insert into EPISODIO_ENTITY values (1, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups and the Kitty-tastrophe', 1,'Ryder and the PAW Patrol save a lost kitty from the bay, only to watch her create mayhem on land. Marshall finally rescues her from high atop City Hall! The kittys owner is overjoyed that Ryder and the PAW Patrol returned her precious pet!',1);
insert into EPISODIO_ENTITY values (2, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Save a Train', 2,'A rock slide has trapped Katie and Cali on a train on the old trestle bridge! Ryder and the PAW Patrol have to clear the tracks and free the train before more boulders tumble down.',1);
insert into EPISODIO_ENTITY values (3, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pup Pup Boogie', 3,'The PAW Patrol must work quickly to fix the tracks and remove a train car at the train station, before the next train comes. But when Rubble hurts his paw, Ryder has to teach Chase how to use Rubbles digger.',1);
insert into EPISODIO_ENTITY values (4, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups in a Fog', 4,'When the bulb in the Adventure Bay lighthouse goes out, Ryder and the PAW Patrol battle the clock and thick fog as they try to fix the light in time to get their good friend Capn Turbot back home safely.',1);
insert into EPISODIO_ENTITY values (5, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Save the Sea Turtles', 5,'Baby sea turtles were hatching at the other side of the road near the beach. They cant get to the beach without crossing the street, there are cars, skateboarders, scooters and all the hungry naughty seagulls around, not to mention Alexs rambunctious antics. Will the PAW Patrol be able to get them across the road without any danger?',1);
insert into EPISODIO_ENTITY values (6, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups and the Very Big Baby', 6,'A baby whale has beached herself. The PAW Patrol has to rescue her and make sure her mother doesnt get too close. Can they save her and reunite her with her mother?',1);
insert into EPISODIO_ENTITY values (7, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Save the Circus', 7,'Ellie, the baby elephant from the Circus train, has escaped and is loose in Adventure Bay! Now Eunice, her mom, is loose and looking for her. Can the PAW Patrol find Ellie and calm Eunice down?',1);
insert into EPISODIO_ENTITY values (8, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pup a Doodle Do', 8,'Mayor Goodways purse chicken, Chickaletta, is on the loose and the PAW Patrol must find her before its too late for Mayor Goodway and Chickaletta to host Hello, Adventure Bay!.',1);
insert into EPISODIO_ENTITY values (9, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pup Pup Goose', 9,'Marshall gets a new BFF when a gosling named "Fuzzy" takes a liking to him. Ryder and the PAW Patrol have to figure out a way to get Fuzzy to join his flock when they fly south, because he wont leave Marshall!',1);
insert into EPISODIO_ENTITY values (10, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pup Pup and Away', 10,'When Mayor Goodway accidentally takes off in a hot air balloon, Ryder and the PAW Patrol must make a dramatic rescue to save her and win the race!',1);
insert into EPISODIO_ENTITY values (11, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Pit Crew', 11,'The PAW Patrol must help Alex fix his super-trike, and teach him the art of patience and taking things slowly. But when Alex goes too fast the PAW Patrol goes on a high speed chase to save Alex.',1);
insert into EPISODIO_ENTITY values (12, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Fight Fire', 12,'Marshall is going to try to break the record for the Worlds Fastest Fire-Pup. But he accidentally broke his ladder during practice, and now hes not feeling very confident in himself. Can the rest of the PAW Patrol help their droopy pup-pal regain his fiery confidence?',1);
insert into EPISODIO_ENTITY values (13, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Save the Bunnies', 13,'A bunch of adorable bunnies have come to Farmer Yumis carrot patch. The PAW Patrol must catch them all and relocate them to a perfect new home. Can the pups help the bunnies and Farmer Yumi?',1);
insert into EPISODIO_ENTITY values (14, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pup-Tacular', 14,'While the rest of the PAW Patrol are out to rescue Mayor Goodway and Chickaletta and checking the trucks, Rocky must face his aquaphobia so that Katie can enter him in the Pup-Tacular show. If he doesnt, Katie might have to miss it and wait for the Cat-Tacular, which isnt coming anytime soon.',1);
insert into EPISODIO_ENTITY values (15, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Save the Bay', 15,'Theres an oil spill in the bay, and a baby whale swam into the oil. The PAW Patrol must clean up the baby whale and the oil spill before more animals living in Adventure Bay are harmed by it. Can the pups clean it up before any more animals get hurt?',1);
insert into EPISODIO_ENTITY values (16, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Save a Goodway', 16,'Its Great-Great-Great-Great-Grandpa Grover Day, and Mayor Goodway has been planning anxiously for todays celebration. She sent the statue of her Great-Great-Great-Great-Grandfather, Grover Goodway to be cleaned. However, on the way back from the cleaners, the statue fell in Adventure Bay. The PAW Patrol must dive down to the bottom to get the statue.',1);
insert into EPISODIO_ENTITY values (17, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Get a Rubble', 17,'This episode is a flashback story of how Rubble joined the PAW Patrol. Rubble must help Jake when he gets trapped in an avalanche.',1);
insert into EPISODIO_ENTITY values (18, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Save A Walrus', 18,'The playful walrus, Wally, was performing tricks for Capn Turbot, but he eventually gets himself tangled in a fishing net during one of his tricks. The PAW Patrol must rescue him before he drowns.',1);
insert into EPISODIO_ENTITY values (19, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Save the Treats', 19,'On a snow and icy day, Mr. Porters van ends up sliding on ice. If the ice cracks, it will fall into the bottom of the bay, and inside of the truck has all the pups treats and food in it! Can Ryder, Zuma, and Chase save the truck before they break the ice?',1);
insert into EPISODIO_ENTITY values (20, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Get a Lift', 20,'Katie and Cali are stuck on Jakes Mountain. Rubble wants Ryder to pick him but he picks Marshall and Rocky. Rubble becomes sad. Later on, Rubble is chosen to make a staircase to get Katie and Cali down because the hill is too steep for Marshalls truck.',1);
insert into EPISODIO_ENTITY values (21, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Save a Hoedown', 21,'The PAW Patrol are having a great time at the Adventure Bay Hoedown, but trouble starts to brew when Farmer Als cows get spooked out and are on the loose in Adventure Bay. Can the PAW Patrol get the cows back to safety before they stampede into the hoedown?',1);
insert into EPISODIO_ENTITY values (22, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Save Alex', 22,'While Cali is playing with her favorite toy on Farmer Yumis farm, she gets stuck on the top of the silo, which is not safe. The PAW Patrol must help the frightened cat before she falls, and only Alex has the solution.',1);
insert into EPISODIO_ENTITY values (23, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups and the Ghost Pirate', 23,'A Halloween party turns into a spooky time when theres a ghostly figure roaming around on a ship. Can the PAW Patrol solve the paranormal mystery and save the Halloween party?',1);
insert into EPISODIO_ENTITY values (24, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Save a School Day', 24,'Its Alexs first day of school, but he has lost his backpack! So the PAW Patrol agrees to help him find it. Easier said than done when Alex says that his backpack could be in many places around Adventure Bay, prompting all the pups to be deployed to all corners of the city, not to mention they have limited time before the school bus arrives. Can the PAW Patrol get the backpack before the school bus picks Alex up?',1);
insert into EPISODIO_ENTITY values (25, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Turn on the Lights', 25,'Its Chases birthday and the other pups and Katie are setting up Chases surprise birthday party at Katies Clinic. But their hopes for a surprise is on the line when a strong wind breaks the blade of the windmill on the wind turbine, causing a blackout. Can the PAW Patrol get the power back on in time for Chases surprise birthday party?',1);
insert into EPISODIO_ENTITY values (26, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Save a Pool Day', 26,'Its a hot day and the pups head for the water park, but the pool is empty! The water tower that pumps water into the pool is tilted and has a bent pipe. Can the PAW Patrol fill the pool so everyone can enjoy their day?',1);
insert into EPISODIO_ENTITY values (27, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Circus Pupformers', 27,'The PAW Patrol, for the first time must all work together to help Eunice and Ellie save the circus when most of the performers are late. Can the PAW Patrol help them?',1);
insert into EPISODIO_ENTITY values (28, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Make a Splash', 28,'Capn Turbots boat has crashed into a rock and is sinking! Ryder and the PAW Patrol leap into action. As Ryder and Zuma tow the boat to safety, Rocky and Skye team up to patch it so it stays afloat long enough to get it to the dock. Everyone stays high and dry - except Rocky!',1);
insert into EPISODIO_ENTITY values (29, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Fall Festival', 29,'No hay resumen disponible',1);
insert into EPISODIO_ENTITY values (30, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Save Christmas', 30,'Santas sleigh crashes and breaks in a snowstorm on Christmas Eve, and all of the presents are scattered across Adventure Bay. Its up to the PAW Patrol to fix the sleigh, round up the reindeer, find the presents, find the magic star, and most of all, save Christmas for Adventure Bay.',1);
insert into EPISODIO_ENTITY values (31, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups on Ice', 31,'The snowy days have returned to Adventure Bay, and the pups decide to go to Jakes mountain to go snowboarding. However, Jake and Alex end up between a "rock and cold place." Can the PAW Patrol rescue them? If they dont hurry, Ryder could fall on them. Will they get Alex up?',1);
insert into EPISODIO_ENTITY values (32, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups and the Snow Monster', 32,'Theres a mystery at Jakes mountain, and its scaring away all the people who came to ski. The PAW Patrol must find out who or what left strange snow tracks. Could it be a Snow Monster? If they dont find what it is, they might have to close the slopes forever!',1);
insert into EPISODIO_ENTITY values (33, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Save a Super Pup', 33,'Rubble pretends to be "Apollo the Super-Pup", a superhero pup on TV who saves the day by himself. But his superhero phase gets him and the train engineer trapped in a tunnel behind a rock slide. Can the PAW Patrol save the train, the conductor, and Rubble?',1);
insert into EPISODIO_ENTITY values (34, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Save Ryders Robot', 34,'When Ryders new robot pup goes haywire, the pups must stop it so Ryder can fix it. If they dont hurry, bad things could happen.',1);
insert into EPISODIO_ENTITY values (35, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Save a Hoot', 35,'The PAW Patrol must save Mama Hootie before the tree she is in falls in the bay. Will the PAW Patrol help save Little Hooties Mama?',1);
insert into EPISODIO_ENTITY values (36, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Go All Monkey', 36,'A monkey named Mandy has escaped the train car that is supposed to be taking her to the jungle. She is now driving Mr. Porters van around Adventure Bay, and its up to the PAW Patrol to catch her.',1);
insert into EPISODIO_ENTITY values (37, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Save a Toof', 37,'Chases tooth gets loose, but he doesnt want to see the dentist because he is scared. Meanwhile, Alex must visit the dentist, but hes afraid too, so the pups and Ryder help him face his fear by showing him their own fears.',1);
insert into EPISODIO_ENTITY values (38, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Save a Bat', 38,'A baby bat takes a nap inside of a bell, and the pups try to rescue it without awakening it. The PAW Patrol chase it around Adventure Bay and try to save it.',1);
insert into EPISODIO_ENTITY values (39, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Save the Easter Egg Hunt', 39,'Its Adventure Bays annual Easter Egg Hunt and the pups are helping Mayor Goodway with the egg decorating. The hunt for a very special egg leads Ryder and the PAW Patrol on an exciting adventure.',1);
insert into EPISODIO_ENTITY values (40, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups and the Lighthouse Boogie', 40,'Mayor Goodway and Alex take a rowboat out into the bay to get a closer look at a narwhal whale. A storm is approaching though and the rowboat drifts out of control towards the sea. Its up to the PAW Patrol to rescue them!',1);
insert into EPISODIO_ENTITY values (41, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Save Ryder', 41,'While out on a hike, Ryder discovers that Garbie the goat is stuck on the edge of a cliff! He attempts to rescue Garbie, but gets stranded himself in the process. He calls the pups for help, but Garbie kicks his pup-pad down the cliff side! Now the pups have to save Ryder... all on their own!',1);
insert into EPISODIO_ENTITY values (42, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Great Race', 42,'Its Adventure Bay Race Day and the pups are about to race each other all across the town to see who is the fastest pup. One other competitor unexpectedly shows up though: Alex in his super trike!',1);
insert into EPISODIO_ENTITY values (43, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Take the Cake', 43,'Mr. Porter enters a cake competition and needs Ryder and the pups to help him bake the biggest and tastiest cake. The race is on to get their cake baked and to the competition on time!',1);
insert into EPISODIO_ENTITY values (44, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups and the Beanstalk', 44,'In a dream one of the pups has, Alex is a giant and, without meaning any harm, causes it around Adventure Bay, so the PAW Patrol has to keep him busy and get him back up the beanstalk.',1);
insert into EPISODIO_ENTITY values (45, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Save the Turbots', 45,'Capn Turbot needs to get a picture of the rare blue-footed booby bird. His French cousin, Francois Turbot, decides to help but gets caught on a cliff! Its up to the PAW Patrol to rescue him and bring the two cousins together again.',1);
insert into EPISODIO_ENTITY values (46, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Save the Camping Trip', 46,'Mayor Goodway, Chickaletta, Rocky, and Skye go camping to earn their Pup Scouts badges, but while searching for berry bushes, Chickaletta falls into a cave! Its up to the PAW Patrol to save their feathered friend!',1);
insert into EPISODIO_ENTITY values (47, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups and the Trouble with Turtles', 47,'Tons of baby turtles are popping up all over the Lookout. Can the PAW Patrol help get them back to their homes before they get hurt?',1);
