insert into EPISODIO_ENTITY values (91, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Save the Woof and Roll Show', 44,'Luke Stars is coming to Adventure Bay! The whole town is looking forward to the pop stars show, especially Rubble and a star struck Mayor Goodway. On the big day, the pups wake up to a mess as a storm has blown the whole town apart, including the stage. The Paw Patrol is busy at work fixing the stage and corralling the eager audience when Luke calls to say the bridge is out. Ryder sends Zuma and Skye to airlift Luke and his equipment from one side of the bridge to safety of Ryders ATV, then to the stage where he wows the audience, with a little help from Rubble.',1);
insert into EPISODIO_ENTITY values (92, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Save an Eagle', 45,'While enjoying a hike in the woods, Mayor Goodways backpack slips down the side of a cliff, with Chickaletta in it! The backpack is perched way out on a limb, with an eagles nest not far away and Mayor Goodway is sure Chickaletta will be the eagles lunch! Ryder calls Chase to winch the backpack and EMT Marshall just in case the chicken falls. No sooner do the pups rescue Chickaletta than they discover the eagle is caught in twine and tied to her own nest. Skye swallows all her fear and rescues the eagle by executing some sneaky maneuvers to get close enough to bite the twine to free the majestic bird. That pups gotta fly!',1);
insert into EPISODIO_ENTITY values (93, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pups Bark with Dinosaurs', 46,'The Paw Patrol is on a big excavation dig in the jungle with Capn Turbot looking for dinosaur fossils when they unearth 3 fossilized eggs. Before they know whats happening the eggs start to hatch and there are three baby pterodactyls running around Adventure Bay! Its all paws on board for this rescue as Ryder sends the pups to catch the dinos. Just as theyre doing that Mayor Goodway and Mr. Porter call to report a Utahraptor is destroying Mr. Porters restaurant, and eating everything in sight! And as soon as they get this news, another call comes in, theres a Triceratop on the railway tracks!! Paw Patrol is on a Roll. Rubble befriends and coaxes the baby Triceratop off the tracks and even gets that dino to help rescue one of the baby pterodactyls. As Chase, Skye and Marshall collect the other two hatchlings, Rocky rigs his peanut dispenser to deploy liver sausages luring the hungry Utahraptor home to the jungle. Soon all the prehistoric creatures are back where they should be,',1);
insert into EPISODIO_ENTITY values (94, 15, 'https://static.tvmaze.com/uploads/images/medium_portrait/448/1121194.jpg', 'Pup-Fu!', 47,'Sensei Yumi is teaching all the pups the ancient art of Pup-Fu. The Paw Patrol and the mischievous kittens from Mayor Humdingers Kit-tastrophe Crew are both competing for their belts when they come across an ancient scroll that holds all the secrets of the art. Mayor Humdinger steals the scroll and the Paw Patrol is called upon to find and return it to back to Sensei Yumi. It can be dangerous in the wrong hands, so Chases drone tracks the sneaky Mayor to his secret lair, while Zuma helps them enter by a hidden cave in the water. Super Pup-Fu student Marshall sneaks in quiet as a mouse and together they get the scroll back where its supposed to be.',1);
