insert into EPISODIO_ENTITY values (424, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/8/21463.jpg', 'Rites of Passage', 1,'A Viking warrior seeks approval from his communitys leader in the opener of this series chronicling the medieval adventures of a band of Norsemen.',2);
insert into EPISODIO_ENTITY values (425, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/8/21464.jpg', 'Wrath of the Northmen', 2,'Ragnar gathers a crew in preparation for an epic journey; the earl is overcome with paranoia.',2);
insert into EPISODIO_ENTITY values (426, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/8/21465.jpg', 'Dispossessed', 3,'Ragnar and his crew raid a monastery, securing a bounty of riches that impresses the earl.',2);
insert into EPISODIO_ENTITY values (427, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/363/907717.jpg', 'Trial', 4,'The Vikings return to England; the earl plants a spy within Ragnars crew.',2);
insert into EPISODIO_ENTITY values (428, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/8/21466.jpg', 'Raid', 5,'A prophet predicts the earls future; Ragnars home and farm are destroyed.',2);
insert into EPISODIO_ENTITY values (429, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/8/21467.jpg', 'Burial of the Dead', 6,'Ragnar faces off with the Earl after learning of Rollos torture.',2);
insert into EPISODIO_ENTITY values (430, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/8/21472.jpg', 'A Kings Ransom', 7,'Ragnar presents a proposal to King Aelle.',2);
insert into EPISODIO_ENTITY values (431, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/8/21469.jpg', 'Sacrifice', 8,'Ragnar attempts to cope with the death of his unborn son; Lagertha seeks answers from the gods.',2);
insert into EPISODIO_ENTITY values (432, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/8/21470.jpg', 'All Change', 9,'Ragnar attempts to settle a land dispute; a plague breaks out.',2);
insert into EPISODIO_ENTITY values (433, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/44/111364.jpg', 'Brothers War', 1,'A battle begins, pitting Ragnar and King Horiks forces against Jarl Borg and Rollo in the Season 2 premiere. Meanwhile, Princess Aslaug arrives in Kattegat with a surprise that leaves Ragnar in a difficult predicament.',2);
insert into EPISODIO_ENTITY values (434, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/44/111366.jpg', 'Invasion', 2,'An unlikely alliance plans a raid on England; Ragnar and his men face off against a formidable foe.',2);
insert into EPISODIO_ENTITY values (435, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/44/111367.jpg', 'Treachery', 3,'King Ecbert faces a new foe; Ragnar races to dominate in the West.',2);
insert into EPISODIO_ENTITY values (436, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/44/111368.jpg', 'Eye for an Eye', 4,'Ragnar and Ecbert meet face-to-face; Rollo is forced to become a leader.',2);
insert into EPISODIO_ENTITY values (437, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/44/111369.jpg', 'Answers in Blood', 5,'Lagertha and Ragnar unite to battle Jarl Borg. Later, Bjorn makes a difficult choice.',2);
insert into EPISODIO_ENTITY values (438, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/44/111370.jpg', 'Unforgiven', 6,'King Horik presents a surprising proposition to Ragnar; Athelstan becomes confidant to King Ecbert.',2);
insert into EPISODIO_ENTITY values (439, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/44/111371.jpg', 'Blood Eagle', 7,'Ragnar and King Horik clash over how to punish Jarl Borg. Meanwhile, Ecbert eyes a new alliance.',2);
insert into EPISODIO_ENTITY values (440, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/44/111372.jpg', 'Boneless', 8,'Aslaug prepares to give birth; Ragnar, Horik and Lagertha set sail for Wessex.',2);
insert into EPISODIO_ENTITY values (441, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/44/111373.jpg', 'The Choice', 9,'Ragnars men are engaged in battle while marching to King Ecberts villa.',2);
insert into EPISODIO_ENTITY values (442, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/44/111374.jpg', 'The Lords Prayer', 10,'Ragnar and King Horik return to Kattegat in the Series 2 finale. Meanwhile, new alliances are formed.',2);
insert into EPISODIO_ENTITY values (443, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/44/111672.jpg', 'Mercenary', 1,'King Ecbert proposes a deal to the Vikings in the Season 3 premiere. Later, Ragnar leads his forces into battle.',2);
insert into EPISODIO_ENTITY values (444, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/44/111686.jpg', 'The Wanderer', 2,'Lagertha and Athelstan help to establish the Viking settlement in Wessex. Harbard, a mysterious wanderer, arrives in Kattegat, realizing the forewarned dreams of Aslaug, Siggy and Helga.',2);
insert into EPISODIO_ENTITY values (445, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/44/111954.jpg', 'Warriors Fate', 3,'King Ecbert visits the developing Viking settlement as the first harvest is sown and rebuffs criticism from his leading nobles. In Mercia, the Wessex/Viking forces charge at the battle at the Hill of the Ash. In Kattegat, Harbard arrives in to the Great Hall and his mysterious aura fascinates Aslaug and Helga but Siggy remains suspicious. There are strange and tragic happenings in Kattegat, and Siggy suspects Harbard is the cause.',2);
insert into EPISODIO_ENTITY values (446, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/44/112382.jpg', 'Scarred', 4,'The victorious Wessex/Viking forces return to Wessex but there is rancour in the Viking camp–Floki is angry over the alliance with Ecbert and resentful the influence that he feels Athelstan has over Ragnar. Princess Kwenthrith makes some calculating political moves following the battle at the Hill of the Ash in Mercia. Visitors from the past arrive in Hederby, at Kalfs invitation.',2);
insert into EPISODIO_ENTITY values (447, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/45/112689.jpg', 'The Usurper', 5,'The fleet returns to Kattegat to find tragic circumstances await. Lagertha learns that her Earldom has been usurped and convinces Ragnar to travel to Hederby with her in an effort to reclaim her title. Ragnar causes great surprise when he announces the next raid. The Seer has interesting prophecies for Rollo.',2);
insert into EPISODIO_ENTITY values (448, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/45/112707.jpg', 'Born Again', 6,'Preparations for the Paris raid pick up pace, and Rollo ponders the Seers prophecy about his destiny. Kalf arrives in Kattegat to join the raid and the Viking fleet sails up the Seine and catches sight of Paris for the first time. Porunn and Judith both deliver children, and with new life there is also death.',2);
insert into EPISODIO_ENTITY values (449, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/45/112972.jpg', 'Paris', 7,'The appearance of the Viking fleet causes panic among the population of Paris. The Emperor Charles, urged by his daughter Gisla, announces in Court he will remain in the city. The defense of Paris is in the hands of its Commander, Count Odo, who hopes that a heroic victory against the Vikings will gain him Gislas hand in marriage. The Vikings establish camp downriver from the city and plan their attack.',2);
insert into EPISODIO_ENTITY values (450, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/45/112989.jpg', 'To the Gates!', 8,'The Viking army embarks and Paris goes into lockdown as the army prepares the defense, overseen by Odo. The Vikings are determined to make it through the gates of Paris and will stop at nothing to succeed.',2);
insert into EPISODIO_ENTITY values (451, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/45/114097.jpg', 'Breaking Point', 9,'The Vikings go all out for a second assault on Paris. Recognizing the desperate state of affairs for his city, Emperor Charles must make a difficult decision. In Wessex, Judith is compelled to make a difficult decision of her own.',2);
insert into EPISODIO_ENTITY values (452, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/45/114118.jpg', 'The Dead', 10,'With one last chance to take Paris, Ragnar and his Viking troops take a daring chance. Ragnar asks Bjorn for a favor that could change the course of Viking history.',2);
insert into EPISODIO_ENTITY values (453, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/45/113398.jpg', 'A Good Treason', 1,'Entry to Valhalla eludes Ragnar but as he lies in his sick bed in Kattegat events unfold beyond his control. Bjorn orders the arrest of Floki for Athelstans murder and in Paris, Rollo betrays his allies to strengthen his position. Meanwhile, in Hedeby, Kalf announces joint Earldom with Lagertha, but is Lagertha actually willing to share what once was hers?',2);
insert into EPISODIO_ENTITY values (454, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/46/116604.jpg', 'Kill the Queen', 2,'Floki hopes to escape from Ragnar and Kattegat. Rollo makes great efforts in Paris to win over his new bride, Princess Gisla. King Ecbert orders his son Aethelwulf to rescue Queen Kwenthrith from opposing forces in Mercia.',2);
insert into EPISODIO_ENTITY values (455, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/40/100831.jpg', 'Mercy', 3,'Floki faces the wrath of Ragnar. Intrigue prevails in the French Court as Rollo finds an unlikely ally. Kalf and Erlendur plot their ascent. Bjorn must fight a fierce opponent in the wilderness.',2);
insert into EPISODIO_ENTITY values (456, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/40/100833.jpg', 'Yol', 4,'The Yule Log burns in the Great Hall in Kattegat and mysterious visitors are welcomed, among them a Norwegian King. King Aelle visits Wessex for Christmas and is concerned with how family relations are developing. In Paris, Rollos future hangs in the balance - can he win over his new bride, Gisla, as a Papal Delegation arrives to arrange a divorce?',2);
insert into EPISODIO_ENTITY values (457, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/49/123323.jpg', 'Promised', 5,'Theres an air of betrayal at Court in Paris and in Wessex. Ecbert agrees to support Kwenthrith in Mercia, but is Ecbert a true ally? Ragnar confides in Yidu his darkest secret. Happiness comes to Lagertha and Kalf and a marriage is arranged.',2);
insert into EPISODIO_ENTITY values (458, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/50/125401.jpg', 'What Might Have Been', 6,'Ragnar announces a raid on Paris at the Thing in Kattegat. The fleet is battered by a storm after it sets sail, but the greatest challenge for the Vikings lies ahead in Paris, where Rollo awaits. Meanwhile, Ecbert dispatches Aethelwulf and Alfred on a pilgrimage to Rome.',2);
insert into EPISODIO_ENTITY values (459, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/50/126316.jpg', 'The Profit and the Loss', 7,'On the Seine, the Vikings attack with considerable force but can they breach Rollos defenses? Meanwhile, Harbard, the mysterious wanderer, returns and causes a stir amongst the women of Kattegat.',2);
insert into EPISODIO_ENTITY values (460, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/51/129427.jpg', 'Portage', 8,'The Vikings call Ragnars leadership into question. Ragnar himself remains inscrutable and orders the fleet to beach at a cliff face where he unveils an ingenious plan. Rollo and Gisla have news that strengthens Rollos position at the French Court.',2);
insert into EPISODIO_ENTITY values (461, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/364/910270.jpg', 'Death All Round', 9,'The labours of the Vikings bear fruit as, within sight of Paris, they re-launch their fleet but this time with some formidable new structures that Floki has engineered. Aethelwulf and Alfred arrive in Rome and honours are conferred by Pope Leo. Relations are not so cordial in Wessex.',2);
insert into EPISODIO_ENTITY values (462, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/364/910271.jpg', 'The Last Ship', 10,'A fierce battle between the Vikings and the French eventually comes down to Ragnar against Rollo and the outcome seals the fates of the two brothers.',2);
insert into EPISODIO_ENTITY values (463, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/82/206241.jpg', 'The Outsider', 11,'Ragnar has returned to Kattegat and there are secrets to be revealed. He makes plans to return to Wessex to right past wrongs but finds that those who were once his closest allies now have plans of their own. Even the Lothbrok sons refuse to join their fathers mission – except one.',2);
insert into EPISODIO_ENTITY values (464, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/82/206230.jpg', 'The Vision', 12,'The Kattegat locals chide Ragnar that the gods have deserted him as he struggles to crew his voyage to Wessex. Its Bjorn who has charisma now as he prepares to fulfill his long-held dream to explore the Mediterranean in a sleek new boat built for him by Floki. By contrast, Ragnar must accept weathered boats and a crew he has bribed but when Aslaug foresees that the fleet will be lost in a vicious storm her warnings go un-heeded by Ragnar and her precious son, Ivar.',2);
insert into EPISODIO_ENTITY values (465, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/89/223066.jpg', 'Two Journeys', 13,'Ragnars fleet is shipwrecked and washes up on the Wessex coast, but without enough survivors to form a credible force, Ragnar and Ivar have a difficult decision to make. Rollo meets his Viking comrades again and cant resist the urge to join Bjorns voyage, risking his marriage and his new Frankish identity. Ragnar too is taking a risk as he carries Ivar towards the Royal Villa in Wessex – throwing himself and his son upon the mercy of King Ecbert.',2);
insert into EPISODIO_ENTITY values (466, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/90/225619.jpg', 'In the Uncertain Hour Before the Morning', 14,'Lagertha attempts to fulfill a long-held ambition. Ragnar negotiates an unexpected concession from King Ecbert.',2);
insert into EPISODIO_ENTITY values (467, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/90/225745.jpg', 'All His Angels', 15,'Ragnar and Ivar plot against the Saxons and reach a new level of understanding.',2);
insert into EPISODIO_ENTITY values (468, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/92/230034.jpg', 'Crossings', 16,'Bjorns fleet sails onward and launches a surprise attack; back in Kattegat, Lagertha continues in her quest for power.',2);
insert into EPISODIO_ENTITY values (469, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/93/232684.jpg', 'The Great Army', 17,'The Viking army begins to gather in Kattegat; Lagertha must remain vigilant in the absence of her son, Bjorn.',2);
insert into EPISODIO_ENTITY values (470, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/93/234955.jpg', 'Revenge', 18,'Ragnars plan comes to fruition; the Viking army lands on the coast of Northumbria.',2);
insert into EPISODIO_ENTITY values (471, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/96/240406.jpg', 'On the Eve', 19,'The Viking army causes panic in the English countryside as King Ecbert and Aethelwulf plan the defense of the realm.',2);
insert into EPISODIO_ENTITY values (472, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/96/241720.jpg', 'The Reckoning', 20,'Prince Aethelwulf finds himself subject to the Vikings battle master plan; Ecbert remains behind with a plan of his own.',2);
insert into EPISODIO_ENTITY values (473, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/136/342356.jpg', 'The Fisher King', 1,'Tensions mount between the sons of Ragnar Lothbrok as the Vikings continue to threaten the very heart of England. As the Great Army moves to take York, with King Aethelwulf and his family still in hiding, Heahmund, the warrior bishop, must rally the Saxons to defend the Realm.',2);
insert into EPISODIO_ENTITY values (474, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/136/342355.jpg', 'The Departed', 2,'As the Vikings establish their stronghold in York, Ivar is determined to lead the Great Army. In Kattegat, Lagertha misjudges King Harald and pays a heavy price. Floki arrives at a mysterious land.',2);
insert into EPISODIO_ENTITY values (475, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/137/344275.jpg', 'Homeland', 3,'Celebrations are cut short in the aftermath of the battle at York. Ragnar Lothbroks sons are pitted against each other as tensions reach an all-time high and each is forced to choose a side.',2);
insert into EPISODIO_ENTITY values (476, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/138/346240.jpg', 'The Plan', 4,'Guided by Bishop Heahmunds visions, the Saxons devise a battle plan. Ivar the Boneless strategizes on his own as the Vikings undergo increasing pressure. Bjorn Ironside finds himself in a new territory and must convince the local commander he is a trader and not a raider.',2);
insert into EPISODIO_ENTITY values (477, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/349466.jpg', 'The Prisoner', 5,'Ivar meets his match in Bishop Heahmund, while Floki returns to Kattegat and Bjorn receives a lavish welcome in North Africa.',2);
insert into EPISODIO_ENTITY values (478, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/140/350537.jpg', 'The Message', 6,'Lagertha is betrayed and Bjorn must find a way to support the distraught queen. Floki and his settlers arrive in a new land but it is far from what they expected.',2);
insert into EPISODIO_ENTITY values (479, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/141/353094.jpg', 'Full Moon', 7,'Bjorn returns to Kattegat to learn that an attack is to take place during the next full moon. Ivar must decide if he can place his trust in a former enemy on the battlefield.',2);
insert into EPISODIO_ENTITY values (480, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/142/355486.jpg', 'The Joke', 8,'The battle for Kattegat begins; as the two armies line up to fight, the Great Heathen Army must decide between a final plea for peace or all-out war; Floki faces discord among the settlers.',2);
insert into EPISODIO_ENTITY values (481, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/142/356959.jpg', 'A Simple Story', 9,'The army leaders consider their options in the aftermath of the battle; in Flokis camp, all hopes of binding the community together are dashed as tragedy unfolds.',2);
insert into EPISODIO_ENTITY values (482, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/143/359172.jpg', 'Moments of Vision', 10,'A sense of doom looms over Kattegat as bloodshed ensues; the defeated army flees in the face of the victors, and a legendary warrior makes his way home.',2);
insert into EPISODIO_ENTITY values (483, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/176/440028.jpg', 'The Revelation', 11,'Ivar is crowned the new king of Kattegat just in time to welcome Rollo home. Bjorn, Lagertha, and Ubbe must rely on unsteady alliances to survive.',2);
insert into EPISODIO_ENTITY values (484, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/176/441479.jpg', 'Murder Most Foul', 12,'Bjorn, Lagertha, and Ubbe face an uncertain fate as Heahmunds loyalty is tested. In Iceland, Floki fights to understand the will of the gods. In Kattegat, Ivar may have met his match.',2);
insert into EPISODIO_ENTITY values (485, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/177/442887.jpg', 'A New God', 13,'Heahmund must try to convince King Alfred that his actions are in defense of the Crown. Ubbe and Torvi strengthen the position of the Vikings but not all in the Viking camp support their strategy. Another settler disappears in Iceland.',2);
insert into EPISODIO_ENTITY values (486, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/177/444910.jpg', 'The Lost Moment', 14,'As the celebrations for Ivar continue in Kattegat, grief hits Iceland, and Floki must now make a fated decision. Haralds army approaches Wessex. A conspiracy grows against King Alfred in Court.',2);
insert into EPISODIO_ENTITY values (487, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/178/446239.jpg', 'Hell', 15,'Bishop Heahmund is wracked with guilt as he fights to renounce his passions. Viking will clash with Saxon on the battlefield leaving a key figure lost in the balance.',2);
insert into EPISODIO_ENTITY values (488, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/179/447793.jpg', 'The Buddha', 16,'Bjorn achieves one of Ragnars dreams. Back in Kattegat, Ivar hatches a new plan while preparing for a divine arrival. In Iceland, a settler returns in a terrible state. King Alfred faces his greatest threat yet.',2);
insert into EPISODIO_ENTITY values (489, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/179/449086.jpg', 'The Most Terrible Thing', 17,'An unexpected turn amongst the settlers leaves Floki powerless. King Alfred confronts Judith. In York, Bjorn must strike a deal with Harald. Wessex is once again threatened by a Viking force, but who will lead the Saxon army to defend the Realm?',2);
insert into EPISODIO_ENTITY values (490, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/180/450723.jpg', 'Baldur', 18,'Hvitserk is severely tested. Floki makes an amazing discovery. Freydis gives Ivar a surprise. Ubbe negotiates with the three Danish Kings that have massed their armies in Reading, but the negotiations may have a perilous outcome.',2);
insert into EPISODIO_ENTITY values (491, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/181/453211.jpg', 'What Happens in the Cave', 19,'Ubbe is forced into hand-to-hand combat. Floki reaches new depths and is met by a shocking sight. Bjorn sets off for Scandinavia with an old rival.',2);
insert into EPISODIO_ENTITY values (492, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/182/455382.jpg', 'Ragnarok', 20,'A new battle for Kattegat is on and only the gods know who will emerge victorious.',2);
insert into EPISODIO_ENTITY values (493, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/229/574383.jpg', 'New Beginnings', 1,'Its six months after the battle of Kattegat and Bjorn is now King. But as he struggles with the responsibilities of kingship, he finds he cant rely on his mother, Lagertha--she has other plans. But can Lagertha lead a quieter life and leave her days as a shield-maiden behind? Ivar falls into the hands of the Kievan Rus, and in their ruthless and unpredictable ruler, Prince Oleg, he may finally have met his match. Intrigued by Ivars claims to be a god, Oleg decides to put him to the test.',2);
insert into EPISODIO_ENTITY values (494, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/229/574381.jpg', 'The Prophet', 2,'Messengers arrive in Kattegat with news that presents Bjorn with a dilemma. As Bjorn attempts to do the right thing as ruler of Kattegat, Prince Oleg of Kiev seems untroubled by his conscience. Even Ivar is shocked by Olegs vicious character as he wrestles for control over the young heir to the throne of the Rus Empire. Lagertha has settled into her new, peaceful life, but danger lurks nearby.',2);
insert into EPISODIO_ENTITY values (495, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/231/577589.jpg', 'Ghosts, Gods and Running Dogs', 3,'Lagertha is visited by women from the nearby villages and they feast together happily but the community is shattered by shocking events that follows and Lagertha is forced to take action. In Kiev, although Oleg continues to be friendly, Ivar is aware of the threat which Oleg poses, not only to himself, but to the vulnerable young heir to the throne. Bjorn has answered the call and come to the aid of an old enemy, but all is not as it seems and disaster looms for Bjorns forces.',2);
insert into EPISODIO_ENTITY values (496, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/232/580405.jpg', 'All the Prisoners', 4,'Lagertha leads her villages response to the recent attacks but despite her best efforts, when the inevitable attack comes, the consequences are tragic. Olaf has a bold new plan for the future of Norway. In Kiev, although Ivar discusses Olegs ambitions for Scandinavia, hes actually more interested in the plight of Igor, the young heir who Oleg controls.',2);
insert into EPISODIO_ENTITY values (497, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/233/584607.jpg', 'The Key', 5,'King Olaf feels confident about the result of the election of the King of all Norway as the kings and jarls visit Haralds territory; Lagerthas village is abuzz due to bandit attacks; Ivar is forced to confront an unfortunate element of his past.',2);
insert into EPISODIO_ENTITY values (498, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/235/587675.jpg', 'Death and the Serpent', 6,'Bjorn is forced to act quickly in the aftermath of the election for the King of all Norway. The bandits attack Lagerthas village again, confident of victory. But when the defense boils down to single combat with Lagertha, victory for the bandits looks less certain. Back in Kattegat, haunted and paranoid, Hvitserk continues to unravel.',2);
insert into EPISODIO_ENTITY values (499, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/236/590626.jpg', 'The Ice Maiden', 7,'Bjorn comes back to Kattegat; Harald manages to acquire a semblance of revenge against Olaf; Ivar and Igor learn information about Prince Dir while in Kiev.',2);
insert into EPISODIO_ENTITY values (500, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/237/593832.jpg', 'Valhalla Can Wait', 8,'Bjorn is confronted by a difficult choice to make; Ubbe and Torvi embark on a search for old friends and new lands after they leave Kattegat; Olegs preparations for invading Scandinavia go as planned while King Harald investigates the raiding party.',2);
insert into EPISODIO_ENTITY values (501, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/238/597193.jpg', 'Resurrection', 9,'In Iceland, Ubbe and Torvi finally meet a mysterious wanderer. Bjorn is forced to re-think who his enemies are when Erik returns from a scouting mission with worrying information. Bjorn will need allies, but can he convince his old foe, King Harald, to join forces in the face of the new threat? Ivar is reunited with someone close to him.',2);
insert into EPISODIO_ENTITY values (502, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/239/599589.jpg', 'The Best Laid Plans', 10,'Ivar and Igor may be plotting against Oleg, but theyre still part of the force that departs Kiev to invade Scandinavia. King Harald and King Bjorn begin furious preparations for the invasion. But can enough be done to resist the Rus force?',2);
insert into EPISODIO_ENTITY values (503, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/291/728211.jpg', 'King of Kings', 11,'In Iceland, Ubbe learns the truth about Kjetill and has a difficult decision to make. Back in Norway, the battle against the Rus has had grave consequences. But re-enforcements have arrived, and Bjorn has an idea that may yet save the day.',2);
insert into EPISODIO_ENTITY values (504, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/291/728203.jpg', 'All Change', 12,'The mood has changed when the Rus army returns to Kiev and Oleg isolates Ivar. But Dir confirms that hes mustering a force to overthrow Oleg and Ivar is part of the plan. Ubbe and a group of settlers depart Iceland, in search of the Golden Land.',2);
insert into EPISODIO_ENTITY values (505, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/291/728204.jpg', 'The Signal', 13,'Its Election Day in Kattegat and all eyes are on the voting. But strangers arriving at the harbor may force an unexpected outcome. Meanwhile, Ivar receives the signal from Prince Dir that his forces are ready to challenge Oleg.',2);
insert into EPISODIO_ENTITY values (506, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/291/728206.jpg', 'Lost Souls', 14,'Prince Igor receives a heros welcome in Novgorod but back in Kiev the mood is darker: Prince Oleg will not be giving up the fight. Meanwhile, Ubbes settlers are overjoyed to find land, but its not the Golden Land they expected.',2);
insert into EPISODIO_ENTITY values (507, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/291/728207.jpg', 'All At Sea', 15,'A fight erupts in Greenland and Ubbe, Torvi and Othere barely escape with their lives...in a leaking boat with no supplies. And in Kattegat, Gunnhild makes a bold move.',2);
insert into EPISODIO_ENTITY values (508, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/291/728208.jpg', 'The Final Straw', 16,'Out in the open sea, Ubbe and the settlers are at the mercy of the elements. Tension mounts between Ubbe and Othere and when baby Ragnar begins to weaken, its the final straw for Ubbe. Meanwhile, Ivar and Hvitserk return to Kattegat.',2);
insert into EPISODIO_ENTITY values (509, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/291/728252.jpg', 'The Raft of Medusa', 17,'When King Alfred of Wessex hears about the arrival of the sons of Ragnar, with an army, he knows he must take drastic action. So as the Viking army makes camp and lies in wait, Alfred and his army abandon the Royal Villa and march to meet them.',2);
insert into EPISODIO_ENTITY values (510, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/291/728209.jpg', 'Its Only Magic', 18,'Ubbe and the settlers find land, but soon realize theyre not alone. In Wessex, King Alfred has mustered a large force to meet the Vikings. Meanwhile, in Kattegat, Erik realizes that Ingrid has been using her powers against him.',2);
insert into EPISODIO_ENTITY values (511, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/291/728210.jpg', 'The Lord Giveth…', 19,'In the new land, Ubbe and the settlers engage in careful diplomacy when they are surrounded by the locals. In Wessex, the Vikings ambush the Saxon army, but Alfred is convinced the Lord is with his army and refuses to retreat.',2);
insert into EPISODIO_ENTITY values (512, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/291/728243.jpg', 'The Last Act', 20,'The epic saga which began with Ragnar Lothbrok, the first Viking hero to emerge from the mists of myth and legend, comes to an end in a spectacular and shocking series finale which finds tragedy striking in the new land and in England.',2);
