insert into SERIE_ENTITY  values (3, 2011,'https://static.tvmaze.com/uploads/images/medium_portrait/190/476117.jpg', 'Game of Thrones', 'Based on the bestselling book series A Song of Ice and Fire by George R.R. Martin, this sprawling new HBO drama is set in a world where summers span decades and winters can last a lifetime. From the scheming south and the savage eastern lands, to the frozen north and ancient Wall that protects the realm from the mysterious darkness beyond, the powerful families of the Seven Kingdoms are locked in a battle for the Iron Throne. This is a story of duplicity and treachery, nobility and honor, conquest and triumph. In the Game of Thrones, you either win or you die.','https://external-preview.redd.it/PnUSogsjICtBSiZTugVGrX-BPiBv8-xXfzl5iaTAX3I.jpg?auto=webp&s=02a9a44d48481df75490f2ed4eba9e8c45f3b7f3');
