insert into EPISODIO_ENTITY values (513, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/478/1195111.jpg', 'Winter is Coming', 1,'Lord Eddard Stark, ruler of the North, is summoned to court by his old friend, King Robert Baratheon, to serve as the Kings Hand. Eddard reluctantly agrees after learning of a possible threat to the Kings life. Eddards bastard son Jon Snow must make a painful decision about his own future, while in the distant east Viserys Targaryen plots to reclaim his fathers throne, usurped by Robert, by selling his sister in marriage.',3);
insert into EPISODIO_ENTITY values (514, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/478/1195110.jpg', 'The Kingsroad', 2,'An incident on the Kingsroad threatens Eddard and Roberts friendship. Jon and Tyrion travel to the Wall, where they discover that the reality of the Nights Watch may not match the heroic image of it.',3);
insert into EPISODIO_ENTITY values (515, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/478/1195109.jpg', 'Lord Snow', 3,'Jon Snow attempts to find his place amongst the Nights Watch. Eddard and his daughters arrive at Kings Landing.',3);
insert into EPISODIO_ENTITY values (516, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/478/1195107.jpg', 'Cripples, Bastards, and Broken Things', 4,'Tyrion stops at Winterfell on his way home and gets a frosty reception from Robb Stark. Eddards investigation into the death of his predecessor gets underway.',3);
insert into EPISODIO_ENTITY values (517, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/478/1195106.jpg', 'The Wolf and the Lion', 5,'Catelyns actions on the road have repercussions for Eddard. Tyrion enjoys the dubious hospitality of the Eyrie.',3);
insert into EPISODIO_ENTITY values (518, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/478/1195105.jpg', 'A Golden Crown', 6,'Viserys is increasingly frustrated by the lack of progress towards gaining his crown.',3);
