insert into EPISODIO_ENTITY values (521, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/478/1195099.jpg', 'Baelor', 9,'Catelyn must negotiate with the irascible Lord Walder Frey.',3);
insert into EPISODIO_ENTITY values (522, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/478/1195102.jpg', 'Fire and Blood', 10,'Daenerys must realize her destiny. Jaime finds himself in an unfamiliar predicament.',3);
insert into EPISODIO_ENTITY values (523, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/478/1195118.jpg', 'The North Remembers', 1,'War grips the continent of Westeros. As Tyrion Lannister tries to take his strong-willed nephew in hand in Kings Landing, Stannis Baratheon launches his own campaign to take the Iron Throne with the help of a mysterious priestess. In the east, Daenerys must lead her retinue through a desolate wasteland whilst beyond the Wall the Nights Watch seeks the aid of a wildling.',3);
insert into EPISODIO_ENTITY values (524, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/478/1195119.jpg', 'The Night Lands', 2,'Stannis uses Ser Davos to seek out new allies for his war with the Lannisters. On the road north, Arya confides in Gendry. Robb Stark sends Theon Greyjoy to win an alliance with his father and the fierce warriors of the Iron Islands. Cersei and Tyrion clash on how to rule in Kings Landing.',3);
insert into EPISODIO_ENTITY values (525, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/478/1195120.jpg', 'What is Dead May Never Die', 3,'Catelyn Stark treats with King Renly in the hope of winning an alliance. Tyrion undertakes a complex plan in Kings Landing to expose an enemy. At Winterfell, Brans dreams continue to trouble him.',3);
insert into EPISODIO_ENTITY values (526, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/478/1195121.jpg', 'Garden of Bones', 4,'Tyrion attempts to restrain Joffreys cruelty. Catelyn attempts to broker a peace between Stannis and Renly. Daenerys and her followers arrive at the great city of Qarth and hope to find refuge there. Arya and Gendry arrive at Harrenhal, a great castle now under Lannister occupation.',3);
