insert into EPISODIO_ENTITY values (532, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/478/1195128.jpg', 'Valar Morghulis', 10,'Tyrion awakens to a changed situation. King Joffrey doles out rewards to his subjects. As Theon stirs his men to action, Luwin offers some final advice. Brienne silences Jaime; Arya receives a gift from Jaqen; Dany goes to a strange place; Jon proves himself to Qhorin.',3);
