insert into EPISODIO_ENTITY values (586, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1008339.jpg', 'The National Anthem', 1,'Prime Minister Michael Callow faces a huge and shocking dilemma when Princess Susannah, a much-loved member of the Royal Family, is kidnapped.',4);
insert into EPISODIO_ENTITY values (587, 90, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1008340.jpg', 'Fifteen Million Merits', 2,'In the near future, everyone is confined to a life of strange physical drudgery. The only way to escape is to enter the Hot Shot talent show and pray you can impress the judges.',4);
insert into EPISODIO_ENTITY values (588, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1008341.jpg', 'The Entire History of You', 3,'A jealous husband, Liam Foxwell, suspects that his wife was involved with another man. Thanks to an implant that lets anyone play memories back as long and as often as they want, he sets out to confirm his suspicions.',4);
insert into EPISODIO_ENTITY values (589, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1008342.jpg', 'Be Right Back', 1,'When a man named Ash dies, his girlfriend Martha is grief-stricken... until a friend directs her to a service that can create an AI programmed with Ashs online personality. Eventually the software offers Martha a new improvement: a physical body for it to occupy.',4);
insert into EPISODIO_ENTITY values (590, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1008343.jpg', 'White Bear', 2,'A woman, Victoria, wakes up with amnesia and a fellow survivor tells her that nine-tenths of the worlds population have been turned into photo-taking zombies by a mysterious TV signal. To get to safety, they have to evade the sadistic hunters and destroy the White Bear transmitter. However, Victoria soon realizes that something far more sinister is going on.',4);
insert into EPISODIO_ENTITY values (591, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1008344.jpg', 'The Waldo Moment', 3,'An animated blue bear, Waldo, proves surprisingly successful as a third-party candidate. But Jamie Salter, the voice of Waldo, begins to have second thoughts when he learns what the governments of the world intend to use Waldo for.',4);
insert into EPISODIO_ENTITY values (592, 63, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1008347.jpg', 'Nosedive', 1,'A woman desperate to boost her social media score hits the jackpot when shes invited to a swanky wedding. But the trip doesnt go as planned.',4);
insert into EPISODIO_ENTITY values (593, 57, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1008348.jpg', 'Playtest', 2,'An American traveler short on cash signs up to test a revolutionary new gaming system, only to discover the thrills are a little too real.',4);
insert into EPISODIO_ENTITY values (594, 52, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1008349.jpg', 'Shut Up and Dance', 3,'After a virus infects his laptop, a teen faces a daunting choice: carry out orders delivered by text message, or risk having intimate secrets exposed.',4);
insert into EPISODIO_ENTITY values (595, 61, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1008350.jpg', 'San Junipero', 4,'In a seaside town in 1987, a shy young woman and an outgoing party girl strike up a powerful bond that seems to defy the laws of space and time.',4);
insert into EPISODIO_ENTITY values (596, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1008351.jpg', 'Men Against Fire', 5,'After his first battle with an elusive enemy, a soldier begins experiencing unfamiliar sensations and strange technical glitches.',4);
insert into EPISODIO_ENTITY values (597, 89, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1008352.jpg', 'Hated in the Nation', 6,'The death of a journalist at the center of a social media firestorm leads a veteran detective and her tech-savvy apprentice to a chilling discovery.',4);
insert into EPISODIO_ENTITY values (598, 76, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1008353.jpg', 'USS Callister', 1,'Capt. Robert Daly presides over his crew with wisdom and courage. But a new recruit will soon discover nothing on this spaceship is what it seems.',4);
insert into EPISODIO_ENTITY values (599, 52, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1008354.jpg', 'Arkangel', 2,'Worried about her daughters safety, single mom Marie signs up for a cutting-edge device that monitors the girls whereabouts -- and much more.',4);
insert into EPISODIO_ENTITY values (600, 59, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1008355.jpg', 'Crocodile', 3,'Architect Mia scrambles to keep a dark secret under wraps, while insurance investigator Shazia harvests peoples memories of a nearby accident scene.',4);
insert into EPISODIO_ENTITY values (601, 52, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1008356.jpg', 'Hang the DJ', 4,'Paired up by a dating program that puts an expiration date on all relationships, Frank and Amy soon begin to question the systems logic.',4);
insert into EPISODIO_ENTITY values (602, 41, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1008357.jpg', 'Metalhead', 5,'At an abandoned warehouse, scavengers searching for supplies encounter a ruthless foe and flee for their lives through a bleak wasteland.',4);
insert into EPISODIO_ENTITY values (603, 69, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1008358.jpg', 'Black Museum', 6,'On a dusty stretch of highway, a traveler stumbles across a museum that boasts rare criminal artifacts -- and a disturbing main attraction.',4);
insert into EPISODIO_ENTITY values (604, 61, 'https://static.tvmaze.com/uploads/images/medium_landscape/200/502032.jpg', 'Striking Vipers', 1,'When old college friends Danny and Karl reconnect in a VR version of their favorite video game, the late-night sessions yield an unexpected discovery.',4);
insert into EPISODIO_ENTITY values (605, 70, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1008360.jpg', 'Smithereens', 2,'A London rideshare driver ignites an international crisis when he kidnaps a worker from a social media company.',4);
insert into EPISODIO_ENTITY values (606, 67, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1008361.jpg', 'Rachel, Jack and Ashley, Too', 3,'A lonely teen becomes obsessed with a robot doll based on her pop star idol, Ashley O -- just as the real Ashleys life begins to unravel.',4);
insert into EPISODIO_ENTITY values (607, 56, 'https://static.tvmaze.com/uploads/images/medium_landscape/465/1163016.jpg', 'Joan Is Awful', 1,'An average woman is stunned to discover a global streaming platform has launched a prestige TV drama adaptation of her life — in which she is portrayed by Hollywood A-lister Salma Hayek.',4);
insert into EPISODIO_ENTITY values (608, 56, 'https://static.tvmaze.com/uploads/images/medium_landscape/465/1163017.jpg', 'Loch Henry', 2,'A young couple travel to a sleepy Scottish town to start work on a genteel nature documentary – but find themselves drawn to a juicy local story involving shocking events of the past.',4);
insert into EPISODIO_ENTITY values (609, 80, 'https://static.tvmaze.com/uploads/images/medium_landscape/465/1163018.jpg', 'Beyond the Sea', 3,'In an alternative 1969, two men on a perilous high-tech mission wrestle with the consequences of an unimaginable tragedy.',4);
insert into EPISODIO_ENTITY values (610, 42, 'https://static.tvmaze.com/uploads/images/medium_landscape/465/1163019.jpg', 'Mazey Day', 4,'A troubled starlet is dogged by invasive paparazzi while dealing with the consequences of a hit-and-run incident.',4);
insert into EPISODIO_ENTITY values (611, 75, 'https://static.tvmaze.com/uploads/images/medium_landscape/465/1163020.jpg', 'Demon 79', 5,'Northern England, 1979. A meek sales assistant is told she must commit terrible acts to prevent disaster.',4);
