insert into SERIE_ENTITY  values (5, 2019,'https://static.tvmaze.com/uploads/images/medium_portrait/456/1140750.jpg', 'Demon Slayer: Kimetsu no Yaiba', 'Since ancient times, rumors have abounded of man-eating demons lurking in the woods. Because of this, the local townsfolk never venture outside at night. Legend has it that a demon slayer also roams the night, hunting down these bloodthirsty demons. For young Tanjiro, these rumors will soon to become his harsh reality… Ever since the death of his father, Tanjiro has taken it upon himself to support his family. Although their lives may be hardened by tragedy, theyve found happiness. But that ephemeral warmth is shattered one day when Tanjiro finds his family slaughtered and the lone survivor, his sister Nezuko, turned into a demon. To his surprise, however, Nezuko still shows signs of human emotion and thought… Thus begins Tanjiros quest to fight demons and turn his sister human again.','https://images6.alphacoders.com/133/1330846.png');
