insert into EPISODIO_ENTITY values (612, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/192/480629.jpg', 'Cruelty', 1,'It is the Taisho Period. Tanjiro Kamado is living a modest but blissful life in the mountains with his family. One day, when he returns from selling charcoal in town, he finds his family slaughtered in pools of blood after a demon attack. Tanjiro rushes down the snowy mountain with the sole survivor, his sister Nezuko, on his back. But on the way, Nezuko suddenly snarls, turning on Tanjiro',5);
insert into EPISODIO_ENTITY values (613, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/192/480630.jpg', 'Trainer Sakonji Urokodaki', 2,'At Giyu Tomiokas urging, Tanjiro heads for Mt. Sagiri with his sister Nezuko whos been turned into a demon. During the night, Tanjiro catches the smell of blood from inside a temple. He enters, thinking that someone might be hurt, only to come upon a man-eating demon. When the demon attacks, Tanjiro manages to fight back with his hatchet, but the demons strength is overwhelming. Just as the demon is about to finish him off, Tanjiro is saved by none other than...',5);
insert into EPISODIO_ENTITY values (614, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/192/482188.jpg', 'Sabito and Makomo', 3,'The Demon Slayer Corps... An organization thats been hunting down demons since ancient times. Sakonji Urokodaki starts training Tanjiro for Final Selection, the test for joining the unit. Navigating a mountain riddled with booby traps, dry sword swings, waterfall immersion and breathing techniques... A year later, Urokodaki informs Tanjiro that he has nothing more to teach him, and gives him one last hurdle to overcome in front of a giant boulder.',5);
insert into EPISODIO_ENTITY values (615, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/363/908076.jpg', 'Final Selection', 4,'To pass Final Selection, one must survive for seven days on Mt. Fujikasane where demons captured by the Demon Slayers have been imprisoned. So begins the battle for survival between the young swordsmen and the demons. Armed with the breathing techniques and stances hed learned from Sakonji Urokodaki, Tanjiro slashes demon after demon. His two years of training have not gone to waste. But just then, a morphed demon appears out of nowhere.',5);
insert into EPISODIO_ENTITY values (616, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/194/487469.jpg', 'My Own Steel', 5,'When day breaks, there are only four swordsmen left standing after the seven-day battle. The guides who greet Tanjiro and the other survivors explain the Demon Slayer Corps system. All four are issued uniforms and Kasugai Crows as messengers, after which they must select the ore for their own Nichirin Swords. After gazing hard at each lump of ore and using his sense of smell, the one Tanjiro chooses is...',5);
insert into EPISODIO_ENTITY values (617, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/196/491249.jpg', 'Swordsman Accompanying a Demon', 6,'Tanjiro is now clad in the uniform of the Demon Slayer Corps. His Nichirin Sword on his hip, and Nezuko, now awake, in a special box made by Urokodaki on his back, he heads out for his first assignment. A town to the northwest where girls have been vanishing nightly. There, Tanjiro meets Kazumi, haggard with worry after his girlfriends been abducted. Though he does catch the scent of a demon nearby, theres just no demon in sight. Tanjiro is sure that a demon is behind this sinister incident...',5);
insert into EPISODIO_ENTITY values (618, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/363/908105.jpg', 'Muzan Kibutsuji', 7,'Now split into three, the demons have driven Tanjiro into a corner. It is then that Nezuko attacks. Now that shes become a demon herself, shes no longer so weak that she needs protection. His mind made up, Tanjiro follows one of the demons into the swamp now spreading across the ground. Waiting for him there is...',5);
insert into EPISODIO_ENTITY values (619, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/363/908264.jpg', 'The Smell of Enchanting Blood', 8,'The next mission is in Asakusa, Tokyo. Tanjiro is taken aback by the opulent Taisho Era cityscape, but soon picks up the demons scent there. His pursuit of the scent leads him to Muzan Kibutsuji. Tanjiro attempts to strike him down. But Kibutsuji transforms a passerby into demon, triggering a commotion. As Tanjiro desperately tries to get things under control, someone appears before him..',5);
insert into EPISODIO_ENTITY values (620, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/200/501740.jpg', 'Temari Demon and Arrow Demon', 9,'It was two demons named Tamayo and Yushiro who came to Tanjiros rescue. Using the "Eyeblind" spell, Tamayo guides Tanjiro and Nezuko to her house. There, through his conversation with Tamayo, Tanjiro learns that there is a way to return demons to human form. Just then, two demons in pursuit of Tanjiro locate the house and unleash a furious assault...',5);
insert into EPISODIO_ENTITY values (621, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/201/503868.jpg', 'Together Forever', 10,'Tanjiros crisis continues. He uses multiple forms of the Water Breathing technique to hold out against Yahabas final Blood Demon Art, the "Kouketsu Arrow." Meanwhile, Nezuko and Susamaru are still battling it out. Worried about the outcome, Tamayo unleashes her own Blood Demon Art.',5);
insert into EPISODIO_ENTITY values (622, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/202/505551.jpg', 'Tsuzumi Mansion', 11,'Tanjiros next destination, according to his Kasugai Crow, is to the south-southeast. On the way, Tanjiro runs into his fellow Final Selection survivor, the swordsman Zenitsu Agatsuma. Tanjiro has a hard time dealing with Zenitsus passive attitude as they head deep into the mountains. They encounter two children whose older brother was taken away right in front of their house. There, Zenitsu hears the sound of a tsuzumi ringing out from somewhere.',5);
insert into EPISODIO_ENTITY values (623, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/363/908437.jpg', 'The Boar Bares Its Fangs, Zenitsu Sleeps', 12,'Inside the house, where the rooms spin each time the tsuzumi is played, Tanjiro gets separated from Zenitsu Agatsuma. Without Tanjiro by his side, Zenitsu is overcome by fear and despair as he takes Shoichi through the house. Meanwhile, Tanjiro meets the master of the house, the tsuzumi-playing demon, and an odd-looking man wearing a boars head mask.',5);
insert into EPISODIO_ENTITY values (624, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/203/509304.jpg', 'Something More Important Than Life', 13,'Every time Kyogai, the master of house, plays his tsuzumi, the room spins and Tanjiro struggles. Debilitated by the fractured bones he sustained in his previous battle, Tanjiro tries to fire himself up as he desperately fights on, but he is overwhelmed by Kyogais Blood Demon Art. Will he find a way to slice off Kyogais head?',5);
insert into EPISODIO_ENTITY values (625, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/363/908455.jpg', 'The House With the Wisteria Family Crest', 14,'After a desperate fight to the death, Tanjiro prevails over Kyogai. He exits the house to find Zenitsu who had escaped earlier. But it is then that he sees the strange circumstances before him... The battered Zenitsu holding the box containing Nezuko in his arms while the man in the boars head mask stands in the way with two Nichirin Swords drawn.',5);
insert into EPISODIO_ENTITY values (626, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/205/512854.jpg', 'Mount Natagumo', 15,'Their next destination is to the north-northwest. Tanjiro and Nezuko head towards Mount Natagumo with Zenitsu and Inosuke. This mountain is covered with spider webs and is swarming with innumerable spiders. Leaving the cowering Zenitsu behind, Tanjiro and Inosuke head up the mountain where they run into fellow Demon Slayers entangled in spider webs.',5);
insert into EPISODIO_ENTITY values (627, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/205/514592.jpg', 'Letting Someone Else Go First', 16,'Tanjiro and Inosuke battle the Demon Slayers trapped by spider webs. After slashing the threads and destroying the webs, they head deeper into the mountain. The farther they advance through the forest, the thicker the threads become, and those under their control start moving in ways impossible for a human being. Stopping the Demon Slayers without hurting them isnt going to be easy, but then Tanjiro makes a certain move...',5);
insert into EPISODIO_ENTITY values (628, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/363/908483.jpg', 'You Must Master a Single Thing', 17,'One of the Twelve Kizuki, a direct subordinate of Muzan Kibutsuji, is here somewhere. When Tanjiro slays the Mother Spider Demon of Mt. Natagumo, he learns that a demon who might hold the key to turning Nezuko back into a human is somewhere in this very forest. With the battered Inosuke in tow, he heads deeper into the forest. Meanwhile, Zenitsu trudges forlornly through the woods only to encounter a spider with a human face',5);
insert into EPISODIO_ENTITY values (629, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/363/908486.jpg', 'A Forged Bond', 18,'Tanjiro and Inosuke face off against the Father Spider Demon of Mt. Natagumo. Tanjiro unleashes an attack, only to get hurled away by the demons overwhelming power. Landing near a river, he comes upon the young demon Rui torturing the Sister Spider Demon. When Rui calls their bond of terror and hatred "a familys bond," Tanjiro is enraged. So begins the battle between Rui and Tanjiro.',5);
insert into EPISODIO_ENTITY values (630, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/363/908487.jpg', 'Hinokami', 19,'Swordsmen in the Demon Slayer Corps known as Hashiras have arrived on Mt. Natagumo. Giyu Tomioka, the Water Hashira, slays the Father Spider Demon with a single strike. Inosuke, thrilled to see such a display of swordsmanship by someone in a totally different league from himself, challenges Giyu to a duel. Meanwhile, Zenitsu lies near death as the poison circulates throughout his body. Just then, the Insect Hashira, Shinobu Kocho appears before him.',5);
insert into EPISODIO_ENTITY values (631, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/208/521134.jpg', 'Pretend Family', 20,'When Rui assaults him with his Blood Demon Art, Tanjiro braces himself for certain death. As his life flashes before his eyes, he suddenly remembers his fathers dance, the kagura, and unleashes a new, non-Water Breathing attack. Hinokami Kagura Dance. Knowing that hell be receiving a simultaneous blow from the demon, he uses his new move to slice off Ruis head. As Tanjiro crawls towards Nezuko, who lies on the ground, riddled with wounds, someone appears before him.',5);
insert into EPISODIO_ENTITY values (632, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/209/522614.jpg', 'Against Corps Rules', 21,'Seeing Tanjiro try to protect Nezuko even as he collapses triggers memories of Ruis own past. Once a sickly boy, he became a demon after meeting Muzan Kibutsuji who gave him a share of his blood. But after he turns into a demon, his own parents try to kill him. Ever since then, he has been searching for a family. Seeking a bond that he can never hope to acquire..',5);
insert into EPISODIO_ENTITY values (633, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/209/524213.jpg', 'Master of the Mansion', 22,'After the battle is over, Tanjiro and Nezuko are taken to the Demon Slayer Corps headquarters. This is where the Hashira Meeting between the Corps leader, Ubuyashiki, and the Hashiras, the most powerful swordsmen in the Corps, is to be held. The Hashiras censure Tanjiro for violating the Demon Slayer Corps by protecting a demon. And then, the Wind Hashira, Sanemi Shinazugawa, raises his sword against Nezuko...',5);
insert into EPISODIO_ENTITY values (634, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/210/526344.jpg', 'Hashira Meeting', 23,'Ubuyashiki, the leader of the Demon Slayer Corps, finally appears before Tanjiro. He tells him that he will allow Tanjiro and Nezuko to join the Corps. But the Hashiras are unable to accept this decision right away. The Wind Hashira, Sanemi Shinazugawa, slashes his own arm and taunts Nezuko with his blood, trying to get her to show her true colors as a demon',5);
insert into EPISODIO_ENTITY values (635, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/211/528349.jpg', 'Rehabilitation Training', 24,'The injured Tanjiro, Zenitsu and Inosuke are sent to the home of the Insect Hashira, Shinobu Kocho, for treatment. Two weeks later, Tanjiro and Inosuke start rehabilitation training. But the drills are brutal, and they find themselves broken in spirit. Unaware of the grueling regimen, Zenitsu joins them late and is visibly enthusiastic in front of girls, but...',5);
insert into EPISODIO_ENTITY values (636, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/530895.jpg', 'Tsuguko, Kanao Tsuyuri', 25,'Tanjiro, whos undergoing rehabilitation training at the Butterfly Mansion, works hard to keep up his Total Concentration Breathing techniques all day long. Though at first, hes helpless against Kanao, a swordswoman in his class whos training him, he slowly but surely begins to make some headway. Seeing Tanjiro devote himself to training every single day, Zenitsu and Inosuke resume training as well, but..',5);
insert into EPISODIO_ENTITY values (637, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/213/533047.jpg', 'New Mission', 26,'As Tanjiro and the others are devoted to their rehabilitation training, the absolute master of the demons, Muzan Kibutsuji, gathers the Lower Ranks of the Twelve Kizuki. The demons, too, are preparing to make their next move. As training draws to a close, Tanjiro has improved to the point where he can fight on equal terms with Kanao. Just then, he receives word of a new mission from his Kasugai Crow.',5);
insert into EPISODIO_ENTITY values (638, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/365/913099.jpg', 'Flame Hashira Kyojuro Rengoku', 1,'Flame Hashira Kyojuro Rengoku receives new orders: Travel to the Mugen Train, where over forty people have gone missing, and conduct an investigation. Leaving the Demon Slayer Corps Headquarters, he sets off on this new mission.',5);
insert into EPISODIO_ENTITY values (639, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/367/918663.jpg', 'Deep Sleep', 2,'Kyojuro Rengoku heads to the Mugen Train to investigate the disappearance of over forty passengers and encounters a demon along the way. After saving the people attacked by the demon, he finally arrives at the Mugen Train. What lies ahead of him?',5);
insert into EPISODIO_ENTITY values (640, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/369/923269.jpg', 'Should Have Been', 3,'Trapped in Enmus spell, Tanjiro, Zenitsu, Inosuke and Kyojuro fall closer and deeper into an eternal slumber. Faced with death, Tanjiro is forced to confront his demons to save them.',5);
insert into EPISODIO_ENTITY values (641, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/374/935598.jpg', 'Insult', 4,'With Tanjiro successfully awakening from his dream, he confronts the demon responsible, Lower One Enmu. But the situation challenges Tanjiros resolve when Enmu proves more powerful that any demon hes ever faced.',5);
insert into EPISODIO_ENTITY values (642, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/375/939775.jpg', 'Move Forward!', 5,'The battle with Enmu continues as Inosuke, Zenitsu and Rengoku awaken from the spell. Tanjiro and Inosuke try to pinpoint the demons weak spot, while the others focus on protecting the passengers in the train.',5);
insert into EPISODIO_ENTITY values (643, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/377/943215.jpg', 'Akaza', 6,'Tanjiro has finally slashed Enmus neck with the help of Inosuke. The tremors from the train flipped it over the rails. As silence deepens a mysterious figure approaches from behind.',5);
insert into EPISODIO_ENTITY values (644, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/379/948455.jpg', 'Set Your Heart Ablaze', 7,'Akaza continues to offer Rengoku the chance to become a demon to improve his skills. Rengoku refuses his offer and is trying his best to keep up with him. The fire Hashira has one goal:to protect his comrades even if it costs his own life.',5);
insert into EPISODIO_ENTITY values (645, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/381/952770.jpg', 'Sound Hashira Tengen Uzui', 8,'After the Mugen Train incident, Akaza visits Muzan Kibutsuji. Guided by a crow, Tanjiro Kamado heads off to the Rengoku residence to convey Kyojuro Rengokus last messages to his father and little brother. Tanjiros group return to the Butterfly Mansion.',5);
insert into EPISODIO_ENTITY values (646, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/383/959431.jpg', 'Infiltrating the Entertainment District', 9,'One day, Tanjiro returns to the Butterfly Mansion and finds Sound Hashira, Tengen Uzui, attempting to take Aoi and Naho away on a mission against their will. Tanjiro, Zenitsu and Inosuke offer to go on that mission instead, and they head to their next destination - the Entertainment District.',5);
insert into EPISODIO_ENTITY values (647, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/385/962537.jpg', 'What Are You?', 10,'After arriving at the Entertainment District, Tanjiro and his comrades infiltrate each House where Uzuis wives, Suma, Makio and Hinatsuru, work. While working as apprentices and searching for their whereabouts, Inosuke hears that Makio has been shutting herself away from everyone in her room.',5);
insert into EPISODIO_ENTITY values (648, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/386/965305.jpg', 'Tonight', 11,'Realizing Zenitsu is now missing, Tanjiro and Inosuke re-arm and look for signs of the demon. Tanjiro goes in alone and is confronted by Upper Rank Six.',5);
insert into EPISODIO_ENTITY values (649, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/387/969360.jpg', 'Things Are Gonna Get Real Flashy!!', 12,'Facing Daki alone, Tanjiro tries to use Hinokami Kagura but is hampered by the extreme stress it causes his body. Inosuke and Tengen locate the demons victims and meet the demon responsible for abducting Zenitsu and his wives.',5);
insert into EPISODIO_ENTITY values (650, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/388/972091.jpg', 'Layered Memories', 13,'Furious at Dakis disregard for lives, Tanjiro angrily confronts her, causing her to experience Muzans memories of an old enemy. His excessive use of Hinokami Kagura soon brings him to his knees in pain.',5);
insert into EPISODIO_ENTITY values (651, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/390/976557.jpg', 'Transformation', 14,'As Nezuko fights and overwhelms Daki, she nearly loses herself and forces Tanjiro to stop her. Daki prepares to exact revenge but Tengen arrives.',5);
insert into EPISODIO_ENTITY values (652, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/392/980499.jpg', 'Gathering', 15,'Facing the dual holders of Upper Six, Tengen, Tanjiro, Inosuke and Zenitsu battle Daki and Gyutaro head on.',5);
insert into EPISODIO_ENTITY values (653, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/394/985378.jpg', 'Defeating an Upper Rank Demon', 16,'While Zenitsu and Inosuke struggle with Dakis obi, Tengen and Tanjiro are repeatedly forced on the defensive by Gyutaro.',5);
insert into EPISODIO_ENTITY values (654, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/395/987547.jpg', 'Never Give Up', 17,'With his friends severely wounded, Tanjiro is confronted by Gyutaro. He offers to turn him into a demon but Tanjiro takes his last stand and attacks despite his severe injuries.',5);
insert into EPISODIO_ENTITY values (655, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/396/990146.jpg', 'No Matter How Many Lives', 18,'After defeating the Upper Rank Six demons, Nezuko quickly heals Tanjiro, Inosuke and Tengen of the poison. Tanjiro heads out to finish off the demons while Gyutaro reminisces about his past.',5);
insert into EPISODIO_ENTITY values (656, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/458/1146522.jpg', 'Someones Dream', 1,'After their battle with the Upper Rank Six siblings, Tanjiro, Zenitsu, Inosuke, and Nezuko are found by the Kakushi. In the Infinity Castle, Muzan Kibutsujisummons the remaining five Upper Rank demons – Akaza, Upper Five Gyokko, Upper Four Hantengu, Upper Two Doma and Upper One Kokushibo. He admonishes them for their failure to kill the Ubuyashikis and find the Blue Spider Lily. When Gyokko provides new information, he is sent on a joint mission with Hantengu. While Zenitsu and Inosuke are summoned to individual missions, Tanjiro continues his rehabilitation. When his swordsmith Hotaru Haganezuka refuses to forge him a new sword, Tanjiro is told to meet him at the Swordsmith Village to discuss the matter in person. He arrives with Nezuko and meets the villages chief, Tecchin Tecchikawahara, who reassures Tanjiro he will bring Hotaru back to build the sword. Tanjiro is later shown to the villages hot springs where he meets the Love Hashira Mitsuri Kanroji, who is initially dejected',5);
insert into EPISODIO_ENTITY values (657, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/458/1146521.jpg', 'Yoriichi Type Zero', 2,'While eavesdropping, Tanjiro watches as Muichiro threatens the swordsmith he was arguing with. He tries to defend him but the indifferent Hashira knocks him out for interfering. After waking up, the boy, named Kotetsu, explains that the "man" he saw is actually an advanced mechanical training doll, built after a swordsman who lived over 300 years ago. He explains the doll was made by his ancestors, and as he lacks a family, it is all he has to pass on to the next generation. Tanjiro agrees to protect it, but Muichiro appears, having finished his training session and causing extensive damage. However, after Kotetsu discovers it is still functional, he tells Tanjiro to train with it in order to become stronger than the arrogant Muichiro. However, training proves harsh as Kotetsu denies Tanjiro food and water when he fails to connect hits on the doll. When Tanjiro eventually faints from exhaustion, he imagines himself in the afterlife and sees a peculiar stone in the Sanzu River, enabl',5);
insert into EPISODIO_ENTITY values (658, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/458/1146520.jpg', 'A Sword from Over 300 Years Ago', 3,'Tanjiro becomes disappointed after he discovers the sword rusted. However, a swole Hagenazuka appears, revealing he trained in solitude to be able to forge a better sword for Tanjiro. As such, he offers to restore the rusty sword, giving Tanjiro another one in the meantime. That night, while trying to befriend Genya, swordsmith Kanamori is brutally devoured by Gyokko who, alongside Hantengu, has found the village. After Muichiro is moved by Tanjiros sense of kindness towards others, Hantengu enters their room, only to be quickly beheaded. However, two individual demons regenerate from the severed body parts, each with different, powerful abilities. After one of them blasts Muichiro far away, the other nearly electrocutes Tanjiro with a staff, before Genya appears and beheads them both with a sawed-off shotgun and a Nichirin knife. However, Hantengu again duplicates, and one of the demons deafens Tanjiro with a sonic attack while Nezuko tries to defend Genya. Meanwhile, Muichiro run',5);
