insert into EPISODIO_ENTITY values (667, 59, 'https://static.tvmaze.com/uploads/images/medium_landscape/433/1082584.jpg', 'Chapter I: Wednesdays Child Is Full of Woe', 1,'When a deliciously wicked prank gets Wednesday expelled, her parents ship her off to Nevermore Academy, the boarding school where they fell in love.',6);
insert into EPISODIO_ENTITY values (668, 49, 'https://static.tvmaze.com/uploads/images/medium_landscape/433/1082585.jpg', 'Chapter II: Woe Is the Loneliest Number', 2,'The sheriff questions Wednesday about the nights strange happenings. Later, Wednesday faces off against a fierce rival in the cutthroat Poe Cup race.',6);
insert into EPISODIO_ENTITY values (669, 48, 'https://static.tvmaze.com/uploads/images/medium_landscape/433/1082586.jpg', 'Chapter III: Friend or Woe', 3,'Wednesday stumbles on a secret society. During Outreach Day, Nevermores outcasts mingle with Jerichos normies in Pilgrim World. Fudge, anyone?',6);
insert into EPISODIO_ENTITY values (670, 50, 'https://static.tvmaze.com/uploads/images/medium_landscape/433/1082587.jpg', 'Chapter IV: Woe What a Night', 4,'Wednesday asks Xavier to the RaveN dance, sparking Tylers jealousy — but Things got something up his sleeve. Meanwhile, Eugene stakes out the cave.',6);
insert into EPISODIO_ENTITY values (671, 52, 'https://static.tvmaze.com/uploads/images/medium_landscape/433/1082588.jpg', 'Chapter V: You Reap What You Woe', 5,'During Parents Weekend, Wednesday digs into her familys past — and accidentally gets her dad arrested. Enid feels the pressure to "wolf out."',6);
insert into EPISODIO_ENTITY values (672, 50, 'https://static.tvmaze.com/uploads/images/medium_landscape/431/1079874.jpg', 'Chapter VI: Quid Pro Woe', 6,'Wednesdays friends throw her a surprise birthday party. They mean well... but shed much rather mark the miserable occasion by solving the murders.',6);
insert into EPISODIO_ENTITY values (673, 47, 'https://static.tvmaze.com/uploads/images/medium_landscape/433/1082589.jpg', 'Chapter VII: If You Dont Woe Me by Now', 7,'Kooky Uncle Fester pays a visit and shares his theory about the monster. Wednesday begrudgingly agrees to a date with Tyler at Crackstones crypt.',6);
insert into EPISODIO_ENTITY values (674, 52, 'https://static.tvmaze.com/uploads/images/medium_landscape/431/1079877.jpg', 'Chapter VIII: A Murder of Woes', 8,'Wednesday lands in trouble with Principal Weems, but thats just the start of her problems. To fight an ancient evil, shell need all her friends help.',6);
