insert into SERIE_ENTITY_CATEGORIAS values (7, 12);
insert into CATEGORIA_ENTITY  values (13, 'https://w0.peakpx.com/wallpaper/499/448/HD-wallpaper-american-horror-story-asylum-tv-series-ahs-american-horror-story-show-asylum-american-horror-film.jpg','Horror');
insert into SERIE_ENTITY_CATEGORIAS values (7, 13);
insert into EPISODIO_ENTITY values (675, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531019.jpg', 'Herr Doctor Tenma', 1,'Doctor Tenma is a brilliant Japanese neurosurgeon who works at Eisler Memorial Hospital in Germany. He is doing well professionally and is even engaged to the directors daughter, Eva. One day, a boy with a gunshot wound to the head is brought to him.',7);
insert into EPISODIO_ENTITY values (676, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531020.jpg', 'Downfall', 2,'Dr. Tenma operates on the boy, disregarding the directors orders. The breach of control leads to Dr. Tenma losing his privileges and position as chief surgeon.',7);
insert into EPISODIO_ENTITY values (677, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531021.jpg', 'A Murder', 3,'The three doctors are found dead, while the twins are reported missing. Tenma becomes a prime suspect for the murder. The chairman reinstates Tenma as the chief surgeon. Nine years later, a suspect in Lunges robbery investigation is operated by Tenma and can only say one sentence after waking up.',7);
insert into EPISODIO_ENTITY values (678, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531022.jpg', 'Night of the Execution', 4,'The suspect Yunkers wakes up. Lunge tries to get a confession from him but fails. The following night, Tenma comes to the hospital with a gift and finds Junkers running away scared and chases after him to a building. Tenma finds Junkers held at gunpoint by a man he knows.',7);
insert into EPISODIO_ENTITY values (679, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531023.jpg', 'The Girl of Heidelberg', 5,'In Heidelberg, a girl named Nina Fortner rushes to class. She is a top student and is admired by everyone. She works as a part time pizza delivery girl and also takes karate classes. Nina comes home to find a corny romantic email written to her by an unknown boy. In Köln, Tenma searches for the identity of Johan. He finds that Johan lived in a lot of places and went by the names Michael and Franz. A war veteran reiterates that the boy learnt French and English with ease and always wants to hear war stories. Few days later Johan shows up at Ninas school.',7);
insert into EPISODIO_ENTITY values (680, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531024.jpg', 'The Missing', 6,'Tenma visits a Heidelberg newspaper agency. He is permitted by a reporter to look through the archives for the article about the twins disappearance. They find that Mr.Fortner had filed a missing persons report on a boy. Meanwhile, Its Ninas 20th birthday. She goes to the school counselor to talk about her fainting. Upon recollection, Nina says that the boy made her nostalgic. She gets another email asking her to come to Heidelberg castle. Mr. and Mrs. Fortner are reluctant to share information on the report. Tenma sensing danger hurries to Heidelberg castle.',7);
insert into EPISODIO_ENTITY values (681, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531025.jpg', 'House of Tragedy', 7,'Tenma and Nina come back to the house and find that the reporter and Ninas parents are dead. They are escorted by two police officers. On the way, Tenma realizes that the officers know more things than they are letting on. He grows suspicious and jumps off a bridge to a river with Nina. The following morning, on the river bank, Nina remembers everything from her past.',7);
insert into EPISODIO_ENTITY values (682, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531026.jpg', 'Pursued', 8,'Inspector Lunge visits Eva Heinemann for information on the tie. Eva says she doesnt know anything about it. Later,at the hospital, Eva confesses her love to Tenma. He doesnt reciprocate. Eva threatens him that she would tell the police about the tie. Tenma resigns from the post. After taking Evas info, the police round up the hospital to arrest Tenma.',7);
insert into EPISODIO_ENTITY values (683, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531027.jpg', 'The Girl and the Seasoned Soldier', 9,'It is monsoon season. Inspector Lunge interrogates a mercenary, Mr. Hugo Benhardt who trained Dr. Tenma with firearms five months ago. During the stint, Tenma harmonizes Mr. Hugos life with the little chore girl whose mother he killed during Myanmar war.',7);
insert into EPISODIO_ENTITY values (684, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531028.jpg', 'A Past Erased', 10,'A city council member and his wife are killed in Verden, Germany. Tenma believes that Johan could be the murderer, so he breaks into the council members home for clues. There he meets a petty thief named Heckel. Heckel says that he saw the murderer and leads Tenma to the murderers house.',7);
insert into EPISODIO_ENTITY values (685, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531165.jpg', 'Kinderheim 511', 11,'Tenma learns that Johan used to be in an orphanage known as Kinderheim 511, where he meets an injured boy named Dieter and a former East German official named Hartmann who used to work there.',7);
insert into EPISODIO_ENTITY values (686, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531166.jpg', 'A Meager Little Experiment', 12,'Dieter is picked up by Hartmann before Tenma could return, and Tenma learns more about the experiments in Kinderheim 511.',7);
insert into EPISODIO_ENTITY values (687, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531167.jpg', 'Petra and Schumann', 13,'In a small village, Dr. Schumann worries over the health of his sick but stubborn old friend, Petra.',7);
insert into EPISODIO_ENTITY values (688, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531168.jpg', 'The Only Man Left, The Only Woman Left', 14,'Inspector Lunge investigates the murder of a prostitute and suspects a senator named Dr. Boltzmann of involvement. His dedication to his work however takes a toll on his family life. Meanwhile, the vindictive Eva continues to press Lunge to catch Tenma. She also has a new lover, her gardener.',7);
insert into EPISODIO_ENTITY values (689, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531169.jpg', 'Be My Baby', 15,'Dr. Tenma and Nina Fortners investigations lead them to a powerful man known as The Baby, who belongs in an extremist organization. They soon learn that the organization has special plans for the Turkish district tomorrow.',7);
insert into EPISODIO_ENTITY values (690, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531170.jpg', 'Wolfs Confession', 16,'The Baby leads Nina to Professor Geidlitz, one of the leaders of a right-wing extremist organization. Geidlitz tells Nina about his plan to find Johan and turn him into the leader of his organization, and informs her that he needs Nina in order to do so. Meanwhile, Tenma gets into trouble when he is caught by the Baby.',7);
insert into EPISODIO_ENTITY values (691, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531171.jpg', 'Reunion', 17,'General Wolf is the first person who recognized Johans talents. Having experienced how terrifying Johan is, he asks Tenma to kill him. But Tenma threatens one of the generals subordinates and escapes to Frankfurt in order to prevent the right-wing extremists from burning down the Turkish part of town.',7);
insert into EPISODIO_ENTITY values (692, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531172.jpg', 'The Fifth Spoonful of Sugar', 18,'Nina is held by the police as a witness to the plan to burn down the Turkish quarter but is released when Mr. Rosso appears, the owner of a small restaurant where Nina worked after parting ways with Tenma. Its been a long time since theyve met, and when Nina sees Rosso pour five spoonfuls of sugar into his coffee, she finally smiles again.',7);
insert into EPISODIO_ENTITY values (693, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531173.jpg', 'Abyss of the Monster', 19,'Tenma visits criminal psychologist Rudi Gillen, one of his college classmates. Gillen believes that Tenma is a serial killer with multiple personalities and calls the police to have him arrested. Furthermore, he wants to analyze Tenma as a research subject after hes been arrested.',7);
insert into EPISODIO_ENTITY values (694, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531174.jpg', 'Journey to Freiham', 20,'Tenma and Dieter hitchhike to their next destination in Freiham. Mr. Jones and Leia, an older vacationing British couple, pick them up. Jones, a former police officer, is suspicious of Tenma, who is wanted by the police. But Leia is friendly, and thanks to her, the trip is peaceful. Midway, Jones reveals an unexpected reason for why the couple has come to Germany!',7);
insert into EPISODIO_ENTITY values (695, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531294.jpg', 'A Wonderful Holiday', 21,'There is a man who lives with bodyguards in a luxurious mansion in Nice in the south of France. Nina is looking for this man, called Muller, because he is the former detective who killed her foster parents, the Fortners. After quitting the police, Muller was hired by a crime syndicate. Muller discovers that his protege, Roberto, is actually working for Johan and is now tasked with killing Nina.',7);
insert into EPISODIO_ENTITY values (696, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531295.jpg', 'Lunges Trap', 22,'There is a murder in Hamburg, Germany, believed to be one of the multiple homicides of middle-aged couples. Lunge has an opportunity to lure Tenma to a trap. However, before he can arrest him, Lunge is critically wounded by the real criminal. Tenma is able to treat his injuries.',7);
insert into EPISODIO_ENTITY values (697, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531296.jpg', 'Evas Confession', 23,'Eva, Tenmas former fiance, has risked everything to get her revenge on Tenma and has been spending her days drinking. But a man appears before her...Its Roberto, a man deeply connected to Johan.',7);
insert into EPISODIO_ENTITY values (698, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531297.jpg', 'Mens Table', 24,'Tenma is at a mountain villa treating a man who was a high-ranking member of a crime syndicate. The man tells Tenma about a shocking event that happened in the underworld five years ago. Meanwhile Roberto tells Eva to confront Tenma.',7);
insert into EPISODIO_ENTITY values (699, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531298.jpg', 'The Thursday Boy', 25,'Hans Georg Schuwald, a blind business tycoon whos infamously known as "The Vampire of Bavaria," hires a different college student each day of the week to read books to him. Karl is in charge of Tuesdays. He has approached Schuwald in order to find his mother, who was acquainted with the man.',7);
insert into EPISODIO_ENTITY values (700, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531299.jpg', 'Secret Forest', 26,'"The Thursday Boy," Edmund, who was pretending to be Schuwalds son, commits suicide. Richard, a detective hired by Schuwald, has suspicions about Edmunds death. Meanwhile, Karl approaches a certain young man who turns out to be Johan.',7);
insert into EPISODIO_ENTITY values (701, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531300.jpg', 'Evidence', 27,'Richard quit the police force because he shot a young criminal on duty. He is also trying to recover from alcoholism with help of his psychiatrist Dr Julius Reichwein.',7);
insert into EPISODIO_ENTITY values (702, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531301.jpg', 'Just One Case', 28,'Schuwald tells Richard to stop the investigation because everything has been solved. Richard has suspicions about an earlier investigation he had been asked to conduct concerning the suicide of Edmund, a boy who was thought to be Schuwalds son.',7);
insert into EPISODIO_ENTITY values (703, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1008957.jpg', 'Execution', 29,'Richard is a detective who quit the police force when he shot a criminal while on duty and has run himself into ruin. But reinvestigating some unsolved cases, he begins to put his life back together. Richard also discovers that there is one person behind all of the cases.',7);
insert into EPISODIO_ENTITY values (704, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531303.jpg', 'A Certain Decision', 30,'Richard commits suicide. But Dr. Reichwein, who was counseling Richard, is suspicious of the circumstances of Richards death and begins an investigation himself. Dr. Reichwein is attacked by hoodlums who try to interfere with his investigation.',7);
insert into EPISODIO_ENTITY values (705, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531304.jpg', 'Into the Light of Day', 31,'After Richards death, Reichwein tries to investigate Johan by himself, but an assassin is after him. Tenma saves him from danger just in time.',7);
insert into EPISODIO_ENTITY values (706, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531305.jpg', 'Sanctuary', 32,'Lotte has feelings for Schuwalds son, Karl, but lately, Karl has been busy working with his father, so he hasnt had any time for her. In the college library, Lotte meets Nina, who is doing research because she suspects that the recent events surrounding Schuwald are the work of her brother, Johan. Tenma tries to kill Johan in a forest.',7);
insert into EPISODIO_ENTITY values (707, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531306.jpg', 'Scenes from Childhood', 33,'Dr. Reichwein gets a request from a mother to counsel her son, who hurt himself jumping off a roof. Martin doesnt tell Reichwein anything, but he reveals the truth to Dieter, who has come with Reichwein.',7);
insert into EPISODIO_ENTITY values (708, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531307.jpg', 'At the End of the Darkness', 34,'After an unexpected incident, Johan is hospitalized but immediately released. Johan receives a threatening letter from the prostitute who was pretending to be Karls mother. Tenma helps a girl working as an underworld doctor.',7);
insert into EPISODIO_ENTITY values (709, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531308.jpg', 'Nameless Hero', 35,'Inspector Lunge of the BKA, who is searching for Tenma, meets some Japanese people in Germany who were friends of Tenma and asks them seemingly trivial things about him, trying to get into Tenmas mind.',7);
insert into EPISODIO_ENTITY values (710, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531310.jpg', 'The Monster of Chaos', 36,'Tenma is hiding on top of a bookshelf in a library late at night. He is planning to shoot Johan, who will appear at the Schuwalds book collection donation ceremony. Dr Reichwein confronts Schuwald while Dr Gillen contacts with Lunge.',7);
insert into EPISODIO_ENTITY values (711, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531311.jpg', 'A Monster Without a Name', 37,'The story of the picture book that terrified Johan is revealed. Tenma has his sniper aimed on Johan. Johans monstrous nature is introduced.',7);
insert into EPISODIO_ENTITY values (712, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531312.jpg', 'The Demon in My Sight', 38,'At first, Johan planned to take over Schuwalds financial conglomerate. But after reading a certain picture book, something inside of him changes. Johan makes his move.',7);
insert into EPISODIO_ENTITY values (713, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531313.jpg', 'The Hell in His Sight', 39,'The one who is pointing a gun at Johan is not Tenma, but Nina. But because of the fire, it is unknown whether Johan was hit by a bullet. Johan disappears once again.',7);
insert into EPISODIO_ENTITY values (714, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531314.jpg', 'Grimmer', 40,'Grimmer is a freelance journalist. Currently, he is investigating abuses that may have occurred in the kinderheim (orphanages) of the former East Germany. When East Germany still existed, he traveled around the world as a spy who posed as a newspaper journalist.',7);
insert into EPISODIO_ENTITY values (715, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531607.jpg', 'Ghosts of 511', 41,'Grimmer stubbornly stalks Petrov for his experimental research papers chronicling the abuses at Kinderheim 511, but he gets a surprise instead.',7);
insert into EPISODIO_ENTITY values (716, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531609.jpg', 'The Adventures of the Magnificent Steiner', 42,'Pedrov has been shot. Before he dies, he hands Grimmer the key to a safety-deposit box that contains the data and tapes of his old experiments. Grimmer is abducted by mysterious men who are after the key.',7);
insert into EPISODIO_ENTITY values (717, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531610.jpg', 'Detective Suk', 43,'Grimmer, who is investigating 511 Kinderheim, has passed out after being tortured by members of the former Czechoslovakian secret police. When he comes to, he is surrounded by their dead bodies. One of the bodies is that of Zeman, a Prague police inspector. And Detective Jan Suk, Zemans protege begins to investigate this case.',7);
insert into EPISODIO_ENTITY values (718, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531611.jpg', 'Two Darknesses', 44,'Suk reports to the police chief that he has discovered that Inspector Zeman had ties with former Czechoslovakian secret police that are hiding within the station.',7);
insert into EPISODIO_ENTITY values (719, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531612.jpg', 'The Monsters Afterimage', 45,'The Czech police have turned their suspicions towards the journalist Grimmer and the young detective Suk for the murders of their former police chief and three former Czechoslovakian secret police members. Even though he is a suspect, Suk meets with Grimmer to find out the truth.',7);
insert into EPISODIO_ENTITY values (720, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531613.jpg', 'Point of Contact', 46,'A Prague police detective from a special investigative team has been killed in Suks room, and now Suk is being chased as a suspect in a series of murders. Tenma reads about the case in a newspaper...',7);
insert into EPISODIO_ENTITY values (721, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531614.jpg', 'Nightmares Door', 47,'Nina doesnt know that Johan has disguised himself as her and is confused when people in the street affectionately call her "Anna." Meanwhile, Tenma and Grimmer meet with Captain Karel Lanke, a leader of the former Czechoslovakian secret police.',7);
insert into EPISODIO_ENTITY values (722, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531615.jpg', 'The Scariest Thing', 48,'While searching for the sign with the three frogs, Nina is surprised that she knows the surrounding buildings and streets, but there is a shadow of fear in her memories. Meanwhile, Tenma and Grimmer get an important testimony from Lanke. Inspector Lunge takes a holiday in Prague.',7);
insert into EPISODIO_ENTITY values (723, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531616.jpg', 'The Cruelest Thing', 49,'All the orphans who adore Grimmer try to prove his innocence. They find the blonde woman (Johan, disguised as Anna) who was at the scene of the murder.',7);
insert into EPISODIO_ENTITY values (724, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531617.jpg', 'Mansion of Roses', 50,'Inspector Lunge arrives at the Red Rose Mansion after finding a hint in a picture book. Afterwards, he meets with Captainl Lanke, a leader of the former Czechoslovakian secret police.',7);
insert into EPISODIO_ENTITY values (725, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531618.jpg', 'The Monsters Love Letter', 51,'In order to get close to the tycoon Schuwald, Johan used Schuwalds mistress, Margot Langer. Schuwald thinks back to the time he visited the building with the sign with the three frogs when he went searching for Margot three years after they had parted ways.',7);
insert into EPISODIO_ENTITY values (726, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531619.jpg', 'Lawyer', 52,'Tenma is caught in the Czech Republic. He is moved to a police department in DÃ¼sseldorf and is questioned daily. GÃ¼nter Milch, an escape artist, is in the same detention area. When Milch feigns illness, Tenma has a look at him...',7);
insert into EPISODIO_ENTITY values (727, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531620.jpg', 'Decision', 53,'After hearing Robertos threat against Eva, Tenma decides to confess to all charges against him so he can be placed in the same van transporting a prisoner to a Federal Penetentary as the prisoner is arranging for a jailbreak.',7);
insert into EPISODIO_ENTITY values (728, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531621.jpg', 'Escape', 54,'Tenma and Milch are on the run with the injured Gustav and Helene. Eva finds her life in danger when she discovers that the attorney shes supposed to meet, Mr.Baul, is none other than Roberto.',7);
insert into EPISODIO_ENTITY values (729, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531622.jpg', 'Room 402', 55,'Tenma escapes with Milch and tries to warn Eva that she is in danger. Eva is staying in room 402 of the Hotel Steigent. Tenma is unable to contact Eva, so he heads to her room.',7);
insert into EPISODIO_ENTITY values (730, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531623.jpg', 'The Unending Journey', 56,'Tenma has escaped and is headed to his lawyer Verdemans house. There, Tenma finds a message inviting him to the Red Rose Mansion. Tenma heads to the Czech Republic while decoding the encoded memo that Verdemans father left behind.',7);
insert into EPISODIO_ENTITY values (731, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531624.jpg', 'That Night', 57,'Nina faints at the Red Rose Mansion and is saved by Lipsky, a puppeteer. When she recovers from the temporary shock, Nina remembers everything that happened on that tragic day that the Lieberts were killed.',7);
insert into EPISODIO_ENTITY values (732, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531625.jpg', 'An Unpleasant Job', 58,'Two months earlier, before Tenma escaped, Martin visited Evas room and took her away. A mysterious man in Frankfurt told Martin to bring Eva to him...',7);
insert into EPISODIO_ENTITY values (733, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531626.jpg', 'The Man Who Saw the Devil', 59,'While acting as Evas bodyguard, Martin becomes determined to protect Eva, even from Tenma, who is searching for Eva. But Eva has found the person she needed to find and their professional relationship is at an end.',7);
insert into EPISODIO_ENTITY values (734, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531627.jpg', 'The Man Who Knew Too Much', 60,'Martins attempt to save Eva costs him his life, his last minutes with Tenma reveals a terrible secrets about Martins boss, Petr Capek and the about the experiments.',7);
insert into EPISODIO_ENTITY values (735, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531628.jpg', 'The Door of Memory', 61,'Nina returns to the apartment that she lived in and Johan and encounters another memory, Jan Suk and Fritz Vardemann team up to gather information on Franz Bonapartas.',7);
insert into EPISODIO_ENTITY values (736, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531629.jpg', 'A Fun Dining Table', 62,'Tenma is hit by a van While trying to escape from police in Frankfurt upon trying to pursue Petr Capek, He awakes in the Turkish Quarter of the city.',7);
insert into EPISODIO_ENTITY values (737, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531630.jpg', 'Unrelated Murders', 63,'Inspector Weissbach, who was in charge of the murder cases concerning the Lieberts and the Eisler Memorial Hospital victims, is nearing retirement. His final job is to transport Dinger, a multiple homicide offender.',7);
insert into EPISODIO_ENTITY values (738, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531631.jpg', 'The Babys Depression', 64,'The Baby is a prominent right-wing extremist in Frankfurt. He became Capeks right-hand man with the aim of creating a new world order, but lately hes been distrustful of Capeks words and actions.',7);
insert into EPISODIO_ENTITY values (739, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531632.jpg', 'Johans Footprints', 65,'Nina has recovered all of her memories and goes alone to Capeks villa in search of Johan. Meanwhile, acting on a note that Milan left behind, Tenma watches Christof, the young man who works with Capek.',7);
insert into EPISODIO_ENTITY values (740, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531633.jpg', 'Welcome Back', 66,'Capek is at the mercy of a gun-toting Nina and leads her to Johan by car. On the way there, Capek reveals that Johan came just before Nina did, and that Johan told him to tell Nina where he was.',7);
insert into EPISODIO_ENTITY values (741, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531634.jpg', 'Im Home', 67,'Johan, during his confrontation with Anna, reveals what he endured in the Red Rose Mansion as a child. As Tenma and Anna embark further on the monsters trail, Johan is already ahead of them, now knowing where his path of destruction will end.',7);
insert into EPISODIO_ENTITY values (742, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531635.jpg', 'Ruhenheim', 68,'BKA inspector Lunge is standing on a hill that overlooks Ruhenheim, a peaceful country town. Lunge stays at a hotel whose only guests are an old married couple.',7);
insert into EPISODIO_ENTITY values (743, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531636.jpg', 'A Peaceful Home', 69,'Inspector Lunge and Grimmer are standing on a hill that overlooks the town of Ruhenheim. A disaster will soon befall this seemingly peaceful town. The townspeople will become suspicious of each other and then annihilate each other.',7);
insert into EPISODIO_ENTITY values (744, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531637.jpg', 'Town Bloodbath', 70,'It continues to rain in the town of Ruhenheim. The phones dont connect to the outside, and it is completely isolated. Furthermore, gunshots can be heard throughout the town.',7);
insert into EPISODIO_ENTITY values (745, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531638.jpg', 'The Magnificent Steiners Rage', 71,'In the pouring rain, in the town of Ruhenheim, people have become suspicious of each other and have begun killing each other. Inspector Lunge is saving the surviving townspeople as he searches for the leader of the group that is inciting the massacre.',7);
insert into EPISODIO_ENTITY values (746, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531640.jpg', 'Man Without a Name', 72,'Inspector Lunge tracks down Roberto, the leader of the inciters, and charges in. But Inspector Lunge ends up being defeated by Roberto, who declares that he has no name. Meanwhile, upon meeting Bonaparta, Tenma goes into the town with him to end everything.',7);
insert into EPISODIO_ENTITY values (747, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531642.jpg', 'The Landscape of the End', 73,'Tenma is running through the town in the pouring rain with Franz Bonaparta, also known as Klaus Poppe, in order to save Inspector Lunge, who has gone off to arrest Roberto. The boy Wim comes to them and tells them that Nina has gone to the "Vampires House."',7);
insert into EPISODIO_ENTITY values (748, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/212/531643.jpg', 'The Real Monster', 74,'After the events in Ruhenheim, Tenma is cleared of suspicion of multiple homicide, and the survivors of the case begin to move on with their lives.',7);
