insert into SERIE_ENTITY  values (8, 2011,'https://static.tvmaze.com/uploads/images/medium_portrait/398/996211.jpg', 'Fate/Zero', 'The Holy Grail War is a death-match between 7 magi (Masters) and their summoned heroic spirits (Servants). In this battle royale, the prize is the legendary Holy Grail, said to be an omnipotent wish-granting device which will produce any sort of miracle in order to bend reality to accommodate the wishes it grants. The winning Master and Servant shall be granted one wish each, after which the Holy Grail will not be activated until the next War. As the 4th Holy Grail War progresses, several camps raise the stakes, and the challenges only become bigger and more difficult. Each Master and Servant will be faced with the impact of their own shortcomings, and some of the competitors would do well in remembering that deceit and betrayal do not send prior warning...','https://i.pinimg.com/originals/93/b0/c8/93b0c85098ac04b3f3f13a17eb6f64db.jpg');
