insert into EPISODIO_ENTITY values (749, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493951.jpg', 'Summoning of the Heroic Spirits', 1,'The grail war will start eight years later from the birth of Kiritsugus daughter. Matous and Toushaka family arranged their plans to summon the Holy grail and fulfill their wish. Tohsaka tokiomi made his student Kirei a master for the Holy grail to be as a puppet. Zouken from matous family made his Kariya a master. All the 7 masters then call upon their servants to fight for them to bring the Holy grail home.',8);
insert into EPISODIO_ENTITY values (750, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493952.jpg', 'False Start', 2,'Waver has a hard time commanding his Servant Rider (Alexander the Great), as Rider is more interested in how the world has changed since his time and intends to conquer it once he wins the War. Saber has formed a poor opinion of Kiritsugu, considering him cold-hearted, but is surprised to see him have a tender moment with his daughter Ilya. Saber also admits she admires Kiritsugu and Iris wishes to save the world, as she, too, wishes to save Britain. In Fuyuki City, serial killer Ryuunosuke Uryuu has murdered an entire family except a young boy to summon a demon, but inadvertently calls the servant Caster (Bluebeard). When Uryuu offers the boy to Caster as a sacrifice, Caster pretends to let him go, then kills him with a horrific Cthulhu-esque monster. Uryuu, overjoyed to meet someone as sadistic as him, vows to follow Caster anywhere and becomes his Master. Upon learning the seventh and final Master has been chosen, Kirei orders Assassin to kill Tokiomi, only for Assassin to be ki',8);
insert into EPISODIO_ENTITY values (751, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493953.jpg', 'Land of Winter Trees', 3,'Kirei announces his resignation from the war due to Assassins elimination and is granted asylum by Risei. However, this is actually a ruse by Kirei, Risei and Tokiomi: "Assassin" is not one, but several dozen people. With everyone else believing him out of the game, Kirei can send the Assassins to spy on them without suspicion. Waver informs Rider of Assassins demise, but the latter is only interested of defeating President Clinton, acquiring his countrys military weapons and having a good time. Saber and Iri arrive at Fuyuki City to meet up with Kiritsugu, but decide to tour the city since this is Iris first time abroad. Meanwhile, Kiritsugu meets up with his assistant Maiya Hisau, who informs him the other Masters believe Iri is Sabers Master and that she has smuggled in the guns they need for the war, including his Contender pistol. As Iri has a good time at the beach, Saber detects another Servant at the harbor. Once there, they encounter Lancer, who challenges Saber to a d',8);
insert into EPISODIO_ENTITY values (752, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493954.jpg', 'Blade of the Demonic Spear', 4,'Saber and Lancer fight, while complimenting each other on their skills and chivalry. At the same time, Kiritsugu and Maiya are scouting the battle, with Kiritsugu spotting Lancers hidden Master. As he is about to snipe him, Kiritsugu spots Assassin, who is relaying the battle to Kirei and Tokiomi. Lancers Master orders him to use his Noble Phantasms, Gae Dearg, the anti-magic spear and Gae Buidhe, the cursed spear that inflicts wounds that cannot be healed. From these, Saber recognizes Lancer as Diarmuid of the Love Spot, while Lancer discovers Sabers identity after using Gae Dearg to temporarily dispel the invisibility spell on her sword. Saber, whose left tendon was wounded by Lancers Gae Buidhe, is about to give it her all when Rider, who was watching the battle from afar, suddenly rides down to the harbor on his chariot, interrupting the battle.',8);
insert into EPISODIO_ENTITY values (753, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493955.jpg', 'The Vicious Beast Roars', 5,'Rider introduces himself to Lancer and Saber and asks them to join his army, with both declining. Lancers Master, Kayneth, reveals himself and mocks Waver, but Rider defends him. Soon after, Archer and Berserker join the battle. Berserker, Kariyas Servant, is a Black Knight covered in a fog that prevents all attempts at gauging his strength. Archer attacks Berserker with his Noble Phantasm, Gate of Babylon, but Berserker keeps evading and using Archers weapons against him. To prevent Archer from exposing his Noble Phantasm further, Tokiomi expends a Command Seal to order him to withdraw from the battle, much to Archers displeasure. After seeing Saber, Berserker goes after her and his ability to turn anything he wields into a Noble Phantasm is revealed. Lancer defends Saber out of chivalry, but Kayneth uses a Command Spell to force him to assist Berserker. However, Rider incapacitates Berserker and warns Kayneth to withdraw, or he will side with Saber. After Berserker, Kayneth an',8);
insert into EPISODIO_ENTITY values (754, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493956.jpg', 'Night of Stratagems', 6,'Iri and Saber are driving to Einzbern Castle when they encounter Caster. Caster believes Saber is Jeanne dArc, but Saber tells him he is mistaken and drives him away. Returning to his lair, Caster is convinced "Jeanne" has lost her memories. At his hotel, Kayneth scolds Lancer for failing to kill Saber. Lancer is defended by Sola-Ui Nuada-Re Sophia-Ri, Kayneths fiancee, who is maintaining Lancers existence by supplying him with mana and has fallen for him due to his magic love spot. When the hotels occupants are ordered to evacuate, Kayneth realizes Sabers Master has come for them. After making sure all civilians have evacuated, Kiritsugu and Maiya blow up the hotel using explosives. Maiya is found by Kirei, but escapes thanks to Kiritsugus smoke bomb. When the Assassins inform Kirei, Risei and Tokiomi that Caster and Uryuu have been kidnapping and sacrificing children, Risei is disgusted by their pointless murders and their jeopardising the wars secrecy. In a meeting between',8);
insert into EPISODIO_ENTITY values (755, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493957.jpg', 'Forest of Demons', 7,'Risei informs all the active Masters that the war is to be put on hold until Caster, whose killings of children are attracting the public attention, is destroyed, with an additional Command Spell as a reward. In Einzbern Castle, Kiritsugu plans to use the hunt for Caster to attack the other Masters, despite Sabers protests that they should give priority to stopping Casters atrocities. As Kiritsugu confides in Iri that he would rather escape with her and their daughter and live in peace somewhere, Iri detects Caster arriving from the forest with more children to be sacrificed and sends Saber after him. Saber is ambushed and cornered by Casters summoned monsters until Lancer appears and joins forces with her. As Iri and Maiya leave the castle, Kayneth, who had survived the hotel bombing thanks to his Volumen Hydragyrum, a giant magical blob of mercury, infiltrates the castle to duel Sabers Master. Kiritsugu evades Kayneth using his Calico M950 and launches a surprise attack with h',8);
insert into EPISODIO_ENTITY values (756, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493958.jpg', 'The Magus Killer', 8,'Iri and Maiya are about to escape through the woods until Iri detects Kirei coming their way. Instead of evading him, Iri and Maiya decide to confront him in order to protect Kiritsugu. However, both of them are outmatched. Meanwhile, Kiritsugu is able to wound Kayneth with his Contender pistol. Believing the attack was a fluke, Kayneth decides to increase Hydragyrums defense even further. Saber and Lancer continue fighting Casters waves of demonic creatures, which prove limitless due to his Noble Phantasm, his grimoire. Saber manages to clear a path for Lancer, who pierces Casters grimoire with Gae Dearg, cutting off his source of mana and instantly destroying his minions, causing him to flee. After hiding from an enraged and injured Kayneth, Kiritsugu finally appears and shoots him with his Contender again. Because the Contender uses special anti-magic bullets, Kayneths Hydragyrum not only fails to protect him, but amplifies his injury significantly. Lancer arrives to save his',8);
insert into EPISODIO_ENTITY values (757, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493960.jpg', 'Master and Servant', 9,'Kayneth wakes up with his body tied to a bed. Sola tells Kayneth that his Magic Circuits were destroyed by Kiritsugus bullets and he can never use magic again. At Solas mercy, Kayneth has no choice but to relinquish Lancers command to her. Despite Sola becoming his new Master, Lancer wishes to remain loyal to Kayneth, but Sola convinces him to keep fighting with her, using Kayneths honor as a pretext. Kiritsugu decides to hunt Kayneth down despite Saber and Iris wishes to stop Caster. Meanwhile, Waver and Rider manage to find Casters lair, where they are horrified to see the mutilated bodies of his victims. Before setting Casters lair on fire, Rider kills an Assassin targeting Waver and drives off two more. With Waver and Rider now knowing their secret, Tokiomi orders Kirei to send his Assassins to spy on them.',8);
insert into EPISODIO_ENTITY values (758, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493962.jpg', 'Rins Adventure', 10,'This episode focuses on Tokiomis daughter, Rin, and her involvement in the Fuyuki City Kidnappings. Despite her young age, Rin is determined to follow in her fathers footsteps as a great mage. With the Holy Grail War starting soon, Tokiomi sends Aoi and Rin away for their own safety. At Rins new school, several children, including her best friend Kotone, have been kidnapped by the Fuyuki Serial Killer. Wishing to save Kotone, Rin heads to Fuyuki City alone. Using a mana detector gifted to her by her father, she eventually finds Uryuu using a magic bracelet to hypnotize children. Rin follows Uryuu to his hideout, where she is found by him. Rin overloads Uryuus bracelet with mana, destroying it, incapacitating him and freeing the children from his control. With everyone safe, Rin heads home only to be ambushed by one of Casters monsters; however, Kariya comes to her rescue and later hands her to Aoi. Kirei, who had been spying on them through Assassin, orders him to continue moni',8);
insert into EPISODIO_ENTITY values (759, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493964.jpg', 'The Grail Dialogue', 11,'Rider and Waver, unexpectedly arrive at Einzbern Castle. Rider declares his intention to have a peaceful discussion with her and Archer on the subject of kingship and the wishes they want the grail to grant. Saber argues a King should serve his people selflessly and wishes to use the grails power to save Britain. Rider criticises her, saying that Sabers emotional distance from her subjects led to their dissatisfaction and proposes his own ideal, namely that people should serve the king, whose extravagant ambitions inspire them in turn. Their talk is interrupted by the arrival of the Assassins. When they rebuff Riders offer to join the feast, Rider summons his Noble Phantasm "Ionian Hetairoi," the Armies of Macedonia, composed of his loyal soldiers who also became Servants after their death. Rider and his army easily decimate every single Assassin. With their meeting over, Rider tells Saber he no longer recognises her as a king and departs. A conflicted Saber reveals to Iri that o',8);
insert into EPISODIO_ENTITY values (760, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493965.jpg', 'Invitation of the Holy Grail', 12,'Thanks to the information provided by the Assassins before their annihilation, Tokiomi and Kirei now know about Riders Noble Phantasm and decide to let him attack the other Servants first before engaging him. While Maiya transports Iri and Saber to their new headquarters, Kiritsugu reviews his intel about the other contestants whereabouts. At their new headquarters, Saber points out Iris odd behavior, which forces her to admit that her powers have weakened. Archer questions Kirei about what he learned by spying on the other contestants and points out that Kirei has shown an unusually large interest in Kariya, despite the minimal threat he poses. From this, Archer concludes that Kirei enjoys seeing the pain and suffering of others. Though initially reluctant to acknowledge his dark nature, Kirei eventually gives in, at which point the Command Spells reappear on his hand, signifying that he is still meant to be a contestant. Since he currently has no Servant, however, Archer hints',8);
insert into EPISODIO_ENTITY values (761, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493966.jpg', 'The Forbidden Banquet', 13,'Caster and Uryuu returns to their lair and are dismayed to see their "artwork" destroyed by Riders fire. Uryuu cheers Caster up by sharing his twisted view that God, who Caster hates the most for Jeannes death, is just a spectator who enjoys seeing humans do whatever they want. Impressed by his Masters idea, Caster plans a "grand spectacle" for God. Meanwhile, Waver has second thoughts about being a worthy master for Rider, but Rider encourages him to believe in himself. Suddenly, Waver, Rider, Saber and Iri sense magic from Mion River. When they arrive, they witness Caster summoning a giant demonic monster. Rider informs the other contestants and they all agree on a temporary alliance to stop Caster before his monster destroys the city. With Rider leading the vanguard, Saber joins him to give Lancer an opening to use his spears on Caster.',8);
insert into EPISODIO_ENTITY values (762, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493968.jpg', 'The Mion River Battle', 1,'Saber, Lancer, and Rider fight to stop Casters demon from reaching the shore. However, it regenerates at an astounding pace, making it difficult to destroy. Kirei and Risei discuss plans to cover up the incident, while Archer and Tokiomi watch the battle aboard Archers aircraft, the Vimana. Tokiomi pleads with Archer to assist in destroying Caster, but the latter refuses after sacrificing four of his weapons to damage the beast. A crowd of bystanders begins to gather along the river and a pair of F-15 jets are caught in the battle while patrolling the area. Berserker appears, takes control of one of the jets, and engages in aerial combat with Archers Vimana while the other jet is consumed by Casters demon. Kariya confronts Tokiomi about his treatment of Sakura, and is enraged when Tokiomi simply dismisses his wife and daughters as rabble. He attacks him as Kirei watches their fight from afar. Uryuu, watching from the bank, is sniped by Kiritsugu and dies. Caster senses the d',8);
insert into EPISODIO_ENTITY values (763, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493970.jpg', 'Golden Brilliance', 2,'As Archer and Berserker continue to battle in the sky, Saber and Rider are forced to retreat from Casters demon to rethink their strategy. Rider proposes transporting the demon inside of Ionian Hetairoi, where his armies will hold it off as long as they can while Saber and Lancer find a way to finally destroy it. Kiritsugu calls and explains to Waver how they will defeat the demon and tells him to inform Lancer about Sabers Noble Phantasm. Lancer realizes what Kiritsugu means and destroys his Gae Buidhe to allow Sabers wound to heal and fully use her Noble Phantasm. Tokiomi defeats Kariya by burning him with a blast of fire. He falls from the building, and is later found by Kirei, who is on the verge of killing him but decides to heal him instead. Berserker destroys Archers Vimana, but is drawn by the unveiling of Sabers sword and begins attacking her instead. Lancer and Archer attack him and destroy his jet. With the coast clear, Kiritsugu fires a flare gun to signal to Waver',8);
insert into EPISODIO_ENTITY values (764, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493971.jpg', 'The End of Honor', 3,'Kayneth visits Risei and asks for his reward for Lancers role in defeating Caster. Risei agrees to reward Kayneth with a Command Seal, but after receiving it, Kayneth immediately shoots and kills him to ensure that no other Masters can get one. During the battle at the Mion River, Maiya finds Sola-Ui and cuts off the arm bearing her Command Seals, then kidnaps her. Kayneth scolds Lancer for not protecting Sola-Ui and mocks him. Saber and Iri, tipped off by Kiritsugu, arrive at Kayneths hideout, where Saber and Lancer decide the time is right to finish their duel. Kiritsugu confronts Kayneth and, holding Sola-Ui at gunpoint, gives Kayneth a contract of geas that will prevent Kiritsugu from killing him and Sola-Ui if he uses his last Command Seal to force Lancer to commit suicide. Desperate, Kayneth agrees to the deal, causing Lancer to curse everyone around him, especially Saber, before he dies, impaled on his own lance. But the contract only binds Kiritsugu from harming them perso',8);
insert into EPISODIO_ENTITY values (765, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493972.jpg', 'The Eighth Contract', 4,'Kirei discovers Riseis body and informs Tokiomi. Kirei is saddened by his fathers death, although Archer suggests that his sadness is due to not having had the chance to kill his father himself. Maiya informs Iri and Saber that Tokiomi wishes to form an alliance with them, and Iri agrees to go to the church to discuss the offer. Before the meeting, Tokiomi visits his wife and Rin, giving his daughter a magus book and some wisdom before leaving. During the meeting, Tokiomi suggests a temporary alliance to defeat the other Masters first and ensure that a representative of the three families, not an outsider, will attain the Grail. Iri agrees, but on the condition that Kirei leaves the city and is no longer involved in the War. Tokiomi complies. As they depart, Iri reveals to Maiya that she is the embodiment of the Holy Grail in human form and will soon die to create the Grail near the end of the war. Maiya promises to protect her until that time comes. Meanwhile, Kirei reveals to Ar',8);
insert into EPISODIO_ENTITY values (766, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493973.jpg', 'Distant Memories', 5,'Years ago, a young Kiritsugu lived on Alimango island in the Philippines with his father Noritaka and his fathers assistant, a local girl named Shirley who called him Kerry. Noritaka was conducting research on immortality using plants. Despite being told by the townsfolk to stay away from Noritaka, Shirley is convinced his research will help the world and tells Kiritsugu she hopes he grows up to be great man. But one morning, Kiritsugus father asks him if he went into his lab, and then tells him not to leave their house. Kiritsugu ignores his fathers warning and goes to search for Shirley, only to find her at her house in a frenzy, devouring live chickens. Shirley reveals that she went into Noritakas lab and use his immortality formula on herself, which turned her into a Dead Apostle vampire with an incessant craving for blood. Shirley begs Kiritsugu to kill her while she is still herself, but he is unable to do it, and she attacks the townsfolk, turning them into Ghouls. As cha',8);
insert into EPISODIO_ENTITY values (767, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493975.jpg', 'Where Justice is Found', 6,'After leaving the island, Kiritsugu began living with Natalia, who trained him to become a mercenary like her and travel around the world as a hired gun. Due to his unique magic, Natalia removes several of Kiritsugus ribs and uses them to create sixty-six magic bullets that have a devastating effect against magi. Natalia and Kiritsugu are assigned to kill Odd Dvorak, a Dead Apostle mage who controls bee familiars that turn their victims into Ghouls. While Natalia boards the plane that Dvorak is taking from Paris, Kiritsugu heads to his destination of New York to kill the mages associate there. Both Natalia and Kiritsugu successfully eliminate their targets. However, Dvorak was concealing bees in his body which turn all the passengers and crew into ghouls. Natalia manages to get into the cockpit safely, but with the plane filled with ghouls, she asks Kiritsugu to do something for her. He surprises Natalia by saying he already has something planned. As her plane draws closer to New',8);
insert into EPISODIO_ENTITY values (768, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493976.jpg', 'Return of the Assassin', 7,'Kiritsugu visits an ailing Iri in the storehouse. She gives her husband the scabbard Avalon and asks him to bring their daughter Ilya to see Japan once the War is over. Learning from Maiya that Saber has gone to battle Rider, Kiritsugu assigns Maiya to protect his wife while he goes to assassinate Tokiomi. Meanwhile, Waver heads to the forest where he summoned Rider in order to replenish his mana before Riders intended fight with Saber, whom he wishes to battle to set her straight on what it means to be a king. Kariya has a nightmare in which Berserker speaks to him before awakening chained in the cellar of the Matou house. To heal Kariya, Zouken forces him to swallow the crest worm that first tasted Sakuras purity. Iri talks with Maiya about the latters past as a child soldier, and implores her to live her own life after the war. Iri tells Maiya her wish that this Grail War will be the last so that Ilya can live a normal life. At the same time, Kiritsugu arrives at the Thosaka m',8);
insert into EPISODIO_ENTITY values (769, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493977.jpg', 'Knight on Two Wheels', 8,'As Saber chases Rider through the city on her motorcycle, Kiritsugu investigates and concludes that Rider was not responsible for attacking Iri and Maiya. Saber catches up to the real Rider and Waver, and the two Servants duel, resulting in the destruction of Riders chariot. Meanwhile, concluding that the Matous were behind his wifes kidnapping, Kiritsugu tortures Kariyas brother Byakuya, who reveals that Kariya was working with Kirei. Kirei made a deal with Kariya to kidnap Iri using Berserkers Noble Phantasm, which allows him to disguise himself as another hero (in this case Rider), in return for the restoration the two Command Seals this consumed and the promise of a duel with Tokiomi at the church. When Kariya leaves, Kirei orders Zouken, who has been hiding and watching them, to show himself. Zouken remarks that he and Kirei are the same in their enjoyment of watching Kariya suffer, before he is driven away by Kirei. Kariya arrives at the church to duel Tokiomi only to find',8);
insert into EPISODIO_ENTITY values (770, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493979.jpg', 'All Evil in This World', 9,'Waver returns to the Mackenzie household. The old couple, who Waver put under a spell to make them believe he was their grandson, are actually aware he isnt related to them, but enjoyed his and Riders company. In Casters lair, Kirei interrogates Iri about Kiritsugu, who he believes is like himself. However, Iri tells him her husband has nothing in common with an empty man like him, as Kiritsugu is fighting for the Grail to wish for a world without conflict. Disappointed, Kirei kills Iri and vows to destroy Kiritsugus dream. Later that night, Rider and Waver see magical flares sent up the theater, meant to lure them into a duel with Archer. As Rider summons his horse Bucephalus, Waver decides to use all of his Command Seals to give Rider the power he needs to win and conquer the world, as he feels he is no longer worthy of being his Master. Instead, Rider tells Waver he considers him a friend and wants him to ride with him into battle. Kiritsugu and Saber sees the flares as well,',8);
insert into EPISODIO_ENTITY values (771, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493981.jpg', 'The Sea at the End of the World', 10,'As Kiritsugu and Saber arrive at the theater on separate paths, Saber is attacked by a gun-wielding Berserker in the underground parking lot. Meanwhile, Rider and Waver encounter Archer on the bridge. As they share a final toast before their duel, Rider asks Archer to join forces with him and conquer the world and beyond, but Archer politely declines. Saber manages to destroy Berserkers gun, but is startled to find he knows the exact length of her sword. She ask for his true identity, and Berserker removes his mask to reveal Sir Lancelot, one of Sabers most trusted knights, gravely shocking her. At the same time, a dying Kariya begins hallucinating due to his guilt over Aoi. Rider summons Ionian Hetairoi and he and his army charge at Archer. Archer pulls out his sword Ea and uses his Noble Phantasm Enuma Elish to destroy Riders army and Ionian Hetairoi, sending them back into real world. Rider asks Waver if he would like to become his retainer, to which he agrees. Rider pulls out',8);
insert into EPISODIO_ENTITY values (772, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493983.jpg', 'The Last Command Seal', 11,'With Kiritsugu and Kirei fighting with all of their skills, Saber finally kills Lancelot where they share one last talk together. As both Kiritsugu and Kirei are about to give each other the finishing blow, a black ooze from the Grails spreads over them. Kiritsugu finds himself in an illusionary world where the Grail, taking the form of his wife Iri, tells him he is worthy to make a wish for the Grail. However, Kiritsugu is shocked that the Grail is evil when it deconstructs his belief of killing the few for the sakes of many and tells him it cannot save the world and end conflict unless all of humanity must die which it wants to do once it is born onto Earth. The Grail attempts to convince Kiritsugu to make his wish by promising he will be together with his family again by taking the form of both Iri and Ilya. However, Kiritsugu rejects the Grail and kills both his wife and child, as his personal happiness is not worth the cost of the global population. For this, he is cursed by t',8);
insert into EPISODIO_ENTITY values (773, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493984.jpg', 'Fate/Zero', 12,'In the aftermath of the destruction of the Grail, a guilt-ridden Kiritsugu searches for survivors, finding only death and despair. In the end, he only finds a young boy named Shirou, who is the sole survivor. While attempting to visit the Einzbern many times, Jubstacheit never opened the forests barrier as he didnt return with the grail, and he never sees Illya again. He then decides to live in Fuyuki City with Shirou, whom he adopts. Five years later, Kiritsugu tells Shirpi how he once wished to be a hero. Shirō promises his father that he will fulfill that dream for him. The episode ends with Kiritsugu remembering the question Shirley asked him long ago about what he wanted to be when he grew up, to which he had replied, I want to be a hero',8);
