insert into SERIE_ENTITY  values (12, 2006,'https://static.tvmaze.com/uploads/images/medium_portrait/403/1009233.jpg', 'Death Note', 'Death Note is an anime series based around a manga of the same name whereby a human finds a death gods notebook. Any persons name written in this notebook will die. The main character who finds this noteboook is Light Yagami who faces off against an unfaced character named L who tries to challenge him.','https://c4.wallpaperflare.com/wallpaper/1017/4/915/death-note-death-note-anime-wallpaper-preview.jpg');
