insert into EPISODIO_ENTITY values (902, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317298.jpg', 'Rebirth', 1,'Brilliant but bored high school student Light Yagami suddenly finds himself holding the power of life and death in his hands.',12);
insert into EPISODIO_ENTITY values (903, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317299.jpg', 'Confrontation', 2,'While the worlds criminals continue to drop dead, L meets by computer with representatives from various nations.',12);
insert into EPISODIO_ENTITY values (904, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317300.jpg', 'Dealings', 3,'Ryuk, the Shinigami, or god of death, who dropped the Death Note into the human world, warns Light that someone is on his trail.',12);
insert into EPISODIO_ENTITY values (905, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317301.jpg', 'Pursuit', 4,'Light--now known to the world as Kira--tests the Death Note to understand the scope of its powers by killing off six convicts in various ways...',12);
insert into EPISODIO_ENTITY values (906, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317302.jpg', 'Tactics', 5,'Soichiro Yagami demands to meet with L in person when he finds out that L has secretly brought FBI agents into Japan.',12);
insert into EPISODIO_ENTITY values (907, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317303.jpg', 'Unraveling', 6,'Light meets a woman at the Police Department with an urgent message for the Kira task force.',12);
insert into EPISODIO_ENTITY values (908, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/103/258276.jpg', 'Overcast', 7,'Light uses the Death Note to try to get rid of the woman who could get him captured, and is shocked when it doesnt work.',12);
insert into EPISODIO_ENTITY values (909, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317304.jpg', 'Glare', 8,'L insists on setting up bugs and cameras in the homes of Chief Yagami and Deputy Director Kitamura...',12);
insert into EPISODIO_ENTITY values (910, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317305.jpg', 'Encounter', 9,'The murders continue, and L grows suspicious of Lights too-perfect behavior and decides to investigate him on his own.',12);
insert into EPISODIO_ENTITY values (911, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317306.jpg', 'Doubt', 10,'Ls suspicion of Light deepens, compelling him to invite Light into the investigation.',12);
insert into EPISODIO_ENTITY values (912, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317307.jpg', 'Assault', 11,'As predicted on the tapes sent to Sakura TV, news anchors and commentators who expressed doubt about Kira die one by one.',12);
insert into EPISODIO_ENTITY values (913, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317308.jpg', 'Love', 12,'With a second Kira now on the loose, L asks Light to join the task force and pose as the real Kira in order to catch the copycat.',12);
insert into EPISODIO_ENTITY values (914, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317309.jpg', 'Confession', 13,'Light goes to Aoyama to discover the identity of the second Kira before L becomes more suspicious.',12);
insert into EPISODIO_ENTITY values (915, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317310.jpg', 'Friend', 14,'Light and Misa show each other their Death Notes, and Light asks Misa to have her shinigami Rem get rid of L.',12);
insert into EPISODIO_ENTITY values (916, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317311.jpg', 'Wager', 15,'Evidence turns up that points to Misa Amane as the second Kira.',12);
insert into EPISODIO_ENTITY values (917, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317312.jpg', 'Decision', 16,'Misa is in confinement, though her memories of the Death Note have been completely wiped away.',12);
insert into EPISODIO_ENTITY values (918, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317313.jpg', 'Execution', 17,'After fifty days of confinement the killings continue, and Misa and Light are released.',12);
insert into EPISODIO_ENTITY values (919, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317314.jpg', 'Ally', 18,'Though L is still suspicious, Light and Misa, their memories of being Kira wiped clean, return to headquarters...',12);
insert into EPISODIO_ENTITY values (920, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317315.jpg', 'Matsuda', 19,'Matsuda, the task force member assigned to watch Misa, is eager to distinguish himself...',12);
insert into EPISODIO_ENTITY values (921, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317480.jpg', 'Makeshift', 20,'Ls team discovers that the Yotsuba Group meet in secret to discuss the elimination of individuals who are troublesome to their company...',12);
insert into EPISODIO_ENTITY values (922, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317481.jpg', 'Performance', 21,'The Yotsuba Group hires Eraldo Coil to uncover Ls identity.',12);
insert into EPISODIO_ENTITY values (923, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317482.jpg', 'Guidance', 22,'Misa succeeds in narrowing down the Kira suspects in the Yotsuba Group to one: Higuchi.',12);
insert into EPISODIO_ENTITY values (924, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317483.jpg', 'Frenzy', 23,'Higuchi of the Yotsuba Group attempts to kill Matsuda of the task force, and is surprised when he doesnt die after 40 seconds.',12);
insert into EPISODIO_ENTITY values (925, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317484.jpg', 'Revival', 24,'Higuchi is captured and tells the investigators about the Death Note.',12);
insert into EPISODIO_ENTITY values (926, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317485.jpg', 'Silence', 25,'Light, his memory recovered, orders Misa to begin killing after Higuchi dies.',12);
insert into EPISODIO_ENTITY values (927, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317486.jpg', 'Renewal', 26,'Light has removed everyone in his way and is closer to achieving his perfect world.',12);
insert into EPISODIO_ENTITY values (928, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317487.jpg', 'Abduction', 27,'A new investigator steps forward--Near, a central figure in the SPK, an organization that is trying to catch Kira without relying on L.',12);
insert into EPISODIO_ENTITY values (929, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317488.jpg', 'Impatience', 28,'Light, acting as L, reveals to Near that his sister Sayu has been kidnapped by someone wanting to trade her for the Death Note.',12);
insert into EPISODIO_ENTITY values (930, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317489.jpg', 'Father', 29,'Light tries to discover where Mello and his Mafia associates are hiding and uses Misas eyes to find the Death Notes current owner.',12);
insert into EPISODIO_ENTITY values (931, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317490.jpg', 'Justice', 30,'Mello busts into SPK headquarters to retrieve a photograph of himself to make sure he wont be killed by Kira.',12);
insert into EPISODIO_ENTITY values (932, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317491.jpg', 'Transfer', 31,'Near contacts the Japanese task force and determines that Kira is among their members.',12);
insert into EPISODIO_ENTITY values (933, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317492.jpg', 'Selection', 32,'Star newscaster Kiyomi Takada becomes Kiras spokesperson to the world...',12);
insert into EPISODIO_ENTITY values (934, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317493.jpg', 'Scorn', 33,'Light pretends to investigate Kiyomi...',12);
insert into EPISODIO_ENTITY values (935, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317494.jpg', 'Vigilance', 34,'Aizawa figures out whats going on and tells Near, who already knows about the notes.',12);
insert into EPISODIO_ENTITY values (936, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317495.jpg', 'Malice', 35,'Light gives Kiyomi the order to finish off Near.',12);
insert into EPISODIO_ENTITY values (937, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317496.jpg', '1.28', 36,'Near, along with the SPK, meets Light and the task force at a warehouse for the final showdown.',12);
insert into EPISODIO_ENTITY values (938, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/126/317497.jpg', 'New World', 37,'Though Mikami has written all the investigators names in the Death Note, a minute passes and everyone is still alive.',12);
