insert into SERIE_ENTITY  values (13, 2005,'https://static.tvmaze.com/uploads/images/medium_portrait/41/104392.jpg', 'Tu voz estéreo', 'Tu voz estéreo is a television series Colombian created by Caracol Television and produced by Daniel Bautista emitted in the schedule of 18:00 to 19:00. Among its initial librettists he featured Saldarriaga and Julio Ricardo Castaneda. Among its main actors they have been Milena Catalina Aristizabal (table for three and Saga) and Alejo (Juan Pablo Espinosa), after entering Andrea (Maria Jose Martinez) and Felipe (Italo Londeros). After the departure of Italo Londeros, it gave as speaker Sebastian (Alejandro Estrada, ex-contestant protagonists of our tele of RCN Television) who was later replaced by actor Peter Falla as Andrew. Michelle Rouillard, as Sara, she joined replacing José María; In 2016 Maria Laura Quintero entered the program by the group in September.','https://caracoltv.brightspotcdn.com/dims4/default/462a864/2147483647/strip/true/crop/640x329+0+48/resize/1440x740!/quality/90/?url=https%3A%2F%2Fcaracol-brightspot.s3-us-west-2.amazonaws.com%2Fassets%2Fcaracoltv%2F35091b27cea5ba6b11ae5a7319a5bd54.jpg');
