insert into SERIE_ENTITY  values (14, 2008,'https://static.tvmaze.com/uploads/images/medium_portrait/41/104321.jpg', 'La rosa de Guadalupe', 'La rosa de Guadalupe (The Rose of Guadalupe) is a Mexican anthology drama series created and produced by Carlos Mercado Orduña for Televisa. Each episode presents a self-contained story. Canal de las Estrellas is currently broadcasting it on Monday, Wednesday, and Friday at 5:15 P.M. The show has been panned by Mexican viewers and critics. The show lacks of proper acting, writing and directing. Some talk shows have criticized the corny effects and acting of the show, as well as the lack of research the shows writers had put into for episodes dealing with certain social groups that some episodes focus on (Emos, goths, anime fans). It also covered current topics and issues as well.','https://st1.uvnimg.com/75/30/9273d12147f1acece077b230f017/universal.jpg');
