insert into SERIE_ENTITY  values (15, 2011,'https://static.tvmaze.com/uploads/images/medium_portrait/87/219506.jpg', 'Como dice el dicho', 'Como dice el dicho (As the saying) is a telenovela set in Mexico City, mostly at a coffee shop named "El Dicho" owned by Don Tomás, where he is helped by his granddaughter Isabel (Seasons 1–4) and his employees Poncho (Seasons 1–5) and Marieta (Season 4–present). Episodes usually center around the customers, who most of the time are dealing with a problem. Throughout the episode a saying is written in one of the white walls of the coffee shop, either by Don Tomás, one of his employees or by a customer. The saying that is written is usually describing the situation of what is happening in the particular moment it is written.','https://univision.ca/wp-content/uploads/2020/09/Como-Dice-El-Dicho-slider.jpg');
