insert into SERIE_ENTITY  values (16, 2022,'https://static.tvmaze.com/uploads/images/medium_portrait/422/1056726.jpg', 'Chainsaw Man', 'Denji has a simple dream—to live a happy and peaceful life, spending time with a girl he likes. This is a far cry from reality, however, as Denji is forced by the yakuza into killing devils in order to pay off his crushing debts. Using his pet devil Pochita as a weapon, he is ready to do anything for a bit of cash. Unfortunately, he has outlived his usefulness and is murdered by a devil in contract with the yakuza. However, in an unexpected turn of events, Pochita merges with Denjis dead body and grants him the powers of a chainsaw devil. Now able to transform parts of his body into chainsaws, a revived Denji uses his new abilities to quickly and brutally dispatch his enemies. Catching the eye of the official devil hunters who arrive at the scene, he is offered work at the Public Safety Bureau as one of them. Now with the means to face even the toughest of enemies, Denji will stop at nothing to achieve his simple teenage dreams.','https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/cbf4b076-baf2-4e20-bf43-37175271e72c/dffcuhh-af2dd21c-6ab4-460a-97c7-7af05eec2797.jpg/v1/fill/w_1280,h_720,q_75,strp/denji_chainsaw_from_chainsaw_man_wallpaper_by_vilex45_dffcuhh-fullview.jpg?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..PoFEKR_1l2DmVX6u8YBayFpUJKJ0LO6TZCE96rFIhJo');
insert into SERIE_ENTITY_PLATAFORMAS  values (16, 3);
