insert into EPISODIO_ENTITY values (3334, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/426/1065250.jpg', 'Dog & Chainsaw', 1,'To pay off his debt, teenager Denji starts hunting devils for the Yakuza with his buddy Pochita, a "Chainsaw Devil". Just when things seem like they couldnt get any worse, Denji is betrayed by the Yakuza.',16);
insert into EPISODIO_ENTITY values (3335, 24, 'https://static.tvmaze.com/uploads/images/medium_landscape/427/1067774.jpg', 'Arrival in Tokyo', 2,'Denji finds himself in love with Makima, one of the Public Safety Devil Hunters. At the Devil Hunters Headquarters in Tokyo, Denji gets introduced to Aki Hayakawa, a senior hunter that he is supposed to partner up with.',16);
insert into EPISODIO_ENTITY values (3336, 24, 'https://static.tvmaze.com/uploads/images/medium_landscape/428/1070222.jpg', 'Meowys Whereabouts', 3,'After Powers attack on the Sea Cucumber Devil, Makima confronts the team and urges them to deliver better results. Power tries to blame Denji, making their teamwork more complicated. But then Power starts talking about her old pet cat Meowy ...',16);
insert into EPISODIO_ENTITY values (3337, 24, 'https://static.tvmaze.com/uploads/images/medium_landscape/428/1072469.jpg', 'Rescue', 4,'After defeating the Bat Devil and rescuing Power, Denji is supposedly one step closer to his dream. However, the joy does not last long, as he is suddenly attacked by the Leech Devil.',16);
insert into EPISODIO_ENTITY values (3338, 24, 'https://static.tvmaze.com/uploads/images/medium_landscape/429/1074818.jpg', 'Gun Devil', 5,'After Power has made good on her promise to Denji, the latter still doesnt quite know what to make of the matter. When he talks to Makima about it, she explains her personal view of the matter and makes him an offer he cant refuse.',16);
insert into EPISODIO_ENTITY values (3339, 24, 'https://static.tvmaze.com/uploads/images/medium_landscape/430/1077129.jpg', 'Kill Denji', 6,'Tokyo Special Division 4 is stuck on the 8th floor of the hotel. Not everyone on the team can handle this unforeseen and seemingly hopeless situation very well and soon the situation threatens to get out of control.',16);
insert into EPISODIO_ENTITY values (3340, 24, 'https://static.tvmaze.com/uploads/images/medium_landscape/431/1079687.jpg', 'The Taste of a Kiss', 7,'Denji fights a fierce battle against the Eternity Devil to end their hopeless situation at the hotel. But the terrible experiences have left deep scars on Kobeni and Arai and they now want to leave the Public Safety Department.',16);
insert into EPISODIO_ENTITY values (3341, 24, 'https://static.tvmaze.com/uploads/images/medium_landscape/432/1081231.jpg', 'Gunfire', 8,'After Denji spent the night with Himeno, the two make a deal the next morning. Meanwhile, Makima travels to Kyoto to for a briefing.',16);
insert into EPISODIO_ENTITY values (3342, 24, 'https://static.tvmaze.com/uploads/images/medium_landscape/433/1084055.jpg', 'From Kyoto', 9,'In the fight against Denji, the attacking group calls in reinforcements to overwhelm their target. At the same time,  two Public Safety Devil Hunters are ready to meet Makima at Kyoto Station when news of the attacks is delivered to them.',16);
insert into EPISODIO_ENTITY values (3343, 24, 'https://static.tvmaze.com/uploads/images/medium_landscape/434/1087359.jpg', 'Bruised & Battered', 10,'Aki wakes up in the hospital and is visited by Tendo and Kurose. Meanwhile, Makima calls Denji and Power in and introduces them to their new combat instructor, Kishibe.',16);
insert into EPISODIO_ENTITY values (3344, 24, 'https://static.tvmaze.com/uploads/images/medium_landscape/436/1090684.jpg', 'Mission Start', 11,'Aki successfully completes the pact with the Future Devil. After their training, Denji and Power are ready to prove their skills in real combat. They get the opportunity to do so in the next operation of the new Special Division 4, which now has to hunt Samurai Sword and Snake Girl.',16);
insert into EPISODIO_ENTITY values (3345, 24, 'https://static.tvmaze.com/uploads/images/medium_landscape/437/1094070.jpg', 'Katana vs. Chainsaw', 12,'No hay resumen disponible',16);
