insert into SERIE_ENTITY  values (17, 2004,'https://static.tvmaze.com/uploads/images/medium_portrait/11/28726.jpg', 'Elfen Lied', 'Nyu is a babe in the woods.Lucy is a vicious killer.If only they didn t share the same body!A strange girl washes up on shore naked, unable to communicate, scared and alone. Another, a powerful mutant, uses her inhuman telekinetic powers to escape from her prison and leaves a trail of death and destruction behind her. These two couldn t be more opposite...except for the fact that they are both the same person. When two cousins give the strange girl shelter, will they come to realise the deadly secret that lies inside the mind of this horrible monster?','https://i.pinimg.com/originals/3c/2c/65/3c2c652bb534fe0b486f62656e033c18.jpg');
