insert into SERIE_ENTITY  values (18, 2015,'https://static.tvmaze.com/uploads/images/medium_portrait/21/54602.jpg', 'Rakudai Kishi no Cavalry', 'The "school sword action" story revolves around Magic Knights, modern magic-users who fight with weapons converted from their souls. Ikki Kurogane goes to a school for these Magic Knights, but he is the "Failed Knight" or "Worst One" who is failing because he has no magical skills. However, one day, he is challenged to a duel by Stella, a foreign princess and the "Number One" student. In this duel, "the loser must be obedient for life".','https://e1.pxfuel.com/desktop-wallpaper/225/245/desktop-wallpaper-myanimelist-rakudai-kishi-no-cavalry.jpg');
