insert into EPISODIO_ENTITY values (3359, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/214/536001.jpg', 'Failed Knight I', 1,'Ikki Kurogane walks in on Princess Stella Vermillion changing clothes. A duel will settle the matter, but Stella raises the stakes, obligating the loser to lifelong servitude.',18);
insert into EPISODIO_ENTITY values (3360, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/214/536002.jpg', 'Failed Knight II', 2,'Ikkis sister, Shizuku, enrolls in the school and causes quite the commotion upon seeing him. With Shizukus arrival, Stella learns more about Ikkis history.',18);
insert into EPISODIO_ENTITY values (3361, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/214/536004.jpg', 'Failed Knight III', 3,'Shizuku invites Ikki to go shopping, but is annoyed when Stella joins them. Ikki meets Shizukus roommate, whose device helps the group as they encounter some serious trouble!',18);
insert into EPISODIO_ENTITY values (3362, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/214/536005.jpg', 'Failed Knight IV', 4,'Ikkis first official match approaches! Unfortunately, he and his opponent, Shizuya Kirihara, have a history. Worse, Kirihara has the immediate upper hand due to his device.',18);
insert into EPISODIO_ENTITY values (3363, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/214/536006.jpg', 'The Experience of the Princess', 5,'As a result of his selection match performances, Ikki gains an unexpected following. Kagami gives Stella some advice that may save the princess and Ikki from parting ways.',18);
insert into EPISODIO_ENTITY values (3364, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/214/536007.jpg', 'Sword Eater I', 6,'Another student wishes to be Ikkis pupil, but doesnt quite know how to ask. Despite her initial awkwardness, Ayatsuji proves to be a hard worker and talented with a sword.',18);
insert into EPISODIO_ENTITY values (3365, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/214/536008.jpg', 'Sword Eater II', 7,'Ikkis impending opponent might be the most difficult one yet. Hell have to rely on his skill and determination to help a friend rediscover their honor.',18);
insert into EPISODIO_ENTITY values (3366, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/214/536009.jpg', 'Sword Eater III', 8,'In an effort to help Ayase and her father, Ikki challenges Kuraudo Kurashiki, a swordsman from Donro Academy with the nickname "Sword Eater".',18);
insert into EPISODIO_ENTITY values (3367, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/214/536010.jpg', 'Princess Vacation', 9,'Stella and Ikki head to what they think is a vacation, only to find multiple surprises lying in wait. Meanwhile, Shizuku makes a visit home.',18);
insert into EPISODIO_ENTITY values (3368, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/214/536011.jpg', 'Witch of the Deep Ocean vs Raikiri', 10,'Shizukus next opponent is none other than the student council president, Toka Todo. In the clash between lightning and water, which blazer will emerge as the victor?',18);
insert into EPISODIO_ENTITY values (3369, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/214/536012.jpg', 'An Uncrowned Champion I', 11,'An innocent kiss shared in secret becomes the catalyst for a scandal, and Ikki is taken by the ethics committee on counts of "indecent" behavior with the Crimson Princess.',18);
insert into EPISODIO_ENTITY values (3370, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/214/536013.jpg', 'An Uncrowned Champion II', 12,'The stage is set and stakes run high as Ikki prepares to face the unbeatable Raikiri. In the end, who will be the victor?',18);
