insert into SERIE_ENTITY  values (19, 2012,'https://static.tvmaze.com/uploads/images/medium_portrait/420/1052327.jpg', 'JoJos Bizarre Adventure', 'In 1880s England, noble George Joestar takes in his new adopted son: young Dio Brando, whose father "saved" Georges life 12 years ago. But instead of moving peacefully into his new home, Dio, who grew up in poverty, wants to destroy the Joestar family and gain their status for himself. What starts off as a simple feud with Georges son Jonathan soon develops into a conflict that lasts well over 100 years and sends all generations of Joestars into battle against vampires, aztec deities, Nazis and shrewd serial killers.','https://steamuserimages-a.akamaihd.net/ugc/1016068436114416823/68816CC2C389B799626BF0F77E5934032F23A553/?imw=5000&imh=5000&ima=fit&impolicy=Letterbox&imcolor=%23000000&letterbox=false');
