insert into EPISODIO_ENTITY values (3371, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/334/835814.jpg', 'Dio the Destroyer', 1,'England, 1868. A thief tries to raid an overturned carriage, but discovers that two of the occupants, a man and his young son are still alive. The man, George Joestar, proclaims he will forever be indebted to his savior, who reveals himself to be Dario Brando.',19);
insert into EPISODIO_ENTITY values (3372, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/334/835816.jpg', 'A Letter from the Past', 2,'Seven years later in 1888, JoJo and Dio are supposedly getting along, though JoJo is still fearful of Dio. Meanwhile, Dio plots to liberate the Joestar family of their fortune.',19);
insert into EPISODIO_ENTITY values (3373, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/334/835817.jpg', 'Youth with Dio', 3,'JoJo prepares to turn Dio in to the police.',19);
insert into EPISODIO_ENTITY values (3374, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/334/835818.jpg', 'Overdrive', 4,'Three days later, JoJo awakens to find Erina nursing him back to health in the hospital. As they rekindle their friendship, they encounter a strange man named Will A. Zeppeli.',19);
insert into EPISODIO_ENTITY values (3375, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/334/835819.jpg', 'The Dark Knights', 5,'A talented young pickpocket named Poco unwittingly lures JoJo and company into an encounter with Dio, Tarukus, and Blueford.',19);
insert into EPISODIO_ENTITY values (3376, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/334/835820.jpg', 'Tomorrows Courage', 6,'The encounter between JoJo and the Knights continues.',19);
insert into EPISODIO_ENTITY values (3377, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/334/835822.jpg', 'Sorrowful Successor', 7,'The encounter against Tarukus comes to an end. Pocos family is in grave danger. JoJo meets Dire, Straizo, and Tonpetty.',19);
insert into EPISODIO_ENTITY values (3378, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/334/835823.jpg', 'Bloody Battle! JoJo & Dio', 8,'The party are received by Doobie. Dire faces off against Dio. Straizo takes on Pajyu, Jones, Pluton, and Barnum.',19);
insert into EPISODIO_ENTITY values (3379, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/334/835824.jpg', 'The Final Ripple!', 9,'As Dio falls following his battle with JoJo, he decapitates himself before the ripple reaches his head, which is recovered by his zombie servant Wang Chung.',19);
insert into EPISODIO_ENTITY values (3380, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/334/835825.jpg', 'New Yorks JoJo', 10,'In 1938, 49 years after Jonathan Joestars death, Speedwagon and Straizo travel to Mexico, where they discover an underground room filled with similar looking masks and a petrified body believed to be the being who created them.',19);
insert into EPISODIO_ENTITY values (3381, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/334/835826.jpg', 'The Game Master', 11,'As expected, Straizo recovers from Josephs attack and uses the laser eye attack Dio used to seemingly pierce through JoJos head and neck. However, this turns out to be a clever trick by Joseph.',19);
insert into EPISODIO_ENTITY values (3382, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/334/835827.jpg', 'The Pillar Man', 12,'Joseph is confronted by one of Stroheims men, Donovan, but manages to subdue him, learning that Speedwagon is still alive.',19);
insert into EPISODIO_ENTITY values (3383, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/334/835828.jpg', 'JoJo vs. The Ultimate Lifeform', 13,'As Joseph begins to fight against Santana, Joseph finds his Ripple to not be effective against Santana, but it still helps protect him from the Pillar Mans attacks. Joseph appears to be unconscious after receiving a powerful hit.',19);
insert into EPISODIO_ENTITY values (3384, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/334/835830.jpg', 'Ultimate Warriors from Ancient Times', 14,'Speedwagon brings statued remains of Santana to the headquarters of his foundation in Washington, D.C., where it is shown Santana is still alive, but his scientists are able to keep him dormant through the use of ultraviolet light.',19);
insert into EPISODIO_ENTITY values (3385, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/334/835831.jpg', 'To Be a Hero', 15,'Caesar engages Wamuu in battle for killing Mark, using his Bubble Launcher technique to surround the Pillar Man in Ripple enfused bubbles.',19);
insert into EPISODIO_ENTITY values (3386, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/334/835832.jpg', 'Ripple Teacher Lisa Lisa', 16,'Wanting to teach JoJo to control his Ripple powers, Caesar takes him to Venice to meet his teacher, Lisa Lisa.',19);
insert into EPISODIO_ENTITY values (3387, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/334/835833.jpg', 'Laying Some Elaborate Traps!', 17,'Lisa Lisa explains to JoJo and Caesar how the creator of the Stone Mask, Kars, is seeking a perfectly cut Red Stone of Aja known as the Super Aja to power the Stone Mask and become the ultimate life form.',19);
insert into EPISODIO_ENTITY values (3388, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/334/835834.jpg', 'Von Stroheims Revenge', 18,'As JoJo awaits to warn Lisa Lisa about the Pillar Men, Esidisis brain takes over the body of Suzi Q and sends the Super Aja off on a boat bound for Venice before confronting Lisa Lisa.',19);
insert into EPISODIO_ENTITY values (3389, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/334/835835.jpg', 'Rushing Towards the Cliffs of Death', 19,'Stroheim starts using his new mechanical body, which was designed to surpass Santana, to fight against Kars. However, it proves futile against Kars Light Mode.',19);
insert into EPISODIO_ENTITY values (3390, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/334/835836.jpg', 'Caesars Lonely Youth', 20,'Lisa Lisa tells JoJo of Caesars childhood, in which he took to crime at a young age after being abandoned by his debt-ridden father, Mario.',19);
insert into EPISODIO_ENTITY values (3391, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/334/835837.jpg', 'The Hundred vs. Two Strategy', 21,'Whilst following Wamuus trail of blood, JoJo and Lisa Lisa encounter another vampire named Wired Beck.',19);
insert into EPISODIO_ENTITY values (3392, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/334/835838.jpg', 'A True Warrior', 22,'Before JoJos and Wamuus race begins, it is revealed that during each lap, there will be a different weapon for whoever can grab it from a pillar first.',19);
insert into EPISODIO_ENTITY values (3393, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/334/835839.jpg', 'The Warrior Returning to the Wind', 23,'Launching his Final Mode attack, Gathering Gale, which starts peeling away his own body, Wamuu begins firing a stream of wind capable of cutting stone towards JoJo.',19);
insert into EPISODIO_ENTITY values (3394, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/334/835840.jpg', 'The Link to JoJo', 24,'Being forced to cling onto a rope to stop Lisa Lisa from falling to her death, JoJo is at a huge disadvantage against Kars.',19);
insert into EPISODIO_ENTITY values (3395, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/334/835842.jpg', 'Birth of the Ultimate Being!', 25,'Kars demonstrates his new powers, turning his hand into a flesh-eating squirrel that deals damage to Stroheim. The sun rises, leaving a shocking discovery.',19);
insert into EPISODIO_ENTITY values (3396, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/334/835843.jpg', 'The Man Who Became a God', 26,'JoJos victory, along with his arm, is cut short when Kars manages to survive the volcano by forming a shield of air bubbles to protect him from its deadly lava.',19);
insert into EPISODIO_ENTITY values (3397, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/131/327949.jpg', 'A Man Possessed by an Evil Spirit', 1,'In 1987, in Japan, a boy named Jotaro Kujo has willingly turned himself into jail, refusing to leave. Jotaros mother, Holly, requests help from her father, Joseph Joestar, who travels to Japan alongside an acquaintance, Mohammed Avdol.',19);
insert into EPISODIO_ENTITY values (3398, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/131/327953.jpg', 'Who Will Be the Judge!?', 2,'Jotaro heads to school and encounters a mysterious transfer student named Noriaki Kakyoin.',19);
insert into EPISODIO_ENTITY values (3399, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/131/327956.jpg', 'Dios Curse', 3,'Jotaro is able to defeat Kakyoin. He takes the wounded Kakyoin back to his house, hoping to get some information about Dio.',19);
insert into EPISODIO_ENTITY values (3400, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/131/327958.jpg', 'Tower of Gray', 4,'If they do not defeat Dio within 50 days, Holly could die - Jotaro and crew head to Egypt, where they think Dio is hiding. While on the plane, they run into another one of Dios assassins.',19);
insert into EPISODIO_ENTITY values (3401, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/131/327959.jpg', 'Silver Chariot', 5,'Dios next assassin, Polnareff attacks Jotaro and crew, Avdol faces him with his Magicians Red.',19);
insert into EPISODIO_ENTITY values (3402, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/131/327960.jpg', 'Dark Blue Moon', 6,'With a new person in their party, they head to Singapore with the boat the Speedwagon Foundation provided them, during their journey Jotaro is targeted by an enemy Stand from within the water.',19);
insert into EPISODIO_ENTITY values (3403, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/131/327961.jpg', 'Strength', 7,'A giant ship shows itself . On board, they realize they cant seem to find a crew, but an orangutan.',19);
insert into EPISODIO_ENTITY values (3404, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/132/331221.jpg', 'Devil', 8,'Arrived at Singapore, Jotaros group stay at hotel individualy. A new Stand owner who is afraid as "Devo the Cursed" is awaited Polnareff in his room. Devos Stand increases its power as its users hatred toward opponent increases. Polnareff gets into desperate situation as he starts fighting front. Does Polnareff have a chance to win the battle from Devo who keeps attacking him with cruel and brutal way?',19);
insert into EPISODIO_ENTITY values (3405, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/132/331222.jpg', 'Yellow Temperance', 9,'Joseph uses Hermit Purple to create a message using the TV, which tells them that Kakyoin is a traitor.',19);
insert into EPISODIO_ENTITY values (3406, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/132/331223.jpg', 'The Emperor and the Hanged Man, Part 1', 10,'The group travels to India. In a restaurant Polnareff is attacked by a mysterious Stand that is inside a mirror.',19);
insert into EPISODIO_ENTITY values (3407, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/132/331224.jpg', 'The Emperor and the Hanged Man, Part 2', 11,'In an effort to save Poinareff, Avdol is injured by the enemy. Then Centerfolds Stand, Hanged Man attacks.',19);
insert into EPISODIO_ENTITY values (3408, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/132/331225.jpg', 'The Empress', 12,'The group heads toward Varanasi. On the way, Joseph realizes his arm is quite swollen.',19);
insert into EPISODIO_ENTITY values (3409, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/132/331226.jpg', 'Wheel of Fortune', 13,'Jotaro and the others head toward Pakistan in a car. Polnareff is driving the car on a very dangerous mountain road, and recklessly passes a slow moving vehicle that was in front of him.',19);
insert into EPISODIO_ENTITY values (3410, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/132/331227.jpg', 'Justice, Part 1', 14,'Jotaro and the others successfully survive another attack from the enemy Stand users and make it into Pakistan. However, they decide to find an inn at a nearby village because of the dense fog they suddenly hit. The village they get to is rather quiet and all of the inhabitants seem rather odd.',19);
insert into EPISODIO_ENTITY values (3411, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/132/331228.jpg', 'Justice, Part 2', 15,'Polnareff finally realizes that Enyaba is another assassin from DIO. He tries to warn the others, but Enyabas Stand, Justice, has the ability to take control of peoples bodies and corpses, and he is pursued. The whole village had already been under Enyabas control.',19);
insert into EPISODIO_ENTITY values (3412, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/132/331229.jpg', 'The Lovers, Part 1', 16,'After surviving Enyabas attack, Jotaro and crew make it to Pakistans capital, Karachi. There, they encounter DIOs next assassin, Dan of Steel. Following DIOs orders, Dan of Steel ruthlessly kills Enyaba in front of them. Jotaro and the others cant help but feel conflicted about that happening, and end up in a battle with Dan of Steel.',19);
insert into EPISODIO_ENTITY values (3413, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/132/331230.jpg', 'The Lovers, Part 2', 17,'Dan of Steels Stand, The Lovers, has entered Josephs brain. Dan puts himself at an advantage, with having Josephs life on the line, and tells Jotaro to do various things for him, knowing Jotaro has no choice but to obey. Meanwhile, Kakyoin and Polnareff also enter Josephs brain with their Stands and find the Stand that is using brain cells as food.',19);
insert into EPISODIO_ENTITY values (3414, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/132/331231.jpg', 'The Sun', 18,'Jotaro and the others continue their journey through the desert, trying to get to Cairo. They travel with camels and cant shake the feeling that someone is following them, but no one is in sight. Traveling in the killer heat, they realize that its still bright out at 8pm and the sun is actually rising rather than setting.',19);
insert into EPISODIO_ENTITY values (3415, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/132/331232.jpg', 'Death 13, Part 1', 19,'Kakyoin is dreaming and dreams about being in a strange amusement park, where he encounters the Death tarot card. While in the dream, he witnesses Death cut down a dog. Kakyoin wakes up screaming, but cant remember what his bad dream was about.',19);
insert into EPISODIO_ENTITY values (3416, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/132/331233.jpg', 'Death 13, Part 2', 20,'Kakyoin tries to convince the others that the baby is suspicious, but that backfires, and his friends start to doubt his sanity. Kakyoin then tries to convince them that hes not crazy, and shows them his arm that has "Baby Stand" carved into it... but that just makes them believe he really is crazy. Kakyoin then tries to use his Stand to attack, but is knocked out by Polnareff. Eventually, Jotaro and the others wake up in the nightmare and the truth finally comes out.',19);
insert into EPISODIO_ENTITY values (3417, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/132/331234.jpg', 'Judgement, Part 1', 21,'While on an island on the edge of the Red Sea where Mohammed Avdols father is said to live, Polnareff uncovers a magic lamp and its genie Cameo offers him three wishes, although all is not as it seems.',19);
insert into EPISODIO_ENTITY values (3418, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/132/331235.jpg', 'Judgement, Part 2', 22,'Polnareff must find out a way to escape the attacks of Cameo and his Stand Judgement who has apparently turned his sister Cherie and Avdol into zombies.',19);
insert into EPISODIO_ENTITY values (3419, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/132/331236.jpg', 'The High Priestess, Part 1', 23,'Jotaro and the others obtain a submarine as a new means of travel. Through the Red Sea, they try to head toward Egypt where DIO awaits. Using the sonar to detect any threats on the outside, the submarine quietly dives in. They however realize that if theyre attacked underwater, there is nowhere to escape, so they are on their guard. Finally, when they are about to surface, a coffee mug that was in the cabin transforms and cuts off Josephs artificial hand.',19);
insert into EPISODIO_ENTITY values (3420, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/132/331237.jpg', 'The High Priestess, Part 2', 24,'The group must find a way off of the submarine and away from the attacks of High Priestess.',19);
insert into EPISODIO_ENTITY values (3421, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/135/337643.jpg', 'Iggy the Fool and Gebs NDoul, Part 1', 25,'Jotaros group encounters NDouls Stand "Geb", and Iggys "The Fool".',19);
insert into EPISODIO_ENTITY values (3422, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/135/337644.jpg', 'Iggy the Fool and Gebs NDoul, Part 2', 26,'The groups battle with the water stand continues.',19);
insert into EPISODIO_ENTITY values (3423, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/135/337645.jpg', 'Khnums Oingo and Tohths Boingo', 27,'Two brothers - Oingo, who can disguise himself, and Boingo, who can predict the future - set traps for Jotaros group. But they end up as epic failures.',19);
insert into EPISODIO_ENTITY values (3424, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/135/337646.jpg', 'Anubis, Part 1', 28,'A young man named Chaka finds a mysterious sword on the beach. Though other men try, Chaka is the only one who can draw it. The sword claims Chaka as its master and sends the youth in pursuit of Jotaro and his friends with deadly intent.',19);
insert into EPISODIO_ENTITY values (3425, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/135/337647.jpg', 'Anubis, Part 2', 29,'Having defeated the "Anubis" Stand user Chaka, Polnareff pays a visit to a barber. But when the barber starts attacking him with Chakas sword, the Frenchman realizes the sword itself is the Stand user.',19);
insert into EPISODIO_ENTITY values (3426, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/135/337648.jpg', 'Bastets Mariah, Part 1', 30,'On the way to Luxor, Joseph notices an electrical outlet set in a rock. Fascinated by the rare sight, Joseph goes in for a closer look and gets shocked. Though he seems fine afterwards, soon all manner of small accidents begin to occur around him.',19);
insert into EPISODIO_ENTITY values (3427, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/135/337649.jpg', 'Bastets Mariah, Part 2', 31,'Due to the powers of an enemy Stand, Josephs body becomes magnetized. While chasing after the woman he suspects is the Stand user, Joseph learns that Avdol has also become magnetized from touching a different electrical outlet.',19);
insert into EPISODIO_ENTITY values (3428, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/135/337650.jpg', 'Sets Alessi, Part 1', 32,'While Joseph and Avdol are fighting with Mariah, Jotaro gets concerned that they havent shown up yet, and goes to look for them around Luxor. Then, Polnareff senses someone following them and confronts the man.',19);
insert into EPISODIO_ENTITY values (3429, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/135/337651.jpg', 'Sets Alessi, Part 2', 33,'Because of the power of Alessis Stand, Set, Polnareff is turned back into a child. The one who came to his aid amidst his confusion was a woman named Marena. However, Alessis evil hands followed Polnareff into her house.',19);
insert into EPISODIO_ENTITY values (3430, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/135/337652.jpg', 'DArby the Gambler, Part 1', 34,'Arriving in Cairo, the Stardust Crusaders try to discover where Dio is, only to encounter DArby the Gambler. He is willing to give them the information they want, but only if they bet their souls against him in a game.',19);
insert into EPISODIO_ENTITY values (3431, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/135/337653.jpg', 'DArby the Gambler, Part 2', 35,'With Joseph and Polnareff taken, Jotaro stands up to play DArby in a game of poker. With Osiris ready to steal Jotaros soul, DArby is confident until he notices Jotaros icy calm.',19);
insert into EPISODIO_ENTITY values (3432, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/135/337654.jpg', 'Hol Horse and Boingo, Part 1', 36,'Hol Horse tries to take out Jotaros group again, and enlists the future-telling Boingo to aid him.',19);
insert into EPISODIO_ENTITY values (3433, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/135/337655.jpg', 'Hol Horse and Boingo, Part 2', 37,'Every time Boingo makes a prediction and Hol Horse tries to follow it, it goes wrong.',19);
insert into EPISODIO_ENTITY values (3434, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/135/337656.jpg', 'The Guardian of Hell: Pet Shop, Part 1', 38,'Iggy separates from the group and has a bizarre adventure of his own.',19);
insert into EPISODIO_ENTITY values (3435, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/135/337657.jpg', 'The Guardian of Hell: Pet Shop, Part 2', 39,'Under attack by Pet Shop and his Horus, Iggy has no choice but to flee into the sewers. Iggy can only hide using The Fool as the fearsome Pet Shop continues his barrage of ice attacks.',19);
insert into EPISODIO_ENTITY values (3436, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/135/337658.jpg', 'DArby the Player, Part 1', 40,'Inside Dios mansion, Terence T. DArby uses his Atum to drag the group into an illusion. With their souls on the line, the gang meet his challenge in a series of video games.',19);
insert into EPISODIO_ENTITY values (3437, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/135/337659.jpg', 'DArby the Player, Part 2', 41,'Kakyoin is defeated by DArby and has his soul sealed inside of a puppet. Despite having no knowledge of games, Jotaro faces DArby next in a baseball game.',19);
insert into EPISODIO_ENTITY values (3438, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/135/337660.jpg', 'The Miasma of the Void, Vanilla Ice, Part 1', 42,'As Jotaro and Joseph continue to face off against DArby, Avdol and the others continue to explore the mansion. Little do they know that Dios servant is watching them and unleashes his terrifying power.',19);
insert into EPISODIO_ENTITY values (3439, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/135/337661.jpg', 'The Miasma of the Void, Vanilla Ice, Part 2', 43,'Vanilla Ice, now powered up by Dio, uses his Cream to disintegrate Avdol. Iggy and Polnareff desperately try to fight back, but he remains too powerful for the duo to take down.',19);
insert into EPISODIO_ENTITY values (3440, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/135/337662.jpg', 'The Miasma of the Void, Vanilla Ice, Part 3', 44,'Polnareff is ready to accept his defeat, only to be rescued by the dying Iggy and hardens his resolve. Suzi comforts her daughter as Jotaro and Joseph get closer to where Dio lies in wait.',19);
insert into EPISODIO_ENTITY values (3441, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/135/337663.jpg', 'Dios World, Part 1', 45,'The Joestar group begin the fight against Dio, as Kakyoin learns the full extent of Dios true power.',19);
insert into EPISODIO_ENTITY values (3442, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/424/1060839.jpg', 'Dios World, Part 2', 46,'Kakyoin discovers The Worlds true power. The fight between Jotaro and Dio begins.',19);
insert into EPISODIO_ENTITY values (3443, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/135/337665.jpg', 'Dios World, Part 3', 47,'The fight between Jotaro and Dio continues.',19);
insert into EPISODIO_ENTITY values (3444, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/135/337666.jpg', 'Long Travels, Goodbye My Friend', 48,'The final battle between Jotaro and Dio comes to a climactic end.',19);
insert into EPISODIO_ENTITY values (3445, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/78/196926.jpg', 'Jotaro Kujo! Meets Josuke Higashikata', 1,'Ten years after battle in Egypt, Jotaro Kujo arrives to Morioh in Japan looking for Josuke Higashikata. He need to talk to Josuke about Joestars heritage and tells him about dangerous Stand User whos hiding in town.',19);
insert into EPISODIO_ENTITY values (3446, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/78/196927.jpg', 'Josuke Higashikata! Meets Angelo', 2,'Angelo uses his Aqua Necklace to attack Josukes family and succeeds in killing his grandfather. Hungry for revenge, Jotaro and Josuke prepare to fight Angelo once more.',19);
insert into EPISODIO_ENTITY values (3447, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/424/1061471.jpg', 'The Nijimura Brothers, Part 1', 3,'Angelo reveals that he was given his Stand by a man in a school uniform using an arrow. Josuke and Koichi pass by a wrecked house where they discover the brothers Okuyasu and Keicho.',19);
insert into EPISODIO_ENTITY values (3448, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/78/196930.jpg', 'The Nijimura Brothers, Part 2', 4,'After defeating Okuyasu and The Hand, Josuke enters the house to save Koichi. However, he soons find himself under attack by Keicho and his army Stand, Bad Company.',19);
insert into EPISODIO_ENTITY values (3449, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/78/196931.jpg', 'The Nijimura Brothers, Part 3', 5,'Josuke and Koichi learn that the Nijimura brothers were giving people Stands to try and create one that could save their father. But just as a ceasefire begins, another enemy Stand appears before them.',19);
insert into EPISODIO_ENTITY values (3450, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/78/196932.jpg', 'Koichi Hirose (Reverb)', 6,'Koichi finds himself stalked by Tamami Kobayashi, who tries to scam him using The Lock. But when his family is in Tamamis crosshairs, Koichi finally awakens the power of his Stand, Echoes.',19);
insert into EPISODIO_ENTITY values (3451, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/424/1061606.jpg', 'Toshikazu Hazamada (Show Off)', 7,'Josuke and Koichi get info that a student at their school, Toshikazu Hazamada may be a Stand user and decide to look into the case. Their suspicions are quickly confirmed after Hazamadas wooden doll morphs into an exact copy of Josuke, and attacks them.',19);
insert into EPISODIO_ENTITY values (3452, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/424/1061612.jpg', 'Yukako Yamagishi Falls In Love, Part 1', 8,'Koichi finds that he has captured the attention of Yukako Yamagishi, who claims to be in love with him. Things seem fine, until Yukako reveals that her feelings for Koichi go far beyond a simple crush.',19);
insert into EPISODIO_ENTITY values (3453, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/78/196936.jpg', 'Yukako Yamagishi Falls In Love, Part 2', 9,'Now Yukakos prisoner, Koichi tries to escape the deranged woman using Echoes. But when he is pushed into a corner by Love Deluxe, a new power awakens within Echoes.',19);
insert into EPISODIO_ENTITY values (3454, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/424/1061613.jpg', 'Lets Go Eat Some Italian Food', 10,'Josuke and Okuyasu decide to eat some Italian at a new restaurant run by Tonio Trussardi. However, the food starts affecting Okuyasu and Josuke in strange ways, as Tonio appears to have a Stand.',19);
insert into EPISODIO_ENTITY values (3455, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/78/196938.jpg', 'Red Hot Chili Pepper, Part 1', 11,'The electric Stand Red Hot Chili Pepper appears to taunt Josuke before vanishing. The gang learn that its user is targeting Joseph Joestar, and attempt to stop Chili Pepper from killing him.',19);
insert into EPISODIO_ENTITY values (3456, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/78/196939.jpg', 'Red Hot Chili Pepper, Part 2', 12,'Josuke and the gang continue to fight Red Hot Chili Pepper and its user, Akira Otoishi. Powered up by electricity, Red Hot Chili Pepper proves to be a powerful for as Josephs boat gets closer to Morioh.',19);
insert into EPISODIO_ENTITY values (3457, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/78/196940.jpg', 'We Picked Up Something Crazy!', 13,'Josuke and Joseph find an invisible baby and adopt it.',19);
insert into EPISODIO_ENTITY values (3458, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/78/196941.jpg', 'Lets Go to the Manga Artists House, Part 1', 14,'Hazamada and Koichi learn that one of their favorite mangaka, Rohan Kishibe, learns in Morioh. But when they go to visit him, the eccentric Rohan greets them with his Stand, Heavens Door.',19);
insert into EPISODIO_ENTITY values (3459, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/424/1061626.jpg', 'Lets Go to the Manga Artists House, Part 2', 15,'Rohan uses Heavens Door to read the secrets of Josukes friends and puts them under special locks so that they cant stop him. Angered at seeing his friends hurt, Josuke approaches Rohan.',19);
insert into EPISODIO_ENTITY values (3460, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/78/196949.jpg', 'Lets Go Hunting!', 16,'Josuke and Jotaro go hunting for a rat that has been given Stand abilities. While searching for their target, they find living things melted into flesh cubes and soon learn it isnt as simple as a mere rat.',19);
insert into EPISODIO_ENTITY values (3461, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/424/1061633.jpg', 'Rohan Kishibes Adventure', 17,'Rohan and Koichi investigate a strange alley in Morioh that does not appear on any map. They get more than they bargained for when they meet the ghosts of Reimi and Arnold, who warn them of a dangerous presence in Morioh.',19);
insert into EPISODIO_ENTITY values (3462, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/424/1061645.jpg', 'Shigechis Harvest, Part 1', 18,'Josuke and Okuyasu see strange hornet Stands, belonging to Shigechi, stealing money from all around Morioh. The three work together in a get rich quick scheme that soon goes awry.',19);
insert into EPISODIO_ENTITY values (3463, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/78/196952.jpg', 'Shigechis Harvest, Part 2', 19,'Shigechi, Okuyasu, and Josuke find themselves blinded by greed as they fight over a lottery ticket. When Stands get involved, it turns into a mad brawl over who will get the money.',19);
insert into EPISODIO_ENTITY values (3464, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/78/196953.jpg', 'Yukaku Yamagishi Dreams of Cinderella', 20,'Yukako is feeling down about her looks when she meets Aya Tsuji and Cinderella. She offers to give Yukako a makeover, but little does she know that such beauty comes with a price.',19);
insert into EPISODIO_ENTITY values (3465, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/424/1061650.jpg', 'Yoshikage Kira Just Wants to Live Quietly, Part 1', 21,'Yoshikage Kira is a simple businessman who just wants to enjoy his sandwich for lunch. But a minor scuffle with Shigechi escalates when a horrific secret is revealed.',19);
insert into EPISODIO_ENTITY values (3466, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/78/196955.jpg', 'Yoshikage Kira Just Wants to Live Quietly, Part 2', 22,'Shigechi desperately tries to flee from Yoshikage Kira and Killer Queen, which can turn anything into a bomb. As he perishes, Shigechi gets a clue to Josuke and the others that sets them on a new path.',19);
insert into EPISODIO_ENTITY values (3467, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/78/196956.jpg', 'Sheer Heart Attack, Part 1', 23,'Kira uses Sheer Heart Attack to kill his tailor and fight Josuke to prevent anyone from learning his secret. The indestructible tank proves to be tough, until Echoes manages to evolve yet again into Act 3.',19);
insert into EPISODIO_ENTITY values (3468, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/78/196957.jpg', 'Sheer Heart Attack, Part 2', 24,'With Sheer Heart Attack beaten, Jotaro and Koichi finally encounter Kira himself. It seems like the final battle is underway as Stands clash, but then...',19);
insert into EPISODIO_ENTITY values (3469, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/424/1061821.jpg', 'Atom Heart Father', 25,'Searching for more clues about Kira, Josuke and the others investigate his old house. But Kiras father, still alive as a ghost, is determined to protect his son and unleashes Atom Heart Father on them.',19);
insert into EPISODIO_ENTITY values (3470, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/78/196959.jpg', 'Janken Boy Is Coming!', 26,'Rohan encounters a boy named Ken, who is obsessed with janken. He accepts the boys challenge, only to end up playing a dangerous game with his Stand, Boy II Man.',19);
insert into EPISODIO_ENTITY values (3471, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/78/196960.jpg', 'Im an Alien', 27,'Josuke and Okuyasu encounter a weird boy named Mikitaka, who claims to be an alien. Possessing weird powers but no Stand, Mikitaka appears to be telling the truth as Josuke gets an idea.',19);
insert into EPISODIO_ENTITY values (3472, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/78/196961.jpg', 'Highway Go Go, Part 1', 28,'Rohan and Josukes game ends without Mikitala being discovered. As Rohan discovers something odd while on the train, a boy named Hayato suspects that his dad is acting strange.',19);
insert into EPISODIO_ENTITY values (3473, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/80/200136.jpg', 'Highway Go Go, Part 2', 29,'Rohan has his energy drained by a nefarious Stand in Futatsumori Tunnel. Josuke flees the pursuing Highway Star on a motorcycle to try and track down its user at the hospital in town.',19);
insert into EPISODIO_ENTITY values (3474, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/81/203546.jpg', 'Cats Love Yoshikage Kira', 30,'Kira has stolen the identity of another man to live in his house. He discovers a dead cat and buries it, only for the cat to resurrect as a Stand that still has a desire for revenge.',19);
insert into EPISODIO_ENTITY values (3475, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/82/205948.jpg', 'July 15th (Thurs), Part 1', 31,'On July 15th, Josuke and the others discover a man living in an electric pylon and fall under the spell of Super Fly. Even stranger things then start happening over Morioh.',19);
insert into EPISODIO_ENTITY values (3476, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/424/1061832.jpg', 'July 15th (Thurs), Part 2', 32,'While Rohan deals with an odd architect who is terrified of his own back, Josuke defeats Super Fly only to encounter Terunosuke and his paper controlling Enigma.',19);
insert into EPISODIO_ENTITY values (3477, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/84/210899.jpg', 'July 15th (Thurs), Part 3', 33,'Josuke succumbs to fear and is turned into paper , leading Yuya and Highway Star to save him. Rohan looks at the architects back and becomes cursed by the Stand Cheap Trick.',19);
insert into EPISODIO_ENTITY values (3478, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/85/213146.jpg', 'July 15th (Thurs), Part 4', 34,'Rohan tries to prevent anyway from seeing his back to avoid Cheap Tricks curse. Hayato sees Kira in action and confronts the imposter posing as his dad with hard evidence.',19);
insert into EPISODIO_ENTITY values (3479, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/86/215570.jpg', 'Bites the Dust, Part 1', 35,'Kira gets a new power and tests it out on Hayato.',19);
insert into EPISODIO_ENTITY values (3480, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/87/218454.jpg', 'Bites the Dust, Part 2', 36,'Hayato has gone back in time and attempts to warn everyone about Kira, but will he able to stop history from repeating?',19);
insert into EPISODIO_ENTITY values (3481, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/88/221495.jpg', 'Shining D (Diamond) is Unbreakable, Part 1', 37,'Having inadvertently revealed his true identity to Josuke, Yoshikage Kira is forced to fight him alongside Okuyasu, but does he have a trick up his sleeve?',19);
insert into EPISODIO_ENTITY values (3482, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/89/223279.jpg', 'Shining D (Diamond) is Unbreakable, Part 2', 38,'The battle between Josuke and Kira continues',19);
insert into EPISODIO_ENTITY values (3483, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/90/225913.jpg', 'Goodbye, Morioh - The Heart of Gold', 39,'The final battle between Kira and the Morioh Warriors comes to a climactic end.',19);
insert into EPISODIO_ENTITY values (3484, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493640.jpg', 'Golden Experience', 1,'Giorno Giovanna has a dream, to become a Gang-Star! Inspired by a man he saved as a child, he sets out to join the shady organisation, Passione. Accompanied by his fellow gang members, Bruno, Mista, Narancia and Fugo, he unearths a terrifying secret about the boss of Passione. With the power of Gold Experience and the help of his friends, Giorno strides forth to achieve his dream.',19);
insert into EPISODIO_ENTITY values (3485, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493641.jpg', 'Buccellati Is Coming', 2,'Giorno is attacked by the mysterious Bruno Bucciarati. Using his Stand, Sticky Fingers, he relentlessly pursues Giorno. As he continues his fight with Bruno, Giorno reflects on his past and his decision to become a Gang-Star.',19);
insert into EPISODIO_ENTITY values (3486, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493642.jpg', 'Meet the Gangster Behind the Wall', 3,'In order to join the Passione organization, Giorno meets with Polpo, one of the capos in the gang who is currently in prison. He gives Giorno a test to prove his worth: keep a lighter burner for 24 hours without going out.',19);
insert into EPISODIO_ENTITY values (3487, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493643.jpg', 'Joining the Gang', 4,'Polpos Stand, Black Sabbath, begins a relentless attack against Giorno from the shadows. As night begins to fall, Giorno is desperate to defeat his powerful foe. Will he be able to prove his worth and join the gang?',19);
insert into EPISODIO_ENTITY values (3488, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493644.jpg', 'Find Polpos Fortune!', 5,'Bruno introduces Giorno to the other members of his team, who do not take kindly to the newcomer. In order to rise through the ranks, Bruno decides to track down Polpos hidden fortune. The team heads to Capri to find the lost treasure.',19);
insert into EPISODIO_ENTITY values (3489, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493645.jpg', 'Moody Blues Counterattack', 6,'As the team is attacked by an unseen enemy, Abbacchio uses the power of his Stand, Moody Blues, to replay the past and understand the nature of their opponent.',19);
insert into EPISODIO_ENTITY values (3490, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493646.jpg', 'Six Bullets Appears, Part 1', 7,'Torturing their enemy for information, the team learns that another Stand user is aiming to ambush them on Capri. Mista and Giorno go alone to the island to catch the enemy off guard.',19);
insert into EPISODIO_ENTITY values (3491, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493647.jpg', 'Six Bullets Appears, Part 2', 8,'Mistas Stand, Six Bullets, fights against Sale and his stand, Arts and Crafts.',19);
insert into EPISODIO_ENTITY values (3492, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493652.jpg', 'The First Mission From the Boss', 9,'Having found Polpos treasure, Bruno is promoted to the role of capo. The mysterious boss of the organization gives them a mission: protect his daughter Trish and bring him to her safely. However, from the shadows an enemy watches.',19);
insert into EPISODIO_ENTITY values (3493, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493661.jpg', 'Hitman Team', 10,'A hit-man team, that seeks to overthrow the boss of the organization, begins to search for Trish. One of its members, Formaggio, attacks Narancia. Narancia fights back with his Aerosmith but Formaggio manages to hide from his attacks.',19);
insert into EPISODIO_ENTITY values (3494, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493662.jpg', 'Narancias Aerosmith', 11,'Narancia continues to shrink due to the power of Formaggios Little Feet. His Stand shrinks as well and his attacks barely affect the relentless Formaggio. Narancia tries to think of a way out as Formaggio tortures him for Trishs location.',19);
insert into EPISODIO_ENTITY values (3495, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493663.jpg', 'The Second Mission from the Boss', 12,'Fugo, Abbachio, and Giorno head to Pompeii to retrieve a key for the boss. However, another member of the hit-man team, Illuso, attacks them with his Stand, Man in the Mirror.',19);
insert into EPISODIO_ENTITY values (3496, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493664.jpg', 'Man in the Mirror and Purple Haze', 13,'Fugo is still trapped in the mirror world due to Man in the Mirror, who continues its attack. Giorno and Abbachio try to think of a way to save their friend as Fugos Purple Haze rampages in the real world.',19);
insert into EPISODIO_ENTITY values (3497, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493665.jpg', 'Express Train to Florence', 14,'Using the power of the key in conjunction with a turtle, the gang hides on a train bound for Venice. However, two members of the hit-man team board as well, with Prosciutto unleashing his Stand on the hapless passengers.',19);
insert into EPISODIO_ENTITY values (3498, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493666.jpg', 'The Grateful Dead Part 1', 15,'The Grateful Dead slowly begins to age everybody on the train. With his teammates affected, Mista goes alone to confront the enemy, only to encounter Pesci and his Beach Boy.',19);
insert into EPISODIO_ENTITY values (3499, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493667.jpg', 'The Grateful Dead Part 2', 16,'To protect his teammates, Bruno manages to knock Prosciutto off the train to negate the aging power of The Grateful Dead, However, Pescis resolve is hardened seeing his brother fight and he continues to attack Bruno.',19);
insert into EPISODIO_ENTITY values (3500, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493668.jpg', 'Baby Face', 17,'The gang tries to steal a car to travel to Venice in secret. Another hit-man, Melone, uses his Baby Face to impregnate a woman and create a soldier that pursues Giorno and the others.',19);
insert into EPISODIO_ENTITY values (3501, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493669.jpg', 'Head to Venice!', 18,'With Baby Face defeated, the group continues driving to Venice. A chill is in the air however, as Ghiaccio and his cold manipulating White Album unleash a barrage of ice attacks on Giorno and Mista.',19);
insert into EPISODIO_ENTITY values (3502, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493670.jpg', 'White Ice', 19,'Giorno drives into the canals of Venice in the hope of shaking off Ghiaccio. However, his White Album only operates better in ice, especially when he unleashes the power of his Gently Weeps.',19);
insert into EPISODIO_ENTITY values (3503, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493671.jpg', 'The Final Mission from the Boss', 20,'The boss gives the gang one final mission: deliver Trish to the top of a bell tower. Bruno takes Trish to the tower, reflecting on his past arriving to this point, but thats when the boss reveals his horrific true nature.',19);
insert into EPISODIO_ENTITY values (3504, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493672.jpg', 'The Mystery of Emperor Crimson', 21,'Bruno continues his desperate struggle against the boss, but cannot comprehend the nature of his Stand, King Crimson. When the dust settles, a decision is made that will change the lives of the gang forever.',19);
insert into EPISODIO_ENTITY values (3505, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493673.jpg', 'The "G" in Gozzo', 22,'Stopping for lunch at a cafe, the gang tries to determine what to do now that they are enemies of the Passione organization. Members of the elite squad then attack, unleashing the power of their Stands: Clash and Talking Head.',19);
insert into EPISODIO_ENTITY values (3506, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493674.jpg', 'Crush and Talking Mouth', 23,'Squalos Clash and Tizianos Talking Head continue their combination attack to kill Giorno and finish off the gang. Forced to only tell lies, Narancia has to try to get his friends to go after the real enemy and save Giornos life.',19);
insert into EPISODIO_ENTITY values (3507, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493675.jpg', 'Notorious B.I.G', 24,'The gang manage to acquire a plane and aim to fly to Sardinia, after dispatching an enemy. However, once they are in the air, they find themselves under attack by a powerful and terrifying foe.',19);
insert into EPISODIO_ENTITY values (3508, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493676.jpg', 'Spice Girl', 25,'On the verge of death, Trish discovers and unlocks a Stand power.',19);
insert into EPISODIO_ENTITY values (3509, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493677.jpg', 'A Little Story From the Past ~My Name Is Doppio~', 26,'On the island of Sardinia, a boy named Doppio is searching for Trish and the others on orders from Passiones boss. But Doppio has a dark secret, one that becomes apparent when he encounters Risotto of La Squadra.',19);
insert into EPISODIO_ENTITY values (3510, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493678.jpg', 'King Crimson vs Metallica', 27,'Doppio, the alter ego of Passiones boss, continues to fight against Risotto and his iron controlling Metallica. Doppio struggles against the powerful assassin, but is armed with King Crimsons Epitaph, which allows him to see the future.',19);
insert into EPISODIO_ENTITY values (3511, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493679.jpg', 'Beneath a Sky on the Verge of Falling', 28,'In the aftermath of the battle between Risotto and Doppio, Abbacchio uses Moody Blues to try and uncover the bosss identity. But the boss is adamant about keeping his identity a secret and executes his next gambit against the group.',19);
insert into EPISODIO_ENTITY values (3512, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493680.jpg', 'Get to the Roman Colosseum!', 29,'Unsure of what to do next, the gang receive a strange message on their computer revealing the origins of the Stand arrow and the true name of Passiones boss. The gang aim to travel to Rome as two assassins wait in the shadows.',19);
insert into EPISODIO_ENTITY values (3513, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/198/497047.jpg', 'Green Day and Oasis, Part 1', 30,'The gang are under attack by the last two members of the Elite Squad. Cioccolata uses his Green Day to spread a toxic mold over the island while Secco uses Oasis to swim through rock for stealth attacks, leaving the gang in a pinch.',19);
insert into EPISODIO_ENTITY values (3514, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/200/500499.jpg', 'Green Day and Oasis, Part 2', 31,'While Bruno stays on the ground to fight against Seccos Oasis, Giorno and Mista head upwards towards Cioccolata to stop the power of his Green Day. But Cioccolata has another dangerous trick up his sleeve, pushing the two into a corner.',19);
insert into EPISODIO_ENTITY values (3515, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/201/502729.jpg', 'Green Day and Oasis, Part 3', 32,'Bruno and Secco are both racing towards the man at the Colloseum whilst trying to kill each other.',19);
insert into EPISODIO_ENTITY values (3516, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/201/504522.jpg', 'His Name Is Diavolo', 33,'Bruno unknowingly leads Doppio to the Colosseum while the rest of the gang is searching for their leader.',19);
insert into EPISODIO_ENTITY values (3517, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/202/505878.jpg', 'The Requiem Quietly Plays, Part 1', 34,'Everyone wakes up from a deep sleep to discover their souls have been swapped.',19);
insert into EPISODIO_ENTITY values (3518, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/203/508136.jpg', 'The Requiem Quietly Plays, Part 2', 35,'The gang desperately tries to reach the Stand arrow whilst looking for Diavolo.',19);
insert into EPISODIO_ENTITY values (3519, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/203/509925.jpg', 'Diavolo Surfaces', 36,'Everyone continues to desperately chase after the Requiem in order to obtain the Stand arrow. Diavolos soul is then forced to show itself, but he will not quit until he obtains the arrow for himself.',19);
insert into EPISODIO_ENTITY values (3520, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/204/511357.jpg', 'King Of Kings', 37,'The Stand arrows rightful owner is finally revealed.',19);
insert into EPISODIO_ENTITY values (3521, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/207/517701.jpg', 'Golden Experience Requiem', 38,'Giorno achieves his dream and destiny of becoming a Gang-star.',19);
insert into EPISODIO_ENTITY values (3522, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/207/517702.jpg', 'The Sleeping Slave', 39,'In the past, Bruno and his team investigated the mysterious death of a girl and how it ties into the power known as Rolling Stones. And in the present, the final fate of Giorno and the gang is revealed as Golden Wind comes to a close.',19);
insert into EPISODIO_ENTITY values (3523, 24, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113619.jpg', 'Stone Ocean', 1,'Florida, 2011. Framed for a DUI and imprisoned, young Jolyne gains a mysterious new power after receiving a bizarre item from her estranged father.',19);
insert into EPISODIO_ENTITY values (3524, 24, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113620.jpg', 'Prisoner FE40536: Jolyne Cujoh', 2,'Jolyne gets acquainted with Green Dolphin Street Prison and her two-faced cellmate, Gwess, who has obtained Jolynes locket and a pint-sized new Stand.',19);
insert into EPISODIO_ENTITY values (3525, 24, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113621.jpg', 'The Visitor (1)', 3,'Jolyne acclimates to prison, but a mysterious boy delivers an ominous message before Jolyne receives a visit from her father and an enemy Stand user.',19);
insert into EPISODIO_ENTITY values (3526, 24, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113622.jpg', 'The Visitor (2)', 4,'DIOs follower Johngalli A. aims for revenge. The boy risks his safety to help Jotaro and Jolyne, but she refuses to leave the kid behind.',19);
insert into EPISODIO_ENTITY values (3527, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113623.jpg', 'Prisoner of Love', 5,'Father and daughter try to escape the visiting rooms trap and the prison, but an enemy Stand extracts two discs from Jotaro. One holds Star Platinum.',19);
insert into EPISODIO_ENTITY values (3528, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113624.jpg', 'Ermess Stickers', 6,'Jolyne returns to prison to retrieve Jotaros discs. Ermes Costello discovers her new ability and a guard with discs in his head before shes attacked.',19);
insert into EPISODIO_ENTITY values (3529, 24, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113625.jpg', 'Theres Six of Us!', 7,'After people go missing from the prisons farm, Jolyne and Ermes volunteer to join the search party as a way to look for Pale Snake and the discs.',19);
insert into EPISODIO_ENTITY values (3530, 24, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113626.jpg', 'F.F.', 8,'Jolyne and Ermes unravel the mystery of Stand F.F. and its user, who admits to helping Pale Snake in his efforts to steal their Stands.',19);
insert into EPISODIO_ENTITY values (3531, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113627.jpg', 'Debt Collector Mary Lynn Manson', 9,'Pale Snakes user, Father Pucchi, makes his entrance. A baseball game in the yard against Miraschon heats up when F.F. and Stone Ocean get involved.',19);
insert into EPISODIO_ENTITY values (3532, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113628.jpg', 'Operation Savage Guardian (Head to the Courtyard!) (1)', 10,'Assisted by Emporio and his friend Weather Forecast, Jolyne rushes to the courtyard to pass Jotaros Stand Disc to the Speedwagon Foundation.',19);
insert into EPISODIO_ENTITY values (3533, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113629.jpg', 'Operation Savage Guardian (Head to the Courtyard!) (2)', 11,'Father Pucchi learns some damning information. Jolyne and Weathers bodies strain under Jumpin Jack Sparks Stand ability as the fight continues.',19);
insert into EPISODIO_ENTITY values (3534, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113630.jpg', 'Torrential Downpour Warning', 12,'Jolyne reaches the courtyard. Pucchi recalls his talks with DIO and his reason for hunting Jotaro when Weather unleashes a squall of poison dart frogs.',19);
insert into EPISODIO_ENTITY values (3535, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113634.jpg', 'Kiss of Love and Revenge (1)', 13,'Jolyne and F.F. discover that Ermes got herself sent to prison to track down and kill a notorious gangster who murdered her older sister.',19);
insert into EPISODIO_ENTITY values (3536, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113635.jpg', 'Kiss of Love and Revenge (2)', 14,'Ermes, Jolyne and F.F. find out that Maxx has turned into an invisible zombie and escaped from the pipe. Maxx lures them into the prisons mausoleum and revives several dead prisoners.',19);
insert into EPISODIO_ENTITY values (3537, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113641.jpg', 'Ultra Security House Unit', 15,'F.F. and Emporio find out that forced Maxx was forced to bring one of DIOs bones back to life. Narciso Anasui agrees to help F.F. rescue Jolyne.',19);
insert into EPISODIO_ENTITY values (3538, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113642.jpg', 'The Secret of Guard Westwood', 16,'Jolyne faces off against Westwood. Westwoods Stand attracts small meteorites towards him that seriously wound his enemies.',19);
insert into EPISODIO_ENTITY values (3539, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113643.jpg', 'Enter the Dragons Dream', 17,'Only two other inmates are left standing after the brawl in the Disciplinary Wing. F.F. arrives in time to fight one of them, an elderly former cult leader named Kenzou.',19);
insert into EPISODIO_ENTITY values (3540, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113644.jpg', 'Enter the F.F.', 18,'F.F. attempts to get water and heal themselves, only to trigger Kenzous Stand again and become trapped in an active electric chair.',19);
insert into EPISODIO_ENTITY values (3541, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113646.jpg', 'Birth of the "Green"', 19,'Jolyne, F.F. and Anasui confront the prisoner who had DIOs bone and find that he and the rest of the inmates are turning into plants when exposed to sunlight.',19);
insert into EPISODIO_ENTITY values (3542, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113648.jpg', 'F.F. – The Witness', 20,'Jolyne, Anasui and Yo-Yo Ma steal a boat to approach the main prison. After Jolynes tongue is suddenly dissolved by mosquitoes carrying Yo-Yo Mas acidic spit, she attempts to warn Anasui of the Stands power.',19);
insert into EPISODIO_ENTITY values (3543, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113649.jpg', 'AWAKEN', 21,'Jolyne and Anasui attempt to retrieve The Green Baby, but find themselves shrinking whenever they get close to it as a result of the infants Stand.',19);
insert into EPISODIO_ENTITY values (3544, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113651.jpg', 'Time for Heaven! New Moon! New Priest!', 22,'F. F. and Weather meet up with Jolyne and Anasui and reveal that Pucci is Whitesnakes user. But the Weather with them is not who he seems to be...',19);
insert into EPISODIO_ENTITY values (3545, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113652.jpg', 'Jail House Lock!', 23,'Pucci leaves Green Dolphin Street Prison to enact the next part of the plan to attain heaven. After viewing her Jotaros memory disc and discovering Puccis plans, Jolyne decides to break out of prison and stop him.',19);
insert into EPISODIO_ENTITY values (3546, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113653.jpg', 'Jailbreak...', 24,'Emporio remembers that he wanted to print a picture of the guards face. But Miu Miu appears and shoots both the boy and his computer.',19);
insert into EPISODIO_ENTITY values (3547, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113655.jpg', 'Bohemian Ecstatic (1)', 25,'Pucci tries to stay ahead of Jolyne, but is held hostage outside a hospital.',19);
insert into EPISODIO_ENTITY values (3548, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113656.jpg', 'Bohemian Ecstatic (2)', 26,'Anasui tries to recover his physical body after the enemy Stand Bohemian Ecstatic separates it from his soul.',19);
insert into EPISODIO_ENTITY values (3549, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113657.jpg', 'Sky Guy', 27,'Jolyne and her companions are attacked in Romeos helicopter on the way to Cape Canaveral.',19);
insert into EPISODIO_ENTITY values (3550, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113658.jpg', 'Heaven is at Hand: Three Days Until the New Moon', 28,'Jolyne and Ermes enter the hospital and find a hole in the floor.',19);
insert into EPISODIO_ENTITY values (3551, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113659.jpg', 'Netherworld', 29,'Jolyne jumps out of the plane and launches an attack, but it doesnt affect Versus.',19);
insert into EPISODIO_ENTITY values (3552, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113660.jpg', 'Heavy Forecast (1)', 30,'Weather Forecasts powerful ability Heavy Forecast triggers automatically, turning everyone affected by it into snails.',19);
insert into EPISODIO_ENTITY values (3553, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113661.jpg', 'Heavy Forecast (2)', 31,'Puccis and Weather Reports past is revealed.',19);
insert into EPISODIO_ENTITY values (3554, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113662.jpg', 'Heavy Forecast (3)', 32,'Jolyne and her comrades hurry to stop Weather Forecasts Stand. In the meantime, Weather Forecast decides to settle the score with Pucci.',19);
insert into EPISODIO_ENTITY values (3555, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113663.jpg', 'Gravity of the New Moon', 33,'Jolyne and her comrades head to Cape Canaveral in pursuit of Pucci, whose body begins to change.',19);
insert into EPISODIO_ENTITY values (3556, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113664.jpg', 'See Moon (1)', 34,'Jolyne struggles against Puccis new Stand See Moon, which can invert anything it touches.',19);
insert into EPISODIO_ENTITY values (3557, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113665.jpg', 'See Moon (2)', 35,'Pucci senses that Jolyne is still alive and pursues her in hopes of ending the Joestar bloodline for good.',19);
insert into EPISODIO_ENTITY values (3558, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113666.jpg', 'Maiden Heaven (1)', 36,'Jolyne and her companions awake to find that Pucci is gone and gravity has returned to normal.',19);
insert into EPISODIO_ENTITY values (3559, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113667.jpg', 'Maiden Heaven (2)', 37,'Puccis new Stand Maiden Heaven overwhelms Jolynes group. Therefore, Anasui acts as bait while Jotaro prepares to attack.',19);
insert into EPISODIO_ENTITY values (3560, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/445/1113668.jpg', 'Its a Wonderful World', 38,'The unstoppable acceleration of time brings the universe full circle. Emporio awakes in Green Dolphin Street Prison and humanity enters a new world.',19);
