insert into SERIE_ENTITY  values (20, 2008,'https://static.tvmaze.com/uploads/images/medium_portrait/1/4898.jpg', 'Adventure Time', 'Adventure Times unlikely heroes Finn and Jake are buddies who traverse the mystical Land of Ooo and encounter its colorful inhabitants.','https://i.pinimg.com/originals/98/bb/59/98bb59d6137da9c5cfa853bb14b95323.jpg');
