insert into EPISODIO_ENTITY values (3561, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348248.jpg', 'Slumber Party Panic', 1,'Princess Bumblegums latest experiment accidentally unleashes an undead horde upon the Candy Kingdom.',20);
insert into EPISODIO_ENTITY values (3562, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348249.jpg', 'Trouble in Lumpy Space', 2,'Jake is bitten by Lumpy Space Princess and begins to transform into a Lumpy being. In order to find a cure, Finn is travels to Lumpy Space.',20);
insert into EPISODIO_ENTITY values (3563, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348250.jpg', 'Prisoners of Love', 3,'After the Ice King kidnaps a large group of princesses, its up to Finn and Jake to free them.',20);
insert into EPISODIO_ENTITY values (3564, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348253.jpg', 'Tree Trunks', 4,'Tree Trunks joins Finn and Jake on an quest, but finds her talents for adventuring leave something to be desired.',20);
insert into EPISODIO_ENTITY values (3565, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348254.jpg', 'The Enchiridion!', 5,'Finn and Jake go on a quest for the titular magical book that would prove them worthy of being righteous heroes. After passing through a series of trials and tribulations, Finn acquires the legendary book.',20);
insert into EPISODIO_ENTITY values (3566, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348256.jpg', 'The Jiggler', 6,'A strange creature attracted by Finns auto-tuned singing voice follows the duo to their home and they keep him as a pet. Soon, however, the creature begins to show signs of sickness, and Finn and Jake realize the creature needs the love and attention of its mother. They then return it to its nest.',20);
insert into EPISODIO_ENTITY values (3567, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348257.jpg', 'Ricardio the Heart Guy', 7,'Finn believes that Princess Bubblegums new friend, a literal heart named Ricardio is evil and is proven right after learning that Ricardio is the heart of the Ice King. Ricardio reveals that he wants to "make out" with Bubblegums heart, but he is defeated by Finn and Jake.',20);
insert into EPISODIO_ENTITY values (3568, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348268.jpg', 'Business Time', 8,'Finn and Jake fall victim to their own laziness when they delegate their adventuring responsibilities to a group of businessmen they thawed from an iceberg. Eventually, the businessmens efficiency causes them to become hazards to others, and they are refrozen into an iceberg.',20);
insert into EPISODIO_ENTITY values (3569, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348269.jpg', 'My Two Favorite People', 9,'Jake feels overwhelmed at not having enough time for Finn and his girlfriend, Lady Rainicorn, so he tries to get them to hang out more. Eventually, Finn and Lady Raincorn become closer than Jake is comfortable with, and he starts feeling jealous.',20);
insert into EPISODIO_ENTITY values (3570, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348288.jpg', 'Memories of Boom Boom Mountain', 10,'Finn, motivated by an upsetting experience when he was a baby, tries to reconfirm his desire for helping people out when confronted with one problem after another stemming from a violence-hating mountain.',20);
insert into EPISODIO_ENTITY values (3571, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348289.jpg', 'Finn the Wizard', 11,'Finn and Jake are coaxed by a skeleton man to enroll in a course for free magic powers. After becoming full-fledged wizards, they realize they were tricked into helping stop an asteroid for all of eternity. Finn rejects the status quo and thinks of a different way to avert the crisis.',20);
insert into EPISODIO_ENTITY values (3572, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/101/252998.jpg', 'Evicted!', 12,'Finn and Jake search the land of Ooo for a new home after a vampire queen named Marceline claims the duos treehouse as her own. Eventually, Marceline relents, because she thinks Finn and Jake are "cool".',20);
insert into EPISODIO_ENTITY values (3573, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348290.jpg', 'City of Thieves', 13,'Finn and Jake, in hopes of helping a little girl named Penny get back her stolen basket, enter into a city where everyone is a thief, and become slowly corrupted by their surroundings.',20);
insert into EPISODIO_ENTITY values (3574, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348291.jpg', 'The Witchs Garden', 14,'After Jake steals one of the Witchs donuts, she steals Jakes powers and wont give them back unless he apologizes to her. During a series of events trying to find a way to get Jakes powers back, Finns life is then held on the line, but will Jakes new laziness get the best of him?',20);
insert into EPISODIO_ENTITY values (3575, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348292.jpg', 'What is Life?', 15,'Finn creates a Never-Ending Pie-Throwing Robot (Neptr) to prank Jake, but it unexpectedly comes to life! Yet when he decides to use some of the Ice Kings power to further develop it, this ultimately leads to a moral dilemma for the new living machine.',20);
insert into EPISODIO_ENTITY values (3576, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348293.jpg', 'Ocean of Fear', 16,'Finn discovers hes afraid of the ocean, so he enlists Jakes help to overcome his fear or risk failure.',20);
insert into EPISODIO_ENTITY values (3577, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348294.jpg', 'When Wedding Bells Thaw', 17,'The Ice King is finally getting married, but consults Finn and Jake on whether or not to go through with getting hitched or keeping his life of abducting princesses.',20);
insert into EPISODIO_ENTITY values (3578, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348295.jpg', 'Dungeon', 18,'Finn descends into a dungeon in hopes of finding adventure, but ultimately finding various obstacles that better fit being handled by Jake than himself alone.',20);
insert into EPISODIO_ENTITY values (3579, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348296.jpg', 'The Duke', 19,'During a mishap accidentally caused by Finn,Princess Bubblegum becomes green and bald, and blames the Duke of Nuts for it, thus making Finn think hes a bad guy. Finn and Jake have no choice but to find the Duke of Nuts on Bubblegums order.',20);
insert into EPISODIO_ENTITY values (3580, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/138/346911.jpg', 'Freak City', 20,'After a magic man turns Finn into a giant foot, he and Jake team up with a band of similar body part freaks to set things right and try to turn themselves back to normal.',20);
insert into EPISODIO_ENTITY values (3581, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/138/346912.jpg', 'Donny', 21,'When Finn and Jake see a bullying ogre named Donny, they help him turn his life around, unaware of the ecological consequences of their action.',20);
insert into EPISODIO_ENTITY values (3582, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348297.jpg', 'Henchman', 22,'Finn takes the place of Marcelines henchman, and he finds out how hard it is to obey her strange ways.',20);
insert into EPISODIO_ENTITY values (3583, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/138/346917.jpg', 'Rainy Day Daydream', 23,'When a knife storm forces Finn and Jake to stay inside, they discover the out-of-control power of Jakes imagination.',20);
insert into EPISODIO_ENTITY values (3584, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348298.jpg', 'What Have You Done?', 24,'Finn and Jake capture Ice King under order of Princess Bubblegum without even knowing what he has done wrong.',20);
insert into EPISODIO_ENTITY values (3585, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348299.jpg', 'Finn Meets His Hero', 25,'Finn and Jake discover Billy, the greatest hero who ever lived, and try to help other people without using violence in their methods.',20);
insert into EPISODIO_ENTITY values (3586, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348300.jpg', 'The Gut Grinder', 26,'When the gold owned by several beings were devoured by a creature called the "Gut Grinder," Finn and Jake set out to discover who the culprit is, while trying to sustain Jakes thoughts that he is the actual Gut Grinder.',20);
insert into EPISODIO_ENTITY values (3587, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348523.jpg', 'It Came from the Nightosphere', 1,'Finn summons the Lord of Evil to reconcile with his daughter, Marceline the Vampire Queen, but ends up unleashing him on the unsuspecting land.',20);
insert into EPISODIO_ENTITY values (3588, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348524.jpg', 'The Eyes', 2,'One night, an exhausted Finn and Jake are creeped out by an odd-looking horse that mysteriously appears outside the treehouse and keeps them awake. They try everything they can think of to get rid of the freaky horse, but nothing seems to work.',20);
insert into EPISODIO_ENTITY values (3589, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348525.jpg', 'Loyalty to the King', 3,'Theres a new "Nice King" in Ooo, and he looks kinda like someone else we know.',20);
insert into EPISODIO_ENTITY values (3590, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348526.jpg', 'Blood Under the Skin', 4,'Finn goes on an embarrassing quest to get armor to fit in with some really cool knights.',20);
insert into EPISODIO_ENTITY values (3591, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348527.jpg', 'Storytelling', 5,'When Jake becomes sick, the only thing that can cure him is a good story, so he asks Finn to go out and find one. The story must have excitement, romance, suspense and, of course, a happy ending. But when nothing interesting happens, Finn tries to make the story happen, accidentally turning the forest animals against each other... and him!',20);
insert into EPISODIO_ENTITY values (3592, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348528.jpg', 'Slow Love', 6,'A lonely snail lookin for love literally crashes into the treehouse and asks Finn and Jake for help. Now our heroes must teach this snail how to get a girlfriend before he destroys their home!',20);
insert into EPISODIO_ENTITY values (3593, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348260.jpg', 'Power Animal', 7,'Finn is kidnapped by a group of gnomes, who want to harness his energy to take over the world. Only Jake can save his best friend... if he can just focus long enough to follow the obvious clues and rescue Finn.',20);
insert into EPISODIO_ENTITY values (3594, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348529.jpg', 'Crystals Have Power', 8,'Jake takes a vow of non-violence which is inconvenient when theyre attacked by marauders from the crystal dimension.',20);
insert into EPISODIO_ENTITY values (3595, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/139/348261.jpg', 'The Other Tarts', 9,'Finn and Jake volunteer for a dangerous assignment: carrying rare tarts for a meeting of Ooo royalty.',20);
