insert into EPISODIO_ENTITY values (3691, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/141/353089.jpg', 'Jake Suit', 27,'Jake is sick and tired of Finn using his body as a suit of armor, so he convinces Finn to trade places to show him how much it really stinks.',20);
insert into EPISODIO_ENTITY values (3692, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/141/353090.jpg', 'Be More', 28,'Finn and Jake disguise themselves as MOs in order to infiltrate the MO factory in hopes of saving BMO from malfunctioning.',20);
insert into EPISODIO_ENTITY values (3693, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/141/353091.jpg', 'Sky Witch', 29,'Marceline is on a top-secret mission tracking Maja the Sky Witch. But when she loses the witchs trail, Marceline turns to Princess Bubblegum for help.',20);
insert into EPISODIO_ENTITY values (3694, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/141/353092.jpg', 'Frost & Fire', 30,'After Flame Princess battles Ice King, Finn has an exciting dream. But when it abruptly ends, Finn must get FP and IK to fight again to find out how it ends.',20);
insert into EPISODIO_ENTITY values (3695, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/141/353245.jpg', 'Too Old', 31,'Finn, Jake and PB discover a talented mutant named Lemonsqueak at The Pageant of Mutants. Now they must find a way to free him from the lemongrabs.',20);
insert into EPISODIO_ENTITY values (3696, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/141/353246.jpg', 'Earth & Water', 32,'Princess Bubblegum subjects Flame Princess to a series of tests to gauge FPs fiery tendencies. But when theres an emergency at the treehouse, and PB leaves Cinnamon Bun to watch Flame Princess, her experiment might literally backfire in her face.',20);
insert into EPISODIO_ENTITY values (3697, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/141/353247.jpg', 'Time Sandwich', 33,'Jake crafts the most delicious sandwich ever, but when Magic Man steals it, Finn must defy the laws of space and time to win back Jakes creation.',20);
insert into EPISODIO_ENTITY values (3698, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/141/353261.jpg', 'The Vault', 34,'When Finn starts sleepwalking and dreaming about the Green Lady he filed away in his memory vault, Jake and BMO help him tap into his repressed memories to uncover a secret past. Who is the Green Lady? And how is she connected to Finn?',20);
insert into EPISODIO_ENTITY values (3699, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/141/353262.jpg', 'Love Games', 35,'Slime Princess needs a husband or else shell lose the Slime Kingdom to her obnoxious sis. Finn steps in to save the day, but first they will need to win a series of Love Games to prove to Slime Princesss dad that they are really in love. This is definitely NOT what Finn signed up for!',20);
insert into EPISODIO_ENTITY values (3700, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/141/353282.jpg', 'Dungeon Train', 36,'All aboard! Finn and Jake discover a train where every car is a dungeon filled with a new foe for Finn to fight. Jake quickly gets bored and wants to leave, but Finn is having the BEST time and doesnt want to leave... ever!',20);
insert into EPISODIO_ENTITY values (3701, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/141/353283.jpg', 'The Box Prince', 37,'Finn meets the Box Prince (a cat with a box on its back) and discovers the Box Kingdom has been taken over by an imposter. Now, Finn must help the real Box Prince reclaim his rightful throne.',20);
insert into EPISODIO_ENTITY values (3702, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/141/353563.jpg', 'Red Starved', 38,'Finn, Jake and Marceline are trapped in an underground cavern with no red in sight. If Marceline doesnt feed, like ASAP, she will turn into a vampiric beast and suck out all of Jakes blood! So, Finn heads off to explore the cave and find something red to satiate her until they can be rescued. But time is running out!',20);
insert into EPISODIO_ENTITY values (3703, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/141/353564.jpg', 'We Fixed a Truck', 39,'Finn finds an old truck, and Jake calls Banana Man to help with the repairs. But when BMO stays up all night working on the truck, he hears on a spooky radio talk show that Princess Bubblegum is a reptilian replicant. Is it just another one of Starchys crazy conspiracy theories, or a fact?',20);
insert into EPISODIO_ENTITY values (3704, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/141/353565.jpg', 'Play Date', 40,'Sick and tired of babysitting Ice King while the Ice Kingdom is being rebuilt, Finn and Jake call up an old friend to hang out with their annoying houseguest: Abracadaniel. But when Ice King and his new BFF accidentally unleash the demon Kee-Oth, Finn and Jake have to clean up their mess.',20);
insert into EPISODIO_ENTITY values (3705, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/141/353566.jpg', 'The Pit', 41,'Kee-Oth the Blood Demon has kidnapped Jake, taken him back to his dimension and thrown him in a pit. If Finn wants to rescue his friend, hes going to need Lady Rainicorns help... and a videotape that will reveal how to open the portal to Kee-Oths messed-up dimension.',20);
insert into EPISODIO_ENTITY values (3706, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/141/353567.jpg', 'James', 42,'Finn &amp; Jake are excited when Princess Bubblegum invites them to help her collect samples in the Desert of Wonders. But when their vessel is attacked by nasty goo monsters, Finn &amp; Jake start to think the mission has been sabotaged by PBs robot helper James.',20);
insert into EPISODIO_ENTITY values (3707, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/141/353570.jpg', 'Root Beer Guy', 43,'Root Beer Guy works a boring job during the day and tries to write mystery stories at night. But his life is about to change when he witnesses Finn &amp; Jake kidnapping Princess Bubblegum! Theres only one problem: no one believes Root Beer Guy...',20);
insert into EPISODIO_ENTITY values (3708, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/141/353580.jpg', 'Apple Wedding', 44,'You are cordially invited to the Wedding of the Year! But who will be united in matrimony?',20);
insert into EPISODIO_ENTITY values (3709, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/141/353682.jpg', 'Blade of Grass', 45,'Finn and Jake decide its time for Finn to get a new sword. Finn reluctantly buys a grass sword from a mysterious old man, but the sword turns out to be cursed! And unfortunately for our hero, all sales are final.',20);
insert into EPISODIO_ENTITY values (3710, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/141/353693.jpg', 'Rattleballs', 46,'Finn practices his sword fighting skills at the candy junkyard, where he meets an old gumball robot named Rattleballs. To Finns shock, he finds out hes NOT the master swordsman he thinks he is. What the what?! Finn begs Rattleballs to train him, but he soon discovers his mentors deep, dark secret... a secret that will ultimately test Finns loyalty to Princess Bubblegum.',20);
insert into EPISODIO_ENTITY values (3711, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/141/353757.jpg', 'The Red Throne', 47,'When Flame King breaks out of his prison and takes over the Flame Kingdom again, Flame Princess turns to the one person she believes she can trust... Finn! But will Finn be able to put his feelings for Flame Princess aside long enough to help her reclaim her throne?',20);
insert into EPISODIO_ENTITY values (3712, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/141/353762.jpg', 'Betty', 48,'In Wizard City, a magic spell backfires and turns Ice King back into Simon. Now with Finn, Jake and Marcelines help, Simon finds a way to bring his beloved Betty back. Finally reunited with the love of his life, everything is great! Theres just one catch...without his magic crown, Simon will die.',20);
insert into EPISODIO_ENTITY values (3713, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/141/353765.jpg', 'Bad Timing', 49,'Love is in the air when Lumpy Space Princess reconnects with an old classmate, but will her jealousy get in the way of finding true love?',20);
insert into EPISODIO_ENTITY values (3714, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/141/353766.jpg', 'Lemonhope Part I', 50,'Tired of all of Princess Bubblegums talk about "responsibility," Lemonhope yearns for true freedom. So he sets off on the greatest adventure of his lemony life.',20);
insert into EPISODIO_ENTITY values (3715, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/141/353771.jpg', 'Lemonhope Part II', 51,'Though Lemonhope finds refuge from the desert with monster hunter Phlannel Boxingday, he might not be able to escape the ghosts of his past.',20);
