insert into EPISODIO_ENTITY values (3840, 15, 'https://static.tvmaze.com/uploads/images/medium_landscape/382/956273.jpg', 'Laser Light Cannon', 2,'When a menacing red eye is about to hit Beach City, the only thing that can destroy it is a Laser Light Cannon which once belonged to Stevens mother, Rose Quartz. Thus, Steven enlists the help of his father, Greg, and they search through his storage for the cannon.',21);
