insert into SERIE_ENTITY  values (22, 2009,'https://static.tvmaze.com/uploads/images/medium_portrait/485/1214095.jpg', 'Fullmetal Alchemist: Brotherhood', 'Fullmetal Alchemist: Brotherhood is set in a fictional world where alchemy – the transmutation of raw materials into objects – is science, and the way of life. The series follows the Elric brothers, Edward and Alphonse, on their perilous journey in search of the legendary "Philosophers Stone". They set forth hoping that the magical artifact can restore their bodies after a failed attempt to revive their dead mother cost Edward his left leg and right arm, while Alphonses entire body was taken away leaving his soul affixed to a suit of armor.Source: Anime News Network','https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/da999385-f4f0-4976-9232-d3f55056b549/d6ve2q1-77ae5718-c0a1-4bd6-9795-cb385a861738.png/v1/fill/w_1273,h_628,q_70,strp/wallpaper_fullmetal_alchemist_brotherhood__by_narusailor_d6ve2q1-pre.jpg?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..Eo3D9Bfom--pJsKLd1sjaRTHyX6aQEqhhr53AbyFPXE');
