insert into EPISODIO_ENTITY values (3993, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1000304.jpg', 'Fullmetal Alchemist', 1,'The Elric brothers adjust to military life and take part in a manhunt for Isaac the Freezer, a former State Alchemist bent on ending the reign of Fuhrer Bradley.',22);
insert into EPISODIO_ENTITY values (3994, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1000305.jpg', 'The First Day', 2,'A glimpse into the past reveals the pain and desperation that drove the Elric boys to break alchemys greatest taboo - human transmutation - and their reasons for becoming dogs of the military.',22);
insert into EPISODIO_ENTITY values (3995, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1000601.jpg', 'City of Heresy', 3,'Science and faith collide when the Elrics confront Father Cornello. He claims to work miracles, but the brothers suspect him of abusing a Philosophers Stone to manipulate his flock.',22);
insert into EPISODIO_ENTITY values (3996, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1000602.jpg', 'An Alchemists Anguish', 4,'The Elrics meet Shou Tucker, a leading researcher in the field of chimeras. He has much to teach Ed and Al about alchemy - and the horrible cruelty that sometimes accompanies it.',22);
insert into EPISODIO_ENTITY values (3997, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1000603.jpg', 'Rain of Sorrows', 5,'Edward and Alphonse are attacked by Scar, a mysterious killer wanted for a string of gruesome murders. His powers are incredible - and his obsession with slaying State Alchemists might be justified.',22);
insert into EPISODIO_ENTITY values (3998, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1000604.jpg', 'Road of Hope', 6,'Before arriving at the Rockbell home for repairs, the Elrics meet Dr. Marcoh, a State Alchemist running from past sins. The information he gives Ed and Al could put the Philosophers Stone within reach.',22);
insert into EPISODIO_ENTITY values (3999, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1000605.jpg', 'Hidden Truths', 7,'The Elrics discover the horrific ingredient needed to create a Philosophers Stone. When night falls, they prowl the grounds of a secret laboratory in search of more facts - but the brothers find only danger.',22);
insert into EPISODIO_ENTITY values (4000, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1000744.jpg', 'The Fifth Laboratory', 8,'Ed and Al furiously battle the Fifth Laboratorys psychotic guards. In the chaos, the truth behind the Philosophers Stone is buried beneath rubble - and disturbing new questions are unearthed.',22);
insert into EPISODIO_ENTITY values (4001, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1000747.jpg', 'Created Feelings', 9,'Al is haunted by the notion his entire existence was simply created by his brother. When the youngest Elric angrily reveals these suspicions, only Winry can convince him just how wrong he is about Ed.',22);
insert into EPISODIO_ENTITY values (4002, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001300.jpg', 'Separate Destinations', 10,'When the conspiracy surrounding the Philosophers Stone closes in on the highest ranks of the military, one of Mustangs most trusted and cherished allies is murdered.',22);
insert into EPISODIO_ENTITY values (4003, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001302.jpg', 'Miracle at Rush Valley', 11,'The Elrics, realizing alchemy has yet to unlock the mysteries of creating life, feel powerless when a new friend goes into labor. Winry, however, jumps into action with a young thief named Paninya.',22);
insert into EPISODIO_ENTITY values (4004, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001303.jpg', 'One is All, All is One', 12,'While visiting Izumi, their childhood teacher, the Elrics recall the early difficulties of grasping equivalent exchange. They also discover she shares their intimate knowledge of alchemys greatest taboo.',22);
insert into EPISODIO_ENTITY values (4005, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001304.jpg', 'Beasts of Dublith', 13,'Al is abducted by chimeras led by the seemingly indestructible Homunculus known as Greed. When Eds rescue attempt falls short, Izumi proves once more that shes got the brothers best interests in mind.',22);
insert into EPISODIO_ENTITY values (4006, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001308.jpg', 'Those Who Lurk Underground', 14,'In a violent clash with Greed, King Bradley proves to be a brutal opponent. But the man who finally destroys the Ultimate Shield is more powerful than even the Fuhrer himself.',22);
insert into EPISODIO_ENTITY values (4007, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001309.jpg', 'Envoy from the East', 15,'The Elrics scuffle with Ling Yao and his attendants, Lan Fan and Fu, visitors from Xing seeking the Philosophers Stone. Ed may not like him, but Ling Yaos not leaving until he gets what he wants.',22);
insert into EPISODIO_ENTITY values (4008, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001310.jpg', 'Footsteps of a Comrade-in-Arms', 16,'After learning of Hughess fate, Ed and Al are ravaged by sadness and guilt. Envy still hides in plain sight among the State Alchemists, and another Homunculus is on the verge of infiltrating their ranks as well.',22);
insert into EPISODIO_ENTITY values (4009, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001311.jpg', 'Cold Flame', 17,'Freed by an unlikely liberator, Rosss escape is interrupted by Mustang. Even those most loyal to the Flame Alchemist are shaken by the controversial action he takes against the accused killer of Maes Hughes.',22);
insert into EPISODIO_ENTITY values (4010, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001312.jpg', 'The Arrogant Palm of a Small Human', 18,'Eds journey to a distant land of legend offers surprising new details behind Mustangs alleyway encounter with Ross. After a fateful encounter of his own, Elric learns a stunning secret about Winrys parents.',22);
insert into EPISODIO_ENTITY values (4011, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001313.jpg', 'Death of the Undying', 19,'Mustang, Alphonse, Havoc, and Hawkeye split up to search a military laboratory. If Lust has her way, none of them will ever see each other again.',22);
insert into EPISODIO_ENTITY values (4012, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001316.jpg', 'Father Before the Grave', 20,'Hohenheims visit ends with a grave warning to Pinako, but Ed finds hope among the charred ruins of his childhood. Now more than ever, he has confidence that Al can be returned to his body.',22);
insert into EPISODIO_ENTITY values (4013, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001317.jpg', 'Advance of the Fool', 21,'Hoping to learn more about the Homunculi, Ed and Al devise a risky strategy to lure the creatures out of hiding. Step one of the brothers plan: risk death at the hands of their most dangerous enemy - Scar.',22);
insert into EPISODIO_ENTITY values (4014, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001318.jpg', 'Backs in the Distance', 22,'Scars mission to destroy those who slaughtered his people is fueled by justifiable rage. Upon learning the role Scar played in her parents deaths, Winry claims those murderous feelings as her own.',22);
insert into EPISODIO_ENTITY values (4015, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001319.jpg', 'Girl on the Battlefield', 23,'Cooperation between Mustangs cabal and Ling Yaos band leads to the capture of a Homunculus. Unfortunately, their actions also capture the eye of the Homunculus hiding atop the militarys ranks.',22);
insert into EPISODIO_ENTITY values (4016, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001320.jpg', 'Inside the Belly', 24,'Gluttonys twisted powers overwhelm the Elrics - and the creatures appetite is satisfied by battles end. Meanwhile, Mustang acts on his suspicions of Bradley and finds himself in the belly of the beast.',22);
insert into EPISODIO_ENTITY values (4017, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001321.jpg', 'Doorway of Darkness', 25,'The Homunculi are winning. Ed and Ling face a horrific enemy within the hellish expanse of Gluttonys gut. In Central, Mustang can only watch as his loyal band of soldiers is divided by Bradley.',22);
insert into EPISODIO_ENTITY values (4018, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001322.jpg', 'Reunion', 26,'Truths are exposed when Al finds the one called Father, and Mustang hears the tale of Bradleys creation - but the most amazing revelation is reserved for Ed after he once again breaks alchemys greatest taboo.',22);
insert into EPISODIO_ENTITY values (4019, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001324.jpg', 'Interlude Party', 27,'Visions of the past play out as Hohenheim reflects on the follies of man; the pain that comes with family, the truths of Alchemy and the roots of war.',22);
insert into EPISODIO_ENTITY values (4020, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001325.jpg', 'Father', 28,'The Elrics come face to face with Father - and his face is familiar indeed. Powerless and amazed, Ed and Al can only watch as Father creates a new Homunculus with alchemy that should be impossible.',22);
insert into EPISODIO_ENTITY values (4021, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001326.jpg', 'Struggle of the Fool', 29,'The Elrics are at Bradleys mercy; if the brothers make one wrong move, those dearest to them will pay. As Mustang quietly gathers allies at his side, Ed discovers there may be no need to find a Philosophers Stone.',22);
insert into EPISODIO_ENTITY values (4022, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001327.jpg', 'The Ishvalan War of Extermination', 30,'As Edward hears Hawkeyes tale of a time when idealistic young soldiers were tasked with genocide, the horrors of the Ishvalan battlefield are revealed.',22);
insert into EPISODIO_ENTITY values (4023, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001328.jpg', 'The 520 Cens Promise', 31,'Even as his subordinates are scattered, Mustang finds he still has allies - unfortunately, so do his enemies. The Homunculi unleash one of the Ishvalan Wars most notorious killers to deal with Scar and Marcoh.',22);
insert into EPISODIO_ENTITY values (4024, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001329.jpg', 'The Führers Son', 32,'A secret encounter allows Mustang to spark new ambitions in an old friend - an ally with loyal troops at his command. Meanwhile, Edward and Alphonse share a chance meeting with their biggest fan - young Selim Bradley.',22);
insert into EPISODIO_ENTITY values (4025, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001330.jpg', 'The Northern Wall of Briggs', 33,'The frigid northern borderlands become a battlefield when Kimblee finally closes in on Scar. Deeper into the frozen wasteland, Ed and Als fight is against the bitter elements as they struggle to reach Fort Briggs.',22);
insert into EPISODIO_ENTITY values (4026, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001331.jpg', 'Ice Queen', 34,'The soldiers at Fort Briggs remain ever vigilant against the threat of spies from Drachma. The massive compound may seem impenetrable - but a violent intruder offers destructive proof to the contrary.',22);
insert into EPISODIO_ENTITY values (4027, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001332.jpg', 'The Shape of This Country', 35,'Edward uncovers a conspiracy of staggering scope: a plot that has already claimed countless victims. Clues suggest that Fort Briggs will soon know bloodshed - and an entire nation will suffer.',22);
insert into EPISODIO_ENTITY values (4028, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001333.jpg', 'Family Portrait', 36,'As Raven tries to corrupt Armstrong, Ed and Al can only wait in their cell. Long ago, their father faced his own captivity, confined to an eternity of regret in an undying body. To escape the pain, he said goodbye.',22);
insert into EPISODIO_ENTITY values (4029, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001334.jpg', 'The First Homunculus', 37,'The first Homunculus reveals itself; Edward is surprised by an offer from Kimblee: Fullmetal can have all he has searched for - in exchange for becoming a mass murderer.',22);
insert into EPISODIO_ENTITY values (4030, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001335.jpg', 'Conflict at Baschool', 38,'When Scar is cornered by a pair of gruesome chimera, the Elrics must enter the fray as his unlikely allies. Later, Winrys attempt to confront Scar over his role in her parents death ends in disaster.',22);
insert into EPISODIO_ENTITY values (4031, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001336.jpg', 'Daydream', 39,'The ruse of Winrys abduction by Scar is revealed, but a plan of rescue must still be hatched. A brutal storm is coming - one which only Alphonse Elric can brave.',22);
insert into EPISODIO_ENTITY values (4032, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001337.jpg', 'Homunculus', 40,'Long ago, the blood of a simple slave was used in an experiment which created a strange, shapeless being. In exchange for the gift of existence, the being gave the slave a name - and cursed him with immortality.',22);
insert into EPISODIO_ENTITY values (4033, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001351.jpg', 'The Abyss', 41,'Bound by more than blood, the Elrics have long shared joy and pain. Now, with Al wandering the frigid void - and Ed losing blood by Kimblees hand - the mystical connection of their souls could prove fatal.',22);
insert into EPISODIO_ENTITY values (4034, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001352.jpg', 'Signs of a Counteroffensive', 42,'May and Marcohs efforts to decode the research of Scars brother yield progress, but it might be too late to prevent catastrophe. Violence is spreading across the land, and it will soon reach the northern border.',22);
insert into EPISODIO_ENTITY values (4035, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001353.jpg', 'Bite of the Ant', 43,'In the snowy north, the soldiers of Fort Briggs engage an invading army and Marcoh leads an attack against monstrous Envy. In Central, an ominous and shocking secret is revealed to Olivier Armstrong.',22);
insert into EPISODIO_ENTITY values (4036, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001354.jpg', 'Revving at Full Throttle', 44,'Hohenheim and Alphonse enjoy a chance to get reacquainted. Their bond is restored with ease, inspiring the father to share his secrets with his sons - but one of them is far away and on the run.',22);
insert into EPISODIO_ENTITY values (4037, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001355.jpg', 'The Promised Day', 45,'The Promised Day is approaching. While most will face the coming chaos with their own kind, Edward forms a new group comprised of human, chimera and Homunculus',22);
insert into EPISODIO_ENTITY values (4038, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001356.jpg', 'Looming Shadows', 46,'Those who have prepared to reclaim a nation find their plans exposed. The chaos multiplies after an assassin strikes down a mighty leader in broad daylight, and Alphonse falls prey to monsters in the dark.',22);
insert into EPISODIO_ENTITY values (4039, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001357.jpg', 'Emissary of Darkness', 47,'A sinister voice rings out from the shell of Als armor, and Ed and Greed find themselves under attack. As the Homunculi use the darkness to their advantage, a face from the past arrives to join the battle.',22);
insert into EPISODIO_ENTITY values (4040, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001358.jpg', 'The Oath in the Tunnel', 48,'After investigating the twisted roots of the Bradley family tree, Mustang gathers his most loyal troops. Meanwhile, Ed and his allies continue fighting Selim, who shocks everyone by turning on his own kind.',22);
insert into EPISODIO_ENTITY values (4041, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001359.jpg', 'Filial Affection', 49,'With his fathers help, Al takes incredible steps to contain the monstrous Pride. As the sun begins to rise on the Promised Day, the youngest Elric listens while the Homunculus ponders his very human mother.',22);
insert into EPISODIO_ENTITY values (4042, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001360.jpg', 'Upheaval in Central', 50,'Mustang leads a ragtag assault force of hardy northern troops - and welcome faces from the past - against Centrals defenses. Victory seems certain until the militarys most horrifying secret is revealed.',22);
insert into EPISODIO_ENTITY values (4043, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001362.jpg', 'The Immortal Legion', 51,'Eds crew faces a horde of ravenous mannequins, abominations powered by human souls. The twisted creatures arent the only unstoppable force on the battlefield - Pride, Sloth, and Envy are on the move.',22);
insert into EPISODIO_ENTITY values (4044, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001363.jpg', 'Combined Strength', 52,'With the philosopher stone in his possession, Alphonse fearlessly takes on pride and Kimble. Elsewhere, the Armstrongs find themselves trapped between Sloths onslaught and the guns of Centrals troops.',22);
insert into EPISODIO_ENTITY values (4045, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001364.jpg', 'Flame of Vengeance', 53,'After a startling radio broadcast grants Mustangs forces the advantage over Centrals troops, the Flame Alchemist unleashes the brutal power of burning hatred in the battle against the killer of Maes Hughes.',22);
insert into EPISODIO_ENTITY values (4046, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001365.jpg', 'Beyond the Inferno', 54,'As Envy writhes within the firestorm unleashed by Mustangs vengeful rage, Hawkeye must take drastic measures to prevent the Flame Alchemists hatred from going out of control.',22);
insert into EPISODIO_ENTITY values (4047, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001366.jpg', 'The Adults Way of Life', 55,'A rebel victory is imminent and hope takes hold among Mustang and Armstrongs troops. Centrals forces teeter on the brink of collapse - until their fallen leader returns to take control.',22);
insert into EPISODIO_ENTITY values (4048, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001367.jpg', 'The Return of the Führer', 56,'Centrals forces fight with renewed vigor following Bradleys return, and the Führer himself enters the battle. His first opponent is an armored tank. His second foe is even tougher.',22);
insert into EPISODIO_ENTITY values (4049, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001368.jpg', 'Eternal Leave', 57,'The battle for a nations soul descends into chaos. Bradley unleashes death on those who dare engage him. Beneath Central, the one responsible for the Führers creation unleashes something far, far worse.',22);
insert into EPISODIO_ENTITY values (4050, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001369.jpg', 'Sacrifices', 58,'Mustang must make a difficult choice: will he break alchemys greatest taboo? Or will he watch the person dearest to him die? Meanwhile, it grows ever more difficult to discern where Ling ends and Greed begins.',22);
insert into EPISODIO_ENTITY values (4051, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001370.jpg', 'Lost Light', 59,'As the light of the sun vanishes, Mustang learns the loss which comes from seeing the other side of the Gateway - and five sacrifices gather in the dark presence of the Father.',22);
insert into EPISODIO_ENTITY values (4052, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001371.jpg', 'Eye of Heaven, Gateway of Earth', 60,'The light is gone. Shadows swallow everything. As the planet quakes and the heavens tremble, the souls of heroes and villains alike vanish into darkness. The circle is complete.',22);
insert into EPISODIO_ENTITY values (4053, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001372.jpg', 'He Who Would Swallow God', 61,'Millions of lifeless bodies litter the landscape of Amestris, and a being with the power to create suns is unleashed upon the world. Unless Hohenheim has something amazing up his sleeve, all is surely lost.',22);
insert into EPISODIO_ENTITY values (4054, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001373.jpg', 'A Fierce Counterattack', 62,'A truly epic battle erupts when Edward, Mustang, Hawkeye, Greed, Izumi, and Armstrong attack the god-like Father. The odds are against the forces of good - until one brave boy makes a shocking sacrifice.',22);
insert into EPISODIO_ENTITY values (4055, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001374.jpg', 'The Other Side of the Gateway', 63,'Ed fights the original homunculus known as The father trying to defeat him in order to get his and Als body back.',22);
insert into EPISODIO_ENTITY values (4056, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001375.jpg', 'Journeys End', 64,'Ed and Al start a new adventure in searching for new and innovative ways of alchemy.',22);
