insert into SERIE_ENTITY  values (23, 2013,'https://static.tvmaze.com/uploads/images/medium_portrait/477/1194843.jpg', 'Rick and Morty', 'Rick is a mentally gifted, but sociopathic and alcoholic scientist and a grandfather to Morty; an awkward, impressionable, and somewhat spineless teenage boy. Rick moves into the family home of Morty, where he immediately becomes a bad influence.','https://wallpapers.com/images/featured/rick-and-morty-cool-background-t3ynu5ly9m7jq6e2.jpg');
