insert into EPISODIO_ENTITY values (4057, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/292/730352.jpg', 'Pilot', 1,'Rick takes Morty to another dimension to get some seeds for him but Mortys parents are considering to put Rick in a retirement home for keeping Morty away from school to help him in his lab.',23);
insert into EPISODIO_ENTITY values (4058, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/292/730780.jpg', 'Lawnmower Dog', 2,'Mortys small, white dog Snuffles gets on the nerves of the family, so Rick quickly builds a knowledge enhancing helmet for the dog. In the meantime, Rick and Morty decide to incept the dreams of Mortys math teacher, Mr. Goldenfold in order to convince him to give Morty As in math. While the duo are sent on an epic dream world journey, Snuffles slowly gains sentience, which leads to a slew of even more problems.',23);
insert into EPISODIO_ENTITY values (4059, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/15/37914.jpg', 'Anatomy Park', 3,'Its around Christmas time and Jerrys parents are coming to visit so he wants everybody to have a normal holiday without technology and without Rick. Fortunately for him, Rick has other plans, involving building a molecular theme park inside of a friend of his named Ruben, and he shrinks down Morty and sends him in there to test it out.',23);
insert into EPISODIO_ENTITY values (4060, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/15/37915.jpg', 'M. Night Shaym-Aliens!', 4,'Aliens send Rick, Morty and Jerry into an alternate reality, and Rick tries to get them out as oblivious Jerry pitches a marketing slogan for apples.',23);
insert into EPISODIO_ENTITY values (4061, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/15/37916.jpg', 'Meeseeks and Destroy', 5,'Morty has grown weary of Ricks shenanigans, so he leads a supposedly safer adventure. Jerry conjures weird creatures to help him with his golf game.',23);
insert into EPISODIO_ENTITY values (4062, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/15/37917.jpg', 'Rick Potion #9', 6,'Rick provides Morty with a love potion to get Jessica. The serum backfires &amp; Ricks attempt to fix things creates Cronenberg inspired monsters. Rick is okay with it but Morty feels partly responsible for creating a living nightmare.',23);
insert into EPISODIO_ENTITY values (4063, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/15/37918.jpg', 'Raising Gazorpazorp', 7,'After Morty fathers a child with a sex robot, Rick and Summer visit the robots planet, where the kid grows into an adult within days.',23);
insert into EPISODIO_ENTITY values (4064, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/15/37919.jpg', 'Rixty Minutes', 8,'When Rick hooks up the familys tv receiver with reality-tv shows from alternate dimensions, and allows them to see themselves in different versions of their lives, they begin to wonder what they have, and more importantly - what could have been.',23);
insert into EPISODIO_ENTITY values (4065, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/15/37920.jpg', 'Something Ricked This Way Comes', 9,'Rick is skeptical of Summers new job at a shop run by the devil. Jerry and Morty argue about Plutos status as a planet and end up traveling there.',23);
insert into EPISODIO_ENTITY values (4066, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/15/37921.jpg', 'Close Rick-Counters of the Rick Kind', 10,'Ricks just trying to enjoy a nice breakfast, but hes kidnapped by a group of alternate Ricks and taken to stand trial for crimes against Ricks.',23);
insert into EPISODIO_ENTITY values (4067, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/15/37922.jpg', 'Ricksy Business', 11,'When Jerry and Beth go away to take part in a re-creation of the sinking of the Titanic, Rick and Summer throw a party that gets out of control.',23);
insert into EPISODIO_ENTITY values (4068, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/15/37923.jpg', 'A Rickle in Time', 1,'Rick unfreezes time, but since he, Morty and Summer have been living for so long on frozen time, a parallel dimension develops.',23);
insert into EPISODIO_ENTITY values (4069, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/15/37924.jpg', 'Mortynight Run', 2,'Morty tries to save a life.',23);
insert into EPISODIO_ENTITY values (4070, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/15/37925.jpg', 'Auto Erotic Assimilation', 3,'Rick becomes emotional; Beth and Jerry are hard on each other.',23);
insert into EPISODIO_ENTITY values (4071, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/15/38412.jpg', 'Total Rickall', 4,'Meeting new friends; Morty goes ballistic.',23);
insert into EPISODIO_ENTITY values (4072, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/15/39536.jpg', 'Get Schwifty', 5,'Rick and Morty must step up and save things; a new religion starts up.',23);
insert into EPISODIO_ENTITY values (4073, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/68/171025.jpg', 'The Ricks Must Be Crazy', 6,'Rick forgets to check his oil, and must repair his car.',23);
insert into EPISODIO_ENTITY values (4074, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/18/46223.jpg', 'Big Trouble in Little Sanchez', 7,'Rick joins in on hijinks, Beth and Jerry sort out relationship issues.',23);
insert into EPISODIO_ENTITY values (4075, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/68/171026.jpg', 'Interdimensional Cable 2: Tempting Fate', 8,'Jerry gets sick and Rick sparks up the TV.',23);
insert into EPISODIO_ENTITY values (4076, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/300/751727.jpg', 'Look Whos Purging Now', 9,'Rick and Morty land on a planet where all the citizens are allowed to commit crimes -- including murder -- without punishment for one night.',23);
insert into EPISODIO_ENTITY values (4077, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/307/769086.jpg', 'The Wedding Squanchers', 10,'When Jerry accidentally gets transported to the planet hosting Birdperson and Tammys wedding, the whole family attends the ill-fated ceremony.',23);
insert into EPISODIO_ENTITY values (4078, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/105/262759.jpg', 'The Rickshank Rickdemption', 1,'Rick, still in galactic prison, puts an intricate escape plan into action. Back on Earth, which is now under federation control, Morty and Summer have an argument about their grandpa.',23);
insert into EPISODIO_ENTITY values (4079, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/122/306764.jpg', 'Rickmancing the Stone', 2,'With the kids dealing with their parents divorce, Rick takes them to a Mad Max-style universe where he tries to steal a green crystal from a group of scavengers.',23);
insert into EPISODIO_ENTITY values (4080, 24, 'https://static.tvmaze.com/uploads/images/medium_landscape/123/308859.jpg', 'Pickle Rick', 3,'Rick turns himself into a pickle while the rest of the family goes to therapy. Now Rick has to figure out how to stop being a pickle.',23);
insert into EPISODIO_ENTITY values (4081, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/123/309507.jpg', 'Vindicators 3: The Return of Worldender', 4,'While ostensibly helping a group of superheroes called the Vindicators, Rick instead drunkenly sets up a "Saw"-like scenario for them to navigate.',23);
insert into EPISODIO_ENTITY values (4082, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/124/310725.jpg', 'The Whirly Dirly Conspiracy', 5,'Rick takes Jerry on a sympathy adventure to a resort where everyone is immortal when there, and Jerry meets some old acquaintances of Ricks who want payback.',23);
insert into EPISODIO_ENTITY values (4083, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/125/314281.jpg', 'Rest and Ricklaxation', 6,'After another exhausting adventure, Rick and Morty decide they need a vacation. But things go a little haywire when they try a special detox machine.',23);
insert into EPISODIO_ENTITY values (4084, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/127/318431.jpg', 'The Ricklantis Mixup', 7,'Rick and Morty encounter a visiting Rick and Morty from the Citadel of Ricks before heading off on an amazing adventure to Atlantis.',23);
insert into EPISODIO_ENTITY values (4085, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/128/320259.jpg', 'Mortys Mind Blowers', 8,'Rick shows Morty a room filled with memories Morty begged him to remove from his mind, and things go off the rails when Rick starts restoring them.',23);
insert into EPISODIO_ENTITY values (4086, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/128/322458.jpg', 'The ABCs of Beth', 9,'Rick and Beth sort out issues from her childhood by visiting a world called Froopyland. Morty and Summer are a little wary of Jerrys new girlfriend.',23);
insert into EPISODIO_ENTITY values (4087, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/129/324378.jpg', 'The Rickchurian Mortydate', 10,'The president needs help from Rick and Morty, prompting a bit of a confrontation. Beth begins to suspect that she may be a clone.',23);
insert into EPISODIO_ENTITY values (4088, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/221/553800.jpg', 'Edge of Tomorty: Rick, Die, Rickpeat', 1,'Rick brings Morty to a planet containing crystals that show whoever is touching them all the ways they may die depending on their choices.',23);
insert into EPISODIO_ENTITY values (4089, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/224/561992.jpg', 'The Old Man and the Seat', 2,'Jerry develops an app at the request of a persistent alien with a "Do Not Develop My App" forehead tattoo. A determined Rick tracks a mystery pooper.',23);
insert into EPISODIO_ENTITY values (4090, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/227/568855.jpg', 'One Crew Over the Crewcoos Morty', 3,'Rick assembles a crew to break into a heist convention, then needs another crew to stop a heist-planning robot. And Morty writes a heist script.',23);
insert into EPISODIO_ENTITY values (4091, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/230/576337.jpg', 'Claw and Hoarder: Special Ricktims Morty', 4,'Rick reluctantly gives in to Mortys wishes to get a pet dragon, then things get weird. Jerry befriends a talking cat and they go to Florida.',23);
insert into EPISODIO_ENTITY values (4092, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/231/579127.jpg', 'Rattlestar Ricklactica', 5,'Rick and Morty get caught up in a full-on snake war after a space snake bites Morty. Jerry tries to prove he can hang Christmas lights without dying.',23);
insert into EPISODIO_ENTITY values (4093, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/255/638365.jpg', 'Never Ricking Morty', 6,'Rick and Morty get caught in a continuity-creating anthology device full of people telling stories about Rick.',23);
insert into EPISODIO_ENTITY values (4094, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/256/640513.jpg', 'Promortyus', 7,'Rick and Morty find themselves in a fight against face-hugging aliens who just happen to have an M&amp;Ms store.',23);
insert into EPISODIO_ENTITY values (4095, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/256/640514.jpg', 'The Vat of Acid Episode', 8,'Morty challenges Rick to build him the real-life equivalent of a "save game" function to live without consequence. Also, theres a giant vat of acid.',23);
insert into EPISODIO_ENTITY values (4096, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/258/645881.jpg', 'Childrick of Mort', 9,'Jerrys plan to take the whole family on a camping trip is sidetracked when Rick gets news that he may have impregnated a planet.',23);
insert into EPISODIO_ENTITY values (4097, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/259/649320.jpg', 'Star Mort Rickturn of the Jerri', 10,'Two Beths, a corporate-sponsored planet incinerator and some faces from the past force Rick and family to "do a Star Wars" to save Earth.',23);
insert into EPISODIO_ENTITY values (4098, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/331/829108.jpg', 'Mort Dinner Rick Andre', 1,'Its a busy night at the Smith house as Ricks nemesis pays a visit and Morty invites a girl over. Then some stuff happens with a portal in the garage.',23);
insert into EPISODIO_ENTITY values (4099, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/334/835723.jpg', 'Mortyplicity', 2,'Killer squids are after the Smiths, but luckily Rick created a decoy family. Or are they real? Can the decoys make decoys? Whos real? Are you real?',23);
insert into EPISODIO_ENTITY values (4100, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/336/841515.jpg', 'A Rickconvenient Mort', 3,'Morty falls head-over-heels in love with an ecological superhero, leaving Summer to join Rick on a bender of interplanetary apocalyptic hedonism.',23);
insert into EPISODIO_ENTITY values (4101, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/339/848455.jpg', 'Rickdependence Spray', 4,'The Smiths band together to fight an army of giant mutant sperm, and lets just say everyone would be better off if Morty stays away from Beths work.',23);
insert into EPISODIO_ENTITY values (4102, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/341/854180.jpg', 'Amortycan Grickfitti', 5,'Beth crashes Rick and Jerrys hellish guys night out, while Morty and Summer attempt to use a spaceship to impress a cool new kid at school.',23);
insert into EPISODIO_ENTITY values (4103, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/343/859276.jpg', 'Rick & Mortys Thanksploitation Spectacular', 6,'Rick turns himself into a turkey after he ruffles the Presidents feathers on Thanksgiving, and the situation soon spirals into total clucking carnage.',23);
insert into EPISODIO_ENTITY values (4104, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/339/848929.jpg', 'Gotron Jerrysis Rickvangelion', 7,'The Smiths get a lesson on the meaning of family after Rick cancels a trip to Boob World to acquire the fifth and final GoTron ferret.',23);
insert into EPISODIO_ENTITY values (4105, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/347/868292.jpg', 'Rickternal Friendshine of the Spotless Mort', 8,'With the rest of the family out of town on a cruise, Rick is left to his own devices at home and decides its time to reconnect with an old friend.',23);
insert into EPISODIO_ENTITY values (4106, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/354/887285.jpg', 'Forgetting Sarick Mortshall', 9,'When Rick starts using birds as sidekicks, Morty finds a new partner in a portal. Is Rick and Mortys interdimensional partnership done forever?',23);
insert into EPISODIO_ENTITY values (4107, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/354/887286.jpg', 'Rickmurai Jack', 10,'Ricks still doing the weird crows thing, but a middle-aged Morty hopes to reconnect with Rick, leading them down an emotional path in a familiar location.',23);
insert into EPISODIO_ENTITY values (4108, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/421/1052645.jpg', 'Solaricks', 1,'Theyre back, baby! The Smiths deal with last seasons fallout, and Rick and Morty are stranded in space floating in the remnants of the citadel.',23);
insert into EPISODIO_ENTITY values (4109, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/421/1054704.jpg', 'Rick: A Mort Well Lived', 2,'Morty is trapped and Rick needs to save him, but to do so, Summer must do a Die Hard. This wont be easy because shes never seen it.',23);
insert into EPISODIO_ENTITY values (4110, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/422/1056844.jpg', 'Bethic Twinstinct', 3,'The Smiths celebrate one of their favourite holidays while Summer and Morty lock into their new ultra-realistic video game console.',23);
insert into EPISODIO_ENTITY values (4111, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/423/1058641.jpg', 'Night Family', 4,'The family discover Rick has been using some new technology that they want to try too. After obliging, classic Rick and Morty chaos ensues.',23);
insert into EPISODIO_ENTITY values (4112, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/424/1061150.jpg', 'Final DeSmithation', 5,'The Smiths dine at their favourite Chinese restaurant and read their fortune cookies aloud. Pretty normal stuff, until Jerry reads his.',23);
insert into EPISODIO_ENTITY values (4113, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/425/1064415.jpg', 'JuRicksic Mort', 6,'Seemingly out of the blue, Earths old rulers return. They make a great case for changing the way society does business, but Rick isnt going to put up with it.',23);
insert into EPISODIO_ENTITY values (4114, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/431/1078899.jpg', 'Full Meta Jackrick', 7,'Rick and Morty remember some of their old adventures together, which leads them to a stand-off with an old enemy.',23);
insert into EPISODIO_ENTITY values (4115, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/432/1080841.jpg', 'Analyze Piss', 8,'Tired of being attacked by goofball supervillains, Rick decides to seek advice about why hes always a target, leading to a breakthrough - for Jerry.',23);
insert into EPISODIO_ENTITY values (4116, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/432/1081799.jpg', 'A Rick in King Morturs Mort', 9,'Morty starts a war on worlds after debunking the entire existence of the Knights of the Sun and is forced to take extreme measures in order to put an end to it all.',23);
insert into EPISODIO_ENTITY values (4117, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/434/1086572.jpg', 'Ricktional Mortpoons Rickmas Mortcation', 10,'What starts as a merry Christmas in the Smith household takes an ugly turn when Morty uncovers a betrayal thanks to a gift from a galaxy far, far away.',23);
insert into EPISODIO_ENTITY values (4118, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/481/1203461.jpg', 'How Poopy Got His Poop Back', 1,'When Mr. Poopybutthole overstays his welcome at the Smith household, the rest of the family get Rick to deal with the problem. However what starts out as a hang out of friends quickly turns into an out of control bar crawl, especially when a special guest joins the group.',23);
insert into EPISODIO_ENTITY values (4119, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/482/1206935.jpg', 'The Jerrick Trap', 2,'Rick and Jerrys minds are accidentally scrambled; they have to learn to set aside their differences to save their family.',23);
insert into EPISODIO_ENTITY values (4120, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/484/1210292.jpg', 'Air Force Wong', 3,'Rick, along with the president and Dr. Wong, deal with a situation when an ex-lover of Rick takes over Virginia.',23);
insert into EPISODIO_ENTITY values (4121, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/484/1211100.jpg', 'Thats Amorte', 4,'The Smith family is enjoying delicious spaghetti for family dinner but Morty uncovers the truth about the dish leading to a horrifying discovery and the collapse of a society.',23);
insert into EPISODIO_ENTITY values (4122, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/486/1216454.jpg', 'Unmortricken', 5,'The search for Rick Prime takes Rick and Morty to the vast reaches of the multiverse where they have to team up with an old enemy to bring him down for good.',23);
insert into EPISODIO_ENTITY values (4123, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/487/1219807.jpg', 'Rickfending Your Mort', 6,'As the mind-bending animated adventures continue, Morty gets audited.',23);
insert into EPISODIO_ENTITY values (4124, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/489/1222952.jpg', 'Wet Kuat Amortican Summer', 7,'Rick gives Summer an Attribute Slider as payment for helping clean up his messes. When Morty wants it for himself, the siblings are thrown into an adventure where the term "sibling bond" is given a whole new meaning for them.',23);
insert into EPISODIO_ENTITY values (4125, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/477/1194843.jpg', 'Rise of the Numbericons: The Movie', 8,'Action! Adventure! Its a whole movie, broh!',23);
