insert into SERIE_ENTITY  values (24, 2018,'https://static.tvmaze.com/uploads/images/medium_portrait/479/1198441.jpg', 'Goblin Slayer', 'A young priestess has formed her first adventuring party, but almost immediately they find themselves in distress. Its the Goblin Slayer who comes to their rescue—a man whos dedicated his life to the extermination of all goblins, by any means necessary. And when rumors of his feats begin to circulate, theres no telling who might come calling next...','https://rare-gallery.com/uploads/posts/197107-goblin-slayer-1920x1080.png');
