insert into EPISODIO_ENTITY values (4128, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/171/428156.jpg', 'The Fate of Particular Adventurers', 1,'On the first day that the Priestess became an adventurer, she joins three other rookie adventurers on a quest to save some girls who were kidnapped by some goblins. Despite being one of the weakest monsters around, the rookie adventurers fall for some traps that were set for them in the goblin cave, which leads to dire results. A goblin was about to attack the Priestess when a mysterious armored figure appears before her. The armored figure then mercilessly starts slaughtering the goblins and tells the Priestess that his name is Goblin Slayer.',24);
insert into EPISODIO_ENTITY values (4129, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/171/429480.jpg', 'Goblin Slayer', 2,'The Goblin Slayer is a silver-ranked adventurer covered in armor from head to toe. The Goblin Slayer never accepted any quests from the Adventurers Guild other than quests to slay goblins so he was perceived as strange by the other guild members. Ever since she was saved by the Goblin Slayer the Priestess had been joining him on quests and slowly began to understand how he functions.',24);
insert into EPISODIO_ENTITY values (4130, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/203/509822.jpg', 'Unexpected Visitors', 3,'The High Elf Archer, Dwarf Shaman, and Lizardman Priest come to see Goblin Slayer. They tell him of a demon lord thats revived with the intent to destroy the world, and they ask for Goblin Slayers help. However, he tells them they have no interest until they mention goblins.',24);
insert into EPISODIO_ENTITY values (4131, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/203/509823.jpg', 'The Strong', 4,'Goblin Slayer and his companions enter some ancient ruins that had been taken over by the demon lords minions. Goblin Slayer works together with the High Elf Archer and the others to slay the army of goblins, but suddenly, an ogre appears. The tables turn on the battle as the ogre beats Goblin Slayer down.',24);
insert into EPISODIO_ENTITY values (4132, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/203/509824.jpg', 'Adventures and Daily Life', 5,'Goblin Slayer and the others return successful from their quest in the ruins. Goblin Slayer spends a few days sleeping at Cow Girls home to recover and then heads to the guild. There, he gives advice to a couple of adventurers on how to deal with some giant rats and also accepts a request from Guild Girl.',24);
insert into EPISODIO_ENTITY values (4133, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/203/509825.jpg', 'Goblin Slayer in the Water Town', 6,'Goblin Slayer and his party recieve a request to slay some goblins. The one who sent the request was the Sword Maiden, one of the heroes that defeated the Demon Lord. Goblin Slayer, Priestess, High Elf Archer, Dwarf Shaman, and Lizardman Priest head to Water Town. Its a peaceful, beautiful city, but apparently, there are some scary incidents happening. The party believes that there might be some goblins hiding in the sewers so they head down there as soon as possible.',24);
insert into EPISODIO_ENTITY values (4134, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/203/509826.jpg', 'Onward Unto Death', 7,'Goblin Slayer and his party go into the sewers of Water Town to investigate some brutal incidents they think were caused by goblins. When they go down to the sewers, they are immediately attacked by a horde of goblins. Because of the sheer number of goblins, the party has a hard time dealing with them all and then a goblin champion also appears before them.',24);
insert into EPISODIO_ENTITY values (4135, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/203/509827.jpg', 'Whispers and Prayers and Chants', 8,'Goblin Slayer was gravely injured after the battle with the goblin champion. The Priestess and Sword Maiden work together to heal Goblin Slayer with a special ritual. Meanwhile, High Elf Archer and the others investigate the sewers a bit further and encounter a mysterious creature. Due to the creatures abilities, the party heads back up to the surface to regroup with Goblin Slayer and Priestess before they go any further.',24);
insert into EPISODIO_ENTITY values (4136, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/203/509828.jpg', 'There and Back Again', 9,'The party encounters a giant mirror in the sewers. The mirror, the mysterious creature they encountered, the horde of goblins, and the goblin champion that appeared - Goblin Slayer and the others try to get to the bottom of whats going on. They once again encounter the horde of goblins as well as the goblin champion, which gravely injured Goblin Slayer previously. But Goblin Slayer had a plan to take care of them once and for all.',24);
insert into EPISODIO_ENTITY values (4137, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/203/509829.jpg', 'Dozing', 10,'Goblin Slayer and his party head back to town. The news that the Hero had defeated the Demon Lord is spreading, putting everyone in a celebratory mood. However, Goblin Slayer doesnt seem to care much about the news and continues on with his daily life. On the other hand, it seems that Goblin Slayer is changing ever so slightly through his interactions with his companions.',24);
insert into EPISODIO_ENTITY values (4138, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/203/509831.jpg', 'A Gathering of Adventurers', 11,'Goblin Slayer does his usual rounds around the farm and finds a bunch of goblin footprints, and realizes that theyre planning to attack the farm that night. Goblin Slayer tries to convince Cow Girl and her uncle to leave, but she refuses to leave, wanting to protect the one place that Goblin Slayer has to come home to. In order to protect the farm Goblin Slayer heads to the guild to make a request.',24);
insert into EPISODIO_ENTITY values (4139, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/203/509832.jpg', 'The Fate of an Adventurer', 12,'The battle against the Goblin Lord and his horde of goblins had begun, and High Elf Archer, Dwarf Shaman, Lizardman Priest, and the other members from the guild face them head-on. Meanwhile, Goblin Slayer goes to face the Goblin Lord alone.',24);
