insert into SERIE_ENTITY  values (25, 2003,'https://static.tvmaze.com/uploads/images/medium_portrait/20/51196.jpg', 'Fullmetal Alchemist', 'Edward Elric, a young, brilliant alchemist, has lost much in his twelve-year life: when he and his brother Alphonse try to resurrect their dead mother through the forbidden act of human transmutation, Edward loses his family as well as two of his limbs. With his supreme alchemy skills, Edward binds Alphonses soul to a large suit of armor.A year later, Edward, now promoted to the fullmetal alchemist of the state, embarks on a journey with his younger brother to obtain the Philosophers Stone. The fabled mythical object is rumored to be capable of amplifying an alchemists abilities by leaps and bounds, thus allowing them to override the fundamental law of alchemy: to gain something, an alchemist must sacrifice something of equal value. Edward hopes to draw into the militarys resources to find the fabled stone with his power and restore his and Alphonses bodies to normal. However, the Elric brothers soon discover that there is more to the legendary stone than meets the eye,','https://images7.alphacoders.com/459/459039.jpg');
