insert into EPISODIO_ENTITY values (4153, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/20/51196.jpg', 'To Challenge the Sun', 1,'Edward and Alphonse meet a so-called religious leader during their travels who can invoke miracles, once seeing his miracles in person, they set out to discover if he is using the fabled Philosophers Stone.',25);
insert into EPISODIO_ENTITY values (4154, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/20/51196.jpg', 'Body of the Sanctioned', 2,'Edward and Alphonse have to decide if they should reveal the truth behind Cornellos miracles and the possible devastating effects that revelation might have on the townspeople and their lives.',25);
insert into EPISODIO_ENTITY values (4155, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/20/51196.jpg', 'Mother', 3,'The story line flashes back to a younger Ed and Al and tells how their mother died and their determination to bring her back to life.',25);
insert into EPISODIO_ENTITY values (4156, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/20/51196.jpg', 'A Forgers Love', 4,'While on their way to seek out a man from their early childhood, Al and Ed arrive in a town haunted by a ghostly woman.',25);
