insert into PARTICIPANTE_ENTITY values (293, 'Kazuhiro Furuhashi; is a Japanese anime director and supervisor. He is recognized as one of the most important directors in anime, having directed the Rurouni Kenshin series, Zipang, You're Under Arrest!, GetBackers, Hunter × Hunter, Le Chevalier D'Eon, Real Drive and Mobile Suit Gundam Unicorn.', 'https://upload.wikimedia.org/wikipedia/commons/2/2f/Kazuhiro_Furuhashi_at_Anime_Expo_2013.jpg', 'Kazuhiro Furuhashi');
insert into SERIE_ENTITY_DIRECTORES values (26, 293);
insert into SERIE_ENTITY  values (27, 1997,'https://static.tvmaze.com/uploads/images/medium_portrait/459/1148947.jpg', 'Pokémon', 'The great adventures of 10 year old Ash Ketchum, a young Pokémon Trainer from Pallet Town, as well as his best friend and everlasting companion Pikachu. Together, they venture through many regions: the traditional region of Kanto, the culturally rich Johto, the temperate region of Hoenn, the mystical region of Sinnoh, the advanced landscapes of Unova, Kalos, with its many landmarks, the splendor of the tropics of Alola, and the expansive Galar. Along the way, they meet many new companions, many new friends and new rivals, while also competing in each regional league; as well as toppling evil organizations, and outsmarting the pesky and persistent Team Rocket. However, through all this, Ashs goal remains unchanged: to discover many new Pokémon, and to become regarded as the worlds greatest Pokémon Master.','https://images7.alphacoders.com/592/592678.jpg');
