insert into EPISODIO_ENTITY values (4299, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/24/60137.jpg', 'Pokémon - I Choose You!', 1,'Pokemon: Ash Ketchum is finally 10 years old, old enough to become a Pokemon Trainer. He wakes up late, and arrives to Professor Oaks lab late, and all the Pokemon are gone! Ash has no choice but to take a naughty Pikachu. Pikachu wont listen or go inside its PokeBall, so Ash must drag it along (literally). After many failed attempts at capturing some Pokemon, Ash throws a rock and it hits a Spearow. The Spearow gets angry and starts attacking them! Soon, the entire flock start chasing Ash and Pikachu! Ash, with no Pokemon that will listen to him, he must escape from the raging Spearow. Can they escape and will Ash ever earn Pikachus trust?',27);
insert into EPISODIO_ENTITY values (4300, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/24/60145.jpg', 'Pokémon Emergency!', 2,'Pokemon: Finally arriving in Viridian City, Ash is cornered by Officer Jenny who asks why he is carrying Pikachu instead of having it in a Pokeball. He explains that Pikachu doesnt like Pokeballs and shows her his Pokedex proving that he is one of the Pallet Town Trainers. Jenny takes Ash to the Pokemon Center where Nurse Joy begins treatment on the injured Pikachu. Before Pikachus treatment finishes, however, the Center is attacked by two members of Team Rocket.',27);
insert into EPISODIO_ENTITY values (4301, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/24/60151.jpg', 'Ash Catches a Pokémon', 3,'Pokemon: Ash, Pikachu and Misty have entered the Viridian Forest. Ash has spotted a Caterpie and thrown a Pokéball at it. Capturing it, Ash is overjoyed at his first catch. Misty, however, hates bugs and screams every time it comes near her. Meanwhile, Team Rocket is following them, ready for a fresh attempt at capturing Pikachu. Ash decides to capture another Pokémon, and manages to get a Pidgeotto. Can he, Misty, and his Pokémon, fend off Team Rocket again?',27);
insert into EPISODIO_ENTITY values (4302, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/24/60164.jpg', 'Challenge of the Samurai', 4,'Pokemon: Ash and Misty are now wandering through Viridian Forest. A Samurai challenges Ash to a battle, and it turns out to be Metapod vs. Metapod. After a short time, a swarm of Beedrill attacks, and Ashs Metapod is taken by them. Can Ash get his Pokemon back from them or will it be doomed to live its life without Ash?',27);
insert into EPISODIO_ENTITY values (4303, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/24/60172.jpg', 'Showdown in Pewter City', 5,'Pokemon: Ash and Misty have arrived in Pewter City. A rock-seller name Flint approaches them and attempts to sell them some rocks. At the pokemon center he learns of the pokemon league and decides to start collecting badges. He heads for the gym and is easily overpowered by Gym Leader Brock. Flint, who happens to be Brocks dad, helps Ash train Pikachu and Ash heads back for a rematch.',27);
insert into EPISODIO_ENTITY values (4304, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/24/60421.jpg', 'Clefairy and the Moon Stone', 6,'Pokemon: Ash, Misty, and Brock have just begun their journey together, and come across Mt. Moon. Outside the mountain they discover a scientist being attacked by some Zubat, he takes them inside where some strange activities are happening, which is delaying his search for the elusive Moon Stone, but could Team Rocket have something to do with it?',27);
insert into EPISODIO_ENTITY values (4305, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/24/60423.jpg', 'The Water Flowers of Cerulean City', 7,'Pokemon: In his search to collect Trainer Badges, Ash heads for Cerulean City, intending to confront the Cerulean Gym Leader. For some reason, Misty expresses a desire to avoid Cerulean City and disappears somewhere along the way. Without concern for Misty, Ash and Pikachu continue toward the Cerulean City Gym. When they arrive, the exterior of the Gym gives the strange appearance of an aquarium. Upon entering the building, Ash and Pikachu are entranced by a synchronized swimming show being performed by three beautiful sisters. Could this truly be the Cerulean Gym? And what could be the role of the three beautiful swimming sisters? More importantly, will Ash be able to defeat the strangely absent Gym Leader to earn his next badge?',27);
insert into EPISODIO_ENTITY values (4306, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/24/60429.jpg', 'The Path to the Pokémon League', 8,'Pokemon: After receiving his second badge, Ash sets off triumphantly for Vermilion City. Along the way, they hear of a trainer named A.J. - a fierce pokemon trainer who has never lost a match. Full of self-confidence from his own record of ten victories in a row, Ash heads directly for the gym to find his new opponent. When they arrive, a huge bulletin is in front of the gym with a neon sign declaring "98 Consecutive Victories" appeal to Ashs over-confidence. A.J. is on the brink of achieving his goal of 100 straight victories, after which he will embark on a journey to gather badges. Will victory fall on the side of Ash and his 10 straight victories or with A.J. and his string of 98? In the process, will Ash learn some important lessons about the bonds between pokemon and trainer?',27);
insert into EPISODIO_ENTITY values (4307, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/24/60438.jpg', 'The School of Hard Knocks', 9,'Pokemon: Our three heroes have lost their way in the depths of a dense wood, shrouded in thick, white mist. Momentarily giving up, they decide to break for a brief rest. As Ash wanders deeper into the wood, searching for firewood, he happens across a young boy being bullied by five classmates gathered around him. Eavesdropping on their conversation, Ash learns that the boys are attending a preparatory school for Pokemon trainers. Graduates from the school are automatically qualified to participate in the Pokemon League without undergoing any actual test of skill. Ash, Misty, and Brock head to the school and dont agree with some of their ideas of training, something their "leader" doesnt take well.',27);
insert into EPISODIO_ENTITY values (4308, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/24/60442.jpg', 'Bulbasaur and the Hidden Village', 10,'Pokemon: Ash and friends are still on their way to Vermilion City and still lost. They stop by a pond for a break when they see an Oddish taking a drink. Ash wants to catch it but Misty already has Starmie out. She weakens it and throws a PokeBall but a Bulbasaur pops out of the bushes and deflects the ball. Ash sends out Butterfree to catch the Bulbasaur, but Bulbasaur deflects its sleep powder and escapes. The continue on their journey and keep getting caught in traps, until Bulbasaurs owner, Melanie, finds them and saves them and brings them back to her cabin. It turns out that she helps injured, sick, and abandoned pokemon, and they decide to help. Meanwhile, Team Rocket decides to steal all the pokemon, while Brock could make a startling decision.',27);
insert into EPISODIO_ENTITY values (4309, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/24/60446.jpg', 'Charmander - The Stray Pokémon', 11,'Pokemon: On the way to Vermilion City, Ash, Misty, and Brock come across a Charmander sitting on a rock. Ash tries to catch it, but it turns out it has a trainer and cant be captured, so they head to the Pokemon Center. At the center, a hotshot trainer named Damien is bragging about how he left it, promising to come back for it. After hearing this, they head back out to get the poor pokemon as the rainstorm threatens its very life.',27);
insert into EPISODIO_ENTITY values (4310, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/24/61028.jpg', 'Here Comes the Squirtle Squad', 12,'Pokemon: On the way to Vermilion City, Ash, Misty, and Brock become the "victims" of the Squirtle Squads pranks. The end up falling down a hole, and are even eventually captured by them. It turns out that they are working together with Team Rocket. When Pikachu is severely injured, the Squirtle let him out to go get medicine from town, but will the Squirtle keep there promise and leave Pikachu, Misty, and Brock alone while he is gone, and what is Team Rocket really up too?',27);
insert into EPISODIO_ENTITY values (4311, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/24/61067.jpg', 'Mystery at the Lighthouse', 13,'Pokemon: On the way to Vermilion City, Misty and Brock criticize Ash as he has not truly won his two badges and he isnt take the time to try and capture pokemon. Angered at this, he rushes through the forest and winds up on a beach where he finds a Krabby. He catches the Krabby and its pokeball disappears. Worried about it, Misty explains that trainers can only have six pokemon with them at one time. Still wanting to check on it, they head to a nearby lighthouse where the find the pokemon expert Bill trapped in a Kabuto costume. After freeing him, he tells them a little about the history of pokemon, as well as the mysterious pokemon he thinks will show up to his lighthouse one day. All of a sudden they hear a loud noise, and they head outside. A giant shadowed pokemon starts approaching the lighthouse. However, Team Rocket threatens Bills perfect chance.',27);
insert into EPISODIO_ENTITY values (4312, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/24/61610.jpg', 'Electric Shock Showdown', 14,'Pokemon: Our heroes finally reach Vermilion City. They make their way to the Pokemon Center to refill their empty stomachs, but once there, they witness dozens of injured Pokemon being treated. Pikachu and Ash are alarmed to learn that all of these Pokemon were injured in battles with the Vermilion Gym Leader, Lt. Surge. Nonetheless, eager to earn a badge, Ash challenges Lt. Surge. Pikachu reluctantly enters the battle only to discover its opponent to be a Raichu, its evolved form. After a short battle Pikachu is overwhelmingly defeated. At the pokemon center Ash wonders what he can do to win. Nurse Joy presents him with a Thunder Stone which would evolve Pikachu into Raichu and make it more powerful. Now he must choose whether or not to evolve Pikachu just to beat one trainer.',27);
insert into EPISODIO_ENTITY values (4313, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/24/61612.jpg', 'Battle Aboard the St. Anne', 15,'Pokemon: Ash, Misty, and Brock head to Vermilion Port the SS Anne, an international cruise liner, is docked. Receiving free tickets from a mysterious duo (who is actually Jessie and James) for a Pokemon Trainer party aboard the SS Anne, they board the ship filled with anticipation of good food and lots of Pokemon excitement. Aboard the ship bustling with Pokemon Trainers, Ash meets a distinguished gentleman who suggests they make a Pokemon trade. Ash exchanges his Butterfree for the gentlemans Raticate. Just then, the SS Anne is taken over by Team Rocket who had arranged the party as a ploy to steal Pokemon.',27);
insert into EPISODIO_ENTITY values (4314, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/24/61624.jpg', 'Pokémon Shipwreck', 16,'Pokemon: With the St. Anne fully sunk, the police officers mourn the apparent lose of Ash, Misty, Brock, Jessie, and James. However, deep inside the ship the five of them finally awaken and quickly realize the dire situation they are in. They agree to temporarily put there differences aside so that they can work together and hopefully make it out of the ship alive. They finally manage to get to the week point of the ships hull and break through, but will they be able to make it to the surface in time, and eventually manage to find land?',27);
insert into EPISODIO_ENTITY values (4315, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/24/61632.jpg', 'Island of the Giant Pokémon', 17,'Pokemon: Following Gyarados powerful Dragon Rage, Ash and the others wind up on an abandoned island with nothing insight. Every quickly notices that Pikachu, Bulbasaur, Charmander, Squirtle, Ekans, Koffing, and Meowth are all missing. All seven end up together and band together to try and survive the dangerous island and its giant inhabitants. Meanwhile the humans try to find their missing pokemon, but dont fare well against all the giant pokemon either.',27);
insert into EPISODIO_ENTITY values (4316, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/24/61636.jpg', 'Beauty and the Beach', 18,'Pokemon: Ash and the others arrive in beautiful Porta Vista, a beach town that has everything you could think of. They decide to rent a boat and they end up colliding with Team Rockets submarine, destroying a nearby dock. They end up working in the owners restaurant to pay off the debt, while Team Rocket wind up working in the neighboring restaurant. The two restaurants are rivals and Brutellas is threatening Moes business. Ash and the others try to help Moe, but Team Rocket try to ruin Moes business and jack up his debt to Brutella. When Professor Oak and Delia show up, they reveal there is going to be a beauty contest which has a large amount of money as the prize. Misty and Delia decide to enter to try and win the money for Moe',27);
insert into EPISODIO_ENTITY values (4317, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/24/62472.jpg', 'Tentacool & Tentacruel', 19,'Pokemon: Still in Porta Vista, Ash, Misty, and Brock must wait for another boat to take them to their next destination. After witnessing a boat explosion, they use their pokemon to save the crew. They are thanked by the boats owner, Nastina, who then asks them to exterminate all of the Tentacool who are harming the construction of her new underwater hotel. Misty refuses saying Nastina is doing all the harm and brags Ash and Brock out of there. Team Rocket then takes up Nastinas offer and once again they ultimately fail, and in the process cause a Tentacruel to grow to a enormous size. The water pokemon then invade the city with the goal of destroying all the humans, and it is up to Ash, Misty, Brock, and their new Horsea friend to save the residents.',27);
insert into EPISODIO_ENTITY values (4318, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/62500.jpg', 'The Ghost of Maidens Peak', 20,'Pokemon: Ash, Misty, and Brock arrive in the port city of Maidens Peak. They join in the summer festival where they learn the Legend of the Maiden. Brock decides to visit Maidens Rock to look at the Maiden while Team Rocket decides to camp outside the shrine so they can steal the paintings inside. That night Brock doesnt return to the pokemon center and James goes missing. In the morning everyone heads to the temple to find them.',27);
insert into EPISODIO_ENTITY values (4319, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/62502.jpg', 'Bye Bye Butterfree', 21,'As the group continue on their way, they notice a group of Butterfree out over the ocean. Brock informs Ash that it is the mating season for all of the Butterfree. Ash lets his Butterfree out to try and find a mate, but can he actually come to let his Butterfree go? Meanwhile, Team Rocket comes up with a plan to get all the Butterfree.',27);
insert into EPISODIO_ENTITY values (4320, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/62503.jpg', 'Abra and the Psychic Showdown', 22,'Continuing on their way to Saffron City, a mysterious girl appears in front of the group. They ask her for directions to Saffron City, but she runs away. Ash gives chase and runs straight off a cliff. After using Bulbasaur to rescue him, they discover that the little girl has lead them to Saffron City. After entering the city, they are greeted by two people as the millionth visitors to the city. The grand prize turns out to a trap by Team Rocket who have left them in a room with no exit, and are ready to leave with Pikachu. Before they can leave the little girl returns and saves them, and even brings them to the Saffron Gym. Ash heads inside, where he is ready to fight Sabrina for his fourth badge.',27);
insert into EPISODIO_ENTITY values (4321, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/62504.jpg', 'The Tower of Terror', 23,'After suffering a humiliating defeat by Sabrina (and playing with her evil doll), Ash and the others head to Lavender Town so Ash can capture a ghost pokemon to use against Sabrina. Arriving at the Pokemon Tower, Ash and Pikachu head inside capture a ghost pokemon. Meanwhile, Team Rocket is also inside the tower planning something, but soon become victims of the ghost pokemon as well. The tower is haunted by the ghost trio of Gastly, Haunter, and Gengar. The three of them begin playing tricks on everyone, and one of them might have dire consequences for Ash and Pikachu.',27);
insert into EPISODIO_ENTITY values (4322, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/62505.jpg', 'Haunter Versus Kadabra', 24,'After befriending Haunter in Lavender Town, Ash, Misty, and Brock return to Saffron City for his rematch with Sabrina. When they head to the gym, Haunter disappears and Ash tries to run away. Sabrina locks down the gym and turns Misty and Brock into dolls. Then the man that had helped them before returns to save Ash and his pokemon by teleporting them outside. He tell Ash about Sabrinas life, and how her personality is split in two. After Sabrina first developed her psychic powers, her childish side disappeared and turned into the doll she now holds. Now Ash must somehow defeat Sabrina, with or without Haunter. Meanwhile, the doll versions of Brock and Misty have a run in with Sabrinas mom!',27);
insert into EPISODIO_ENTITY values (4323, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/62514.jpg', 'Primeape Goes Bananas', 25,'Ash calls Professor Oak to tell him of his victory at the Saffron Gym. Much to his dismay, Professor Oak tells him that the other trainers from Pallet all have five badges and are well ahead of him, including how many pokemon they have. This angers Ash, and they decide to eat lunch before heading to Celadon City. While eating, a wild Mankey comes neat them. Brock gives it a rice ball to eat, and Ash decides to capture it. Ironically, Ash ends up capturing the rice ball instead of Mankey. This angers Mankey, and he begins to chase them. Soon they encounter Team Rocket who, after kicking it, angers it, causing it to evolve into Primeape. Primeape then disposes of Team Rocket and attacks Ash, chasing him. Now Ash needs to somehow stop Primeape from catching him.',27);
insert into EPISODIO_ENTITY values (4324, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/62520.jpg', 'Pokémon Scent-sation!', 26,'Ash and the others finally arrive in Celadon City. Misty then drags the boys to a perfume shop. Misty wants to smell all the perfume, while Brock is glad to meet all the pretty girls. Ash insults perfume and the owner throws him out of the shop. After Misty and Brock leave the store, they head over the Celadon Gym. It turns out that the Celadon Gym Leader, Erika, is also the owner of the perfume shop, and refuses to battle Ash and has him kicked out of the gym. Misty and Brock do nothing and decide to attend Erikas class. Meanwhile, Team Rocket decides to help Ash get into the gym, and disguise him as a girl to get in. After acting like "her" parents, they run off and go after the secret perfume Erika has in the gym. Ash then gets into Erikas class, and takes off his disguise to reveal himself and demands Erika battle him.',27);
insert into EPISODIO_ENTITY values (4325, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/62521.jpg', 'Hypnos Naptime', 27,'Ash and the others arrive in a town where all of the children have been disappearing. The head to the pokemon center where all of a sudden their pokemon start acting sick. They team up with Officer Jenny and track the source of the strange energy to a rooftop mansion, where people are using a Drowzee as a sleep aid. When Misty tries it, she begins acting like a Seel and runs off into the nearby rooftop park. They then follow her to a giant pond where all the missing children are. They then decide to use Hypno to reduce the childrens condition, but Team Rocket decide to get the psychic pokemon for themselves.',27);
insert into EPISODIO_ENTITY values (4326, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/62524.jpg', 'Pokémon Fashion Flash', 28,'Ash and the others arrive at the world famous Scissor Street, where you can find almost anything. They see a salon where the owners, who are really Team Rocket in disguise, say that pokemon beauty is all that matters, which excites Misty. They then find what they came to look for, the salon of the world famous pokemon breeder Susie. Susie then begins a class to show off some of her techniques. After Ash and Brock insult Team Rockets salon, Misty decides to bring Psyduck there for a makeover. However this turns out to be a lure by Team Rocket, who want to use Misty as "bait" for Ash.',27);
insert into EPISODIO_ENTITY values (4327, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/62783.jpg', 'The Punchy Pokémon', 29,'On the way to the next town, Ash sees a Hitmonchan nearby. Ash starts battling it with Pikachu, but then the trainer, Anthony, comes and Hitmonchan easily beats Pikachu. The two of them leave and head to a gym to train. Anthonys daughter shows up and begs for them to enter the P-1 Grand Prix so that they can beat her father. She tells them that he is more concerned with training then his family and his daughter really misses him. Ash and Brock agree to enter with Primeape and Geodude. Meanwhile, Team Rocket decide to enter the tournament for the prize, and steal a trainers Hitmonlee to enter.',27);
insert into EPISODIO_ENTITY values (4328, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/62792.jpg', 'Sparks Fly for Magnemite', 30,'Ash, Misty, and Brock arrive in Gringy City, a now polluted city built along the shore with a skyline full of factories. When Pikachu falls sick, they head to the pokemon center to heal it. Nurse Joy says it is just a cold, but Ash is still worried. Soon the power goes out, and all the sick pokemon are now in extreme danger. Ash and the others decide to head to the Power Plant to find out what is wrong, and it turns out that a bunch of Grimer are clogging up the water system, and they have overrun the Power Plant. Not only that, Pikachu is still extremely sick, and all the plants Magnemite are attracted to its energy.',27);
insert into EPISODIO_ENTITY values (4329, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/62802.jpg', 'Dig Those Diglett!', 31,'On their way to Fuchsia City, Ash and the others notice a big explosion up ahead. They head to the site where a giant dam is being built. The explosion was caused by a bunch of Diglett, who are trying to prevent the construction. The project manager is more then willing to give a reward to any trainer who can get rid of the Diglett. Gary even shows up and he, along with Ash and many other trainers try to send out their pokemon. When they try to release their pokemon, none of them will come out, so all the trainers leave. Later that night Ash, Misty, and Brock find the home of the Diglett and Dugtrio, and find out that if the dam is built, there home will be washed away, so they decide to help prevent the construction. Meanwhile, Team Rocket are depressed over their losses, and complain that they need stronger pokemon, and Ekans and Koffing just might "grant" their wish.',27);
insert into EPISODIO_ENTITY values (4330, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/62814.jpg', 'The Ninja Poké-Showdown', 32,'On the way to the Fuchsia City, Ash and the others notice a giant mansion and decide to stop and get directions. When they enter the mansion, a Venonat begins to mislead them around the various traps in the mansion, including hidden Voltorbs, collapsible walls, and invisible walls. After falling through one to many traps, the wind up in a room with ninja Aya, who challenges Ash to a battle. Ash quickly defeats her, and her older brother comes out. It turns out that they did wind up at the Fuchsia Gym after all and Ayas older brother is Koga, the Gym Leader. Now Ash finally has his chance to win his sixth badge. Meanwhile, Team Rocket plans on attacking the mansion and stealing all of the poison pokemon inside.',27);
insert into EPISODIO_ENTITY values (4331, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/62820.jpg', 'The Flame Pokémon-athon!', 33,'After winning his sixth badge in Fuchsia City, Ash and the others head to the world famous Safari Zone. When Ash tries to catch a pokemon, a Growlithe attacks him. Then a girl named Lara comes by and tells them that this is actually her familys pokemon ranch. After apologizing, Ash, Misty, and Brock follow her to her home where they learn of a festival going on in town. They also learn about the race the following day, which Lara will enter with her Ponyta. It also turns out that her familys rival will be entering the race and she needs to beat him. That night, he hires Team Rocket to make sure Lara does not compete, and they wind up breaking her arm. She then picks Ash as her replacement for the race, who must win it or else.',27);
insert into EPISODIO_ENTITY values (4332, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/62828.jpg', 'The Kangaskhan Kid', 34,'Ash and the others arrive in the real Safari Zone, and try to catch some of the many pokemon that live there. However, Officer Jenny shows up and stops them, before taking them to her tent. It turns out that in this part of the Safari Zone, you cannot catch any of the pokemon. They apologize to Jenny, and in reparation, as to help her when poachers enter the reserve. The poachers turn out to be Team Rocket, who are rounding up all the Kangaskhan. Ash and others dont even get the chance to help, due to a little boy freeing all of the pokemon, who send Team Rocket flying. After the boy and Kangaskhan leave, two people come in a helicopter and say they are looking for their lost son Tommy. When they show the picture to Jenny, it turns out to be the same boy who lives with the Kangaskhan! Meanwhile, Team Rocket come up with another plan to get the Kangaskhan.',27);
insert into EPISODIO_ENTITY values (4333, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/62997.jpg', 'The Legend of Dratini', 35,'Ash and friends arrive at the Safari Zone, where they are ready to participate in the Safari Game and captured some new Pokemon. However, the Warden is extremely cranky and is not beyond pointing a gun to them. They talk with Professor Oak and tells them about the Warden and the rare Pokemon Dratini. They then take their Safari Balls and head out into the field. However Team Rocket is also at the Safari Zone and they have captured the warden and attempt to force him to tell them where the Legendary Dratini is.',27);
insert into EPISODIO_ENTITY values (4334, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/63001.jpg', 'The Bridge Bike Gang', 36,'After finally making it through the Safari Zone, Ash and the others come across a long bridge they will be a shortcut to the next town. However, they need bikes to get across. They head to a pokemon center, where Nurse Joy allows them to borrow some bikes, if they take some medicine to the pokemon center across the bridge. After getting about halfway across the bridge, they run into a local gang that claims the bridge as their territory. Ash begins a battle with them, but when Officer Jenny shows up, they take off. It turns out that Jessie and James used to be part of the gang, and they decide to help them stop Ash and friends from crossing the bridge.',27);
insert into EPISODIO_ENTITY values (4335, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/63003.jpg', 'Dittos Mysterious Mansion', 37,'Ash and the other seek shelter from the rain inside an abandoned theater house. However, it turns out that the place is not abandoned, as they meet a young girl named Duplica that likes to mimic people. Duplica loves to put on acts wit her Ditto, but she has one small problem. When her Ditto transforms, it cant change its face. Ash, Misty, and Brock decide to do anything they can to help her, though their efforts come up short. Meanwhile, Team Rocket plan to steal Ditto so that they can have it transform into Dratini for Giovanni.',27);
insert into EPISODIO_ENTITY values (4336, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/63004.jpg', 'Electric Porygon Soldier', 38,'Ash and friends find at the local Pokemon Center that there is something wrong the Pokeball transmitting devise. To find out whats wrong, everyone must go inside the machine.',27);
insert into EPISODIO_ENTITY values (4337, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/63005.jpg', 'Pikachus Goodbye', 39,'Ash and the group stop by a river to have a quick lunch. Pikachu hears something and notices another Pikachu nearby. The other Pikachu is younger, and accidentally falls in the river. Pikachu jumps in to save it, and the two are quickly overpowered by the river. Ash tries to help, but cannot reach the two in time. Just before the two fall off a waterfall, a whole group of Pikachu arrives and pulls the two from the river. Ashs Pikachu is quickly accepted in this group. As Ash witnesses all the fun Pikachu is having, he begins to think that maybe this I where Pikachu really belongs. Meanwhile, Team Rocket decide to steal all the Pikachu instead of just Ashs in hopes they will get on Giovannis good side.',27);
insert into EPISODIO_ENTITY values (4338, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/63012.jpg', 'The Battling Eevee Brothers', 40,'While traveling through the woods, the group encounters an Eevee that was apparently abandoned by a tree. Noticing the collar, they take it to the address in nearby Stone Town. It turns out that the owner is a little boy named Mikey, who left Eevee in the woods because his brothers are pressuring him into evolving Eevee. Stone Town is at the foot of a mountain where evolution stones are plentiful, and Mikeys brothers are hosting a party where people are encouraged to use stones to evolve their pokemon. The brother even try to get Ash and Brock to evolve Pikachu and Vulpix. The party is also a event to decide weather Mikey will evolve Eevee into Vaporeon, Jolteon, or Flareon. however, Mikey does not want to evolve Eevee and Misty encourages him to tell his brothers. However, Team Rocket interrupts the party and steal all the food, evolution stones, and pokemon! Now it is up to Ash and the others to get all of them back.',27);
insert into EPISODIO_ENTITY values (4339, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/63639.jpg', 'Wake Up Snorlax!', 41,'Ash and friends continue on their journey, and grow tired and hungry. They decide to stop at a town up ahead, but the town has barley any food left as the river has dried up, causing them to have no water to grow any food. Driven by the promise of a meal, the three friends head up the river to find the source. When they find the source of the river, they find out that the river flow is being blocked by a sleeping Snorlax! They convince the owner to play his pokeflute to wake up Snorlax, but the river still does not flow, as there is a mess of vines blocking the passage. They try to cut them away, but there are way too many, so they decide to wake up Snorlax again. However, this is easier said then done, especially when Team Rocket come to steal Snorlax.',27);
insert into EPISODIO_ENTITY values (4340, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/63927.jpg', 'Showdown at Dark City', 42,'The group arrives in Dark City, a seemingly dull town where they are attacked just because they are pokemon trainers. A restaurant owner tells them that the reason why people in the town hate pokemon trainers is because in Dark City there are two unofficial gyms that are trying to best each other so that they can be the official gym of the city. There battles are slowly destroying the town, so Ash, Misty, and Brock decide to help the townspeople stop the pointless fighting.',27);
insert into EPISODIO_ENTITY values (4341, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/63941.jpg', 'The March of the Exeggutor Squad', 43,'On the way to the next town, Ash, Misty, and Brock arrive at a carnival. Ash and Brock head off to look around while Misty and Pikachu attend a magic show. However, the magician is not good and his act fails horribly. Misty decides to help him, but the act still does not fair well. The magician then gets an idea to use his Exeggcute to hypnotize people into liking his act, he even tries it out on Misty! However, his plan backfires and he ends up hypnotizing a bunch of Exeggutor who begin to go on a rampage that is heading straight for the carnival.',27);
insert into EPISODIO_ENTITY values (4342, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/63945.jpg', 'The Problem with Paras', 44,'On the way to the next gym, Ash and friends are out of medical supplies and stop to get some. However, the town has no pokemon center or mart, so they head to a lady who specializes in special medicines. When they arrive there they meet her and her granddaughter Cassandra. Cassandra tells them that she wants to help her Grandma, but in order to do that she needs her Paras to evolve into Parasect. Ash decides to help her, but his Charmeleon goes a little too far and burns poor Paras. Meanwhile, Meowth has an immediate crush on Cassandra and decides to help her out.',27);
insert into EPISODIO_ENTITY values (4343, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/63950.jpg', 'The Song of Jigglypuff', 45,'Ash and friends arrive in Neon Town, a flashy town where the people are very cranky ad get little to no sleep. They decide to leave the town. In the forest they come across a wild Jigglypuff. Misty decides to capture it, but the pokemon is not feeling good, so she decides not to. They help the Jigglypuff to heal its throat, and then she sings to them, forcing them to fall asleep. After they wake up, they decide to have Jigglypuff sing to Neon Town, but Team Rocket may have other plans for the little pink pokemon, and a new motto to boot.',27);
insert into EPISODIO_ENTITY values (4344, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/63954.jpg', 'Attack of the Prehistoric Pokémon', 46,'Continuing the journey to the next town, Ash and the others notice a bunch of people with digging tolls heading in the same direction. Gary arrives and tells them about Grandpa Canyon, and how ancient pokemon fossils are said to rest there. Team Rocket is also at the canyon, and they plan to use explosives to reveal all the fossils, which will also trap many people down below. After Meowth lights the fuse Ash and Squirtle try to put it out, but they do not make it in time. The explosion causes Ash, Misty, Brock, and Team Rocket to all fall into an underground cave. The cave is home to the ancient pokemon Kabuto, Kabutops, Omanyte, and Omastar. The four quickly attack them, but the real threat is on its way. Soon an Aerodactyl appears, and decides to take Ash for a ride.',27);
insert into EPISODIO_ENTITY values (4345, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/63958.jpg', 'A Chansey Operation', 47,'On the way to the next town, Ash, Misty, and Brock stop in a park to have a lunch. Pikachu is in a nearby tree looking for apples to eat. The little pokemon then decides to swallow an apple whole, which results in it passing out. With the nearest pokemon center being far away, they decide to take Pikachu to a human hospital, where "charming" Doctor Proctor reluctantly removes the apple. Then the phone rings. Nurse Joy warns them about a truck hauling pokemon that overturned, injuring dozens of pokemon. Her center can not care for all of them, so she is sending some over to his hospital. Ash, Misty, and Brock agree to help. When the pokemon arrive, it is revealed that Team Rocket was hauling them, and they also agree to help. However, once the doctor is accidentally knocked out from some medicine and the pokemon are resting, Team Rocket decides to take them all back for themselves.',27);
insert into EPISODIO_ENTITY values (4346, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/63960.jpg', 'Holy Matrimony!', 48,'While walking down a long road, Ash and friends notices a sign with a picture of James as a young kid. A limo then pulls up, and a butler reveals that James parents have died recently and he wants to find James so that James can receive his inheritance. Team Rocket is nearby, and Jessie and Meowth encourage James to go and get his inheritance. He reluctantly returns, where every finds out that his parents are actually alive! It turns out to be a plan to lure James home so that he can marry his fiance Jessibelle, a girl who looks similar to Jessie. James refuses, and Jessibelle takes matters into her hands by forcing James to marry her. However, with some help from his pet Growlithe, he manages to escape. He then decides to return to Team Rocket, knowing it to the best place for him.',27);
insert into EPISODIO_ENTITY values (4347, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/63964.jpg', 'So Near, Yet So Farfetchd', 49,'Ash and friends stop in a forest to have a snack. Misty notices a Farfetchd, and tries to catch it. The pokemon runs into the woods and Misty follows. Misty runs into its trainer, causing their bags to fall on the ground, and he gives her bag back to her. After departing, Misty realizes that he tricked her, and stole her bag with all of her supplies and pokemon. However, Psyduck escapes and leads them back to the trainer, who tries to get away. However, Team Rocket show up, and after realizing they have been tricked, try to get back at him. After sending Team Rocket away, Ash and Misty decide to battle the trainer and get all of the pokemon back.',27);
insert into EPISODIO_ENTITY values (4348, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/63968.jpg', 'Who Gets to Keep Togepi?', 50,'Continuing onto the next gym, Ash and friends stop by a pokemon center where Nurse Joy gives Ash a message from Professor Oak. Ash calls him, and the Professor offers to give Ashs pokedex an upgrade, which he accepts. After they leave the center, they encounter Team Rocket, who disguise themselves as eggs thieves. They mix up all their fake eggs with the egg Ash found, and they grab it an run off. However, they leave a trail of eggs behind them and Ash and friends follow them to a cabin where an all out battle ensues for the egg. During the battle, the egg hatches, revealing the pokemon Togepi. However, no one can decide who gets to keep it. To solve the problem, Ash, Misty, Brock, and Meowth decide to hold a tournament to decide Togepis owner.',27);
insert into EPISODIO_ENTITY values (4349, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/64135.jpg', 'Bulbasaurs Mysterious Garden', 51,'During a battle, the bulb on Bulbasaurs back begins to glow. They rush it to the Pokemon Center where Nurse joy tells them that Bulbasaur is getting ready to evolve. Soon after Bulbasaur leaves its bed and is taken by other Bulbasaur to the mysterious garden where the Bulbasaur evolve into Ivysaur. They follow it to the garden where a Venusaur appears to start the ceremony. The rest of the Bulbasaur evolve, but Ashs refuses to. Venusaur and Ivysaur get mad and try to punish it, but Ash steps in the way. Then Team Rocket shows up, and they want Ivysaur and Venusaur.',27);
insert into EPISODIO_ENTITY values (4350, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/64171.jpg', 'Princess vs. Princess', 52,'It is Princess Day, the day when there are incredible discounts in the malls, and all sorts of events and activities, but only for girls. Just after having gone shopping and buying a present to get on the boss good side, Jessie encounters a Lickitung. The Lickitung eats everything Jessie had bought, and so she captures it. When Jessie and Misty hear about a competition where girls can enter to win a set of Pokemon dolls they both decide to compete for the ultimate prize.',27);
insert into EPISODIO_ENTITY values (4351, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/64173.jpg', 'The Purr-Fect Hero', 53,'On the way to the next gym, Ash and friends arrive a school on what just happens to be Childrens day. However, the people who were suppose to visit the school are not able to make it. Ash, Misty, and Brock decide to let them play with their pokemon to make up for it. Then, Team Rocket shows up as magicians and try to steal Pikachu. However, they end up capturing one of the students, Timmy, instead. Timmy, who was once saved by a Meowth from a Beedrill, becomes obsessed with Meowth, thinking it is the same one. Team Rocket decide to take advantage of this and send Timmy and Meowth back to the school, where Meowth can not talk and blow his cover while he tries to capture Pikachu.',27);
insert into EPISODIO_ENTITY values (4352, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/64175.jpg', 'The Case of the K-9 Caper!', 54,'While traveling through the forest, the group see who they think is a thief. Ash sends Pikachu after it, but Pikachu is scared because he holds a gun. When a Growlithe comes by to knock the gun out of its hand, Pikachu goes. They are all stopped because he isnt a thief, but a police officer training the K-9 police squad. Ash wants to have them train Pikachu, but doesnt realize he must go, too. Officer Jenny then drills Ash morning til night and he becomes exhausted. Team Rocket then busts into the school and uses a special gas to confuse the pokemon and alter Ash, Misty, Brock, and Officer Jennys voices. They then use megaphones that project Ash, Misty, Brock, and Officer Jennys real voices. Now the Pokemon cant tell where their trainers really are, and Team Rocket plans to use this to steal Pikachu.',27);
insert into EPISODIO_ENTITY values (4353, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/64177.jpg', 'Pokémon Paparazzi', 55,'As Ash and the group continue on their way, they notice a boy trying to take a picture of Pikachu. The boy, whose name is Todd, invites them to his place for pancakes and he tries to get a picture of Pikachu. However, Team Rocket has hired him because he says he can "capture" any pokemon. However, he means capture them on film. Later on Team Rocket finds out about this and they decide to get revenge and capture Pikachu themselves, and get rid of Todd',27);
insert into EPISODIO_ENTITY values (4354, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/64178.jpg', 'The Ultimate Test', 56,'While everyone is eating lunch, Misty mentions that it has been a while since Ash received a gym badge. Todd then tells Ash about a test that he can take that will allow him to enter the Pokemon League if he passes it. Everyone heads over to the building and Ash enters, and Jessie and James (in disguises) also enter. However, the test turns out to be harder then they thought, and Jessie quits during the first part. When it comes time to battle with random pokemon that obey whoever uses them, Team Rocket come up with a plan to capture all of the pokemon and Pikachu!',27);
insert into EPISODIO_ENTITY values (4355, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/64179.jpg', 'The Breeding Center Secret', 57,'Stopping in a town on the way to Cinnabar Island, Ash and friends see a commercial for a Breeding Center and decide to check it out. Misty decides to leave Psyduck there. Afterwords, they find a restaurant where the chef will give a free buffet meal to anyone who can show him his favorite pokemon, which just happens to be Psyduck. Everyone the races back to the Breeding Center to get it. However, it is closed. After sneaking in the back, they discover that the people who run it are Butch and Cassidy, another duo from Team Rocket and they plan to send all of the pokemon to Giovanni. After trying to escape, everyone (including Jessie and James who were trying to steal some of the pokemon) are sent to jail except Misty, Pikachu, and Togepi. Now those three must find a way to prove them innocent and save Psyduck and all the other pokemon.',27);
insert into EPISODIO_ENTITY values (4356, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/64456.jpg', 'Riddle Me This', 58,'Ash and friends finally make it to Cinnabar Island, but are saddened to see that the gym has been closed because the island is now a tourist destination. They try to find a place to stay, but every place is packed. They finally find a room at a hotel run by a man who loves riddles. While in the hot spring, they end up discovering an entrance into the volcano, which leads them to a battlefield. The old man appears and reveals himself to be Blaine, the leader of the Cinnabar Gym. Ash challenges him and he accepts, but this match will be way more then Ash expected.',27);
insert into EPISODIO_ENTITY values (4357, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/64460.jpg', 'Vocanic Panic', 59,'Pikachu was able to dodge Magmars attack, but just by an inch and is now hanging from the edge of the battlefield. Before anything worse happens, Ash forfeits. He takes Pikachu to the hot spring to heal it, and is trying to come up with ways to beat Blaine. Meanwhile, Team Rocket enters the battlefield to capture Magmar, but when Magmar is unaffected by their freeze guns, they proceed to freeze the entire area. This causes the volcano to become really unstable. Now Ash, Misty, Brock, and Blaine must stop the volcano from erupting, and Ash must still figure out a way to battle and defeat Blaine.',27);
insert into EPISODIO_ENTITY values (4358, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/64467.jpg', 'Beach Blank-Out Blastoise', 60,'Ash and friends are running to catch the last ferry off of Cinnibar Island, and just as they are approaching the ferry, they collide with a Wartortle. Wartortle talks with Ashs Squirtle and the two race off the island. Everyone follows them and they wind up on an island that is a haven for Squirtle and Wartortle and they are protected and led by a Blastoise. However, Blastoise has fallen asleep and will not wake up, and Ash and friends decide to help figure out what is wrong. Meanwhile, Team Rocket is planning on steal the Blastoise.',27);
insert into EPISODIO_ENTITY values (4359, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/64685.jpg', 'The Misty Mermaid', 61,'On the way to Viridian City, Misty notices that Horsea isnt feeling well. She decides to take Horsea back to the Cerulean City Gym to get a chance to swim around in their bigger pool. Her sisters get an idea to generate publicity for the gym by having an underwater ballet. To everyones surprise, they picked Misty to be the star of the show. She reluctantly agrees and the ballet begins perfectly. However, Team Rocket have stolen the villain outfits from Violet and Lily and are planning on crashing the ballet in order to capture the pokemon they are using.',27);
insert into EPISODIO_ENTITY values (4360, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/64687.jpg', 'Clefairy Tales', 62,'In Viridian City, Ash and friends are enjoying Ice Cream when a Clefairy comes and steals their backpacks. They report this to Officer Jenny, who tells them this has happened to more people as well. They then meey a guy names Oswald, and they follow the Clefairy down city pipes to find a spaceship underground! The Clefairy are stealing stuff in order to repair the ship. While Brock goes to get Officer Jenny, the other decide to sneak on the ship and retrieve the stolen stuff.',27);
insert into EPISODIO_ENTITY values (4361, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/64691.jpg', 'The Battle of the Badge', 63,'Ash arrives at the Viridian Gym and is ready to head inside when Gary shows up. Gary brags about how many badges he has and goes inside the gym before Ash can. Inside Gary is having an easy time battling the Gym Leader until he brings out a pokemon that cant be identified, and uses it to beat Gary. Meanwhile, Togepi gets separated from the group and everyone goes searching for it. Togepi ends up with Team Rocket who deliver it to Giovanni, who wants nothing to do with it. He is then called away on important business and leaves the gym in the care of Jessie, James, and Meowth and hands them pokemon to use. Ash and the others arrive back at the gym only to discover that Togepi is inside. Once inside they find Gary and wake him up and they talk about what happened. Team Rocket then shows up for a battle with Ash. He agrees to a gym battle, but it may have some shocking consequences if he makes a wrong move.',27);
insert into EPISODIO_ENTITY values (4362, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/64696.jpg', 'Its Mr. Mimie Time', 64,'On the way to Pallet Town, Ash and friends run across Stella, a girl who is trying to get her Mr. Mime to obey her so she can properly perform her circus routines. Mr. Mime is lazy and wants nothing to do with her or the circus. Because of this, Ash and friends decide to help her out (and Ash reluctantly end up in a Mr. Mime outfit) Then, Team Rocket show up and take Ash, thinking him to Mr. Mime. Knowing Ash will be ok, Delia takes Misty and Brock her house where another Mr. Mime shows up. Thinking it is Ash, Delia puts it to work, that is until Ash shows up. Team Rocket then return to try and take the Mr. Mime.',27);
insert into EPISODIO_ENTITY values (4363, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/64699.jpg', 'Holiday Hi-Jynx', 65,'Jessie is convinced that Santa stole a doll from here when she was younger and wants revenge and comes up with a plan to get it back. Meanwhile, Ash, Misty, and Brock encounter a Jynx who wants to get back to Santa at the North Pole. They decide to help it but Team Rockets plan could pose some trouble for them.',27);
insert into EPISODIO_ENTITY values (4364, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/64703.jpg', 'Snow Way Out', 66,'Continuing on their way to the next town, Ash and friends come to a fork in the road. Ash rushes down one path and ends up almost falling of the mountain. His compass does not work and he is now lost and can not find Misty and Brock, so he must make his way off of the mountain, and survive the terrible blizzard. Meanwhile, Team Rocket is stuck in the bad weather and are stuck in igloo. Jessie is enjoying this however, remembering her childhood and all the things she used to do with her mother.',27);
insert into EPISODIO_ENTITY values (4365, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/26/65177.jpg', 'Showdown at the Po-ké Corral', 67,'Ash has finally returned home to Pallet Town. With the Pokemon League still a few months away, he decides to visit Professor Oak. However, his rival Gary is also there. After compared their Pokedexes, it turns out that while ash has seen more Pokemon, Gary has captured more, which upsets Ash. Everyone then decides to spend the day seeing what Professor Oak does each day at the lab. Meanwhile, Team rocket have found their way into the labs reserve and are planning to steal all the Pokemon!',27);
insert into EPISODIO_ENTITY values (4366, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/26/65184.jpg', 'The Evolution Solution', 68,'Delia, Misty, and Brock leave Ash behind in Pallet Town while they head to Seafoam Island for a vacation. When goes looking for them at Oaks lab, he learns that Professor Oak is trying to figure out the secrets of Slowpokes evolution. Oak then suggests that Ash should go visit Professor Westwood, the creator of the Pokedex and find out. Ash heads out and surprises they other when he arrives. They head to Westwoods lab where they follow him around as he also studies Slowpoke. Meanwhile, Giovanni is tired of Team Rockets failures and commands them to go and steal the Pokemon from Westwoods lab.',27);
insert into EPISODIO_ENTITY values (4367, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/26/65185.jpg', 'The Pi-Kahuna', 69,'While jogging on Seafoam Island, Ash becomes blinded and accidentally causes a traffic mess. Officer Jenny comes along and clears it, and tells everyone about the high tourist traffic is due to the huge tidal wave that is due to hit the island soon "Humunga Dunga". Ash and friends go surfing, and while surfing Ashs foot cramps up and he starts to pass out. He is saved by a man named Victor and his Pikachu "Puka". Ash thanks hims and Victor tells everyone how everyone who rides Humunga Dunga tries to place a flag on the giant rock that sits off shore, as well as the story about his hero, Jan, who is the only one to ride the wave to the top of the rock and place a flag on it. Victor dreams of also doing this. Team Rocket then shows up and steals the two Pikachus and try to retreat to sea. now they must get they Pikachus back, as well as get ready for the big wave that is approaching.',27);
insert into EPISODIO_ENTITY values (4368, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/26/65196.jpg', 'Make Room for Gloom', 70,'To avoid work around the house, Ash, Misty, and Brock run off to find something to do. They wind up at the famous Xanadu Nursery, a place where Ash used to go all the time when he was little. There they meet Florinda, a shy girls who helps run the place and her Gloom. Florinda has recently lost her confidence after a Leaf Stone she bought failed to make her Gloom evolve. Professor Oak shows up and reveals that is is fake and they find out Team Rocket are the ones who sold it. Brock says that he will catch them for Florinda, who has fallen in love with him. Meanwhile, Team Rocket sneak into the nursery to steal plants.',27);
insert into EPISODIO_ENTITY values (4369, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/26/65517.jpg', 'Lights, Camera, Quack-tion!', 71,'While wondering around near Pallet Town, Ash and friends come across a girl named Kay who wants to battle. Ash agrees to, but before the battle can start Team Rocket comes an interrupts it. However, they accidentally capture Katrinas Raichu instead of Ashs Pikachu. Before anything else can happen, a movie director by the name of Cleavon Schpielbunk arrives and talks about how he needs starts for his upcoming Pokemon movie. His star, Wigglytuff, it a bit bratty and he must find a star that can handle her. Everyone then decides to audition for the role. When Arbok and Weezing get rejected, Team Rocket decide to take revenge and steal all of the Pokemon on the movie set.',27);
insert into EPISODIO_ENTITY values (4370, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/26/65518.jpg', 'Go West Young Meowth', 72,'Ash, Misty, Brock and Delia get invited to Hollywood for the premiere of the movie they helped to make "Pokemon In Love". They all head to Hollywood (as well as Team Rocket) and wind up at an abandoned movie theater where the director is waiting. After they go in the theater Team Rocket come out of hiding. Meowth says that he will catch up with them in a little bit. As everyone else watches the movie, Meowth walks around town remembering his past in the town and the events that lead him to join Team Rocket.',27);
insert into EPISODIO_ENTITY values (4371, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/26/65522.jpg', 'To Master the Onixpected', 73,'Ash and Brock are watching Bruno of the Elite 4 on TV, when Misty turns it off and tells Ash to do some real training. Delia then mentions that she heard that Bruno likes to train at Mt. Hideaway near Pallet Town. They decide to try and go find him. On the way up the mountain they have a quick ordeal with Team Rocket trying to steal from an old lady. While walking on the mountain they notice that there is a giant trail, and t was made by a giant Onix that is coming after them! All of a sudden Bruno himself appears and saves them. Ash asks Bruno to train him, but Brunos lessons are not what Ash had expected. Meanwhile, Team Rocket decide to capture the giant Onix, which causes it to go on a rampage.',27);
insert into EPISODIO_ENTITY values (4372, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/26/65535.jpg', 'The Ancient Puzzle of Pokémopolis', 74,'Ash continues his training for the Pokemon League by having a battle with Brock. When Jigglypuff randomly appears in the middle of the battlefield, Ash and Brock have Pikachu and Vulpix deflect their attacks. The resulting explosion unearths a mysterious looking thing. A girl named Eve immediately arrives to take the artifacts that they unearthed. She then explains that this must be the ancient city of Pokemopolis, and tells them about the story of the city. That night Team Rocket send Arbok into the ruins to find something. Arbok retrieves a black bar-bell looking object that sucks it along with Team Rocket into it. The next morning Eves team find the object and are also captured in it. They it suddenly turns into a giant Gengar! Ash and friends run to make sure Eve is ok, but she is stuck in a trance from another one of the artifacts. The two artifacts combine together and turn into a Giant Alakazam. The two ancient pokemon begin to battle and threaten to destroy the surrounding',27);
insert into EPISODIO_ENTITY values (4373, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/26/65544.jpg', 'Bad to the Bone', 75,'Ash finds out that the Pokemon League is starting soon, so he, along with Misty, and Brock, begins the journey to the Indigo Plateau. Along the way he is challenged by a trainer named Otoshi. He demands that the winner takes the losers gym badges. Thinking he will win, Ash agrees. Luckily Ash wins, only to discover that Otoshi does not have any badges, and he tells them that they were stolen by Team Rocket. Meanwhile, James and Meowth discover that they gym badges are gone, and so is Jessie. Jessie has taken the badges and it planning on entering the Pokemon League without Team Rockets help. Otoshi has now become depressed about losing his badges and has given up hope. His Marowak is angered by this and leaves. Ash, Misty, and Brock agree to help him find his badges and get them back, and reunite him with Marowak.',27);
insert into EPISODIO_ENTITY values (4374, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/26/65550.jpg', 'All Fired Up!', 76,'Ash has made it to the Pokemon League. A man is carrying the torch up towards the League, where it will burn throughout the entire event. Ash steps in and asks if he can carry the torch. Although Officer Jenny would not let him, the president of the Pokemon League decides to let him try. He does not get far until Team Rocket appears and tries to steal the torch, and they manage to get away with it. Thankfully, Mr. Goodshow has a spare flame and they continue on their way to the stadium and eventually make it. However, Team Rockets stolen flame burns out and they decide to crash the opening ceremony and steal the flame!',27);
insert into EPISODIO_ENTITY values (4375, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/26/66505.jpg', 'Round One -- Begin!', 77,'The Pokemon ceremony is about to begin, so Ash heads to register. Each trainer must first battle on four fields made up of Water, Ice, Rock, and Grass before reaching the main stadium. Ashs first match will be on the Water Filed against the arrogant "Astounding Mandi". Ash runs into Gary who taunts Ash as usual and gets him fired up to win, especially after Gary ins his first battle. with his first battle on the Water Field, Ash calls Professor Oak and has him send Krabby over so he can have two water pokemon to use. Misty and Brock advise him not to use Krabby but Ash wont listen, and when the match starts, Ash picks Krabby, but will Krabby be able to pull of a victory in its first battle, and in such an important battle?',27);
insert into EPISODIO_ENTITY values (4376, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/26/66506.jpg', 'Fire and Ice', 78,'As the Pokemon League continues, Ash pulls off a win on the Rock Field. After the battle Ash leaves his Pokemon with Misty and Brock, while he and Pikachu go to find something to eat. Misty is upset by this and her and Brock take him Pokemon and go to find him. They catch up with him, and tell him to take his Pokemon to the Pokemon Center. However, everyone is filled up. Luckily a strange looking Nurse Joy appears to guide them to a vacant center. It turns out to be a trap by Team Rocket who try to steal his Pokemon. They stop them and finally get them to a real center and they go out to eat. The next say Ash has his third battle on the Ice Field, and so far the match it tied, but his opponents Arcanine may change that.',27);
insert into EPISODIO_ENTITY values (4377, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/26/66507.jpg', 'The Fourth Round Rumble', 79,'Gary is battling his fourth match of the Pokemon League. His Nidoking is battling against a Golem on the rock field. After a little fighting, Nidoking is defeated and Gary is out of the Pokemon League. This defeat makes Ash nervous that he too may lose his fourth battle. Meanwhile, Team Rocket is making money by selling "official" Pokemon League badges. They also try to distract unsuspecting trainers so they can steal their pokemon, however Officer Jenny quickly puts a kink and the plan and they flee. The time has finally come for Ashs battle on the Grass Field, his final challenge before heading into Indigo Stadium. His trainer is the beautiful Jeanette Fisher, a trainer who is very skilled with her grass-type Pokemon. After tough fights Ash manages to defeat her Beedrill and Scyther, but when she calls out Bellsprout, Ash is in for his toughest league match yet.',27);
insert into EPISODIO_ENTITY values (4378, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/26/66508.jpg', 'A Friend in Deed', 80,'Following his fourth win in the Pokemon League, Ash is enjoying his day off. He goes to get something to eat, and finds his mom in the restaurant cooking for him. After the meal Ash meets another trainer named Richie who he shares a lot in common with. They begin talking when Team Rocket come by in a car pretending to be league officials saying that trainers must get their Pokemon inspected. Team Rocket made a mistake and reveal themselves, so they flee. Ash and Richie chase after them, but eventually lose them. That night they camp out by a river and talk more about their journeys. The next day they manage to find Team Rocket, but Team Rocket wake up and trap them in the back of the van as well. Now they must figure out a way to get out and return the Pokemon.',27);
insert into EPISODIO_ENTITY values (4379, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/26/66509.jpg', 'Friend and Foe Alike', 81,'The fifth round match-ups have been determined and Ash is up against his new friend Richie. The two of them are shocked, but determined to win the battle, despite little sleep that night. The day of there battle, Team Rocket use a voice changer to sound like Richie and call Ash. "Richie" wants to meet Ash and talk to him about Pikachu. When Ash arrives at the meeting point, Team Rocket reveal themselves and capture Ash and Pikachu and begin to take him and Pikachu away. Ash manages to escape, but Team Rocket is in pursuit. Now Ash must race back to Indigo Stadium before he is disquialifed for not showing up, while at the same time dodging Team Rockets attacks.',27);
insert into EPISODIO_ENTITY values (4380, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/26/66510.jpg', 'Friends to the End', 82,'Ash is upset about losing in the Pokemon League and does not want to talk to anybody. when Misty tries to talk to him it turns into a fight. However, Ash does in the end decide to go and watch Richies sixth round match, which he just narrowly loses. After the match Ash and Richie go out to the lake and talk about their experiences in the league. However, Team Rocket once again comes to interrupt the battle. After defeating them, the only thing left is the awards and closing ceremonies.',27);
insert into EPISODIO_ENTITY values (4381, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/301/754235.jpg', 'Pallet Party Panic', 1,'Following the completion of the Pokemon League, Ash is back home in Pallet Town. Professor Oak and Delia throw him a party which of course Team Rocket crashes, but Ash is able to send them off with the help of Charizard, who proceeds to wreck the party. Later that day Professor Oak asks Ash to run a errand for him. He wants Ash to go to the Orange Islands and pick up the GS Ball from Professor Ivy. He agrees and leaves soon after. Along the way they become trapped ina forest where the same flock of Spearow from the beginning of Ashs journey is still causing trouble, along with their newly evolved Fearow leader. Now they must figure out a way to get out of the forest before the Spearow manage to get to them.',27);
insert into EPISODIO_ENTITY values (4382, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/26/66512.jpg', 'A Scare in the Air', 2,'Ash and friends stop at a convenience store for some supplies for their journey to Valencia Island, and outside Ash participates in a contest and ends up winning blimp tickets to the island! What they dont know though, is that it was a setup by Team Rocket. However, before Team Rocket can plan anything, they lose control of the blimp, and Ash, Misty, and Brock also lose Togepi. Now everyone is in an all out race to find Togepi, dodge the ghost of the blimp, and catch Pikachu before the blimp crash lands.',27);
insert into EPISODIO_ENTITY values (4383, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/26/66569.jpg', 'Pokéball Peril', 3,'Walking along the beaches of Valencia Island, Ash and friends are searching for Professor Ivy, who luckily ends up appearing on her own. After finding out why they are there, she takes them to the lab where she shows them the GS Ball and explains why it is so mysterious. Ash then calls Professor Oak about it and Oak is excited to look at it, and then he and Ivy get into a discussion about their various works. Following that, Brock helps clean their living quarters and even makes dinner. That night a little scare happens when Professor Ivy jumps into a cloud of Vileplumes Stun Spore to save a Raticate, and she is taken to the Pokemon Center.After spending the night on the island and seeing how Ivy ans her assistants live and work, Brock decide to make a bold decision as Ash and Misty are ready to leave.',27);
insert into EPISODIO_ENTITY values (4384, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/26/66582.jpg', 'The Lost Lapras', 4,'After picking up the "GS Ball" from Professor Ivy, Brock decided to stay on the island so Ash and Misty head back home by blimp. Unfortunately, our duo gets double-crossed by Team Rocket once again, and then Jigglypuff puts the whole crew to sleep. The blimp crashes on sunny Tangelo Island. Ash and Misty then wonder along the beach and find some kids picking on a beached baby Lapras. They chase them away and get a hold of Nurse Joy to come save it. At the center they meet Tracey, and Ash learns of the Orange League, and wants to compete. Professor Oak agrees to wait for the GS Ball so that Ash can compete. Meanwhile, Team Rocket want to steal the Lapras while it is defenseless.',27);
insert into EPISODIO_ENTITY values (4385, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/26/66587.jpg', 'Fit to Be Tide', 5,'Ash, Misty, and their new friend Tracey begin their journey through the Orange Islands so Ash cam compete in the Orange League. Their first stop is Mikan Island where the first Orange League Gym is located. Ash meets the gym leader Cissy and challenges her to a battle. However, Ash soon learns that in the Orange League, Gym Battles are not what he is used to, such as accuracy tests and water races. Will Ash conquer this type of gym and win his first badge?',27);
insert into EPISODIO_ENTITY values (4386, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/26/66588.jpg', 'Pikachu Re-Volts', 6,'The group are headed towards Mandarin Island on Lapras. When they arrive there, they see a person being attacked by some Pokemon. As they go to investigate; Pikachu stops, turns around, and attacks Ash. Togepi jumps out of Mistys arms. Then a group of Magnemite surround Ash, shocking him. To create a distraction, an Electrode rolls by and explodes in front of Ash. When the smoke clears Pikachu and Togepi are gone. They find out from Officer Jenny that the same thing has happened to many others. They believe it is some sort of psychic Pokemon behind all of this, because Jennys Gastly is not effected. Meanwhile, Jessie and James are on the island and Meowth suddenly leaves them. They follow him to the source of all this, it is the work of Butch and Cassidy. Butch and Cassidy get rid of them, and Officer Jenny find them. Team Rocket reluctantly agree to help Officer Jenny and Ash to stop Butch and Cassidy.',27);
insert into EPISODIO_ENTITY values (4387, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/26/67008.jpg', 'The Crystal Onix', 7,'While riding around the Orange Islands on his Lapras, Ash finds a mysterious message in a bottle, which leads the gang on a new adventure. Ash, Misty, and Tracey travel to Sunburst Island, which is famous for its artists and glassblowers. They meet a struggling young shopkeeper named Mateo whos seeking inspiration from a legendary "Crystal Onix." Having been unable to find this special Pokemon, the shopkeeper turns to our heroes. With Tracey and his observational Pokemon on board, they set out to fire up a new friends creative drive!',27);
insert into EPISODIO_ENTITY values (4388, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/26/67261.jpg', 'In the Pink', 8,'A raging whirlpool whisks our heroes to top-secret Pinkan Island, a magical place where sheer cliffs and special berries have created a plethora of pink Pokemon. Traceys Pokemon watching skills are put to quite a test, while Ashs attempts at observing lead to trouble for both his friends and a feisty pink Rhyhorn. Officer Jenny and Professor Oak explain that people are not allowed on the island since poachers would love to get their hand on the pokemon. However, Team Rocket is already ready to launch their plan to capture the pink pokemon.',27);
insert into EPISODIO_ENTITY values (4389, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/26/67262.jpg', 'Shell Shock!', 9,'Aboard Lapras, the group follows a news crew to an uninhabited island, where a scientific expedition is underway after the discovery of a fossilized Kabuto. A series of natural disasters place our heroes in mortal danger, with only the power of their Pokemon to help them. What is the secret of the Kabuto, and who wants that secret to remain hidden?',27);
insert into EPISODIO_ENTITY values (4390, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/26/67265.jpg', 'Stage Fight!', 10,'Ash, Misty, and Tracey buy tickets to the Pokemon Showboat, a wonderful carnival where Pokemon can speak and perform plays! A young actress from the performance has been having problems with her Raichu ever since it shocked her early in their relationship. Ash and Pikachu may be able to help. Of course, theyll have to deal with Team Rocket first, as they attempt to steal all the "talking" Pokemon.',27);
insert into EPISODIO_ENTITY values (4391, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/27/67646.jpg', 'Bye Bye Psyduck', 11,'While Pikachu, Togepi and Psyduck are sleeping on Lapras back, Psyduck slips off and into the water. Everyone searches for Psyduck but they cant find it. Meanwhile, a girl named Marina finds Psyduck and thankfully finds Misty. Psyducks tail begins to glow and Marina says that is a sign that it should be ready to evolve. Since Marina is a water-type trainer, the two girls decide to have a battle. During the battle, when Misty goes to use Psyduck, she notices the pokeball is empty. She asks Ash to throw her bag to her, but he doesnt throw far enough and it lands in the water. When Misty goes to recover her bag, there is a Golduck hanging from it. She believes it to be hers and starts and is super excited to use it. However, Golduck may not be all that it seems. Meanwhile, Team Rocket is planning on stealing Golduck.',27);
insert into EPISODIO_ENTITY values (4392, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/27/67833.jpg', 'The Joy of Pokémon', 12,'Ash and friends continue their journey through the Orange Islands. The come across a very athletic Nurse Joy who travels to nearby islands and helps Pokemon, and decide to follow her as she makes her rounds. Then, a huge storm hits while Nurse Joy is heading to another island, and Ash, Misty, and Tracey decide that they must help her stay safe in the storm and still help all the sick baby Seel.',27);
insert into EPISODIO_ENTITY values (4393, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/27/67836.jpg', 'Navel Maneuvers', 13,'Ash finally arrives on Navel Island for his second Gym Battle. On the island, they meet Danny, the gym leader. Like the previous gym, Dannys gym is run a little differently. Instead of a battle Ash must complete a few tests. The first one involves climbing up the mountain in the center of the island. Despite having a tough time, Ash makes it to the top. Now comes the real challenge. Ash must freeze a geyser, and use it to slide back down the mountain before Danny in order to win his badge.',27);
insert into EPISODIO_ENTITY values (4394, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/27/67839.jpg', 'Snack Attack', 14,'Continuing their journey in the Orange Islands, Ash and friends stop at the Seven Grapefruit Islands, a small chain of islands known for grown tons of Grapefruit. When they try to pick them, a girl named Ruby appears and calls them thieves, and tries to stop them. However, it is just misunderstanding. When the real thief appears, they agree to help her, but that may be easier said then done when the thief is a very hungry Snorlax that can swim between islands!',27);
insert into EPISODIO_ENTITY values (4395, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/27/67841.jpg', 'A Shipful of Shivers', 15,'Ash, Tracey and Misty find more excitement than they bargain for when they reach their next destination. Professor Oak tells them that divers have recovered an Orange League Championship trophy off the coast of Moro Island that dates back over two hundred years! The trophy is on display at the Moro Island Museum of Art for all to see. By the time they get to the museum, Team Rocket has already broken in and stolen the trophy and Ash, Misty, and Tracey must find them and get the trophy back.',27);
insert into EPISODIO_ENTITY values (4396, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/27/68106.jpg', 'Meowth Rules!', 16,'Team Rocket has engine trouble and lands on an island where the natives are waiting for the "Great Meowth of Bounty" to arrive and fulfill an ancient prophecy. When Meowth gets mistaken for this great creature with special powers, he enjoys the special treatment and decides to play along. But, when hes unable to perform the ancient ritual thats expected of him, the treatment he gets becomes less and less enjoyable.',27);
insert into EPISODIO_ENTITY values (4397, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/27/68351.jpg', 'Tracey Gets Bugged', 17,'On the way to the third Orange Island Gym, Ash and friends stop at an island inhabited by tons of bug pokemon (much to Mistys dismay). In the woods they find an injured Scyther and try to catch it so it can be taken to the Pokemon Center. Scyther tries to put up a fight but Tracey has Venonat put it to sleep and he catches it. At the center Nurse Joy tells them about how wild Scyther live and this must have been the former leader of its group. Later that day, Scyther break out of the center and goes to redeem itself. Meanwhile, following a encounter with the wild Scyther which causes part of Jessies hair to be cut off, Team Rocket decide to capture all of them.',27);
insert into EPISODIO_ENTITY values (4398, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/27/68354.jpg', 'A Way Off Day Off', 18,'Ash and friends arrive on a small island hoping to get some rest and relaxation. However, things dont turn out so good when Charizard and Scyther begin to fight, and Team Rocket is once again planning on capturing all their pokemon.',27);
insert into EPISODIO_ENTITY values (4399, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/27/68356.jpg', 'The Mandarin Island Miss Match', 19,'Ash, Misty, and Tracey are on Mandarin Island where Ash has just won three battles in a row. He starts to become cocky, and when he has a chance encounter with Prima of the Elite 4, he believes he can take her on. However, she ignores his battle request and talks about the sea and admires Pikachu and Togepi, causing Ash to go and battle a nearby trainer. Ashs arrogance gets the best of him when he uses Charizard in a battle and it goes out of control. Prima then comes and uses her Slowbro to stop it. She tells Ash that he should come and watch her demonstration the next day and learn something. They go, and Ash is still unimpressed. He once again demands a battle and she agrees. Will Ash defeat a member of the Elite 4, or will his arrogance get the better of him?',27);
insert into EPISODIO_ENTITY values (4400, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/27/68357.jpg', 'Wherefore Art Thou, Pokémon?', 20,'Our heroes are on their way to Trovita Island when they come across two Pokemon trainers who seemingly hate each other, even though their two Pokemon are in love. Tony has a male Nidoran and Emily has a female Nidoran and all that the two Pokemon want is to be together. Misty then takes it upon herself to get these two Pokemon together',27);
insert into EPISODIO_ENTITY values (4401, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/27/68358.jpg', 'Get Along, Little Pokémon', 21,'While traveling across Mandarin Island, Ash and friends must stop and rest because of a thunderstorm. During the storm they notice a bunch of Magnemite absorbing the lighting. After the storm they find their trainer Ethan who explains that he collects the electricity from lighting and delivers it to towns. Following the storm, a town is left with out power and the Pokemon Center needs it soon. However, Ethan is injured, and now Ash, Misty, and Tracey must help him get to the next town while fending off Team Rocket and keeping track of his sneaky Magnemite #6.',27);
insert into EPISODIO_ENTITY values (4402, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/27/68808.jpg', 'The Mystery Menace', 22,'Ash and the group have finally made their way to the city of Trovitopolis, which has a ferry to Trovita Island, the location of the next Orange League Gym. However, the town is not as normal as they think, apparently a monster is in the sewer and has taken Ashs Bulbasaur. Now Ash, Misty, and Tracey must venture into the sewers to find this so called monster before the citys mayor and his SWAT team close off the sewers and trap them.',27);
insert into EPISODIO_ENTITY values (4403, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/27/68826.jpg', 'Misty Meets Her Match', 23,'Ash, Misty, and Tracey finally arrive on Trovita Island, the location of the third Orange League Gym. However, the Gym Leader, Rudy, is too busy focusing on Misty to care about Ashs gym request. After a day of begging, Rudy finally agrees, but Ash must a test first. First he must knock down targets that appear while he travels down a river. After completing that, they move onto the main event, a 3-on-3 battle, and if Ash wins he earns another badge. Meanwhile, Rudy also asks Misty to stay on the island with him, and she is considering it, but will she stay, or continue traveling with Ash?',27);
insert into EPISODIO_ENTITY values (4404, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/27/68832.jpg', 'Bound for Trouble', 24,'On the way to the fourth gym, Team Rocket attacks and captures Pikachu. They attach Pikachu to a ring that is also attached to another ring with Meowth on it. Then, Meowth and Pikachu get lost without the key. Now it is a race to find the pair, while at the same time trying to stay clear of the giant Pidgeot and Rhydon that inhabit the island. But what will happen with Pikachu and Meowth while they are lost?',27);
insert into EPISODIO_ENTITY values (4405, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/27/68852.jpg', 'Charizard Chills', 25,'While traveling through the Orange Islands, Ash and friends arrive at legend rich Shamouti Island. There the annual legend festival is beginning and Ash is revealed to be the Chosen One. As a greedy collector disturbs the peace between Moltres, Zapdos, and Articuno by capturing them, nature is thrown out of balance with strange storms happening all over the planet, turning the tropical Orange Islands into a winter wonderland. Now Ash must head to Fire, Lighting, and Ice islands and retrieve the three treasures that will calm the fighting Legendary Birds, as well as stop the greedy collector from capturing Lugia, the only pokemon who can help stop the fighting birds. But that is easy said them done with the three fighting Legendary Pokemon determined to stop him.',27);
insert into EPISODIO_ENTITY values (4406, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/27/68855.jpg', 'The Pokémon Water War', 26,'Ash and friends arrive on an island to get something to eat, but those plans are interrupted by a warehouse fire. They try to help, but its not enough. All of a sudden a group of Wartortle appear and put the fire out. Their trainer, Captain Aidan uses Squirtle, Wartortle, and Blastoise for fighting fires. Wanting to prove itself as strong as its evolution, Squirtle begins to train with Captain Aidan. Meanwhile, Team Rocket wants to capture all the firefighter teams for themselves.',27);
insert into EPISODIO_ENTITY values (4407, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/27/68856.jpg', 'Pokémon Food Fight!', 27,'After begin stuck on an island for a week, Ash and friends must go looking for food. However, they end up meeting a kid named Gulzar who wears flowers on his head. He gets upset and demands a battle with Ash. During the battle Ash tries to call out Snorlax and accidentally drops its pokeball, which shatters! The only way to fix it is to go to a Pokemon Center. Now they must get the sleepy and hungry Snorlax all the way to the other side of the island somehow, which is easier said then done.',27);
insert into EPISODIO_ENTITY values (4408, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/27/68858.jpg', 'Pokémon Double Trouble', 28,'Ash and friends finally arrive on Kumquat Island, the location of the final Orange League Gym Battle. Before Ash can go to the gym, Team Rocket attacks the beach in the Robo-Rhydon. However, Luana, the Gym Leader arrives and defeats it for them. Ash challenges her to a battle and she agrees. However, it will be a double battle, a brand new experience for Ash, will he be able to beat Luana and win his final Orange Leage Badge.',27);
insert into EPISODIO_ENTITY values (4409, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/27/68859.jpg', 'The Wacky Watcher!', 29,'Ash, Misty, And Tracey are suddenly caught in a migrating group of Magikarp. A submarine surfaces and a man named Dr. Quakenpoker comes out and tells them that he studies the Magikarp every year. Ash, Misty, and Tracey decide to help him, and begins an adventure of a lifetime.',27);
insert into EPISODIO_ENTITY values (4410, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/27/68860.jpg', 'The Stun Spore Detour', 30,'Ash and Pikachu stand at the edge of a rock by the water, all excited about the upcoming Orange League tournament battle, and then a huge wave from the sea looms over them and splashes down. Meanwhile, Tracey is studying a Vileplume and Ash is going to meet Tracey, but trips on a rock and tumbles into him. They both land inside the Vileplume and breathe in Stun Spore. Pikachu rushes to get help. Misty gets them to a cabin. She finds out that she needs to find some salveyo weed in order to cure Ash and Tracey. She sets out to find some, and with the help of a friendly Poliwag she finds some. However, James and Meowth are now trying to steal it from her so they can heal Jessie, who also is suffering from Stun Spore.',27);
insert into EPISODIO_ENTITY values (4411, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/27/69521.jpg', 'Hello, Pummelo!', 31,'Ash, Misty, and Tracey finally arrive on Pummelo Island. Ash is excited for his battle for the championship. After he registers, his Snorlax wont wake up, so he must switch it for another Pokemon. The next day, Ash begins his long-awaited battle against Drake, the leader of the Orange League, and a trainer skilled to any Pokemon type.',27);
insert into EPISODIO_ENTITY values (4412, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/27/69522.jpg', 'Enter the Dragonite', 32,'When the smoke clears, both Lapras and Gengar are unable to battle. With three of Drakes pokemon unable to battle, it is time for a field switch. After the brief intermission the battle resumes. With three pokemon left to defeat, Ash is in for one of the toughest battles yet, and waiting in the wings is Drakes powerful Dragonite, which has never lost a battle.',27);
insert into EPISODIO_ENTITY values (4413, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/27/69525.jpg', 'Viva Las Lapras', 33,'After winning the Orange League, Ash and friends begin their journey back to Pallet Town. They encounter a group of Lapras that just happens to be Ashs Lapras family! However, the Lapras (minus a teal colored one) reject Ashs Lapras and swim away. They contact Professor Oak who says they must have had a bad encounter with humans. Officer Jenny comes along and confirms this, and says that pirates are after the Lapras. When the pirates attack, Ash, Misty, and Tracey agree to help Officer Jenny stop them and save Lapras family.',27);
insert into EPISODIO_ENTITY values (4414, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/27/69527.jpg', 'The Underground Round-Up', 34,'Ash, Misty, and Tracey are on their way back to Pallet Town. They reach an island where a ferry is supposed to take them to Pallet Town. The town is deserted except for tons of Electrode. Togepi befriends a Voltob, but then tons of Electrode appear and start to attack. A man named Poncho appears and helps to get rid of them. He reveals that he was hired to get rid of the Electrode and transfer them to a nearby field. Poncho gets a phone call from the mayor who says he has hired someone else, someone who will get rid of the Electrode that very day. Everyone heads outside and Team Rocket appear with a new machine. They plan to capture all of the Electrode by making them self-destruct and then placing them in the machine while they cant defend themselves. Ash and friends decide to stop them.',27);
insert into EPISODIO_ENTITY values (4415, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/27/69533.jpg', 'A Tent Situation', 35,'Ash finally returns home to Pallet Town and is surprised when he gets home and Brock is there, as he is no longer working at Professor Ivys place. Everyone heads to Professor Oaks lab where Tracey finally gets to meet him in person. However, the good times are short lived when Team Rocket attacks and traps everyone.',27);
insert into EPISODIO_ENTITY values (4416, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/27/69539.jpg', 'The Rivalry Revival', 36,'Ash and Gary have a battle, and although he puts up a fight, Ash ultimately loses. Later, Professor Oak is examining the GS Ball and can not find out anything about it. Ash comes in and Oak tells him that Gary has left on his next journey, the Johto region. Ash becomes upset knowing that Gary is still ahead of him, and he decides to head to Johto as well, and he may have a few surprises before heading out.',27);
insert into EPISODIO_ENTITY values (4417, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/27/69546.jpg', 'Dont Touch That Dile', 1,'Ash, Misty, and Brock are reunited once again on a brand new journey. They venture west of Pallet Town into the region of Johto, where new adventures and Pokemon await them at every turn. They arrive in New Bark Town where Ash registers for the Johto League. However, they soon become involved in a rescue mission when Team Rocket breaks into Professor Elms lab, and steal a Totodile.',27);
insert into EPISODIO_ENTITY values (4418, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/27/69547.jpg', 'The Double Trouble Header', 2,'Ash, Misty, and Brock start their journey to the first Johto Gym in Violet City. On the way they meet Casey, a brand new trainer who has just received her first Pokemon, Chikorita, from Professor Elm a few days earlier. She insists on a battle with Ash. Ash is hesitant since he is far more experienced then her, but eventually agrees. Ash picks Charizard, and easily defeats all of Caseys pokemon. She becomes discouraged and runs away crying. She then encounters Team Rocket who convince her that Ash cheated, and that they will help her win the right way. She agrees and goes to find Ash.',27);
insert into EPISODIO_ENTITY values (4419, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/28/70057.jpg', 'A Sappy Ending', 3,'On the way to Violet City, Ash and friends come across a forest where Pinsir and Heracross are normally separated by a river into their own sections of the forest. However, something has happened in Pinsirs side of the forest, causing them to migrate to the Heracross part of the forest and stir up trouble. Ash and friends, along with a forest ranger named Woodrow and a friendly Heracross set out to find out why the Pinsir are leaving their part of the forest.',27);
insert into EPISODIO_ENTITY values (4420, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/28/70067.jpg', 'Roll On, Pokémon!', 4,'Ash and friends stumble across a valley where a girl named Rochelle uses Donphan to harvest Amberite, a gemstone only found in this valley. Ash, Misty, and Brock follow her as she makes her rounds, and see exactly how she finds it. However, Team Rocket hears about the gemstone and decides to steal a Donphan so that they can find their own Amberite.',27);
insert into EPISODIO_ENTITY values (4421, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/28/70087.jpg', 'Illusion Confusion', 5,'Continuing their way to Violet City, Ash and friends have become lost in a forest. The forest seems to be haunted as the trees begin to move and faces appear on them. They try to run, but trees appear everywhere. Then a Hoothoot appears and uses Foresight to clear up the illusions. Gary appears and taunts Ash about going through the forest without a Hoothoot. Ash, Misty, and Brock go to rent a Hoothoot, and get stuck with one that is scared, cant use Foresight, and does not listen to Ash (but loves Misty). A series of crazy adventures ensues as they try to make it through the forest.',27);
insert into EPISODIO_ENTITY values (4422, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/28/70106.jpg', 'Flower Power', 6,'Upon finally making their way out of the forest, Ash, Misty and Brock find themselves at the outskirts of a large city called Florando. Wondering what they should do next, Misty suggests that they relax and do some sight seeing. Brock quickly jumps in and tells Misty that he cannot relax in a city full of girls that need his protection. As Ash, Misty and Brock walk along the city streets, they stumble across a young lady who advises them to see the Pokemon Exhibition. There they meet a girl named Bailey and her Bellossom. One of her Bellossom is not dancing properly, and Ash, Misty, and Brock decide to help her.',27);
insert into EPISODIO_ENTITY values (4423, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/28/70518.jpg', 'Spinarak Attack', 7,'Our heroes make their way to Catallia City, a town recognized for its magnificent buildings. A patrol car barrels down the street, and knowing that Officer Jenny must be inside, Brock gives chase. However, a few seconds later, he trips over a thin web. Ash and Misty catch up with him and after Togepi notices something approaching, a Spinarak appears. Officer Jenny appears and tells them how in Catallia City they use Spinarak to help them. Ash, Misty, and Brock then become involved in a plot to stop thieves who are copying the legendary Black Arachnid.',27);
insert into EPISODIO_ENTITY values (4424, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/28/70526.jpg', 'Snubbull Snobbery', 8,'Ash, Misty, and Brock arrive in the rich town of Palm Hills. At one mansion they notice butlers looking for something. The mansions owner, Madame Muchmoney, is trying to find her Snubbull. Snubbull eventually appears. Madame Muchmoney invites them inside for lunch, where they discover that despite spoiling it, Snubbull doesnt want any of it. Madame Muchmoney is also planning for Snubbull to get married, and so it runs away again, and now everyone must find it before Team Rocket takes it.',27);
insert into EPISODIO_ENTITY values (4425, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/28/70552.jpg', 'The Little Big Horn', 9,'In a city park, Ash and friends encounter a lost baby Stantler. Brock decides to help nurse it back to health and then release it back to the wild, but Team Rocket is planning on taking the young pokemon.',27);
insert into EPISODIO_ENTITY values (4426, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/28/70559.jpg', 'The Chikorita Rescue', 10,'Ash encounters a wild Chikorita and begins to battle it, wanting to add it to his team. However, after battling Charizard, Chikorita is injured. Ash takes it to the Pokemon Center to get healed, but Team Rocket is disguise steal it. Ash chases after Team Rocket, trying to make sure the Chikorita is safe and unharmed.',27);
insert into EPISODIO_ENTITY values (4427, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/28/70909.jpg', 'Once in a Blue Moon', 11,'Ash and friends arrive in Cherrygrove City where they have an encounter with a Quagsire. It steals the GS Ball and runs away. Officer Jenny tells them that the Quagsire do this every year on the night of the blue moon. Not wanting to wait for the GS Ball to float back down the river, Ash, Misty, and Brock follow the Quagsire up the river.',27);
insert into EPISODIO_ENTITY values (4428, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/28/70917.jpg', 'The Whistle Stop', 12,'On the way to Violet City, Ash and friends meet Arielle, a trainer who owns a flock of Ledyba, and uses them to pollinate nearby trees. When Team Rocket steal some of the Ledyba (with some accidental help from Pikachu), Ash and friends must help Arielle find them before Team Rocket can get to far.',27);
insert into EPISODIO_ENTITY values (4429, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/28/70938.jpg', 'Ignorance is Blissey', 13,'Team Rocket cant believe their luck when the Blissey employed in a Pokémon Center willingly gives them the centers entire food supply. As they abscond with the grub, however, an collective pang of conscience tells them to return their ill-gotten booty. However, they are ashamed lest this act of decency ruin their carefully cultivated reputation as troublemakers.',27);
insert into EPISODIO_ENTITY values (4430, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/28/71540.jpg', 'A Bout with Sprout', 14,'Ash, Misty, and Brock finally arrive in Violet City, the location the first Johto Gym. They come across a Pokemon Academy. At the academy a young boy named Zackie becomes obsessed with Ashs Pikachu and decides to catch it, even if it belongs to another trainer. However, he ends up catching a Bellsprout instead. Meanwhile, the rest of the class goes on a field trip to the Sprout Tower, where Team Rocket is waiting for Ash so they can get Pikachu.',27);
insert into EPISODIO_ENTITY values (4431, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/28/71542.jpg', 'Fighting Flyer with Fire', 15,'Ash, Misty, and Brock finally arrive at the Violet City Gym, ready to face the Gym Leader. After a little tussle with Team Rocket, Ash challenges Falkner, the Gym Leader to a three on three battle in order to win his first Johto Badge.',27);
insert into EPISODIO_ENTITY values (4432, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/31/78843.jpg', 'For Crying Out Loud', 16,'Fresh off his win at the Violet City Gym, Ash and friends encounter a Marill that cries at everything. Following an encounter with Team Rocket, Misty, Togepi, and Marill become separated from everyone after being washed away in a river. Now Misty must somehow get back to Ash and the others while at the same time passing all of the many challenges of a forest.',27);
insert into EPISODIO_ENTITY values (4433, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/31/78888.jpg', 'Tanks a Lot!', 17,'Team Rockets most recent super vehicle, the Arbotank, is their ticket to capturing Pikachu. That is until Togepi and its new found Sentret buddy climb inside and and end up taking it on a joyride. Now Ash. Misty, Brock, and Team Rocket must team up in order to stop the Arbotank and get Togepi back.',27);
insert into EPISODIO_ENTITY values (4434, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/31/79292.jpg', 'Charizards Burning Ambitions', 18,'Ash and friends meet a girl named Liza, the person who protects the nearby Charicific Valley, a valley where wild Charizard live. Everyone goes there and Ash wants his Charizard to train with the others, but after it is easily beaten by another one, it loses its fighting spirit. Now Ash must figure out what is the best thing to do for Charizard.',27);
insert into EPISODIO_ENTITY values (4435, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/31/79294.jpg', 'Grin to Win!', 19,'Ash and friends arrive in Bloomingvale the day before the Annual Sunflora Contest. The meet a girl named Sonrisa who can not get her star Sunflora to compete. As the day of the contest arrives, will she be able to compete, especially when Team Rocket plans to steal all the Sunflora?',27);
insert into EPISODIO_ENTITY values (4436, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/31/79693.jpg', 'Chikoritas Big Upset', 20,'During a tough Pokemon Battle, Ash tries to call back Chikorita in order to use Pikachu, but Chikorita refuses to go back. Ash continues to try, but eventually the boy has to leave. At the Pokemon Center, Professor Oak and Nurse Joy tell Ash that Chikorita is probably jealous of Pikachu. That night Chikorita sneaks out of the Pokemon Center and Pikachu follows, but what will happen to the two?',27);
insert into EPISODIO_ENTITY values (4437, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/31/79699.jpg', 'Foul Weather Friends', 21,'Ash and friends come across a girl name Mariah and her pokemon Hoppip. Mariah uses her pokemon to forecast the weather. A brutal storm is heading their way and they must take cover before anything bad happens, but thats not so easy with the all of the pokemon that they must keep safe.',27);
insert into EPISODIO_ENTITY values (4438, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/31/79703.jpg', 'The Superhero Secret', 22,'Ash and friends arrive in a town where there is a local superhero - Gligarman. However, upon meeting him, they realize that he is getting a little too old to be fighting crime by himself. He tries to get Ash to be his sidekick, but Ash refuses. Gligarman then faces a real big threat when Team Rocket show up with their newest machine.',27);
insert into EPISODIO_ENTITY values (4439, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/32/80390.jpg', 'Mild N Wooly', 23,'Ash and friends meet up with Mary, a young girl who helps her parents operate a Mareep farm. She wants to enter the tournament in the upcoming Mareep Festival, but her mother does not want her to because she thinks she is not ready. Mary sets out to prove that she is ready for it and Ash, Misty, and Brock decide to help her.',27);
insert into EPISODIO_ENTITY values (4440, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/32/80392.jpg', 'Wired for Battle', 24,'When the most promising trainee at a Pokemon Dojo abandons battle altogether, opting to gather information for his comprehensive Poke-database instead, its up to Ash and friends to convince him that battling, and life for that matter, is more than just a matter of probability.',27);
insert into EPISODIO_ENTITY values (4441, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/32/80404.jpg', 'Good Quil Hunting', 25,'Continuing their way to Azalea Town, Ash and friends come across a trainer who is looking for a Cyndaquil. According to rumors, there are suppose to be many of them living in the area. Ash gets excited and goes looking for one so he can capture it. However, the trainer from before is not to happen with this and capturing Cyndaquil turns into a contest between the two trainers.',27);
insert into EPISODIO_ENTITY values (4442, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/33/83121.jpg', 'A Shadow of a Drought', 26,'Ash and friends finally arrive in Azalea Town. The town is currently in the middle of a drought. While walking through town Ash accidentally steps on a Slowpokes tail, which causes the towns residents to chase after him, angry that he injured their mascot. They are saved by a man, who just happens to the be the Pokeball expert Kurt! Before they can deliver the GS Ball to him, they decide to help him investigate the cause of the drought.',27);
insert into EPISODIO_ENTITY values (4443, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/33/83744.jpg', 'Going Apricorn', 27,'Ash, Misty, and Brock arrive at Kurts house and finally deliver the GS Ball to him. As he needs time to study it, they must find something to do. Since the gym is still closed, they decide to watch Kurt work and create Pokeballs. He makes them out of Apricorns, a special type of fruit that only grows in the Johto region. Kurt gives them each their own Fast Ball. He says he will make them more if they go and pick more Apricorn. As he only has a White Apricorn tree in his yard, his granddaughter Maisy takes them into the mountains outside of town to pick all different kinds of Apricorns. However, Team Rocket is not far behind and they want the Apricorns for themselves.',27);
insert into EPISODIO_ENTITY values (4444, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/33/83755.jpg', 'Gettin the Bugs Out', 28,'Ash and friends have delivered the GS Ball safely to Kurt and are heading to the Azalea Town Gym for the next badge. Misty thinks Ash will have a tough time without Charizard but Ash is confident that Cyndaquil has the firepower he needs. They arrive at the gym are are surprised to find out that it is a forest inside of a dome. The Gym Leader, Bugsy, appears and accepts Ashs battle. Bugsy specializes in Bug-Types, and quickly proves that Ash will need to think quickly if he is to earn his Second Badge.',27);
insert into EPISODIO_ENTITY values (4445, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/33/83768.jpg', 'A Farfetchd Tale', 29,'Ash and friends find themselves inside the Ilex Forest. The encounter a young trainer named Sylvester who is having trouble with his Farfecthd and cant get it to help him make Charcoal. Team Rocket appear and steal the pokemon, and now Ash, Misty, and Brock must help Sylvester get it back, and prove to Farfetchd that he really cares for it.',27);
insert into EPISODIO_ENTITY values (4446, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/33/83817.jpg', 'Tricks of the Trade', 30,'Ash and friends arrive in a town where the Pokemon Swap Meet is being held. The event has many festivities, but the main one is where people trade their pokemon to other trainers. They meet a trainer named Benny who is trying to find someone to trade his Wobbuffet to. Ash, Misty, and Brock decide to help him find someone to trade to. Meanwhile, Team Rocket is using the event to trick trainers into giving them their pokemon. However, a run-in with the Magikarp Salesman leads to events that may change the outcome of Team Rockets plans.',27);
insert into EPISODIO_ENTITY values (4447, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/33/84125.jpg', 'The Fire-ing Squad', 31,'Ash and friends arrive in a new town where an event called the Fire and Rescue Grand Prix in going to be held. It is a firefighter competition, mainly for Water Pokemon. They are quickly reunited with two sets of old friends. First they meet Captain Aidan and Team Wartortle from the Orange Islands, and then they meet the Squirtle Squad. Both team are going to be in the competition. However, the Squirtle Squad have become essentially lost without their leader. In order to settle its rivalry with Team Wartortle, Ashs Squirtle rejoins the Squirtle Squad for the competition, and the end result will change everyone.',27);
insert into EPISODIO_ENTITY values (4448, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/33/84129.jpg', 'No Big Woop', 32,'Ash and friends come across a school where a girl named Olesia takes care of some Wooper. She needs to run and visit her mother, but she cant take the Wooper with her. Ash, Misty, and Brock agree to watch them for her, but it turns out to be more then they bargained for.',27);
insert into EPISODIO_ENTITY values (4449, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/33/84131.jpg', 'Tunnel Vision', 33,'Ash and friends come across a tunnel that is a shortcut to Goldenrod City. However, the Onix in the tunnel dont want to let anyone pass. Now they must find a way through the tunnel, but things are made worse when both Jigglypuff and Snubbull show up!',27);
insert into EPISODIO_ENTITY values (4450, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/33/84146.jpg', 'Hour of the Houndour', 34,'A group of wild Houndour is stealing stuff from people in town and terrorizing people in the forest, and people are becoming scared of them. But when one of them is attacked by a wild Golem, Ash and friends befriend them and make the long trek back to town to help the poor Houndour.',27);
insert into EPISODIO_ENTITY values (4451, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/33/84176.jpg', 'The Totodile Duel', 35,'Ash and Mistys "friendly" rivalry is tested when they both try to capture a Totodile at the same time. Unable to determine whose Pokeball had captured the wild Pokemon, the two must battle it out to determine who gets Totodile.',27);
insert into EPISODIO_ENTITY values (4452, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/34/85425.jpg', 'Hot Matches!', 36,'When Ash and friends hear of a unbeatable trainer operating nearby, they seek her out. They are quickly stunned when both Brocks Vuplix and Ashs Cyndaquil are easily defeated by her Skarmory, despite having a huge type advantage. Ash then sets out to train Cyndaquil and help it with its flame problem.',27);
insert into EPISODIO_ENTITY values (4453, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/34/85435.jpg', 'Love, Totodile Style', 37,'Ashs Totodile falls head over tail for a passing Azumarill, but Azumarill doesnt care about it and sends it flying. Trixie, Azumarills trainer comes along and says that she is trying to figure out why Azumarill is acting so strange lately. When Team Rocket kidnaps Azumarill, Totodile sets out to rescue and win the her love.',27);
insert into EPISODIO_ENTITY values (4454, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/34/85448.jpg', 'Fowl Play', 38,'While walking through a forest on the way to Goldenrod City, Ash and friends encounter a rare Noctowl that is smaller then other Noctowl and has different colors too. This Noctowl is a trickster, and when Ash hears this he sets out to capture the tricky Pokemon.',27);
insert into EPISODIO_ENTITY values (4455, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/34/85451.jpg', 'Forrest Grumps', 39,'When Molly Hales sadness of her fathers disappearance gets to her, she unknowingly uses the Unown to create her own dream world along with Entei, who she believes to be her father. When Entei kidnaps Delia, Ash, Misty &amp; Brock invade the mansion looking for her and to try to save Molly from the fantasies of her dream world.',27);
insert into EPISODIO_ENTITY values (4456, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/34/85797.jpg', 'The Psychic Sidekicks!', 40,'Ash and friends are wandering through a forest that is supposedly haunted by ghosts. Luckily they run into a girl named Cherry, who owns a Girafarig. Once they get to town, Ash decides to have a battle with this unique pokemon. Meanwhile, Team Rocket is planning on stealing all of the psychic pokemon in the town.',27);
insert into EPISODIO_ENTITY values (4457, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/34/85802.jpg', 'The Fortune Hunters', 41,'A Pokemon Fortune Telling boom turns out to be a Team Rocket plot to steal Pokemon from local trainers. The engineers of this plot, though, are not the Team Rocket regulars, but by the formidable Butch and Cassidy. Now it is up to Ash and friends to stop them.',27);
insert into EPISODIO_ENTITY values (4458, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/34/86119.jpg', 'A Goldenrod Opportunity', 1,'Our heroes have finally reached the next stop on the road to Johto: Goldenrod City! Looking to challenge the citys Gym Leader, Ash finds out the gym is closed for the day. Knowing they must wait until tomorrow, the gang decides to shop around and enjoy the city when they run into a local trainer, Whitney. After a close-encounter with Team Rocket, our heroes find out Whitney is actually the Goldenrod City Gym Leader! Whitney says that even though it is her day off she will battle him, but will ash be able to beat her and win his third Johto Badge?',27);
insert into EPISODIO_ENTITY values (4459, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/34/86120.jpg', 'A Dairy Tale Ending', 2,'Whitney takes our heroes to her uncles Miltank farm in the outskirts of Goldenrod City. Here they sample the finest in Miltank dairy products and learn how to groom and care for these Pokemon. Ash realizes this is a great opportunity to study Miltank first hand and hopes it will help him against Whitneys Miltank in their next battle. After learning about Miltank and coming out victorious in a battle against Team Rocket, Ash thinks he has found out the perfect way to combat Miltank and challenges Whitney to a rematch.',27);
insert into EPISODIO_ENTITY values (4460, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/34/86121.jpg', 'Air Time', 3,'Following his victory against Whitney, Ash and the others sit down to have breakfast at the Goldenrod City Pokemon Center. Suddenly a man introduces himself as the producer of Poketalk Radio, and invites Ash to an interview at their radio show. However, when Team Rocket disguise themselves as famous performers, things might not go exactly as planned.',27);
insert into EPISODIO_ENTITY values (4461, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/34/87460.jpg', 'The Bug Stops Here', 4,'Ash and friends arrive at the National Park where the Bug Catching Contest is about to start. They reunite with Casey who is also competing. As the contest starts, Ash and Casey decide to see who can get the best pokemon. Meanwhile, when Team Rocket is denied entry into the competition, they steal the costume of one of the employees and sneak into the park. When their plan fails, they resort to their old ways and prepare a trap to catch Pikachu.',27);
insert into EPISODIO_ENTITY values (4462, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/40/100900.jpg', 'Type Casting', 5,'Ash and friends come across a river where the bridge across it has been washed out due to a recent storm. They see a man in a boat nearby and ask him for a ride. He says he will give them a ride if they can find the pokemon Sudowoodo. They begin their search and come across Marie and Pierre, two scientists who are also after Sudowoodo, trying to figure out what type it is. Realizing they must be related to the guy with the boat, they join them on their quest to find Sudowoodo. However, Team Rocket are also hot on their trail planning to find Sudowoodo first.',27);
insert into EPISODIO_ENTITY values (4463, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/40/100901.jpg', 'Fossil Fools', 6,'Ash, Misty and Brock have reached the famous Ruins of Alph. Summoned there by a note from Professor Oak they join him and an old student of his, Foster in a facility for studying Pokemon fossils. Foster has made an amazing discovery, live pre-historic water-type Pokemon thought to be extinct for thousands of years! However, their habitat is being threaten by an unknown force, and Ash and friends go to find out what it is.',27);
insert into EPISODIO_ENTITY values (4464, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/44/112485.jpg', 'Carrying On', 7,'On the way to Ecruteak City, Ash and friends see a flying Pidgey being attacked by a huge Fearow and decide to intervene. They bring the Pidgey to the next town and luckily find its home, and discover it is a member of the "Carrier-Pidgey Express", a business run by a boy named Malachi and his grandfather. They deliver letters to the nearby islands. Ash and friends join Malachi as he goes to make his rounds for the day, but Team Rocket appears and wants to capture all of the Pidgey.',27);
insert into EPISODIO_ENTITY values (4465, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/45/113162.jpg', 'Hassle in the Castle', 8,'In order to escape the rain, Ash and friends go inside a nearby castle. They venture into the castle and they discover it is actually a clinic where the doctors use pokemon to heal the patients. Team Rocket sneaks into the castle and steals some of the food. When they are discovered, they dash towards another room. Dr. Anna tells them not to go in there, so she and Brock follow them, but then the entrance to the dungeon becomes blocked. While Ash, Misty, and Annas assistant go to find the entrance to the dungeon in the forest, Brock and Anna must survive the booby trapped maze in order to get out of the dungeon in one piece.',27);
insert into EPISODIO_ENTITY values (4466, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/47/118459.jpg', 'Two Hits and a Miss', 9,'On the way to Ecruteak City, Ash saves an old man from getting trampled by a rampaging Tauros. Seeing promise in Ash, he invites everyone to his Dojo. Before he can do anything, a trainer named Shiro appears and wants to battle Kenzo for leadership of the Dojo. Due to his bad back, his granddaughter Chigusa steps in, much to his annoyance. However, Team Rocket crashes the battle, and even though they defeat them, they must call off the battle for one day. Kenzo however does not believe Chigusa has the talent to battle Shiro or eventually take on the Dojo. Instead, he wants Ash to do it. Ash does not want to, so he Misty, and Brock decide to help Chigusa train with her Hitmontop and prove that she can defeat Shiro the next day. When it comes time for battle, will she be able to defend the Dojo?',27);
insert into EPISODIO_ENTITY values (4467, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/47/118705.jpg', 'A Hot Water Battle', 10,'Ash and friends stop at a Hot Spring to relax for the day. While playing a game, Chikorita, Cyndaquil and Totodile become angry with each other. When the ball they are playing with rolls away, the three of them give chase, but eventually become lost inside of a cave with Meowth. Now they must work together if they are to get back to their trainer. Meanwhile, Jessie and James are beginning to think of a new scheme to capture the starter pokemon.',27);
insert into EPISODIO_ENTITY values (4468, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/47/118710.jpg', 'Hook, Line and Stinker', 11,'Ash and friends arrive at a lake where a competition called the Seaking Catching Competition is going to be held. The goal is to catch the biggest Seaking, and the winner gets the grand prize of a trophy and a years supply of chocolate. Ash, Misty, and Brock decide to enter, and the competition becomes super important to Misty when a trainer with a Poliwrath insults her and her Poliwhirl and says she has no chance against him. She sets out to prove that she can beat him.',27);
insert into EPISODIO_ENTITY values (4469, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/52/131234.jpg', 'Beauty and the Breeder', 12,'On the way to Ecruteak City, Ash and friends stop in a town where Suzy, Brocks Vulpixs original owner, is planning on meeting them. They meet up with Suzy and go to have lunch with her. She says that she will be entering a beauty contest and she wants to use Vulpix, and she wants Brock to enter with her. However, he has a little competition from Suzys close friend Zane. Meanwhile, Team Rocket is planning on crashing the ceremony and stealing all of the pokemon.',27);
insert into EPISODIO_ENTITY values (4470, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/54/135120.jpg', 'A Better Pill to Swallow', 13,'Ash and friends encounter a man named Old Man Shuckle who uses Shuckle to produce medicine. There is an especially rare one that has a purple shell that has a special juice that it produces. Team Rocket steal the Shuckle and drink the juice which makes all of the pokemon in the area fall in love with them. Ash and friends set out to find them and get the Shuckle back.',27);
insert into EPISODIO_ENTITY values (4471, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/54/135128.jpg', 'Power Play!', 14,'Ash and friends run into Gary and his newly evolved Umbreon in a forest clearing. Ash challenges Gary to a battle, but all of his pokemon are not paying attention and Gary walks off. Meanwhile, Team Rocket take over a Power Plant and cause a blackout, and Ash must team up with Gary in order to restore the power to the nearby town.',27);
insert into EPISODIO_ENTITY values (4472, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/54/135245.jpg', 'Mountain Time', 15,'Ashs and friends are traveling through a windy mountain past and meet a mountain patroller named Benji and his dad. Team Rocket show up and steal Pikachu and Togepi, but the winds botch their escape attempt and they wind up on an unstable rock that could fall into the ravine below any second. Ash and friends must team up with Benji and his dad if they are to get their pokemon back.',27);
insert into EPISODIO_ENTITY values (4473, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/54/135580.jpg', 'Wobbu-Palooza!', 16,'Breaking for lunch at a spot in the forest, our heroes notice a nearby Wobbuffet and begin to look around for its teammates, Team Rocket! Although theres no sign of Team Rocket, everywhere they look there are more Wobbuffet popping up. They follow them to a Wobbuffet Village and find out the village is about to have their annual Wobbuffet fair. During the festival a group of punk crash the festival, and due to festival rules, no one can battle inside the village during the festival. They must now find a way to stop the punks, and the solution maybe something they had never suspected.',27);
insert into EPISODIO_ENTITY values (4474, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/54/135586.jpg', 'Imitation Confrontation', 17,'Ash and friends arrive at a Pokemon Center and Nurse Joy is nowhere to be found. All of a sudden she comes from around the corner with Chansey, but Brock says this is not Nurse Joy. He is right, as Duplica takes off the costume and reveals herself and Chansey goes back to being Ditto. Nurse Joy is currently doing a check up on Duplicas new Ditto, nicknamed "Mini-Dit". Unlike what happened with her first Ditto, Mini-Dit can transform perfectly, but it remains the same size as a Ditto. Knowing this, Team Rocket hatch a plan to steal Mini-Dit ans use it for their evil purposes.',27);
insert into EPISODIO_ENTITY values (4475, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/54/135609.jpg', 'The Trouble with Snubbull', 18,'Madame Muchmoneys Snubbull has once again caught up with Team Rocket. Meanwhile Ash and friends run into Madame Muchmoney who is desperately searching for Snubbull. Things take an unexpected turn when Snubbull evolves into a Granbull. With a new powerful pokemon that loves Meowth, Team Rocket decide to use Granbull to capture Pikachu, and to demand a giant ransom from Madame Muchmoney.',27);
insert into EPISODIO_ENTITY values (4476, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/54/135617.jpg', 'Ariados Amigos!', 19,'Ash, Pikachu, and Brock take a break by the lake while Misty heads deeper into the forest with Togepi. As Misty picks some flowers, Togepi wanders over to a very strange looking bush. It appears to have legs...spider legs! Summoned by Mistys shrieks, Ash and Brock discover an Ariados in the bush. Just then, Aya, Fuchsia City Gym Leader Kogas younger sister, appears before everyone. She is happy to see them again and tells them that she is studying Pokemon Jujitsu at a nearby Dojo. She invites them to the Dojo where they all decide to take part in the different classes. However, Team Rocket is once again planning to strike and steal as many Pokemon as the can.',27);
insert into EPISODIO_ENTITY values (4477, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/54/136086.jpg', 'Wings N Things', 20,'Continuing the journey to Ecruteak City, Ash and friends arrive in a town where a happy little Yanma is constantly going around and accidentally breaking every window in town with its Sonicboom attack. Yanmas trainer, Zachary, loves his Yanma and wishes that his Yanma would stop. However, Zacharys father tells him that he needs to release Yanma back into the wild. Zachary is confused on what to do, and Ash and friends are there to help him decide what to do.',27);
insert into EPISODIO_ENTITY values (4478, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/54/136097.jpg', 'The Grass Route', 21,'On the way to Ecruteak, Ash and friends are caught by the sight of a Skiploom racing by. They follow it, and encounter its trainer, Ephram. He and his Skiploom are training for the upcoming annual Grass-Type tournament, a contest for Grass Pokemon only. Confident he can win any "local" tournament, Ash decides he and Bulbasaur will enter as well. Ephram and his Skiploom train hard as the tournament quickly approaches. However, Ash doesnt think it is necessary for someone of his Pokemon prowess to prepare. The next day the tournament starts, and with two mystery trainers in the competition, who will emerge victorious?',27);
insert into EPISODIO_ENTITY values (4479, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/54/136184.jpg', 'The Apple Corp!', 22,'Catching a sweet scent on the breeze, Ash and Pikachu follow their noses to a nearby apple orchard. As Misty and Brock follow, they warn him not to eat the apples that dont belong to them. No sooner is this said than Pikachu is caught red-handed with couple of cores! Once Ash proves Pikachus innocence to the orchard owner, Ash, Misty, and Brock agree to help Charmaine find the real thieves.',27);
insert into EPISODIO_ENTITY values (4480, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/55/137679.jpg', 'Houndooms Special Delivery', 23,'Continuing on the way to Ecruteak City, Ash and friends are peacefully walking when Team Rocket attacks. When Weezing uses Smokescreen, Togepi uses Metronome which causes it to teleport away. Misty becomes frantic trying to find her young pokemon. Together with Ash and Brock she begins a long desperate search for the young pokemon. Meanwhile, a Houndoom finds Togepi who is crying, afraid to be alone. Houndoom grabs the young pokemon and takes it with on its delivery journey.',27);
insert into EPISODIO_ENTITY values (4481, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/55/137680.jpg', 'A Ghost of a Chance', 24,'Arriving in Ecruteak, Ash immediately heads to the Gym to challenge its leader for his next Johto League badge. Our heroes soon realize this isnt a normal gym....it bursts into flames as soon as they enter! Trying to douse the flames with their water Pokemon, they find out the blaze is fake. Its actually Gastly, Haunter, and Gengar instigating the illusion. Then the Gym Leader, Morty shows up and asks them what they are doing in the tower. After explaining Morty explains the history of the two towers. Ash asks for a gym battle, but when Togepi and Pikachu wander off, they must tend to Team Rocket.',27);
insert into EPISODIO_ENTITY values (4482, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/55/139270.jpg', 'From Ghost to Ghost', 25,'The time finally comes for Ashs fourth Gym Battle in the Johto League. In the Ecruteak Gym, he must face Morty and his team of powerful ghost Pokemon. But Ash has already been witness to Mortys Gengar and been stunned by the Pokemons power. Does he have a chance against a whole team of such powerful Pokemon phantoms? As Ash thinks over battle strategies, Nurse Joy overhears and suggests he uses his Noctowl, but will that be enough to win the battle?',27);
insert into EPISODIO_ENTITY values (4483, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/57/142627.jpg', 'Troubles Brewing', 26,'After winning his Fog Badge at the Ecruteak Gym, Ash and friends learn of a tea ceremony happening in town and decide to check it out. Inside they find out it is run by five sisters. Misty befriends the youngest sister, Sakura. Sakura wants to start a Pokemon journey and asks if she can join Ash, Misty, and Brock. They agree, but her sisters dont. Her sisters propose a challenge, they have a set of battles, and if Ash, Misty, and Brock defeat them Sakura can go. They agree and the battles begin.',27);
insert into EPISODIO_ENTITY values (4484, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/67/167966.jpg', 'All That Glitters!', 27,'When a flock of Murkrow steal Ashs badges and James prized bottle cap collection, it becomes a race to get to the Murkrow first and reclaim their prized possessions.',27);
insert into EPISODIO_ENTITY values (4485, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/68/170561.jpg', 'The Light Fantastic', 28,'Parched from a long desert journey, our heroes are excited to see a promising sparkle in the distance. As they press toward this spectacle, a city in utter ruin unfurls before them. This desolation notwithstanding, they are able to locate an intact Pokémon Center and learn from the Joy in residence that there ruins had once been a great city, inhabited by a tribe of people who were known for the reverence they showed to Remoraid.',27);
insert into EPISODIO_ENTITY values (4486, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/71/177737.jpg', 'UnBEARable', 29,'Hearing a rustling sound, Misty awakens to find an adorable Teddiursa that had wandered into the abandoned cabin where she, Ash, and Brock are staying for the night. She is overjoyed to gain such a cuddly companion, but beginning the following day, Misty and friends face a string of troubles. In all cases, the Teddiursa is quick to point out the culprits, blaming other Pokemon belonging to Ash, Misty and Brock. When both Teddiursa and Brocks backpack go missing, they finally figure something is strange about this Teddiursa, and must now find it and get Brocks backpack back.',27);
insert into EPISODIO_ENTITY values (4487, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/71/177746.jpg', 'Moving Pictures!', 30,'On the way to Olivine City Ash and friends run into their old shutterbug friend Todd, who is now traveling far and wide in search of the dream photo opportunity - a close up of the Legendary Pokemon Articuno. Their reunion is cut short when a chunk of solid ice comes falling out of a perfectly blue sky. Out heroes examine the object and discover that a Sunkern is frozen inside. Observing the Pokemon to still be alive, Ash and friends rush it off to be treated at the Pokemon Center. They cant find one, and instead find a lodge run by a old lady named Sophia. She knows exactly how to treat the young pokemon. She then tells Ash and friends about the Sunflora that used to inhabit the mountain. They decide to head to the mountain to see if they can find some Sunflora, but wind up being attacked by Team Rocket. After Team Rocket is defeated, they continue their journey up the mountain. But will they find any Sunflora?',27);
insert into EPISODIO_ENTITY values (4488, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/71/178644.jpg', 'Spring Fever', 31,'Continuing on their search for Articuno with Todd, Ash and friends stop for a snack break. A trio of Swinub appears and takes Mistys rice cake. They jump to pursuit and soon learn that these Pokemon belong to a father daughter team of water prospectors. The Swinubs keen sense of smell allows them to detect substances buried deep underground, and they use this to find areas for resorts to come and build hot springs. Impressed by their ability, Team Rocket decide to capture the Swinub trio.',27);
insert into EPISODIO_ENTITY values (4489, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/71/179863.jpg', 'Freeze Frame', 32,'Ash, Misty, and Brock continue exploring the Johto region. They arrive at Mt. Quena, a special location in the Johto region famous for high winds and the Purity River, a river so pure that you can drink from it and feel immediately refreshed. A man named Cullen and his assistant Domino come to the nearby lodge to study the river. Team Rocket arrive and steal Pikachu. As they try to make their escape, the winds of the mountain toss them around and they wind up on top of the mountain. There, Domino reveals that she is actually a member of Team Rocket, and sends everyone on the balloon crashing into the lake on top of the mountain. After making it back to shore, Ash and friends once again encounter Mewtwo and his clones, and are soon caught up in the struggle between Mewtwo and Giovanni. Giovanni still wants to capture and use Mewtwo for his evil purposes, while Mewtwo wants to live a peaceful life with its clones and protect Mount Quena. Ash and friends vow to help Mewtwo in its quest',27);
insert into EPISODIO_ENTITY values (4490, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/71/179866.jpg', 'The Stolen Stones!', 33,'Continuing on their journey to Olivine City, Ash, Misty and Brock find themselves walking along a canyon bottom with unstable boulders above them. All of a sudden, a gust of wind knocks the boulders loose. At the last second they are saved by a pack of Arcanine. Their trainers, Ramona and Keegan, appear and ask them if they are OK. They are delivering Fire Stones to a nearby town and offer Ash and friends a ride part of the way to Olivine City. However, Team Rocket appears and steals the Fire Stones. Now Ash and friends must help Ramona and Keegan get them back.',27);
insert into EPISODIO_ENTITY values (4491, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/71/179868.jpg', 'The Dunsparce Deception', 34,'Ash, Misty, and Brock are still journeying toward Olivine City when they come across a boy named Bucky who seems to be looking for something. He introduces himself and explains that hes looking for a Dunsparce. Recently, he and his family went away to visit his sick grandfather. When they came back, he found out that a swarm of Dunsparce came through town and all of his friends captured one, but now he doesnt have one. They decide to help the young trainer, but interference from Team Rocket could hamper that plan.',27);
insert into EPISODIO_ENTITY values (4492, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/71/179871.jpg', 'The Wayward Wobbuffet', 35,'Knowing our heroes are still en-route to Olivine, Team Rocket lie in wait. Dressed as scientists, they explain theyve just repaired the amazing "PokePod." To test it out, Pikachu is placed in the pod and locked in tight. When Team Rocket reveals their true identity and runs, Ash and Co. are chase in hot pursuit. When they catch up to Team Rocket, there isnt a PokePod or Pikachu in site! Realizing Wobbuffet was hiding for the hand off, Ash chases after it. In Wobbuffets quick retreat, it trips dropping the Pikachu containing PokePod and falls into the rapids of a nearby river. Since the only way to release Pikachu from the PokePod is the key around Wobbuffets neck, Ash, Misty, Brock and Team Rocket begin an all out race to find Wobbuffet first.',27);
insert into EPISODIO_ENTITY values (4493, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/72/180201.jpg', 'Sick Daze', 36,'When Brock falls ill, Ash and Misty must do all of the chores that he normally does. This includes cleaning up after themselves, cooking, getting firewood, and taking of Brock. To make matters worse, Team Rocket is planning on ambushing them to take all of their pokemon.',27);
insert into EPISODIO_ENTITY values (4494, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/72/180209.jpg', 'The Ring Masters', 37,'Ash and friends are passing through a town where a Sumo Competition is about to be held. Ash, competitive as always, decides to enter the contest with his Snorlax. But will he be able to win without any training in sumo wrestling?',27);
insert into EPISODIO_ENTITY values (4495, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/72/180508.jpg', 'The Poke Spokesman', 38,'On the long trek to Olivine City, our heroes notice Pikachu looks a bit worn out. All of a sudden a man named Simon appears and starts talking to Pikachu in pokemon language! He takes them to his rest stop to heal Pikachu. Officer Jenny shows up and claims that Simon is swindling money from trainers. Ash, Misty, and Brock then set out to prove his innocence.',27);
insert into EPISODIO_ENTITY values (4496, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/72/180512.jpg', 'Control Freak!', 39,'On the way to Olivine City, Brocks Golbat begins to act strangely and flies to a archeological dig site. A girl named Tierra is there using ultrasonic waves to help dig up a special artifact, an ancient gold mask and scepter that once belonged to a queen. Together they have the power to control any Pokemon. Team Rocket hears this and plans to steal it.',27);
insert into EPISODIO_ENTITY values (4497, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/72/180518.jpg', 'The Art of Pokémon', 40,'Ash and friends arrive in a town where a group of Smeargle are constantly painting on everything and everyone. The townspeople have had enough and demand something be done about it. However, after seeing the amazing works they can make, Ash, Misty, and Brock decide to help their trainer, Jack, convince the townspeople that they are not doing anything wrong.',27);
insert into EPISODIO_ENTITY values (4498, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/72/181659.jpg', 'The Heartbreak of Brock', 41,'At the end of a long day, our heroes search for a Pokémon Center in a small town near Olivine City. Unable to locate one they ask a local lady for directions. She explains the nearest Pokémon Center is ten miles away! Too exhausted to extend todays journey, the gang decides to set up camp in a local park. As he gets water from a nearby fountain, Brock notices a Nidorina approaching to take a drink. Running after Nidorina is her trainer, who trips and almost falls into the fountain. She is narrowly saved by Brock and immediately falls head over heals in love with him. Introducing herself as Temacu, she insists Brock and his friends stay with her at her fathers house. They agree, but what will happy when a girl actually loves Brock and will do anything for him?',27);
insert into EPISODIO_ENTITY values (4499, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/72/181660.jpg', 'Current Events', 42,'Ash and friends stop for a rest near a Power Plant. While on a walk, Ash and Chikorita encounter Jigglypuff. They run inside to avoid it, but now they are stuck inside. To make matters worse, they plant is guarded by tons of Electric Pokémon, and Team Rocket is also inside the building. Will they be able to get out?',27);
insert into EPISODIO_ENTITY values (4500, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/73/182752.jpg', 'Turning Over a New Bayleef', 43,'Now that Chikorita has evolved into Bayleef, it is bigger then it once was. However, it has yet to realize how much stronger it has gotten. After tackling Ash a few times, he yells at Bayleef, and it runs away. Everyone goes off in search of her. Meanwhile, Bayleef slips and falls into the river. Our heroes follow the scent, which leads them to an old womans house. Ash is relieved to see Bayleef, but Bayleef wants nothing to do with Ash. Now Ash must prove to Bayleef that he still cares about her, and fend off Team Rocket.',27);
insert into EPISODIO_ENTITY values (4501, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/73/183130.jpg', 'Doin What Comes Natu-rally', 44,'When our heroes stumble upon a one-day street performance, they get to see all types of Pokemon with unique skills. Anxious to know the future, Misty volunteers to have her fortune read by Natu. A young boy named Mackenzie and his Pokemon, Natu begin the reading but make several mistakes. Embarrassed, Mackenzie runs away with Natu before Mistys future is revealed. The gang follows Mackenzie and suggests he wear a mask during his performances to help boost his confidence. Misty explains if he wears the mask no one will know who he is. Mackenzies father likes the idea too, believing the mask will lend an exciting element to the performance. When Mackenzie returns to the stage, will he and Natu be able to remember the routine and use Natus Future Sight to tell patrons fortunes?',27);
insert into EPISODIO_ENTITY values (4502, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/73/183449.jpg', 'The Big Balloon Blow-Up', 45,'When our heroes come across an unusual formation in the middle of a grassy field, Brock believes it is a crop circle placed there by aliens! Just then, something comes hurtling out of the sky towards them. A far away voice calls down an apology for almost hitting Ash with the object. Skyler, a boy training for a hot air balloon race, introduces himself to the gang and explains he was practicing for the upcoming event. Getting a marker as close to the center of the large, circular target by throwing it from the hot air balloon is one aspect of the competition. Intrigued by the hot-air balloon racing circuit, Ash quickly makes up his mind to enter as well. When Brock reminds him they dont have a chance of winning without a hot air balloon, Skylers father says he has something to help them out. Pulling a balloon out of his shop, he begins to fill it up and to our heroes surprise, its a Pikachu shaped hot air balloon! When Team Rocket decides to enter the race as well, Jessie and Jam',27);
insert into EPISODIO_ENTITY values (4503, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/73/183452.jpg', 'The Screen Actors Guilt', 46,'Ash and friends become wrapped up in helping a movie star keep one of his best friends close to him when his manger threatens to pull them apart.',27);
insert into EPISODIO_ENTITY values (4504, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/74/186593.jpg', 'Right On, Rhydon!', 47,'On the way to Olivine City, Ash and friends run into a girl who is trying to build a tunnel threw a mountain, but leaking water is causing her Rock Pokemon to stop digging. In order to finish the tunnel, Ash and friends decide to help her capture a Rhydon that likes water and lives nearby.',27);
insert into EPISODIO_ENTITY values (4505, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/76/190047.jpg', 'The Kecleon Caper', 48,'On the way to Olivine City, a blimp lands in the town that Ash and friends are in. It turns out that there are two sick Pokemon on board and Brock is allowed to treat them. The two pokemon are Kecleon, and after being healed they go on a hiding spree. Not knowing whether or not if they are on the blimp, Ash, Misty, and Brock decide to help find them.',27);
insert into EPISODIO_ENTITY values (4506, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/76/190048.jpg', 'The Joy of Water Pokémon', 49,'40 years in the past, the Legendary Celebi flees through time to escape a poacher, accidentally bringing a young boy named Sammy with it. In present times young Sammy encounters Ash and friends in the same forest. They soon discover Celebi, and when a Team Rocket agent arrives to capture Celebi, they must evade the agent and keep Celebi safe while it recovers from its last encounter. But for how long can they keep it safe, and will Sammy be able to make it back to his own time?',27);
insert into EPISODIO_ENTITY values (4507, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/76/190077.jpg', 'Got Miltank?', 50,'As Ash, Misty, and Brock head to Olivine City, Team Rocket attacks. In the battle, Cyndaquil and Weezings attacks cause an explosion and Cyndaquil is separated from Ash. When Cyndaquil wakes up it is in an oasis with a Miltank. Ash then sets out to find it.',27);
insert into EPISODIO_ENTITY values (4508, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/76/190135.jpg', 'Fight for the Light!', 51,'Ash finally arrives in Olivine City and is ready to battle the Gym Leader. At the Gym a girl named Janina arrives and claims to be the Gym Leader. Ash begins to have his battle with her, until the real Gym Leader, Jasmine appears. She apologizes for Janina, and says that at the moment she can not accept his battle because her Ampharos is sick. They head down to the Lighthouse where Ampharos is in order to help it. However, Team Rocket is planning on capturing the pokemon while it is weak.',27);
insert into EPISODIO_ENTITY values (4509, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/76/190151.jpg', 'Machoke, Machoke Man!', 52,'Ash, Misty, Brock and Janina sail toward Cianwood City. They go to the store to get Ampharos medicine. After say goodbye to Janina, they walk towards the Cianwood Gym. They stop when they see a man battling a Machoke on the beach. It turns out that he is Chuck, the Cianwood Gym Leader. He accepts Ashs request for a battle and they head to the gym. Will Ash be able to win his fifth Johto Badge?',27);
insert into EPISODIO_ENTITY values (4510, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/76/190156.jpg', 'Around the Whirlpool', 1,'In a scuffle with Team Rocket, Ash and friends are thrown from the ship that is brining them to the Whirl Islands. As powerful whirlpools draw them toward impending doom, a mysterious form under the sea shifts the powerful undertow, drawing them to safety. Shortly thereafter, a Corsola comes skipping over the seas surface and guides them back to a ship where their old friend, Professor Elm waits. They ride the ship to a bustling harbor on Blue Point Isle. There they learn about an upcoming competition in which Water Pokemon trainers will battle for the title of Whirl Islands champion. Meanwhile, Team Rocket is planning on attacking the Pokemon Center so they can steal all of the Pokemon there.',27);
insert into EPISODIO_ENTITY values (4511, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/76/190170.jpg', 'Fly Me to the Moon', 2,'Ash and friends discover an island on which the Pidgey population-long protected by environmental regulation and free from predators-has grown to unusually stout proportions and virtually abandoned any desire for flight. There Ash and friends find one Pidgey, however, in which the desire to soar through the heavens burns more fiercely than even in Pidgey from beyond this island. Anxious to see this Pidgey achieve its dreams, the young trainers join with the Pidgeys trainer and follow the Pokemon in a jet-assisted hot air balloon, tracking its flight as the Pidgey climbs higher into the stratosphere.',27);
insert into EPISODIO_ENTITY values (4512, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/76/190983.jpg', 'Takin It on the Chinchou!', 3,'On their way to the Whirl Cup competition, Ash and friends are fortunate enough to pass a small mountain village just as an annual Chinchou migration is about to occur. When both a vicious rainstorm and Team Rocket threaten the travel to the Chinchous breeding grounds, Ash and friends must help Dayton and his father keep all the Chinchou safe.',27);
insert into EPISODIO_ENTITY values (4513, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/91/228105.jpg', 'A Corsola Caper!', 4,'Just as Ash and friends arrive at a new island, they find themselves in the middle of the Corsola frenzy and Misty hopes to catch one of her own.',27);
insert into EPISODIO_ENTITY values (4514, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/91/228109.jpg', 'Mantine Overboard', 5,'While trying to find a ride to Red Rock Isle, Ash and friends meet a girl named Luka. After learning about how she is trying to find a treasure on the bottom of the ocean nearby, Ash and friends decide to join her on her quest',27);
insert into EPISODIO_ENTITY values (4515, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/91/228118.jpg', 'Octillery, the Outcast', 6,'After reaching the town where the preliminary round of the Whirlpool Cup is held, Ash and Misty must help cheer up a young trainers Octillery after its evolution has left it feeling lonely and isolated from its Remoraid companions.',27);
insert into EPISODIO_ENTITY values (4516, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/91/229247.jpg', 'Dueling Heroes', 7,'Ash and Misty make their way to the semi-finals and Ash gets Kingler back for the Whirlpool Cup.',27);
insert into EPISODIO_ENTITY values (4517, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/91/229584.jpg', 'The Perfect Match', 8,'Ash faces off against Misty in the Whirlpool Cup. Who will win?',27);
insert into EPISODIO_ENTITY values (4518, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/91/229587.jpg', 'Plant It Now... Diglett Later', 9,'A village of kind, elderly people requests that Ash and friends help them defend against a gang of marauders that invades every year, attempting to rustle their sizable herd of Diglett.',27);
insert into EPISODIO_ENTITY values (4519, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/92/230471.jpg', 'Hi Ho Silver...Away!', 10,'Ash, Misty and Brock run into a local shopkeeper who introduces them to one of their friends, a jewelry maker who tells them the legend of the fourth Whirl Island.',27);
insert into EPISODIO_ENTITY values (4520, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/92/230487.jpg', 'The Mystery is History', 11,'Ash, Misty, and Brock run into their old friend Richie and his Pikachu, Sparky. They also meet a young boy whose Lanturn has made friends with a baby Lugia.',27);
insert into EPISODIO_ENTITY values (4521, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/140/351233.jpg', 'A Parent Trapped', 12,'With the young Lugia in the possession of Butch and Cassidy, Ash and friends set about rescuing it while protecting its parent from itself. The parent Lugia fights desperately to free its child, playing right into Team Rockets hands. Will Ash and friends be able to save the two Lugia?',27);
insert into EPISODIO_ENTITY values (4522, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/140/351245.jpg', 'A Promise is a Promise', 13,'Ash and the gang, along with Richie, captured by Team Rocket and held at their base. Dr. Number and the other Rockets look upon their capture of the parent Lugia, but they rather use that than the child so they carry that one off.',27);
insert into EPISODIO_ENTITY values (4523, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/140/351924.jpg', 'Throwing in the Noctowl', 14,'Ash and friends have missed the ferry back to Olivine City. An old fisherman tells them that there is a plane service that can get them to Olivine that day. The fisherman turns out to be the one running the plane and they take off for Olivine. Several problems arise along the course of the trip including Team Rocket, Jigglypuff, and broken plane parts.',27);
insert into EPISODIO_ENTITY values (4524, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/140/351925.jpg', 'Nerves of Steelix', 15,'Ash finally battles Jasmine in Olivine City to get his next badge.',27);
insert into EPISODIO_ENTITY values (4525, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/188/471952.jpg', 'Bulbasaur...The Ambassador!', 16,'Professor Oak and Tracey have a problem. The Pokémon in Professor Oaks garden are acting very agressive. Seeing the extremity in this case they call Ash for his Bulbasaur because Bulbasaur took care of and understood wild Pokémon in the past.',27);
insert into EPISODIO_ENTITY values (4526, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/188/471959.jpg', 'Espeon, Not Included', 17,'Ash, Misty, and Brock head back to Ecruteak City where they meet up with Sakura.',27);
insert into EPISODIO_ENTITY values (4527, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/188/472158.jpg', 'For Ho-Oh the Bells Toll!', 18,'When Ash, Misty, and Brock run to investigate a mysterious chorus of bells that spontaneously ring out, they chance to meet their old friend Morty and a Pokémon researcher of his acquaintance. Morty and the researcher discover that the sacred Crystal bells, which are said to ring when a legendary Ho-oh returns, are missing. Since the bells were also used to heal the Bug Pokémon living in that area, these Pokémon lash out against their human neighbors, covering the town with their webs. Ash and friends decide to get to the heart of things and, in the forest, find Team Rocket restrained by webs and hanging from a tree. Ash, Misty, Brock, Morty, and the researcher begin to battle with the Bug Pokémon.',27);
insert into EPISODIO_ENTITY values (4528, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/188/472169.jpg', 'Extreme Pokémon!', 19,'In a racing competition called Extreme Pokémon in which you are pulled by your Pokémon, Ash and Gary face off once again. The prize is a Pokémon egg. With Bayleef racing with Ash and Arcanine with Gary, who will win?',27);
insert into EPISODIO_ENTITY values (4529, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/188/472171.jpg', 'An Egg-Sighting Adventure', 20,'Ash must save his newly won egg from Team Rocket before it hatches.',27);
insert into EPISODIO_ENTITY values (4530, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/188/472174.jpg', 'Hatching a Plan', 21,'Ashs egg hatches into a baby Phanpy. Team Rocket tries to get it on their side by decepting it, but when they trap it with Pikachu, Pikachu explains that Ash is a good trainer and friend.',27);
insert into EPISODIO_ENTITY values (4531, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/188/472175.jpg', 'Dues and Donts!', 22,'Upon realizing that Ash and friends have many more Pokémon than they do, Team Rocket goes on a search for a new Pokémon. They find a Delibird in a cage, free it and capture it. A lady comes out and says that if they athey can prove re members of Team Rocket, they can keep the Delibird. They search through Team Rocket records to find they names arent listed. Will Jessie and James finally get a new Pokémon?',27);
insert into EPISODIO_ENTITY values (4532, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/189/473243.jpg', 'Just Waiting on a Friend', 23,'As they journey towards Mahogany Town, Ash and friends stop in a house for the night. When they arrive, they discover that theres a girl named Lakoko who owns it and a Ninetales. Brock instantly falls in love with her. Strangely, she likes him too. Brock says that he wants to marry her and she agrees that she wants to marry him. He is about to hug her but actually goes through her. Ash and Misty get scared and as they get suspicious, a fog appears and Ninetales Fire Blasts them out of the house. Meanwhile, Team Rocket tries to sneak into the house but they run into some booby traps. Ash and Misty sneak in and find that theres an old picture of Brock in the house. Theres also a diary written by Lakoko that is over 200 years old...',27);
insert into EPISODIO_ENTITY values (4533, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/189/473249.jpg', 'A Tyrogue Full of Trouble', 24,'Ash and friends chance into a Tyrogue, nearly falling victim to a ploy it lays out in an attempt to make off with all of their Pokémon food. Just as they tie things up with the Tyrogue, they learn that it is in fact not wild, but owned by a devoted student of Chuck, the Cianwood Gym leader. This student, who prides himself for his martial arts ability, explains that he is now taking his Tyrogue to an exhaustive tournament in which Fighting type Pokémon vie for the title. Meanwhile, though, he is having a terrible time disciplining his mischievous Pokémon. As if to accent this complaint, an angry local arrives, exclaiming that Tyrogue has wrought havoc in town for the last time.',27);
insert into EPISODIO_ENTITY values (4534, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/189/473250.jpg', 'Xatu the Future', 25,'Ash and friends stumble onto a community which relies on the predictions of Xatus. Ultimately the people learn not to rely on the pokemon that much and the caretaker of the Xatus becomes a weather girl.',27);
insert into EPISODIO_ENTITY values (4535, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/189/473260.jpg', 'Talkin Bout an Evolution', 26,'Heading for Mahogany Town, Pikachu, Togepi and several wild Pokémon seem a little sick. Ash and friends go to the Lake of Rage to find a red Gyarados. Team Rocket comes to battle but theyre beaten with the help of Lance of the Elite Four. Defeated, Team Rocket goes to a Rocket HQ where they meet there Team Rocket members named Shiranui and Tatusumi who are going to try and capture the Red Gyarados. They and other Team Rocket members, not including Jessie, James and Meowth, go on a search for the Gyarados. Lance disguises himself as a Team Rocket member and they capture the Gyarados while Ash and friends watch helplessly. The Gyarados is taken on a truck and Lance is still with them in disguise...',27);
insert into EPISODIO_ENTITY values (4536, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/189/473261.jpg', 'Rage of Innocence', 27,'Since Ash, Misty and Brock are all trapped, Jesse and James decide to take an advantage of the moment to catch Pikachu. They press the wrong button and it frees Ash and the others! Then Lance comes with Dragonite to help Ash. With Dragonite, they destroy Team Rockets evolution inducement ray, and go off to save the red Gyarados. Since the ray was destroyed, the Gyarados becomes stronger and breaks free with Team Rocket. But now, its angry and rampages towards Mahogany Town! Lance had called Officer Jenny to come and arrest Tyson and the Rocket Grunts. Ash and friends go to help the Gyarados, while Lance fights Tysons two Fearows with Dragonite. After winning, Lance goes to help Ash calm down the Gyarados. He eventually captures it. Tyson and the Rocket Grunts are arrested, Lance flies off, and Ash is now in Mahogany Town ready to challenge the gym leader!',27);
insert into EPISODIO_ENTITY values (4537, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/189/473263.jpg', 'As Cold as Pryce', 28,'With the business of the Red Gyarados over, Ash decides to challenge the Gym Leader Pryce but he isnt in town. They find him meditating under a waterfall. Ash battles him with Phanpy and quickly loses. Afterwards, Pryce tells the gang that his most prized Pokémon Piloswine disappeared a long time ago and he needs help finding it. The groupd agrees to help and they set out immediately. Jessie and James are nearby and they decide to steal it. Can Ash and the others find it before Jessie and James do?',27);
insert into EPISODIO_ENTITY values (4538, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/189/473264.jpg', 'Nice Pryce, Baby!', 29,'Having earned Pryces respect and permission to face the trainer in a gym battle, Ash makes the unlikely choice of sending out Cyndaquil, a Fire Pokémon, to face his opponent on an Ice battlefield. Fortunately, Ashs strategy pans out as he leads the gym leader to lower his defenses, allowing Ash to take the first victory in a two-on-two match. Next the gym leader sends out his trusty Piloswine, which immediately unleashes a Blizzard attack that completely alters the battlefield, allowing it to make quick work of Ashs defending Pokémon. With one victory each, the round enters sudden death with each trainer playing his oldest, most reliable Pokémon. A seasoned duo, Ash and Pikachu may match the teamwork of the gym leader and his Piloswine',27);
insert into EPISODIO_ENTITY values (4539, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/189/473471.jpg', 'Whichever Way the Wind Blows', 30,'Our friends find themselves in a meadow with lots off Gloom, Vileplume, Bellossom and Oddish. Steve there new friend tells Ash and Friends that he came to this area so he could do studies on all the Grass-type Pokemon. He also added when the wind blows, the Gloom may evolve into Bellossom (NE winds) or Vileplume (NW winds). Vileplume and Bellossom fight over territory since the very old and large tree covers so much of the land; they both need the sun shine, so over the day they fight for the area not covered in shade. Jesse, and James both get Stun Spored by the Vileplume and Bellossom, So Meowth goes to a convenient store and buys Salvea Weed. A major storm comes in and makes very large amounts of Gloom evolve all at once, but since the wind was coming from the NE and NW, they both were even in numbers in the end. The war broke out and Ash, Misty, Brock, and Steven all knew they had to fight to finally see that fighting does not solve anything. Jesse and James try with help from t',27);
insert into EPISODIO_ENTITY values (4540, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/189/473472.jpg', 'Some Like It Hot!', 31,'Ash, Misty, and Brock encounter a gigantic Magcargo that refuse to step aside and let a traveller pass. When Mistys Water tactics fail to move the stubborn Fire Pokémon, a passing trainer taunts her, declaring that Fire Pokémon, his specialty, are far superior to Water. Their rivalry escalates into a full-on Pokémon battle.',27);
insert into EPISODIO_ENTITY values (4541, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/189/473473.jpg', 'Hocus Pokémon', 32,'Ash, Brock, and Misty meet up with a witch named Lily. She is seeking ingredients to conduct a spell to make humans more friendly with Pokemon. The one last ingredient she needs is tears of an Aipom, and the group fights Team Rocket to get an Aipom. Lily then conducts the spell, turning Ash into a Pikachu!',27);
insert into EPISODIO_ENTITY values (4542, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/189/473478.jpg', 'As Clear as Crystal', 33,'When Pikachu is left exhausted in battle, the gang meets a trainer who guides them to a secret, yet legendary lake that somehow serves to restore energy to the Electric Pokémon that live along its banks.',27);
insert into EPISODIO_ENTITY values (4543, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/189/473484.jpg', 'Same Old Song and Dance', 34,'In the midst of their travels, Ash and friends meet up with a young girl who, along with her two Igglybuff assistants, stars in her own musical variety television program. Our heroes are content to sit back and enjoy the show, but unfortunately Team Rocket has other plans in mind.',27);
insert into EPISODIO_ENTITY values (4544, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/189/473490.jpg', 'Enlighten Up!', 35,'Ash, Misty and Brock stop by a lake where they meet with Team Rocket. As theyre about to battle each other, a Slowpoke with a flag comes and sits on a rock fishing. This lady comes and says the Slowpoke is looking for "enlightment". She offers everyone to take to Slowpoke Temple to learn this. Theres a giant gold statue of a Slowpoke. They go through tests, such as having to concentrate so hard they wont move or else theyll be hit by sticks(!). The next is cleaning the temple, which Ash and Team Rocket compete in. Jesse and James go off to steal the statue, and Meowth distracts Ash by fishing with him. The same Slowpoke is fishing much better than Ash and friends, because the pokemon know they wont be captured. The gold statue is stolen by Jesse and James, but Slowpoke evolves into Slowbro and defeats them. Ash and friends head off, while Team Rocket stay at the temple, this time to truthfully learn enlightment.',27);
insert into EPISODIO_ENTITY values (4545, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/189/473839.jpg', 'Will the Real Oak Please Stand Up?', 36,'Ash, Brock, and Misty, on their adventure to the way to the Johto League, they stop to rest in a small town, and learn that Prof. Oak and Mary are doing an outdoor show in Maroon Town, a nearby town. They go there, and as usual, Team Rocket pop up and they impersonate Prof. Oak and Mary. A standoff to prove the real Prof. Oak is held, and the real Oak was, fortunately, picked, and Team Rocket get foiled.',27);
insert into EPISODIO_ENTITY values (4546, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/189/473841.jpg', 'Wish Upon a Star Shape', 37,'The gang is relaxing in a field when a Cleffa lands on Phanpy, the gang then witness a flying saucer which crashes into a mountain. The Pokemon Myserty Club (PMC, Ken and Mary) appear to get the Cleffa and interrupt Team Rockets plan to capture the Cleffa as well. While both Pokemon escape into the forest, PMC, Rocket and Ash all search for them. Ash, Misty and Brock stumble upon the Clefairy rocket ship which needs to be repaired. As PMC and Rocket fight using their machines, the Clefairy steal their machine parts for repair. As the ship leaves, Cleffa evolves into Clefairy and leaves a sad Phanpy behind. Meanwhile, PMC examine crop circles being created by Snorlax.',27);
insert into EPISODIO_ENTITY values (4547, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/189/473842.jpg', 'Outrageous Fortunes', 38,'On meeting up with a proud Pokémon trainer who dares all comers to face his Poliwrath, Misty and Ash quickly rise to the challenge. Misty, in particular, encourages her Poliwhirl to watch closely as it may someday evolve into a Poliwrath. As is often the case, the battle isnt long over before this challenger and Ash and Misty have become fast friends. Meanwhile, Team Rocket, having furtively observed this battle and been convinced that the Poliwrath is a match even for Pikachu, decide to first capture it and then use it to capture Pikachu. Unfortunately, this logic does not hold as they find capturing a Pokemon stronger than Pikachu even more difficult than simply capturing Pikachu. A surprise is in store for Misty, as her Poliwhirl evolves not into a Poliwrath, but into another Pokemon altogether.',27);
insert into EPISODIO_ENTITY values (4548, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/189/473957.jpg', 'One Trick Phony', 39,'After defeating a girl who has a Smoochum, Ash is determined to beat Clair, as he is getting close to Blackthorn City. Seeing that Ash just cant get enough battling, the trainer suggests as she leaves that he give a local Pokémon battle park a try.',27);
insert into EPISODIO_ENTITY values (4549, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/189/473968.jpg', 'I Politoed Ya So!', 40,'When Ash, Misty, and Brock pause for a picnic by a lake, Politoed wanders off and is mistaken by another trainer for her own Politoed.',27);
insert into EPISODIO_ENTITY values (4550, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/189/473973.jpg', 'The Ice Cave', 41,'As they continue on their journey, Ash and co go through the Ice Cave, a shortcut to Blackthorn City. But when they slip, they fall into a hole. Why is there a hole? Team Rocket, of course.',27);
insert into EPISODIO_ENTITY values (4551, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/189/473982.jpg', 'Beauty is Skin Deep', 42,'Finally reaching the outskirts of Blackthorn City, Ash pushes to quickly seek out the gym where he hopes to earn his final Johto badge. Before he has the opportunity, he chances into a Dratini and learns that its eager trainer, Clair, is in fact the Blackthorn Gym leader.',27);
insert into EPISODIO_ENTITY values (4552, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/189/473989.jpg', 'Fangs for Nothin!', 43,'Team Rocket steals the Dragon Fang as Ash begins his battle for the final Johto badge with Clair. Then TR gets Dragonite on their side to help them escape.',27);
insert into EPISODIO_ENTITY values (4553, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/189/473996.jpg', 'Great Bowls of Fire!', 44,'Ashs Charizard flys in and lands on Ash. Liza also lands in on Charla who is in love with Charizard. Rocket find a bowl in a Dragon Shrine which upsets Dragonite and causes a fire in a field. So Ash, Liza and Clair set to put out the fire to save wild Pokemon.After the fire is put out, TR is greatful that they were saved from the fire. Dragonite is under an attack rage and starts attacking Clair, Ash and the gang. This leads to a battle between Dragonair and Charizard versus Dragonite which ends his attack rage.',27);
insert into EPISODIO_ENTITY values (4554, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/189/474006.jpg', 'Better Eight Than Never', 45,'Ashs battle with Claire begins right away and Ash uses Snorlax, Pikachu and Charizard. Meanwhile, Team Rocket dig underground to get back the Dragon Fang but end up meeting Charla. Ash wins his 8th gym badge and is allowed to enter the Johto League as Leeza, Charla and Ashs Charizard fly off.',27);
insert into EPISODIO_ENTITY values (4555, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/190/476977.jpg', 'Why? Wynaut!', 46,'Ash plans to go to Newbarktown to register for the Johto Silver Conference now that he has all 8 badges even though the Silver Conference is in 3 months. Team Rocket has plans of their own, they decide to steal Ashs badges for money or to enter the Conference themselves.',27);
insert into EPISODIO_ENTITY values (4556, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/190/476979.jpg', 'Just Add Water', 47,'On the road back to New Bark Town, Ash and friends stop for a rest near the ocean. There they spot a sign advertising a synchronized Pokémon swimming event. Close behind is Team Rocket, who quickly hatch a plan to steal all of the Pokémon from the swimming show.',27);
insert into EPISODIO_ENTITY values (4557, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/190/477269.jpg', 'Lapras of Luxury', 48,'Ash and friends return to New Bark Town, but before Ash is able to register for the Johto League Championship, Professor Elm sends him on an errand to retrieve a Pokémon egg from a nearby marine Pokémon laboratory. At the laboratory, Ash and friends meet up with a young researcher who uses the supersonic waves from a Lanturn to detect the singing voices of traveling Lapras.',27);
insert into EPISODIO_ENTITY values (4558, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/190/477277.jpg', 'Hatch Me If You Can', 49,'Ash receives an egg from Prof. Elm, and as the egg hatches into a Larvitar, Ash must help the shy pokemon find its parents. Unfortunately, Team Rocket has their eye on this rare pokemon.',27);
insert into EPISODIO_ENTITY values (4559, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/190/477343.jpg', 'Entei at Your Own Risk', 50,'On their way to Mount Silver, the gang come across a hot spring and meet Nelson who is looking for an Entei. Ash, Misty and Brock decide to release their Pokemon for them to enjoy the hot springs and hot sand. Team Rocket appear pretending to be researchers in order to steal Larvitar. After escaping from Rockets truck, Nelson and his Misdreavous meet Ash again.Nelson wants to battle Ash, so Ash sends out Phanpy first.',27);
insert into EPISODIO_ENTITY values (4560, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/191/477655.jpg', 'A Crowning Achievement', 51,'Brock leads Ash and Misty toward a beautiful lake he has read about in his guidebook, but when they arrive at its supposed location, they find nothing but a dried-up stream, surrounded by a number of thirsty Slowpoke. Ash and friends spot a Sumo Crown, but are stopped from approaching it by a young girl and her Slowpoke. The girl explains that she and her Slowpoke are researching legends surrounding the Slowpoke and a supposed Slowking.',27);
insert into EPISODIO_ENTITY values (4561, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/191/477664.jpg', 'Heres Looking at You, Elekid', 52,'While the gang looks for Larvitars mother, they run into Casey, to see that her Bayleef has evolved into Meganium. It seems that Casey is after a wild Elekid who is a very good tricker. The group decides to help her find it. Meanwhile, James trades his Victreebell for a Weppinbell and it evolves.',27);
insert into EPISODIO_ENTITY values (4562, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/191/477674.jpg', 'Youre a Star, Larvitar!', 53,'Ash and friends reach the base of Mount Silver, where they hope to return their Larvitar to its birthplace. On their way, Ash faces a young trainer in Pokémon battle, pitting his Cyndaquil against the trainers Magby. After the battle, Ash has thoughts about trying to make his Cyndaquil evovle. Following behind, Jessie and James note the trainers and their rare and valuable Pokémon preparing to battle in the Johto Championship. Setting aside their usual plans for capturing Pikachu-they capture Larvitar and many other Pokémon.',27);
insert into EPISODIO_ENTITY values (4563, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/191/477679.jpg', 'Address Unknown!', 54,'Having finally reached amount Silver, Ash and friends stop momentarily when they discover a lost Unown on their path. Spotting these two rare Pokemon together, Team Rocket decides to kidnap both of them. When this Unown is attacked, however, a defensive instinct leads it to teleport itself into another dimension. Unfortunately, Ash and friends are also caught up in this interdimensional escape.',27);
insert into EPISODIO_ENTITY values (4564, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/191/477697.jpg', 'Mother of All Battles', 55,'After many days of travel, Ash and friends finally reach the area where their Larvitar was born. They soon encounter a Tyranitar that they recognize from Larvitars visions to be its mother. Unfortunately, this Tyranitar mistakes them for the poachers that had stolen her child. Our heroes struggle to convince the mother Tyranitar of their good intentions, but to no avail. Things only get worse when the actual poachers arrive, intent on capturing not only the child, but its mother as well.',27);
insert into EPISODIO_ENTITY values (4565, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/191/477703.jpg', 'Pop Goes the Sneasel', 56,'Ash and friends offer to help the Silver Conference Officials retrieve the Ho-Oh Flame from atop a mountain shrine. However, a Sneasel and its buddies Machop and Machoke are guarding the shrine. They also meet another trainer, from the Hoenn Region, named Harrison. Harrison vowes to catch the Sneasel. Will he succeed and will they get the Flame?',27);
insert into EPISODIO_ENTITY values (4566, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/191/477708.jpg', 'A Claim to Flame!', 57,'Gary and Ash meet up again.',27);
insert into EPISODIO_ENTITY values (4567, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/191/477722.jpg', 'Love, Pokémon Style', 58,'Ashs Squirtle makes an appearance.',27);
insert into EPISODIO_ENTITY values (4568, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/191/477738.jpg', 'Tie One On!', 59,'Ash calls on Bulbasaur for his next battle against a trainer named Jackson, who is well known for having a powerful Meganium and a Shiny Magneton.',27);
insert into EPISODIO_ENTITY values (4569, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/191/477746.jpg', 'The Ties That Bind', 60,'Ash is about to take on his long time rival, Gary Oak, in the next battle of the Johto League Silver Conference, and hes determined to do everything he can to win. He stays up all night researching strategies and trying to learn more about Garys Pokémon. Gary has a lot of strong Pokémon, and he trains many different types, so Ash has to pick his team carefully. Gary starts out with Nidoqueen, and Ash uses Tauros. Gary wins the first round, but Ash takes the second. Its going to be a very close match! In round three, its Ashs Heracross versus Garys Blastoise.',27);
insert into EPISODIO_ENTITY values (4570, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/191/477747.jpg', 'Cant Beat the Heat!', 61,'Our hero is in the middle of the first match of the championship tournament at the Johto League Silver Conference. His opponent is his long time rival – Gary Oak. Each trainer is down one Pokémon, with five to go. Garys Blastoise is very strong and knocks out Ashs Heracross.',27);
insert into EPISODIO_ENTITY values (4571, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/191/477876.jpg', 'Playing with Fire', 62,'Ash is battling Harrison from Hoenn at the Johto League Silver Conference. Pikachu is very excited to be battling. Its a close match the whole way through, but one by one Harrison knocks out Totodile, Snorlax, and Noctowl. Ash cleverly guides Bayleef through a rough battle with Harrisons Houndoom.',27);
insert into EPISODIO_ENTITY values (4572, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/191/477878.jpg', 'Johto Photo Finish', 63,'Our hero is at the end of a tough battle with Harrison at the Johto League Silver Conference. The winner of this battle will go on to the semi-finals. Each trainer has battled hard and is down to their last Pokémon. Ash is using Charizard. Harrison is also using a high level fire type called Blaziken.',27);
insert into EPISODIO_ENTITY values (4573, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/191/477880.jpg', 'Gotta Catch Ya Later!', 64,'With the Johto League Silver Conference behind them, Ash, Brock and Misty head back to Viridian City to relax. Their vacation is cut short when Misty receives an urgent call beckoning her back to Cerulean City to run the gym while her sisters cruise the world. Brock, too, realizes that has things he has to do. After a teary goodbye, Ash returns home to Pallet Town – but soon grows restless for adventure. When his former rival Gary takes off on a new journey, leaving behind all of his Pokémon except Blastoise, Ash starts thinking about his next journey.',27);
insert into EPISODIO_ENTITY values (4574, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/191/477881.jpg', 'Hoenn Alone!', 65,'Ash has left all of his Pokémon behind in Pallet Town – except Pikachu – and boarded a ship bound for Littleroot Town in Hoenn. Unfortunately, Team Rocket is on board as well, and theyre cooking up a scheme to catch Pikachu once and for all. They nab Pikachu and hop off the boat just as it pulls into a port.',27);
insert into EPISODIO_ENTITY values (4575, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/191/478443.jpg', 'Get the Show on the Road!', 1,'In the land of Hoenn, a girl named May travels to Prof. Birchs lab. She is attacked by a wild ghost pokemon called Duskull. Scared, but unharmed, she travels on her bike to the lab in Littleroot Town.',27);
insert into EPISODIO_ENTITY values (4576, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/191/478444.jpg', 'A Ruin with a View', 2,'Ash is ready to head to Oldale Town to sign up for the Hoenn League. May has offered to show Ash the way in exchange for his company to Oldale Town - which is only fair, seeing as Pikachu destroyed Mays bike when it was sick! In Oldale Town, May visits her first Pokémon Center and is amazed with all of its services, and by the ancient ruins next door.',27);
insert into EPISODIO_ENTITY values (4577, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/191/478445.jpg', 'Theres No Place Like Hoenn', 3,'Ash and May have made it all the way to Petalburg City â€" the first city with a gym. Ash is very excited to take on the gym leader. May seems a little uneasy â€" perhaps its because she hasnt yet told Ash that her father, Norman, is the gym leader in Petalburg!',27);
insert into EPISODIO_ENTITY values (4578, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/191/478446.jpg', 'You Never Can Taillow', 4,'Ash, May, and Max are strolling through the Petalburg forest on hopes of seeing new pokemon and adventures. May suggest that they should stop for a quick lunch break but Max on the otherhand think that they should continue to find pokemon in the forest.',27);
insert into EPISODIO_ENTITY values (4579, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/191/478447.jpg', 'In the Knicker of Time!', 5,'Brock is ready to travel again and has joined up with Ash, May and Max as the journey on towards Rustboro City. In the forest they encounter a giant Zigzagoon, which they soon realize is actually a trainer in a Zigzagoon suit. Nicolai the Knickerbocker is a trainer that believes in becoming one with Pokémon in order to understand them. While battling, he wears a costume of whichever Pokémon he is using. When not dressed as a Pokémon, he wears knickers in order to be closer to nature.',27);
insert into EPISODIO_ENTITY values (4580, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/191/478448.jpg', 'A Poached Ego!', 6,'Our heroes are headed for Rustboro City, where Ash hopes to have his first real gym battle in Hoenn. Team Rocket is making their way along the same path when they stumble upon a cage full of Ekans.',27);
insert into EPISODIO_ENTITY values (4581, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/191/478449.jpg', 'Trees a Crowd', 7,'Deep in the woods, Ash spies a Treecko. Hes wanted to catch a Treecko since he first saw one at Professor Birchs laboratory. He follows the Treecko to an enormous tree that seems to be dying. There, Ashs Treecko has an argument with all of the other Treecko.',27);
insert into EPISODIO_ENTITY values (4582, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/191/478450.jpg', 'A Tail with a Twist', 8,'Ashs newly caught Treecko may be a bit standoff-ish, but the little green Pokémon is quite a fighter. When Team Rocket sees Treecko knocked down and hurt by a Seviper, they decide that they must have that Seviper. Jessie is very impressed with its "sneaky, snakey ways."',27);
insert into EPISODIO_ENTITY values (4583, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/191/478451.jpg', 'Taming of the Shroomish', 9,'Ash, May, Brock and Max have arrived at a small city on their way to Rustboro City. Brock decides to stock up on supplies, while Max is eager to go hunting for city dwelling Pokémon. Max soon stumbles upon a very frightened Shroomish who is hiding in an alleyway. Ash, Max, Pikachu and their new Shroomish friend head off to find a Pokémon Center.',27);
insert into EPISODIO_ENTITY values (4584, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/191/478452.jpg', 'You Said a Mouthful!', 10,'En route to Rustboro City, Ash and the gang pass by an unofficial gym boasting the worlds most powerful Pokémon. Even though he cant win a badge there, Ash is intrigued and decides to battle the trainer named Anthony and this mysterious Pokémon.',27);
insert into EPISODIO_ENTITY values (4585, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/203/507997.jpg', 'A Bite to Remember', 11,'As our heroes travel on towards Rustboro City, they stumble into a forest filled with many different kinds of Pokémon. It turns out that the area is actually a Pokémon preserve, and its looked after by a girl named Katrina. Katrina takes care of all of the Pokémon in the area and helps to nurse them back to health when they are sick. Max takes a particular liking to her Poochyena and hes determined to see it evolve before they leave the preserve.',27);
insert into EPISODIO_ENTITY values (4586, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620335.jpg', 'The Lotad Lowdown', 12,'Ash and friends are relaxing in a lake when they come across a group of Lotad. The Lotad help a group of three sisters grow flowers and berries for their shop. The runt of the Lotad litter is having trouble, though, and Brock gives it some advice and encouragement. Natalie, the youngest sister, develops a crush on Brock and runs off to find a Sitrus Berry to give him. Brock and company arrive just in time to save her from a wild Beedrill. But just then, Team Rocket sets out to catch all of the Lotad in the lake. Pikachu joins forces with the lake dwellers to stop Team Rocket, and afterward, the littlest Lotad decides to join Brock as his Pokémon!',27);
insert into EPISODIO_ENTITY values (4587, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620336.jpg', 'All Things Bright and Beautifly!', 13,'Ash and friends come across their first Pokémon Contest! These competitions, hosted all over the Hoenn region, focus on the beauty of Pokémon attacks--style and technique count just as much as power! May and Max assist Janet, a Pokémon Coordinator with a beautiful Beautifly. Meanwhile, Janets friend Chaz helps Ash teach Pikachu to use Iron Tail, a Steel-type attack that may come in handy for his upcoming battle at the Rustboro Gym, which specializes in Rock-type Pokémon. Jessie, in disguise, enters Seviper in the Pokémon Contest. But its a complete disaster, because Seviper doesnt know any showy attacks. Janet and Beautifly win the contest, but Team Rocket cuts in and tries to steal the finalists Pokémon. Ash, May, Janet, and Chaz fight them off. May is amazed by the beauty of Pokémon, and it seems like she has found her calling.',27);
insert into EPISODIO_ENTITY values (4588, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620337.jpg', 'All in a Days Wurmple', 14,'While the gang is walking through a forest May sees a Wurmple. After Ash scanned it with his Pokédex and they learn from Max that it can evolve into Beautifly, May decides to capture it and separates from the group. Meanwhile, Jessie wants to capture some Wurmple too, to give them to Giovanni and to use the others for winning contests. After a while, Team Rocket attacks May to catch the Wurmple that she saw when a boy named Franklin, who is a ranger, helps her. At the same time, Ash has a double battle against another ranger also named Franklin who is identical to the other one. Whats the truth behind the two Franklins? Will Jessie and May be able to catch a Wurmple?',27);
insert into EPISODIO_ENTITY values (4589, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620338.jpg', 'Gonna Rule the School!', 15,'Ash and friends arrive at Rustboro City where he gets silly with souvenirs. Max then notices a Poliwag hiding and soon the gang meets Roxanne, teacher of the Pokémon Training School and Rustboro Gym Leader. Will Ash get his first Gym Battle in Hoenn, and what of May? And how can Max fair against the school bully?',27);
insert into EPISODIO_ENTITY values (4590, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620339.jpg', 'The Winner by a Nosepass', 16,'The time has come! After mastering Pikachus Iron Tail, Ash is ready for his Gym Battle with Roxanne. But before the battle begins, May tells Roxanne she will not be participating in Gym Battles and instead focus on Contests. Roxanne supports Mays decision and wishes her the best of luck. With that set aside the Battle has begun. Will Ash manage to win on his first try, or will this end up like his first Gym Battle back in Pewter City all over again?',27);
insert into EPISODIO_ENTITY values (4591, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620340.jpg', 'Stairway to Devon', 17,'After winning the Stone Badge from Roxanne, Ash and co. head out to the next gym, located on Dewford Island. However, Max spills a drink on Mays PokéNav and rather than suffer her wrath, Max tries to find a quick solution. He sees an old man demonstrating new inventions but before he can go further, a younger man picks him up in a limo. Who is this old man, and can he help Max fix the PokéNav before May finds out its broken?',27);
insert into EPISODIO_ENTITY values (4592, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620341.jpg', 'On a Wingull and a Prayer!', 18,'May may be the new Misty but she is not as smart as she was. And she proves this when she, Ash, Brock and Max head to a pasta restaurant that May read up on the internet. The thing was May forgot to check the date and found that the place was closed. The date was exactly the same day, exactly the same month, ten years ago. Things go from bad to worse when they find the pier on the other side of town.May tries to find help and finds a kind sailor by the name of Mr. Briney. But when she returned with her friends, his personality changed for the worse. Could May have goofed up again? Or is someone else pulling Mr. Brineys strings?',27);
insert into EPISODIO_ENTITY values (4593, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620342.jpg', 'Sharpedo Attack!', 19,'After the incident with the Team Aqua agent and with Peeko safely returned to Mr. Briney, Ash and co set sail for Dewford Island. All is not calm on the way there however as a school of Sharpedo suddenly attack Mr. Brineys boat. Not to mention tear up a part of Mays new swimsuit. Now how will Ash and co. get to Dewford with all the Sharpedo in the way? Is this going to be like "Jaws" all over again?',27);
insert into EPISODIO_ENTITY values (4594, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620343.jpg', 'Brave the Wave', 20,'After a night at the Pokémon center, Ash is stoked to have another Gym Battle. He meets the Gym Leader Brawly, who would rather surf than battle, which infuriates Ash. Could there be more to this Gym Leader than meets the eye? And does May even have a shred of decency?',27);
insert into EPISODIO_ENTITY values (4595, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620344.jpg', 'Which Wurmples Which?', 21,'After being beaten by Brawly, Ash decides to do some serious training of one thing he lacks: patience. He does this by practicing the fine art of Fishing. He, along with May, Max and Brock, accidentally hook Team Rockets Magikarp submarine and after a fierce battle, May notices something different about her Wurmple: it is actually Jessies. Can the heroes find Mays Wurmple before Team Rocket figures it out?',27);
insert into EPISODIO_ENTITY values (4596, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620345.jpg', 'A Hole Lotta Trouble', 22,'While exploring Dewford Island, Ash and friends notice a large cave and Max states that its Granite Cave. They all enter and soon they fall into a pit trap courtesy of Team Rocket. Unfortunately they fall in as well and the two groups are mixed and separated. This time around, there are three groups: Males being Ash, Brock and James. Females being May and Jessie and the rest being Max, Pikachu and Meowth. Can these groups be brought back to order and who is in Granite Cave along with our heroes and villains?',27);
insert into EPISODIO_ENTITY values (4597, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620346.jpg', 'Gone Corphishin', 23,'A mysterious Pokémon is terrorizing Dewford Towns beach. Ash and friends set many traps for the terror and discover its identity, Corphish. Will Ash and his friends be able is capture the feisty Water-type Pokémon, or will it set them out to dry?',27);
insert into EPISODIO_ENTITY values (4598, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620347.jpg', 'A Corphish Out of Water', 24,'With a new Pokémon in tow, Ash continues his training to prepare for his rematch with Brawly. However, though caught, Corphish is still a ruffian as it introduced itself by whacking all the other Pokémon on the head. Can it ever be more social with other Pokémon, and why is Jessies Silcoon purple right after it evolved?',27);
insert into EPISODIO_ENTITY values (4599, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620348.jpg', 'A Mudkip Mission!', 25,'Get ready for a new episode of Mays Expedition as she, Ash, Max and Brock stumble upon a swamp. There they find the swamp full on Mudkip and their caretaker, an elderly man named Old Man Swamp (or Mr. Swampy) who has the same whiskers as a Mudkips fins. He explains that he gets Mudkip eggs from the Hoenn League and when they hatch they wait till their old enough to give to Professor Birch. But Team Rocket also has plans for the Mudkip. What evil will they have in store for them, and will Brock get a new friend?',27);
insert into EPISODIO_ENTITY values (4600, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620349.jpg', 'Turning Over a Nuzleaf', 26,'While Ash preps up for his rematch with Brawly, Corphish pinches the ears of a Loudred, causing it to scream. Corphish, along with Pikachu, Silcoon, Torchic, Lotad and Mudkip get lost and soon they encounter a tribe of Nuzleaf. Can Ash and co. find their Pokémon before its too late?',27);
insert into EPISODIO_ENTITY values (4601, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620594.jpg', 'A Three Team Scheme!', 27,'As Ash continues his training, he, May, Max and Brock encounter Prof. Birch. Meanwhile, a boys Nincada was captured by Team Rocket and it digs a hole to a temple. There they encounter the commanders of the teams they encountered before: Team Magmas Harland and Team Aquas Isabel. How will this clash of Aqua vs. Magma go down, and can Ash and co. help the boy save his Nincada?',27);
insert into EPISODIO_ENTITY values (4602, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620596.jpg', 'Seeing is Believing!', 28,'After the ordeal in the last episode, Ash and co. continue training and are joined by Prof. Birch. May is so happy that her Silcoon will soon evolve. Elsewhere Jessie is still in denial of the fact that her "Silcoon" is really a Cascoon. After a fierce battle, Silcoon evolves into Beautifly and blows away Team Rocket with a Gust attack. How will Jessie get her "Silcoon" to evolve and how will she take it if it doesnt evolve into what she wanted?',27);
insert into EPISODIO_ENTITY values (4603, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620597.jpg', 'Ready, Willing and Sableye', 29,'Corphishs bad attitude is showing no signs of improving so Ash plans to humble it a bit by putting a good scare into it deep inside an abandoned mine. Later on, Team Rocket discovers an abandoned gold mine and goes in. Can Ash and co. brave this mine in order to be well prepared for his rematch with Brawly?',27);
insert into EPISODIO_ENTITY values (4604, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620599.jpg', 'A Meditite Fight!', 30,'As Ash prepares for his rematch with Brawly, he, May, Max and Brock meet a Battle Girl by the name of Shauna, whose reason for battling was to prove she was better than Ash. During their battle Brock noticed that while Ashs training was paying off Shauna battled like Ash used to. Just as the match was about to be decided Brawly appears with some mondo bad news: A hurricane was approaching which could wipe out the beach. Can our heroes manage to weather the storm, and why is Shauna so nervous around Brawly?',27);
insert into EPISODIO_ENTITY values (4605, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620600.jpg', 'Just One of the Geysers', 31,'It is time for Ash to have his rematch with Brawly. He decides to shake things up a little by using his new Corphish instead of Taillow on a new battlefield. With all the training Ash had to do up to this point, does he have what it takes to beat Brawly, or will he wipe out again and be all for nothing?',27);
insert into EPISODIO_ENTITY values (4606, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620601.jpg', 'Abandon Ship!', 32,'Ash and friends foil a Team Rocket kidnapping scheme on the high seas, but are then left high and dry themselves when Team Rockets boat breaks down. Drifting with the tide, they eventually come to rest against an abandoned ship. On board, they meet one of the ships original passengers, Tommy, who has returned to search for the Marshtomp he was separated from when the ship first ran aground. Happy to have found a ride back to land, Ash and friends offer to help this passenger in his search.',27);
insert into EPISODIO_ENTITY values (4607, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620602.jpg', 'Now Thats Flower Power!', 33,'After arriving to Slateport City, May begins her training for the Contest. However, just as she and Beautifly have some good results, a boy named Drew appears and starts belittling May. May does not give up and has a battle with Ash. Despite losing, a man named Mr. Big appears and teaches May about Contests. He takes them to the shop, where he finds Mays Torchic had eaten his Bluk Berry, which is to be used in tonights firework event. In order to make amends, May goes with her friends in search for the berry.',27);
insert into EPISODIO_ENTITY values (4608, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620603.jpg', 'Having a Wailord of a Time', 34,'Impressed at how well they had raised their own Pokémon, Nurse Joy enlists Ash and Max to babysit the Treecko, Torchic and Mudkip awaiting a Pokémon trainer whos just about to begin her journey. Torchic proves to be rambunctious of the group, and when Ash sends several of his Pokémon to gently coax it into obedience, he inadvertently causes the troublesome Pokémon evolve into a Combusken.',27);
insert into EPISODIO_ENTITY values (4609, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620604.jpg', 'Win, Lose or Drew!', 35,'Ash and the others arrive in Slateport City, where May can compete in her first Contest. Also competing is Mays new rival, Drew, and a young man named Robert who uses a Milotic.',27);
insert into EPISODIO_ENTITY values (4610, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620606.jpg', 'The Spheal of Approval', 36,'While Brock and May go shopping, Ash and Max go to the museum, only to find it closed. Max attempts to go in, but is caught by a boy, who claims they are thieves. Just then, Captain Stern arrives and the confusion is settled. While Ash and Max visit the exhibition, the members of Team Magma try to infiltrate the museum to steal Captain Sterns stone he recently acquired.',27);
insert into EPISODIO_ENTITY values (4611, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620607.jpg', 'Jump for Joy!', 37,'While cutting through a mountain pass, Ash and friends decide to stop into the local Pokémon Center for directions. Imagine their surprise when they discover it vacated, with no sign of Nurse Joy. The plot thickens when they take it upon themselves to investigate and discover security camera footage of a Shiftry immobilizing Nurse Joy with Stun Spore before carrying her off. Their only clue as to her location is a mysterious entry on Shiftry in the Pokédex, indicating that these Pokémon inhabit only trees that are over a thousand years old.',27);
insert into EPISODIO_ENTITY values (4612, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620608.jpg', 'A Different Kind of Misty', 38,'Continuing their journey to Mauville City, Ash and co. are starting to get lost by heavy fog. After Team Rocket got taken care of, they notice a lighthouse in the distance by two people and how does it work?',27);
insert into EPISODIO_ENTITY values (4613, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620610.jpg', 'A Poké-BLOCK Party', 39,'As Ash and co are a mere stone throw away from Mauville City, they soon notice a poster for the House of Tricks. Anyone who navigates this wacky maze will receive a grand prize of a years supply of Pokéblock. Along the way, May meets a cute Jigglypuff, but Ash and Brock remember it all too well. Can anyone listen to its song all the way through?',27);
insert into EPISODIO_ENTITY values (4614, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620611.jpg', 'Watts with Wattson', 40,'The time has come, once again. Ash was super psyched to have another Gym Battle. This time, it was with the elderly, yet hilarious, Wattson. The battle was short as Ashs Pikachu took out Wattsons entire team with just one hit each. Devastated, Wattson gave Ash the Dynamo Badge. Will Wattson recover from this, and what has happened to Pikachu?',27);
insert into EPISODIO_ENTITY values (4615, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620612.jpg', 'What You Seed is What You Get', 1,'After earning the Dynamo Badge from Wattson, Ash and co. continue their journey. May insists to go to Fallarbor Town while Ash suggests they go to Lavaridge Town. Max suggests they go to both and Brock decides the order. During the trip, they notice some watermelons float down by the river and have some lunch. Ash then comes up with an idea: Teach Treecko to use Bullet Seed like the Shiftry that attacked them a while back, and as practice, they try it by spitting watermelon seeds. Can Treecko learn to master this move, and who do the watermelons belong too?',27);
insert into EPISODIO_ENTITY values (4616, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620613.jpg', 'Love at First Flight', 2,'The pair then bow to one another, as dance partners would, and begin flying around one another in a wide circle. Brock identifies them for what they are (Volbeat and Illumise), prompting May and Ash to pull out their Pokédexes: Mays identifies Illumise, and Ashs Volbeat. The two Firefly Pokémon are still dancing about. While watching, a Nurse Joy greets the group, asking of they are here for the May Festival, for the dance performance of Illumise and Volbeat. She notes that it is almost time for the practice runs, and indicated two people standing out on the lakes pier, saying they are Volbeat and Illumises Trainers, Romeo and Juliet.',27);
insert into EPISODIO_ENTITY values (4617, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620615.jpg', 'Let Bagons Be Bagons', 3,'On the way to Fallarbor Town and Mays next contest, Ash and co encounter a rare Bagon and its trainer, a girl named Michelle, who is trying hard to make Bagons dream of flying high come true. So Ash challenges her to a battle to get it to evolve faster. Will his plan work? And what could Team Rocket do with a Bagon anyway?',27);
insert into EPISODIO_ENTITY values (4618, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620616.jpg', 'The Princess and the Togepi', 4,'Ash and co reunite with their old friend Misty, who is happy to meet May and Max for the first time. Soon, they enter a kingdom dedicated to Togepi and soon meet Sara, princess of the Togepi Kingdom. Team Rocket also teams up with Colonel Hansen, who wants to rule the kingdom with an iron fist. What will happen to Togepi now, and has Max learned a way how to keep Brock from flirting with pretty girls?',27);
insert into EPISODIO_ENTITY values (4619, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620618.jpg', 'A Togepi Mirage!', 5,'During the reunion with their old friend Misty, Ash and co. discover Hansen wants to rule the Togepi Kingdom and the Mirage Kingdom. Can they be able to stop him, and will Misty say good-bye to the Pokémon she cared for so long?',27);
insert into EPISODIO_ENTITY values (4620, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620619.jpg', 'Candid Camerupt!', 6,'Being exhausted and tired, the heroes collapse in a desert. Soon, they wake up in a lodge, being rescued by the Winstrate family. The heroes ask what could they repay for the familys kindness. The family decides to battle Ash, May, Max and Brock, in honor of their eldest son, Vito, who is watching the battle and wondering what to do, since he gave up on his dream to become the Champion of Hoenn League.',27);
insert into EPISODIO_ENTITY values (4621, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620620.jpg', 'I Feel Skitty!', 7,'While doing her training with Beautifly, Mays frisbee flies off. Torchic goes away and finds the frisbee, but also finds a Skitty, who seems to be ill. May is amused by Skittys cuteness and goes with her friends to a laboratory, where Skitty would recover through aromatherapy. Team Rocket plans on stealing the fragrances, but Meowth finds Skitty and falls in love with her. The heroes try to get the fragrances back, while Meowth starts wondering what hell do with Skitty.',27);
insert into EPISODIO_ENTITY values (4622, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620621.jpg', 'ZigZag Zangoose!', 8,'Traveling on the road, the heroes encounter Nicholai, who had caught a Zangoose. While having a battle with Ash, Nicholai notices Zangoose is acting strange. Just then, Team Rocket appears, whose Seviper starts battling Zangoose and injures it. Due to Zangoose being Sevipers natural enemy, Ash decides to help Nicholai in training, to let Zangoose defeat Seviper.',27);
insert into EPISODIO_ENTITY values (4623, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620623.jpg', 'Maxxed Out!', 9,'Max meets up with another Pokémon enthusiast who goes by the same name, but despite their shared interests and shared name, the two get off to a rocky start. As they continue to bicker, Team Rocket launches a surprise attack, separating May, Max, and this new Max--the youngest and least experienced Pokémon trainers--from their friends. Without Ash and Brock to protect them, these children nonetheless work to find their new acquaintances missing Surskit before Team Rocket does.',27);
insert into EPISODIO_ENTITY values (4624, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620624.jpg', 'Pros and Con Artists', 10,'After arriving to Fallarbor Town, May starts doubting herself, seeing a lot of Coordinators that will participate, including Drew. However, the heroes meet Grace, a Coordinator, who gives May advice on the performances. May starts wondering what to do and tries to find an answer.',27);
insert into EPISODIO_ENTITY values (4625, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620625.jpg', 'Come What May!', 11,'May reaches the second round of the Contest and defeats Jessica (who is Jessie, in disguise). Seeing Grace had managed to defeat her rival, Drew, May wonders if she could defeat Grace. During the battle, however, May displays new tricks she learned from Grace.',27);
insert into EPISODIO_ENTITY values (4626, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620626.jpg', 'Cheer Pressure', 12,'The heroes encounter the boy they helped at the lighthouse, named Thatcher, who joined a band of cheerleaders, named Pep Squad. Team Rocket decides to ally themselves with the Pep Squads leader, Sheridan, who gives them an advantage during their battle with Ash and Brock. However, Max starts having suspicions and goes to check out what is coming from the drums the squad is playing.',27);
insert into EPISODIO_ENTITY values (4627, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620627.jpg', 'Game Winning Assist', 13,'After running away from some Slugma, the heroes find themselves on a ranch, owned by a girl named Julie. The heroes decide to spend some time at the ranch, while Julie offers a battle with Mays Skitty, who got them in the trouble with the Slugma. Team Rocket attempts to steal the ranchs Numel and ends up capturing May and Skitty. To get out, May has to awaken Numel and has an idea with Skittys Assist attack.',27);
insert into EPISODIO_ENTITY values (4628, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620628.jpg', 'Fight for the Meteorite', 14,'The heroes (and Team Rocket, who hope to catch their enemy, Pikachu) take a cable cart to Mount Chimney. However, the cart suddenly stops and without any technical help, Ash climbs to Mount Chimney to find some help. Instead, he finds Professor Cozmo, who tries to hide the meteorite from Team Magma, who want to use it for ill purposes. Ash and Professor Cozmo make a plan to stop Team Magmas plan and set it into action.',27);
insert into EPISODIO_ENTITY values (4629, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620629.jpg', 'Poetry Commotion!', 15,'After Ash and Co. reach Lavaridge Town, they meet Flannery, the Gym Leader. Having just inherited the Gym from her grandfather and determined to prove her abilities, she is just as eager as Ash to battle, but the Gyms battlefield is full of holes and therefore cannot be used. Deciding to help, the gang are hard at work filling the holes. Meanwhile, Team Rocket are standing by ready to snatch one of Flannerys Pokémon, a Torkoal that they can give to their boss.',27);
insert into EPISODIO_ENTITY values (4630, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620631.jpg', 'Going, Going, Yawn', 16,'Ash challenges Flannery to a Gym match. Ash hopes to have an easy fight by using Corphish. Flannery, despite sometimes acting a bit nervous, manages to display some clever moves to thwart Ashs tactics and sends Torkoal, who switches offense and defense, pushing Ash to his limits.',27);
insert into EPISODIO_ENTITY values (4631, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620632.jpg', 'Going for a Spinda', 17,'Deciding to go back to Petalburg City, the heroes encounter a woman named Claire, who had lost her heart-marked Spinda. The heroes decide to help Claire and her butler, Royce, in finding Spinda. Team Rocket tries to intervene and both sides chase Spinda to a mountain top, a place which Claire recognizes.',27);
insert into EPISODIO_ENTITY values (4632, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620633.jpg', 'All Torkoal, No Play', 18,'On their way back to Mauville City, Ash and friends travel through the Valley of Steel, home of many different kinds of Steel Pokémon and a potential shortcut to Mauville City and then Petalburg City. On their way through, they come across a Torkoal being attacked by several Steel Pokémon. After using Pikachu to scare the Pokémon away, the Fire-type hears a noise, also scaring it off. Later, having reunited with Torkoal, Ash and friends become determined to help Torkoal defeat the Steelix that lords over the valley. Will they succeed in cutting through the valley unharmed or will the angry Steel-type block their way?',27);
insert into EPISODIO_ENTITY values (4633, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620634.jpg', 'Manectric Charge', 19,'After returning to Mauville City, the gang decide to visit Wattson at his Gym. However, when neither he or Watt are there, the group goes exploring and come across a carnival run by Team Rocket. Just as Team Rocket succeed in stealing the gangs Pokémon, Wattson and Watt appears and rescues the Pokémon from their evil clutches. After the crooks got blasted off, Wattsons Electrike evolves into Manectric. With everything taken care of, Ash challenges Wattson to a battle against his newly captured Torkoal.',27);
insert into EPISODIO_ENTITY values (4634, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620637.jpg', 'Delcatty Got Your Tongue', 20,'After a battle with Team Rocket, Mays Skitty accidentally inhales Torkoals smoke. To cure her, the heroes go to a Pokémon Clinic, ran by Dr. Abby. Abby, who manages to cure Skitty, is recognized by May as the Top Coordinator. Abby confirms this and even gives May some tips for Skitty before the Verdanturf Towns Contest. Team Rocket, however, plans on stealing Jonny, Dr. Abbys Delcatty.',27);
insert into EPISODIO_ENTITY values (4635, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620641.jpg', 'Disaster of Disguise', 21,'As the heroes arrive to Verdanturf Town, they meet up with Drew, who cannot participate in the upcoming Contest, since his Roselia has been defeated by the Phantom and his Dusclops. May is surprised and decides to train for the Contest. Just then, the Phantom appears, so Ash challenges him to a battle. However, a woman arrives and starts chasing the Phantom, but fails. In order to find more about the Phantom, the woman requests the heroes to unmask his identity.',27);
insert into EPISODIO_ENTITY values (4636, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620642.jpg', 'Disguise Da Limit', 22,'With Timmy participating in the Contest, May hopes to win her second ribbon. However, with Mays Skittys Blizzard not working properly, May starts worrying. Timmy, however, gets visited by his own mother, who watches her sons successes.',27);
insert into EPISODIO_ENTITY values (4637, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620643.jpg', 'Take the Lombre Home', 23,'The heroes, who are thirsty, wander the land. Brock shows them a spring, but it ran out of water. They go to the village, but find it deserted. Just as Lotad falls in a well and gets risen up, it evolves into a Lombre. Much to the heroes surprise, the villagers start coming out of their houses and pray to Lombre and start cursing a Solrock, believing it is the reason for the local drought. In order to prove them wrong, the heroes decide to investigate.',27);
insert into EPISODIO_ENTITY values (4638, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620644.jpg', 'True Blue Swablu', 24,'The heroes, who got lost in a forest, encounter a Swablu, who has its wing injured. Along with the help of a local ranger, Morita, May spends time with Swablu, who recovers and heals its wing. However, due to its trauma, Swablu cannot fly, so the heroes try certain ways to teach Swablu how to fly once more.',27);
insert into EPISODIO_ENTITY values (4639, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620645.jpg', 'Gulpin It Down', 25,'During their break, the heroes get their lunch eaten by a Gulpin. They soon find out a group of Gulpin is eating away the food supplies in the city. They contact Nurse Joy and Officer Jenny, who receive help from Professor Jacuzzi, who decides to stop the Gulpin. After driving off the Gulpin, the professor uses a machine to launch Gulpin away. However, the machine malfunctions and oversizes Gulpin and Ashs Treecko, who battled the former.',27);
insert into EPISODIO_ENTITY values (4640, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620646.jpg', 'Exploud and Clear', 26,'As Ash has trouble dealing with Treecko, who ignores everyone, a Loudred appears and starts trouble. Its trainer, Guy, manages to subdue it and to solve their problems, Ash challenges Guy to a battle, where both Loudred and Treecko evolve.',27);
insert into EPISODIO_ENTITY values (4641, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620647.jpg', 'Go Go Ludicolo!', 27,'While having sandwiches for lunch, the heroes are visited by a man named Poncho and his Ludicolo. They challenge Ash to a battle, who bets his sandwiches with Poncho, who is to buy cheeseburgers if Poncho loses. Corphish volunteers for the battle, but it seems distracted and eventually loses. This infuriates Corphish even more, who runs off while the heroes try to find out why Corphish is angry.',27);
insert into EPISODIO_ENTITY values (4642, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620648.jpg', 'A Double Dilemma', 28,'As the heroes arrive to Petalburg City, May and Max are visited by the crowd, who like Norman, Caroline and their children. While Max and May are dealing with the crowd and Ash battles a lot of trainers to prove he is worthy to challenge Norman, Team Rocket decides to disguise themselves to take profit from the situation.',27);
insert into EPISODIO_ENTITY values (4643, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620649.jpg', 'Love, Petalburg Style!', 29,'Just as the heroes return to Petalburg City, Ash goes to the Pokémon Center to get ready for his Gym match, where he encounters Norman talking with Nurse Joy. Back home, May and Max, along with Brock, meet up with Kenny, who reports trouble. Caroline, Normans wife, greets them as well, but something troubles her as well. Deciding enough is enough, Caroline goes with her children, as well as Kenny and Brock, to face Norman, who is hiding something. Ash, however, is at the greenhouse with Normans Pokémon and faces Team Rocket, who wants to steal them.',27);
insert into EPISODIO_ENTITY values (4644, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620650.jpg', 'Balance of Power', 30,'Ash faces Norman in a Gym battle. Norman switches offense and defense to baffle Ash, who tries to overcome this trial, having his Pokémon use abilities in the battle. After the battle, however, Max becomes upset over something.',27);
insert into EPISODIO_ENTITY values (4645, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620651.jpg', 'A Six Pack Attack!', 31,'The heroes decide to stop at Professor Birchs lab. Hearing Professor Oak will come to the lab as well, Ash and Brock decide to accompany Birch to escort Oak to the lab. However, Professor Oak arrives by a cart and greets May and Max, the latter being a big fan of his. Once Team Rocket steals Birch and Oaks Pokémon, May, Max and Professor Oak decide to go after them and rescue the Pokémon on their own.',27);
insert into EPISODIO_ENTITY values (4646, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620652.jpg', 'The Bicker the Better', 32,'Due to May being late, Ash gets outraged, since he wants to go to Fortree City as quickly as possible. May becomes angry as well and soon, Ash and May are challenged by a couple named Oscar and Andi. Even during the battle, Ash and May bicker at each other, causing them to lose. Team Rocket gets challenged as well, causing Jessie and James to annoy each other. Just as they meet up with the twerps, James sides with Ash and Jessie with May to have another Tag Battle, which displeases Brock, Max and Meowth who wants the feud to end.',27);
insert into EPISODIO_ENTITY values (4647, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620653.jpg', 'Grass Hysteria!', 33,'The heroes get lost in a forest. Just then, May gets taken away by a Skarmory. As Ash, Brock and Max try to get May out of the forbidden area, May befriends a Bulbasaur, but the Grass-type Pokémon start attacking her.',27);
insert into EPISODIO_ENTITY values (4648, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620656.jpg', 'Hokey Pokéballs', 34,'With Bulbasaur being in Mays team, Ash decides to call his own Bulbasaur to meet up. However, Team Rocket has modified the transporting machine, causing them to obtain the Poké Balls that are being transported. While Team Rocket blasts off during the battle, they manage to steal the Poké Balls. Fortunately, Ashs Bulbasaur returns and teams up with Mays Bulbasaur to find Team Rocket.',27);
insert into EPISODIO_ENTITY values (4649, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620658.jpg', 'Whiscash and Ash', 35,'While resting by a lake with his friends, Ash polishes his Badge Case and remembers all the Gym Battles hes won so far. Suddenly, a wild Whiscash jumps out and eats the case. Ash dives in to go after it to get his badges back, but nearly drowns. He is saved by a Fishing Master named Sullivan who has spent years trying to catch the giant Whiscash. Determined to retrieve the badges, Ash and the others start fishing. Meanwhile, Team Rocket are also trying to get a hold of the same Whiscash.',27);
insert into EPISODIO_ENTITY values (4650, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620659.jpg', 'Me, Myself and Time', 36,'While separated from his friends, Ash encounters a girl and her Baltoy. He learns they were called to meet someone at a set of ruins, and her Baltoy is a key.',27);
insert into EPISODIO_ENTITY values (4651, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620660.jpg', 'A Fan with a Plan', 37,'Arriving in Rubello Town, May finds Drew, who is going to participate in the Contest. She also meets Savannah, a wife, who is going to participate in the Contest. However, Savannah becomes nervous and asks for Mays help, who is decides to use Bulbasaur, even if she didnt train it much. Since she cant compete without a ribbon, Jessie plans on stealing some.',27);
insert into EPISODIO_ENTITY values (4652, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620662.jpg', 'Cruisin for a Losin', 38,'May, confident in her Pokémon, enters the Contest with Drew and Savannah. While all three manage to pass the first round, Mays Bulbasaur becomes nervous, which shakes Mays victory. May tries to get Bulbasaur to battle, but this does not impress the judges.',27);
insert into EPISODIO_ENTITY values (4653, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620664.jpg', 'Pearls Are a Spoinks Best Friend', 39,'Continuing their journey to Fortree City, Ash and friends come across a Spoink, who is upset after losing the Pearl it keeps on the top of its head. After Spoink tries to put on a couple of round Pokémon on its head, the Pearl is found. However, during a Team Rocket encounter, they steal the Pearl. After coming across a fair, James is approached by the same Magikarp Salesman who has made his life miserable in the past and offers to trade Feebas for the Pearl. After discovering Feebas evolves into Milotic, Team Rocket agree. However, when they let their new Feebas out to have a swim in a nearby river, they discover the Feebas is just a Magikarp painted with a Feebas colors, meaning they have been swindled yet again. After Ash and the others find out what happened, they have to get Spoinks Pearl back by finding the Magikarp Salesman before Team Rocket do.',27);
insert into EPISODIO_ENTITY values (4654, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620665.jpg', 'Thats Just Swellow', 40,'As they arrive to Crossgate Town, the heroes learn there is a tournament involving flying Pokémon. May, Ash and, surprisingly, James, enter the competition. Just as James and Ash advance to next rounds, Jessie and Meowth decide to make another attempt at stealing Pokémon.',27);
insert into EPISODIO_ENTITY values (4655, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620666.jpg', 'Take This House and Shuppet', 41,'The heroes and Team Rocket, after another clash, have gone to the mansion. There, May argues with Max, who runs off and meets a Shuppet. Due to his fight with his sister, Max decides to play a prank on her, Ash and Brock with Shuppet. However, Team Rocket arrives and stirs trouble.',27);
insert into EPISODIO_ENTITY values (4656, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620667.jpg', 'A Shroomish Skirmish', 42,'As the heroes have a meal, Torchic and Corphish start fighting. As Ash and May try to calm them down, Team Rocket arrives, and so do the Breloom, from whom the stole the apples. The Breloom attack and blast everyone away, causing everyone to get separated. Max, Meowth, Torchic and Corphish try to find others and come to dead end, where they face Breloom once more. Corphish decides to protect Torchic, who gathers all of its bravery to attack.',27);
insert into EPISODIO_ENTITY values (4657, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620668.jpg', 'Unfair-Weather Friends', 43,'The heroes spend a day at the Weather Research Institute. Just then, Team Aqua, with Shelly as the commander, arrive to gather information about the Legendary Pokémon. The heroes make a plan to protect the data, but an unexpected betrayal is among the scientists.',27);
insert into EPISODIO_ENTITY values (4658, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620670.jpg', 'Whos Flying Now?', 44,'After the events that transpired at the Weather Station, Ash and co. finally arrive at Fortree City. Ash couldnt wait to challenge the Gym Leader, unfortunately the Gym Leader is helping with the Feather Carnival. Later they meet the Gym Leader, Winona, who scheduled in Ashs request for a Gym Battle, but in the meantime they should have some fun. Meanwhile, Team Rocket has plans of their own. What sinister plot are they up to this time, and why does the carnival bring back such bad memories for James?',27);
insert into EPISODIO_ENTITY values (4659, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620672.jpg', 'Sky High Gym Battle!', 45,'The time has come once more. Ash is ready with his Gym Battle with Winona. Before the battle starts she evokes a prayer to all Flying Pokémon to give her strength. And now the battle begins. Will Ash fly high in the sky or will he crash and burn?',27);
insert into EPISODIO_ENTITY values (4660, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620673.jpg', 'Lights, Camerupt, Action!', 46,'As the heroes continue onwards, they encounter a man pushing his Camerupt. After helping the man, the heroes are told the man, named Elijah, goes around villages and shows movies. The heroes decide to accompany them, while Team Rocket plans on stealing his equipment.',27);
insert into EPISODIO_ENTITY values (4661, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620675.jpg', 'Crazy as a Lunatone', 47,'The heroes arrive in a deserted town and get rejected by Nurse Joy to stay in her Pokémon Center. They soon find out the PMC, Ken and Mary, whom Ash and Brock encountered in Johto, are here after a mysterious Pokémon. Arriving in the Pokémon Center, the heroes encounter Team Rocket, as well as the mysterious Pokémon, Lunatone. They soon find out Lunatone is weak and can be restored if it sees moonlight beams. While the heroes go to the place to heal Lunatone, they encounter the PMC guys again.',27);
insert into EPISODIO_ENTITY values (4662, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620677.jpg', 'The Garden of Eatin', 48,'The heroes come into the Banana Slakoth Garden, a famous tourist spot. However, they find it empty, save for a Snorlax, who is eating away the bananas. Marcel asks for their help and the heroes accept it. However, when they face Snorlax, it uses Yawn, putting everyone to sleep. To battle against such a foe, the heroes speak with Professor Oak, who shares some tips.',27);
insert into EPISODIO_ENTITY values (4663, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620678.jpg', 'A Scare to Remember', 49,'After another encounter with Team Rocket, Ash loses Pikachu. Pikachu, however, has hit his head and suffers from amnesia and is found by Meowth. Meowth takes the opportunity and states Pikachu was one of Team Rocket members. Pikachu starts believing and once Ash comes to him, Pikachu turns his back on him. Ash, however, does not give up to get Pikachu back, and his memories.',27);
insert into EPISODIO_ENTITY values (4664, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620680.jpg', 'Pokeblock, Stock, and Berry', 50,'As they arrive to Lilycove City, the heroes meet Kelly, a fellow Coordinator, who knows how to make good Pokéblocks. As Max stays with Ash, who wants to teach Swellow Aerial Ace, Brock is with May, who wants to learn more about Pokéblocks from Kelly.',27);
insert into EPISODIO_ENTITY values (4665, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620681.jpg', 'Lessons in Lilycove', 51,'Mays Combusken manages to control the Fire Spin attack it launched. Through luck, May enters the next round with Kelly and fights Josaphine. In the final round, Kelly battles May, who has a tactic to overcome Grumpigs psychic powers. Just as Grumpig and Combusken are to fall down, May makes an honorable gesture. Meanwhile, Ash misses the contest to help his Swellow learn Aerial Ace.',27);
insert into EPISODIO_ENTITY values (4666, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/620682.jpg', 'Judgement Day!', 52,'Due to a mistake, the heroes sail away to an island, with their actual destination being Mossdeep City. On the island, they find Jimmy, who trains to become a judge. With teacher Serenas help, Jimmy tries to be the referee of a Double Battle of Ash vs. Brock. After the battle, Jimmy recalls his past before he has to rescue his Pokémon, who were stolen by Team Rocket.',27);
insert into EPISODIO_ENTITY values (4667, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621053.jpg', 'Clamperl of Wisdom', 1,'While heading to Mossdeep City, Ash and co. notice a life preserver belonging to the Spoink they met before. The reunion is cut short as Spoinks pearl goes missing again. It lands up on an island and Ash and co. try to find Spoinks pearl. Will they find it... again, and how is it possible that a Spoink can balance a Wailmer on its head?',27);
insert into EPISODIO_ENTITY values (4668, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621055.jpg', 'The Relicanth Really Can', 2,'The heroes encounter a man named Adam whos searching for treasure. They decide to accompany him to find an old ship, which is told to have lots of treasure on it. Just as they take the submarine down, they also encounter Team Rocket, who is also determined to take the treasure, which is connected to the Relicanth Adam saw earlier.',27);
insert into EPISODIO_ENTITY values (4669, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621056.jpg', 'The Evolutionary War', 3,'The heroes come to the A-B-C Islands, where they meet up with Professor Birch. The Professor wants to study more about Clamperls evolutions, Huntail and Gorebyss. They also accompany two children, who are angry at each other, for they want to evolve Clamperl that goes against their principles. Birch, however, finds something that can settle the trouble, and give Team Rocket a new opportunity at stealing Pokémon.',27);
insert into EPISODIO_ENTITY values (4670, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621058.jpg', 'Training Wrecks', 4,'Since they have to wait for the boat to Mossdeep City, the heroes spend some time with other trainers, who want to get physically fit for the battles. While Brock, May, Max, even Team Rocket exercise, Ash has a Double Battle with the coach, Rocky, who shows how much his Pokémon can be in sync.',27);
insert into EPISODIO_ENTITY values (4671, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621059.jpg', 'Gaining Groudon', 5,'Due to a twist of fate, the heroes get captured by Team Magma and face their leader, Maxie. After Maxie explained his goals, Team Aquas Shelly frees Kyogre and reports to her leader. In a moment of confusion, Pikachu takes the Blue Orb, which gets absorbed into him. Just as the heroes try to escape, Ash gets captured, while Team Aquas leader starts controlling Kyogre. However, an unexpected help arrives, a man whom Ash and Brock have met before.',27);
insert into EPISODIO_ENTITY values (4672, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621061.jpg', 'The Scuffle of Legends', 6,'Team Aqua has gained control over Kyogre and prepares to unleash its powers over the worlds water levels. A Blue Orb possessed Pikachu releases Groudon from its entrapment and the two prepare to take on Kyogre in a battle to end all battles. Will Groudon and Kyogre destroy the world with their legendary battle or will Lance, Ash and his friends be able to stop the worlds imminent destruction?',27);
insert into EPISODIO_ENTITY values (4673, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621063.jpg', 'Its Still Rocket Roll to Me', 7,'The heroes arrive to Mossdeep City, but learn the Gym Leader Ash wants to battle is at the Mossdeep Research Center. Once they arrive there, the heroes met up with Tate and Liza, who just had a battle. Learning these two are duo of Gym Leaders, Ash is surprised he has to fight them in a Double Battle. While spending some more time at the space center, Max and Tate go to a space shuttle, only to encounter Team Rocket, who wants to steal the space shuttle.',27);
insert into EPISODIO_ENTITY values (4674, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621064.jpg', 'Solid as a Solrock', 8,'Once again, the time has come. Ash will have a double battle against the terrific twins, Tate and Liza. As the battle begins he sees they dont get along very well and the battle could be an easy win for him, that is until Team Rocket interferes and snatches Lunatone and Solrock. After thwarting their latest plot Rachel suggest that Ash and Liza and Tate continue their battle, even though the Gym is destroyed they could have it on the cliff. As the rematch begins Liza and Tate are more in-sync than ever. Will Ash be able to beat them this time? The answer might shock you.',27);
insert into EPISODIO_ENTITY values (4675, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621065.jpg', 'Vanity Affair', 9,'After battling a trainer, Ash, as well as his friends, meet Drake of the Elite Four. Drake is impressed by Ashs skills and invites the heroes to his boat, where Ash will have the battle with him. Just as everyone sees Drake doesnt do much, the latter makes his counterattack and shows Ash where he went wrong.',27);
insert into EPISODIO_ENTITY values (4676, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621067.jpg', 'Wheres Armaldo?', 10,'Arriving on an island, Max encounters a Cradily, an ancient Pokémon that is supposed to be extinct. His friends do not believe him, so Max goes away to search for it and finds a building. Ash, May and Brock eventually find a woman and are surprised to see the Cradily Max spoke about. They go to the lab, where they also find an Anorith, which evolves into an Armaldo. Team Rocket barges in and after failing to catch Armaldo, Armaldo goes on a rampage.',27);
insert into EPISODIO_ENTITY values (4677, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621068.jpg', 'A Cacturne for the Worse', 11,'As the heroes sail to Mays next Contest, May finds a boy named Harley. She speaks to him a bit and meets his Cacturne and eats his cookies. Harley is annoyed at the girl, who becomes his rival that he wants to crush. During the Contest, Harley gives May some false advice, which May accepts, only to find out Harley tricked her. Just as she faces Harley, he uses another trick up his sleeve to deceive May even more, wanting her to be defeated.',27);
insert into EPISODIO_ENTITY values (4678, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621069.jpg', 'Claydol Big and Tall', 12,'Continuing their journey across Izabe Island, Ash and friends run into an old man who tells them the legend of the giant Claydol. When Team Rocket hears the legend, they unleash the Claydol thats going on a rampage.',27);
insert into EPISODIO_ENTITY values (4679, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621070.jpg', 'Once in a Mawile', 13,'While on their journey across Izabe Island, Ash and his friends meet a girl named Samantha, who performs her ribbon dance in various towns, and her Mawile, who develops a crush on Brocks Lombre. In the next town, Team Rocket takes Mawile, but ends up taking Lombre by mistake. Now Ash and his friends must save Lombre and Samanthas show.',27);
insert into EPISODIO_ENTITY values (4680, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621071.jpg', 'Beg, Burrow and Steal', 14,'While traveling on Izabe Island, Ash and his friends end up above a Trapinch Labyrinth. They meet up with two people named Elisa and Hal, two of the reserve rangers. After a Team Rocket encounter, they all end up inside of the labyrinth. Will they find a way to get out of this situation?',27);
insert into EPISODIO_ENTITY values (4681, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621072.jpg', 'Absol-ute Disaster', 15,'Still traveling towards Sootopolis City, Ash and friends arrive in a town where the people hate Absol. They blame Absol for all of the troubles that have in their small town. Ash and friends decide to help a kid named Nicky find his missing brother Gordon, who went to solve the mystery of the appearing Absol, as well as try to solve the mystery of the Pokémon themselves.',27);
insert into EPISODIO_ENTITY values (4682, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621073.jpg', 'Let It Snow, Let It Snow, Let It Snorunt', 16,'Still heading for Cerosi Town and the ferry to Sootopolis City, Ash and his friends stop at a Pokémon Center to stay warm as a blizzard approaches. At the Center, a wild Snorunt steals all 7 of Ashs Badges. Will he be able to get them back or will he have to train all over again?',27);
insert into EPISODIO_ENTITY values (4683, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621074.jpg', 'Do I Hear a Ralts?', 17,'Continuing towards Izabe Island, Max finds a sick Ralts. Brock is unable to fully cure it and they must bring it to the Pokémon Center. However, Team Rocket wants to capture the Ralts. Ash, May, and Brock battle Team Rocket while Max rushes to the Pokémon Center as quick as can. However, he must get there before it is too late, and has to deal with Team Rocket again and also Kirlia and Gardevoir.',27);
insert into EPISODIO_ENTITY values (4684, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621075.jpg', 'The Great Eight Fate!', 18,'The final battle is approaching, Gym Battle that is. Ash and co. arrive in Sootopolis City, home of Ashs final Gym Battle. There they met Juan, who is not only the Gym Leader but a Grand Festival winner as well. Does Ash have what it takes to beat an accomplished trainer like Juan?',27);
insert into EPISODIO_ENTITY values (4685, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621076.jpg', 'Eight Aint Enough', 19,'The final battle for Ashs final badge continues as he has managed to beat Juans Sealeo and Seaking. Now he must contend with the rest of his Pokémon, like Luvdisc who used Sweet Kiss to confuse Grovyle. With three Pokémon left against Juans three, will Ash be able to win his final badge or will he be washed away with the tide?',27);
insert into EPISODIO_ENTITY values (4686, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621077.jpg', 'Showdown at Linoone', 20,'While waiting to eat lunch in the woods, a Linoone comes by and steals two of Mays Poké Balls. They find out that the Linoone belongs to a boy named Kimmy. Kimmy helps the heroes get the Poké Balls back before Team Rocket gets a hold of them and Linoone.',27);
insert into EPISODIO_ENTITY values (4687, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621078.jpg', 'Who, What, Where, When, Wynaut?', 21,'On the way to Pacifidlog Town, Ash and his friends run into Drew. May challenges him to a practice battle, but they get interrupted by Team Rocket. However, Team Rockets sub gets sucked into a whirlpool and everybody winds up getting separated on the mysterious Mirage Island. Now, Ash, Max, and Brock must find Drew and May.',27);
insert into EPISODIO_ENTITY values (4688, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621079.jpg', 'Date Expectations', 22,'On their way to Pacifidlog Town, the boat Ash and his friends are riding breaks down, forcing them to make a pit stop on Donto Island. It is currently the Donphan mating season, which they end up being separated from each other. May now has to make the ultimate decision: stay to find Max and miss the final contest before the Grand Festival, or leave alone for Pacifidlog Island trusting that Ash will find Max and come to the Contest for the next morning.',27);
insert into EPISODIO_ENTITY values (4689, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621080.jpg', 'Mean with Envy', 23,'After showing up in Pacifidlog Town, May prepares for the upcoming Contest, the one that shes determine to get her final Ribbon to qualify into the Grand Festival. When Skitty chases after an Aipom, May runs into two Coordinators named Joshua and Erika, who are entering the Contest as well. May and Erika dont get along to a good start. At the contest, May, Joshua, Erika, and the Jester (Jessie in another disguise) all make it to the next round.',27);
insert into EPISODIO_ENTITY values (4690, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621081.jpg', 'Pacifidlog Jam', 24,'With qualifying for the Grand Festival hanging on the line, May is more determined then ever to win the contest to win her final Ribbon. First, Erika faces Jessie and Meowth and the latte somehow uses Transform. When the judges find out the truth, they get disqualified. Then May faces off against Joshua and after some battles, she pulls off a win. Erika finally apologizes to May and together the two have a great battle. After a lucky Fire Spin from Assist, May and Skitty won and the former qualifies for the Grand Festival.',27);
insert into EPISODIO_ENTITY values (4691, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621082.jpg', 'Berry, Berry Interesting', 25,'On their way to the Grand Festival, the gang stops at an island filled with berries. May decides to make Pokéblocks, but no one except a wild Munchlax likes it. When Munchlax is blamed of eating everyones Pokéblocks, May decides to prove them wrong and capture Munchlax.',27);
insert into EPISODIO_ENTITY values (4692, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621083.jpg', 'Less is Morrison', 26,'As Ash is training, he faces a new rival, Morrison, who tries to challenge Ash in any way possible. After having a number of challenges, Ashs Pikachu and Morrisons Beldum get captured. In order to rescue them, Morrison and Ash team up to battle Team Rocket by themselves.',27);
insert into EPISODIO_ENTITY values (4693, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621085.jpg', 'The Ribbon Cup Caper!', 27,'While taking a boat to Slateport City, the heroes encounter Officer Jenny, who warns them of Brodie, an ex-Team Magma member, who came to steal an object of great importance.',27);
insert into EPISODIO_ENTITY values (4694, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621086.jpg', 'Hi Ho Silver Wind!', 28,'The heroes arrive to Slateport City, where they meet up with Mays mother, Caroline, as well as her rivals, Drew and Harley. Harley, despite his past incidents, tries to bond with May, suggesting she should have only Beautifly use Silver Wind. May, unaware of Harleys true motives, starts to take liking to this idea. Suddenly, the group hears that Norman is in town, too, and go to check that out.',27);
insert into EPISODIO_ENTITY values (4695, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621088.jpg', 'Deceit and Assist', 29,'May continues to take Harleys advice as she advances in the tournament. Drew, however, has his suspicions about Harley and continues to monitor him. Meanwhile, Ash and Max join forces with Officer Jenny to help a Coordinator, Anthony, whose ribbons and contest pass have been stolen.',27);
insert into EPISODIO_ENTITY values (4696, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621089.jpg', 'Rhaspody in Drew', 30,'May faces Harley, her dreadful rival, who aims to take revenge on her. However, May has collected a lot of experience from his previous battles, and uses her tactics to counter Harley. As she wins this battle, she ends up facing her other rival, Drew, in the quarterfinals. Much to her surprise, he sends out a Pokémon he trained just for the Grand Festival.',27);
insert into EPISODIO_ENTITY values (4697, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621276.jpg', 'Island Time', 31,'Tricked into another of Team Rockets schemes, the heroes are stranded on an island. They encounter Robin, a former salesman, who was saved by a Wailmer. Like the heroes, Robin, too, wishes to get off the island, but due to the constant whirlpools, he is barred from doing so. With the inevitable teamwork between the heroes and the villains, Team Rocket plan on another sabotage to catch the ship everyone is building and snatch the Pokémon at it.',27);
insert into EPISODIO_ENTITY values (4698, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621277.jpg', 'Like a Meowth to a Flame', 32,'The heroes arrive to Ever Grande City, the site of the Hoenn League. On Mays request, they go around town for a noodle shop, but end up getting assaulted by a group of Murkrow. In that moment, a Meowth, wearing a hat and boots, attacks the Murkrow and disperses them. Its trainer, Tyson, greets the group, and adds that he is also a participant of the League. Moreover, he is also a torchbearer of the Moltres flame, which Team Rocket intend on stealing.',27);
insert into EPISODIO_ENTITY values (4699, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621278.jpg', 'Saved by the Beldum', 33,'Its the Preliminaries in the Hoenn League. Ash is facing some tough battles against Fighting type Pokémon. Morrison is up against electric types and Tyson on the other hand has his own tough battles when his Meowth must battle an opponents Persian. Will the 3 Rivals get through the league?',27);
insert into EPISODIO_ENTITY values (4700, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621279.jpg', 'From Brags to Riches', 34,'The Hoenn League has come and Ash has managed to get through to the proper league. His new rival Morrison has also progressed this far and must win a battle against a Marowak &amp; Machamp. Ash meanwhile has to go through a tough battle against a Tropius &amp; a Swalot with his Corphish &amp; Torkoal. Will Ash manage to get through to the next round of the finals?',27);
insert into EPISODIO_ENTITY values (4701, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621280.jpg', 'Shocks and Bonds', 35,'Further into the Hoenn League Finals, Ash is about to have one of his toughest battles. Another Double Battle against a Charizard and a Quilava...both Fire types while using Glalie &amp; Grovyle giving Ash a clear Disadvantage. Will Ash manage to beat these hot fire Pokémon or will he end up burned?',27);
insert into EPISODIO_ENTITY values (4702, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621281.jpg', 'A Judgment Brawl', 36,'Continuing the full battle from the previous episode, Katie has seemingly backed Ash into a corner and now has four Pokémon remaining to Ashs three. Fortunately, after the intermission and the field change, Ash gains momentum and pulls ahead, eventually winning the battle. Unfortunately, he finds out that his next opponent is his buddy Morrison. Ash simply wants them both to give it their all, but Morrison is reluctant about battling a friend and this holds him back in their battle, to Ashs frustration. Will Morrison snap out of it and give Ash the good battle that they both want?',27);
insert into EPISODIO_ENTITY values (4703, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621282.jpg', 'Choose It or Lose It!', 37,'Ashs battle with Morrison continues on...but Morrison seems apathetic to the battle and not wanting to battle Ash properly, he starts losing. Ash manages to convince him to battle properly and so the fierce battle properly begins. Who will win? Ash or Morrison?',27);
insert into EPISODIO_ENTITY values (4704, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621283.jpg', 'At the End of the Fray', 38,'In his quest to become the Hoenn League Champion, Ash must battle Tyson, one of his newest friends. However when the battle begins Ash finds it one of the toughest battles of his time. Will Ash win?',27);
insert into EPISODIO_ENTITY values (4705, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621284.jpg', 'The Scheme Team', 39,'On his way home to Pallet Town after saying goodbye to his friends, Ash meets Scott, Leader of the Battle Frontier. After losing to the one of the Elite Four named Agatha, Scott tells Ash about the Battle Frontier. The latter agrees to take the challenge but first he must deal with Team Rocket and return to Pallet Town. After coming home, Ash meets up with his old traveling friend Misty.',27);
insert into EPISODIO_ENTITY values (4706, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621285.jpg', 'The Right Place and the Right Mime', 40,'Finally Back in Pallet meeting with Misty, Tracey, May, Max &amp; Professor Birch, Ash reunites with his old Pokémon. After spending some time with his old friends, Ash discovers that Team Rocket have another plan to try and steal the Pokémon. Can they be stopped?',27);
insert into EPISODIO_ENTITY values (4707, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621286.jpg', 'A Real Cleffa-Hanger', 41,'Heading to the Battle Factory near Cerulean City, Ash &amp; Co. go through Mt. Moon, however they meet a Cleffa who seems to dislike humans and due to a Team Rocket plot the group ends up being seperated through Mt. Moon. Will they manage to get together and earn the trust of the Cleffa?',27);
insert into EPISODIO_ENTITY values (4708, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621287.jpg', 'Numero Uno Articuno', 42,'Finally at the Battle Factory, Ash meets with the Frontier Brain, Noland. Ash is eager to begin his Battle Frontier challenge and challenges him. However Team Rocket have their eyes set on Nolands Articuno...will they steal it and will Ash get to battle?',27);
insert into EPISODIO_ENTITY values (4709, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621288.jpg', 'The Symbol Life', 43,'Its the time of Ashs Battle and he decided to challenge Nolands Friend, Articuno to a battle with his Charizard. It is going to be the toughest battle Ash has ever had. Will he prevail and get his first Battle Frontier win and the Knowledge Symbol?',27);
insert into EPISODIO_ENTITY values (4710, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621289.jpg', 'Hooked on Onix', 44,'Enroute to the Battle Arena, Ash &amp; Co. stumble across a mountain where they find some Onix being attacked by Geodudes &amp; Golems, and to make things worse the Onix does not seem to like Ash &amp; Co. Will they be able to sort this and get through the mountain?',27);
insert into EPISODIO_ENTITY values (4711, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621290.jpg', 'Rough, Tough Jigglypuff', 45,'Enroute to the Battle Arena &amp; Saffron City, Ash &amp; Co. get caught in a trap a man has made in order to catch a Jigglypuff. Disheartened by his failure to capture, the man requests Ash &amp; Co.s help. Will they be able to get this Jigglypuff?',27);
insert into EPISODIO_ENTITY values (4712, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621291.jpg', 'On Cloud Arcanine', 46,'On their way to the Battle Arena, Ash and friends stop by a cake shop, but the line for it is long. They see an Arcanine come running by and May decides to catch it. However, Drew returns and also wants to capture it.',27);
insert into EPISODIO_ENTITY values (4713, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621292.jpg', 'Sitting Psyduck', 47,'Enroute to Saffron City, Ash &amp; Co. meet up with a trainer whos Psyduck has been attacked by a Machop, Machoke &amp; Machamp. Psyduck is trying to return something to its trainer but is being stopped by its trainers fighting Pokémon. Will it get the item back to its trainer and defend itself against the bullies?',27);
insert into EPISODIO_ENTITY values (4714, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621293.jpg', 'Hail to the Chef!', 48,'Enroute to Saffron City, Ash &amp; Co. meet up with a couple of sisters who are participating in a cook-off with their hired Pokémon Mr. Mime &amp; Sneasel for the cooking. The contest is to see who will take other their fathers restaurant. Ash &amp; Co. decide to help out one sister while Team Rocket help out the other. Who will win?',27);
insert into EPISODIO_ENTITY values (4715, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621294.jpg', 'Caterpies Big Dilemma', 49,'Enroute to Saffron City, Ash &amp; Co. meet up with a professor who has been studying a Caterpie and its evolutions, however in his experiments he has made the Caterpie and thus its evolutions, giant sized. Team Rocket however have snuck in and decided to make their Pokémon increase in size to steal Pokémon. Will they succeed?',27);
insert into EPISODIO_ENTITY values (4716, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621295.jpg', 'The Saffron Con', 50,'Finally at Saffron City, they gang arrive at the first conference hall in Kanto. However Mays old rival Harley is there and intends to enter the contest. May intending to use her new Squirtle is about to find a tough challenge against Harley. Will May prevail?',27);
insert into EPISODIO_ENTITY values (4717, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621296.jpg', 'A Hurdle for Squirtle', 51,'Its time for the Saffron City Pokémon Contest. May is entering with her Squirtle &amp; Combusken, Harley is entering with Cacturne &amp; Ariados and Jessie is entering with Cacnea. The battles will be tough but will May be able to beat Harley and earn her first Kanto Ribbon?',27);
insert into EPISODIO_ENTITY values (4718, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621297.jpg', 'Pasta La Vista', 52,'After the Saffron City Contest, Ash &amp; Co. find a Fighting Dojo in Saffron City, however one of the trainers there has had a disagreement with May so Ash &amp; May decide to take part in the Fighting Dojos battles and face the trainer...but they wind up battling eachother. Who will win?',27);
insert into EPISODIO_ENTITY values (4719, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621608.jpg', 'Fear Factor Phony!', 1,'On the way to the next Battle Frontier facility, Ash and co. are lost. They soon come across a ghost town which is haunted by Ghost Pokémon. They are soon befriended by some friendly Psychic Pokémon who dance the night away. Will Ash and co. stop the ghosts from ruining the town, and does Ash and the rest of the crew sound different to anyone?',27);
insert into EPISODIO_ENTITY values (4720, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621609.jpg', 'Sweet Baby James!', 2,'On the way to the Battle Arena, both James Chimecho and Mays Munchlax fall sick. They bring them to James old summer mansion where they are attended to by James Nanny and Pop-Pop. James has everyone play along with him when he says he is the leader of a major business. Meanwhile, even though they promised James they would stay out of trouble, Jessie and Meowth decide to steal all the Pokémon in the garden as well as Nanny and Pop-Pops friend Mime Jr!',27);
insert into EPISODIO_ENTITY values (4721, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621610.jpg', 'A Chip Off the Old Brock!', 3,'During a training match against Ashs Grovyle, Brocks Mudkip evolves into Marshtomp and with its new power injures a nearby Flaaffy. They offer to help Flaaffy, but it turns out the girl, Mariah, has a Grandma that owns a pharmacy nearby. At the pharmacy, Flaaffy is healed. Ash and the others then learn that Grandma Katie has a student named McCauley that is learning the secrets behind medicine. Meanwhile, Team Rocket decides to steal all of Katies medicine.',27);
insert into EPISODIO_ENTITY values (4722, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621611.jpg', 'Wheel of Frontier!', 4,'At the Pokémon Center Ash recieves his Snorlax from Professor Oak. He learns about the Arena Tycoon Greta from Scott, who tells him that she battles with Fighting Pokémon. At the Battle Arena, Ash ends up with a two-on-two battle with Greta. Greta chooses Hariyama and Medicham while Ash chooses Grovyle and Snorlax. In the first round Greta quickly overwhelms Grovyle. Can Ash and Snorlax pull through and beat Greta?',27);
insert into EPISODIO_ENTITY values (4723, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621612.jpg', 'Mays Egg-cellent Adventure!', 5,'On the way to the Battle Dome, Ash and friends stumble upon a Pokémon Breeding Farm. On the farm, a girl named Nicolet dreams of entering Pokémon Contests, but doesnt want to leave the Farm. May tries to encourage her but instead she challenges May to a battle a launches attack after attack at Munchlax. Munchlax, using its new attack Focus Punch, wins the battle. Meanwhile, Team Rocket comes up with a plan to steal all the eggs!',27);
insert into EPISODIO_ENTITY values (4724, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621613.jpg', 'Weekend Warrior!', 6,'May arrives in Silver Town for her second Pokémon Contest. As the contest begins a guy named Jeremy enters the contest much to his wife and sons protest. Jeremy tries to tell his wife why he loves contests but she doesnt want to listen so May steps in to help Jeremy. As the final round arrives, it is a battle between May and Jeremy.',27);
insert into EPISODIO_ENTITY values (4725, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621614.jpg', 'On Olden Pond!', 7,'On the way to the Battle Dome, Ash and the others decide to stop at a famous fishing spot for the day. However, the lake is deserted. They find out from the owner of a fishing house, Tiffany, that a company wants to buy the lake and turn the land into a resort. In order to scare people away from the land so Tifanny and her Grandma get no business, the leader of the comapny uses his Crawdaunt to terrorize the lake. When Tiffany fins out, she challenges his to a battle. The next day Ash prepares to fight him for the future of the lake.',27);
insert into EPISODIO_ENTITY values (4726, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621616.jpg', 'Tactic Theatrics!', 8,'Ash finally arrives at the Battle Dome ready for his next Frontier Battle. After a little press conference Ash finally begins his battle against the Frontier Brain, Tucker. The battle will be a double battle, which Tucker uses Swampert and Arcanine for. Ash chooses Swellow and Corphish and the battle begins. The battle quickly goes in Tuckers favor as his Pokémon are very skilled at combinations together.',27);
insert into EPISODIO_ENTITY values (4727, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621617.jpg', 'Reversing the Charges!', 9,'On their way to the Battle Pike, Ash and friends encounter an Elekid with an attitude problem. Lately, the mountains where Elekid lives have been struck by tons of lightning, which has caused Elekid to absorb it and go crazy. Following an attack, Mays Egg becomes stuck in Elekids antenna and it runs off. Now they must get the egg back! However, Elekid attacks Team Rocket and separates James from Mime Jr! Now, Mays egg is with Team Rocket and Mime Jr is with May! Can Ash and the others stop Elekid from attacking more Pokémon and save Mays Egg?',27);
insert into EPISODIO_ENTITY values (4728, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621618.jpg', 'The Green Guardian!', 10,'On their way to the Battle Pike, Ash and his friends decide to ride along the Cycling Road. However, it is closed and they must go through the forest. After hearing a noise, Pikachu wanders off and finds an wild injured Celebi under some thick vines. Ash and the others then meet a Pokémon Ranger named Solana who agrees to help them find Pikachu. When they finally find Pikachu and Celebi, the reunion is cut short as Team Rocket shows up to steal Celebi.',27);
insert into EPISODIO_ENTITY values (4729, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621619.jpg', 'From Cradle to Save!', 11,'On the way to the Battle Pike, Ash and friends stumble across a ninja school. However, there have been thefts around the school lately and they are told to be alert. On one of their tasks, which is to find the teachers Kecleon, Ash and another Ninja stumble across a Bonsly. Bonsly is quickly blamed for all of the recent thefts at the school but Brock quickly proves them wrong. Soon after, the real thieves, which is none-other than Team Rocket, show up to steal all of the Pokémon at the Ninja School!',27);
insert into EPISODIO_ENTITY values (4730, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621620.jpg', 'Time-Warp Heals All Wounds!', 12,'On their way to the Battle Pike, Mays Squirtle accidentally wanders off. While looking for her trusty Squirtle, May meets an old lady who has been waiting for her husband to come home for decades. Before long, once reunited with Squritle...May, Squirtle &amp; Meowth mysteriously get sent back in time...',27);
insert into EPISODIO_ENTITY values (4731, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621621.jpg', 'Queen of the Serpentine!', 13,'Ash finally arrives at the location of the Battle Pike, ready to battle. Team Rocket tricks him into coming into their own fake Battle Pike where they capture Pikachu. With the help of the real Frontier Brain—Pike Queen Lucy—they save Pikachu. Ash challenges Lucy to a battle, and even though it is her day off, she accepts as she has a crush on Brock. As the two begin their battle, Ash realizes Lucy is no pushover. Can Ash win? And who will Brock cheer for?',27);
insert into EPISODIO_ENTITY values (4732, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621622.jpg', 'Off the Unbeaten Path!', 14,'On their way to the Battle Palace on Seafoam Island, Ash &amp; Co. learn about a Pokémon Orienteering Championship. Both Ash &amp; Co. and Team Rocket decide to take part in it. Ash &amp; Pikachu, May &amp; Eevee, Brock &amp; Bonsly, Max &amp; Munchlax, Jessie &amp; Meowth and James &amp; Manene all enter...who will emerge victorious?',27);
insert into EPISODIO_ENTITY values (4733, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621623.jpg', 'Harley Rides Again!', 15,'On their travels, Ash &amp; Co. go to Modama Town where a Pokémon Contest is taking place. May is eager to win her 3rd Kanto Ribbon, however things start to get tense when she discovers her rival, Harley is taking part in this contest with his Ariados &amp; Octillery. Will May be able to defeat Harley or will she suffer her first Kanto loss?',27);
insert into EPISODIO_ENTITY values (4734, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621624.jpg', 'Odd Pokémon Out!', 16,'While on the way to Mays next contest, Ash and friends must stop at a nearby island to switch to the ferry to the next island. They let their Pokémon out to play and Donphan, still as playful as ever, tries to play with some Rhyhorn, only to be chased by their parents. After being saved by Nurse Joy and her Meganium, Grovyle gets into a conflict with a wild Tropius and beaten badly. Meganium heals Grovyle and Grovyle falls in love with her. However, Meganium and Tropius love each other! Now Grovyle decides to battle Tropius again to get revenge, and win Meganiums love!',27);
insert into EPISODIO_ENTITY values (4735, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621625.jpg', 'Spontaneous Combusken!', 17,'After losing a ribbon to Harley, May arrives on Chrysanthemum Island, ready to win her third ribbon. Ash is also working hard trying to help Sceptile regain its ability to use attacks. When Drew shows up, May finds out he didnt send her the letter. Later, while training on the beach, she meets a girl named Brianna who reveals that she sent the letter and rose to May. When Brianna finds out May knows Drew, she freaks out as she has a crush on Drew. When she finally meets Drew, Brianna claims that she will beat May in the contest and win Drews respect and love! Meanwhile, Jessie also enters the contest with James Mime Jr.',27);
insert into EPISODIO_ENTITY values (4736, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621626.jpg', 'Cutting the Ties That Bind!', 18,'Ash &amp; co have arrived on the island of the Battle Palace which happens to be a massive Jungle. Ash, eager to make his upcoming battle with the Brain as good as it can be, decides to put extra emphasis on helping his recently evolved Sceptile to be able to use its attacks. However in the process, Ash &amp; Sceptile get seperated from the group and meet with the Frontier Brain, Spenser. Will Ash &amp; Spenser get Sceptile to be able to use attacks again?',27);
insert into EPISODIO_ENTITY values (4737, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621627.jpg', 'Ka Boom with a View!', 19,'Ash finally arrives at Battle Palace, ready to take on Spenser for the Spirit Symbol. As they head out to the battlefield, Ash learns that he has the entire surrounding jungle to battle in! As the battle begins, May, Brock and Max head up in a balloon with Scott to watch the battle. As the battle begins, Ash pits his newly "revived" Sceptile against Spensers Shiftry and the battle quickly takes into the forest. Will Ash be able to beat Spenser while battling in a forest? And does he have a secret weapon waiting in the wings?',27);
insert into EPISODIO_ENTITY values (4738, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621629.jpg', 'King and Queen for a Day!', 20,'After a battle with Team Rocket, Pikachu, Meowth, Bonsly &amp; Manene are seperated from their respective trainers. Lost in a town, the four Pokémon decide to team up to find their trainers...however three strange men have their eyes set on Bonsly &amp; Manene. Will the Pokémon get back to their trainers?',27);
insert into EPISODIO_ENTITY values (4739, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621630.jpg', 'Curbing the Crimson Tide!', 21,'On their way to the next town, Ash &amp; Co. enter a town where a legend exists about The Red Inazuma, who is a person that can wear a cloak, talk and use Pokémon Attacks. However soon The Red Inazuma starts attacking innocent Pokémon and must be stopped. Can Ash &amp; Co. stop it and find out what it really is?',27);
insert into EPISODIO_ENTITY values (4740, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621631.jpg', 'What I Did for Love!', 22,'May finally arrives in Gardenia Town ready to win her fourth ribbon. She gains a nice surprise when she finds out that her Eevee has learned Dig. While May prepares for the contest, Brock meets another Pokémon Breeder named Yuma. After seeing his Pokémon skills, she convinces him to enter the Gardenia Contest. After amazing appeals by Squirtle and Bonsly, both May and Brock make it to the battle rounds. Will May be able to beat her friend to win her fourth Kanto Ribbon?',27);
insert into EPISODIO_ENTITY values (4741, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621632.jpg', 'Three Jynx and a Baby!', 23,'On their way to the Battle Tower, May finds a Smoochum behind a bush. She tries to pick it up, only to be attacked by three Jynx, Smoochums sisters. After a short battle Ash and the others leave and head for town. Soon after, Team Rocket take Smoochum and plan to make her a star. The Jynx then begin to attack the town and Ash and May hold them back before luring them to where Smoochum is. However, when they get there, Jessie has no intentions to give Smoochum back to her sisters!',27);
insert into EPISODIO_ENTITY values (4742, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621633.jpg', 'Talking a Good Game!', 24,'Ash is finally at the Battle Tower, wanting his 6th Battle Frontier victory. However he gets chased off by a pack of Wild Beedrill and ends up meeting up with Anabel. Ash eagerly challenges Anabel to a battle, but with Anabel having strong Psychic Pokémon...Ash faces his toughest match yet.',27);
insert into EPISODIO_ENTITY values (4743, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621634.jpg', 'Second Times the Charm!', 25,'After his loss in the Battle Tower, Ash decides to start training his Pokémon so he can devise the perfect strategy to defeat Anabels Psychic Pokémon. However by using the same Pokémon as before, ash faces a tough battle against the Psychic Pokémon and their strong attacks. Will Ash manage to claim victory?',27);
insert into EPISODIO_ENTITY values (4744, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621635.jpg', 'Pokémon Ranger! Deoxys Crisis! Part 1', 26,'On the way to the Battle Pyramid, Ash and friends meet up with Solana, the Pokémon Ranger. She is there because of a geometric problem in the area that is disturbing electronics of all kinds including the Poké Balls. Everyone figures out that the disturbance is caused by a lonely Deoxys. When they go to investigate the place where Deoxys meteor crashed, Deoxys becomes scared and flees with Max and Meowth.',27);
insert into EPISODIO_ENTITY values (4745, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621636.jpg', 'Pokémon Ranger! Deoxys Crisis! Part 2', 27,'With Max and Meowth taken by Deoxys, Ash and the others head back to the Pokémon Center to devise a plan. Solana manages to fix their Pokéballs and so they head out in search of their friends. In Deoxys world, it explains to Max (through Meowth) that it is very lonely and confused. However, the geometric imbalance is starting to create Chaos in the world, this pain causes Deoxys to start attacking everybody. Their only hope is for Solana to use the Capture Styler on Deoxys, but it only works when Deoxys is in normal form. Now the others must battle to save themselves from Deoxys and wait patiently for the right time to capture it.',27);
insert into EPISODIO_ENTITY values (4746, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621637.jpg', 'All That Glitters is Not Golden!', 28,'On their way to the Battle Pyramid, Ash &amp; co. find an unusual Pokémon inside a forest, a golden Sudowoodo which quickly runs away. When they reach the next town they tell the townsfolk of this Sudowoodo, they decide to go find it. However Team Rocket also have their eyes on this Golden Pokémon. Will Ash &amp; Co. be able to save it from Team Rocket?',27);
insert into EPISODIO_ENTITY values (4747, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621638.jpg', 'New Plot - Odd Lot!', 29,'At the next Town, May decided to enter the contest in order to win her 5th Pokémon Contest in Kanto in order to qualify for the Grand Festival. However when there, May &amp; Co. meet up with Mays Rival Harley who still wants to stop May from entering the Grand Festival, and he intends to mess up this contest for her so she cannot get her fifth ribbon. To do so, he teams up with Team Rocket. Will May be able to enter and win?',27);
insert into EPISODIO_ENTITY values (4748, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621639.jpg', 'Going for Choke!', 30,'After just getting through the preliminaries, May gets ready for the finals of her 5th Pokémon Contest. However her rival Harley, still trying to stop May from getting through lends his Cacturne &amp; Banette to Jessie who also got through the preliminaries. However, May &amp; Jessie wind up having to battle eachother in order to get the ribbon. Will May win?',27);
insert into EPISODIO_ENTITY values (4749, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621640.jpg', 'The Ole Berate and Switch!', 31,'After failing to capture Pikachu, Jessie, James, and Meowth go their separate ways. Butch and Cassidy also split which leads to Jessie teaming up with Butch and James with Cassidy. Both teams then try to prove who is better by capturing Pikachu and Pokémon that trainers are using in a fake battle tournament set up by them.',27);
insert into EPISODIO_ENTITY values (4750, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621641.jpg', 'Grating Spaces!', 32,'On their way to the Battle Pyramid, Ash &amp; Co. stop in to Pewter Gym to see Brocks Family. When they get there Brock gets two suprises, his Onix has evolved into a Steelix and the gym has pretty much been vandalised on the inside due to lack of care for the gym. However when hes trying to fix it, Team Rocket come in disguise with strong Pokémon delivered by Delibird in order to try and capture the gym, Charizard &amp; Aggron. Will Ash &amp; Brock be able to defend the gym?',27);
insert into EPISODIO_ENTITY values (4751, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621642.jpg', 'Battling the Enemy Within!', 33,'Finally at the final Battle Frontier Facility, the Battle Pyramid, Ash &amp; Co. find a challenge just to find Brandon, the Frontier Brain. Once found, while they are going through the Pyramid, Ash gets adversely affected by one of the artifacts inside. Will Ash snap out of it in order to battle Brandon and the legendary Pokémon Regirock?',27);
insert into EPISODIO_ENTITY values (4752, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621643.jpg', 'Slaking Kong!', 34,'On their way to the Grand Festival at the Indigo Plateau, Ash &amp; Co. come across a large group of Aipom, however the mischievous Aipom steal Ashs Hat and Mays Ribbon Case and run off. However when they track down the Aipom, it turns out they worship a Giant Slaking who soon appears and kidnaps May. Can Ash &amp; Co. rescue May from the Giant Slaking and get the Hat and Ribbon Case back in time for May to participate in the Grand Festival?',27);
insert into EPISODIO_ENTITY values (4753, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621644.jpg', 'May, We Harley Drewd Ya!', 35,'Its time for the Grand Festival. May is eager to enter to try and best her place in the Hoenn Grand Festival. However she soon learns that her rivals Harley and Drew are also participating in this Grand Festival. The preliminary appeals are up first and May finds a whole new challenge in besting another co-ordinator and her elegant Lapras. Will May get through the preliminaries?',27);
insert into EPISODIO_ENTITY values (4754, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621645.jpg', 'Thinning the Hoard!', 36,'After getting through the preliminaries of the Grand Festival and the first round of the finals, May ends up having to battle her old rival Harley in a double battle. Munchlax &amp; Eevee VS Cacturne &amp; Wigglytuff. Will May be able to defeat her rival and will Drew &amp; Saori manage to get through to the finals aswell?',27);
insert into EPISODIO_ENTITY values (4755, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621646.jpg', 'Channeling the Battle Zone!', 37,'As May and Drew continue their battle. Drew quickly gains a lead with a new combo move. As the battle progresses, May manages to finally defeat Flygon with Squritle. However, her victory is soon spoiled as Absol quickly takes out Squirtle. Combusken and Absol continue to battle with neither side letting down. During the battle, Combusken learns Overheat and is able to strike back with amazing power. As the battle ends, it comes down to May winning by just a few points! After the battle, Ash finally catches the troublesome Aipom. May then finds herself up against Solidad and her amazing Pidgeot and Slowbro. Can May defeat Solidad and go on to win the Grand Festival?',27);
insert into EPISODIO_ENTITY values (4756, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621647.jpg', 'Aipom and Circumstance!', 38,'On their way to the Battle Pyramid, Ash &amp; Co. come across a town where the locals are looking for a new King to lead them. In doing so they run an event and whoever wins the event gets to be king for a year. However Ashs newly captured Aipom manages to get stuck in the crown. Will Ash be able to retrieve the crown and get the event happening?',27);
insert into EPISODIO_ENTITY values (4757, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621648.jpg', 'Strategy Tomorrow - Comedy Tonight!', 39,'On thier way to the Battle Pyramid, Ash and friends meet a trainer who uses a Chatot for her pokémon comedy routine. She hopes to win an upcoming comedy showdown by using Chatot to imitate people and pokémon. Chatot gets away from its trainer and now Ash and the others have to find it, but Team Rocket is also after this pokémon.',27);
insert into EPISODIO_ENTITY values (4758, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621649.jpg', 'Dules of the Jungle!', 40,'Ash and friends continue thier journey to the Battle Pyramid for Ashs final symbol. They come across a injured wild Weavile. They try to help it but it attacks and badly injures Aipom. They find out from a townperson that Weavile was attacked by a member of its own group instead of a Sneasel. Ash and friends then decide to find Weavile and help it beat its adversary.',27);
insert into EPISODIO_ENTITY values (4759, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621650.jpg', 'Overjoyed!', 41,'Ash and friends finally arrive at the Battle Pyramid. Ash has a training match against Nurse Joy and Chansey which he loses. He then trades Aipom for Torkoal and faces off against Brandon and his Registeel.',27);
insert into EPISODIO_ENTITY values (4760, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621651.jpg', 'The Unbeatable Lightness of Seeing!', 42,'Travelling through the Kanto region in preperation for his rematch against Brandon, Ash &amp; Co. meet up with Mays Rival Drew. May, eager to battle her long time rival, challenges Drew to a Contest Match. However in mid-match, Harley appears. Will the Rivals have an all out battle? Meanwhile, Ash learns about the land of Shinou from Gary and Prof. Oak',27);
insert into EPISODIO_ENTITY values (4761, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621652.jpg', 'Pinch Healing!', 43,'A bus full of Pokémon breaks down in front of the Pokémon Center. However, Nurse Joy has fallen sick! Now Ash, May, Max, and Brock must take care of the Pokémon and save them from Team Rocket! Jap Title: The Pokémon Center Is Very Busy!',27);
insert into EPISODIO_ENTITY values (4762, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621653.jpg', 'Gathering the Gang of Four!', 44,'Its time for Ashs 2nd Rematch against Brandon, a full 4 VS 4 Pokémon Battle. Calling upon his oldest Pokémon; Pikachu, Bulbasaur, Charizard &amp; Squirtle, Ash trains the four and prepares for the battle. However when he gets into the battle, the battle appears to be tougher than anticipated...',27);
insert into EPISODIO_ENTITY values (4763, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621654.jpg', 'Pace - The Final Frontier!', 45,'After Charizards loss to Dusclops, Ash is faced with being at a disadvantage in his rematch with Brandon. With only Pikachu, Squirtle &amp; Bulbasaur left, he has to face Brandons Ninjask &amp; Solrock. However after they have been subdued, Brandon reveals his trump card...the legendary Golem Regice. Will Ash manage to defeat Regice or will he suffer his 3rd loss against Brandon?',27);
insert into EPISODIO_ENTITY values (4764, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621655.jpg', 'Once More with Reeling!', 46,'On their way back to Pallet Town, Ash and May compete in a Pokémon Contest. During the break, Mays Combusken evolves into Blaziken! In the final round, Ash pits Sceptile against Mays Blaziken! jap title: Ash VS May! The Last Battle!!',27);
insert into EPISODIO_ENTITY values (4765, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/621656.jpg', 'Home is Where the Start Is!', 47,'After the climatic end to their contest battle. Ash, May, Brock &amp; Max all go their seperate ways and go home. On his way back to Pallet Town, Ash meets up with his old rival who has returned home from Shinou on a visit. Ash is eager to challenge Gary and see the new Pokémon that he has seen and thus they battle. Pikachu VS Electabuzzs new evolution, Elekible. Who will win?',27);
insert into EPISODIO_ENTITY values (4766, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622339.jpg', 'Following a Maidens Voyage!', 1,'In the land of Sinnoh, Dawn has turned the age of 10 and is to meet Professor Rowan in Sandgem Town in order to receive her first Pokémon. Dreaming of partaking in Super Contests, she manages to get lost before getting to the lab. However once she gets there the Pokémon are fighting and escape the laboratory. Will she be able to faciliate the return of Turtwig, Chimchar and Piplup? Where is Ash in all of this?',27);
insert into EPISODIO_ENTITY values (4767, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622340.jpg', 'Two Degrees of Separation!', 2,'After getting her starting Pokémon, Piplup, Dawn begins her quest to compete in Super Contests. After many failed capture attempts, she runs into Ashs Pikachu who is still separated from Ash and she tries to catch it. The capture fails because Pikachu is already someone elses Pokemon. Then Team Rocket come and attack Pikachu! Meanwhile, Brock returns with new clothes and him, Ash, and Aipom set out to find Pikachu. Can they find Pikachu? and can Dawn save Pikachu?!',27);
insert into EPISODIO_ENTITY values (4768, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622341.jpg', 'When Pokémon Worlds Collide!', 3,'Paul challenges Ash to a battle, however, since he has not found Pikachu yet so he has to decline. Finally, Ash finds Pikachu with Dawn. After thanking her, he returns to Sandgem Town along with Brock and Dawn where Paul challenges him again, and he accepts.',27);
insert into EPISODIO_ENTITY values (4769, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622342.jpg', 'Dawn of a New Era!', 4,'After popping Team Rockets Balloon, Ash &amp; Dawn argue about Hikaris experience. Dawn is eager to show her worth as a trainer and challenges a trainer who has the Pokémon Budew. It is Dawns first battle with her new Pokémon, will Piplup be able to defeat Budew despite the type disadvantage?',27);
insert into EPISODIO_ENTITY values (4770, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622343.jpg', 'Gettin Twiggy with It!', 5,'After the usual battle with Team Rocket, Pikachu goes missing. When finding him, Ash meets up with a Turtwig that helps out the Wild Pokémon from fighting. However Team Rocket re-appear and have their eyes set on this powerful yet helpful Pokémon. Can Ash protect it?',27);
insert into EPISODIO_ENTITY values (4771, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622344.jpg', 'Different Strokes for Different Blokes!', 6,'In a forest during their trvaels, Ash &amp; Co, unexpectadly meet up with Paul. Ash is eager for a rematch and challenges him with his newly captured Turtwig. However during the battle, Team Rocket interrupts and Ash ends up lost in the forest with Shinji. Will Ash &amp; Paul get out of the Forest and will they have a rematch?',27);
insert into EPISODIO_ENTITY values (4772, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622345.jpg', 'Like It or Lup It!', 7,'While training for her Super Contests, Piplup accidentally gets lost and muddled up in some Wild Water Pokémon that are feuding nearby. However Team Rocket have their eyes set on these Pokémons food and the Pokémon themselves. Can Piplup stop them and can Dawn find Piplup?',27);
insert into EPISODIO_ENTITY values (4773, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622346.jpg', 'Gymbaliar!', 8,'On their way to the next city, Ash &amp; Co. come across a Mysterious Unofficial Gym run, unknown to them, by Team Rocket. While there, Brock makes friends with a Croagunk that has been following and helping Team Rocket out. What are Team Rockets Plans &amp; will Ash &amp; Co. stop them?',27);
insert into EPISODIO_ENTITY values (4774, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622347.jpg', 'Setting the World on Its Buneary!', 9,'On their way to the next city, Ash &amp; Co. come across another Wild Buneary, of whom has a crush on Pikachu. Dawn, eager to finally catch one, attempts to battle it and fails. However, Team Rocket are nearby and have their eyes on Buneary. Can Dawn protect it?',27);
insert into EPISODIO_ENTITY values (4775, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622348.jpg', 'Not on MY Watch Ya Dont!', 10,'Ash and friends finally arrive in Jubilife City, and Dawn is ready for the upcoming Pokemon Contest. However, she wants to go get a Poketch for the contest, but they are all gone! At a street corner, Team Rocket disguised as clowns are giving free ones out, and Dawn, Ash, and Brock take one. At a park, a boy comes up to them and reveals that they are fake. It turns out that the fake ones are a scheme to hypnotize the Pokemon of the trainers who took one and capture. However, Ash, Dawn, and Brock soon catch onto this and plan to stop Team Rocket.',27);
insert into EPISODIO_ENTITY values (4776, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622349.jpg', 'Mounting a Coordinator Assault!', 11,'The Jubilife contest is about to begin and Dawn is excited for her first contest. She comes across Zoey, a girl who will also be competing in the contest. While practicing with Ash, Aipom interferes in her battle and Dawn convinces Ash to join the contest. As the two get registered, Jessie will also be entering the contest with James Carnivine, while James and Meowth sell fake seals. As the contest begins, Dawn is nervous while Ash and Jessie are confident. Can Dawn win her first contest?',27);
insert into EPISODIO_ENTITY values (4777, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622350.jpg', 'Arrival of a Rival!', 12,'The battle rounds of the Jubilife contest are about to begin and Ash, Dawn, Jessie, and Zoey all make it to the finals. Tension rises quickly between Ash and Zoey when Zoey finds out that Ash also enters Gym Battles. Their battle is up first, and although Ash puts up a good fight, Zoey wins in the end. As the next semi-finals begin, Dawn must beat Zoey. Will she be able to beat Zoey and Jessie and win her first ribbon?',27);
insert into EPISODIO_ENTITY values (4778, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622351.jpg', 'A Staravia is Born!', 13,'On the way to Oreburgh City, Ash is training Starly so that it will learn Aerial Ace. During the training they meet a girl named Rosebay whos job is to protect the wild Pokemon in the valley. She has noticed that the population of bird Pokemon has decreased over the last copule of days. In turns out that this is all a plan by Team Rocket, who is capturing them inside of an underground base. When Starly winds up in this trap, he tries to rally the Pokemon into trying to break free.',27);
insert into EPISODIO_ENTITY values (4779, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622353.jpg', 'Leave It to Brocko!', 14,'On their way to the next town, Brock encounters an injured Nuzleaf that has been seperated from its pack. Eager to help, Brock heals the Nuzleaf and tries to get it back home. However Team Rocket have their eyes set on it and its family, can Brock protect it and get Nuzleaf home?',27);
insert into EPISODIO_ENTITY values (4780, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622354.jpg', 'Shapes of Things to Come!', 15,'Ash and friends finally arrive in Oreburgh City. They head to the Gym and run into Paul. It turns out that Roark, the leader is working at the Oreburgh mines. After digging up a fossil, Roark returns to the Gym and begins his battle with Paul. The realization of Roarks power comes into view when he easily takes out Pauls Azumarill. As the battle continues, Paul now has to face three rock-types, with his only type advantage knocked out. Will Paul be able to pull off a win?',27);
insert into EPISODIO_ENTITY values (4781, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622355.jpg', 'A Gruff Act to Follow!', 16,'Its finally time for Ashs battle against Roark. In a 3 VS 3 Match, Ash faces a tough challenge for his first Sinnoh Gym Battle. Will Ash be able to beat Roark or will he fall flat on the hard rock?',27);
insert into EPISODIO_ENTITY values (4782, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622356.jpg', 'Wild in the Streets!', 17,'Ash begins training with Brock for his re-match against Roark. Dawn decides to train for her next contest. Meanwhile, Team Rocket finally steals the fossil machine from the museum, hoping to resurrect tons of fossil Pokemon for Giovanni. When the first fossil is regenerated, the Aerodactyl flies away and begins to terrorize Oreburgh City. Soon, a Kabutops and Armaldo break free from the museum and join Aerodactyl in the rampage. Now, it is up to Ash, Dawn, Brock, Roark, and Officer Jenny to stop them.',27);
insert into EPISODIO_ENTITY values (4783, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622357.jpg', 'Ore the Rampardos We Watched!', 18,'Ash returns to Oreburgh Gym, ready to challenge Roark again. As the battle starts, Ash quickly surprises everyone when Pikachu manages to take down Onix. As the second battle begins, Ash pits Aipom against Geodude. After a long struggle, Ash manages to beat Geodude, and loses Pikachu and Aipom before the real test begins, defeating Roarks newly-evolved Rampardos.',27);
insert into EPISODIO_ENTITY values (4784, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622358.jpg', 'Twice Smitten, Once Shy', 19,'After staring at a Pachirisu for some time, Dawn decides to capture it. After she captures it, she is immediately attached to it, loving to spend time with it. However, Pachirisus playful nature causes Dawn to freak out and doubt her abilities as a trainer. She decides to release Pachirisu, and runs away. Jessie sees this and decides to capture the Pokemon for herself. However, Dawn begins to have second thoughts and decides to re-capture Pachirisu.',27);
insert into EPISODIO_ENTITY values (4785, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622359.jpg', 'Mutiny in the Bountiny', 20,'During their travels, Ash &amp; Co. encounter a Pokémon Hunter. This Hunter is eager to take Pokémon from other people and manages to take Ashs Pikachu &amp; Team Rockets Meowth. Ash, eager to get his friend back, teams up with Team Rocket. Will they get Pikachu &amp; Meowth back or will this Hunter prevail?',27);
insert into EPISODIO_ENTITY values (4786, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622360.jpg', 'Ya See We Want an Evolution', 21,'On their travels, Ash &amp; Co find a group who are dedicated to keeping their Pokémon at their base stage, the "B-Button" gang. Training Magikarp &amp; Feebas for Battles &amp; Contests, they manage to tap the fishs power. However, Team Rocket have their eyes on these abnormally strong Fish. Can Ash &amp; Co. Protect them?',27);
insert into EPISODIO_ENTITY values (4787, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622361.jpg', 'Borrowing on Bad Faith', 22,'On their way to Floaroma City, Ash &amp; Co. come across another Pokémon Contest. Dawn is eager to enter and try to get her own ribbon. While playing, Aipom gets caught on a cliff and is saved by Jessie. Jessie soon requests to Ash that she can use Aipom in the Contest, to which Ash agrees. Who will win?',27);
insert into EPISODIO_ENTITY values (4788, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622362.jpg', 'Faces with Steelix Determination', 23,'On their travels, Ash &amp; Co. come across a pack of Bidoof. These Bidoof once lived peacefully in the valley. However, recently a Steelix has come and started terrorising the Bidoof and the area. Can Ash &amp; Co. stop the Steelix and protect the Bidoof?',27);
insert into EPISODIO_ENTITY values (4789, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622363.jpg', 'Cooking Up a Sweet Story', 24,'On the way to Floaroma Town Ash and friends arrive at a cake shop where they meet Theresa and her aunt Abigail, who run the shop. They find out that a annual bake-off will be held soon and usually Abigail wins it making her special cake with her Pikachu, Sugar. However, Sugar recently left leaving Abigail sad and debating whether or not she will be entering the contest this year. Theresa convinces Ash to let Abigail borrow his Pikachu for the contest, and pretend that it is Sugar, and he agrees. However, Team Rocket once again threatens to ruin the plan.',27);
insert into EPISODIO_ENTITY values (4790, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622364.jpg', 'Oh Do You Know the Poffin Plan!', 25,'Ash &amp; Co. finally get to Floaroma City, home of the next Pokémon Contest. Dawn is eager to start creating Poffin in order to improve her Pokémons contest performance. However, when in the shop, watched over a Roserade, they get mysteriously attacked...',27);
insert into EPISODIO_ENTITY values (4791, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622365.jpg', 'Getting the Pre-Contest Titters', 26,'Ash &amp; Co. are at Floaroma City. Dawn is eager to enter the contest and try and win her first ribbon, however her childhood friend appears, boasting none other than Dawns Piplups next evolutionary stage; Prinplup. Dawn is eager to challenge her friend. However, Team Rocket have their eyes set on the Prinplup. Will they be stopped and will Dawn battle her friend in the contest?',27);
insert into EPISODIO_ENTITY values (4792, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622366.jpg', 'Settling a Not-So-Old Score', 27,'The contest has begun. Dawn, Jessie &amp; Dawns childhood friend are all participating. Dawn is completely eager to actually win the contest. However the battles end up being against her Childhood Friend. Despite the fact that they were friends, Dawn gives it her all. Will Piplup defeat the Prinplup?',27);
insert into EPISODIO_ENTITY values (4793, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622367.jpg', 'Dirfloon on the Wind', 28,'Ash &amp; Co. are on their way to Eterna City when they encounter Nurse Joy and her children. Ash &amp; Co. decide to stay for a bit, but they learn that the youngest kid has some secret friends in the cave; Drifloon. However, Team Rocket have their eyes on these Drifloon...but something big is around following the North Winds...',27);
insert into EPISODIO_ENTITY values (4794, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622368.jpg', 'The Champ Twins', 29,'When they get to the next city, Ash &amp; co are interviewed by the local tv station. From this interview, Ash &amp; Dawn are pulled into a double battle against a team who has had over a dozen consecutive wins with their Quilava &amp; Croconaw. Will Ash &amp; Dawn be able to beat them and end their streak?',27);
insert into EPISODIO_ENTITY values (4795, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622370.jpg', 'Some Enchanted Sweetening', 30,'On their way through Eterna Forest, Ash &amp; Co. meet up with a trainer called Cheryl. She is looking for Sweet Honey so she can get some really rare Pokémon. Having found some Burmy, she learned that it has many different evolved forms. Having obtained three of them, Cheryl is trying to evolve her final Burmy to see what it will become. Team Rocket however have their eyes set on this Worm Family. Will they be stopped?',27);
insert into EPISODIO_ENTITY values (4796, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622371.jpg', 'Grass Type is Always Greener', 31,'While travelling through Eterna Forest with their new friend Cheryl, Ash &amp; Co. come across the Eterna Gym Leader; Gardenia. Upon learning that shes the gym leader, Ash is eager to challenge her. However, when she sends out her Turtwig and Cherubi, could Ash be facing a tougher battle than he anticipated?',27);
insert into EPISODIO_ENTITY values (4797, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622372.jpg', 'An Angry Combee-Nation!', 32,'After splitting from Gardenia, Ash &amp; Co. continue their search for Honey with their new friend Cheryl. Chasing a Combee that they found, they find a massive hive filled with Combee. However, Team Rocket see this and want the Combee. The hives leader however, is not too happy with Team Rocket or Ash &amp; Cos presence in the hive...',27);
insert into EPISODIO_ENTITY values (4798, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622374.jpg', 'All Dressed Up with Somewhere to Go', 33,'On their way to Eterna City, Ash &amp; Co. come across a special convention. The prize? A mysterious Pokémon egg. This convention however is a rather unusual one. Entrants are Pokémon and they have to look like other Pokémon. With everyone intending to enter, the competition is fierce. Especially since Team Rocket have their eyes on the egg.',27);
insert into EPISODIO_ENTITY values (4799, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622375.jpg', 'Buizel Your Way Out of This!', 34,'On their way to Eterna City, Ash &amp; co. decide to do a spot of fishing. Hooking a Buizel, Ash &amp; Dawn both want the opportunity to capture it. To make things worse, Dawns rival Nozomi arrives and also wants to capture the strong Buizel. Who will manage to battle it and capture it? Or will Team Rocket appear and capture it themselves?',27);
insert into EPISODIO_ENTITY values (4800, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622376.jpg', 'An Elite Meet and Greet', 35,'On their way to Eterna City, Ash &amp; co. meet up with Lucian, a member of the Elite Four in Sinnoh. Dawn is eager to test out her newly captures Buizel and challenges Lucian to a battle. Is Dawn biting off more than she can chew? Will Buizel be up to the challenge?',27);
insert into EPISODIO_ENTITY values (4801, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622377.jpg', 'A Secret Sphere of Influence', 36,'The gang finally enter Eterna City, the home of the second Sinnoh Gym. However, before they get to the gym, they meet up with the old friends Gardenia &amp; Nando. However, recently there has been a theft of the rare Adamant Orb, linked to Dialga and Nando &amp; his Sunflora are implicated in the crime. Is Nando innocent and if so, will Ash &amp; Co. manage to uncover the true culprits?',27);
insert into EPISODIO_ENTITY values (4802, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622378.jpg', 'A Grass Menagerie', 37,'It is time for Ashs second gym battle. In Eterna City, agsint Gardenia, whom he previously battled in the Forest, Ash faces one of his toughest battles. In a three on three battle, Staravia, Turtwig &amp; Aipom face strong competition against Cherubi, Turtwig &amp; Roserade. Can Ash beat Gardenia this time or will he end up losing to her again?',27);
insert into EPISODIO_ENTITY values (4803, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622379.jpg', 'One Big Happiny Family', 38,'Enroute from Eterna City, Brocks egg starts to glow. Finding a nearby Nurse Joy and await the egg to hatch. Happiny hatches from the egg and immediately takes a shine to Brock. Lacking a White Rock however, Brock goes out to find one. However, Team Rocket have their eyes set on Brocks new Pink Pokémon. Can the new Pokémon be protected?',27);
insert into EPISODIO_ENTITY values (4804, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622380.jpg', 'Steamboat Willies!', 39,'Heading to the next town on a boat, Ash &amp; Co. decide to let their Pokémon free to have a little fun. However, Team Rocket hatch a plan in order to take all of Ash &amp; Co.s Pokémon and to make things worse, the boat ends up heading for a Waterfall. Can the Pokémon be saved?',27);
insert into EPISODIO_ENTITY values (4805, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622381.jpg', 'Top - Down Training!', 40,'On their way to the next town, Ash &amp; Co. meet up with Cynthia, the Pokémon Champion of Sinnoh while they are investigating some ruins. Paul appears soon after and is eager to challenge Cynthia to a battle. Will Paul manage to stand his ground against the Champion or will he be easily defeated?',27);
insert into EPISODIO_ENTITY values (4806, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622382.jpg', 'A Stand-Up Sit-Down!', 41,'On their way to the next city, Ash &amp; Co. bump into Zoey, who has been injured while training. While helping her out, Dawn learns that the next contest will follow Grand Festival Rules and require double battles. Dawn, having no experience in battling in double battles alone, decides she needs to practice with her Pokémon. However, Team Rocket are around the corner and have their eye on Zoeys new Shellos...',27);
insert into EPISODIO_ENTITY values (4807, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622383.jpg', 'The Elektrike Company!', 42,'On their way to the next city, Ash &amp; Co. meet a trainer who is wanting to train his Electrike up to impress a nearby trainer who has a stronger one. Ash &amp; co are eager to help the trainer and the Electrike. However, Team Rocket are nearby and want the Electrike. Can Ash &amp; Co help train the Electrike enough to stop Team Rocket?',27);
insert into EPISODIO_ENTITY values (4808, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622384.jpg', 'Malice in Wonderland!', 43,'Its night-time on their travels and Ash &amp; Co. get to sleep. Dreaming their usual dreams, their desires are shown. However, a nearby Mismagius accidentally taps into their dreams causing everything to go wrong. Will Ash &amp; Co be able to get out of their dreams?',27);
insert into EPISODIO_ENTITY values (4809, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622385.jpg', 'Mass Hip-Po-sis!', 44,'Travelling to the next town, Ash &amp; Co. spot a Hippopotas about to fall. Worried, they quickly intervene and rescue the Hippopotas. However, a TV crew was scouting the Hippopotas for a documentary. To make things worse, Team Rocket want the Hippopotas. Can Ash protect the Hippopotas?',27);
insert into EPISODIO_ENTITY values (4810, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622386.jpg', 'III-Will Hunting', 45,'On the way to the next town, Ash &amp; Co. come across some Shieldon, the rare fossil Pokémon. However, nearby, the Pokémon Hunter, J, has arrived and intends to get these Shieldon. Ash is eager to try and stop this and in doing so is in pursuit of Hunter J. During this pursuit, out of nowhere comes Gary &amp; his Electivire...',27);
insert into EPISODIO_ENTITY values (4811, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622387.jpg', 'A Maze-ing Race!', 46,'On their way to Hearthome City, Ash &amp; Co. find a contest in which the winner can earn a new Pokétch Application. Dawn, eager to get a new one insists that they all take part. The task? Get through a Maze on time. However, Team Rocket get in the way intent on stealing some Pokémon. Will Ash &amp; Co. get through the maze safely?',27);
insert into EPISODIO_ENTITY values (4812, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622388.jpg', 'Sandshrews Locker', 47,'On their way to Hearthome City, Ash &amp; Co. meet Mira who offers to give them a shortcut using her Abras Teleport. However, when they fail to arrive at Hearthome, Mira asks Ash &amp; Co. for a favour, to help find a pendant that was lost at the bottom of sea. Reluctantly, Ash &amp; Co. agree and go underwater. However, the pendant is found out to be a Pokémons Pokéball, and is in some ruins protected by a Gyarados. Will Ash &amp; Co. get the Pokéball and get to Hearthome in the end?',27);
insert into EPISODIO_ENTITY values (4813, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622389.jpg', 'Dawns Early Night', 48,'Its time to Dawns next contest. However, as she enters in the contest, she sees that her old friends Nando &amp; Zoey are also entering the contest. With the three co-ordinators eager to win, this is going to prove to be one of Dawns toughest contests. Will she win?',27);
insert into EPISODIO_ENTITY values (4814, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622390.jpg', 'Tag! Were It...!', 49,'Taking Nandos advice, Ash and Brock decide to enter the Hearthome Tag Battle Tournament. In order to cheer her up following her contest loss, Ash also enters Dawn in the tournament. As everyone is paired up with their partners, Ash finds out that his partner will be none other then Paul! Things are just a strange for Dawn due to her partner, Conway, being a little to attached to her. Meanwhile, Brock gets lucky when he is paired with the beautiful Holly. As the tournament begins, Dawn and Conway, and Brock and Holly manage to pull off wins, but can Ash and Paul set aside their differences and work together?',27);
insert into EPISODIO_ENTITY values (4815, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622391.jpg', 'Glory Blazed!', 50,'Ash, Paul, Dawn &amp; Brock have all got through to the next round. With Dawn &amp; Brock teamed up with Random trainers and Ash teamed up with Paul, the gang will have their hardest challenges yet. However, with Paul using his Chimchar, will he finally accept Chimchars strengths? And will Ash &amp; Co. all get to the next round?',27);
insert into EPISODIO_ENTITY values (4816, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/248/622392.jpg', 'Smells Like Team Spirit!', 51,'Its time for the finals of the Tag Tournement. With Ash, Dawn, Brock &amp; Paul all into the finals, the gang are to have their toughest battles yet as they battle eachother. However, with Ash choosing Pauls newly released and his recently obtained Pokémon, Chimchar, could Ash be about to have the hardest battle yet by using a new Pokémon at such a crucial stage?',27);
insert into EPISODIO_ENTITY values (4817, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623239.jpg', 'Tears for Fears', 1,'On their way to the next city, Chimchar is starting to settle into the new environment, Ashs group. However, after the harsh training given to it by Paul, Chimchar is rather on edge all the time and is shocked at how different things are...',27);
insert into EPISODIO_ENTITY values (4818, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623240.jpg', 'Once There Were Greenfields', 2,'In their next town, Ash &amp; co. meet up with Gardenia, the gym leader of Eterna City. Deciding to do a tag battle with James from Team Rocket, Ash &amp; Dawn battle James &amp; Gardenia. However, James Cacnea has trouble competing and Gardenia wants to help it become stronger. Will James allow Gardenia to take his Pokémon to train?',27);
insert into EPISODIO_ENTITY values (4819, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623241.jpg', 'Throwing the Track Switch!', 3,'On their way to Solaceon City, Ash &amp; Dawn are both prepping their Pokémon for their upcoming challenges. However, after emeting up with Zoey, Zoey suggests that Ash &amp; Dawn trade Aipom &amp; Buizel due to their tastes being in the other trainers vocation. Ash &amp; Dawn decide to take it out for a try. Will these Pokémon like the new ideas or will they want to stay with their original trainer?',27);
insert into EPISODIO_ENTITY values (4820, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623242.jpg', 'The Keystone Pops!', 4,'While training his New Buizel by the Lost Tower, Buizel accidentally destroys it and sets Spiritomb, the sealed ghost Pokémon free. When Spiritomb starts causing issues around the area, its up to Ash &amp; Co. to seal it back up. Will this be do-able or will Spiritomb be forever causing mischief?',27);
insert into EPISODIO_ENTITY values (4821, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623243.jpg', 'Bibarel Gnaws Best!', 5,'On their travels, Ash &amp; Co. discover that a bridge that has had construction halted on it. Wondering why, they find that the Bibarel and other Pokémon working on it have suddenly stopped. Ash &amp; co. volunteer to help build the bridge but will Bibarel and the other Pokémon prevent it?',27);
insert into EPISODIO_ENTITY values (4822, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623244.jpg', 'Nosing Round the Mountain!', 6,'On their travels, Ash battles a trainer with a Nosepass. However, when the battle moves out of the Mt. Coronet area, the trainer stops the battle explaining that he wants his Nosepass to evolve. Ash is happy to help out. However, after it evolves, Team Rocket steals Probopass. Ash &amp; the trainer have to hunt Team Rocket down and get it back. Will they succeed?',27);
insert into EPISODIO_ENTITY values (4823, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623245.jpg', 'Luxray Vision', 7,'On their travels, Ash &amp; Co. come across a castle. However as soon as they arrive they are attacked by Luxray. Whilst futily trying to find cover. Eventually the trainer calls it off and says that Luxray has been angsty due to the fact that it can no longer use Electric attacks since it has evolved. Team Rocket soon however capture Pikachu &amp; Luxray. Can the Pokémon be retrieved and will Luxray be able to use its electric attacks again?',27);
insert into EPISODIO_ENTITY values (4824, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623246.jpg', 'Journey to the Unown!', 8,'Finally in Solaceon Town, Ash &amp; co. visit the nearby ruins to investigate them. Inside, finding many of the alphabet Pokéon Unown, Ash &amp; co. discover that they have been enraged. Discovering Team Galactic in there, Ash &amp; Co. must work out what theyre doing and stop them...',27);
insert into EPISODIO_ENTITY values (4825, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623247.jpg', 'Team Shocker!', 9,'Its time for the Solaceon Contest. Dawn is eager to enter to try and earn her second Contest Ribbon. However, things get a bit heated when her old rival Kenny appears in order to compete in the Contest. This makes Dawn even more eager to enter the contest. Will she do well?',27);
insert into EPISODIO_ENTITY values (4826, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623248.jpg', 'Tanks for the Memories!', 10,'On their way to Veilstone, Ash &amp; Co. stop off at the Maid Café for a nice drink of Miltanks Milk. However, when they arrive, they learn of the troubles the Café is having, being under-staffed. Ash &amp; co. offer their services and soon become Maids in the Café...',27);
insert into EPISODIO_ENTITY values (4827, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623249.jpg', 'Hot Springing a Leak!', 11,'On their way to Veilstone, Ash &amp; Co. decide to stop off at some hot springs near where one of Dawns friends lives. However, when they get there, they discover that the Hot Springs have recently gone dry. Ash &amp; Co. decide to look for the reason why this has happened...',27);
insert into EPISODIO_ENTITY values (4828, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623250.jpg', 'Riding the Winds of Change!', 12,'On their way to Veilstone, Ash &amp; Co. bump into Paul and the gang discover a swarm of Gligar lead by a Glion that appear to be causing some issues in the town after being swept there from the nearby forest. Ash &amp; Paul decide to try and stop them. However, will they get more than they bargained for?',27);
insert into EPISODIO_ENTITY values (4829, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623251.jpg', 'Sleight of Sand!', 13,'On their way to Veilstone, Pachirisu gets stuck in a Hippowdon. While trying to get it out, Ash &amp; Co. discover that not one, but two Team Rocket groups are trying to capture the Hippowdon and the Hippopotas. With the help of his old Hippopotas friend, Ash must stop them. Will Team Rocket be stopped and will Pachirisu be rescued?',27);
insert into EPISODIO_ENTITY values (4830, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623252.jpg', 'Lost Leader Strategy!', 14,'Finally at Veilstone City, Ash &amp; co. meet the gym leader of the town Maylene. Ash hastily challenges her to a gym battle, to which she declines as she has lost faith in herself due to her recent loss to Paul. Her Lucario is angered by this, and Pauls brother arrives to help out...',27);
insert into EPISODIO_ENTITY values (4831, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623253.jpg', 'Crossing the Battle Line!', 15,'In an idea to boost both of their confidence, Dawn &amp; Maylene are to have an informal battle. Its a tense time as both have to regain their faith in themselves. With Dawn using Buneary, Piplup &amp; Ambipom and Maylene using her gym trained team including Lucario, a fierce battle is to ensue. Who will win?',27);
insert into EPISODIO_ENTITY values (4832, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623254.jpg', 'A Triple Fighting Chance!', 16,'After re-gaining her confidence in a battle with Dawn, Maylene accepts Ashs gym battle challenge. In a fierce 3 on 3 fight, Ash faces a tough challenge indeed. With Maylene using Machoke, Meditite and Lucario and Ash using Staravia, Chimchar &amp; Buizel, things are going to get tougher before they get easier. Will Ash finally win his 3rd Sinnoh Badge?',27);
insert into EPISODIO_ENTITY values (4833, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623255.jpg', 'Enter Galactic!', 17,'Deciding to move on to Pastoria City for the next gym bade, Ash &amp; Co. inadvertantly get caught up in a massive fiasco when Team Galactic turn. Eager to serve their evil purpose for world conquest, Saturn takes on Ash &amp; Co. in order to get a special artefact. Can Ash &amp; Co. stop Saturn or will the evil team get away with it?',27);
insert into EPISODIO_ENTITY values (4834, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623256.jpg', 'The Bells Are Singing!', 18,'On their way to the next town, Ash &amp; Co. meet a trainer who is putting on a magic act with her three Chingling. However, one of them cannot seem to get things right, and to make matters worse, James from Team Rocket wants one of the Chingling for his Chimecho to play with as well as the rest for Team Rocket. Can the Chingling be protected and learn the Magic Act?',27);
insert into EPISODIO_ENTITY values (4835, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623257.jpg', 'Pokémon Ranger and the Kidnapped Riolu! Part 1', 19,'On their travels, Ash &amp; Co. meet up with another Pokémon Ranger. The Rangerr is undercover to stop Pokémon Hunter J from capturing other Pokémon. Ash &amp; Co. discover that a Riolu is being hunted by J due to being able to use Aura before evolving. Ash &amp; Riolu start to bond with their shared Aura, but J is insistent on getting it. Will she succeed?',27);
insert into EPISODIO_ENTITY values (4836, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623258.jpg', 'Pokémon Ranger and the Kidnapped Riolu! Part 2', 20,'Hunter J has managed to take the Riolu. With the Ranger Hajime and their old Ranger friend Solana joining them, Ash &amp; Co. go to hunt down Hunter J and get Riolu back. However, J is far more formidable than anyone could have anticipated and Ash is stuck at the mercy of her Drapion. Will Ash manage to save Riolu and himself?',27);
insert into EPISODIO_ENTITY values (4837, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623259.jpg', 'Crossing Paths', 21,'As they travel towards the next town, Jessies Dustox becomes infatuated with a Shiny Dustox. It seems that it is now mating season for Dustox and as Dustox begins to find happiness, Jessie becomes conflicted on whether to keep Dustox, preventing it from being happy, or letting her old friend go...',27);
insert into EPISODIO_ENTITY values (4838, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623260.jpg', 'Pika and Goliath!', 22,'After losing to a Raichu in a trainer battle and becoming severely injured, Ash &amp; Pikachu start questioning themselves and wonder if the time has come to evolve. Drawing parallels upon the previous time this happened in Vermillion City, Pikachu is determined to show its true power. However, will it be able to defeat the Raichu without evolving? Or is Ash going to have a Raichu?',27);
insert into EPISODIO_ENTITY values (4839, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623261.jpg', 'Our Cup Runneth Over!', 23,'On their way to Pastoria City, while training, Ash &amp; co. meet up with Wallace, a legendary contest master. Dawn, wanting to participate in the Wallace Cup contest, is a bit nervous in front of Wallace and is reluctant to show Wallace her Pokémon and how she battles. Wallace however, is eager to give advice...',27);
insert into EPISODIO_ENTITY values (4840, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623262.jpg', 'A Full Course Tag Battle!', 24,'Near Lake Valor, Ash &amp; co. meet up with their old friend May, who has come to Sinnoh to participate in Wallaces special Wallace Cup for a Ribbon that can be used anywhere. Before the cup starts, the gang go to a restaurant at the Grand Lake Hotel where they can get a full course meal for free. The catch however, is that the winners of a tag battle will win the meal. Ash &amp; Brock team up while May &amp; Dawn also pair up for the challenges. Who will win?',27);
insert into EPISODIO_ENTITY values (4841, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623263.jpg', 'Staging a Heroes Welcome', 25,'The gang have arrived in Lake Valor where the Wallace Cup is taking place. meethin up with Zoey, the gang all joins in. Ash, May, Dawn, Zoey and Jessie in disguise enter into the Wallace Cup with hopes of winning the coveted ribbon. However, will they all get through the appeals?',27);
insert into EPISODIO_ENTITY values (4842, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623264.jpg', 'Pruning a Passel of Pals!', 26,'Having passed the appeal process in the Wallace Cup, the gang all move onto the next round; the battles. However, in reflection of their respective journeys, the gang get pumped for the battles. Will they all get through the next round?',27);
insert into EPISODIO_ENTITY values (4843, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623265.jpg', 'Strategy with a Smile!', 27,'Finishing her battle against Kite, Dawn moves onto the next round. Her opponent will be either May or Zoey depending on the battle outcome. It ends up being Dawn VS May in the finals. Who will win and receive the Wallace Cup Ribbon?',27);
insert into EPISODIO_ENTITY values (4844, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623266.jpg', 'The Thief That Keeps on Thieving!', 28,'Travelling to Pastoria, Ash &amp; Co. meet a trainer desperate to capture a Yanma. His last attempt had been thwarted by Team Rocket who captured it themselves. Ash &amp; Co. decide to assist the trainer. However, Jessie wants to try out her newly captured Yanma...',27);
insert into EPISODIO_ENTITY values (4845, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623267.jpg', 'Chim-Charred!', 29,'On their way to Pastoria, Ash &amp; co. bump into Paul. After having a dispute in how Pokémon should be raised, Ash challenges Paul to a 3 on 3 match which he accepts. However, in this match Ash uses his Chimchar which previously belonged to Paul. Chimchar is understandably angry at Paul due to its prior treatment and intends to win...',27);
insert into EPISODIO_ENTITY values (4846, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623268.jpg', 'Cream of the Croagunk Crop!', 30,'Ash &amp; Co. finally arrive in Pastoria City where they meet Crasher Wake, the gym leader. He mentions that there is a Croagunk Festival going on at the nearby Great Marsh. Brock is eager to enter with his Croagunk. Acting like a contest, the rounds show off Croagunks unique skills. However, Team Rocket wish to enter and obtain the Croagunk...',27);
insert into EPISODIO_ENTITY values (4847, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623269.jpg', 'A Crasher Course in Power!', 31,'Its time for Ashs gym battle against Crasher Wake. In a basic 3 on 3 match, Ash could face one of the hardest challenges of his Sinnoh career. Using Pikachu, Turtwig &amp; Buizel against Gyarados, Quagsire &amp; Floatzel, Ash has to use his Pokémons strengths to their full potential. Will he win the Fen Badge or does he need to go back to training?',27);
insert into EPISODIO_ENTITY values (4848, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623270.jpg', 'Hungry for the Good Life!', 32,'On their travels, Ash &amp; Co. arrive at the Pokémon Mansion owned by Mr. Backlot. When they arrive there, they meet a wild Swinub whom eats all the food that they cooked...to make matters worse, Team Rocket arrive intent on capturing all the Pokémon in the garden including Ash &amp; Co.s Pokémon. Can Ash &amp; Co. save their Pokémon and stop Swinub from eating all the food?',27);
insert into EPISODIO_ENTITY values (4849, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623271.jpg', 'Fighting Fear with Fear!', 33,'On their way to Hearthome City, Ash decides to train his Gligar so he can be as strong as they can be. While there, they meet up with Gary who is looking for Azelf at Lake Valor. Gary, still believing evolution is the key to a Pokémons strength, gives Ash a Razor Fang to evolve Gligar with. Ash however is reluctant despite Gligars wish to become stronger...',27);
insert into EPISODIO_ENTITY values (4850, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623272.jpg', 'Arriving in Style!', 34,'Back in Hearthome City, Ash discovers that the gym is closed again. Disappointed, the gang soon find out about a Pokémon Styling contest. Everyone is eager to join in, including Team Rocket. However, as there can only be one victor and both the trainer and the Pokémon have to take part, it could be tricky. Who will win?',27);
insert into EPISODIO_ENTITY values (4851, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623274.jpg', 'The Psyduck Stops Here!', 35,'On their way to Celestic Town, Ash &amp; co. find their path blocked by a group of Psyduck. Try as they might, the Psyduck do not yeild and continue to block their path. It seems theyre trying to protect their eggs, which are soon to hatch. However, the nearby lake is polluted. Can Ash &amp; Co. help? Will they be able to go to Celestic Town?',27);
insert into EPISODIO_ENTITY values (4852, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623276.jpg', 'Camping It Up', 36,'On their way to Celestic Town, Ash &amp; Co. meet up with Professor Rowan and find a Pokéon Summer School. In it, you get given a Pokémon to take care of and raise in order for you to use it at the end of the month and win a championship. Ash &amp; Co. all decide to join in. However, with these new Pokémon come new problems. Will they obey?',27);
insert into EPISODIO_ENTITY values (4853, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623277.jpg', 'Up Close and Personable', 37,'Continuing their Summer School adventure. Ash &amp; Co. are sent to a nearby lake to investigate reports that Pokémon are getting hypnotised there. Their task is to work out whats behind it and write a report on it. However, everyone wants to find out the reason first. Who will write the best report?',27);
insert into EPISODIO_ENTITY values (4854, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623278.jpg', 'Ghoul Daze', 38,'Continuing their Summer School adventure. Ash &amp; Co. are sent to investigate some supernatural goings on nearby for a report at the school. Upon investigating the area, they all discover a variety of ghost Pokémon. However, as well as the Pokémon, there is another paranormal entity. Does it have sinister motives?',27);
insert into EPISODIO_ENTITY values (4855, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623279.jpg', 'One Team, Two Team, Red Team, Blue Team', 39,'Its the end of the Summer School and time to see who is the most triumphant. How is this eventually determined? By a Triathlon race over land, sea and sky. Each trainer has to choose a random Pokéball for their companion for each part making it a very hard contest of strength, skill and knowledge. Who will win?',27);
insert into EPISODIO_ENTITY values (4856, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623280.jpg', 'A Lean Mean Team Rocket Machine', 40,'In the aftermath of the Pokémon Summer School, Team Rocket have come to live the life of luxury a bit too much and soon discover that they have lost the mission. Eager to get back to their routes, Team Rocket begin rigourous training and have their eyes set on a new place to steal Pokémon from, going back to their first appearance; a Pokémon Center...',27);
insert into EPISODIO_ENTITY values (4857, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623281.jpg', 'Playing the Leveling Field', 41,'As the gang get to Celestic Town for a Pokémon Contest, Ash &amp; Co. bump into the Hearthome Gym Leader, Fantina. Ash is eager to see her battle, however she is more interested in the upcoming contest. She does agree to a practice match, but is Ash biting off more than he can chew?',27);
insert into EPISODIO_ENTITY values (4858, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623282.jpg', 'Doc Brock!', 42,'On their way to Celestic Town for the next Contest. Ash &amp; Co. are training their Pokémon when Pachirisu gets a surge of lightning on it. As they are in the middle of nowhere, treatment seems to be a tricky thing to accomplish. Will Pachirisu be ok?',27);
insert into EPISODIO_ENTITY values (4859, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623283.jpg', 'Battling the Generation Gap!', 43,'Finally in Celestic Town, Dawn &amp; co. arrive just in time for the Pokémon Contest. When they go to enter, Dawn finds out that a rival of her mothers is entering in the contest. With a seasoned co-ordinator as one of her opponents, Dawn could be facing the hardest contest of her career so far. Will she win?',27);
insert into EPISODIO_ENTITY values (4860, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623284.jpg', 'Losing Its Lustrous!', 44,'While training in Celestic Town for his upcoming Hearthome Gym match, Ash &amp; Co. meet up with Cynthia. While there, an old friend of Cynthias Grand Mother appears. This friend is eager to get to the ruins. However, the police of Sinnoh are all looking for Team Galactic and their leaders as theyve had reports that they are planning to steal the Adamant &amp; Lustrous Orbs...',27);
insert into EPISODIO_ENTITY values (4861, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623285.jpg', 'Double Team Turnover!', 45,'The Celestic Ruins have been attacked by Cyrus and the other leaders of Team Galactic. Searching for the Adamant &amp; Lustrous Orbs, Cyrus intends to summon Dialga &amp; Palkia. However, Jenny, Cynthia and Ash &amp; co. are all set to stop Team Galactics evil schemes. Team Rocket, on the other hand, have plans of their own...',27);
insert into EPISODIO_ENTITY values (4862, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623286.jpg', 'If the Scarf Fits, Wear It!', 46,'Back in Solaceon Town on their way to Hearthome, Ash &amp; Co. meet up with Aoi and her family at the breeding centre. When they arrive, they find out about a huge flying monster thats around town at night. Ash &amp; Co. decide to investigate. What could it be?',27);
insert into EPISODIO_ENTITY values (4863, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623287.jpg', 'A Trainer and Child Reunion!', 47,'On their way to Hearthome City, Ash &amp; Co. meet up with Aaron, one of the Elite Four of Sinnoh. When they meet up with him, they see Aaron is training both himself and his bug Pokémon. However, he is in the area since hes looking for a Wurmple he let go. Ash &amp; Co. offer to help, however Team Rocket are in the area trying to steal some Pokémon. Can Ash &amp; Co. find the Wurmple?',27);
insert into EPISODIO_ENTITY values (4864, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623288.jpg', 'Aiding the Enemy!', 48,'Travelling back to Hearthome City, Ash &amp; Co. bump into Paul. Ash is eager to show up Paul and beat him so he challenges him to a battle. Using Turtwig in battle, Turtwig evolves when the goings get tough. However, after evolving, it loses its speed and thus its confidence. Will Grotle manage to get it back?',27);
insert into EPISODIO_ENTITY values (4865, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623289.jpg', 'Barrys Busting Out All Over!', 49,'Back at Hearthome City, Ash is eager to challenge Fantina to a gym battle. However, before he gets a chance, he meets up with a trainer called Jun, from the same town as Dawn. Upon meeting, Ash learns that Jun is a trainer who follows Pauls training method; looking for strong Pokémon and getting rid of weaker ones. Ash is annoyed by this and intends to show Jun the proper way to train. The pair do battle...',27);
insert into EPISODIO_ENTITY values (4866, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623290.jpg', 'Shield with a Twist!', 50,'Its a time of Contests &amp; Gym Battles in Hearthome City. While Ash finally challenges Fantina to a Gym battle, Jessie partakes in another of Hearthome Citys contests. Ash is facing one of the toughest battles yet against Fantinas Ghost Pokémon. Will he manage to beat Fantina and get the Relic Badge?',27);
insert into EPISODIO_ENTITY values (4867, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623291.jpg', 'Jumping Rocket Ship!', 51,'Taking a blimp to Canalave City, Ash &amp; Co., travelling with Jun, end up exiting the blimp and getting separated with their Pokémon. With the various groups all separated and with Pokémon they dont normally hang out with, the groups need to all come together so they can get to Canalave City. Will they find eachother or will they be stuck forever?',27);
insert into EPISODIO_ENTITY values (4868, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623292.jpg', 'Sleepless in Pre-Battle!', 52,'In Canalave City, while exploring and looking for the gym, Ash &amp; Co. fall into the world of nightmares. It seems that Darkrai is nearby and lettling loose its dark powers. However, legends say Cresselia is also nearby and when she appears, a climatic battle between Cresselia &amp; Darkrai is sure to take place...',27);
insert into EPISODIO_ENTITY values (4869, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623462.jpg', 'Get Your Rotom Running!', 1,'Ash contacts Professor Oak who tells them about a hotel in the city that serves a delicious dessert. They head to the hotel, but it is closed. As they turn to leave the door mysteriously opens. They then head inside where they are attacked by a Rotom.',27);
insert into EPISODIO_ENTITY values (4870, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623463.jpg', 'A Breed Stampede!', 2,'While awaiting the return of the Canalave Gym Leader, Ash decides to train. Dawn also decides to begin training her newly evolved Piloswine for its contest debut. However, Piloswine begins to ignore Dawn. Trying to reconnect with it, Dawn enrolls in a "Pokémon Friendship School".',27);
insert into EPISODIO_ENTITY values (4871, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623464.jpg', 'Ancient Family Matters!', 3,'Roark, the Oreburgh Gym Leader, and son of Byron, the Canalave Gym Leader, is visiting his father. The two of them, both users of Fossil Pokémon, are having an argument about who likes them more; and they end up battling. Meanwhile, Ash has returned to the Canalave Gym for a Gym Battle after hearing that Byron is back.',27);
insert into EPISODIO_ENTITY values (4872, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623465.jpg', 'Dealing with Defensive Types!', 4,'Ash finally gets to battle the Canalave City Gym Leader, Byron. In the first round Byron chooses his Bronzor, while Ash uses Chimchar. Ash tries to use Chimchars type-advantage to score an early victory, but this begins to prove ineffective when he learns that Byron has a defensive style of battling.',27);
insert into EPISODIO_ENTITY values (4873, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623466.jpg', 'Leading a Stray!', 5,'Ash and friends are having lunch when all of a sudden a Luxio comes along and steals all of their food. They follow it into the sewers where they discover a Wailmer that is trapped in the sewer and cant make it back to the ocean.',27);
insert into EPISODIO_ENTITY values (4874, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623467.jpg', 'Steeling Peace of Mind!', 6,'Everyone is getting prepared to leave Canalave City to head to Dawns next contest. Before they leave, Ash calls Barry to tell him of his win at the Canalave Gym. Barry is at Iron Island, and something is currently wrong with his Empoleon. Ash, Dawn, and Brock head to Iron Island to see him, but all of the steel pokémon are going crazy. A man named Riley appears and helps them, and they decide to find the source of the problem.',27);
insert into EPISODIO_ENTITY values (4875, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623468.jpg', 'Saving the World from Ruins!', 7,'Ash, Dawn, and Brock, along with their new friend Riley search for the source of the mysterious waves affecting the Steel Pokémon, and find Team Galactic. What is Team Galactics plan, and what do they want with the ruins on Iron Island?',27);
insert into EPISODIO_ENTITY values (4876, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623469.jpg', 'Cheers on Castaways Isle!', 8,'Ash and friends decide to take a boat to the location of the next contest. On the ride Team Rocket appear and steal Pikachu and Piplup. They manage to escape but they wind up on a deserted island. Will they be able to make it back to their trainers?',27);
insert into EPISODIO_ENTITY values (4877, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623470.jpg', 'Hold the Phione!', 9,'Ash and friends arrive in the town where Dawn will enter her next Pokémon Contest. They find out that a lot of people have come to the town in order to see the legendary Pokémon Phione, who lives in the surrounding sea. Legend has it that anyone who sees Phione will have good luck, so Dawn decides to try and catch a glimpse of it.',27);
insert into EPISODIO_ENTITY values (4878, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623471.jpg', 'Another One Gabites the Dust!', 10,'Dawn is getting ready to participate in her next contest. She meets a girl with a Gabite who is not so friendly. She believes that Dawns victory in the Wallace Cup was pure luck and is determined to defeat Dawn. Dawn is now determined to defeat her and prove that her win was not just luck.',27);
insert into EPISODIO_ENTITY values (4879, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623685.jpg', 'Stealing the Conversation!', 11,'Ash and friends arrive in a town where an Officer Jenny and her Chatot are working hard to find Team Rocket and arrest them. Jenny wants Ash and friends to help.',27);
insert into EPISODIO_ENTITY values (4880, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623686.jpg', 'The Drifting Snorunt!', 12,'Ash and friends are lost in a blizzard when they run into a Froslass. Froslass leads the trainers to a small lodge, where it provides them with warm soup and a bath. But is it as friendly as it seems?',27);
insert into EPISODIO_ENTITY values (4881, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623687.jpg', 'Noodles! Roamin Off!', 13,'After yet another failed attempt to steal Ashs Pikachu, Team Rocket wind up at a Ramen shop. Jessie and James are surprised when they discover that the shop owner was one of their underclassmen from their days at the Team Rocket training facility.',27);
insert into EPISODIO_ENTITY values (4882, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623688.jpg', 'Pursuing a Lofty Goal!', 14,'On the way to Snowpoint City, Ash and friends stop in a town where a PokéRinger competition is to be held. Ash is eager to participate in the contest with Staravia. However, he soon finds out that Paul is also entering with his Honchkrow.',27);
insert into EPISODIO_ENTITY values (4883, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623689.jpg', 'Trials and Adulations!', 15,'On the way to the next town, Ash and friends decide to stop and take a break. Dawn heads to a river to fill up her canteen, but is attacked by a wild Aggron and falls into the river. She manages to get out of the river far down stream, and is now lost from Ash and Brock. Aggron returns and after calling out Mamoswine, it is badly hurt. Now, Dawn must take care of Mamoswine by herself, and hide from Team Rocket and Aggron at the same time.',27);
insert into EPISODIO_ENTITY values (4884, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623690.jpg', 'The Lonely Snover!', 16,'On the way to Snowpoint City, Ash and friends suddenly find themselves stuck in a bunch of traps. Soon a Snover pops out of the bushes. Its is very playful and wants to be with someone. Team Rocket, however, want to steal Snover for themselves.',27);
insert into EPISODIO_ENTITY values (4885, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623691.jpg', 'Stopped in the Name of Love!', 17,'On the way to Dawns next contest, Piplup suddenly begins to show signs of evolving. When they arrive at the next Pokémon Center, Kenny and Barry are there as well. Dawn and Piplup must decide whether or not to have Piplup evolve into Prinplup, while trying to fend off Team Rocket who want to capture Dawns Piplup, Kennys Prinplup, and Barrys Empoleon to have a complete evolutionary set.',27);
insert into EPISODIO_ENTITY values (4886, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623692.jpg', 'Old Rivals, New Tricks!', 18,'Ash and friends have arrived at the location of Dawns next Pokémon Contest. With only one more ribbon needed to enter the Grand Festival, she is extremely excited. With both Jessie and Kenny entering the contest, however, will Dawn be able to pull off a win?',27);
insert into EPISODIO_ENTITY values (4887, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623693.jpg', 'To Thine Own Pokémon Be True!', 19,'After learning about a Pokemon Ping Pong Tournament from Barry, Dawn decides to enter. The previous champion sees them preparing and notes that Dawn is a shoe-in for victory with her Ambipom, who seems to have a natural talent for the game.',27);
insert into EPISODIO_ENTITY values (4888, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623694.jpg', 'Battling a Cute Drama!', 20,'Ash and friends stop in a town on the way to Snowpoint City. There they meet a girl who only likes cute Pokémon. After she insults Dawns Piplup, Dawn challenges her to a battle.',27);
insert into EPISODIO_ENTITY values (4889, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623695.jpg', 'Classroom Training!', 21,'Ash and friends finally arrive in Snowpoint City. They are welcomed by the Gym Leader, Candice. She offers to show them around town. She brings them to a trainers school where she is a teacher.',27);
insert into EPISODIO_ENTITY values (4890, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623696.jpg', 'Sliding Into Seventh!', 22,'Ash finally arrives at Snowpoint Gym for his battle with Candice. This gym will be different from his previous gym challenges, with each trainer using 4 pokémon each. Can Ash defeat Candice and win his seventh badge?',27);
insert into EPISODIO_ENTITY values (4891, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623697.jpg', 'A Pyramiding Rage!', 23,'At the Snowpoint City Pokémon Center, Ash and friends run into Paul, who has come to town to challenge Candice. Surprisingly Pauls brother Reggie also arrives at the center. To add to the surprises, Pyramid King Brandon arrives in Snowpoint City. After Ash and Reggie talk about their great battles in Kanto, Paul becomes upset and challenges Brandon to a battle.',27);
insert into EPISODIO_ENTITY values (4892, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623698.jpg', 'Pillars of Friendship!', 24,'Pokémon Hunter J arrives in Snowpoint City and targets the legendary Pokémon Regigigas, which is sleeping inside the Snowpoint Temple. After J commands her henchmen to launch an attack, a maiden from the shrine asks Ash and his friends for help. But Ash and the others come too late; Regigigas has been reawakened and starts rampaging.',27);
insert into EPISODIO_ENTITY values (4893, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623699.jpg', 'Frozen on Their Tracks!', 25,'Ash &amp; Co. are heading to Lake Acuity on a train. While travelling, they meet Looker, a member of the International Police, whom is in the area looking for Team Galactic. However, problems arise on the train and the Ampharos running the train, along with a few of the gangs Pokémon are seperated from the gang...',27);
insert into EPISODIO_ENTITY values (4894, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623700.jpg', 'Pedal to the Mettle!', 26,'Ash and friends arrive at Lake Acuity, the site where Ash and Paul will have their full 6-vs-6 battle. After healing his Pokémon, Ash meets up with Paul and the two begin their long awaited battle. Who will ultimately be victorious?',27);
insert into EPISODIO_ENTITY values (4895, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623701.jpg', 'Evolving Strategies!', 27,'Ash and Paul continue their 6-on-6 battle. With both teams fighting extremely hard it could be anyones match, so Paul calls out his newly evolved Magmortar, hoping it will secure him victory.',27);
insert into EPISODIO_ENTITY values (4896, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623702.jpg', 'Uncrushing Defeat!', 28,'With all of his Pokémon weak and injured from the battle with Paul, Ash rushes to the Pokémon Center in order to get them healed. Nurse Joy does not, however, have the berry needed to properly heal Monferno. Brock decides to help and heads to Lake Acuity to find it. While at the lake, something strange happens....',27);
insert into EPISODIO_ENTITY values (4897, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623703.jpg', 'Promoting Healthy Tangrowth!', 29,'Dawn decides to start training for the next Pokemon Contest with Mamoswine. However, despite overcoming its disobedience, Mamoswine still wont battle. Things turn bad when Mamoswine runs into a forest and Dawn chases after it.',27);
insert into EPISODIO_ENTITY values (4898, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623704.jpg', 'Beating the Bustle & Hustle!', 30,'Dawns favorite television show, Pokémon Hustle, is searching for actors near their current locations, and Dawn decides to try out for the show. Ash and Brock decide to try out, as well.',27);
insert into EPISODIO_ENTITY values (4899, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623705.jpg', 'Gateway to Ruin!', 31,'Ash and friends are on their way to the town where Dawns next contest will be held. They arrive at Mt. Coronet, the massive mountain that divides the Sinnoh region in half. The mountain also divides the regions pokémon, like Shellos. The Blue and Pink Shellos have ended up on the opposite side of the mountain, and while trying to figure out why, Piplup falls into an artificial tunnel, and when they go to rescue him, they come across something sinister.',27);
insert into EPISODIO_ENTITY values (4900, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623706.jpg', 'Three Sides to Every Story!', 32,'While on the way to Twinleaf Town, Piplup falls in love with a Marill. However, an Elekid also has its sights on Marill. What will become of this love triangle, especially when Team Rocket show up?',27);
insert into EPISODIO_ENTITY values (4901, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623707.jpg', 'Strategy Begins at Home!', 33,'Ash and friends go to Dawns hometown of Twinleaf. Upon arrival, they find that they made it in time for the Twinleaf Town Festival, where a Pokémon Contest is about to be held. Dawn decides to enter, and it isnt long before she finds herself facing none other than her mother, Johanna, in battle. Knowing that Johanna won the Grand Festival in the past, will Dawn be able to defeat her?',27);
insert into EPISODIO_ENTITY values (4902, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623708.jpg', 'A Faux Oak Finish!', 34,'As the Twinleaf Town Festival continues, Ash and friends are surprised when they find that one of the upcoming Pokémon courses is to be hosted by none other than Professor Oak. Trouble starts brewing, however, when James brings back an old plan: to disguise himself as the professor.',27);
insert into EPISODIO_ENTITY values (4903, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623709.jpg', 'Historical Mystery Tour!', 35,'Ash and friends are still enjoying the Twinleaf Festival when they run into Barry. Wanting to see how the other one has improved, Ash and Barry decide to have a battle. However, plans are put on hold when the mysterious Xatu appears out of nowhere.',27);
insert into EPISODIO_ENTITY values (4904, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623710.jpg', 'Challenging a Towering Figure!', 36,'Ash and friends find out that the main event for the Twinleaf Town Festival is a battle tournament, and the winner gets to have a battle with the Sinnoh Battle Frontier Brain, Palmer. Excited about that, Ash enters the tournament with hopes of battling him.',27);
insert into EPISODIO_ENTITY values (4905, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623711.jpg', 'Where No Togepi Has Gone Before!', 37,'The Twinleaf Town Festival has concluded, and Ash and friends continue their journey to the town hosting Dawns next Pokémon Contest. The three soon fall into yet another one of Team Rockets traps. However, things are not what they seem. A mischievous Togepi stirs up trouble for everyone and in the end they must work together in order to stop Togepi.',27);
insert into EPISODIO_ENTITY values (4906, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623712.jpg', 'An Egg Scramble!', 38,'Ash and friends arrive at a festival promoting the Johto region where they meet two trainers from the Johto Region and their starters, Chikorita and Totodile. At the festival, Dawn and the girl have a battle over a Pokémon egg. However, Team Rocket also has their eyes on the egg.',27);
insert into EPISODIO_ENTITY values (4907, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623713.jpg', 'Gone with the Windworks!', 39,'The two Johto trainers decide to join Ash, Dawn, and Brock on their journey. While on the way to Dawns next contest, the group stops near the Valley Windworks for Dawn to do some training. When Marill goes missing, the group heads into the windworks to find it, but once inside they are attacked by wild Pokémon and become trapped. Will they be able to escape the building?',27);
insert into EPISODIO_ENTITY values (4908, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623714.jpg', 'A Rivalry to Gible On!', 40,'While on the way to the Dawns contest, Ash and friends encounter a wild Gible, a very rare Dragon-Type Pokémon. Ash and Kazunari are both interested in capturing one, and they both go after it. Who will catch Gible?',27);
insert into EPISODIO_ENTITY values (4909, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623715.jpg', 'Dressed for Jess Success!', 41,'The time for the Lilypad Pokémon Contest has finally arrived. Dawn is excited for the contest since she still only needs one more ribbon in order to get into the Grand Festival. Meanwhile, when Jessie gets sick, James takes her place in the contest. Who will win the contest?',27);
insert into EPISODIO_ENTITY values (4910, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623716.jpg', 'Bagged Then Tagged!', 42,'Following the pokémon contest, Ash and friends decide to take a break. While they rest, they decide to have a tag battle since Lyra and Khoury have to return to Johto soon. However, before that happens Team Rocket shows up and steals Pikachu and Piplup, putting their plans on hold.',27);
insert into EPISODIO_ENTITY values (4911, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623717.jpg', 'Try for the Family Stone!', 43,'Still on the way to Sunyshore City so Ash can battle for his final Sinnoh Gym Badge, Ash and friends meet a female trainer and her Misdreavus who are battling a Murkrow for a Dusk Stone, which has the power to evolve Misdreavus into Mismagius. It also has the power to evolve Murkrow into Honchkrow, so she is frantic to get the stone.',27);
insert into EPISODIO_ENTITY values (4912, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623718.jpg', 'Sticking with Who You Know!', 44,'On the way to Sunyshore City, Ash and friends stop in a forest. Things start to get chaotic, however, as Pikachu gets upset with Piplup in a debate over which of them Ash likes best. However, a mysterious wave all of a sudden makes the two Pokémon inseparable, so Ash and the others must solve the problem.',27);
insert into EPISODIO_ENTITY values (4913, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623719.jpg', 'Unlocking the Red Chain of Events!', 45,'On the way to Sunyshore City, Ash and friends are walking through a grassland and come across Meowth of Team Rocket, who is injured. When they ask him what happened while treating his wounds, Meowth says that he was attacked by Team Galactic in a large building called the Fuego Ironworks. Not only that, Jessie, James, and even Looker of the International Police have been captured. Upon hearing this, Ash and the others decide to head to the Fuego Ironworks to save them.',27);
insert into EPISODIO_ENTITY values (4914, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623720.jpg', 'The Needs of the Three!', 46,'Team Galactic has almost achieved its ultimate goal. In order to complete their plan, Cyrus hires Pokémon Hunter J to catch the legendary Lake Guardians, Azelf, Uxie, and Mesprit. Will J and Team Galactic succeed, or will Ash and friends put a stop to their plans?',27);
insert into EPISODIO_ENTITY values (4915, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623721.jpg', 'The Battle Finale of Legend!', 47,'Cyrus has succeeded in his goal of awakening Dialga and Palkia and now the entire Sinnoh region is in danger. Cyrus plans to rebuild the world in his image, but that means the destruction of everything. Can Ash, Dawn, Brock, Looker, and Cynthia stop Team Galactic and save Sinnoh?',27);
insert into EPISODIO_ENTITY values (4916, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623722.jpg', 'The Treasure is All Mine!', 48,'With only one more badge needed to enter the Sinnoh League, Ash and friends resume their journey to Sunyshore City. Meanwhile, James stumbles upon a treasure chest that holds a big secret.',27);
insert into EPISODIO_ENTITY values (4917, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623723.jpg', 'Mastering Current Events!', 49,'While on the way to Sunyshore City, Ash and friends meet a master of air battles. Hoping to improve Gliscors flying, Ash decides to have a battle with him, and the results may be more than he expected.',27);
insert into EPISODIO_ENTITY values (4918, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623724.jpg', 'Double-Time Battle Training!', 50,'Knowing that the next contest is going to be a double performance, Dawn begins training Mamoswine and Cyndaquil. Zoey arrives and decides to help Dawn with her training.',27);
insert into EPISODIO_ENTITY values (4919, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623725.jpg', 'Meteoric Rise to Excellence!', 51,'On the way to Dawns next Pokémon Contest, Ash and friends come across a wild Gible. Gible is determined to learn the powerful move Draco Meteor, so Ash decides to help by doing some special training with it.',27);
insert into EPISODIO_ENTITY values (4920, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623726.jpg', 'Gotta Get a Gible!', 52,'Ash and friends continue on their way to the next town when they notice that the Gible they helped has been following them. Ash decides to try and catch it, but Barry shows up and wants to catch it too. Now the two trainers race to capture it first.',27);
insert into EPISODIO_ENTITY values (4921, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623727.jpg', 'Regaining the Home Advantage!', 1,'On the way to Dawns next contest, Ash and friends encounter a Magnezone in a forest. The Magnezone is enraged and is quickly heading for a nearby town, so Ash and the others try to stop the rampaging Pokémon before it makes it to the city.',27);
insert into EPISODIO_ENTITY values (4922, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623728.jpg', 'Short and to the Punch!', 2,'While on the way to the next contest town, Gible falls in a river. Buizel saves it. This attracts the attention of a trainer, who wants to have a battle between Buizel and his Mr. Mime. Ash agrees. Mr. Mime proves to be too strong for Buizel though. Following this loss, Buizel is determined to get stronger and defeat Mr. Mime.',27);
insert into EPISODIO_ENTITY values (4923, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623729.jpg', 'A Marathon Rivalry!', 3,'On the way to the next contest, Ash and friends meet a trainer who is training for a competition known as the Pokéathlon. Interested in what it is, they decide to go check it out. Ash then decide to enter the competition.',27);
insert into EPISODIO_ENTITY values (4924, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623730.jpg', 'Yes in Dee Dee, Its Dawn!', 4,'Contest day has finally arrived and Dawn is trying to perfect Mamoswine and Cyndaquils "Flame-Ice" combination. However, a Plusle and Minun shows up. Dawn begins to act strangely, revealing that she has a bad experience with a Plusle and Minun in the past. Things are made worse when Dawns mean spirited rival Ursula shows up. Ursula is ready to defeat Dawn. Can Dawn keep it together for the contest?',27);
insert into EPISODIO_ENTITY values (4925, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623731.jpg', 'Playing the Performance Encore!', 5,'Dawn and Ursula have made it past the first round and must now face each other in battle. Although Mamoswine and Cyndaquil are doing great, Ursula has a secret plan for Plusle and Minun. Will Dawn be able to defeat Ursula and win her fifth and final ribbon?',27);
insert into EPISODIO_ENTITY values (4926, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623732.jpg', 'Fighting Ire with Fire!', 6,'On the way to Sunyshore City, Ash and friends run into Barry, who has just recently defeated the Sunyshore Gym Leader, winning a badge. Ash and Barry decide to have a battle, Empoleon vs. Monferno. During the battle Monfernos Blaze ability becomes activated and trouble begins. Meanwhile, Team Rocket is planning on stealing all of their pokémon.',27);
insert into EPISODIO_ENTITY values (4927, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623733.jpg', 'Piplup, Up and Away!', 7,'Piplup is getting sick and tired of being constantly hit by Gibles failed Draco Meteor attacks. Fed up, Piplup runs away, and heads towards Professor Rowans lab. Will Dawn be able to find her beloved Pokémon?',27);
insert into EPISODIO_ENTITY values (4928, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623734.jpg', 'Flint Sparks the Fire!', 8,'Ash and friends have finally arrived in Sunyshore City, where Ash will challenge the Gym Leader and try to win his eighth badge. However, something is wrong with Volkner, the Gym Leader, and he does not seem interested in battling at all. However, his friend, Flint of the Sinnoh Elite Four has an idea to rekindle his spirit.',27);
insert into EPISODIO_ENTITY values (4929, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623735.jpg', 'The Fleeing Tower of Sunyshore!', 9,'Ash is finally going to battle Volkner, the Gym Leader of Sunyshore City so he can get his eighth badge and qualify for the Sinnoh League. However, a mysterious power outage occurs, canceling the battle. Everyone heads to Sunyshore Tower, the source of the citys power, but it has disappeared! Now they must somehow trace it and bring it back.',27);
insert into EPISODIO_ENTITY values (4930, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623736.jpg', 'Teaching the Student Teacher!', 10,'With Ashs Sunyshore Gym match delayed, Ash and friends head towards Lake Valor for the Grand Festival. They meet up with Dawns mother Johanna who asks them to help out at a school. They help out, but things get hectic, especially when a kid takes a "liking" to Piplup. Dawn decides to use this time at the school to perfect some combos for the Grand Festival, while Jessie sets her sights on her fourth ribbon.',27);
insert into EPISODIO_ENTITY values (4931, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623737.jpg', 'Keeping in Top Forme!', 11,'Continuing on to the Grand Festival, Ash and friends find a girl named Marley in a river and swiftly bound for a waterfall. Brock rescues her, and they find out that a legendary Shaymin is with her, injured by a group of thugs who want to steal it. Team Rocket, who are the ones responsible, set out in an attempt to nab Shaymin once more. Ash and friends, knowing the danger, join Marley in helping to keep Shaymin safe while returning it to its friends.',27);
insert into EPISODIO_ENTITY values (4932, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623738.jpg', 'An Elite Coverup!', 12,'On the way to the Grand Festival at Lake Valor, Ash and friends arrive in a small town and run into a young boy who left his Magby at what was apparently a fake Daycare Center. As a result, it was stolen, so Ash and friends decide to help. After they begin their search for Magby, they encounter a woman who introduces herself as Bertha, and who also seems to know how to find Magby. While Ash and Dawn dont see it themselves, Brock realizes who Bertha is. What is Berthas secret?',27);
insert into EPISODIO_ENTITY values (4933, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623739.jpg', 'Dawn of a Royal Day!', 13,'Ash and friends arrive in a town where they find out that one of the last contests before the Grand Festival is going to be held. Since Dawn already has her fifth ribbon, however, she decides not to participate. As theyre moving on, a woman comes up to them and asks them to follow, bringing them to a princess by the name of Salvia. Surprisingly, Salvia looks as if she could be Dawns identical twin, and because of this, the former asks Dawn if she could take her place as princess for one day so that she could participate in the Pokémon Contest. How will Dawn react to this extraordinary request?',27);
insert into EPISODIO_ENTITY values (4934, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623740.jpg', 'With the Easiest of Grace!', 14,'With the Grand Festival coming up soon, Dawn begins to train with her new Togekiss. Togekiss likes to move as elegantly as possible when performing a move in battle which causes confusion. Meanwhile, Jessie decides that Togekiss is perfect for her, and sets her sights on catching it.',27);
insert into EPISODIO_ENTITY values (4935, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623741.jpg', 'Dealing with a Fierce Double Ditto Drama!', 15,'Ash and friends finally arrive at Valor Lakefront, site of the Grand Festival. Trouble ensues, however, when they encounter a girl named Makina, dressed up as Flint of the Elite Four, and owner of two Ditto; one of alternate coloration. Despite the fact that shes only been a trainer for a month, Makina mocks Ash for being a "newbie," and loudly proclaims that regular trainers and Gym Leaders alike would run in fear from her two Ditto (which is her reason for not having any gym badges). When battling Ash, however, Makinas tough facade starts to break, and she shows that shes not exactly as "all-powerful" and as she claims.',27);
insert into EPISODIO_ENTITY values (4936, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623742.jpg', 'Last Call, First Round!', 16,'Ash and friends return to Lake Valor where the Grand Festival is to begin shortly. Dawn reunites with her rivals and gets ready for the first round. The first round is a double performance, and Dawn chooses Buneary and Cyndaquil. Will she make it past the first round?',27);
insert into EPISODIO_ENTITY values (4937, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623743.jpg', 'Opposites Interact!', 17,'The Grand Festival continues and Dawn and her rivals have made it past the appeals round, and have moved on to the battle rounds. Dawns first opponent is Ursula, who decides to use Gabite and and her newly evolved Flareon. Along with Mamoswine and Pachirisu, will Dawn be able to defeat Ursula and progress to the Top 16 round?',27);
insert into EPISODIO_ENTITY values (4938, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623744.jpg', 'Coming Full Festival Circle!', 18,'As the Grand Festival rages on, Dawn, Zoey, Nando, and Jessie battle their way past tons of talented coordinators and the four of them arrive in the Top 4. The first battle is Zoey vs. Nando. Nando chooses Kricketune and his new Lopunny while Zoey goes with Leafeon and her newly evolved Mismagius. As the battle goes on, both trainers put on an amazing battle, with neither giving an inch. Later, Dawn and Jessie take the stage for their battle. Which two coordinators will advance to the final stage and battle for the Ribbon Cup?',27);
insert into EPISODIO_ENTITY values (4939, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623745.jpg', 'A Grand Fight for Winning!', 19,'The final round of the Grand Festival has arrived. As they promised long ago, Dawn and Zoey are the final two contestants. As the battle begins, Zoey chooses her Glameow and her newly evolved Gallade, while Dawn goes with Piplup and Togekiss. With only one battle standing between them and the Ribbon Cup the battle is sure to be fierce, but who will ultimately win?',27);
insert into EPISODIO_ENTITY values (4940, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623746.jpg', 'Pokémon Ranger: Heatran Rescue!', 20,'Ash and friends encounter a Pokémon Ranger named Ben. They find out that the legendary Heatran has been disturbed and is now going on a rampage, and Ben is on a mission to calm it down. Meanwhile, Team Rocket decide to catch Heatran, eager for the legendary Pokémons power.',27);
insert into EPISODIO_ENTITY values (4941, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623747.jpg', 'For the Love of Meowth!', 21,'With the Grand Festival over, Ash and friends begin to head back to Sunyshore City. Team Rocket is once again in pursuit, but their plans are put on hold when Meowth falls in love with another Pokémon. Now he must choose whether or not to follow his new love, or stay with Jessie and James.',27);
insert into EPISODIO_ENTITY values (4942, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623748.jpg', 'The Eighth Wonder of the Sinnoh World!', 22,'Ash and friends return to Sunyshore City and Ash is excited to finally get the chance to battle Volkner to try and win his eighth and final badge. Will Ash be able to defeat Volkner and finally be able to qualify for the Sinnoh League?',27);
insert into EPISODIO_ENTITY values (4943, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623749.jpg', 'Four Roads Diverged in a Pokémon Port!', 23,'Ash and friends run into Kenny who is having a special training session with Olivine Gym Leader Jasmine. Kenny is already preparing for the next Grand Festival, and this worries Dawn as she has not decided what her next step will be. Kenny challenges Ash to a battle and says that if he defeats him, then Dawn must travel with him. Who will win the battle?',27);
insert into EPISODIO_ENTITY values (4944, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623750.jpg', 'Bucking the Treasure Trend!', 24,'Ash and friends board a ship which will take them to the location of the Sinnoh League. On the boat they meet a trainer named Buck. They decide to help him find a treasure which is said to be located on a nearby island.',27);
insert into EPISODIO_ENTITY values (4945, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623751.jpg', 'An Old Family Blend!', 25,'It is almost time for the Sinnoh League competition to start. Knowing that the Sinnoh League is going to be tough with rivals like Barry and Paul competing, Ash decides it is best if he uses Pokémon not only from his Sinnoh journey, but all his other past journeys as well. However, which ones will he choose.',27);
insert into EPISODIO_ENTITY values (4946, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623752.jpg', 'League Unleashed!', 26,'The first round of the Sinnoh League begins. Ashs first opponent is Nando. Sending out Staraptor against Nandos Roserade, he thinks he has a good advantage. However, Nando is no push over and begins to take the lead. Will Ash be able to defeat Nando, the trainer who fought grandly in the Grand Festival?',27);
insert into EPISODIO_ENTITY values (4947, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623753.jpg', 'Casting a Paul on Barry!', 27,'The third round of the Lily of the Valley Conference is about to start. Much to his happiness, Barrys next match will be against Paul, a trainer he looks up too. As the battle begins Paul believes it will be an easy win, but Barry soon proves that he is no pushover. Which trainer will advance to the next round?',27);
insert into EPISODIO_ENTITY values (4948, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623754.jpg', 'Working on a Right Move!', 28,'The Sinnoh League continues and it is time for Ashs battle. Ash will be going up against Conway. As the battle begins Ash gets in over his head when Conway uses the move Trick Room, changing the battle. Will Ash be able to defeat Conway and progress in the tournament.',27);
insert into EPISODIO_ENTITY values (4949, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623755.jpg', 'Familiarity Breeds Strategy!', 29,'After defeating Conway, Ash has now progressed to the Top 8 in the Sinnoh League, and its finally time for him to go up against Paul in the Sinnoh League battle promised after Monfernos evolution. With the return of Gliscor, Ash decides to use the same Pokémon he used in his full battle with Paul at Lake Acuity, determined to show that they have grown considerably since then. The time has come; will Ash finally be able to defeat the rival he made when he first set foot in the Sinnoh Region, and progress even further in the tournament?',27);
insert into EPISODIO_ENTITY values (4950, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623756.jpg', 'A Real Rival Rouser!', 30,'Ash and Pauls battle in the Sinnoh League quarter-finals rages on. Things are looking good for Ash, who has so far defeated Pauls Aggron and Gastrodon and still has all of his Pokémon remaining, but the tables start to turn when Paul sends out his new Drapion. Will Ash be able to hold his ground and defeat his Sinnoh Region rival once and for all?',27);
insert into EPISODIO_ENTITY values (4951, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623757.jpg', 'Battling a Thaw in Relations!', 31,'Ash and Pauls battle in the Sinnoh League quarter-finals rages on as both trainers give it their all. Eventually, both Ash and Paul have just one Pokémon remaining; Infernape for Ash and Electivire for Paul. Which trainer will emerge victorious in this decisive battle and move on to the semi-finals?',27);
insert into EPISODIO_ENTITY values (4952, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623758.jpg', 'The Semi-Final Frontier!', 32,'Ash has defeated Paul and advanced to the semi-finals of the Sinnoh League. Ashs biggest challenge, however, is now ahead of him. His next opponent is Tobias, who has won his eight badges and advanced to the semi-finals of the tournament using solely his Darkrai. Will Ash be able to defeat Darkrai, as well as Tobiass other Pokémon, and advance to the finals?',27);
insert into EPISODIO_ENTITY values (4953, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623759.jpg', 'The Brockster Is In!', 33,'With the Sinnoh League behind them, Ash and friends take a ship back to Dawns hometown of Twinleaf. A crisis emerges, however, when a group of Tentacruel attack the ship and poison many of the Pokémon on board. With no other doctor on the ship, Brock is the only one who can help those Pokémon. Will he succeed before its too late?',27);
insert into EPISODIO_ENTITY values (4954, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623760.jpg', 'Memories Are Made of Bliss!', 34,'Back in Twinleaf Town, Ash, Dawn, and Brock finally come to realize that their journey together is over. Everyone is sad about this, especially Piplup who is overwhelmed with tears. However, as one journey ends, one is also set to begin.',27);
insert into EPISODIO_ENTITY values (4955, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623761.jpg', 'In the Shadow of Zekrom!', 1,'Once again Ash sets his sights on a new region and a new adventure. Continuing his journey alone, Ash arrives in the beautiful Unova region with just Pikachu at this side. While on his way to visit Professor Juniper, Unovas resident professor, a mysterious shadow appears above and Pikachu loses the ability to use his electric attacks. Ash also encounters a trainer named Trip and the two decide to have an unlikely ending battle.',27);
insert into EPISODIO_ENTITY values (4956, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623762.jpg', 'Enter Iris and Axew!', 2,'With Pikachu healed up, Ash decides to not return with his mom and Professor Oak to Kanto and to travel around the Unova region instead. As he begins his travels he meets a girl named Iris and together they decide to travel with each other, but when Pikachu and Axew are stolen by Team Rocket, will they be able to save their only Pokémon?',27);
insert into EPISODIO_ENTITY values (4957, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623763.jpg', 'A Sandile Gusher of Change!', 3,'After learning that the first gym of Unova is located in Striaton City, Ash and Iris begin their journey there. However, they are stopped by a boy who requests their help. A group of Sandile are terrorizing his sand bath resort and he wants Ash and Iriss help to stop them.',27);
insert into EPISODIO_ENTITY values (4958, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623764.jpg', 'The Battle Club and Tepigs Choice!', 4,'While on the way to Striaton City, Ash and Iris arrive in Karakusa Town and Ash hears about a place called the Pokémon Battle Club. Interested, he decides to go check it out. However, trouble is abound as a mysterious pokémon has been spotted nearby and both Ash and Iris wants to capture it.',27);
insert into EPISODIO_ENTITY values (4959, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623765.jpg', 'Triple Leaders, Team Threats!', 5,'Ash and Iris arrive in Striaton City, the location of Unovas first gym. When they arrive in town they meet a boy named Cilan who says he is a Pokémon Sommelier, someone who is able to test the compatibility between a Pokémon and trainer. He leads them to the Gym where it is revealed that he and his two brothers are all the Gym Leaders of Striaton City. Will Ash be able to defeat the three brothers and win his first badge?',27);
insert into EPISODIO_ENTITY values (4960, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623766.jpg', 'Dreams by the Yard Full!', 6,'Ash is taking a break at the Pokémon Center following his Gym Battle when all of a sudden Iris comes dashing in. Apparently Axew has fallen asleep and will not wake up. Overhearing, a professor named Fennel and her Munna come to help them.',27);
insert into EPISODIO_ENTITY values (4961, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623767.jpg', 'Snivy Plays Hard to Catch!', 7,'While on the way to the next Gym, Ash, Iris, and Cilan stop to take a break. While eating a Snivy comes by and starts eating their food. They try to stop it but it uses Attract to stun Pikachu and cause other mischief. What will they do to stop it.',27);
insert into EPISODIO_ENTITY values (4962, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623768.jpg', 'Saving Darmanitan from the Bell!', 8,'While stopping for lunch by a river, Pikachu and Axews food suddenly goes missing. Everyone begins to search around and they find a Darumaka eating the food. They give chase but lose it and get lost.',27);
insert into EPISODIO_ENTITY values (4963, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623769.jpg', 'The Bloom is on Axew!', 9,'On the way to Nacrene City, Axew wanders off to get some apples and ends up trapped in the horms of the bug pokémon Scolipede. The Pokémon begins rampaging and now everyone must find a way to stop it and get Axew back.',27);
insert into EPISODIO_ENTITY values (4964, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623770.jpg', 'A Rival Battle for Club Champ!', 10,'On the way to the next city Ash and his friends run into Trip again. Determined to prove that his previous loss was just a fluke, Ash challenges him to a battle. Trip accepts and the two get ready to have a five-on-five battle.',27);
insert into EPISODIO_ENTITY values (4965, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623771.jpg', 'A Home for Dwebble!', 11,'On the way to Nacrene City, Ash and friends encounter the Pokémon Dwebble. However, this Dwebble does not have a rock on its back as it should. It begins to make a new shell, but then three more Dwebble show up and trouble starts.',27);
insert into EPISODIO_ENTITY values (4966, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623772.jpg', 'Here Comes the Trubbish Squad!', 12,'Ash and friends are continuing their journey when a group of kids suddenly appear in front of them. They begin throwing mud balls at Ash and his friends and as they run off, a Trubbish steals Ashs hat. They then give chase.',27);
insert into EPISODIO_ENTITY values (4967, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623773.jpg', 'Minccino—Neat and Tidy!', 13,'Ash and friends meet a girl named Bianca. Professor Juniper has asked Bianca to meet up with them in order to deliver a badge case to Ash. As Bianca gets the case out it is all dusty from sitting at the bottom of her bag. Suddenly a Minccino comes by and snatches the case and runs off with it. Ash and friends give chase.',27);
insert into EPISODIO_ENTITY values (4968, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623774.jpg', 'A Night in the Nacrene City Museum!', 14,'Ash, Iris, and Cilan finally arrive at Nacrene City, the location of Unovas second gym. When they arrive at the gym, which is located in the citys museum, the door is locked. They soon find out that some strange things have been happening in the museum. Ash, determined to have his gym battle, decides to head inside and find out what is happening.',27);
insert into EPISODIO_ENTITY values (4969, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623775.jpg', 'The Battle According to Lenora!', 15,'With their museum adventure behind them, Ash finally gets to challenge the Nacrene City Gym Leader, Lenora. Lenora specializes in Normal-type Pokémon and is no pushover. Will Ash be able to defeat Lenora and earn his second badge?',27);
insert into EPISODIO_ENTITY values (4970, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623776.jpg', 'Rematch at the Nacrene Gym!', 16,'After his devastating loss against Lenora, Ash heads to the Nacrene City Battle Club to train for a rematch. While at the Battle Club, his training proves useful for both Oshawott and Tepig. With renewed confidence, Ash heads back to the gym to battle Lenora yet again. Will he defeat Lenora and win his second badge?',27);
insert into EPISODIO_ENTITY values (4971, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623777.jpg', 'Scraggy-Hatched to Be Wild!', 17,'The day everyone has been waiting for has arrived! Ashs egg finally hatches, and it hatches into a Scraggy! However, the celebration ends when Scraggy proves to be a little troublemaker, and soon puts Ash and friends in danger with some wild Pokémon.',27);
insert into EPISODIO_ENTITY values (4972, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623778.jpg', 'Sewaddle and Burgh in Pinwheel Forest!', 18,'Continuing their journey, Ash and friends reach Pinwheel Forest. There Ash sets his sights on catching a Sewaddle after encountering one. However, this Sewaddle is not careful and winds up in some dangerous situations. Meanwhile, Ash and friends also receive help with Sewaddle from Castelia City Gym Leader Burgh.',27);
insert into EPISODIO_ENTITY values (4973, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623779.jpg', 'A Connoisseurers Revenge!', 19,'Continuing their journey, Ash and friends come across an authorized Pokémon Connoisseurer. The Connoisseurer is at a new store performing readings for people and their Pokémon. They decide to go watch them so that Ash can get a free reading and Cilan can see another Connoisseurer in action. However, this Connoisseurer has a connection to Cilan.',27);
insert into EPISODIO_ENTITY values (4974, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623780.jpg', 'Dancing with the Ducklett Trio!', 20,'While Ash is doing some training with his Scraggy, he and his friends are confronted by the same Sandile they met near Nuvema Town. Ash, wanting to accept Sandiles challenge is interrupted by three Ducklett which quickly snatch Ashs hat and Sandiles sunglasses.',27);
insert into EPISODIO_ENTITY values (4975, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623781.jpg', 'The Lost World of Gothitelle!', 21,'Ash, Iris, and Cilan arrive at the famous Skyarrow Bridge, their last obstacle before reaching Castelia City. They try crossing the bridge, but a Gothitelle appears and prevents them from crossing. They must now find a way to get past it and get into the city.',27);
insert into EPISODIO_ENTITY values (4976, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623782.jpg', 'A Venipede Stampede!', 22,'Ash and friends have finally arrived in Castelia City. While exploring the city they run into Burgh. After hearing a noise underground, they go to find out what it was and find a wild Venipede. It is injured, and even though they heal it, the other Venipede in the sewers become upset and begin attacking the city above. Now Ash and friends must help to stop them.',27);
insert into EPISODIO_ENTITY values (4977, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623783.jpg', 'Battling for the Love of Bug-Types!', 23,'The time has arrived, Ash is finally going to battle Burgh to try and win his third badge in Unova. Burgh is an excellent Bug-type trainer with many tricks up his sleeve. Will Ash be able to win his third badge?',27);
insert into EPISODIO_ENTITY values (4978, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623784.jpg', 'Emolga the Irresistible!', 24,'Ash, Iris, Cilan and Bianca are on their way to Nimbasa City. Axew encounters an Emolga that had just stolen a bunch of apples from a group of Patrat.',27);
insert into EPISODIO_ENTITY values (4979, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623785.jpg', 'Emolga and the New Volt Switch!', 25,'Iris decides to do some training with her new Emolga. However, while training it is discovered that it has a problem. Whenever Emolga uses Volt Switch, instead of switching places with one of Iriss other Pokémon, it also switches places with Ash and Cilans Pokémon as well!',27);
insert into EPISODIO_ENTITY values (4980, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623786.jpg', 'Scare at the Litwick Mansion!', 26,'Continuing to Nimbasa City, Ash and friends suddenly find themselves caught in the rain. They notice a mansion nearby and go inside hoping to seek shelter from the rain. However, things are not as they seem. Soon a group of Litwick begin tormenting them and cause havoc.',27);
insert into EPISODIO_ENTITY values (4981, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623787.jpg', 'The Dragon Masters Path!', 27,'While on the way to Nimbassa City, Ash and friends encounter a trainer who is skilled in training Dragon-type Pokémon. Iris, determined to achieve her goal given to her by the elder of her town, seeks the wisdom of the trainer, hoping to make Axew stronger.',27);
insert into EPISODIO_ENTITY values (4982, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623788.jpg', 'Oshawotts Lost Scalchop!', 28,'On the way to Nimbasa City, Ash meets a Pokémon trainer and the two decide to battle. During the battle Oshawotts scalchop is kicked away from Oshawott and becomes lost in the woods. Devastated, Oshawott frantically searches for it, and eventually a replacement for it.',27);
insert into EPISODIO_ENTITY values (4983, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623789.jpg', 'Cottonee in Love!', 29,'While on the way to Nimbasa City, Ash and friend encounter a group of Cottonee. One of these Cottonee is in love with another one, but she rejects him, so Cilan decides to help the Pokémon win her love.',27);
insert into EPISODIO_ENTITY values (4984, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623790.jpg', 'A UFO for Elgyem!', 30,'Continuing their journey to Nimbasa City, Ash and friends are suddenly woken up in the middle of the night by a mysterious light. Soon after they encounter a professor and the mysterious Pokémon Elgyem.',27);
insert into EPISODIO_ENTITY values (4985, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623791.jpg', 'Ash and Trips Third Battle!', 31,'Continuing their journey to Nimbasa City, Ash and friends stop to have lunch. However, they end up ruining Cilans lunch. Soon after Ash and Iris wander off and run into Trip. After seeing Trips new Pokémon Ash is eager to battle and Trip agrees to a three one three battle. Who will win?',27);
insert into EPISODIO_ENTITY values (4986, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623792.jpg', 'Facing Fear with Eyes Wide Open!', 32,'While taking a break on their journey, Ash and friends come under attack by wild Pokémon and the gangs Pokemon are badly poisoned. The only thing nearby that can heal them are herbs found at the bottom of a nearby lake. However, when Oshawott goes to get them, it is attacked by a wild Palpitoad and Stunfisk. Now everyone must find a way to stop the two Pokémon and heal the gangs Pokemon.',27);
insert into EPISODIO_ENTITY values (4987, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623793.jpg', 'Iris and Excadrill Against the Dragon Buster!', 33,'On their way to Nimbasa City, a girl confronts Iris and demands a battle against her and Axew. She says she is a Dragon Buster and it is her job to defeat Dragon Trainers. Due to his lack of experience Axew falls easily and in a fit of rage, Iris calls out Excadrill. Excadrill still ignores Iris and too is defeated. Following the battle Iris finally reveals what happened to her and Excadrill and decides it is time to finally get him to listen to her.',27);
insert into EPISODIO_ENTITY values (4988, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623794.jpg', 'Gotta Catch a Roggenrola!', 34,'On their way to Nimbasa City, Ash and friends come across a group of Roggenrola who are being targeted by Team Rocket. When Team Rocket reveals their plan for the Pokémon they decide to stop them and save the Pokémon.',27);
insert into EPISODIO_ENTITY values (4989, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623795.jpg', 'Where Did You Go, Audino?', 35,'Ash and friends arrive in a town where the pokémon Audino is popular among the residents. However, the Audino have been mysteriously disappearing and acting strangely. Cilan decides to help Officer Jenny get to the bottom of this strange case.',27);
insert into EPISODIO_ENTITY values (4990, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623797.jpg', 'Archeops in the Modern World!', 36,'Ash, Iris, and Cilan meet up with Professor Juniper and Fennel who reveal they are going to revive a Pokémon fossil. the fossil is the pokémon Archen. Archen is a wild pokémon that likes to do as it pleases, but it cannot fly. Ash and friend decide to help it learn to fly. Meanwhile, Team Rocket also set their sites on the pokémon.',27);
insert into EPISODIO_ENTITY values (4991, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623798.jpg', 'A Fishing Connoisseur in a Fishy Competition!', 37,'Continuing to Nimbasa City, Ash and the gang decide to take a rest stop in a town. They run into Bianca who presents a fishing competition poster, unknowingly staged by Team Rocket. Cilan decides to enter the fishing contest. Meanwhile Team Rocket plans to steal the Pokemon the contestants caught.',27);
insert into EPISODIO_ENTITY values (4992, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623799.jpg', 'Movie Time! Zorua in "The Legend of the Pokemon Knight"!', 38,'Continuing to Nimbasa City, Ash and friend encounter a boy who directs movies. The boy is having troubles with both his lead actress and his pokémon Zorua. Ash and friends agree to help him with his movie.',27);
insert into EPISODIO_ENTITY values (4993, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623800.jpg', 'Reunion Battles in Nimbasa!', 39,'Ash and friends arrive in Nimbasa Town where they learn of a tournament that is to be held. They decide to enter it before they leave town. However, they have stiff competition as trainers theyve encountered in Unova also gather for the tournament.',27);
insert into EPISODIO_ENTITY values (4994, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623801.jpg', 'Cilan Versus Trip, Ash Versus Georgia!', 40,'The next round of the Club Battle tournament begins with a battle between Cilan and Trip. Meanwhile, Ash, Iris, and Bianca wait in the wings for their upcoming battles. Who will progress to the next round?',27);
insert into EPISODIO_ENTITY values (4995, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623802.jpg', 'The Club Battle Hearts of Fury, Emolga Versus Sawk!', 41,'The Club Battle tournament continues with Ash and Georgias battle ending. Next up is Cilan vs Luke and Iris vs Stephan. With tough opponents ahead of them will Cilan and Iris continue to advance in the tournament?',27);
insert into EPISODIO_ENTITY values (4996, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623803.jpg', 'The Club Battle Finale: A Heroes Outcome!', 42,'The Club Battle semi-finals conclude with Ash and Iris as the victors. Now the two friends are set to go head to head in the tournament finale. Who will be crowned the victor?',27);
insert into EPISODIO_ENTITY values (4997, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623804.jpg', 'Meowths Scrafty Tactics!', 43,'On the way to Nimbasa City, Ash and friends find Meowth of Team Rocket lying in a bush. Meowth says he botched a Team Rocket operation and was fired and disowned. He then joins Ash, Iris, and Cilan. Meanwhile a Scrafty comes by and kidnaps Axew.',27);
insert into EPISODIO_ENTITY values (4998, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623805.jpg', 'Purrloin: Sweet or Sneaky?', 44,'While continuing to Nimbasa City, Ash and friends come across a Purrloin. Meowth and Oshawott fall for the little pokémon and soon begin to follow whatever it says. However, Cilan doesnt trust Purrloin and follows everyone reluctantly.',27);
insert into EPISODIO_ENTITY values (4999, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623806.jpg', 'Beheeyem, Duosion, and the Dream Thief!', 45,'On the way to Nimbasa City, Ash and friends encounter a Beheeyem. After discovering its secret ability, they decide to try and test it out. Meanwhile, Officer Jenny shows up and reveals that she is investigating the Beheeyem.',27);
insert into EPISODIO_ENTITY values (5000, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623807.jpg', 'Beartic Mountain Feud!', 46,'While on the way to Nimbasa City, Ash and friends come across a Cubchoo that has been separated from its pack. They decide to help find the pack, but that proves difficult when another group of Beartic constantly attacks them.',27);
insert into EPISODIO_ENTITY values (5001, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623808.jpg', 'Crisis from the Underground Up!', 47,'Ash and friend finally arrive in Nimbasa City. Before heading to gym they decide to check out the Battle Subway. However, a mysterious event causes the Subway System to halt. They head to the Pokmon Center where strange events begin...',27);
insert into EPISODIO_ENTITY values (5002, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623809.jpg', 'Battle for the Underground!', 48,'With the subway going awry, Ash &amp; Co have met up with the Subway Masters Emmet &amp; Ingo who are helping them to get to the trains with their Pokémon on. However, things are not as easy as it seems as Meowth has betrayed them and the train is getting further and further away, with Nimbasa City cut off from the rest of Unova. Will Ash &amp; Co. manage to get their Pokémon back?',27);
insert into EPISODIO_ENTITY values (5003, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623821.jpg', 'Enter Elesa, Electrifying Gym Leader!', 1,'After a long journey, its time for Ash to visit the Nimbasa City Gym where the Electric-type Pokémon fan &amp; Gym Leader; Elesa accepts challenges. However, while in Nimbasa City, Ash &amp; Co. meet up with Bianca who is closely followed by her father. Her father insists that Bianca should return home, but Bianca is adamant that she has grown since she left on her journey. Elesa suggests that Biancas father watch the battle, and Bianca promises to return home if she loses. Will Bianca manage to defeat the Gym Leader, Elesa and prove herself to her father?',27);
insert into EPISODIO_ENTITY values (5004, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623822.jpg', 'Battle-Dazzling the Nimbasa Gym!', 2,'Its time for Ashs battle against the Nimbasa City Gym leader; Elesa. As Elsea focuses on Electric-types, Ash is to find the battle tough. Pikachu becomes eager to face down against the Electric-type Pokémon despite the obvious type disadvantage. So, using his Palpitoad, Snivy and Pikachu against Elesas Zebstrika, Tynamo and Emolga, Ash will face the toughest battle he has had in the Unova region. Will Ash win?',27);
insert into EPISODIO_ENTITY values (5005, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623823.jpg', 'Lost at the Stamp Rally!', 3,'After the Nimbasa Gym match, Cilan convinces Ash &amp; Iris to take part on the Subway Stamp Rally, which requires travelling across Nimbasa City, to collect stamps in order to battle Emmet &amp; Ingo. However, while doing so, Ash &amp; Iris encounter a lost Axew and decide to help it find its trainer. Will they be able to find the trainer and will Ash &amp; Cilan be able to defeat the Subway Bosses?',27);
insert into EPISODIO_ENTITY values (5006, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623824.jpg', 'Ash Versus the Champion!', 4,'Heading out of Nimbasa City, Ash &amp; Co. bump into Trip and learn that the champion of the Unova region, Alder, is in Performers Street. Ash &amp; Trip decide to go find the legendary trainer and challenge him to a battle. However, the battle seems to be tougher than both trainers thought it would be. Will Ash or Trip win the battle, or will Alder defeat both trainers?',27);
insert into EPISODIO_ENTITY values (5007, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623825.jpg', 'A Maractus Musical!', 5,'On their way to Driftveil City, Ash &amp; Co. encounter a trainer who is dreaming of partaking in the Pokémon Musicals in Nimbasa City. Using his Maractus Trio, he is trying to perfect the Over the Rainbow dance, but his Maractus keep messing up. Ash &amp; co. decide to help the trainer and his Maractus perfect their moves...',27);
insert into EPISODIO_ENTITY values (5008, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623826.jpg', 'The Four Seasons of Sawsbuck!', 6,'On their way to Driftveil City, Ash &amp; Co. encounter a photographer who wishes to create a photograph so rare and legendary; one featuring all four Sawsbuck forms in one photograph which only happens in a certain area. Ash decides to help the photographer in his quest, but things get tricky when the wild Pokémon start acting strange.',27);
insert into EPISODIO_ENTITY values (5009, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623827.jpg', 'Scraggy and the Demanding Gothita!', 7,'On their way to Driftveil City, Ash &amp; Co. meet up with a trainer who is having trouble with her Gothita. The Gothita takes a liking to Ashs Scraggy so the trainer requests Ash trade it to her. Ash refuses this offer and so the trainer challenges him to a battle, and if he loses, he must trade Scraggy. Will Ash win the battle or will he lose Scraggy?',27);
insert into EPISODIO_ENTITY values (5010, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623828.jpg', 'The Lonely Deino!', 8,'On their way to Driftveil City, Ash &amp; Co. meet up with a trainer who has three Deino. However, he seems to be having a problem with one of his Deino which is so shy that it even refuses to eat. Iris decides to take it upon herself to help the Deino. However, its not as easy as it seems, especially when its owner doesnt return...',27);
insert into EPISODIO_ENTITY values (5011, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623829.jpg', 'The Mighty Accelguard to the Rescue!', 9,'Finally at Driftveil City, Ash discovers that the gym is not currently open so Ash &amp; Co. take a tour of the city offered by Charles. However, when they get to the market, they find a couple of thieves in disguise, only for them to be thwarted by the mysterious A☆celgor, who helps fight crime with his Accelgor. However, things start to turn when the evil Cyrogonal Man appears...',27);
insert into EPISODIO_ENTITY values (5012, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623830.jpg', 'A Call for Brotherly Love!', 10,'While training for his gym match with Clay in Driftveil City, Ash &amp; Co. meet up with Cilans brother Chili. Chili is having doubts as his Pansear lost and so he wants Cilans advice in training it. As such, Chili challenges Cilan to a battle, but when Chili loses the match, he and Pansear both react badly to it...',27);
insert into EPISODIO_ENTITY values (5013, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623831.jpg', 'Stopping the Rage of Legends! (Part 1)', 11,'When arriving at Driftveil Gym, Ash &amp; Co. are soon sent to Milos Island by Clay in order to look for some Revival Herbs. However, when they arrive on the island, they learn that the plant isnt growing because someone has disturbed the shrines of the Pokémon that live on the island. Things get even more iffy when the legendary Pokémon: Tornadus and Thundurus appear and start attacking...',27);
insert into EPISODIO_ENTITY values (5014, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623832.jpg', 'Stopping the Rage of Legends! (Part 2)', 12,'On Milos Island, Tornadus and Thundurus continue their fighting after Team Rocket destroyed their shrines. However, Iris has managed to awaken the other Legendary Pokémon; Landorus, to try and qwell the fighting. Ash &amp; Co. however get stuck in the middle of the battle, and things get worse when Team Rocket appear to enact their final plan: the capture of Tornadus, Thundurus and Landorus.',27);
insert into EPISODIO_ENTITY values (5015, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623833.jpg', 'Battling the King of the Mines!', 13,'After the incident on Milos Island, Ash finally arrives at the Drifveil City Gym and Clay finally accepts his challenge. With Clay being a trainer since he was a child, Ash faces a massive challenge against Clays Ground-type Pokémon. With Krokorok, Palpitoad and Excadrill being used by Clay, Ash soon learns that the battle is not as simple as using type advantages...',27);
insert into EPISODIO_ENTITY values (5016, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623834.jpg', 'Crisis at Chargestone Cave!', 14,'On their way to Mistralton City, Ash &amp; Co. come across the Chargestone Cave. However, when they get within the viscinity of the cave, the Electric-type Pokémon start acting strangely. It appears that the Joltik of Chargestone Cave have appeared and are sucking the electricity out of them. Bianca calls Professor Juniper to appear, but when her Xtransceiver cuts out, things turn out to not be as they seem...',27);
insert into EPISODIO_ENTITY values (5017, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623835.jpg', 'Evolution Exchange Excitement!', 15,'Having met with Professor Juniper and Bianca in Chargstone Cave, Bianca takes up on an offer to trade her Shelmet for a Karrablast in order to evolve them. However, the Karrablast she receives ends up having a personality change upon evolution and quickly attacks Ash &amp; Co. Bianca doesnt know what to do so Professor Juniper suggests a battle to prove her worth as a trainer. The battle is Ash &amp; Cilan VS Juniper and Bianca. Who shall win and will Escavalier learn to obey its new trainer?',27);
insert into EPISODIO_ENTITY values (5018, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623836.jpg', 'Explorers of the Heros Ruin!', 16,'After he collapsed after exiting Chargestone Cave, Ash &amp; Co. learn from Cedric Juniper about some nearby ruins which once held the legendary Pokémon, Zekrom. Cedric goes to visit the ruins, but Ash, eager to learn about the legendary Pokémon, decides to join him in the exploration. However, when they enter, theyre quickly attacked by a Sigilyph and Cofagrigus who are protecting the ruins. Will Cedric find what hes looking for and will Ash &amp; Co. get out safely?',27);
insert into EPISODIO_ENTITY values (5019, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623837.jpg', 'Battling the Bully!', 17,'On their way to Mistralton City, Ash &amp; Co. get ambushed by the Sunglasses Krokorok, Pikachus rival. Shortly after this, Ash &amp; co. meet up with a trainer in town who wishes to borrow Pikachu so he can battle and defeat his friend as he doesnt have any Pokémon and he has been challenged by a friend. A problem soon arises however when Ash &amp; Co. learn that the battle is a Double Battle and so the trainer needs a second Pokémon. Krokorok decides to join in with the battle. Who will win?',27);
insert into EPISODIO_ENTITY values (5020, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623838.jpg', 'Baffling the Bouffalant!', 18,'On their way to Mistralton City, Ash &amp; Co. enter a forest which is filled with Bouffalant. While traversing the forest, Ash &amp; Co. get seperated from their Pokémon and they all learn that, in order to pass through the forest, they need to put on afros to blend in. However, when Axew loses its afro, it incurs the wrath of the Bouffalant and gets chased. Will the Pokémon meet up with their trainers again, and will they be able to get through the forest?',27);
insert into EPISODIO_ENTITY values (5021, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623839.jpg', 'Cilan Takes Flight!', 19,'Finally arriving in Mistralton City, Ash &amp; Co. get to the gym and learn from Skyla that the gym battle is to be a special "Air Battle" where she is challenged by multiple trainers at once. Ash is somewhat intrigued by this and books a slot where he can participate in order for him to earn his new badge. However, Cilan gets angered by this and challenges Skyla to a battle the proper way to see if she is even capable of being a proper gym leader. Will she prove herself?',27);
insert into EPISODIO_ENTITY values (5022, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623840.jpg', 'An Amazing Aerial Battle!', 20,'After proving that her way of deciding who gets a badge is valid by defeating Cilan as she predicted, Ash challenges Skyla to a proper match. Skyla insists that she will win based on the Pokémon Ash decides to use. Ash, however, does not accept this and faces a tough uphill battle. Using Pikachu, Krokorok and Tranquill, he has to face off against Skylas Unfezant, Swoobat and Swanna. Will Ash manage to defeat Skyla and prove her wrong?',27);
insert into EPISODIO_ENTITY values (5023, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623841.jpg', 'Climbing the Tower of Success!', 21,'Heading towards Icirrus City, Ash &amp; Co. meet up with their old friend Stephan and learn about a special contest. This contest features a variety of rounds including dressing up as famous characters, obstacle courses and having to collect various items including a Thunderstone. Whoever wins gets to ring the bell at the Celestial Tower that grants any wish. Who will win this contest?',27);
insert into EPISODIO_ENTITY values (5024, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623845.jpg', 'The Clubsplosion Begins!', 22,'Having learned about it from Stephan, Ash &amp; Co. decide to enter the local Battle Club tournament lead by Don George: The Donamite. This battle tournament has you only use one Pokémon throughout the tournament. With Ash choosing Scraggy, he soon finds he has more than he bargained for when his opponent chooses the Grass-type, Simisage. Will Ash manage to help Scraggy overcome the strength disadvantage and progress to the next round?',27);
insert into EPISODIO_ENTITY values (5025, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623846.jpg', 'Search for the Clubultimate!', 23,'Continuing the Donamite, Ash &amp; Co. are still in the first round. While Cilan, Ash &amp; Stephan have passed to the next round, everyone else is still fighting. While Iris has a matchup with Burgundy and her Dewott, there are even tougher battles to come with Trip facing Bianca and Georgia facing a Dragon-type Pokémon: Druddigon. Who will win the battles and make it to the next round of the tournament?',27);
insert into EPISODIO_ENTITY values (5026, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623847.jpg', 'A Clubsplosion of Excitement!', 24,'Continuing the Donamite, Bianca and Trip face a daunting battle between their Emboar and Conkeldurr with both of them severely weakened. Furthermore, Cilan faces his second round battle against Stephans Sawk. The battles are to be fierce but who will get through the second round and who will continue on to the finals of the Donamite?',27);
insert into EPISODIO_ENTITY values (5027, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623848.jpg', 'Commanding the Clubsplosion Crown!', 25,'Its time for the end of the Donamite tournament and the Semi-Finals begin. With Ash, Bianca, Stephan and the reigning champion all in it, battles are sure to be fierce. Bianca and her Emboar have to face Stephans Sawk while Ash &amp; Scraggy are facing the chamion and his Throh. Who will emerge triumphant and the overall winner of the tournament?',27);
insert into EPISODIO_ENTITY values (5028, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623849.jpg', 'Battling the Leaf Thieves!', 26,'During a training battle, Ash gets a massive surprise when his Swadloon evolves into Leavanny who brings fun to the group in the creation of masks and headpieces. However, shortly afterwards, a group of Durant arrive and kidnap Axew after mistaking it for food. Ash &amp; co. have to go and find Durant and rescue Axew before it gets eaten. Will they succeed?',27);
insert into EPISODIO_ENTITY values (5029, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623850.jpg', 'A Restoration Confrontation! (Part 1)', 27,'Heading to Iccirus City, Ash &amp; Co. enter Twist Mountain. While traversing the mountain, they start to hear a loud noise and discover an archeologist excavating fossils. Eventually, he finds a fossil for Tirtouga. The archeologist begins to tell a story about how he used to play with some when he was a child, but in the process of telling the story, Team Rocket make an appearance, with desires not just upon the fossil...',27);
insert into EPISODIO_ENTITY values (5030, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623851.jpg', 'A Restoration Confrontation! (Part 2)', 28,'With Tirtouga having been revived and escaped, Team Rocket set their sights firmly upon the time portal that the archeologist went through as a child. However, they soon learn that Tirtougas life energy is vital to keeping the time portal open. Ash &amp; co. however are determined to protect Tirtouga from Team Rocket and attempt to stop Team Rocket. Will they be able to, or will Team Rocket succeed?',27);
insert into EPISODIO_ENTITY values (5031, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623852.jpg', 'Evolution by Fire!', 29,'On their way to Iccirus City, Ash &amp; Co. bump into a trainer who maintains he has the strongest Pokémon. It turns out that this trainer is the original trainer of Ashs Tepig, who discarded Tepig, thinking it was weak and not worth training. Ash gets angered by this attitude and decides to challenge him using Tepig in a Double Battle to prove him wrong. Will Tepig be able to show his previous trainer how strong it is, or will that trainer turn out to be right?',27);
insert into EPISODIO_ENTITY values (5032, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623853.jpg', 'Guarding the Guardian of the Mountain!', 30,'Nearing Icirrus City, Ash &amp; co. are saved from a landslide by Brycen, the Icirrus Gym Leader and former star of various movies. Cilan knows about his new training techniques and he helps teach Ash these training techniques. However, soon after they begin, they get interrupted by a Pokémon Hunter who wants to capture the guardian of the mountain: Volcarona.',27);
insert into EPISODIO_ENTITY values (5033, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623854.jpg', 'Caution: Icy Battle Conditions!', 31,'Having learned that Brycen is the Icirrus Gym Leader, Ash eagerly challenges him to a battle, which Brycen accepts. After the training with Brycen, Ash is pretty confident, using Pignite, Krokorok and Scraggy against Brycens Beartic, Cryogonal and Vanillish. However, Ash faces a massive challenge with Krokoroks type disadvantage, with Krokorok refusing to give up the fight. Will Ash win and earn the Freeze Badge?',27);
insert into EPISODIO_ENTITY values (5034, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623855.jpg', 'Clash of the Connoisseurs!', 32,'On their way to Opelucid City, Ash &amp; co. meet up with a person whose daughter is about to pick her first Pokémon. Cilan is eager to help, using his talents as a Pokémon Connoisseur but before he can, another Connoisseur appears and tries to outshine Cilan. Cilan decides to challenge the Connoisseur to decide who will pick the Pokémon for the girl. Who will win?',27);
insert into EPISODIO_ENTITY values (5035, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623856.jpg', 'Crisis at Ferroseed Research!', 33,'On their way to Tachiwaki City, Ash &amp; Co. meet up with Georgia and find a nearby facility where scientists are doing some tests on some Chargestones. However, when an accident happens, an electrified moss from Ferroseed starts spreading throughout the area. Getting cut off from the group, Iris finds herself stuck with an Ice-type Pokémon, Vanilluxe and has to work a way to stop the moss using the thing she hates most, Ice-type Pokémon. Will the moss stop spreading?',27);
insert into EPISODIO_ENTITY values (5036, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623857.jpg', 'An Epic Defense Force!', 34,'Arriving at Tachiwaki City, Ash &amp; Co. meet up with Luke, the trainer they met who enjoys creating Pokémon Movies. Luke is eager to create a movie for the PokéWood contests in the city and recruits Ash &amp; Co. to help him in the creation of the movie. In doing so, a mecha-Tyranitar starts to attack and needs to be stopped by a giant Golurk. Will the movie win the Pokéwood contest?',27);
insert into EPISODIO_ENTITY values (5037, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623858.jpg', 'Rocking the Virbank Gym! (Part 1)', 35,'Ash has arrived at Tachiwaki City Gym and has learned of the Gym Leader, Homika. Homika, the vocalist of the band "The Koffings", is very confident and states that Ash can challenge her, but insisting she will win, she says Ash should challenge her with six of his Pokémon, against the three of hers. Will Ash manage to beat Homika with the number advantage?',27);
insert into EPISODIO_ENTITY values (5038, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623860.jpg', 'Rocking the Virbank Gym! (Part 2)', 36,'The Gym battle with Homika continues. With her Pokémon managing to poison Ashs with great ease, Ash faces his toughest challenge of Unova yet. As more of his Pokémon get poisoned and start to fall, Ash starts to lose the will to continue. Will Ash overcome this devastation and earn the Toxic Badge?',27);
insert into EPISODIO_ENTITY values (5039, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623861.jpg', 'All for the Love of Meloetta!', 37,'Learning that the Unova League is months away, Ash &amp; Co. decide to take in the sights of Virbank City where they encounter the Sinnoh Champion, Cynthia. Cynthia explains she is on her way to perform at the World Tournament in East Unova and offers to take Ash &amp; Co. there. However, enroute, they collide with a severely injured Meloetta, injured from Team Rockets attacks. Will Ash &amp; Co. be able to protect Meloetta?',27);
insert into EPISODIO_ENTITY values (5040, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623862.jpg', 'Piplup, Pansage, and a Meeting of the Times!', 38,'Finally arriving in Undella Town to start training for the World Tournament, Ash &amp; co. meet up with a very old friend, Dawn, who has arrived to train to become a better co-ordinator. Cilan is eager to see how a Pokémon Co-ordinator battles and so challenges Dawn to a battle. In addition to that, Meloetta has decided to tag along with Ash &amp; Co, but Team Rocket still have their eye on it...',27);
insert into EPISODIO_ENTITY values (5041, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623863.jpg', 'Expedition to Onix Island!', 39,'While training for the World Tournament in Undella Town, Dawn suggests that Ash &amp; Co. need to relax so they travel to a nearby island where many Onix dwell. However, as they explore the island, they inadvertantly anger the Onix that dwell there and the gang gets separated. As they try to find eachother, they keep getting attacked. Meloetta gets angry at Ash getting attacked and manages to change form. Will Meloetta help stop the Onix attack and will Ash &amp; Co. find eachother?',27);
insert into EPISODIO_ENTITY values (5042, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623864.jpg', 'The Mystery of the Missing Cubchoo!', 40,'While training for the World Tournament in Undella Town, Ash &amp; co. bump into a trainer who is looking for his Cubchoo which disappeared from a locked room in the house. While investigating, Cilan comes to the conclusion that Cubchoo has been kidnapped. However, as they go further into the forest, they soon find a Beartic and assume that Cubchoo has evolved. Has Cubchoo evolved and was it really kidnapped?',27);
insert into EPISODIO_ENTITY values (5043, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623865.jpg', 'Iris and the Rogue Dragonite!', 41,'While training for the World Tournament in Undella Town, Ash &amp; co. soon find that the power for the entire town has been taken out. Officer Jenny appears and informs then that a Dragonite is responsible. Iris is angered by this, claiming that Dragon-type Pokémon would never act this way and runs off to the substation. Ash, Cilan and Dawn quickly follow and find the Dragonite in the area, injured. However, Dragonite has a distrust for humans and starts to act hostile. Will Ash &amp; Co. find out what caused the blackout and will Dragonite get calmed?',27);
insert into EPISODIO_ENTITY values (5044, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623866.jpg', 'Jostling for the Junior Cup!', 42,'Its time for the Junior Cup of the World Tournament and, after the exhibition match between Cynthia &amp; Elite Four member Caitlin, the battle begins. With the old rivals of Burgundy and Georgia re-appearing, the battles are going to be tough. First up is Iris battling against Georgia, with Iris choosing to use the Dragonite she recently captured. However, Dragonite doesnt listen to Iris orders, choosing to do what it wants instead. Will Iris manage to win the battle or will Georgia live up to her Dragon Buster nickname?',27);
insert into EPISODIO_ENTITY values (5045, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623867.jpg', 'Battling Authority Once Again!', 43,'After getting through the first round of the Junior Cup, the second round begins for Ash, Dawn, Iris, Cilan and Trip. However, in the match ups, Dawn and Iris get paired together. Iris is still confident in the strength of her new Dragonite and uses it against Dawns Mamoswine. However, Dragonite continues to do what it decides to do, and not what Iris wants. In addition to that, Trip and Cilan get teamed up. Eager to make up for the defeat at the hands of Cilan in the Club Battle, and to battle Alder, Trip is intent on winning...',27);
insert into EPISODIO_ENTITY values (5046, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623868.jpg', 'Ash, Iris and Trip: Then There Were Three!', 44,'After beating Cilan, Trip moves onto the finals. The battle between Ash and Iris is under with Ashs Krokorok against Iriss Dragonite.',27);
insert into EPISODIO_ENTITY values (5047, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623869.jpg', 'Goodbye, Junior Cup - Hello Adventure!', 45,'Its the final battle of the Junior Cup with Trip facing off against Alder. Dawn leaving for the Wallace Cup in Unova. Ash and Dawn have a battle before she leaves.',27);
insert into EPISODIO_ENTITY values (5048, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623870.jpg', 'The Road to Humilau!', 46,'After telling him about the need for eight badges, Ash &amp; Co. accompany Kotetsu to Seigaiha City in order to challenge the Gym Leader, Marlon. However, enroute, Ash &amp; Co. end up getting seperated from eachother, and Ash and Kotetsu end up randomly at the citys gym. Marlon accepts Kotetsus challenge, but the battle ends up being more of a challenge than Kotetsu thought when he uses Ferrothorn against Marlons Jellicent. Will Kotetsu win?',27);
insert into EPISODIO_ENTITY values (5049, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623871.jpg', 'Unrest at the Nursery!', 47,'While training for the Unova League, Scraggys Focus Blast shoots off and inadvertantly causes an argument between a Rufflet and a Vullaby. However, a nursery school teacher soon arrives and mentions that these two fight often. Cilan decides to investigate this, but soon learns that Pokémon will keep escapring from the Nursery School. Will Cilan be able to put things right?',27);
insert into EPISODIO_ENTITY values (5050, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623872.jpg', 'Meloetta and the Undersea Temple!', 48,'While training for the Unova League, Meloetta decides that it wants to practice against Ash. However, during training, another character comes in and attacks Ash thinking he was attacking Meloetta. Learning that the character is Meloettas protector, Ash &amp; Co. soon learn of a monitoring device watching Meloetta. In haste, they leave only to find that the Team Rocket boss, Giovanni, has returned to Unova and intends to capture Meloetta. Will Ash be able to protect Meloetta?',27);
insert into EPISODIO_ENTITY values (5051, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623873.jpg', 'Unovas Survival Crisis!', 49,'The situation is getting tense. With Team Rocket having unleashed the Abyssal Temple and Ash, Meloetta and Pikachu captured by Giovanni, things truly get bad; Giovanni soon summons Tornadus, Thundurus and Landorus through the Reveal Glass and orders them to go on a rampage. Its up to Ash &amp; Co. to stop Giovanni and the rest of Team Rocket from taking over Unova. Will they be up for the challenge, or will Giovanni succeed with his biggest plan yet?',27);
insert into EPISODIO_ENTITY values (5052, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623880.jpg', 'Beauties Battling for Pride and Prestige!', 1,'Having left Undella Town to head to the Unova League, Ash &amp; Co. bump into a few trainers, known as the Flower Garden Operette Troupe. However, during the meeting, Snivy and Emolga end up trying to break up a fight and crash into one of the trainers, causing the trainer to insult them. Iris gets angered and intends to teach the trainers a lesson. However, the place they live is girls only so she needs to sneak Ash and Cilan in...',27);
insert into EPISODIO_ENTITY values (5053, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623881.jpg', 'A Surface to Air Tag Battle Team!', 2,'On the way to the Unova League, Ash &amp; Co. are ambushed by two trainers who challenge Ash &amp; Cilan to a tag battle. With Braviary and Drilbur against Unfezant and Pansage, things get a bit tense. After the battle, Cilan takes everyone fishing so that the trainers can battle across Earth, Sky and Ocean. Will Ash &amp; Cilan win the battle and will they be able to help the trainers cover all possible avenues of battle?',27);
insert into EPISODIO_ENTITY values (5054, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623882.jpg', 'A Village Homecoming!', 3,'Heading to the Unova League, Ash &amp; Co. enter the Village of the Dragons, where Iris grew up. Iris is eager to tell her friends about her journey so the group decide to stay there. However, when they meet up with a friend of Iris, they find out that two Zweilous shes raising are feuding. To make matters worse, one ends up evolving into Hydreigon and starts to cause a rampage in the village. Will Iris manage to stop Hydreigon?',27);
insert into EPISODIO_ENTITY values (5055, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623883.jpg', 'Drayden Versus Iris: Past, Present, and Future!', 4,'After seeing her calm down a Hydreigon, Drayden told Iris that hes willing to allow her to battle him again. Iris is really excited for the battle, in order to defeat Drayden, so she ends up going for a walk through Opelucid City. In doing so, she bumps into an old school friend who helps her prepare. When the battle comes around, the battle becomes fierce and ends with a rematch of Haxorus VS Excadrill. Will Iris be able to defeat Drayden this time?',27);
insert into EPISODIO_ENTITY values (5056, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623884.jpg', 'Team Eevee and the Pokemon Rescue Squad!', 5,'Heading towards to Unova League, Ash &amp; Co. end up getting trapped in a mountainside by various rocks. However, they soon get rescued by a trainer called Virgil, who runs a Rescue Squad with his brother and father in order to protect the town with his team, Team Eevee. Travelling back with Virgil, they soon discover that a problem has occured at a nearby dam - it has started to freeze over. On investigation, a load of Cryogonal have come and freeze them in a room. Will Ash, Virgil and Team Eevee be able to help stop this?',27);
insert into EPISODIO_ENTITY values (5057, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623885.jpg', 'Curtain Up, Unova League!', 6,'The time has come. Ash &amp; Co. have arrived in Higaki City for the Unova League. When there, they meet up with Stephan, Bianca, Trip and Virgil. All registering for the tournament, they soon find Kotetsu who has been camping to make sure he doesnt miss the tournament, only to find out that he forgot to register. After helping him register, the preliminary battles of 128 people begin. However, Ash gets matched up with Trip straight away. With Ash using Pikachu and Trip using Serperior, the battle is sure to be tense...',27);
insert into EPISODIO_ENTITY values (5058, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623886.jpg', 'Mission: Defeat Your Rival!', 7,'The preliminaries of the Unova League continue and the battle between Ash and Trip is unbelievably tense. With Serperior constantly evading Pikachus attacks, Ash soon finds that he may be out of the tournament earlier than he thought. Will Ash manage to get through Serperiors defences and win? In the other side of the Unova League, Kotetsu and Bianca start a battle. Using Samurott against Escavalier, the battle gets even more tense than before when Samurotts attacks seem to do no damage on Escavalier. Who will win the battles and get through to the finals?',27);
insert into EPISODIO_ENTITY values (5059, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623887.jpg', 'Lost at the League!', 8,'The Unova League has reached a middle point with the qualifiers over and as such, its time for a short break but as Ash &amp; Co. return to the dorms, they soon learn that Axew has disappeared. While looking for Axew, Oshawott inadvertantly eats food meant for Trubbish and Garbodor, angering those Pokémon. Its up to Pikachu and Ash to try and calm the situation while looking for Axew. Will they be able to find Axew before the finals of the Unova League begin?',27);
insert into EPISODIO_ENTITY values (5060, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623888.jpg', 'Strong Strategy Steals the Show!', 9,'Its time for the next round of the Unova League. Having participated in competitions before, its time for the final battle between Ash and Stephan within the Unova League. With Stephan using Liepard, Zebstrika and Sawk, Ash faces a massive challenge. While Palpitoad can fend off Zebstrikas attacks with great ease, Ash ends up having to use Krookodile against Stephans Sawk, being at a complete type disadvantage. Will Ash and Krookodile be able to overcome the type advantage and get to the next round of the Unova League?',27);
insert into EPISODIO_ENTITY values (5061, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623889.jpg', 'Camerons Secret Weapon!', 10,'Its time for the quarter finals of the Unova League and Ash is facing up against his friend Kotetsu. Ash gets a shock when Kotetsu sends out the massively powerful Hydreigon. With the battles now being 6 VS 6 battles in this round, Ash faces a bigger challenge than he has had so far in the league. In addition to that, when Riolu starts to be in play, it manages to climb on top of Ashs Pokémon and do severely damage while on them. Will Ash manage to overcome the odds and defeat his friend?',27);
insert into EPISODIO_ENTITY values (5062, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623890.jpg', 'A Unova League Evolution!', 11,'Ashs quarter final battle against Cameron continues. With Camerons Riolu having just evolved, Ash faces a tougher challenge than he thought he would when his Snivy faints. Having to rely on Pikachu, who is tired after already defeating two Pokémon in the battle, Ash faces the battle of his Unova League career. Lucario and Pikachu keep their fast attacks, but Ash decides to come up with a new strategy in order to try and win. Who will win the battle and get to the semi-finals of the tournament?',27);
insert into EPISODIO_ENTITY values (5063, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623891.jpg', 'New Places... Familiar Faces!', 12,'After placing in the Top 8 in the Unova League, Ash &amp; Co. decide to return to Professor Junipers laboratory Nuvema Town. On the way, they meet with a girl who is just starting on her journey, and decide to help After discussing with Professors Oak &amp; Juniper, Ash decides that he should return to Kanto before decidign where to travel to next. However, soon after that, the trainer they met enters and picks her first Pokémon. To get to grips with training Pokémon, she participates in a tag battle with Ash against Iris &amp; Cilan. However, the battle gets interrupted by Team Rocket, who have returned to Unova...',27);
insert into EPISODIO_ENTITY values (5064, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623892.jpg', 'The Names N!', 13,'Heading towards the White Ruins to help Cedric Juniper with research into Reshiram, Ash &amp; Co. meet up with the trainer, N. Upon conversing with him, they learn that N has some strong ideals and believes that you should not battle with Pokémon, merely become friends with them. However, Team Rocket soon appear, using their new strategies to easily take out the Pokémon. Will N be able to help stop them?',27);
insert into EPISODIO_ENTITY values (5065, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623893.jpg', 'Theres a New Gym Leader in Town!', 14,'Having arrived in Aspertia City, Ash &amp; co. find out a new gym has recently opened up there with a new Gym Leader, Cheren. With the Gym behind the trainer school, Ash &amp; Co. help Cheren out with teaching the various kids there. However, when Axew gets lost, its cries for help spook the other Pokémon in the school and they run off. Its up to Cilan to find them. Meanwhile, Ash and Cheren decide to battle. Will Ash manage to defeat the new Gym Leader?',27);
insert into EPISODIO_ENTITY values (5066, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623894.jpg', 'Team Plasmas Pokémon Power Plot!', 15,'Arriving in Floccesy Town, Ash &amp; Co. are attacked by a group of Amoonguss, who appear to have strange looks in their eyes. They soon learn from the locals that the Pokémon have started to become more violent and that some suspicious people have been spotted around the area. Soon afterwards, Pikachu and Axew soon turn on Ash and Iris, teamed with some wild Pokémon. Out of nowhere, Looker appears to save them and tells them that Team Plasma are nearby, experimenting on the Pokémon...',27);
insert into EPISODIO_ENTITY values (5067, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623895.jpg', 'The Light of Floccesy Ranch!', 16,'Arriving in Floccesy Ranch, Ash &amp; Co. learn of a girl who is looking after a ranch using her Ampharos to herd them. However, the Mareep have stopped listening to the Ampharos and its owner thinks they can solve this by teaching it Thunderpunch, which Iris helps with using Dragonite. However, the Mareep soon start disappearing from the area, causing the girls grandfather to demand to replace Ampharos. Soon, though, Team Rocket appear with the Mareep...',27);
insert into EPISODIO_ENTITY values (5068, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623896.jpg', 'Saving Braviary!', 17,'Team Plasma are continuing their plot to control various Pokémon and are transporting Pokémon to use in their experiment. N is on their tail and attempts to protect and rescue the Braviary they are transporting. However, in doing so he alerts Team Plasma to his presence who attack him. Taking it to the Pokémon Centre, N meets up with Ash &amp; co. but soon after the reunion, the power in the Pokémon Centre cuts out...',27);
insert into EPISODIO_ENTITY values (5069, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623897.jpg', 'The Pokémon Harbor Patrol!', 18,'Heading to Virbank City, Ash &amp; Co. soon see smoke in the distance. Rushing to it, they soon learn of a trainer who is training his Relief Corps Pokémon, Watchog Frillish &amp; Dewott, to handle disasters. Within the team, however, Watchog is wanting to do more than just keep watch for more problems. However, an accident soon occurs in Virbank Complex and causes the Pokémon to be trapped. N is disgruntled by putting Pokémon in dangerous situations like this and asks Watchog for its help. Will they be able to stop the accident and rescue the Pokémon?',27);
insert into EPISODIO_ENTITY values (5070, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623898.jpg', 'The Fires of a Red-Hot Reunion!', 19,'Heading towards the White Ruins, Ash &amp; Co. come across a special Kanto Fair, a fair celebrating the region of Kanto and the various Pokémon that dwell there. Ash is excited to see all these attractions that remind him of home and ends up seeing a cheerful Charmander. Reminding him of his old friend, Ash calls Profesor Oak and requests that he sends over Charizard. However, once there, Charizard soon meets Iris Dragonite and a rivalry begins with a battle. Will the battle last? Who will win? Will Charizard &amp; Dragonite learn to be friends?',27);
insert into EPISODIO_ENTITY values (5071, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623899.jpg', 'Team Plasmas Pokémon Manipulation!', 20,'As they arrive in a new city, Ash &amp; Co. quickly learn that Team Plasma are there and are using their technology to once again manipulate Pokémon. In doing so, the Pokémon Haxorus starts destroying the city. Iris protests at this, claiming theres no way a Dragon-type Pokémon can be bad. In trying to stop the rampage, Iris Dragonite soon falls to Team Plasmas manipulation, and N can no longer hear the Pokémons hearts. N is worried and tries to stop the Pokémon, but ends up becoming their next target. Will they be able to stop Team Plasmas plans?',27);
insert into EPISODIO_ENTITY values (5072, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623900.jpg', 'Secrets from Out of the Fog!', 21,'After being injured by Team Plasmas attack, N falls unconscious and Anthea &amp; Concordia appear and take N away to a lake where N starts to heal. Cautious about Ashs presnece, Anthea &amp; Concordia explain that the area is a special place where Pokémon and humans come to be healed of their wounds. Giving the history of the area, Ash &amp; Co learn of Ns past and how he is connected with Team Plasma. However, when Team Plasma find the place and attack, Anthea &amp; Concordia accuse Ash &amp; Co of assisting Team Plasma to find the area, but change their mind when they see them try to protect it from Team Plasma. Will they succeed?',27);
insert into EPISODIO_ENTITY values (5073, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623901.jpg', 'Meowth, Colress and Team Rivalry!', 22,'Having infiltrated Team Plasmas hideout, Meowth confronts Colress and tries to convince him to switch sides to use his skills to work for Team Rocket. Colress, however, is insistent that he can awaken Meowths true powers using his machines and attempts it, with Jessie &amp; James watching from afar. However, as Meowth has specially trained his mind to prevent being put under control, things look bleak for Colress until the machine finally puts Meowth under control and starts attacking with its Fury Swipes until Colress has him turn on Jessie &amp; James. Will they be able to snap Meowth out of it?',27);
insert into EPISODIO_ENTITY values (5074, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623902.jpg', 'Ash and N: A Clash of Ideals!', 23,'Arriving at the Dragonspiral Tower, Ash &amp; Co. learn that Cedric Juniper has discovered the location of the White Ruins, where the Light Stone is found, which can be used to awaken Reshiram. When they enter the White Ruins and find the Light Stone, it becomes engulfed with light and N soon appears. Asking what Junipers intent is with the Light Stone, N reacts badly and takes the Light Stone from him. However, soon afterwards, Team Plasma appear with intent on the Light Stone. Will Ash &amp; co. be able to stop them?',27);
insert into EPISODIO_ENTITY values (5075, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623903.jpg', 'Team Plasma and the Awakening Ceremony!', 24,'Having got to the White Ruins, Team Plasma have started attacking the archeologists in the area while looking for the Light Stone, having captured Iris, Cilan, Looker and Cedric Juniper, with Team Rocket looking on with interest. Underground, N notes to Ash that he can no longer hear the voices of the Pokémon above, indicating that Colress has used his machine to control them and he and Ash start to hunt for a way out, only for the cave to start collapsing. Once out, Ash &amp; N try to stop Team Plasma from awakening Reshiram, but Colress turns his machine on Pikachu, causing Pikachu to fall under his control...',27);
insert into EPISODIO_ENTITY values (5076, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623904.jpg', 'What Lies Beyond Truth and Ideals!', 25,'After continuing their onslaught in the White Ruins, Team Plasmas plan starts to take shape. With Athena &amp; Concordia returning, being worried about N, they try to stop Team Plasma. However, their Pokémon soon succumb to Team Plasmas control. Soon after, the Light Stone glows and Reshiram is awakened, but before it has a chance to help against Team Plasma, Colress is ordered by Ghetsis to use the manipulation machine on it to gain control. With Reshiram attacking everywhere, things look bleak. Meanwhile, Ash &amp; co. try to escape after being captured, but Colress decides that he needs Pikachu. As he goes to control it with his machine, Meowth appears, with Team Rocket and Looker, and blocks it...',27);
insert into EPISODIO_ENTITY values (5077, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623905.jpg', 'Farewell, Unova! Setting Sail for New Adventures!', 26,'After the Team Plasma escapades, Ash decides to return to Kanto with Iris and Cilan wanting to go there to continue their quests to be Dragon Master and Pokémon Connoisseur respectively. Following Junipers suggestion, Ash &amp; Co. decide to take a ferry which goes through the Decolora Islands. However, when they get on the ferry, they soon learn that everything is not as it seems when simple doors refuse to open. It turns out Team Rocket are in command of the ship...',27);
insert into EPISODIO_ENTITY values (5078, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623906.jpg', 'Danger, Sweet as Honey!', 27,'As they begin their travels through the Decolora Islands, the boat stops off at Honey Island, a place that is world famous for making the special Honeymitsu honey gathered by the Pokémon on the island, specifically Combee. As part of a lottery, Ash wins an All-You-Can-Eat buffet offering over 150 different kinds of treats. However, the lottery soon seems to have turned into a trap when Team Rocket appear. While fighting them off, Pikachu accidentally causes a swarm of Beedrill to appear who then attack, separating everyone into different directions. Will they be able to find eachother?',27);
insert into EPISODIO_ENTITY values (5079, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623907.jpg', 'Cilan and the Case of the Purrloin Witness!', 28,'Traveling to the next island in the Decolora Islands, Ash &amp; Co. participate in a small tournament on the ship. After the tournament, a gem collector intends to show off her special gem collection, and her Purrloin seems jealous of one of the jewels. Another gem collector is onboard and continually asks the collector to sell him her special Liepards Eye gem, but she refuses. However, the gem soon goes missing and accusations fly everywhere. Cilan decides it is down to him to find out who stole the gem...',27);
insert into EPISODIO_ENTITY values (5080, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623908.jpg', 'Crowning the Scalchop King!', 29,'Ash &amp; Co. have arrived on Scalchop Island where the ScalchopKing Playoff tournament is being held. However, when they get there, they learn they are early. With the area filled with trainers with Oshawott and Dewott and they learn that if they win, they receive a golden Scalchop and get teamed up with the female division winner. When the tournament begins, Oshawott gives it his best, but he soon faces up against a Dewott named Caesar and another Dewott which looks oddly familiar. Will Oshawott manage to win, and become the Scalchop King?',27);
insert into EPISODIO_ENTITY values (5081, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623909.jpg', 'The Island of Illusions!', 30,'As Ash &amp; Co. head to the next island, they soon find a large area of fog start to envelope the ship. They learn that the next island theyre heading to is an island where loads of giant Pokémon used to live. As they enter the island, they soon sense something and spot a giant Heatmor, which attacks them. This leads them to more Pokémon which attack, but when they get to a Pokémon Centre, they soon learn that things are not what they seem on the island...',27);
insert into EPISODIO_ENTITY values (5082, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623910.jpg', 'To Catch a Rotom!', 31,'Having learned that Professor Oak is to be on a nearby island, Ash &amp; Co. decide to stop by to help him with his research. On the island, they learn it is filled with the Pokémon, Rotom, and Professor Oak is on the island to fully research Rotoms special form changes. As they arrive in the area, they soon find three Rotom and try to see what electricity the Rotom enjoy. However, Rotom soon decides to change its form and starts to cause chaos. Will Professor Oak get what he needs, or will Team Rocket stop him from fulfilling his research?',27);
insert into EPISODIO_ENTITY values (5083, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623911.jpg', 'The Pirates of Decolore!', 32,'While heading to the next island, Team Rocket concoct a plan to steal all the food from the ferrys store room. However, before they get a chance, various Water-type Pokémon appear and steal the food before them, taking it off the ferry. Ash &amp; Co. hear the alarm and rush to help, only to find the getaway raft and watch the Pokémon get away with the food. After hearing about the acts that these pirate Pokémon partake within, Ash decides to try and stop them, with Charizard, Snivy &amp; Pignite attempting to make them see the errors of the ways. Will they succeed?',27);
insert into EPISODIO_ENTITY values (5084, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623912.jpg', 'Butterfree and Me!', 33,'Arriving on Migration Island, Ash &amp; Co. witness a massive amount of Metapod evolve into Butterfree and fly away, as is tradition on the island. However, as the Butterfree leave, Ash notices a wild Caterpie emerge, having not even evolved into Metapod yet. Remembering his own Butterfree, Ash decides to help the Caterpie to evolve so it can leave on time with its family. However, Caterpie struggles with the training due to its love of sleep, but things get even worse when wild Ursaring appear and start causing hassle. Will Ash be able to help the Caterpie?',27);
insert into EPISODIO_ENTITY values (5085, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623913.jpg', 'The Path That Leads to Goodbye!', 34,'Arriving on Big Island, the biggest island in the Decolora Archipelago, Ash &amp; Co. encounter the rare Pokémon, Dunsparce. Ash is eager to capture it and challenges it to a battle. During which, it uses its Screech attack which disorientates Ash, causing him to fall onto Iris floral headdress, and while Pikachu tries to attack the Dunsparce, Axew inadvertently crashes into it causing Dunsparce to escape. Ash is angered and blames Axew for this, causing Iris to get angered at Ash. Ash tries to mend fences with Iris, but Iris angrily says shes leaving and heads off with Axew. Will Ash &amp; Iris manage to make up?',27);
insert into EPISODIO_ENTITY values (5086, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623914.jpg', 'Searching for a Wish!', 35,'Continuing their travel across Big Island, Ash &amp; Co. become witness to a rare event, the 1,000 year awakening of the Pokémon Jirachi, who only wakes for seven days. As Pikachu and Axew play with Jirachi, Ash decides to introduce itself but Jirachi, scared of humans, backs away and leaves. Ash is disheartened by this but soon meets a girl who is looking for Jirachi to make her wish to make the land fertile come true. Ash &amp; Co. decide to help her with this but struggle to find Jirachi in the seven days its awake. However, the moment they do, Team Rocket appears and attacks. Will Team Rocket manage to get the weakened Jirachi, or will the wish be granted?',27);
insert into EPISODIO_ENTITY values (5087, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623915.jpg', 'Capacia Island UFO!', 36,'As they reach the other end of Big Island, Ash &amp; Co. rest at the Pokémon Center, however when Ash wakes up he finds that Cilan, Iris and Axews face has been replaced with that of a Beheeyem. Rushing outside, he finds that everyone in town, both people and Pokémon, have had their face turned into a Beheeyem face. Ash worries with what to do until he bumps into two people who have yet to be converted, Jessie and James. It turns out they are looking for Meowth who has disappeared. Ash decides to enlist the help of his enemies in order to try and restore the town. Will they succeed?',27);
insert into EPISODIO_ENTITY values (5088, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623916.jpg', 'The Journalist from Another Region!', 37,'As they reach the next island, Ash &amp; Co. meet up with Alexa, a journalist from the Kalos region, and her Pokémon Gogoat and Helioptile which dont register on Ashs Pokédex. Alexa explains that shes in the Decolora Islands to research an article on the tradition of the island, the Harvest Festival. As they enter the festival, they learn of a special Pokémon Sumo tournament where the winner shall win the Focus Band, and some rare berries. Ash, Cilan and Iris each decide to enter this tournament, but things turn out to be tougher than they thought. Who will win the tournament?',27);
insert into EPISODIO_ENTITY values (5089, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623917.jpg', 'Mystery on a Deserted Island!', 38,'Heading to the next island, Alexa informs Ash &amp; Co. that there are rumours of a hidden treasure on a nearby uninhabited island. Ash &amp; co. decide to investigate this to try and find the treasure, helping Alexa to solve the mystery she learned when doing a report years before. However, Team Rocket have heard about the treasure as well and head there, and to top it off, the wild Pokémon on the island are intent on protecting it. Will Ash &amp; Co. find it?',27);
insert into EPISODIO_ENTITY values (5090, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623918.jpg', 'A Pokémon of a Different Color!', 39,'Arriving on the next island, Ash &amp; co. meet up with the Blackthorn City Gym Leader, Clair. Clair has come to the island in search of a very special Pokémon, a shiny Druddigon! However, while searching for it, she got separated from her Dragonite so Ash &amp; Iris decide to help find it. Once found, Iris Dragonite starts to feud with Clairs which causes various issues, but when Clair solves this and moves on to find the Druddigon, she finds out that not is all what it seems with this special Pokémon. Will she be able to calm and capture it?',27);
insert into EPISODIO_ENTITY values (5091, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623919.jpg', 'Celebrating the Heros Comet!', 40,'Arriving on the next island, Ash &amp; co. learn that its the time of the year for the Woodates Comet showing, which only appears once every 10 years, so they go to the top of a mountain to observe it. It is said that when the comet passes, the Pokémon in the area start acting strangely. When travelling up the mountai, they discover Woodates battlefield amongst the ruins, but soon find that Team Rocket have a plan set. Will they managed to stop Team Rocket in time to see the comet?',27);
insert into EPISODIO_ENTITY values (5092, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623920.jpg', 'Go, Go Gogoat!', 41,'As theyre on a new island, Alexa starts to work on a new article which gives Ash a chance to learn about Gogoat, one of Alexas Pokémon from the Kalos region. However, soon afterwards, a boy who lives in the island comes over to Gogoat and touches its horn. As Gogoat can read minds when interacting with his horn, he sees what the boy is thinking and runs off with him. Ash &amp; Alexa go out to find Gogoat, to find that it has gone off to where the boys father works. Why did the boy leave with Gogoat? Will Alexa get it back?',27);
insert into EPISODIO_ENTITY values (5093, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623921.jpg', 'Team Rockets Shocking Recruit!', 42,'While waiting for the boat to take them to the next island, Ash &amp; Co. decide to take a break and have a picnic. However, while the Pokémon are playing, Iris misunderstands the conflict and erroneously scolds Emolga, which makes Emolga fly off angry. However, when it lands, it finds itself by Team Rocket, and defeats them. This causes them to urge Emolga to join them, which it accepts. However, when they appear in front of Ash, Team Rocket manage to capture Axew. Will Iris be able to get Axew back and apologise to Emolga?',27);
insert into EPISODIO_ENTITY values (5094, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623922.jpg', 'Survival of the Striaton Gym!', 43,'When on the next island on their journey, Ash &amp; co. meet up with Cilans brothers, Chili and Cress and learn about a dojo breaker who has decided to set her sights on the Striaton City Gym. Having already defeated Chili and Cress, the "dojo breaker" has decided that she needs to beat Cilan which is why they are all on the island and challenges him, to which he accepts. Will Cilan be able to defend his brothers and his gym?',27);
insert into EPISODIO_ENTITY values (5095, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623923.jpg', 'Best Wishes Until We Meet Again!', 44,'Ash &amp; co. have boarded the finalboat on the stretch of their journey and start to approach Vermilion City. However, Team Rocket are nearby and have plots to steal every Pokémon on the boat before it reaches the Kanto region. With their plot, they manage to lift the boat out of the sea, causing turmoil. However, when they attempt to succeed with their plan, Porter tries to stop them, but Ash &amp; Co. soon discover that there appears to be two Porters on the ship. Will Ash &amp; co. reach Kanto in tact, or will Team Rocket succeed?',27);
insert into EPISODIO_ENTITY values (5096, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623924.jpg', 'The Dream Continues!', 45,'Having parted ways with Iris and Cilan, Ash returns to Pallet Town with Alexa. Initially intending to go to Professor Oaks laboratory to see his Pokémon, Alexa convinces Ash to pay a visit to his mother first. After some time there, Ash gets restless and heads to Professor Oaks laboratory and starts to reflect on his journey through Unova and the Decolore Islands, and starts to think abotu where to go next. However, as he is doing so, Team Rocket attacks the laboratory. Will Ash and his Pokémon protect the lab?',27);
insert into EPISODIO_ENTITY values (5097, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623941.jpg', 'Kalos, Where Dreams and Adventures Begin!', 1,'After the journey across the Decolore Islands with Alexa, Ash has decided to go to the Kalos region. Thrilled to see new Pokémon, Ash and Pikachu walk through Lumiose City. However, they encounter a Pokémon, who seems to have a similar appearance to Blaziken, but looks different.',27);
insert into EPISODIO_ENTITY values (5098, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623943.jpg', 'Lumiose City Pursuit!', 2,'Ash heads to Professor Sycamores laboratory, where he discovers the professor is investigating a strange looking Garchomp. Team Rocket overhears the conversation and tries to steal Garchomp for themselves, which would lead to a possible disaster.',27);
insert into EPISODIO_ENTITY values (5099, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623944.jpg', 'A Battle of Aerial Mobility!', 3,'Ash has registered for the Kalos Pokémon League and decides to set off on his journey towards the first gym. On the journey, he meets the cute Pokémon Dedenne, which appears to want some fruit. When Ash offers it some fruit, however, a Fletchling appears and steals the fruit. Ash challenges the Fletchling with his new friend Froakie to try and stop it. Will he be able to?',27);
insert into EPISODIO_ENTITY values (5100, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623945.jpg', 'A Shockingly Cheeky Friendship!', 4,'While heading to Santalune City, Ash &amp; Co. stop to feed their Pokémon when they find the Dedenne they previously encountered has been following them. Bonnie is happy to see it and tries to get it, when it suddenly attacks. Meanwhile, Serena has arrived in Lumiose City and is offered a Starter Pokémon by Professor Sycamore. However, once she decides, she decides she needs to go find Ash. Will Bonnie get the Dedenne and will Serena be able to find Ash?',27);
insert into EPISODIO_ENTITY values (5101, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623946.jpg', 'A Blustery Santalune Gym Battle!', 5,'Finally arriving in Santalune City, Ash decides to rush to the Gym to battle Alexas sister, Viola. When they arrive at the gym, they meet Alexa who introduces them to her sister. Ash is eager and immediately challenges her. Learning shes a Bug-type trainer, Ash ends up with a bigger challenge than he had thought when her Surskit freezes the battleground, causing Pikachu to stumble. Will Ash manage to win?',27);
insert into EPISODIO_ENTITY values (5102, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623947.jpg', 'Battling on Thin Ice!', 6,'After his loss due to Violas interesting battle techniques, Ash has started training with Violas sister, Alexa. The training specific to withstanding the Gust move from Vivillon and Surskits Ice Arena. After the training, it is time for Ashs Gym Battle rematch against Viola, but will his training have worked or will he be suffering another loss at the hands of this Gym Leader?',27);
insert into EPISODIO_ENTITY values (5103, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623948.jpg', 'Giving Chase at the Rhyhorn Race!', 7,'Heading back towards Lumiose City, Ash &amp; Co. arrive in a small village where a special competition takes place, the Rhyhorn Race. After learning that the competition is open to anybody, Ash decides to enter. Serena takes the opportunity, based on the training with her mother, to be Ashs coach in the race. However, when the day of the race comes, Ash soon learns that the race will be trickier than he imagined when Team Rocket appears half way through the course...',27);
insert into EPISODIO_ENTITY values (5104, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623949.jpg', 'Grooming Furfrou!', 8,'When they arrived at the next city, Serena informs Ash &amp; Co. that there is a special Star Groomer in the city. This groomer has got an apprentice who is having some troubles; the Furfrou she has to groom doesnt approve of her, and just refuses to be groomed. However, when some new groomers come in, and offer to groom the groups Pokémon, things are not what they seem. Will Ash &amp; Co. be able to protect their Pokémon and help the groomer to groom Furfrou?',27);
insert into EPISODIO_ENTITY values (5105, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623950.jpg', 'Clemonts Got a Secret!', 9,'Returning to Lumiose City, Ash &amp; co. bump into Clemont &amp; Bonnies father, who inadvertently reveals to Ash and Serena that Clemont is the Lumiose City Gym Leader. However, they soon learn that a machine created by Clemont, the Citroid, which was to guard the gym, has instead taken over it. Clemont is eager to stop the Citroid and infiltrates the gym, only to find that the Citroid demands a battle. Will Clemont be able to retake the gym?',27);
insert into EPISODIO_ENTITY values (5106, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623951.jpg', 'Mega-Mega Meowth Madness!', 10,'About to set off to Cyllage City, Ash &amp; Co. decide to stop by Professor Sycamores laboratory. However, when they get there, they discover that Team Rocket have decided to kidnap him in order to get his research on Mega Evolution. Bonnie &amp; Serena try to investigate and look for Sycamore, but end up captured themselves. Ash &amp; Clemont try to follow, but find a very gluttonous Chespin. Can they rescue Sycamore?',27);
insert into EPISODIO_ENTITY values (5107, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623952.jpg', 'The Bamboozling Forest!', 11,'Heading towards the next city, Ash &amp; Co. stop off to have some food, but while eating, two Pancham suddenly appear and begin to eat all of the food. While they are trying to sort it out, Team Rocket appear and manage to capture everyone, and fly off. However, as Team Rocket are flying off, they argue which causes them to crash causing everyone to be separated, and to top things off, Meowth lands on a Pangoro, angering it. Will everyone meet up again?',27);
insert into EPISODIO_ENTITY values (5108, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623953.jpg', 'To Catch a Pokémon Smuggler!', 12,'While heading towards Cyllage City, Ash &amp; Co. see a person who sells Pokémon escaping from Officer Jenny. This seller makes his money by capturing and selling the Pokémon, Vivillon, which has different appearances based upon where it was born. Ash &amp; co. decide to help Jenny catch the seller. However, as they get on his trail, Ash finds a Scatterbug that the seller had discarded. Will Ash &amp; co. manage to help stop this bad person?',27);
insert into EPISODIO_ENTITY values (5109, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623954.jpg', 'Kindergarten Chaos!', 13,'While heading towards Cyllage City, Ash &amp; Co. meet a Pokémon trainer who challenges Ash to a battle. She challenges with the stipulation that if she wins, Ash has to spend time with her. In the battle, she uses the Fairy-type Pokémon, Sylveon...the first Fairy-type Pokémon that Ash has battled. Having lost, she takes Ash to the nearby kindergarten in order to show the children there various Pokémon. However, one child is reluctant to see the various Pokémon and soon, Team Rocket appears...',27);
insert into EPISODIO_ENTITY values (5110, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623955.jpg', 'Seeking Shelter from the Storm!', 14,'While heading towards Cyllage City, Ash &amp; Co. get stuck in a storm and have to find shelter. Coming upon a large mansion, they find that nobody is in it, but some strange things start to happen in it such as things moving, lights turning on and off and doors slamming. Despite these strange happenings, Ash &amp; Co., along with Team Rocket, decide to head further into the mansion, but a mysterious shadow starts to follow them...',27);
insert into EPISODIO_ENTITY values (5111, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623956.jpg', 'An Appetite for Battle!', 15,'While resting on their journey, Clemonts Chespin gorges itself on all the treats that Serena has made, and it starts to show as Chespin gets fatter. Clemont is intent to help Chespin get back into shape, but when it loses in two battles that were intended as exercise, Clemont decides to create a machine to help Chespin get into shape. However, once its complete, Chespin is nowhere to be found. Will Clemont find Chespin and be able to help it get back into shape?',27);
insert into EPISODIO_ENTITY values (5112, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623957.jpg', 'A Jolting Switcheroo!', 16,'While resting on their journey, Bonnie accidentally switches her bag with the bag of another girl. Both girls keep a Pokémon in their bag, with Bonnie getting the girls Pichu and the girl getting Dedenne. Ash &amp; Co. decide to look for the girl who now has Dedenne in order to exchange the Pokémon back, but with only a vague description, the search may be tricky. Will Bonnie be reunited with Dedenne?',27);
insert into EPISODIO_ENTITY values (5113, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623958.jpg', 'A Rush of Ninja Wisdom!', 17,'While on their travels, Ash decides that its time to train his Froakie. During the training, they end up meeting a ninja trainer and his Pokémon Frogadier, the evolved form of Froakie. Ash challenges him to a battle, but ends up losing. Ash is eager to improve with Froakie and requests the trainers help to teach Froakie Quick Attack, so the four of them start to train hard. However, things start to go wrong when Team Rocket appear. Will Froakie manage to learn Quick Attack?',27);
insert into EPISODIO_ENTITY values (5114, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623959.jpg', 'Awakening the Sleeping Giant!', 18,'Arriving in Camphier Town, Ash &amp; Co. soon discover a wild Snorlax asleep in the middle of town, snoring and thus causing issues to everyone in town. In order to wake the Snorlax, they need to find King Shabboneau and have him play the PokéFlute. However, the PokéFlute has been taken by the princess of Parfum Palace and she refuses. When Ash and co finally meet her to get the PokéFlute back, she finally agrees but on a condition; a battle, and the battle has a very high price... Will Ash manage to beat the princess?',27);
insert into EPISODIO_ENTITY values (5115, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623960.jpg', 'A Conspiracy to Conquer!', 19,'As they travel towards Cyllage City, Team Rocket encounter a new adversary in Madame X and her partner Pokémon, Malamar. Madame X had managed to use her powers to brainwash Jessie and James into doing her bidding before Meowth managed to escape. However, without any allies in this region, Meowth must turn to Ash &amp; Co. for help. However, one by one, everyone starts to get brainwashed, including Pikachu. What will Ash do? Will he and Meowth manage to stop Madame X?',27);
insert into EPISODIO_ENTITY values (5116, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623961.jpg', 'Breaking Titles at the Chateau!', 20,'Heading towards Cyllage City, Ash &amp; Co. meet up with the Santalune City Gym Leader, Viola who informs them about the Battle Chateau, where people go for some of the strongest Pokémon battles. While there, they meet the Gym Leader of the next city, Grant. Due to the amount of wins both Grant &amp; Viola have at the Chateau, it is their time to battle eachother. Who will win? Will Ash manage to win his battles in the Chateau?',27);
insert into EPISODIO_ENTITY values (5117, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623963.jpg', 'A PokéVision of Things to Come!', 21,'Heading towards Cyllage City, Ash &amp; Co. learn of the PokéVision videos, that promote the attractiveness of trainers and their Pokémon. After watching a special video from one of Kalos idols and her Fennekin, Serena decides that its time for her to begin one herself. With the help of Ash, Clemont and Bonnie, she starts to film her video, but things start to go wrong...',27);
insert into EPISODIO_ENTITY values (5118, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623964.jpg', 'Going for the Gold!', 22,'Ash &amp; Co. have arrived at Ambrette Town and decide to head towards the special aquarium, where many Water-type Pokémon have been collected from around the world. Meeting the curator and his Clauncher, Ash &amp; co. learn that he is hunting for a special shiny Magikarp. Ash &amp; co. decide to help him find the special Magikarp, with Clemont creating a special machine to help. However, things arent as easy as they seem. Will Ash &amp; Co. manage to help him find the Magikarp?',27);
insert into EPISODIO_ENTITY values (5119, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623965.jpg', 'Coming Back Into the Cold!', 23,'Reuniting with Alexa, Ash &amp; co. decide to visit the Fossil Laboratory in Ambrette Town, to help Alexa with a feature she is doing. While exploring the laboratories, one of the scientists shows them a recently revived Amaura and Aurorus, two very rare ancient Pokémon. After some time playing with the young Amaura, Ash &amp; Co. go to take a break, which is when Team Rocket sneak in to steal Amaura. Will Ash &amp; co. be able to rescue it and return it to its parent?',27);
insert into EPISODIO_ENTITY values (5120, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623966.jpg', 'Climbing the Walls!', 24,'Finally arriving in Cyllage City, Ash decides to rush to the Cyllage City Gym to challenge Grant to a match. Grant accepts and sends out Onix, to which Ash responds by sending Froakie. Having trained hard to work around Onixs Rock Tomb strategy that they saw previously. Will the strategy work, and when it comes down to Pikachu against the fossil Pokémon, Tyrunt, will Ash manage to win the overall battle?',27);
insert into EPISODIO_ENTITY values (5121, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623968.jpg', 'A Battle by Any Other Name!', 25,'Heading towards Shalour City, Serena decides to treat everyone to hand-made PokéPuffs, a special confectionary made specifically for Pokémon. However, a Slurpuff and its trainer soon come by and test Serenas PokéPuffs and give them a mediocre rating, causing an argument between Serena and the trainer. Upon learning of a special PokéPuff competition in a nearby town, Serena and the trainer decide to settle it once and for all. Who will win?',27);
insert into EPISODIO_ENTITY values (5122, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623969.jpg', 'To Find a Fairy Flower!', 26,'Heading towards Shalour City, Serena gives Bonnie a special hair decoration based on a flower. However, a Flabébé mistakes it for its own flower, which it had previously lost, and stays with Bonnie. Ash &amp; co. decide to help Flabébé to find its flower, but this proves to be difficult when they learn that the flowers are no longer in bloom. Will Ash &amp; Co. be able to help Flabébé find its flower?',27);
insert into EPISODIO_ENTITY values (5123, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623970.jpg', 'The Bonds of Evolution!', 27,'Heading towards Shalour City, Ash &amp; Co. enter a small town where they hear that the champion of the region, Diantha, is there to officiate and take part in an Exhibition Match to begin a tournament in the town. Ash is eager to meet Diantha and challenge her to a battle, but is blocked by her staff. However, when they meet Professor Sycamore, he decides to ask for Dianthas help in researching Mega Evolution, and intends to help Ash meet her. When he does, she accepts Ashs challenge. Who will win?',27);
insert into EPISODIO_ENTITY values (5124, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623972.jpg', 'Heroes - Friends and Faux Alike!', 28,'Heading towards Shalour City, Ash &amp; Co. enter a town where they are quickly apprehended by Officer Jenny, who claims that three people known as Ash, Serena and Bonnie, who have a Pikachu and a Dedenne, have been caught out numerous times in the town dine-and-dashing, among other things. Ash &amp; co. protest their innocence and decide to help Officer Jenny find the people who are besmirching their good name. Will they be able to find them and resolve this?',27);
insert into EPISODIO_ENTITY values (5125, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623973.jpg', 'Mega Revelations!', 29,'Nearing Shalour City, Ash &amp; Co. meet up with the trainer Korrina. On learning that she is the Gym Leader of Shalour City, Ash decides to challenge her to a battle, but soon learns that Korrina is on a quest with her Lucario. She is investigating Mega Evolution and is hunting for the ability to help her Lucario Mega Evolve into Mega Lucario. Will she find the means?',27);
insert into EPISODIO_ENTITY values (5126, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623974.jpg', 'The Cave of Trials!', 30,'Having teamed up with Korrina, Ash &amp; co. arrive in Geosenge Town in search of the Lucarionite, the Mega Stone Korrina needs to Mega Evolve her Lucario. Having learned that the Mega Stone is found within a nearby cave, they go to investigate. However, while there, they find Team Rocket beat them to it and got blasted off by a mysterious force in the cave. Upon investigation, they discover that a Blaziken is in the cave and must be defeated to get the Lucarionite. Can Lucario defeat it?',27);
insert into EPISODIO_ENTITY values (5127, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623975.jpg', 'The Aura Storm!', 31,'Having found the Lucarionite in the cave, Korrina meets up with her grandfather, the Mega Evolution Guru Gurkinn. To test Lucarios new power as Mega Lucario, Korrina and Ash decide to battle. However, when Lucarios power is stronger than it can handle, it loses control of its Aura and starts getting more and more brutal. Korrina and Ash try to stop Lucario, but it keeps mercilessly beating Pikachu. Will they manage to control Mega Lucario?',27);
insert into EPISODIO_ENTITY values (5128, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623976.jpg', 'Calling from Beyond the Aura!', 32,'Having been given a trial by Gurkinn in order to help Korrinas Lucario control its aura after Mega Evolving, Ash &amp; Co. set off to the nearby mountains. However, Team Rocket have reached the mountains first and have decided to set up a trap. The trap causes a horde of Noibat to anger and attack Ash &amp; Co., seperating them as they escape. Will tjhey be able to find eachother?',27);
insert into EPISODIO_ENTITY values (5129, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623977.jpg', 'The Bonds of Mega Evolution!', 33,'Following Gurkkins advice, Ash &amp; co. join Korrina on a trip to the Must Mountains to face a trainer who has experience with Mega Evolution. However, during the battle, Korrinas Mega Lucario loses control of its power again, causing it to lose. The elderly trainer decides to help Korrina and Lucario train and control their power, but through some of the more unrelated methods such as flower arranging. Will this help Korrina and Lucario overcome their problems?',27);
insert into EPISODIO_ENTITY values (5130, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623978.jpg', 'The Forest Champion!', 34,'Heading towards Shalour City, Ash &amp; Co. encounter an Ursaring bullying various other Pokémon in a forest. However, as they go to stop it, a Hawlucha comes out of nowhere to defend the other Pokémon. Ash is impressed by the Hawluchas attitude in using cool moves with the intent of making the battle look good, so decides to help it train to perfect the move, Flying Press. However, during training, some Pokémon attack them...',27);
insert into EPISODIO_ENTITY values (5131, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623979.jpg', 'Battles in the Sky!', 35,'Heading towards Shalour City, Ash &amp; Co. enter Kalos Canyon, an area where various trainers come to participate in Sky Battles. Meeting a trainer and her Talonflame, Ash decides to enter the Sky Battle with his newly caught, Hawlucha. If Hawlucha wins against Talonflame, then Ash will be able to test out his Fletchling. Will Hawlucha win and will Fletchling get its chance to shine?',27);
insert into EPISODIO_ENTITY values (5132, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623980.jpg', 'The Cave of Mirrors!', 36,'Traversing through Reflection Cave, Ash &amp; co. are checking out the marvels of the caves reflective structure when Pikachu is taken from Ash by a strange version of Ash. Ash instinctively follows his doppelganger and ends up in a mirror world, where Serena is determined, Clemont is athletic and Bonnie is very "lady-like", all the opposite of the friends he knows. Will Ash be able to find Pikachu and return to his world?',27);
insert into EPISODIO_ENTITY values (5133, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623981.jpg', 'Forging Forest Friendships!', 37,'While training for the Shalour City Gym battle, Hawlucha and Froakie start to be at odds, and cant seem to work in sync, and end up fighting in the battle. Ash is eager to change this so suggest a special combo to train them and help them learn to work together. However, when the training begins, despite not going smoothly, progress is made until Ash is grabbed and dragged into the forest by something, leaving it up to Hawlucha and Froakie to find &amp; rescue him. Will they succeed?',27);
insert into EPISODIO_ENTITY values (5134, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623982.jpg', 'Summer of Discovery!', 38,'As they near Shalour City, Ash &amp; Co. learn of a Pokémon Summer Camp being held by Professor Sycamore. In this camp, the trainers compete with each other in various activities, and get scored based on it with the top trainers entering the special Hall of Fame. When at the camp, they meet a trio of trainers, Shauna Trevor &amp; Tierno who have Bulbasaur, Charmander and Squirtle as their partner Pokémon. A rivalry quickly develops between the seven and the Summer Camp begins...',27);
insert into EPISODIO_ENTITY values (5135, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623983.jpg', 'Day Three Block Busters!', 39,'Its the third day in the Pokémon Summer Camp and the task put forth is the PokéVision Production. Serena, a big fan of PokéVision, is eager to get started and show off her Pokémon, so starts grooming and cooking PokéPuffs. However, when they go out to find a spot to film, Serena doesnt notice a cliff-face and slides down. Ash tries to grab her but falls down as well. Will the pair be alright and will Serena find a place to film her PokéVision video?',27);
insert into EPISODIO_ENTITY values (5136, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623985.jpg', 'Foggy Pokémon Orienteering!', 40,'The Pokémon Summer Camp competition is heating up with Ash &amp; Tiernos teams having the exact same amount of points. The next challenge is PokéEnteering, where each team has to go to various locations and collect stamps, and the fastest time wins. Both teams go smoothly through the challenge, but soon a mysterious mist appears and Bonnie gets lost. To top it off, she sees the legendary Pokémon, Xerneas. Will Ash, Tierno &amp; co. manage to find Bonnie and still win the competition?',27);
insert into EPISODIO_ENTITY values (5137, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623986.jpg', 'Battling Into the Hall of Fame!', 41,'The Pokémon Summer Camp competition is coming to a close with both Ash &amp; Tiernos teams at the top of the rankings. For the final assessment, a special Team Battle is to be held. This is where the six trainers face off against eachother at the same time. Before the battle, they all head to the Pokémon Center to make sure their Pokémon are in top-form. However, as Team Rocket have been posing as chefs in the camp, their plan finally comes to fruition and they capture many trainers Pokémon, including Tiernos Squirtle. Will they manage to retrieve the Pokémon and, when it comes to the battle, who will win and join the Summer Camp Hall of Fame?',27);
insert into EPISODIO_ENTITY values (5138, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623987.jpg', 'Origins of Mega Evolution!', 42,'Finally arriving in Shalour City, Ash &amp; co. meet up with their old friend, Korrina and her Lucario. While there, they had towards the Tower of Mastery where Ash challenges Korrina to a gym battle, despite not having mastered the techniques Tierno showed him. However, the night before the gym match, Team Rocket appear in the tower and steal a document dedicated to Mega Evolution. Will Ash &amp; Co. be able to retrieve the document in time for the battle?',27);
insert into EPISODIO_ENTITY values (5139, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623988.jpg', 'Showdown at the Shalour Gym!', 43,'After struggling to practice his defence moves taught by Tierno, Ash rushingly has challenged Korrina to a gym battle, and the battle is about to begin. In a three on three battle, Ash uses his Pikachu, Hawlucha and Fletchinder against Korrinas Fighting-type Pokémon Mienfoo, Machoke and Lucario, but with Lucario comes Mega Evolution and Ash has unable to beat Korrinas Mega Lucario in battle. Will he manage to this time and earn a Rumble Badge?',27);
insert into EPISODIO_ENTITY values (5140, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623989.jpg', 'Splitting Heirs!', 44,'Heading towards Coumarine City, Ash &amp; Co. meet up with a pair of brothers, each with a Meowstic. Having both been on their journeys separately, they are now returning home but, when they finally meet after so long, there is tension between the two of them. When they get home, their father decides to set a test for them to compete against eachother in, with the winner being chosen as his successor, and Ash &amp; co. are roped in to help. Who will win?',27);
insert into EPISODIO_ENTITY values (5141, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623990.jpg', 'The Clumsy Crier Quiets the Chaos!', 45,'Heading towards Coumarine City, Ash &amp; Co. meet a Nurse Joy whose Wigglytuff continually makes mistakes, drops things etc. When a Slaamence starts attacking the town, injuring numerous Pokémon, things get worse for the Nurse Joy as Wigglytuff continues to make mistakes due to it panicking. But, when the Salamence begins to attack Nurse Joy, Wigglytuff stands up to defend its trainer. Will it manage to defeat the Salamence?',27);
insert into EPISODIO_ENTITY values (5142, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623991.jpg', 'Dreaming a Performers Dream!', 46,'After a Pancham disrupts a television performance and steals Ashs hat and Clemonts glasses, Serena battles it with her Fennekin in an attempt to capture it and teach it manners.',27);
insert into EPISODIO_ENTITY values (5143, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623992.jpg', 'A Campus Reunion!', 47,'Heading towards Coumarine City, Ash &amp; Co. find the school where Clemont used to attend. As they tour the facility, the power starts to go out and as they go to investigate, a wild Luxio blocks their path. It turns out that this Luxio evolved from a Shiny that Clemont had befriended as a child. However, theres a tension between them after a misunderstanding when they were young. Will Clemont be able to fix the friendship and find out whats causing the power cut?',27);
insert into EPISODIO_ENTITY values (5144, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/623994.jpg', 'Bonnie for the Defense!', 48,'While heading to Coumarine City, Ash &amp; Co. decide to stop off in a forest to relax. With everyone relaxing in their own way, Bonnie decides to explore the nearby area with Dedenne. On exploring, she meets up with three kids who call themselves the Lapras Defense Corps due to the fact they are looking after an injured Lapras. As Lapras is nearly healed, it seems rather sad so the kids decide its time to release it back in the ocean. However, as they go to do so, Team Rocket appears to try to get the Lapras. Without having Pokémon of their own to defend Lapras, will the kids be able to get it back into the wild and hold off Team Rocket?',27);
insert into EPISODIO_ENTITY values (5145, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624228.jpg', 'Pathways to Performance Partnering!', 1,'While heading to Coumarine City, a fight between Pancham and Chespin causes the gang to meet a new trainer. Like Serena, this trainer is working on participating in the Tripokalon. Excited, they both show eachother their performances until they get interrupted by Team Rocket who steal the Pokémon. Separated from their trainers, its up to Pancham and Chespin to get the Pokémon back to their trainers. Will they be able to put aside their differences?',27);
insert into EPISODIO_ENTITY values (5146, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624229.jpg', 'When Light and Dark Collide!', 2,'While heading to Coumarine City, Ash &amp; co. encounter a shiny Hawlucha attacking a Snubbull. When they go to help out, they learn that the Pokémon were in fact rehearsing for a play. Not realising this, they interrupt and accidentally hurt the Gallade that is the lead. Due to Gallade being injured, Ash offers to take the place with his Hawlucha, but the two Hawlucha start to fight causing practice to go awry, and when the play begins, Team Rocket appear. Will Ash &amp; Co. be able to help?',27);
insert into EPISODIO_ENTITY values (5147, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624230.jpg', 'An Undersea Place to Call Home!', 3,'While fishing in the Muraille Coast, Ash hooks a Skrelp who manages to poison Pikachu. Rushing for help, he finds a pair of marine archeologist who are willing to help Pikachu. While helping Pikachu, they tell Ash &amp; co. that they are looking for a luxury liner which was said to sink around this area. Ash &amp; co. decide to help out, but Team Rocket overhears this and want to reach the ship first to get the treasure. Who will get there?',27);
insert into EPISODIO_ENTITY values (5148, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624231.jpg', 'A Stealthy Challenge!', 4,'While heading to Coumarine City, Ash &amp; co. meet up with their old friend Sanpei, saving him after an injury during training. They learn that Sanpei was attacked by a masked ninja when on a mission to deliver a scroll to a mansion. Deciding to help, Ash &amp; Co. join Sanpei on his mission, but soon the masked ninja appears and challenges them for a battle. During the battle, something happens with Froakie. Will Ash &amp; co. be able to deliver the scroll?',27);
insert into EPISODIO_ENTITY values (5149, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624232.jpg', 'A Race for Home!', 5,'While heading to Coumarine City, Ash &amp; co. visit a ranch. There, they find Serenas mother, Grace, is also visiting. Grace wants Serena to continue to train to be a Rhyhorn Racer, but Serena recently found a new path as a Pokémon Performer. Serena has been hiding it from her mother, but eventually tells the truth. Grace doesnt approve causing Serena to challenge her mother to a race using Skiddo. If she wins, Grace lets her continue her dream. Who will win?',27);
insert into EPISODIO_ENTITY values (5150, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624233.jpg', 'Facing the Grand Design!', 6,'While heading to Coumarine City, Ash &amp; co. encounter the evil Malamar that took over a power plant earlier in their travels. Noting that it is planning something, both Ash &amp; co. and Team Rocket are captured by it and unable to stop it. However, when Clemont, James and Meowth break free, they try to rescue the others but James Inkay starts acting very strangely and gets out of control. Will they be able to save the others and stop Malamar?',27);
insert into EPISODIO_ENTITY values (5151, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624234.jpg', 'A Slippery Encounter!', 7,'While heading to Coumarine City, Ash &amp; co. encounter encounter a Goomy, a Pokémon that is considered to be the weakest Dragon-type. As the group start trying to help the Goomy, Team Rocket monopolise on the distraction and steal both Goomy and Pikachu. When Pikachu &amp; Goomy work a way to escape from their clutches, Team Rocket make haste. Will they be able to get away?',27);
insert into EPISODIO_ENTITY values (5152, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624235.jpg', 'One for the Goomy!', 8,'While heading to Coumarine City, Ash &amp; co. take a break for their Pokémon to relax. While there, Ash introduces his Pokémon to Goomy, but Goomy gets rather nervous, and when Dedenne approaches to help calm it, it gets even more frightened due to its Fairy-type. Soon after, Team Rocket show up and manage to grab all the Pokémon, and in doing so cause the Lombre in the area to get riled up and start attacking everyone, causing everyone to be separated from eachother. Can they find one another and will Goomy overcome its fears?',27);
insert into EPISODIO_ENTITY values (5153, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624236.jpg', 'Thawing an Icy Panic!', 9,'Having finally made it to Coumarine City, Ash &amp; co. soon learn of a lost Vanillite who is hiding in the Pokémon Center. Ash &amp; co. go to find it to help out just to learn that the Vanillite has been kidnapped by Team Rocket. As they start to investigate, snow starts to fall in the city. Meeting with Ramos, the Gym Leader, Ash &amp; co. set out to rescue Vanillite. Can they do it?',27);
insert into EPISODIO_ENTITY values (5154, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624237.jpg', 'The Green, Green Grass Types of Home!', 10,'After the long trek to Coumarine City, Ash finally reaches the gym and challenges Ramos to a battle so that he can earn his fourth badge in the Kalos region. While Ramos uses Grass-type Pokémon, he really causes issues with Ash by using various different types of moves. As the battle nears its climax, Ash sends out Frogadier against Ramos Grass-type Pokémon, knowing full well that he is at a type disadvantage. What strategy does Ash have up his sleeve and will he be able to win?',27);
insert into EPISODIO_ENTITY values (5155, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624238.jpg', 'Under the Pledging Tree!', 11,'Its time for the annual festival in Coumarine City. After learning of the festival and how the exchange of present to your Pokémon under the vow tree causes your bond with your Pokémon to grow, Ash &amp; Serena decide to go shopping. This is the first time Ash and Serena have been completely alone, without their Pokémon or their travelling partners, so Serena thinks it is akin to a date and starts getting overjoyed...',27);
insert into EPISODIO_ENTITY values (5156, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624239.jpg', 'A Showcase Debut!', 12,'After lots of time practicing, it is time for Serenas showcase debut. Serena is overly nervous for her debut but reassuring words from Shauna, that theyre rivals from here on, gets her nerves under control and allows for her to be ready. When she enters, she finds that there are more opponents than she realises, including Shauna and Jessie. As the Coumarine Showcase begins, everyone goes all out. Will Serena be able to win her debut showcase?',27);
insert into EPISODIO_ENTITY values (5157, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624240.jpg', 'An Oasis of Hope!', 13,'Heading back towards Lumiose City, Ash and co encounter an injured Spoink. They learn that the Spoink lived nearby but its family have been attacked by a Grumpig who took over the place. Ash decides to help out the Spoink to stop the Grumpig, but they end up falling into a Team Rocket trap. However, Dedenne and Goomy manage to escape, only to find Grumpig waiting for them. Will they be able to stop it?',27);
insert into EPISODIO_ENTITY values (5158, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624241.jpg', 'The Future is Now, Thanks to Determination!', 14,'Heading back towards Lumiose City, Ash and co reach the Kalos Power Plant and decide to go and visit it. When they approach, Pikachu, Luxio and Dedenne start acting strangely and head towards the plant. When they reach it they learn that Team Rocket have got a plot in the Power Plant where they are taking control of Electric-type Pokémon. Will Ash &amp; Co. manage to stop Team Rocket and rescue the Electric-type Pokémon?',27);
insert into EPISODIO_ENTITY values (5159, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624242.jpg', 'A Fork in the Road! A Parting of the Ways!', 15,'After another failed attempt at getting Pikachu from Ash &amp; co., Team Rocket end up getting separated. Jessie and Wobbuffet end up in a river and almost drown until she is saved by a mysterious doctor called White. Jessie and Wobbuffet quickly become enamoured with White and his Wobbuffet, causing Jessie to start to think whether or not she should quit Team Rocket and spend her life with White. Will she stay with Team Rocket or will she take the jump?',27);
insert into EPISODIO_ENTITY values (5160, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624243.jpg', 'Battling with Elegance and a Big Smile!', 16,'While training for their next Showcase, Serena ends up going harsh on Fennekin and Pancham when training doesnt go right, still torn from the loss in her first. Feeling down, she leaves Ash and Bonnie for a while for some alone time. As she walks through the city, she meets a girl who randomly approaches her to talk, and they end up going shopping together before finally having a practice battle against her Delphox and Aromatisse. The question is, who is this mysterious girl?',27);
insert into EPISODIO_ENTITY values (5161, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624244.jpg', 'Good Friends, Great Training!', 17,'Having met up with their old friend, Tierno, Ash decides to challenge him to a practice battle to prepare for his upcoming Gym battle with Clemont. During the battle, however, Team Rocket appears and kidnap Tiernos Pokémon as well as Ashs Sliggoo. When Ash &amp; Co. finally find Team Rocket, trouble starts to break out due to a fire, and its up to Sliggoo to help sort the situation. Will Sliggoo save the day?',27);
insert into EPISODIO_ENTITY values (5162, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624245.jpg', 'Confronting the Darkness!', 18,'Finally back in Lumiose City, Ash, Serena and Bonnie meet up with Clemont once again. Ash and Clemont are eager to start their gym match, but as it begins, Officer Jenny arrives to arrest the Clembot. It seems a robot looking just like Clembot is being used around the city to commit crimes. Insisting on Clembots innocence, its up to Ash &amp; co. to investigate and clear Clembot of all crimes. Can they do it?',27);
insert into EPISODIO_ENTITY values (5163, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624246.jpg', 'The Moment of Lumiose Truth!', 19,'Its finally time for the long awaited gym battle between Ash and Clemont. With both of the trainers having trained, they intend to fulfill their promise and fight their hardest, despite knowing eachothers strategies. With Clemont using Bunnelby, Luxray and Heliolisk, and Ash using Pikachu, Hawlucha and his newly evolved Goodra, the battle will be tense. Which Pokémon will lead which trainer to victory?',27);
insert into EPISODIO_ENTITY values (5164, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624247.jpg', 'Garchomps Mega Bond!', 20,'While still in Lumiose City, Ash &amp; co. decide to visit Professor Sycamore in his lab. They are delighted to see that Sycamore has found a Garchompite, but before they can test it, Team Rocket have stolen the Key Stone, the Garchompite and his Garchomp. They chase after Team Rocket to try to retrieve everything, but Team Rocket try to Mega Evolve Garchomp and attack them. Will they be able to rescue Garchomp?',27);
insert into EPISODIO_ENTITY values (5165, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624248.jpg', 'Defending the Homeland!', 21,'Leaving Lumiose City, Ash &amp; co. reach the home that his Goodra fled when it was attacked. Goodra is overjoyed to reunite with its old friends, but it is soon discovered that the wetlands are still the home of a massive fight over who will live in the region. As they learn this, a Florges starts to lead an attack on the area. Goodra is angered by this and gets ready to defend the wetlands from Florges and its army. Will it succeed?',27);
insert into EPISODIO_ENTITY values (5166, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624249.jpg', 'Beyond the Rainbow!', 22,'After saving the Pokémon from an attack by Florges, Goodra got hit by an attack from the side, injuring it. While looking after it, Ash &amp; co. are ambushed and Pikachu and the other Pokémon are all taken by Team Rocket. Ash &amp; Co. set off to rescue the Pokémon but learn that the whole thing is a Team Rocket plot, with them forcing Florges to do their bidding at the threat of its Floette offspring. Will Ash &amp; Co. be able to stop Team Rocket?',27);
insert into EPISODIO_ENTITY values (5167, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624250.jpg', 'So Youre Having a Bad Day!', 23,'During a battle with Team Rocket, Ash &amp; co., get attacked by a wild Pangoro who has been disturbed by the commotion. During the fight, everyone gets separated causing Bonnie to end up lost with nobody except Meowth, and to top it off they have inadvertently been tied together by a vine. Having to work together, Bonnie and Meowth have to try and find their way back to their friends. Will they be able to?',27);
insert into EPISODIO_ENTITY values (5168, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624251.jpg', 'Scary Hospitality!', 24,'Lost in a forest on the way to Laverre City, Ash &amp; co. find what is known as the Scary House, a house that is said to be haunted. An old man appears and offers them shelter ahead of a storm, but when things start going strange there, things seem to go haywire. Its up to Clemont to find out whats the cause: Is it a Pokémon or something far scarier?',27);
insert into EPISODIO_ENTITY values (5169, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624252.jpg', 'A Fashionable Battle!', 25,'Arriving at Laverre City, Ash hads to the gym quickly to challenge it to gain his sixth badge in the Kalos region. Upon arriving at the gym, Ash learns that it is closed while its Gym Leader, Valerie, holds a special fashion show in the city. While at the gym, Ash meets a new trainer who was also looking for a gym battle, but as theyre both disappointed, they challenge eachother to a match. Who will win?',27);
insert into EPISODIO_ENTITY values (5170, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624253.jpg', 'Fairy-Type Trickery!', 26,'Its time for Ashs 6th gym battle in the Kalos region. Ash is excited to battle for the badge but Valerie has got a tricky fighting style using her Fairy-type Pokémon. As Ash hasnt come in with a particular strategy to defeat this new type of Pokémon, the battle will be fierce indeed. Facing off with his Fletchinder against Sylveon and Spritzee, Ash faces his toughest challenge so far in Kalos. Will Ash manage to win?',27);
insert into EPISODIO_ENTITY values (5171, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624254.jpg', 'Rivals: Today and Tomorrow!', 27,'After winning his sixth gym badge, the gang helps Sawyer find his lost notebook from Team Rocket where he reveals details of his past and challenges Ash to another battle.',27);
insert into EPISODIO_ENTITY values (5172, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624255.jpg', 'A Not-So-Flying Start!', 28,'While heading towards Dendemille Town, Hawlucha finds an egg left alone in a forest. Bringing it to Ash, the group decide to try and get it to hatch and when it does, a Noibat appears. Noibat instantly bonds with Ash and Pikachu, but on bonding with it, they learn that the Noibat has not learned how to fly, so Ash &amp; Pikachu put it through training to teach it how. Will they get Noibat to fly?',27);
insert into EPISODIO_ENTITY values (5173, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624256.jpg', 'A Relay in the Sky!', 29,'While heading towards Dendemille Town, Ash &amp; co. learn of a Pokémon Sky Relay. Ash is excited to enter and brings his Fletchinder, Hawlucha and newly obtained Noibat to pasrticipate. However, as Noibat is still so young, its still having trouble mastering flying. Will Ash be able to help Noibate learn to fly and will he win the Sky Relay?',27);
insert into EPISODIO_ENTITY values (5174, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624257.jpg', 'A Frenzied Factory Fiasco!', 30,'While heading towards Dendemille Town, Ash &amp; co. find the Poké Ball Factory, a place that creates all the Poké Balls used around the world. When there, they get offered a guided tour of the facility, but during it they find out it is one of Team Rockets traps. Having been duped out of handing over their Poké Balls for a maintenance check, with the Pokémon still inside them still. As it doesnt go into its Poké Ball, Pikachu manages to escape and its up to Pikachu to rescue them, but Meowth is on hand with a Poké Ball with the intent to stop Pikachu and succeed with their plan. Will Pikachu succeed?',27);
insert into EPISODIO_ENTITY values (5175, 22, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624258.jpg', 'Performing with Fiery Charm!', 31,'Its finally time for Serenas second showcase. After the issues with her first one, Serena is determined not to fail. Meeting up with Miette for the first time in a long while, Serena is completely fired up to do her best. This time, the performances theme is about making PokéPuffs, which is one of Serenas specialties, which allows for her to rapidly pass to the next round. However, things start to go awry backstage. Will Serena overcome these issues and win her first showcase?',27);
insert into EPISODIO_ENTITY values (5176, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624259.jpg', 'Rotoms Wish!', 32,'While visiting a hotel on their way to the next town, Ash &amp; co. encounter a place where battles are held using Pokémon as gambling pieces. Ash is challenged to a battle by the head of the hotel, only to discover that he has to use Pikachu as a betting chip. Ash doesnt wish to risk it but is luckily saved by a Rotom who leads him to an elevator, but when they get off the elevator, it turns out that they are in the past. Will they be able to return to the present?',27);
insert into EPISODIO_ENTITY values (5177, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624260.jpg', 'A Festival Trade! A Festival Farewell?', 33,'In the next town, Ash &amp; co. learn of the Gourgeist festival where all people dress up in various Pokémon costumes. Team Rocket are around and are wanting to steal Pikachu, but when the nearby count bumps into them, he asks if Jessie would like to trade her Pumpkaboo with him, to top it off, Jessies Pumpkaboo has fallen in love with the counts Pumpkaboo. Will Jessie and Pumpkaboo part ways? Will Pumpkaboo get a happy ending?',27);
insert into EPISODIO_ENTITY values (5178, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624261.jpg', 'Over the Mountain of Snow!', 34,'Heading towards Anistar City, Ash &amp; co. come across a snowy mountain. Wanting to take a shortcut, they rent two Mamoswine so that they can cross the mountain range, but on their journey they discover an Abomasnow who is looking after an ill Snover. Ash &amp; co. decide to help out and hunt for herbs for the Snover, but Team Rocket have their eyes on the ill Snover. Will Ash &amp; co. help heal the Snover before Team Rocket get their plan into action?',27);
insert into EPISODIO_ENTITY values (5179, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624262.jpg', 'Adventures in Running Errands!', 35,'Having taken shelter in the Pokémon Center during a long rain storm, the roof of the Pokémon Center soon breaks causing damage to all the equipment in the building. Clemont sets himself up to repair the machinery, but soon finds that he lacks the various parts to do it. In order to get the parts, he sends Chespin and Bunnelby out to get the parts, but things dont go as well as theyd hope...',27);
insert into EPISODIO_ENTITY values (5180, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624263.jpg', 'Mending a Broken Spirit!', 36,'On their way to Anistar City, Serena begins training for the next Pokémon Showcase, but during the training the twig in Braixens tail breaks. Seeing how heartbroken Braixen is, Ash &amp; co. go hunting for a new twig to replace the broken one, but when Braixen rejects each of the twigs, questions soon begin to arise about why the twig is so important to Braixen. Will they be able to find a replacement?',27);
insert into EPISODIO_ENTITY values (5181, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624264.jpg', 'A Legendary Photo Op!', 37,'On their way to Anistar City, Ash &amp; co. bump into their old friend Trevor. Trevor is aiming to be a Pokémon photo collector and tells them that there are stories that the Legendary Pokémon, Moltres, can be found in the nearby volcano. Ash &amp; Pikachu are excited to see the Legendary Pokémon Moltres so decide to join Trevor in his quest. However, things start to not go to plan when Team Rocket appear. Will they be able to find Moltres?',27);
insert into EPISODIO_ENTITY values (5182, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624265.jpg', 'The Tiny Caretaker!', 38,'On their way to Anistar City, at night Bonnie comes to the rescue of a wild Tyrunt. She decides to take care of it, despite how big it is, but learns that it is pampered so itll be very tough. However, Team Rocket soon appear, wanting to take the Tyrunt. As Bonnie tries to protect the Tyrunt from them, she soon finds herself in deep trouble and the Tyrunt soon starts to glow. Will they be able to save eachother?',27);
insert into EPISODIO_ENTITY values (5183, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624266.jpg', 'A Trip Down Memory Train!', 39,'On their way to Anistar City, Ash &amp; co. get ambushed by Team Rocket in a forest. While they managed to thwart Team Rocket, they ended up stuck in one of their classic pitfalls. While trying to work their way back up out of the ground, Bonnie notes that something similar has happened to her and Clemont before. That was the time that they met Bunnelby...',27);
insert into EPISODIO_ENTITY values (5184, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624267.jpg', 'The Frocking Find in the Flowers!', 40,'On their way to Anistar City, Serena is practicing for the next Pokémon Showcase and trying out new performances. While doing so, they spot an Eevee dancing in the flowers. With the dance impressing Serena, she goes to befriend it but Eevee is reluctant, causing Serena to come up with an idea to befriend the Eevee. Will she be able to befriend it and create a new performance?',27);
insert into EPISODIO_ENTITY values (5185, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624268.jpg', 'Lights! Camera! Pika!', 41,'While heading towards Dendemille Town, Ash &amp; co. meet an old man who is enamoured with the Pikachu species. As hes shooting a movie, he decides that Ashs Pikachu is perfect for the lead role. This makes Ash &amp; co. all excited to see Pikachu working with the many Pikachu owned by the old man. When they go to shoot the movie, problems soon arise when it seems that there arent enough staff to properly do the movie so Ash &amp; co. step in. Will the movie be a success?',27);
insert into EPISODIO_ENTITY values (5186, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624269.jpg', 'Tag Team Battle Inspiration!', 42,'Practicing for the next Pokémon Showcase in Anistar City, Serena soon spots Shauna who is also entering the competition, and nearby Tierno who is there to support his friend. This gets Serena all fired up for the competition, but she starts to grow concerned. Her new Eevee is still very shy and Serena is concerned about how well it will perform in front of people. Due to this, Serena starts coming up with plans to help boost Eevees confidence. Will she be able to?',27);
insert into EPISODIO_ENTITY values (5187, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624270.jpg', 'A Performance Pop Quiz!', 43,'Its time for the Anistar City Pokémon Showcase. With even tougher opponents than she has faced before, including Nini and Shauna, Serena faces a tough challenge. However, after she manages to get through the initial rounds and get to the theme performance. However, between rounds, Eevee gets lost and Serena goes to find it. Will she be able to find Eevee in time?',27);
insert into EPISODIO_ENTITY values (5188, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624271.jpg', 'Cloudy Fate, Bright Future!', 44,'Its time for Ashs battle in the Anistar City Gym, but on the way there, Ash &amp; Co. stop by the citys landmark symbol, the Anistar Sundial. When there, they see Professor Sycamore and are shocked when he is suddenly attacked by a mysterious woman. Ash quickly jumps in to defend Professor Sycamore but learns from the woman that she is attacking in order to save the Kalos region, and gets challenged by her. Will Ash find out the true motives of the woman?',27);
insert into EPISODIO_ENTITY values (5189, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624272.jpg', 'All Eyes on the Future!', 45,'Its time for Ashs battle in the Anistar City Gym, and this time its different in that the Gym Leader, Olympia, is challenging him with a Double Battle. Using his Frogadier and Talonflame against the Psychic-type strengths of Olympias two Meowstic, Ash quickly learns that Meowstics Future Sight attack is far more powerful than he anticipated. Ash then has to rethink and come u[p with an even better strategy in order to win. Will he be able to?',27);
insert into EPISODIO_ENTITY values (5190, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624273.jpg', 'From A to Z!', 1,'Bonnie makes a new friend, Ash runs into an old friend, and a terrifying premonition begins to unfold!',27);
insert into EPISODIO_ENTITY values (5191, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624274.jpg', 'Love Strikes! Eevee, Yikes!', 2,'While Eevee deals with some unwanted attention, Team Rocket turns its attention to Squishy!',27);
insert into EPISODIO_ENTITY values (5192, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624275.jpg', 'A Giga Battle with Mega Results!', 3,'Theres trouble at the local Pokémon Center, but our heroes and Professor Sycamore are there to help!',27);
insert into EPISODIO_ENTITY values (5193, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624276.jpg', 'A Fiery Rite of Passage!', 4,'As our heroes continue their journey to Snowbelle City, they encounter a young Pokémon faced with the challenges of growing up!',27);
insert into EPISODIO_ENTITY values (5194, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624277.jpg', 'Dream a Little Dream from Me!', 5,'A nighttime campout brings some interesting adventures for our heroes Pokémon!',27);
insert into EPISODIO_ENTITY values (5195, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624278.jpg', 'The Legend of the Ninja Hero!', 6,'Our heroes friend Sanpei is showing them Ninja Village, his home, but its peace and tranquility is soon to be threatened!',27);
insert into EPISODIO_ENTITY values (5196, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624279.jpg', 'A Festival of Decisions!', 7,'On the eve of the village festival, the fate of Ninja Village hangs in the balance!',27);
insert into EPISODIO_ENTITY values (5197, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624280.jpg', 'A Dancing Debut!', 8,'Our heroes are in Couriway Town for Serenas next Pokémon Showcase, and her third Princess Key win is at stake!',27);
insert into EPISODIO_ENTITY values (5198, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624281.jpg', 'Meeting at Terminus Cave!', 9,'Our heroes are visiting Terminus Cave with hopes of seeing new Pokémon, but theyre not alone!',27);
insert into EPISODIO_ENTITY values (5199, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624282.jpg', 'A Cellular Connection!', 10,'A courageous rescue during our heroes search for Squishy leaves one of their friends in danger!',27);
insert into EPISODIO_ENTITY values (5200, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624283.jpg', 'A Windswept Encounter!', 11,'An expansive field of flowers provides our heroes with a beautiful setting to witness a blooming friendship!',27);
insert into EPISODIO_ENTITY values (5201, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624284.jpg', 'Party Dancecapades!', 12,'Serena is invited to a dance party for Pokémon performers, and there are many surprises in store!',27);
insert into EPISODIO_ENTITY values (5202, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624285.jpg', 'A Meeting of Two Journeys!', 13,'A fierce battle between two powerful Pokémon is about much more than just who wins!',27);
insert into EPISODIO_ENTITY values (5203, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/86/215473.jpg', 'An Explosive Operation!', 14,'As Team Flare continues to advance Operation Z, they get help from an unexpected source!',27);
insert into EPISODIO_ENTITY values (5204, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624286.jpg', 'A Watershed Moment!', 15,'Traversing a vast expanse of parched land, our heroes discover a small group of dedicated individuals in need!',27);
insert into EPISODIO_ENTITY values (5205, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624287.jpg', 'Master Class Choices!', 16,'Its Pokémon Showcase time for Serena, and winning her third Princess Key is on the line!',27);
insert into EPISODIO_ENTITY values (5206, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624288.jpg', 'An Electrifying Rage!', 17,'Our heroes are about to take part in an exciting celebration, but the guest of honor is not happy!',27);
insert into EPISODIO_ENTITY values (5207, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624289.jpg', 'Unlocking Some Respect!', 18,'Our heroes plan to visit a gem exhibition - but they run into a mystery instead!',27);
insert into EPISODIO_ENTITY values (5208, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/111/279909.jpg', 'Master Class is in Session!', 19,'The Pokémon Showcase Master Class is under way and Serena is competing with friends and rivals galore!',27);
insert into EPISODIO_ENTITY values (5209, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/111/279911.jpg', 'Performing a Pathway to the Future!', 20,'The Pokémon Showcase Master Class is in full swing and Serenas quest to become Kalos Queen is shifting into high gear!',27);
insert into EPISODIO_ENTITY values (5210, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/111/279912.jpg', 'A Keeper for Keeps?', 21,'Bonnie has been looking for someone to care for her big brother, but what will happen when she finds that someone?',27);
insert into EPISODIO_ENTITY values (5211, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/88/222156.jpg', 'Battling at Full Volume!', 22,'Rock guitarist Jimmy and his Pikachu seek out Ash for a battle, but Ash is in bed with a fever and he needs his rest.',27);
insert into EPISODIO_ENTITY values (5212, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/111/279913.jpg', 'The Synchronicity Test!', 23,'Clemont wonders about the mysterious change that sometimes happens to Ash and Greninja during battle, and he plans to get to the bottom of it with science.',27);
insert into EPISODIO_ENTITY values (5213, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/111/279914.jpg', 'Making Friends and Influencing Villains!', 24,'Team Rocket finds some delicious macaroons in the forest and happily dig in, only to be attacked by a group of Phantump who think the treats are theirs.',27);
insert into EPISODIO_ENTITY values (5214, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/111/279915.jpg', 'Championing a Research Battle!', 25,'Champion Diantha visits our heroes just as Ash and Greninja are doing some special training; Diantha challenges them to find out more about the bond they share in battle.',27);
insert into EPISODIO_ENTITY values (5215, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/111/279916.jpg', 'A Full-Strength Battle Surprise!', 26,'On their way to Snowbelle City, our heroes run into their friend Sawyer; Ash and Sawyer decide its time for a battle.',27);
insert into EPISODIO_ENTITY values (5216, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/111/279917.jpg', 'All Hail the Ice Battlefield!', 27,'Our heroes and Sawyer arrive in Snowbelle City; Ash is fired up to win his final badge at the freezing Gym.',27);
insert into EPISODIO_ENTITY values (5217, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/111/279919.jpg', 'Seeing the Forest for the Trees!', 28,'Ashs defeat at the Snowbelle Gym is followed some not-so-quiet introspection that turns into some real inspiration.',27);
insert into EPISODIO_ENTITY values (5218, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/111/279920.jpg', 'A Real Icebreaker!', 29,'Having finally mastered Synchro with Greninja, its time for Ash to have a rematch with Wulfric and earn his final Kalos Badge. Changing things up, Ash manages to get through until Wulfric shows a strategy he didnt see last time, with his Abomasnow Mega Evolving into Mega Abomasnow. With Abomasnow getting even more powerful, Ash faces an even bigger challenge than before. Will he and Greninja manage to push through and win his final badge?',27);
insert into EPISODIO_ENTITY values (5219, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/111/279921.jpg', 'A Diamond in the Rough!', 30,'The heroes confront an unusual group of challenges while visiting the home of friends.',27);
insert into EPISODIO_ENTITY values (5220, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/98/247105.jpg', 'A Gaggle of Gadget Greatness!', 31,'Clemont invites the rest of our heroes to experience one of his true passions, while a certain group of uninvited guests are along for the ride.',27);
insert into EPISODIO_ENTITY values (5221, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/111/279927.jpg', 'A League of His Own!', 32,'The Kalos League is just getting under way and the battle temperature is already turned way up.',27);
insert into EPISODIO_ENTITY values (5222, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/111/279928.jpg', 'Valuable Experience for All!', 33,'After the first round, the Kalos League contineus and this time, Tierno and Sawyer end up facing eachother. Sawyer has been studying Tiernos battle strategy, noting how rhthmically based it is since it is based on dancing. The battle is quite fierce. Who will get through and will Ash &amp; Alain get through their battles?',27);
insert into EPISODIO_ENTITY values (5223, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624291.jpg', 'Analysis Versus Passion!', 34,'The semifinals of the Kalos League bring two intense battles.',27);
insert into EPISODIO_ENTITY values (5224, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624292.jpg', 'A Riveting Rivalry!', 35,'As Ash and Sawyer continue their semifinal battle, the audience witnesses a rivalry few have ever seen.',27);
insert into EPISODIO_ENTITY values (5225, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624294.jpg', 'Kalos League Passion with a Certain Flare!', 36,'The final round of the Kalos League is about to begin and a lot going on behind the scenes.',27);
insert into EPISODIO_ENTITY values (5226, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624295.jpg', 'Finals Not for the Faint-Hearted!', 37,'During the Kalos League finals, Ash battles Alain in a much-anticipated battle.',27);
insert into EPISODIO_ENTITY values (5227, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624296.jpg', 'Down to the Fiery Finish!', 38,'The Kalos League Final continues and it is getting tense. With Alain just having Bisharp and Charizard left, Ash has the upper hand with Goodra, Pikachu and Greninja still in reserve. With Pikachu already worn out after taking out Tyranitar and Metagross, it may not last long. Who will emerge triumphant in this battle and become the Kalos League Champion?',27);
insert into EPISODIO_ENTITY values (5228, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624297.jpg', 'A Towering Takeover!', 39,'The Kalos League is over and Team Flare have begun their onslaught, throwing Lumiose City into panic. Ash &amp; Alain head to the Prism Tower to see who is behind it, but Team Flare appear in front of them with their eyes set on Ash. Lysandre also begins to explain his actions to the population of the city. Will Ash &amp; Alain be able to save the city?',27);
insert into EPISODIO_ENTITY values (5229, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624299.jpg', 'Coming Apart at the Dreams!', 40,'Team Flares plan is coming to fruition. Ash has been captured by Lysandre and Squishy has transformed into its 50% Forme in order to try and help Z2. Serena, having bumped into Mairin, goes to help Mairin recover her Chespin from Team Flare while Bonnie goes to follow Squishy. However, Team Flare are still nearby and have their eyes set on Squishy. Will they be able to stop Team Flare?',27);
insert into EPISODIO_ENTITY values (5230, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624315.jpg', 'The Right Hero for the Right Job!', 41,'The fate of Kalos depends on the outcome of Team Flares plans; the team is doing its best.',27);
insert into EPISODIO_ENTITY values (5231, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624316.jpg', 'Rocking Kalos Defenses!', 42,'Bonnie and Clemont have managed to stop the Zygarde rampage, and the Lumiose City Gym is liberated, but as the gang regroups to think the incident is over, the Megalith that Lysandre, Alain and Steven recovered in Hoenn starts to transform, and it even absorbs Mairins Chespin. The Megalith soon starts to head off somewhere. Will Ash &amp; Co. be able to stop it?',27);
insert into EPISODIO_ENTITY values (5232, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624317.jpg', 'Forming a More Perfect Union!', 43,'The Megalith is advancing and the entire world is at stake. With everyone helping open the way, its up to Ash and Alain to get into the Megalith to rescue Mairins Chespin. Stopping the Megalith isnt easy and all the gym leaders come to aid. However, soon after the fight begins, Squishy and Z2 work together and begin to transform into Complete Forme Zygarde. Will the combination of Zygarde, the Gym Leaders, Sycamore, Diantha, Malva and Ash &amp; Co. be able to save the world?',27);
insert into EPISODIO_ENTITY values (5233, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624318.jpg', 'Battling with a Clean Slate!', 44,'Team Flares plan has been thwarted by Ash &amp; Co. and the Gym Leaders of the region, and it is time to rebuild as Lumiose City gradually returns to normal. Clemont works on rebuilding Clembot, but is disheartened to learn that it has no memories of the past. When a trainer returns to the gym for a rematch against Clembot, Clemont is unsure if its a wise course of action due to the memory loss. Will the challenge be accepted and will the trainer win the badge?',27);
insert into EPISODIO_ENTITY values (5234, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624319.jpg', 'The First Day of the Rest of Your Life!', 45,'As Lumiose City is being rebuilt following Team Flares antics, Serena decides to organise a Pokémon Showcase to cheer up the residents of the city. While doing the Showcase, she starts to feel something when she sees the joy she brings to the residents. Undecided on what to do next, with Ash returning to the Kanto Region, she soon inexplicably finds herself in a battle against Ash. Will she be able to defeat her friend and what will she decide to do next?',27);
insert into EPISODIO_ENTITY values (5235, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624320.jpg', 'Facing the Needs of the Many!', 46,'Ash and the others came back at the wetlands and after saying goodbye to Goodra, they run into the plants that were raging wildly during the Team Flare incident, but manage to drive them back with help from Ash-Greninja. But then Team Flare scientist Xerosic returns and abducts Clemont. After officially winning, they reunite with Squishy and Zygarde, who needs Greninjas powers, leaving Ash to choose for Greninjas destiny.',27);
insert into EPISODIO_ENTITY values (5236, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624321.jpg', 'Till We Compete Again!', 47,'The time has come. Ash, Serena, Clemont and Bonnie are going their separate ways after their journey through the Kalos region. Promising to meet again one day, as they go to board their flights, Dedenne runs away. As it is young, it doesnt want to say goodbye. Can Bonnie find Dedenne in time? In the interim, Clemont challenges Ash to one final battle to bring their journey full circle. Who will win?',27);
insert into EPISODIO_ENTITY values (5237, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/243608.jpg', 'Alola to New Adventure!', 1,'Ash, his mother, and Pikachu arrive in the Alola region on vacation to deliver a Pokémon egg to Professor Oaks cousin, Samson Oak. While exploring for new Pokémon, Ash stumbles upon a Pokémon school that Samson runs as its principal. While helping to defend the school from a group of Team Skull grunts, Ash witnesses one of the students, Kiawe, perform a powerful Z-Move with his Pokémon to drive the grunts away. Impressed, Ash decides to enroll in the school to learn more about its native Pokémon. The night before Ashs mother returns home to the Kanto region, the guardian Pokémon, Tapu Koko, appears before Ash and gives him a Z-Ring that enables him to perform his own Z-Moves.',27);
insert into EPISODIO_ENTITY values (5238, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/243609.jpg', 'The Guardians Challenge!', 2,'On Ashs first day at Pokémon school, Professor Kukui and the other students host a surprise welcome party for him. Soon after Tapu Koko approaches Ash in order to battle Pikachu. Tapu Koko teaches Ash how to use the Z-Ring. Ash and Pikachu manage to unleash the Z-Move, Gigavolt Havoc, but the Z-Crystal shatters after Pikachus immense release of power. In order to regain the power of Z-Moves, Ash decides to go through the island trials.',27);
insert into EPISODIO_ENTITY values (5239, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/243610.jpg', 'Loading the Dex!', 3,'Professor Kukui gives Satoshi an intelligent Rotom Pokédex that is capable of human speech. Satoshi goes to find and catch his first Pokémon in Alola, but he instead encounters Rocket-Dan, who are aided by a wild Mimikkyu that despises Pikachu.',27);
insert into EPISODIO_ENTITY values (5240, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/243611.jpg', 'First Catch in Alola, Ketchum-Style!', 4,'After Satoshi fails to capture two wild Pokémon, he encounters a Mokuroh that lives in a Tsutsukera nest. After Satoshi feeds the starving Mokuroh, it returns the favor by helping him fend off Rocket-Dan away from its nest. Afterwards, Satoshi catches Mokuroh as his first Pokémon in Alola.',27);
insert into EPISODIO_ENTITY values (5241, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/243612.jpg', 'Yo, Ho, Ho! Go, Popplio!', 5,'Satoshi helps Suiren train her Ashimari to blow a water balloon large enough to enable undersea travel for people. During a school fishing trip, the classs Ride Pokémon are stolen by Rocket-Dan. However, Ashimari manages to blow a massive balloon to save all the Ride Pokémon from falling on the rocks.',27);
insert into EPISODIO_ENTITY values (5242, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/243613.jpg', 'A Shocking Grocery Run!', 6,'Satoshi and Māmane are separated from their Pokémon during a visit to the local shopping mall.',27);
insert into EPISODIO_ENTITY values (5243, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/243614.jpg', 'Thats Why the Litten is a Scamp!', 7,'Satoshi decides and fails to catch a stray Nyabby that continues to give him trouble.',27);
insert into EPISODIO_ENTITY values (5244, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/243615.jpg', 'Lillies Egg-xhilarating Challenge!', 8,'Samson Oak has given the gang a task of looking after a special Pokémon Egg, but when it comes to night it was decided that the Egg should be kept at Lillies house which makes Lillie uneasy as she doesnt like touching Pokémon. Ash goes with her and is shocked to see how big her house is. As the house is so big, it even has a garden where Pokémon play as well as a battlefield, so Ash challenges Lillies butler to a battle. Who will win and what is in the egg?',27);
insert into EPISODIO_ENTITY values (5245, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/243616.jpg', 'To Top a Totem!', 9,'As Rattata and Raticate cause trouble on the island, Ash decides to participate in the Island Trial Challenge. When meeting the Melemele Island Kahuna, Hala Ash says he is going to take on the trial, but Hala poses a question to him that Ash must answer before participating in it. Will Ash be able to answer the question and complete the trial?',27);
insert into EPISODIO_ENTITY values (5246, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/243617.jpg', 'Trial and Tribulation!', 10,'After completing the only Island Trial on Melemele Island, Ash decides to face off against the Island Kahuna Hala in the Grand Trial. Hala uses powerful Fighting-type Pokémon and moves causing Ash some trouble as he currently only has Pikachu and Rowlet. During battle, Hala unleashes the All-Out Pumelling Z-Move causing Ash to retaliate with a Z-Move of his own. Will he be able to win the battle?',27);
insert into EPISODIO_ENTITY values (5247, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/243618.jpg', 'Young Kiawe Had a Farm!', 11,'As the Pokémon School isnt in session, Ash is practicing his Z-Moves. As he is doing so, he sees Kiawe fly by on a Charizard. Kiawe mentinos that he is helping take care of his familys farm to do a delivery. Ash is intrigued and decides to go visit Kiawes farm and meet his family. However, trouble soon arises when Team Skull show up...',27);
insert into EPISODIO_ENTITY values (5248, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/243619.jpg', 'The Sun, the Scare, the Secret Lair!', 12,'Everyone has gone to the Melemele Sea for an extracurricular lesson, but Team Rocket have also come to the area in search of new Pokémon. However, while hunting for Pokémon by fishing, they soon discover a mysterious new Pokémon, Mareanie, and one of the Mareanie takes a liking to James. Will James get his first Pokémon in Alola?',27);
insert into EPISODIO_ENTITY values (5249, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/243620.jpg', 'Racing to a Big Event!', 13,'Continuing his studies in Alola, Ash soon learns from Mallow about a famous Pancake Race. Intrigued, Ash and all his classmates enter in the special pancake race but while there, he meets the champion from last year, a trainer and her Alolan Raichu. A rivalry soon sparks between Pikachu and the Raichu and the race gets heated. Plus, with Team Rocket having their eyes on the prize, the race may not be as simple as they thought. Who is going to win?',27);
insert into EPISODIO_ENTITY values (5250, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/243621.jpg', 'Getting to Know You!', 14,'The egg that Lillie has been taking care of has finally hatched into a Vulpix. Everyone is overjoyed at this but Lillies excitement soon turns to depression as she cannot pet the Vulpix she took care of as an egg due to her fear of Pokémon. Due to this, Ash and co. decide to encourage her and try and get her to touch and bond with the Vulpix, but soon a shadow has its eyes on Lillie. Will Lillie be able to bond with Vulpix?',27);
insert into EPISODIO_ENTITY values (5251, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/99/249218.jpg', 'Rocking Clawmark Hill!', 15,'Rockruff has returned covered in scratches. Upon investigation, Ash &amp; Kukui decide to record what Rockruff has been up to in order to find the situation. However, on looking at the footage, they see that Rockruff has been leaving the house every night to train so Ash decides to help it train up to become stronger. Will they succeed and find out why Rockruff has been training?',27);
insert into EPISODIO_ENTITY values (5252, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/100/251270.jpg', 'They Might Not Be Giants!', 16,'While Ash &amp; Co. are playing on the beach, Popplio is making a bubble, but a gust of wind pushes Popplio and Rowlet into the bubble and they float away. When they land, they encounter the Litten that wanders around Melemele Island. It decides to take Popplio and Rowlet back to Ash, but Team Rocket soon arrive with plans of their own for Litten. Will they return to their trainers?',27);
insert into EPISODIO_ENTITY values (5253, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/101/253551.jpg', 'Crystal-Clear Sleuthing!', 17,'When he wakes up and heads to the Pokémon School, Ash soon finds that his Electirium Z that he earned has gone missing. Rotom, a huge fan of a crime show on Alolan TV, decides to search for the Electirium Z, wanting to act it out like the protagonist in that show. Will Rotom be able to find the Z-Crystal?',27);
insert into EPISODIO_ENTITY values (5254, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/130/326450.jpg', 'A Seasoned Search!', 18,'Mallow has come up with a new food item for the cafeteria, and Ash &amp; co. all decide to ask Mallow to try it. However, the stew doesnt actually taste good and Mallow states that they need some Yellow Nectar in order to finish it, but the problem is that Yellow Nectar is hard to come by at the moment. Due to this, Ash &amp; Mallow decide to go hunt for some Yellow Nectar, but it seems Team Rocket have a nefarious scheme at hand...',27);
insert into EPISODIO_ENTITY values (5255, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624383.jpg', 'A Guardian Rematch!', 19,'Ash has gone to visit Sophocles in order to learn the best way to try and defeat Tapu Koko in battle. Ash &amp; Pikachu train with Sophocles in order to gain the upper hand, but soon afterwards Tapu Koko appears and challenges them. Will Ash be able to defeat the Guardian Diety of Melemele Island, or will he be defeated?',27);
insert into EPISODIO_ENTITY values (5256, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624384.jpg', 'Partner Promises!', 20,'Hearing about Treasure Island from his classmates, Ash &amp; Pikachu head to the island to explore. While there, its the first time Ash &amp; Pikachu have been out adventuring alone in a very long time and so they begin to strengthen their bond. However, before too long, a mysterious Pokémon appears overhead...',27);
insert into EPISODIO_ENTITY values (5257, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624385.jpg', 'One Journey Ends, Another Begins...', 21,'While shopping, Ash &amp; Pikachu find Litten and learn that it at Stoutland have found a new place to live. However, later Ash finds Litten all worried and panicked and decides to follow Litten to help out. What has got Litten so worried? Is Stoutland ok?',27);
insert into EPISODIO_ENTITY values (5258, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624386.jpg', 'A Shivering Shovel Search!', 22,'While training, Ash discovers a mysterious shovel moving aronud in the sand. Learning that its a Pokémon called Sandygast, Ash learns of the dangers in touching the shovel. However, Sandygasts shovel flies off and angers tha Sandygast. Will Ash be able to help it?',27);
insert into EPISODIO_ENTITY values (5259, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624387.jpg', 'Getting the Band Back Together!', 23,'Ash and co. are attending a concert being held on Melemele Island and see a performance by DJ Leo and his Dugtrio. Going backstage, Ash starts getting to know the Dugtrio, but the Dugtrio starts fighting with itself putting in the possibility of splitting up. Soon after that, Team Rocket appear with their eyes set on Dugtrio. Will Dugtrio be saved and able to reconcile its differences?',27);
insert into EPISODIO_ENTITY values (5260, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624388.jpg', 'Alolan Open House!', 24,'Its time for an open day at the Pokémon School and Ash gets chosen to hold a presentation to all the people attending. Trying to work out what his presentation should be, he learns that his mother is coming to visit from Kanto, which causes Ash to be even more nervous. Rotom then comes up with an idea to help Ash. Will the presentation go off without an issue?',27);
insert into EPISODIO_ENTITY values (5261, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624389.jpg', 'A Team-on-Team Tussle!', 25,'After seeing the power of Z-Moves while encountering Ash at the Pokémon School, Team Rocket decides to hunt for their own Z-Crystals so that they can keep level with Ash. In doing so, they encounter the Team Skull grunts who have been causing trouble on Melemele Island. In addition to that, while hunting for the stone, they discover the Totem Pokémon, Raticate. Will they find what they are looking for?',27);
insert into EPISODIO_ENTITY values (5262, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624390.jpg', 'So Long, Sophocles!', 26,'Sophocles has overheard his parents seeking advice about moving and that means that Sophocles would have to leave the Pokémon School. Feeling down due to this, Ash &amp; co. find out that hes moving and decide to throw a party for him. Will it cheer him up or is this an entirely big misunderstanding?',27);
insert into EPISODIO_ENTITY values (5263, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624391.jpg', 'A Glaring Rivalry!', 27,'While at the schoo, Ash learns of a powerful trainer who has come to Melemele Island. Ash eagerly finds this trainer and challenges him to a battle. The battle is strong with the trainers Z Move coming into full force but soon after the battle starts, Lillie appears and confirms that this trainer is her brother, Gladion. Why is Gladion here?',27);
insert into EPISODIO_ENTITY values (5264, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624392.jpg', 'Pulling Out the Pokémon Base Pepper!', 28,'PokéBase is a famous sport in the Alola Region and, after watching a match on television, Ash decides that they should have a match at school. The match gets really heated, but then Team Rocket appear and join in. Who will win the match?',27);
insert into EPISODIO_ENTITY values (5265, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624393.jpg', 'Lulled to La-La Land!', 29,'Ash and his classmates go on a camping trip in the forest. The trip does not start out well when Lana scares them all with a ghost story about a traveler who had all his energy drained from him while he was asleep. However, they have no idea that they are being spied on by a mysterious Pokémon. One by one, the gang except for Lillie is attacked, knocked out, and their energy drained from them. The culprit turns out to be a hungry Morelull. Ash figures out a way that the Morelull can get all the energy it needs from him, and later the gang finds out why the Morelull need so much energy.',27);
insert into EPISODIO_ENTITY values (5266, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624394.jpg', 'The Ol Raise and Switch!', 30,'As part of a class assignment, each of the students must take care of each others Pokémon partner for the weekend. Pikachu gets to stay with Lillie at her mansion and Lillie is determined to try and overcome her fear of getting close to Pokémon, so she uses Satoshis methods to gain Pikachus trust. At Suirens home, Bakugames is having trouble with her twin sisters, while Mao also has problems with Togedemaru while she works at her family restaurant. Māmanes experiments with Amamaiko dont work out well, but he finds that Amamaiko can be a great night-time comfort. At his familys dairy farm, Kaki assigns Ashimari to work with his younger sister Hoshi, but finds the water Pokémon to be a great problem-solver with the farms Kentauros. Shiron keeps giving Satoshi the cold shoulder but finally warms up to him when Satoshi includes Shiron in his Pokémons training sessions.',27);
insert into EPISODIO_ENTITY values (5267, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624395.jpg', 'The Island Whisperer!', 31,'Lychee, the Akala Island Kahuna, and her Lugarugan appear at the school just in time to stop a fight between Kakis Lizardon and a Kentauros. She completely wins over everybodys Pokémon including Nyabby. The class and Professor Kukui will be traveling to Akala Island for a special practical class under Lychees supervision. On the way, they encounter various types of Sea Pokémon. After Satoshi and Pikachu join Lychee in an underwater swim, they find a Hoeruko trapped in a rock crevice by a vicious Hagigishiri. Now they have to help the Hoeruko and fend off the Hagigishiri at the same time.',27);
insert into EPISODIO_ENTITY values (5268, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624396.jpg', 'Treasure Hunt, Akala Style!', 32,'As part of Lychees practical lesson on Akala Island, the gang are sent on treasure hunts across the island mounted on Mooland, each of which reacts differently to its rider: Satoshis Mooland is extremely friendly and enthusiastic, Suirens Mooland does not seem to like her, and Lillie has trouble even getting close to her Mooland. In the first round, Satoshi finds three gemstones, Mao finds giant mushrooms, Kaki finds a large fossil, Suiren and Māmane find nothing and Lillie is still trying to approach her Mooland. In the second round, Suiren and Ashimari run into a hostile Pokémon which is fought off by her Mooland, an Alolan Isitsubute Satoshi mistakes for a fossil gets away when he tries to catch it, Mao finds a giant fruit, Kaki finds another fossil, Māmane uses technology to find a piece of meteorite, and Suiren finds a lump of metal that can be made into a Z-ring, making her the winner. At last, Lillie uses her experiences with Shiron and Pikachu to finally get close to her',27);
insert into EPISODIO_ENTITY values (5269, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624397.jpg', 'Big Sky, Small Fry!', 33,'With no class today, Ash and Lana go Pokémon-fishing, but they may end up catching more than they bargained for since the lagoon theyre fishing in may contain a water-type Totem Pokémon. If there is, then Lana is determined to battle it. Meanwhile, Kiawe takes the rest of the gang to visit his familys dairy farm, and Team Rocket doesnt seem to be having much luck with their own Pokémon-fishing.',27);
insert into EPISODIO_ENTITY values (5270, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624398.jpg', 'A Crowning Moment of Truth!', 34,'Satoshi and his friends go to the Wela Volcano Festival, where an Alolan Garagara appears and takes the "Wela Crown", which supposedly has the power to make Pokémon stronger. Satoshi and Kaki chase after it, which leads to a fierce battle between Garagara and Kakis Bakugames in which, even when using a Z-move, Bakugames is defeated. Kaki is devastated and disheartened by the loss, but Satoshi and Bakugames encourage him. The next day, Kaki and Bakugames face Garagara in a rematch, but this time Bakugames wins. Garagara not only returns the crown but also decides to join Kaki as one of his Pokémon. Garagara develops a rivalry with Bakugames in the process.',27);
insert into EPISODIO_ENTITY values (5271, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624399.jpg', 'Currying Favor and Flavor!', 35,'Lychee and Professor Kukui send the class out to find ingredients for Akalan Curry in groups of two. The team of Satoshi and Mao find their task more challenging than expected, especially in getting past angry Karikiris, an Alolan Parasect and an Alolan Digda. Their search for the final ingredient brings them face-to-face with a Totem Rarantesu. Satoshi and his Pokémon must now battle Rarantesu and its partner Powalen, but there may be more to this than meets the eye.',27);
insert into EPISODIO_ENTITY values (5272, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624400.jpg', 'Trials and Determinations!', 36,'Its time for the Grand Trial on Akala Island. Ash has challenged Olivia and the battle is a Double Battle. With Ash using Rockruff and Rowlet, he soon finds that something is up with Rockruff and its not acting right. Due to this, Olivias Lycanroc and Nosepass put Ash into a tough position. Will Ash and Rockruff be able to push through?',27);
insert into EPISODIO_ENTITY values (5273, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624401.jpg', 'Rising from the Ruins!', 37,'Following the Grand Trial, Rockruff continues to get agitated and restless and decides to go out in the night. Not returning in the morning, Ash &amp; co. start looking for it. Olivia suggests Ash check the Ruins of Life, where he eventually finds Rockruff. Learning it faced off against Tapu Lele, Rockruff is highly injured and, before they know it, it starts to evolve...',27);
insert into EPISODIO_ENTITY values (5274, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624402.jpg', 'Mimikyu Unmasked!', 38,'After another unsuccessful attempt to defeat Ash, Team Rocket are blasted off again. However, for the first time since they arrived in Alola, Bewear didnt protect them, causing Jessie and Mimikyu to end up in the shopping mall, causing Mimikyus disguise to tear. With Mimikyus true nature bringing terrible consequences, Jessie tries to provide alternatives, but Mimikyu is opposed. How will Jessie help Mimikyu?',27);
insert into EPISODIO_ENTITY values (5275, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624403.jpg', 'Mallow and the Forest Teacher!', 39,'With their cafeteria appearing on TV, Mallow ends up having a fight with her father and storming off into the forest. However, she soon finds herself injured and has to be protected by a wild Oranguru. However, Steenee has gone into the forest to look for Mallow only to find Team Rocket in pursuit. Will they be able to reunite?',27);
insert into EPISODIO_ENTITY values (5276, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624404.jpg', 'Balloons, Brionne, and Belligerence!', 40,'Despite her recently obtained Z-Ring and Waterium Z, Lana is still having difficulty mastering Z-Moves. However, she soon meets a trainer with Popplios evolution, Brionne, who has mastered the Water Z Move. Lana asks for their help and learns that they are around hunting for sunken treasure, and they start training together. When they receive information about the treasure, they learn it is protected by a Dhelmise. Will they be able to obtain it and master the Z-Move?',27);
insert into EPISODIO_ENTITY values (5277, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624405.jpg', 'Mounting an Electrifying Charge!', 41,'Charjabug Races are very popular in Alola and Sophocles is a huge fan. Wanting to enter with his Charjabug, Sophocles recruits Ash and Kiawe to team up with him to enter a race, but his Charjabug seems very docile and doesnt move fast in the car. Wih lots of training done, when the day of the race comes, it proves to be tough for Sophocles. Would he be able to win?',27);
insert into EPISODIO_ENTITY values (5278, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624406.jpg', 'Alola, Kanto!', 42,'As part of an extra curricular class, the group travel to Kanto. When there, Ash meets up with his old friends Brock and Misty. Then, when takingthem through Oaks Laboratory to meet his old Pokémon, the group gets losts. To make matters worse, Team Rocket have also returned to Kanto briefly and have their eyes set on the Pokémon in the laboratory once again. Will they succeed?',27);
insert into EPISODIO_ENTITY values (5279, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624407.jpg', 'When Regions Collide!', 43,'Still in Kanto, the group heads to Cerulean City to teach the Alola group about Pokémon Gyms. Having had his last match at Cerulean Gym interrupted, Ash is eager to have a proper match as demonstration, and Kiawe also wants to battle. As such, battles soon begin of Ash VS Misty and Kiawe VS Brock, but when they start to use their Z-Moves, Brock &amp; Misty pull out their trump cards: Mega Evolution. Will Ash manage to push through the Mega Gyarados strength with his Z-Move?',27);
insert into EPISODIO_ENTITY values (5280, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/234/585018.jpg', 'A Dream Encounter!', 1,'One night, Ash has a dream and the next day, Ash finds the Pokemon he encountered in his dream and is determined to keep his promise.',27);
insert into EPISODIO_ENTITY values (5281, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/234/585083.jpg', 'Now You See Them, Now You Dont!', 2,'Looking after Nebby, Ash and his classmates realize that Nebby can teleport them to places, causing Ash and Pikachu to get lost.',27);
insert into EPISODIO_ENTITY values (5282, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/234/585078.jpg', 'Deceiving Appearances!', 3,'Ash and his classmates visit Aether Paradise run by Lillies mother Lusamine. Whilst there, a Ditto escapes and the gang have to find it among the other Pokémon.',27);
insert into EPISODIO_ENTITY values (5283, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/234/585094.jpg', 'A Masked Warning!', 4,'Whilst giving his Pokémon a bath, Ash thinks about Gladion which results in Nebby teleporting him, Pikachu and Lycanroc to his location.',27);
insert into EPISODIO_ENTITY values (5284, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/234/585104.jpg', 'Night of a Thousand Poses!', 5,'Ashs classmates attend a sleepover at Kukuis house where they are joined by Professor Burnet where Lillie starts thinking about her mother.',27);
insert into EPISODIO_ENTITY values (5285, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624559.jpg', 'Mission: Total Recall!', 6,'Having seen Gladion and Type: Null again, memories are starting to return to Lillie and have caused a relapse of her fear of touching Pokémon, being unable to touch Snowy. Lillie decides to travel around Alola with Ash &amp; Nebby to revisit areas in order to get all her memories back. Eventually, they arrive at the Aether Paradise where Faba is plotting to abduct her to prevent her from remembering what happened to her as a child. Will she remember?',27);
insert into EPISODIO_ENTITY values (5286, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624560.jpg', 'Fabas Revenge!', 7,'With her memories awakened, Lillie has overcome her fears of touching Pokémon, so is enjoying hugging &amp; playing with the various Pokémon at the Pokémon School. However, since her memories revealed Faba to have been at fault, Faba is now reacting and is plotting to kidnap Nebby and use it to open Ultra Wormholes to summon the Ultra Beasts. Will he be successful?',27);
insert into EPISODIO_ENTITY values (5287, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624561.jpg', 'Family Determination!', 8,'With Lusamine having been taken into Ultra Space by Nihilego, Nebby having evolved into Cosmoem and unable to move, and Lillie encountering her childhood fears, Lillie &amp; Gladion decide to head to Poni Island in order to find a way to get through to Ultra Space to save their mother. Meanwhile, Ash consults with Hala after learning that Lillie has run away. Will he be able to help?',27);
insert into EPISODIO_ENTITY values (5288, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624562.jpg', 'Revealing the Stuff of Legend!', 9,'Ash &amp; co. have come to the Altar of the Sunne in the hope of summoning Solgaleo to go to Ultra Space to rescue Lusamine. However, when they reach the altar, they find Tapu Koko, Tapu Lele, Tapu Bulu and Tapu Fini who seem to intend to help. After doing a ceremony, Nebby starts to glow once more and evolves into Solgaleo. Will it be able to help out?',27);
insert into EPISODIO_ENTITY values (5289, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624563.jpg', 'Rescuing the Unwilling!', 10,'Ash &amp; co. have gone to Ultra Space on Solgaleo in order to find Lusamine, however to their surprise they find Lusamine has been enveloped by Nihilego and have to face off against her and the other Ultra Beasts, but with Lusamines Pokémon strengthened by the Ultra Energy, they face a tougher battle than they had initially thought.',27);
insert into EPISODIO_ENTITY values (5290, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624564.jpg', '10,000,000 Reasons to Fight!', 11,'Ash has caught up to Lusamine with Solgaleo, but things are looking tense for his friends who are suffering at the hands of the Ultra Energy powered Pokémon owned by Lusamine. To top it off, with Lusamine having been fused with Nihilego, its hard for Ash to rescue her as she attacks him. Lillie feels powerless to help her mother, but Ash soon discovers the ability to use a new move with Pikachu. Will they rescue Lusamine?',27);
insert into EPISODIO_ENTITY values (5291, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624565.jpg', 'The Professors New Adventure!', 12,'Ash &amp; co. have returned to Alola from Ultra Space, having rescued Lusamine from the grasp of Nihilego. However, soon after, Solgaleo disappears and, when doing so, Kukui approaches Ash saying he has something important to tell him. Will Ash be able to find Solgaleo and what is Professor Kukui going to tell Ash?',27);
insert into EPISODIO_ENTITY values (5292, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624566.jpg', 'Let Sleeping Pokémon Lie!', 13,'Ash &amp; co. have started to take great interest in Samson Oaks Komala. Learning that its always asleep and that it can even eat and battle while asleep, the gang are curious over how it and Samson Oak met. However, before too long, Jigglypuff soon arrives in the school and battles with Komala. Will Komala be able to defeat Jigglypuff?',27);
insert into EPISODIO_ENTITY values (5293, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624567.jpg', 'The Dex Cant Help It!', 14,'Rotom Dex is one of Ashs companions and is a Rotom in a Pokédex. After being hit by Pikachus electricity, it is pushed out of the Pokédex and goes into Kukuis Washing Machine. It tries to go back to being in the Pokédex, but keeps failing and changes to all the different forms. Will Rotom be able to return to the Pokédex?',27);
insert into EPISODIO_ENTITY values (5294, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624568.jpg', 'Fighting Back the Tears!', 15,'After a shopping trip, James Mareanie encounters a Mareanie it used to have unrequieted love for. The other Mareanie proclaims its love for James Mareanie, but James Mareanie dismisses it as it likes James now. Due to this, James and the other Mareanie battle. Will James be able to keep Mareanie?',27);
insert into EPISODIO_ENTITY values (5295, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624569.jpg', 'Tasting the Bitter with the Sweet!', 16,'Lanas sisters return from the forest, with a tale that they were saved by a large mysterious Pokémon. This brings memories back to Lana and Mallow of a time they were stuck in the forest and the Pokémon helped them. Thinking it was the same Pokémon, they go to the forest to thank it. Will they be able to find it?',27);
insert into EPISODIO_ENTITY values (5296, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624570.jpg', 'Getting a Jump on the Competition!', 17,'Ash &amp; Co. have gone to Mount Lanakila on Ulaula Island. When there, they learn about PokéSled Jump, a sport where trainers and Pokémon ride on sleds together to go down the mountain. Everyone decides to enter the tournament, including Team Rocket and Hala. Who will win the competition?',27);
insert into EPISODIO_ENTITY values (5297, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624571.jpg', 'A Mission of Ultra Urgency!', 18,'As if from nowhere, an Ultra Wormhole opened and Ultra Beasts have started to pour through. Ash &amp; co. are tasked by Lusamine to capture the Ultra Beasts and return them to their home world. Ash &amp; Co. set off on their quest but it is harder than they thought itd be. Will they manage to calm the Ultra Beasts?',27);
insert into EPISODIO_ENTITY values (5298, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624572.jpg', 'Acting True to Form!', 19,'After his ice cream gets eaten by Jessie, Meowth storms off in tears and meets an Alolan Meowth. Jessie &amp; James start to think that Alolan Meowth would be a better fit for their group, and start hatching plans to get Pikachu with it. However, Meowth refuses to give up his position in Team Rocket so plans to get Alolan Meowth out of the group, but it seems the Alolan Meowth has plans of its own...',27);
insert into EPISODIO_ENTITY values (5299, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624573.jpg', 'Pushing the Fiery Envelope!', 20,'Ash &amp; Co. have seen a Battle Royal on TV and gets excited when he hears that if you go to the venue, you have a chance to battle the legendary Battle Royal Master, the Masked Royal. In the first match, Ash loses when the Masked Royals Incineroar defeats his Litten, so Ash gets determined and insists hed win a rematch. How does the rematch go?',27);
insert into EPISODIO_ENTITY values (5300, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624574.jpg', 'Satoshi and Nagetukesaru! Touchdown of Friendship!!', 21,'While out shopping, Ash encounters a group of Passimian. He learns that there has been a fight between the Passimian of Melemele Island and Akala Island over who will be the leader, and the Melemele Passimian lost. Ash wants to help the Passimian who lost, but when it doesnt work, he decides he must join them as a Passimian to help out. Will Ash be able to help them win?',27);
insert into EPISODIO_ENTITY values (5301, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624575.jpg', 'Turning Heads and Training Hard!', 22,'A former graduate of the Pokémon School, a well known trainer called Ilima, has returned to the School. Many legends are said of this mysterious trainer and Ash &amp; co. decide to spend some time with him to see if the legends about him are true. However, before too long Team Skull show up to cause mischief. Will the group and Ilima be able to stop them?',27);
insert into EPISODIO_ENTITY values (5302, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624576.jpg', 'Smashing with Sketch!', 23,'As part of their Pokémon School campaign, Ash &amp; co. play Poké-Ping Pong, a game of Ping Pong with your Pokémon, taught by Ilima. While playing, they learn Ilima is a skilled player and is set to enter a tournament soon. Ash &amp; Co. decide to go watch the tournament, but they soon learn that a player that defeated Ilima in a prior tournament will also be taking part. Will Ilima be able to win?',27);
insert into EPISODIO_ENTITY values (5303, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624577.jpg', 'Love at First Twirl!', 24,'The mysterious Ultra Beast, Poipole, appears once again, seemingly attracted to Pikachus electricty. At one point during the school day, while Ash is distrated, Poipole appears and takes Pikachu somewhere. What does Poipole want with Pikachu? When Team Rocket soon appear, trouble may be abound for both the Pokémon. Will they be able to protect themselves?',27);
insert into EPISODIO_ENTITY values (5304, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624578.jpg', 'Real Life... Inquire Within!', 25,'Its time for a special work experience project at the Pokémon Center. However, when Nurse Joy falls ill, Ash &amp; Co. decide to look after the Pokémon Center in her absence by taking care of Pokémon, delivering medicine and various other tasks. However, things are tougher than they thought, especially when Team Skull show up with their injured Pokémon. Can Ash &amp; Co. heal them?',27);
insert into EPISODIO_ENTITY values (5305, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624579.jpg', 'Rise and Shine, Starship!', 26,'Sophocles has found a massive piece of bamboo buried in the ground, but while unburying it, he finds a face which starts laughing. Thinking its a character from a story he heard as a child, he requests everyones help to dig it out. However, Team Rocket also have their eyes set on it. What is this Pokémon? Will Ash &amp; Co. be able to protect it?',27);
insert into EPISODIO_ENTITY values (5306, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624580.jpg', 'The Young Flame Strikes Back!', 27,'A strange man has appeared at Kiawes familys farm stating he wants to buy it so he can build a new resort on the island. When they decline, the man starts harassing the family to try and take the farm against their will. Kiawe is angered and challenges the man to a battl but when he loses after Marowak fails with its Z-Move, things get rough. Will Kiawe be able to protect the farm?',27);
insert into EPISODIO_ENTITY values (5307, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624581.jpg', 'Dewpider Ascending!', 28,'Its a time when the Pokémon, Dewpider, migrate to find a new place to live. However, for one, its completely unable to find a new home. However, it soon crosses paths with Lana and falls in love with her, deciding to follow her to the Pokémon School. Will it be able to find a new home?',27);
insert into EPISODIO_ENTITY values (5308, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624582.jpg', 'Sours for the Sweet!', 29,'Mallows older brother has returned home from a long journey. He is enthusiastic about taking part in the local Alola Bread Festival, held only once a year. Ash &amp; co. decide to help him prepare for the festival, but when the day of the festival hits, catastrophe strikes. Will they be able to participate in the festival?',27);
insert into EPISODIO_ENTITY values (5309, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624583.jpg', 'Why Not Give Me a Z-Ring Sometime?', 30,'As they got a Darkinium Z a while back, when James Mareanie learns the move Knock Off, they realise they need a Z-Ring in order to activate the Z-Moves. Giovanni informs them they may be able to get one from the Kahuna of Ulaula Island, Nanu, so they head straight to the island. However, when they get there, they learn Nanu has gone on a journey to improve his skills and theres no sign of when hell be back. Will they get a Z-Ring?',27);
insert into EPISODIO_ENTITY values (5310, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624584.jpg', 'Tough Guy Trials!', 31,'Wanting to continue his Island Trial Challenge, Ash has come to Ulaula Island in order to face the Kahuna, Nanu. However, Nanu has avoided him so Acerola helps Ash track Nanu down, but Nanu refuses his challenge. Acerola decides to convince Nanu to let Ash battle him to show hes ready. Will Ash be able to prove his worth?',27);
insert into EPISODIO_ENTITY values (5311, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624585.jpg', 'Some Kind of Laziness!', 32,'Following his defeat against Nanu, Acerola has taken Ash to the Ruins of Abundance to receive training from the Guardian Deity, Tapu Bulu. With the travelling having many obstacles, when Ash finally gets to Tapu Bulu, it doesnt seem to care. Will Ash be able to convince it to help him train?',27);
insert into EPISODIO_ENTITY values (5312, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624586.jpg', 'A Battle Hand-Off!', 33,'Before taking his rematch against Nanu, Ash has to partake in the trial. However, the trial ends up being against Team Rocket. Once again after Pikachu, Team Rocket finally show their true power when they unleash Mimikyus special Z-Move, Lets Snuggle Forever. With the Z-Move doing major damage, the battle between Pikachu and Mimikyu is fierce. Who will win?',27);
insert into EPISODIO_ENTITY values (5313, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624587.jpg', 'Guiding an Awakening!', 34,'Its time for Ashs rematch with Nanu to complete the Ulaula Grand Trial. The challenge of this Grand Trial? Defeat all 3 of Nanus Pokémon using only his Lycanroc. However, as the battle progresses, Lycanroc starts to get angry and stressed due to Nanus Dark-type Pokémon. Will Ash be able to calm it and defeat Nanu?',27);
insert into EPISODIO_ENTITY values (5314, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624588.jpg', 'Twirling with a Bang!', 35,'Another Ultra Beast, Blacephalon, has appeared in Alola and so the group set off to calm it. However, soon afterwards, another Ultra Beast, Xurkitree also appears. The two Ultra Beasts start battling with their explosive attacks. How will Ash &amp; co. be able to calm these Ultra Beasts and get them home?',27);
insert into EPISODIO_ENTITY values (5315, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624589.jpg', 'Showering the World with Love!', 36,'Heading to Hokulani Observatory, Ash &amp; Co. are on assignment to observe the Pokémon Minior. While there, they befriend one of the Pokémon and learn Sophocles once befriended one but cant really remember it. However, it seems this Minior has a secret...',27);
insert into EPISODIO_ENTITY values (5316, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624590.jpg', 'Not Caving Under Pressure!', 37,'Heading back from Mt. Hokulani, Ash &amp; co. decide to take a shortcut through a cave. However, the group gets separated from eachother causing Lillie, Mallow and Sophocles to meet a group of Alolan Sandshrew. They learn that the Sandshrew are trying to protect their cave from a Tyranitar. Lillie decides to challenge the Tyranitar on behalf of Sandshrew. Will she be able to win?',27);
insert into EPISODIO_ENTITY values (5317, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624591.jpg', 'A Young Royal Flame Ignites!', 38,'Once again, Ash &amp; Co. go to the Battle Royal Dome to see another Battle Royal. However, in the match, the Masked Royal seems to be in trouble when his Incineroar is in trouble due to dirty attacks. Ashs Torracat cant stand watching it and rushes into the ring. This causes Ash to join the Battle Royal as "Royal Ash". Can they get victory?',27);
insert into EPISODIO_ENTITY values (5318, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624593.jpg', 'All They Want to Do is Dance Dance!', 39,'At the Pokémon school it was decided that the group will hold a PokéDance presentation where the Pokémon will participate in dances created by their trainers. All the trainers get in depth in making a dance that fits their Pokémon but when the day finally comes, Team Rocket appears and attacks, capturing all the Pokémon. Will Ash &amp; Co. be able to get them back?',27);
insert into EPISODIO_ENTITY values (5319, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624594.jpg', 'Dummy, You Shrunk the Kids!', 40,'Aether Foundation member Faba has returned to the Pokémon School. He has come to show off a machine that will shrink anything, no matter how big. However, the machine malfunctions and Ash, Lillie &amp; Sophocles get shrunk down and due to trouble, get stuck outside. Will Ash &amp; Co. get back to the school and get back to full size?',27);
insert into EPISODIO_ENTITY values (5320, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624595.jpg', 'The Shape of Love to Come!', 41,'Ash &amp; co. meet Mina, a trainer who paints pictures. Together with her Ribombee, shes able to tell how Pokémon truly feel. On learning that Ashs Poipole likes to paint pictures, she takes a look and can sense great happiness but also sadness from the pictures. How does Poipole truly feel?',27);
insert into EPISODIO_ENTITY values (5321, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624596.jpg', 'The Long Vault Home!', 42,'While at the Pokémon School with various athletic equipment, a Stakataka appears. The group immediately try to stop its rampage, but their Beast Balls wont hit it. As its not moving, the group decide to leave it and regroup for the next day, but when they return it has started to move towards the city. Will Ash &amp; Co. be able to stop it?',27);
insert into EPISODIO_ENTITY values (5322, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624597.jpg', 'I Choose Paradise!', 43,'As they have been constantly having to assemble to take on the Ultra Beasts that appear in Alola, Ash &amp; Co. are taken to a Pokémon Steam Paradise resort, where they also take their Ride Pokémon in order to get some rest. However, while relaxing, Team Rocket soon appear and kidnap various Pokémon. Will Ash &amp; Co. be able to stop them?',27);
insert into EPISODIO_ENTITY values (5323, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624598.jpg', 'Filling the Light with Darkness!', 44,'The adults in Alola have started to act all lethargic and sleepy. To investigate this mystery, the Ultra Guardians head to the Altar of the Sunne to investigate, joined by Gladion. However, soon after they arrive an Ultra Wormhole opens up and Lunala exits, closely followed by the mysterious Ultra Beast, Necrozma. What does Necrozma want?',27);
insert into EPISODIO_ENTITY values (5324, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624599.jpg', 'Full Moon and Many Arms!', 45,'Lunala and Necrozma have appeared at the Altar of the Sunne and start battling. Ash &amp; co. start to try to battle Necrozma to help Lunala but their attacks have no effect. However, to make things worse, a group from Team Rocket have also appeared and are trying to catch both Lunala and Necrozma. When all seems to be useless, Nebby returns from the Ultra Wormhole. What will happen? Will they be able to stop Necrozma and Team Rocket?',27);
insert into EPISODIO_ENTITY values (5325, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624600.jpg', 'The Prism Between Light and Darkness!', 46,'With Lunala recovered, Ash &amp; Co. join it through the Ultra Wormhole in hunt of Necrozma who has taken over Solgaleo. When through the wormhole, they find themselves on Poipoles homeworld but things on this world are not alright. In addition to this, the special unit from Team Rocket is also going through the wormhole with their eyes set on Necrozma. Can they also be stopped?',27);
insert into EPISODIO_ENTITY values (5326, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624601.jpg', 'Securing the Future!', 47,'With the strength of all of their Z-Moves combined, Ash, Lana, Kiawe &amp; Gladion do their best to rescue Nebby and help Necrozma. However, back in Alola, Team Rocket are still trying to get into the wormhole to get Necrozma. Will Ash &amp; Co. be able to help Necrozma return to being what is known in legend as The Blinding One and will they be able to save Poipoles world and Alola?',27);
insert into EPISODIO_ENTITY values (5327, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624602.jpg', 'A Plethora of Pikachu!', 48,'Ash &amp; Kiawe have gone to the Pikachu Valley where many Pikachu live. When there, they meet a trainer who loves Pikachu. As the Pikachu come in many varieties in the valley, Ashs Pikachu is somewhat amused, but when Team Rocket show up, their Mimikyu starts going wild, and when its Z-Move is used, things get bad. Will Ash &amp; Co. be able to protect the valley?',27);
insert into EPISODIO_ENTITY values (5328, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624603.jpg', 'Turning the Other Mask!', 49,'Ash &amp; Professor Burnet have learned that the Masked Royal is going to hold a meet &amp; greet on Melemele Island, they are eager to go and invite Professor Kukui with them. However, as Professor Kukui is the Masked Royal, he cant do that so he has to make a plan to get out of it, and when one of his rivals appears, things start to get messy. Will Kukuis plan succeed?',27);
insert into EPISODIO_ENTITY values (5329, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624604.jpg', 'Lillier and the Staff!', 1,'The Pokémon School is putting on a play and so the group and all their Pokémon are participating. However, everyones family has been invited, including Ashs mother, which makes the group nervous. To make things worse, Team Rocket find the script to the play and barge in. Will the play work out?',27);
insert into EPISODIO_ENTITY values (5330, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624605.jpg', 'A Haunted House for Everything!', 2,'Lanas sisters learn about haunted houses and decide that they want to go to one. However, with none in the region, the group decides to make one at the Pokémon School. However, when its set up, a group of Ghost-type Pokémon soon appear and drag the group into a mystery world. Will they be able to return?',27);
insert into EPISODIO_ENTITY values (5331, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624607.jpg', 'Sparking Confusion!', 3,'Some strange signals have started coming from Wela Volcano which are interfering with the process Lusamine uses to track the Ultra Wormholes so she sends the Ultra Guardians to Wela Volcano to investigate. However, instead of finding more Ultra Beasts, they instead find a group of Alolan Geodude &amp; Graveler who appear to be taking food from the humans. Will they be able to solve the mystery?',27);
insert into EPISODIO_ENTITY values (5332, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624608.jpg', 'Dont Ignore the Small Stufful!', 4,'As Burnet forgot to take her lunch to work at the Aether Paradise, Ash &amp; Lillie decide to go there to deliver it. However, when there, they found Team Rocket have once again managed to get to the Aether Paradise with the nefarious plan to catch all the Pokémon being conserved there. To top it off, a Stufful from the Aether Paradise has gone missing. Will Ash &amp; Co. be able to stop them?',27);
insert into EPISODIO_ENTITY values (5333, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624609.jpg', 'No Stone Unturned!', 5,'Ash has decided to explore more of Melemele Island when he meets a trainer called Hau, who turns out to be the grandson of the Island Kahuna, Hala. He mentions that he and his partner Pokémon, Dartrix, are currently training for the Grand Trial and gets excited when he learns ash has already beaten it. After seeing Rowlets evolved form, Ash challenges Hau to a battle. Who will win?',27);
insert into EPISODIO_ENTITY values (5334, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624610.jpg', 'Bright Lights, Big Changes!', 6,'Ash &amp; Co. have visited the set for Rotoms favourite Detective TV show. However, when Rotom notices a plothole, it barges onto the set during filming causing Ash to panic. However, when doing so, it catches the eye of the producer and Rotom is cast in the show. Will Rotom be able to follow through?',27);
insert into EPISODIO_ENTITY values (5335, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624611.jpg', 'We Know Where Youre Going, Eevee!', 7,'After a long voyage, Eevee has made it to Alola and befriended Pikachu and the various Pokémon. In an unusual area, it is full of energy exploring. However, when it is spotted by the local Alolan Persian, it starts getting chased and to make it worse, Team Skull spotted it and decided they want it to join them, causing Ash &amp; co. to come to its rescue. Will they be able to save Eevee?',27);
insert into EPISODIO_ENTITY values (5336, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624621.jpg', 'Battling the Beast Within!', 8,'While training on Melemele Island, Ash once again encounters the Island Guardian Tapu Koko. Challenging it to a battle, its attacks clash with Pikachus and create an Ultra Wormhole that drags Ash into a mysterious desolate world, one which has been destroyed and left in ruins. They discover that this is the world of the mysterious Ultra Beast, Guzzlord. However, Guzzlord starts to attack them until a mysterious trainer and his Zeraora comes to their rescue...',27);
insert into EPISODIO_ENTITY values (5337, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624622.jpg', 'Parallel Friendships!', 9,'Having been sent into a mysterious world by accident when battling Tapu Koko, Ash finds himself in front of the Pokémon School, but this is not the world of the Pokémon School he attends. However, the mysterious trainer Ash has befrieneded continues his fight against the Ultra Beast, Guzzlord, who is responsible for all the destruction in this version of Hauoli City. Will they be able to stop Guzzlord and to bring peace back to this world?',27);
insert into EPISODIO_ENTITY values (5338, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624623.jpg', 'Alola, Alola!', 10,'Ashs old friends Brock &amp; Misty have decided to come to Alola to visit. Ash &amp; co. decide to show them all the great hotspots of the region including the pancake shop and even Mantine Surfing. However, with all the fun going on and time going quickly, Team Rocket soon show up with a plan to steal everyones Pokémon. Will they succeed?',27);
insert into EPISODIO_ENTITY values (5339, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624624.jpg', 'Heart of Fire! Heart of Stone!', 11,'Ashs old friends Brock &amp; Misty are still in Alola and the group decide to go to Akala Island so Brock can meet the famous Rock-type Island Kahuna, Olivia. Brock is very excited to meet her, leaving Olivia a bit bewildered when they meet, but when she learns that he was a Rock-type Gym Leader, she challenges him to a battle. Who will win?',27);
insert into EPISODIO_ENTITY values (5340, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624625.jpg', 'Thats Some Spicy Island Research!', 12,'Ash &amp; co. have gone to Poni Island to work on various research projects. However, Ash is eager to complete his Final Grand Trial and decides to look for the Kahuna, but upon learning there isnt one at the moment, he isnt sure what to do. Soon after that, a trainer named Hapu appears and attacks Ash, thinking Ash has stolen some fruit from the field. To top it off, Team Skull has started to appear on the island. Will Ash be able to clear everything up?',27);
insert into EPISODIO_ENTITY values (5341, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624626.jpg', 'Showdown on Poni Island!', 13,'Ash once again challenges Hapu to a battle but she gets angry and refuses. Soon after, Gladion appears on Poni Island and states hes there to meet Tapu Fini. As Lillie and Gladion talk, Gladion brings up their father. Soon after that, Ash challenges Gladion to a battle: Lycanroc VS Lycanroc. Who will win?',27);
insert into EPISODIO_ENTITY values (5342, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624627.jpg', 'Evolving Research!', 14,'While at Poni Island, Sophocles decides he wants to evolve his Charjabug, so Hapu informs him that the electrical energy around Vast Poni Canyon will allow him to do so. Ash, Kiawe and Sophocles then head to the canyon where they find Horacio and his group who are in the canyon to do the same. At the same time, Lana decides to train her Popplio with her old friend Aya and her recently evolved Primarina. With Popplio learning to properly sing with Primarina, does it count as training? How will everyones project turn out?',27);
insert into EPISODIO_ENTITY values (5343, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624628.jpg', 'Run, Heroes, Run!', 15,'Ash is eager to battle Tapu Fini, the guardian deity of Poni Island, so rushes to the Ruins of Hope. However, when Tapu Fini doesnt appear, Ash &amp; Kiawe decide to battle to pass the time and summon it. However, Tapu Fini is angered by this and traps Ash. In order to release him, Kiawe is tasked with having to get an item from Tapu Lele on Akala Island and return to Poni Island with the item in time in order to release Ash. Will he make it?',27);
insert into EPISODIO_ENTITY values (5344, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624629.jpg', 'Memories in the Mist!', 16,'The Island Guardian of Poni Island has got a special power which lets people see loved ones that have long since passed from this world. When Mallow hears this, she gets really upset. As the group visit Hapu at her house, a mysterious mist soon comes from the Ruins of Hope. As they try to make their way through it, they all encounter someone important to them. Hapu, unhappy with this, goes to the Ruins of Hope to get Tapu Fini to stop. Will she be able to?',27);
insert into EPISODIO_ENTITY values (5345, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624630.jpg', 'A Grand Debut!', 17,'Following her standing up to Tapu Fini, Hapu has finally become the Island Kahuna of Poni Island. As hes there on the island to find the Kahuna, Ash challenges her to her Grand Trial. Her trial requires Ash to battle her with just one Pokémon. With Hapu using her Mudsdale, Ash faces a tough battle. Will he be able to win the Grand Trial and finish his research project?',27);
insert into EPISODIO_ENTITY values (5346, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624631.jpg', 'Keeping Your Eyes on the Ball!', 18,'After their stint on Poni Island, Ash &amp; co. meet the legendary golfer Kahili and her partner Pokémon, Toucannon. Its the first time that the group has seen the golf game and are fascinated so decide to take on the Poké Golf sport thats popular in Alola. With this version of Golf, both trainer and Pokémon must work together. Will they do well?',27);
insert into EPISODIO_ENTITY values (5347, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624632.jpg', 'Show Me the Metal!', 19,'Some mysterious Pokémon have arrived in Alola, and these mysterious creatures eat metal! They start causing havoc across Alola by eating the tools at the Pokémon School, and even James bottle cap collection. James is angered and decides to chase down the Pokémon to get his revenge. Just what are they?',27);
insert into EPISODIO_ENTITY values (5348, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624633.jpg', 'Got Meltan?', 20,'Professor Oak has finished his research on the mysterious Pokémon Ash reported on and discovered its the Mythical Pokémon, Meltan. One of the Meltan has grown attached to Ashs Rowlet and joins them all at the Pokémon School, but after an incident, its nut gets stolen. The group tries to replace it but it doesnt fit so Meltan and Rowlet head out to find its old nut. However, while hunting, they bump into Team Rocket who are still after all the Meltan. Will they be able to protect Meltan?',27);
insert into EPISODIO_ENTITY values (5349, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624634.jpg', 'This Magik Moment!', 21,'Sophocles is going to be on a TV Show so Ash &amp; Co. come to the TV station to show their support. However, when there, they see the filming of a series lead by a child-actor Magikarp. However, the Magikarp seems to have something off with it. With another TV show, the usual actresses dont show up in time which leads to Lana, Mallow &amp; Lillie getting cast as replacements. Will all situations get resolved?',27);
insert into EPISODIO_ENTITY values (5350, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624635.jpg', 'Beauty is Only Crystal Deep!', 22,'A new Ultra Beast has appeared from the Ultra Wormholes and has started attacking trainers. When attacking them, it ends up stealing their Z-Crystals. The Ultra Guardians are tasked with stopping this Ultra Beast, Pheromosa. However, Pheromosa also appears and steals Team Rockets Z-Crystals, but while trying to stop it Meowth falls in love with Pheromosa. Will everyone be able to stop it before its too late?',27);
insert into EPISODIO_ENTITY values (5351, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624636.jpg', 'The Dealer of Destruction!', 23,'After much planning, Professor Kukui has finally announced for the formation of the Pokémon League in Alola. However, while much of Alola celebrates, Team Skulls leader Guzma decides he has to destroy the plans and concept of the Pokémon League so marches to the Pokémon School to stop it. However, Ash immediately challenges him to a battle. Will Ash be able to win?',27);
insert into EPISODIO_ENTITY values (5352, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624637.jpg', 'The Secret Princess!', 24,'Since their trip to Poni Island made them realise that their father, Mohn, is still alive, Lillie and Gladion return to the Aether Paradise and investigate their fathers old office. When there, Lillie discovers her fathers old Z-Ring and the Mythical Pokémon, Magearna. Lillie approaches Hala and asks if its alright for her to use her fathers Z-Ring, and so they have a battle to see if Lillie can master the Z-Moves. Will they find more information about their fathers location?',27);
insert into EPISODIO_ENTITY values (5353, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624638.jpg', 'Drawn with the Wind!', 25,'Ash &amp; co. have gone to Malie City for a visit. The town is filled with Pokémon workin with humans to make the city a great place. While on a tour by a group of ninja guides, they get to see all the sights however Mallows hair ornament ends up getting blown away. This causes Shaymin, Sandy and Meltan to chase after it and end up getting lost and fall into a trap of Team Rocket. Will they be able to escape?',27);
insert into EPISODIO_ENTITY values (5354, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624639.jpg', 'Aiming for the Top Floor!', 26,'Still in Malie City, Ash &amp; Co. arrive at the Pokémon Gym, based on the Gyms from the Kanto region. In this gym, the trainers battle you as you go up various floors until you reach the leader at the top. when they get to the top floor, they meet the trainer Ryuki and his Dragon Pokémon. Will they be able to defeat him?',27);
insert into EPISODIO_ENTITY values (5355, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624640.jpg', 'A High-Speed Awakening!', 27,'A special Vikavolt race is being held and so Sophocles starts working on his capabilities with his Vikavolt so they can win. However, when the race begins, he learns that Horacio will also be participating with his Vikavolt which makes the situation even more tense. However, Team Rocket soon appear with a dark scheme to win as well. Who will win the race and get the Buginium Z being offered as a prize?',27);
insert into EPISODIO_ENTITY values (5356, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624641.jpg', 'The One That Didnt Get Away!', 28,'Ash &amp; co. have gone to the seaside to fish for some Pokémon. However, while doing so, Ash and Lana get separated from the group in a whirlpool and stumble upon the Legendary Pokémon, Kyogre. Kyogre is under attack from some Pokémon hunters and ends up poisoned. It is up to Ash and Lana to help the Kyogre and save it from the hunters. Will they succeed?',27);
insert into EPISODIO_ENTITY values (5357, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624642.jpg', 'A Recipe for Success!', 29,'Needing some mushrooms for the cafeteria, Mallow visits Orangurus Pokémon café in the forest. However, when there she sees the café is unusually busy so she decides to help Oranguru out. Making lots of drink and food for the Pokémon, she is soon shocked when the Island Guardian Tapu Koko appears. What will she make for Tapu Koko?',27);
insert into EPISODIO_ENTITY values (5358, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624643.jpg', 'Spying for the Guy!', 30,'Having previously told Giovanni that they had captured Bewear, Team Rocket are asked to send it back to HQ. Worrying about the consequences for lying, Team Rocket try their best to capture the Bewear that has been looking after them, but things get worse when Matori and the Alolan Meowth come from HQ to take Bewear back personally. Will Team Rockets lie be exposed?',27);
insert into EPISODIO_ENTITY values (5359, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624644.jpg', 'A Fiery Training Camp Trick!', 31,'Now that everyone in the group has a Z-Move and a Z-Crystal, the group are practicing the moves. However, despite much practice Sophocles is unsuccessful in activating his, so he, Ash and Kiawe go camping in order to properly train to master the Z-Move. With much determination, Sophocles sees Vikavolt giving it its all in trying to use the Z-Move and Kiawe tells him the story of how he and Turtonator first met. Will Sophocles manage to be able to use the Z-Move?',27);
insert into EPISODIO_ENTITY values (5360, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624645.jpg', 'Living on the Cutting Edge!', 32,'All throughout Alola there have been reports of things getting cut randomly, and it turns out its the Ultra Beast Kartana. The Ultra Guardians are dispatched in order to send it home. However, as the time for the Stufful Meteor Shower approaches, Deoxys and Rayquaza are out in space and are about to cause an effect on all of Alola. Are they able to stop it?',27);
insert into EPISODIO_ENTITY values (5361, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624646.jpg', 'A Timeless Encounter!', 33,'While training in a forest, Torrcat and Lycanrocs attacks collide. This disturbs the Mythical Pokémon, Celebi, who causes Ash to time travel back many years to where Ash meets a young trainer and his Litten. Back in the present, Professor Burnet finds and old photo of Kukui as a child with his own Litten, which causes Kukui to reminisce. Will Ash manage to get back to his own time?',27);
insert into EPISODIO_ENTITY values (5362, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624647.jpg', 'Pikachus Exciting Adventure!', 34,'After Ash &amp; Torracat inadvertently got sent into the past by Celebi, Pikachu and the others are unaware and cant find Ash so decide to start searching for him. Their search takes them to the Pokémon School, Ultra Guardians base and even in the sky with Garchomp. What adventures await Pikachu and the other Pokémon, and will they be able to find Ash?',27);
insert into EPISODIO_ENTITY values (5363, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624648.jpg', 'Chasing Memories, Creating Dreams!', 35,'The group has gone to Lillies house for training with their Z-Moves ahead of the Alola Pokémon League when Lillie shows the group the Magearna her father found for her. In addition to that, Gladion is on Melemele Island looking for something with hisUmbreon. Will he find what hes looking for and will Lillie finally master her Z-Move?',27);
insert into EPISODIO_ENTITY values (5364, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624649.jpg', 'League Offenders and Defenders!', 36,'Its time for the opening of the Alola Pokémon League and the group have arrived at the stadium to register. The expectations for the league heat up as reveryones rivals appear in quick succession. However, soon Guzma and the rest of Team Skull appear and start causing trouble, especially when Team Rocket also appear. This leads into a delve into the history of Guzma and Kukui. What happened between them in the past and can the League continue?',27);
insert into EPISODIO_ENTITY values (5365, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624650.jpg', 'Battle Royal 151!', 37,'Its the first round of the Alola Pokémon League, but unlike other leagues, the first round is a very unique battle. All 151 trainers entered into the league will battle with 1 Pokémon out at the same time. With many powerful trainers including Guzma and Ilima participating, the battle will be tough? Will Ash and his friends make it through to the Top 16?',27);
insert into EPISODIO_ENTITY values (5366, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624651.jpg', 'Battling Besties!', 38,'Its the knock out rounds of the Alola Pokémon League to make the Top 16 come down to the Top 8. The battles are tense when it comes to Ashs Meltan VS Fabas Hypno, Ilimas Kangaskhan VS Guzmas Scizor, Haus Raichu VS Samson Oaks Exeggutor but the big battle is between the two best friends of Lana and Mallow. With Primarina facing down against Tsareena, the tense battle will put their friendship to the test. Who will win?',27);
insert into EPISODIO_ENTITY values (5367, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624652.jpg', 'The Battlefield of Truth and Love!', 39,'With four of the knockout stage matches having been completed, the final four continue. The matches are Sophocles Vikavolt gainst Minas Ribombee, Kiawes Marowak VS Acerolas Gengar, Jessies Wobbuffet VS James Mareanie and Lillies Vulpix VS Gladions Umbreon. With Lillie and Gladion being a match between siblings, Lillie will go for her Z-move. Will it work out? And with longtime friends Jessie &amp; James facing off, how will they plan to continue? Who will get through to the Top 8?',27);
insert into EPISODIO_ENTITY values (5368, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624653.jpg', 'Imitation is the Sincerest Form of Strategy!', 40,'Its time for the Top 8 matches and for Ash, he comes against his friend Hau and his Decidueye. However, much to his friends concern, Ash decides hell pick Rowlet for the match. However, when Rowlets old friends Toucannon and Trumbeak arrive to cheer it on, they decide to help it learn the move Feather Dance. Will Ash be able to push through and help Rowlet learn the move ahead of the battle?',27);
insert into EPISODIO_ENTITY values (5369, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624654.jpg', 'Battling on the Wing!', 41,'With Ashs Z-Move having not had any effect on Haus Decidueye, Decidueye has come back with its Sinister Arrow Raid Z-Move, which Rowlet luckily managed to dodge. However, the battle continues on and, with Rowlet not having fully mastered Feather Dance, the battle gets even more tense. Will Rowlet be able to pull through and bring Ash to the semi finals? In addition to that, the Top 8 match between Sophocles and Kiawe begins...',27);
insert into EPISODIO_ENTITY values (5370, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624655.jpg', 'The Road to the Semifinals!', 42,'The battle between Kiawe and Sophocles comes to a head with Sophocles unleashing Vikavolts Z-Move against Charizard. With Sophocles having studied Kiawes battle strategies intently, the battle is to be tense. In addition to that, the final Semi Final match between Lana and Guzma commences, with Guzma fully intent on winning the league so he can destroy it. Will Lana be able to stop him?',27);
insert into EPISODIO_ENTITY values (5371, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624656.jpg', 'The Final Four!', 43,'Its time for the semi finals of the Alola League and it starts off with the battle between Kiawe and Gladion. However, when Mimo, Kiawes sister appears to cheer her brother on, she gets attacked by Team Skull and gets rescued by Gladion. With this, Mimo starts to worry about if her brother will bw able to beat Gladion. Will he manage it?',27);
insert into EPISODIO_ENTITY values (5372, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624657.jpg', 'Getting Down to the Ire!', 44,'The semi finals match between Gladion and Kiawe rages on with Turtonator being against Silvally. With both trainers being so strong, who will win the battle? Afterwards, the semi final match between Ash &amp; Guzma is set to begin, Ash is eager to win but Guzma is a strong trainer and is said to be undefeated. Will Ash be able to get through and defeat Guzma?',27);
insert into EPISODIO_ENTITY values (5373, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624658.jpg', 'The Wisdom Not to Run!', 45,'The semi finals match between Ash &amp; Guzma continues. With Golisopods Emergency Exit resulting in the loss of Scizor, Guzma is angry and with Ash showing remarkable strength and strategy, Guzma sees Kukui in him which makes him even more agitated. Will Ash manage to get the win against Guzma, a trainer who is said to be undefeated?',27);
insert into EPISODIO_ENTITY values (5374, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624659.jpg', 'Final Rivals!', 46,'Its almost time for the finals of the Alola Pokémon League and, on the day before the finals, Ashs mother and Professor Oak arrive all the way from Kanto to cheer him on. However, soon after a group of Meltan appear and start doing something to Ashs Meltan. Gladion, Ashs opponent, is also preparing for the match being supported by his mother Lusamine and sister Lillie. When the match comes to a head the next day, it starts with Ash with the Mythical Pokémon Melmetal versus Ash with the Legendary Pokémon Silvally. Who will win the match?',27);
insert into EPISODIO_ENTITY values (5375, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624660.jpg', 'Enter the Champion!', 47,'The battle to become Alola League champion is on. With both sides having lost their Legendary/Mythical Pokémon, Ash was stunned to see that the Lycanroc he was battling was actually a Zoroark. With Ash &amp; Gladion both said to have a similar skill level, the battle rages on with a climatic finish of Lycanroc VS Lycanroc. Will Ash be able to break through and win against Gladion, winning a Pokémon League for the first time?',27);
insert into EPISODIO_ENTITY values (5376, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624661.jpg', 'Z-Move Showdown!', 48,'The Alola League Trophy Ceremony got interrupted by the opening of an Ultra Wormhole and the mysterious Ultra Beast Guzzlord coming through and starts devouring the League venue. Ash, the Island Kahunas, his friends and the Masked Royal all must band together to stop the Ultra Beast from destroying the world. However, this Guzzlord is not the only Ultra Beast comin through the Ultra Wormhole...',27);
insert into EPISODIO_ENTITY values (5377, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624662.jpg', 'Exhibition Unmasked!', 49,'As Ash is the league champion of the Alola Region, the time has come for the special exhibition match. With his identity now revealed, Professor Kukui battles as him, not as the Masked Royal. With Kukui being not just the local Pokémon Professor but a trainer with many victories, the battle is to be tense. Will Ash manage to succeed in the battle?',27);
insert into EPISODIO_ENTITY values (5378, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624663.jpg', 'A Full Battle Bounty!', 50,'The battle between Ash and Kukui rages on. With Ash being the Alola League Champion and Kukui being the Professor of the region known for his battling skill, the battle could go either way and with Kukui bringing in Pokémon from all around the world, Ash faces a tough challenge, especially when Kukui sends in Venusaur against Ashs Rowlet. Will Ash be able to push through?',27);
insert into EPISODIO_ENTITY values (5379, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624664.jpg', 'Fiery Surprises!', 51,'The battle between Ash and Kukui rages on. With Ash using his untested Ultra Beast Naganadel, things can get very tough but the battle truly heats up when it features Incineroar versus Torracat once again. With these two having a rivalry, the battle gets incredibly heated. Which of the Pokémon will come out victorious?',27);
insert into EPISODIO_ENTITY values (5380, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624665.jpg', 'From Z to Shining Z!', 52,'With Professor Kukui down to his final Pokémon, the Island Guardian of Melemele Island, Tapu Koko, intervenes and requests to be Kukuis final Pokémon in order to battle Ash. Ash, with Naganadel and Pikachu remaining faces one of the toughest battles he has ever had. Will Ash manage to break through and defeat the Island Guardian?',27);
insert into EPISODIO_ENTITY values (5381, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624666.jpg', 'Dreaming of the Sun and Moon!', 53,'With the League complete, everyone returns to their normal day to day life. As its now time for vacation, Professor Kukui asks for everyones plans over it, and when Ash learns of everyones plans and dreams, he makes a decision. In addition to that, as they didnt get a chance to battle in the league, Ash and Kiawe decide to have one more battle. Which of them will win the battle?',27);
insert into EPISODIO_ENTITY values (5382, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624667.jpg', 'Thank You, Alola! The Journey Continues!', 54,'Ash has made a decision to return to Kanto with a new goal of travelling more of the world to face stronger trainers. However, he has been struggling to tell everyone at the Pokémon school, but as he is trying to work out how to do it, Solgaleo appears in front of him. In addition to that, Team Rocket have received new orders to return to Kanto and Lillie &amp; Gladion decide to go searching for their father. It is time to say goodbye.',27);
insert into EPISODIO_ENTITY values (5383, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624668.jpg', 'Enter Pikachu!', 1,'In this prequel episode, Pikachus backstory as a Pichu, his being cared for by a Kangaskhan after falling off a cliff, and Ashs backstory when he was 6 years old missing Professor Oaks camp because he overslept and breaking the Poké Ball Clock, the events leading to his evolution into a Pikachu and eventually meeting Ash are revealed.',27);
insert into EPISODIO_ENTITY values (5384, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624669.jpg', 'Legend? Go! Friends? Go!', 2,'Ash, his mother Delia, Mr. Mime, and Professor Oak travel to Vermilion City to attend the opening of Professor Cerises new research lab. Professor Cerise wants Goh to choose the Kanto starters, but he refused because he wants to choose Mew instead. The sudden appearance of Lugia causes Ash to meet Goh, a new Trainer with his own dream, and both of them to go on the ride of a lifetime to learn more about Lugia.',27);
insert into EPISODIO_ENTITY values (5385, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624671.jpg', 'Ivysaurs Mysterious Tower!', 3,'A bunch of Ivysaur are causing chaos throughout Vermilion City, and Professor Cerise sends Ash and Goh to investigate. While learning the cause of the trouble, they not only learn more about each other but also clash with Team Rocket, who are now using Pokéballs supplied by Giovanni and delivered by a Pelipper that arrives whenever they call it. With the help of the Ivysaur, Pikachu defeats Team Rocket and the Ivysaur evolve into Venusaur.',27);
insert into EPISODIO_ENTITY values (5386, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624672.jpg', 'Settling the Scorbunny!', 4,'Ash and Goh travel to the Galar Region to investigate reports that Pokemon are growing giant-sized, meeting up along the way with a mischievous Scorbunny that seems to connect with Goh.',27);
insert into EPISODIO_ENTITY values (5387, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624673.jpg', 'Mind-Boggling Dynamax!', 5,'Ash &amp; Go have arrived at the Wild Area, a huge area filled with wild Pokémon. However, they soon come across a Snorlax which soon grows to massive sizes. As they came to learn about the Dynamax phenomenon, Ash &amp; Go are excited by this. However, the Scorbunny they encountered in Wyndon has also come to the Wild Area in search of Go. Will they be able to meet again?',27);
insert into EPISODIO_ENTITY values (5388, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624674.jpg', 'Working My Way Back to Mew!', 6,'After catching Scorbunny in Galar, Go noticed that his Pokédex got filled in when he caught it, which has caused him interest in getting every Pokémon. With Ash, he travels to the forests in the Kanto region and notices a lot of Bug-type Pokémon, so he sets himself a task: Catch every Bug Pokémon from Kanto. Which Pokémon will become his partners?',27);
insert into EPISODIO_ENTITY values (5389, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624675.jpg', 'Serving Up the Flute Cup!', 7,'After catching many Pokémon in Kanto, Ash decides to take Go to the Hoenn region to participate in a special battle tournament. Ash is always eager to battle and is psyched but this is the first time Go has battled as he has just realised how fun catching Pokémon is. Using his newly captured Scyther and Scorbunny, battles are tense and Ash turns up to battle with the Mr. Mime his mother owns and left to look after Ash. Who will win the tournament?',27);
insert into EPISODIO_ENTITY values (5390, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624676.jpg', 'The Sinnoh Iceberg Race!', 8,'At Vermilion Citys port, Ash &amp; Go find a worn out and disheartened Piplup. Taking it back to the laboratory, theyre contacted by its Trainer who states that it swam there all the way from Sinnoh. Ash &amp; Go decide to go to Sinnoh to escort Piplup back and learn of an Ice Floe Race. Will they enter?',27);
insert into EPISODIO_ENTITY values (5391, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624677.jpg', 'Finding a Legend!', 9,'Ash &amp; Go have heard that the Legendary Pokémon, Ho-Oh, has been sighted in Ecruteak City in Johto so head straight to Johto to find it. When there, they see a Pokémon that resembles Ho-Oh instantly but soon learn its a fake. They discover a local boy disguised one of his Pokémon as Ho-Oh to show his grandfather the Pokémon. However, with his plan failing, he hopes to find the real Ho-Oh. Will he succeed?',27);
insert into EPISODIO_ENTITY values (5392, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624678.jpg', 'A Test in Paradise!', 10,'Ash &amp; Go have heard of a person who got rescued by Dragonite on the news. After hearing of their interest in Dragonite, Professor Sakuragi informs them of an area where Dragonite live. Ash &amp; Go immediately go to search for it by sea. However, on the way they are hit by a storm and run aground on the island where Dragonite live. Will they meet the rare Dragonite?',27);
insert into EPISODIO_ENTITY values (5393, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624679.jpg', 'Best Friend…Worst Nightmare!', 11,'Unlike Ash &amp; Go, Koharu is very unenthusiastic about Pokémon. She gets on well with the Yamper but has no interest in capturing or battling with Pokémon. She is often labelled as someone who really loves Pokémon due to her father, Professor Sakuragi, a label which bothers her. Meanwhile, a Gengar starts to cause trouble in Sakuragis Laboratory. Will Koharu rid herself of the label and will they stop Gengar?',27);
insert into EPISODIO_ENTITY values (5394, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624680.jpg', 'Flash of the Titans!', 12,'Ash &amp; Go have gone back to Galar to watch the finals of the Pokémon World Championships, a competition that determines who is the best at Pokémon battles in the year. In the finals, Lance from Kanto and Leon from Galar face off. Ash &amp; Go are excited waiting for the battle showcasing the Dynamax phenomenon. The battle is against the Red Gyarados Lance caught in Johto and Leons Gigantamax Charizard. Who will win?',27);
insert into EPISODIO_ENTITY values (5395, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624681.jpg', 'The Climb to Be the Very Best!', 13,'Following the Pokémon World Championships final, a wild Drednaw has mysteriously Gigantamaxed in Wyndon Stadium. Ash and Go try to stop it but Pikachu starts getting surrounded by a red light... then, after that, Ash challenges Leon to a battle. With Ash using Pikachu and Leon using Charizard, the battle is fierce. Who will win? The Alola Champion or the World Champion?',27);
insert into EPISODIO_ENTITY values (5396, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624682.jpg', 'Raid Battle in the Ruins!', 14,'The Ruins of the Titans have been discovered in the Desert Resort in Unova so Ash &amp; Go head there to research the ruins. When they get there, they find numerous traps and eventually encounter an expedition team. With their help, they reach the end of the ruins and find a giant Golurk. Is this the titan of the ruins?',27);
insert into EPISODIO_ENTITY values (5397, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624683.jpg', 'A Snow Day for Searching!', 15,'There are some issues at Sakuragis laboratory. As such, Ash and Go have to return home while the systems are being fixed. Go is happy to see his parents as he hasnt seen them for a while but gets told they cant return home due to a job they have to do. Expecting as much, Go travels around town and meets a Cubone that is very sad. Go decides to help the Cubone look for the object thats missing, will he be able to find it?',27);
insert into EPISODIO_ENTITY values (5398, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624684.jpg', 'A Chilling Curse!', 16,'Strange phenomenon have been happening at Sakuragis Laboratory lately such as rooms getting ramsacked. On hunting down the problem, Ash &amp; Go find out that the culprit is none other than the Gengar they had encountered previously. Ash &amp; Go both intend to catch the Gengar but Ash starts acting very weird and even almost falls down the stairs. Is Gengar responsible? Will they stop Gengar?',27);
insert into EPISODIO_ENTITY values (5399, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624685.jpg', 'Kicking It From Here Into Tomorrow!', 17,'As Pikachu &amp; Scorbunny are practicing battles, Gos Darmanitan comes over to try and get Scorbunny to use a Fire-type move. Scorbunny tries to use Ember but it doesnt go well and it gers made fun of. Annoyed, Scorbunny starts practicing the move, with Go not wanting to help as Go feels Scorbunny can battle just fine with other moves. This causes friction and Go &amp; Scorbunny start to fight... Will they make up and will Scorbunny learn to use Fire-type moves?',27);
insert into EPISODIO_ENTITY values (5400, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624686.jpg', 'Destination: Coronation!', 18,'Ash intended to battle the World Champion, Leon again, so he has entered the Pokémon World Championships. To qualify for the final few, he has to battle other trainers who are qualified. To start with, he will face Visquez, the deputy Gym Leader at Vermilion City Gym while Lt. Surge is away. Each trainer uses two Pokémon with Ash picking Pikachu and Gengar and Visquez picking Electrode and Raichu. Will Ash manage to win?',27);
insert into EPISODIO_ENTITY values (5401, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/249/624687.jpg', 'A Talent for Imitation!', 19,'Team Rocket have gone to a movie set in order to get a movie role for Jessie. However, when there, a director gets mad at Ditto, a Pokémon that has a role in the movie, as it is struggling with its transforming. Ditto runs away from the set and ends up with Team Rocket who decide to help it become a skilled actor. Meanwhile, Ash &amp; Go have been called upon in order to find the Ditto. Will they get the Ditto back or will it stay with Team Rocket?',27);
insert into EPISODIO_ENTITY values (5402, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/259/648937.jpg', 'Dreams Are Made of These!', 20,'Professor Sakuragi is holding a Pokémon Orienteering event at his laboratory where kids will go through various spots to look for Pokémon. Ash and Go have both been chosen a leaders to guide the children around. Ash gets really focused on the battle part of the event while Go focuses on catching them, furthering their dreams. However, before too long Lugia appears.',27);
insert into EPISODIO_ENTITY values (5403, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/259/648938.jpg', 'Caring for a Mystery!', 21,'Go has taken an interest in Pokémon eggs, as he has never seen one so he and Ash go searching for one. In their search, they come across an egg at the Pokémon Center. This egg has been passed from place to place without it hatching. However, Nurse Joy decides to entrust the egg to Ash. Will Ash be able to get the egg to hatch?',27);
insert into EPISODIO_ENTITY values (5404, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/259/648939.jpg', 'Goodbye, Friend!', 22,'Ash &amp; Go have head to Littleroot Town in Hoenn to investigate the Beautifly migration, which only happens once a year. During this, Go wants to get another Wurmple and calls to Raboot, but Raboot is disinterested. Later, Raboot sneaks out of the Pokémon Center. Where is it going?',27);
insert into EPISODIO_ENTITY values (5405, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/260/652363.jpg', 'Panic in the Park!', 23,'All the food in the Sakuragi Park has disappeared, and all the Pokémon there are starting to fight out of hunger. Ash and Go decide to stake out the park overnight to catch the culprit.',27);
insert into EPISODIO_ENTITY values (5406, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/459/1148947.jpg', 'A Little Rocket R & R!', 24,'Team Rocket receives orders from Giovanni to take a vacation, which apparently applies to all Team Rocket members, but while theyre taking things easy in the Sinnoh Region Resort Area Matori and her Elite Team swoop in and start snatching up Pokémon! Now Jessie, James, Meowth and Wobbuffet have to work with Ash and Go, who are also in Sinnoh, to stop Matori without the two trainers finding out who they are and without headquarters finding out that they are violating their orders.',27);
