insert into EPISODIO_ENTITY values (5509, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/451/1129022.jpg', 'Just a Scones Throw From Here!', 37,'Go reunites with his Mugendina and chooses to leave it under Dandes care. Afterwards, Satoshi and Go revisit the place where Go had first met his Aceburn, leading them to reconnect with Aceburns former friends. After a confrontation with Team Rocket, Go is summoned by Project Mew, forcing him to miss Satoshis battle with Dande.',27);
insert into EPISODIO_ENTITY values (5510, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/451/1129021.jpg', 'Climax! The Night Before the Decisive Battle! Satoshi VS Dande!!', 38,'The battles from the Masters Eight Tournament semifinals and the teams for Satoshi and Dande are reviewed.',27);
insert into EPISODIO_ENTITY values (5511, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/451/1129019.jpg', 'A Flood of Torrential Gains!', 39,'Go travels to Hoenn for his next assignment for Project Mew. Meanwhile, Satoshi and Dande begin their full battle in the Masters Eight Tournament Finals, with Satoshi being allowed to use Mega Evolution, Z-moves and Daimax. In the battle, Gangar takes down Dandes Intereon, but Gangar is later knocked out by the opposing Barrikohru.',27);
insert into EPISODIO_ENTITY values (5512, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/451/1129018.jpg', 'Toying With Your Motions!', 40,'Satoshi and Dande continue their battle, with Satoshis Mega Lucario defeating Barrikohru. As the battle goes on, Dandes strategy begins to tease Satoshi. After Mega Lucario is knocked out by Drapult, Kairyu avenges its teammate by finishing off Drapult with a Draco Meteor, giving Satoshi a 3–2 lead. For his next Pokémon, Dande brings out his Gorirander.',27);
insert into EPISODIO_ENTITY values (5513, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/451/1129017.jpg', 'Paring Pokémon While Parrying!', 41,'After Dandes Drapult is defeated, Dande gains some momentum and begins to turn the tables. Satoshis Kairyu is taken down by the opposing Gorirander, who is then knocked out by Uonoragon. However, Uonoragon is beaten by Dandes Aceburn moments later. With just one Pokémon remaining, Satoshi sends in Pikachu to go up against Lizardon. After each Pokémon uses their strongest attacks, the clash causes Mugendina to reawaken and interfere with the heated battle.',27);
insert into EPISODIO_ENTITY values (5514, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/451/1129016.jpg', 'Partners in Time!', 42,'Satoshi and Dande have their Daimax Bands recharged by Mugendina, leading to a battle between Kyodaimax Aceburn and Kyodaimax Pikachu, which ends in Pikachus favor. Pikachu then goes up against Dandes Lizardon and briefly passes out. However, Pikachu becomes motivated after imagining all of Satoshis Pokémon cheering for him, allowing him to get back up and deliver one last Thunderbolt on Lizardon. Pikachu manages to defeat Lizardon, resulting in Satoshis victory over Dande. Satoshi becomes the new World Champion.',27);
insert into EPISODIO_ENTITY values (5515, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/451/1129015.jpg', 'The Mew from Here!', 43,'The Project Mew team sets out for Faraway Island to commence their search for Mew. After being separated into two different groups, Shigeru and Tsurugi encounter a Groudon, while Go, Tokio, and Asahi come across a Kyogre.',27);
insert into EPISODIO_ENTITY values (5516, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/451/1129014.jpg', 'In the Palms of our Hands!', 44,'The members of Project Mew are forced to confront Groudon and Kyogre. Mew reveals itself after disguising itself as the Hoenn Legendaries. Mew launches attacks at the Project Mew team until Go thanks it for inspiring him to set off on his journey. After the Project Mew team has achieved its goal, Go, Tokio, and Shigeru all go their separate ways.',27);
insert into EPISODIO_ENTITY values (5517, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/451/1129013.jpg', 'Heroes Unite!', 45,'Satoshi and Go return to Kanto and reveal their intentions on starting new adventures without each other. However, Go is unwilling to tell Satoshi his plan, as he doesnt want to betray his friendship with him. When Satoshi publicly announces his decision to continue his journey alone, Go becomes upset due to the feeling of betrayal. The dispute between the two friends is paused when Lugia suddenly appears, prompting Satoshi and Go to begin a raid battle with it.',27);
insert into EPISODIO_ENTITY values (5518, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/451/1129012.jpg', 'These Could be the Starts of Something Big!', 46,'Following their Raid Battle with Lugia, Satoshi and Go go their separate ways and embark on their new journeys.',27);
insert into EPISODIO_ENTITY values (5519, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/457/1144730.jpg', 'The Pendant of Beginning, Part 1', 1,'Liko, a shy girl from the Paldea region arrives in Kanto to begin her studies at the Indigo Academy. Eventually, Liko selects Nyahoja as her first Pokémon, but the two of them struggle to see eye to eye. One night, Liko encounters a man named Amethio, who hands her a letter that is supposedly from her grandmother, requesting her to bring her special pendant. Liko, feeling that the situation seems suspicious, decides to run away instead. While being pursued by Amethio and his crew, another man with a Lizardon comes to Likos rescue. When Liko attempts to jump, her pendant begins to glow.',27);
insert into EPISODIO_ENTITY values (5520, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/460/1150156.jpg', 'The Pendant of Beginning, Part 2', 2,'Liko, now encased in a green sphere, sees a strange Pokémon, which disappears moments later. Friede, the man with the Lizardon, takes Liko away from danger and brings her to an airship known as the Brave Asagi. Liko meets Friedes other companions and begins to trust them. Meanwhile, Amethio and his crew continues their pursuit of Likos pendant and arrives on the airship. After a heated battle between Friede and Amethio, Likos Nyahoja is blown off the airship. Amethio and his team decides to retreat, taking Nyahoja with them.',27);
insert into EPISODIO_ENTITY values (5521, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/460/1150155.jpg', 'As Long as Im With Nyahoja, Im Sure', 3,'The day after Nyahojas disappearance, Friede traces the Explorers to a nearby port town, and the crew agrees to help Liko take back Nyahoja. Conia, who has been affectionately caring for the captive Nyahoja, is sniffed out by Murdocks Iwanko at the Pokémon Center. The gang gives chase, and Amethio orders Conia to lure them to their hideout. There, Friede stalls Amethio in a battle to allow Liko to go rescue Nyahoja. Confronted by Conia outside, Liko commands Nyahoja to use Leafage in order to make their escape in the flurry of leaves. Friede notices his plan succeeded and retreats. The Rising Volteccers and Liko regroup and set sail for her home in Paldea. Meanwhile, a local islander named Roy chances upon the Brave Asagis missing flag on the beach.',27);
insert into EPISODIO_ENTITY values (5522, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/460/1150154.jpg', 'A Passed-Down Treasure', 4,'The Rising Volteccers dock at Roys island to repair the damaged Brave Asagi. Their Hogator stumbles overboard and wanders through the islands forest, eating a stash of berries it finds before being discovered by Roy, who befriends it. Liko and Nyahoja notice Hogators absence and track it to the forest, where they are attacked by wild Pokémon that blame them for eating the berries. The two are aided by Roy, who owns an ancient Poké Ball that resonates with Likos pendant, but the group and Hogator are quickly ensnared by the wild Pokémon. Friede rescues the group and calms the wild Pokémon, which forgive Hogator after Liko and Roy help it replace the berries. Liko, Nyahoja and Hogator part with Roy before returning to the repaired Brave Asagi.',27);
insert into EPISODIO_ENTITY values (5523, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/460/1150151.jpg', 'I Found You, Hogator', 5,'Unwilling to leave Hogator, Roy stows aboard the Brave Asagi to become its partner. The crew allows Roy to stay the night, but he is unable to find Hogator and returns home the next morning. Hogator learns of Roys visit and goes looking for him, discovering along the way that the Explorers have followed the Rising Volteccers. Reuniting with Hogator and warned about the Explorers, Roy enlists the local bug Pokémon to patch the Brave Asagis balloon, while Friede and the rest of the crew battle Amethio and Zir to protect the ship. Roy joins the battle and motivates Hogator to perform its first successful Ember attack, but their achievement distracts Friede and allows Amethio to move in on Liko.',27);
insert into EPISODIO_ENTITY values (5524, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/461/1154250.jpg', 'The Ancient Monster Ball', 6,'After Liko is protected by her pendant, she and Roy battle Amethio together, but his Soublades easily overpowers Nyahoja and Hogator. As Liko rushes to protect Nyahoja, Roys Poké Ball resonates with her pendant and unleashes a black Rayquaza that sends the Explorers into retreat before flying away. Inspired by the adventure he has had, Roy catches Hogator and gains his grandfathers permission to explore the world with the Rising Volteccers to catch Rayquaza. Meanwhile, the Explorers leader, Gibeon, removes Amethio from his mission in favor of his teammate Spinel, leaving Amethio to pursue Rayquaza to determine its connection to the pendant.',27);
insert into EPISODIO_ENTITY values (5525, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/462/1155041.jpg', 'Special Training! Captain Pikachu', 7,'Liko and Roy ask about Rayquazas whereabouts from Dot, the crews reclusive information gatherer, but she rebuffs them with a drawing of a defeated Roy and Hogator. Friede obliges to train Liko and Roy in Pokémon battling, pitting them against his partner, Captain "Cap" Pikachu. When their usual strategy of blindly ordering attacks fails, the two improve by focusing on Caps movements, although Nyahoja and Hogator lose interest in the match and fall asleep. Liko and Roy apply their newly gained knowledge in battle against other, which ends with Nyahoja learning Quick Attack and defeating Hogator. Dot responds to their match with a drawing of Rayquaza flying over Paldea, indicating the legendary Pokémon to be there.',27);
insert into EPISODIO_ENTITY values (5526, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/462/1156941.jpg', 'Mystery of the Unopening Door', 8,'No hay resumen disponible',27);
