insert into SERIE_ENTITY  values (28, 2021,'https://static.tvmaze.com/uploads/images/medium_portrait/483/1209535.jpg', 'Invincible', 'Based on the eponymous comic book, Invincible revolves around Mark Grayson, a normal teenager except for the fact that his father is the most powerful superhero on the planet. Shortly after his 17th birthday, Mark begins to develop powers of his own and enters into his fathers tutelage.','https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/c2d0cffb-96b3-48e3-83bb-eb81054ac04a/dekghdj-bd4eb099-a37e-4006-99ea-4a9b8e7f199f.png/v1/fill/w_1192,h_670,q_70,strp/the_invincible_wallpaper__hd__by_dglproductions_dekghdj-pre.jpg?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..xxPSE5Y00vSn5C9pyIFMLWFwX9yT4S1SDAYthmlWcWw');
