insert into EPISODIO_ENTITY values (5549, 48, 'https://static.tvmaze.com/uploads/images/medium_landscape/300/752426.jpg', 'Its About Time', 1,'When Mark Grayson finally inherits powers from his superhero father, its a dream come true. But theres more to being a hero than just choosing a name and costume.',28);
insert into EPISODIO_ENTITY values (5550, 44, 'https://static.tvmaze.com/uploads/images/medium_landscape/300/752427.jpg', 'Here Goes Nothing', 2,'With his father out of action, Mark struggles to defend the city against an interdimensional invasion, joining forces with a team of teenage superheroes.',28);
insert into EPISODIO_ENTITY values (5551, 42, 'https://static.tvmaze.com/uploads/images/medium_landscape/300/752429.jpg', 'Who You Calling Ugly?', 3,'Mark has to cut a study date short to help save Mount Rushmore from a crazed scientist. Robot deals with Action - Comic as he assembles a new team of world-saving superheroes.',28);
insert into EPISODIO_ENTITY values (5552, 45, 'https://static.tvmaze.com/uploads/images/medium_landscape/301/754393.jpg', 'Neil Armstrong, Eat Your Heart Out', 4,'Its two firsts for Mark: a first date and a first trip to another planet. At the same time, Nolan and Debbie revisit their own first vacation together.',28);
insert into EPISODIO_ENTITY values (5553, 46, 'https://static.tvmaze.com/uploads/images/medium_landscape/305/763638.jpg', 'That Actually Hurt', 5,'Feeling confident in his new abilities, Mark risks a team-up with a local villain to take down a crime lord, while simultaneously juggling school and a new relationship.',28);
insert into EPISODIO_ENTITY values (5554, 45, 'https://static.tvmaze.com/uploads/images/medium_landscape/308/771879.jpg', 'You Look Kinda Dead', 6,'Mark joins William and Amber on a campus visit to Upstate University, hoping to discover a new future for himself. Debbie makes her own disturbing discovery.',28);
insert into EPISODIO_ENTITY values (5555, 49, 'https://static.tvmaze.com/uploads/images/medium_landscape/310/775404.jpg', 'We Need to Talk', 7,'Feeling lost and confused, Mark looks for advice from Eve. At the same time, everyones looking for him.',28);
insert into EPISODIO_ENTITY values (5556, 45, 'https://static.tvmaze.com/uploads/images/medium_landscape/311/778393.jpg', 'Where I Really Come From', 8,'Mark must prove hes become the hero hes always wanted to be by stopping an unstoppable force.',28);
insert into EPISODIO_ENTITY values (5557, 49, 'https://static.tvmaze.com/uploads/images/medium_landscape/484/1212495.jpg', 'A Lesson for Your Next Life', 1,'In the aftermath of his fathers betrayal, Mark struggles with his responsibilities as Invincible and encounters an unexpected enemy.',28);
insert into EPISODIO_ENTITY values (5558, 50, 'https://static.tvmaze.com/uploads/images/medium_landscape/485/1214959.jpg', 'In About Six Hours I Lose My Virginity to a Fish', 2,'Its summer break for Mark and his friends, but supervillains dont take a vacation. Mark is forced to face the consequences of Omni-Mans double life.',28);
insert into EPISODIO_ENTITY values (5559, 49, 'https://static.tvmaze.com/uploads/images/medium_landscape/487/1218236.jpg', 'This Missive, This Machination!', 3,'Mark starts his college career, Debbie struggles with personal trauma, and Allen the Alien returns home to find a new threat facing the Coalition of Planets.',28);
insert into EPISODIO_ENTITY values (5560, 47, 'https://static.tvmaze.com/uploads/images/medium_landscape/488/1221317.jpg', 'Its Been a While', 4,'Mark answers the call to save an alien species, but the mission has unexpected personal consequences.',28);
