insert into SERIE_ENTITY  values (29, 2019,'https://static.tvmaze.com/uploads/images/medium_portrait/483/1209495.jpg', 'Sex Education', 'Insecure Otis has all the answers when it comes to sex advice, thanks to his therapist mom. So rebel Maeve proposes a school sex-therapy clinic.','https://dnm.nflximg.net/api/v6/BvVbc2Wxr2w6QuoANoSpJKEIWjQ/AAAAQeNNxnaQKZy-XsfnUL8JUE6QN0XN9kuOJ9uuyhoE1FsYQpo3qHPfug03ZuXvDLezXajHLbOoSBu2VuCiQ6kBK0xdAkVw-yarVy2Fpyxv1seUf1-uwJ7mRGpsFu6Xtsn_5RYMUW3Xy6S_Wc139PzduMN4nVQ.jpg?r=2fb');
