insert into EPISODIO_ENTITY values (5561, 52, 'https://static.tvmaze.com/uploads/images/medium_landscape/179/449171.jpg', 'Episode 1', 1,'Despite the ministrations of sex therapist mom Jean and encouragement from pal Eric, Otis worries that he cant get it on. Hes not the only one.',29);
insert into EPISODIO_ENTITY values (5562, 50, 'https://static.tvmaze.com/uploads/images/medium_landscape/179/449172.jpg', 'Episode 2', 2,'Egged on by Maeve -- and finding that dispensing sex tips is tougher than he thought -- Otis tries offering free advice at a classmates house party.',29);
insert into EPISODIO_ENTITY values (5563, 51, 'https://static.tvmaze.com/uploads/images/medium_landscape/179/449173.jpg', 'Episode 3', 3,'Otis clinic achieves liftoff, as does his attraction to Maeve, who unexpectedly asks him for help. Eric swings off on his own and fields a come-on.',29);
insert into EPISODIO_ENTITY values (5564, 47, 'https://static.tvmaze.com/uploads/images/medium_landscape/179/449174.jpg', 'Episode 4', 4,'Eric realizes Otis has fallen for Maeve. But the young sex therapist finds himself torn when hot guy Jackson seeks help with his secret crush.',29);
insert into EPISODIO_ENTITY values (5565, 47, 'https://static.tvmaze.com/uploads/images/medium_landscape/179/449175.jpg', 'Episode 5', 5,'An explicit pic puts a mean girl on the spot. Maeve wants to track down the shaming culprit, forcing Otis to make a tough choice on an important day.',29);
insert into EPISODIO_ENTITY values (5566, 50, 'https://static.tvmaze.com/uploads/images/medium_landscape/179/449176.jpg', 'Episode 6', 6,'Erics trauma isolates him, and Maeves essay wins a prize. Otis tries to hook up with Lily, but his deep-seated issues get in the way.',29);
insert into EPISODIO_ENTITY values (5567, 52, 'https://static.tvmaze.com/uploads/images/medium_landscape/179/449177.jpg', 'Episode 7', 7,'The big dance brings out the best, and the drama, in Moordales student body. Otis finds a date, Maeve gets her dress, and Eric returns with style.',29);
insert into EPISODIO_ENTITY values (5568, 53, 'https://static.tvmaze.com/uploads/images/medium_landscape/179/449178.jpg', 'Episode 8', 8,'Otis feels violated by Jeans new book, and Maeve takes the fall for her brother. Eric serves detention with an old foe, while Lilys body betrays her.',29);
insert into EPISODIO_ENTITY values (5569, 51, 'https://static.tvmaze.com/uploads/images/medium_landscape/236/590711.jpg', 'Episode 1', 1,'Masturbation turns out to be Otiss secret talent, but can he master his unruly desires for Ola? A chlamydia outbreak distracts the student body.',29);
insert into EPISODIO_ENTITY values (5570, 51, 'https://static.tvmaze.com/uploads/images/medium_landscape/236/590712.jpg', 'Episode 2', 2,'After Jean makes a cringey appearance at school, Otis tries his hand at pleasing Ola -- and advising a hapless teacher. Fearless Maeve buckles.',29);
insert into EPISODIO_ENTITY values (5571, 49, 'https://static.tvmaze.com/uploads/images/medium_landscape/236/590713.jpg', 'Episode 3', 3,'On her way to surprise Maeve, Aimee gets a horrible shock on the bus. Rahim connects with Eric as a Milburn family dinner gets seriously awkward.',29);
insert into EPISODIO_ENTITY values (5572, 51, 'https://static.tvmaze.com/uploads/images/medium_landscape/236/590714.jpg', 'Episode 4', 4,'Ola wants to go all the way, but Otis is on edge. Jean and Maeve need their space. Jackson has performance worries, and star-crossed lovers reconnect.',29);
insert into EPISODIO_ENTITY values (5573, 53, 'https://static.tvmaze.com/uploads/images/medium_landscape/236/590715.jpg', 'Episode 5', 5,'Otis and Eric get away from romance and retreat to the woods with Remi. But parents arent perfect, as Maeve knows. Later, Ola follows her heart.',29);
insert into EPISODIO_ENTITY values (5574, 55, 'https://static.tvmaze.com/uploads/images/medium_landscape/236/590716.jpg', 'Episode 6', 6,'Bouncing back is the only option, so Otis throws a small gathering that turns rowdy, and Jackson deals with the healing. Who can handle the truth?',29);
insert into EPISODIO_ENTITY values (5575, 50, 'https://static.tvmaze.com/uploads/images/medium_landscape/236/590717.jpg', 'Episode 7', 7,'Welcome to the morning after. "Sex kid" has made a huge mess -- and just cant stop barfing. Chaos comes to class, and in detention, the girls bond.',29);
insert into EPISODIO_ENTITY values (5576, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/236/590718.jpg', 'Episode 8', 8,'The talking cure may be failing Otis and Jean as they sort out their issues. A wary Maeve makes the finals. Sexy Shakespeare never goes out of style.',29);
insert into EPISODIO_ENTITY values (5577, 54, 'https://static.tvmaze.com/uploads/images/medium_landscape/357/894839.jpg', 'Episode 1', 1,'Moordales friskiest come together again — in more ways than one. Otis sports a stache but hides a secret. Jean comes clean. A head teacher arrives.',29);
insert into EPISODIO_ENTITY values (5578, 61, 'https://static.tvmaze.com/uploads/images/medium_landscape/357/894840.jpg', 'Episode 2', 2,'Makeovers take over when Ruby gives Otis a magnetic revamp and Hope tones the school down. Way down. Elsewhere, Eric and Adam look to level up.',29);
insert into EPISODIO_ENTITY values (5579, 53, 'https://static.tvmaze.com/uploads/images/medium_landscape/357/894841.jpg', 'Episode 3', 3,'Self-expression is out as uniforms sweep the student body. Aimee opens up about the assault while Jackson bonds with cool nonbinary student Cal.',29);
insert into EPISODIO_ENTITY values (5580, 54, 'https://static.tvmaze.com/uploads/images/medium_landscape/357/894842.jpg', 'Episode 4', 4,'In the cold light of day, can sex turn into intimacy, and vice versa? Ruby recoils from Otis. Maeve connects with Isaac. Abstinence roils Moordale.',29);
insert into EPISODIO_ENTITY values (5581, 54, 'https://static.tvmaze.com/uploads/images/medium_landscape/357/894843.jpg', 'Episode 5', 5,'Vivid history collides with real awkwardness in France as the poo hits a windshield and friends slam on the brakes. A spark reignites. Jean explodes.',29);
insert into EPISODIO_ENTITY values (5582, 59, 'https://static.tvmaze.com/uploads/images/medium_landscape/357/894844.jpg', 'Episode 6', 6,'The truth is out there: Maeve gets the news, Aimee reveals her vulva cupcakes and more, and Eric navigates Nigerian life. Hope goes to new extremes.',29);
insert into EPISODIO_ENTITY values (5583, 58, 'https://static.tvmaze.com/uploads/images/medium_landscape/357/894845.jpg', 'Episode 7', 7,'Home is where the heat is. Jean contends with a hot mess and a cold shoulder. Maeve deals with a mum on the run. The "sex school" finally goes public.',29);
insert into EPISODIO_ENTITY values (5584, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/357/894846.jpg', 'Episode 8', 8,'As a new day dawns, Moordales fate hangs in the balance. Aimee spills. Eric confesses. Otis haunts the hospital. Honesty matters now, more than ever.',29);
insert into EPISODIO_ENTITY values (5585, 55, 'https://static.tvmaze.com/uploads/images/medium_landscape/477/1194397.jpg', 'Episode 1', 1,'Maeve butts heads with a prickly professor. Oceans apart, will her connection with Otis sizzle or fizzle? An attempted nude leads to a hairy situation.',29);
insert into EPISODIO_ENTITY values (5586, 52, 'https://static.tvmaze.com/uploads/images/medium_landscape/477/1194398.jpg', 'Episode 2', 2,'When a popular couple is on the rocks, Otis eyes an opportunity. Eric finds community. Surprises in the bedroom leave Jackson questioning his sexuality.',29);
insert into EPISODIO_ENTITY values (5587, 56, 'https://static.tvmaze.com/uploads/images/medium_landscape/477/1194424.jpg', 'Episode 3', 3,'A scathing review rattles Maeves resolve. Adam and Michael bond over life as a bachelor. Ruby helps Otis with his campaign — and his loneliness.',29);
insert into EPISODIO_ENTITY values (5588, 56, 'https://static.tvmaze.com/uploads/images/medium_landscape/477/1194400.jpg', 'Episode 4', 4,'Tragedy brings a familiar face back to Moordale. Jeans saving grace is Otis worst nightmare. Ruby does recon. Aisha asks out Cal — but theres a twist.',29);
insert into EPISODIO_ENTITY values (5589, 55, 'https://static.tvmaze.com/uploads/images/medium_landscape/477/1194401.jpg', 'Episode 5', 5,'Jean struggles to find joy in motherhood. Between heated debates and a hot date with a grieving Maeve, can Otis perform? Jackson has an identity crisis.',29);
insert into EPISODIO_ENTITY values (5590, 66, 'https://static.tvmaze.com/uploads/images/medium_landscape/477/1194425.jpg', 'Episode 6', 6,'Goodbyes are never easy, but this ones a mess. With emotions firing on all cylinders, Maeve finds the right words. Aimee gets inspired; Eric gets real.',29);
insert into EPISODIO_ENTITY values (5591, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/477/1194403.jpg', 'Episode 7', 7,'Elevator inaction sparks collective action. A sisterly argument years in the making finally boils over. Maeve makes things right — and makes a choice.',29);
insert into EPISODIO_ENTITY values (5592, 85, 'https://static.tvmaze.com/uploads/images/medium_landscape/477/1194404.jpg', 'Episode 8', 8,'Cavendish rallies to search for Cal. As Eric finds his calling, Jackson discovers his roots. Much like love, truth takes many forms — and it will out.',29);
