insert into EPISODIO_ENTITY values (5593, 57, 'https://static.tvmaze.com/uploads/images/medium_landscape/401/1003655.jpg', 'Bienvenidos', 1,'After a public high school collapses, the builder tries to repair its image by paying for three impacted students to attend an exclusive private school.',30);
insert into EPISODIO_ENTITY values (5594, 50, 'https://static.tvmaze.com/uploads/images/medium_landscape/401/1003656.jpg', 'Deseo', 2,'A school project brings Marina and Samuel closer, and inspires Guzmán to try and win over Nadia. Meanwhile, Christian is shocked by a revelation.',30);
insert into EPISODIO_ENTITY values (5595, 54, 'https://static.tvmaze.com/uploads/images/medium_landscape/401/1003657.jpg', 'Sábado Noche', 3,'Samuel throws a party, where Nano makes a move on Marina and spiked punch affects more than one couple. Nadia is hurt by what she learns about Guzmán.',30);
insert into EPISODIO_ENTITY values (5596, 48, 'https://static.tvmaze.com/uploads/images/medium_landscape/401/1003658.jpg', 'El Amor es una Droga', 4,'Guzmán tries to earn Nadias forgiveness. Polo and Christian bond at a gala. Lu bribes her teacher. To pay his debt, Nano must complete a dark mission.',30);
insert into EPISODIO_ENTITY values (5597, 49, 'https://static.tvmaze.com/uploads/images/medium_landscape/401/1003659.jpg', 'Todos Mienten', 5,'Marina gives Nano a way to pay his debt. Lu intentionally leaks a secret in front of Nadia. Omar learns Ander told his friends about the two of them.',30);
insert into EPISODIO_ENTITY values (5598, 50, 'https://static.tvmaze.com/uploads/images/medium_landscape/401/1003660.jpg', 'Todo Va a Salir Bien', 6,'Nano learns one watch holds a secret. Marinas pot stash is found. News of a pregnancy raises suspicions. Christian is offered fame if he does a favor.',30);
insert into EPISODIO_ENTITY values (5599, 47, 'https://static.tvmaze.com/uploads/images/medium_landscape/401/1003661.jpg', 'Todo Estalla', 7,'Carla suspects Marina is involved in the theft. Omars father makes plans for his son. After learning his sisters secret, Guzmán seeks revenge.',30);
insert into EPISODIO_ENTITY values (5600, 52, 'https://static.tvmaze.com/uploads/images/medium_landscape/401/1003662.jpg', 'Assilah', 8,'The last moments before the murder unfold. Christian makes a tough decision. The police arrest a suspect. Guzmán becomes reckless with grief.',30);
insert into EPISODIO_ENTITY values (5601, 53, 'https://static.tvmaze.com/uploads/images/medium_landscape/210/525631.jpg', '20 horas desaparecido', 1,'New students start school at Las Encinas as Guzmán continues to mourn his sister and Christian struggles with his secret. A classmate goes missing.',30);
insert into EPISODIO_ENTITY values (5602, 48, 'https://static.tvmaze.com/uploads/images/medium_landscape/210/525633.jpg', '34 horas desaparecido', 2,'Seeking the truth about Marinas death, Samuel attempts to seduce Carla. Lus new friend, social media guru Cayetana, hosts an impromptu party.',30);
insert into EPISODIO_ENTITY values (5603, 54, 'https://static.tvmaze.com/uploads/images/medium_landscape/210/525634.jpg', '36 horas desaparecido', 3,'Polo and Ander have a heart-to-heart. Nadia gets creative to stop Guzmán from drinking too much and doing drugs. Rebecas mother offers Samuel a job.',30);
insert into EPISODIO_ENTITY values (5604, 49, 'https://static.tvmaze.com/uploads/images/medium_landscape/210/525635.jpg', '59 horas desaparecido', 4,'Pressured by his friends, Polos guilt overwhelms him. Cayetanas mother threatens to reveal her secret. Ander and Guzmán argue with their partners.',30);
insert into EPISODIO_ENTITY values (5605, 50, 'https://static.tvmaze.com/uploads/images/medium_landscape/210/525636.jpg', '63 horas desaparecido', 5,'Rebeca teases Cayetana with what shes learned. The Halloween party takes a troubling turn. Samuel walks in on a shocking scene.',30);
insert into EPISODIO_ENTITY values (5606, 48, 'https://static.tvmaze.com/uploads/images/medium_landscape/210/525637.jpg', '66 horas desaparecido', 6,'Lu blackmails Nadia, and Samuel confronts Carla with his suspicions. In the future, Guzmán is interrogated about the missing student.',30);
insert into EPISODIO_ENTITY values (5607, 53, 'https://static.tvmaze.com/uploads/images/medium_landscape/210/525638.jpg', '84 horas desaparecido', 7,'Lu uncovers a secret while helping Cayetana with her fundraiser party. Omar worries about Samuels fate. Anders behavior confuses Guzmán.',30);
insert into EPISODIO_ENTITY values (5608, 51, 'https://static.tvmaze.com/uploads/images/medium_landscape/210/525639.jpg', '0 horas desaparecido', 8,'Painful truths and dark secrets are exposed as the students unburden themselves and the circumstances behind Samuels disappearance are revealed.',30);
insert into EPISODIO_ENTITY values (5609, 49, 'https://static.tvmaze.com/uploads/images/medium_landscape/245/614446.jpg', 'Carla', 1,'Carla is interrogated when a student is killed at a party. In the past, she faces Polo in court, Ander has a health worry, and Nadia meets a new suitor.',30);
insert into EPISODIO_ENTITY values (5610, 50, 'https://static.tvmaze.com/uploads/images/medium_landscape/245/614447.jpg', 'Samuel y Guzmán', 2,'Guzmán attempts to make amends. Nadia threatens payback when she and Lu go after the same scholarship. Ander comes clean to his loved ones.',30);
insert into EPISODIO_ENTITY values (5611, 48, 'https://static.tvmaze.com/uploads/images/medium_landscape/245/614448.jpg', 'Cayetana y Valerio', 3,'Polo is harassed at school. Samuel mulls the polices offer as he and Rebeca become closer. Ander struggles with his treatment.',30);
insert into EPISODIO_ENTITY values (5612, 53, 'https://static.tvmaze.com/uploads/images/medium_landscape/245/614449.jpg', 'Lu', 4,'Guzmán confronts Nadias father. New romances transpire when Lu throws a creative Valentines Day party. Rebeca struggles with a moneymaking decision.',30);
insert into EPISODIO_ENTITY values (5613, 52, 'https://static.tvmaze.com/uploads/images/medium_landscape/245/614450.jpg', 'Ander', 5,'Rebeca tries to identify the traitor. A blackout party at the club leads to multiple shocking revelations.',30);
insert into EPISODIO_ENTITY values (5614, 51, 'https://static.tvmaze.com/uploads/images/medium_landscape/245/614451.jpg', 'Rebeca', 6,'The Columbia scholarship winner is announced. Nadia makes a momentous decision. Samuels concern about Carla causes issues between him and Valerio.',30);
insert into EPISODIO_ENTITY values (5615, 47, 'https://static.tvmaze.com/uploads/images/medium_landscape/245/614452.jpg', 'Nadia y Omar', 7,'As graduation day arrives, the futures of multiple students remain uncertain. Polo begs his mothers to reconsider their recent decision.',30);
insert into EPISODIO_ENTITY values (5616, 52, 'https://static.tvmaze.com/uploads/images/medium_landscape/245/614453.jpg', 'Polo', 8,'The events that transpired the night of the murder unfold. The police interview several eyewitnesses who are ready to point fingers.',30);
insert into EPISODIO_ENTITY values (5617, 55, 'https://static.tvmaze.com/uploads/images/medium_landscape/330/825819.jpg', 'El nuevo orden', 1,'A stern principal and three new students begin at Las Encinas. Omar and Samuel must prove themselves academically while their friends try to help.',30);
insert into EPISODIO_ENTITY values (5618, 53, 'https://static.tvmaze.com/uploads/images/medium_landscape/330/825820.jpg', '5 segundos', 2,'Prince Phillipes arrival at the school prompts strict security measures and controversy. Samuel and Omars towel party leads to new romantic hookups.',30);
insert into EPISODIO_ENTITY values (5619, 54, 'https://static.tvmaze.com/uploads/images/medium_landscape/330/825821.jpg', 'Cuando bailan las mentiras con las tentaciones', 3,'When Prince Phillippe hosts his famous Le Bal party, betrayals ensue. The jealousy between Guzmán and Samuel intensifies. Patrick sparks friction.',30);
insert into EPISODIO_ENTITY values (5620, 45, 'https://static.tvmaze.com/uploads/images/medium_landscape/330/825822.jpg', 'Soy una...', 4,'Rebe is confused and hurt by Mencías mysterious behavior. Much to Aris chagrin, Benjamín suggests Samuel join the debate team.',30);
insert into EPISODIO_ENTITY values (5621, 47, 'https://static.tvmaze.com/uploads/images/medium_landscape/330/825823.jpg', 'La reinserción', 5,'Ari and Samuel face off in an important and public debate. After speaking with Ander, Omar struggles with the emotional fallout.',30);
insert into EPISODIO_ENTITY values (5622, 41, 'https://static.tvmaze.com/uploads/images/medium_landscape/330/825824.jpg', 'Te quiero mal', 6,'Phillippe worries that his friends are using him for Ambar Lucid performance tickets. Rebe warns Mencía she feels skeptical about Armandos assistance.',30);
insert into EPISODIO_ENTITY values (5623, 50, 'https://static.tvmaze.com/uploads/images/medium_landscape/330/825825.jpg', 'Antes de irme (1ª parte)', 7,'Samuel tells Ari to make her choice while Guzmán plans a romantic date. Cayetana is stunned by a realization. Mencía is backed into a corner.',30);
insert into EPISODIO_ENTITY values (5624, 47, 'https://static.tvmaze.com/uploads/images/medium_landscape/330/825826.jpg', 'Antes de irme (2ª parte)', 8,'The details of Aris attack are revealed but the Las Encinas students prove yet again there is always more than meets the eye.',30);
insert into EPISODIO_ENTITY values (5625, 48, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1009117.jpg', 'Yo lo maté', 1,'A new student catches Patricks eye while another surprises Cayetana by defending Phillipe. Benjamín implements stricter measures at school.',30);
insert into EPISODIO_ENTITY values (5626, 49, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1009118.jpg', 'Todo vale', 2,'Patrick lashes out at his dad by hosting a hedonistic party for everyone at the school. Samuel struggles with keeping both Ari and Benjamín happy.',30);
insert into EPISODIO_ENTITY values (5627, 45, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1009119.jpg', 'Átame', 3,'Tensions grow between Omar and Samuel as the students vote for someone to be expelled. Isadora tries to persuade Phillipe that she knows whats best.',30);
insert into EPISODIO_ENTITY values (5628, 45, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1009120.jpg', 'El cuerpo', 4,'While helping her father with an auction, Mencía makes a shocking discovery. Outside of the event, Omar is surprised by what he finds in the water.',30);
insert into EPISODIO_ENTITY values (5629, 54, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1009121.jpg', 'Por favor, di la verdad', 5,'The police investigation forces Benjamín into the spotlight. Patrick finds himself in a tough spot with Iván and Cruz. Caye reconnects with a friend.',30);
insert into EPISODIO_ENTITY values (5630, 42, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1009122.jpg', 'No puedes comprar mi amor', 6,'The students auction off dates to raise money for Samuels bail, but the results of the bidding cause more than one broken heart.',30);
insert into EPISODIO_ENTITY values (5631, 41, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1009123.jpg', 'Tóxicos', 7,'Samuel, Rebe and Cayetana look for evidence that could implicate Benjamín. Heartbroken over Phillipes harsh words, Isadora embarks on a trip to Ibiza.',30);
insert into EPISODIO_ENTITY values (5632, 51, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1009124.jpg', 'Tu lado del mundo y el mío', 8,'Samu considers his next move with the SIM card, Cruz gives Iván relationship advice, and Caye tries to support a traumatized Isadora.',30);
insert into EPISODIO_ENTITY values (5633, 53, 'https://static.tvmaze.com/uploads/images/medium_landscape/434/1085283.jpg', 'Ansiedad', 1,'Ari, Mencía and Patrick return to school, determined not to let their familys baggage weigh them down. Isas new club opens with a big first night.',30);
insert into EPISODIO_ENTITY values (5634, 43, 'https://static.tvmaze.com/uploads/images/medium_landscape/434/1085282.jpg', 'Selfis', 2,'After a new development in Isas case against her rapists, everyone has an opinion. Ari asks Nico out for a drink. Patrick makes a sacrifice.',30);
insert into EPISODIO_ENTITY values (5635, 49, 'https://static.tvmaze.com/uploads/images/medium_landscape/434/1085281.jpg', 'Desnudos', 3,'Isas friends rally round — and strip down — to support her. Rocío practices a new talent. Mencía starts to wonder about Sara and Raúls relationship.',30);
insert into EPISODIO_ENTITY values (5636, 56, 'https://static.tvmaze.com/uploads/images/medium_landscape/434/1085280.jpg', 'Guerra', 4,'The crew turns out for Cruzs championship football match, where controversy leads to chaos — and then shocking violence. Sara makes a painful decision.',30);
insert into EPISODIO_ENTITY values (5637, 61, 'https://static.tvmaze.com/uploads/images/medium_landscape/434/1085279.jpg', 'Duelo', 5,'Javi plants an idea in Isas head that she cant shake, while Patrick struggles to help Iván process a loss. Raúl isnt ready to let go of Saraul.Goals.',30);
insert into EPISODIO_ENTITY values (5638, 49, 'https://static.tvmaze.com/uploads/images/medium_landscape/434/1085278.jpg', 'Tina', 6,'Iván seeks emotional release, Sara slips back into old routines, and Ari goes looking for closure. When Isa proposes a collaboration, Nico has doubts.',30);
insert into EPISODIO_ENTITY values (5639, 46, 'https://static.tvmaze.com/uploads/images/medium_landscape/434/1085275.jpg', 'Máscaras', 7,'A Venetian Carnival night at Isadora House shows Isa a new side of Dídac and puts the students of Las Encinas on a collision course toward heartbreak.',30);
insert into EPISODIO_ENTITY values (5640, 56, 'https://static.tvmaze.com/uploads/images/medium_landscape/434/1085277.jpg', 'Separación', 8,'Still reeling from the night before, Ari takes on the heavy responsibility of protecting her siblings. Hugos past actions finally catch up with him.',30);
insert into EPISODIO_ENTITY values (5641, 53, 'https://static.tvmaze.com/uploads/images/medium_landscape/482/1205239.jpg', 'Las Encinas', 1,'An old student is tempted to return to Las Encinas as Isadora struggles with her feelings for Dídac. Iván feels lonely — but that might change soon.',30);
insert into EPISODIO_ENTITY values (5642, 50, 'https://static.tvmaze.com/uploads/images/medium_landscape/482/1205240.jpg', 'Protocolo', 2,'Chloe and Carmen are both obsessed with Iván — but for different reasons. Coach Jessica advises Sara. The mysterious academic director focuses on Dídac.',30);
insert into EPISODIO_ENTITY values (5643, 53, 'https://static.tvmaze.com/uploads/images/medium_landscape/482/1205241.jpg', 'Bling‑Bling', 3,'Sara throws a steamy glitter party. Family tensions tear Dídac and Isadora apart. Rocío and Erics night in the squatters house spirals out of control.',30);
insert into EPISODIO_ENTITY values (5644, 47, 'https://static.tvmaze.com/uploads/images/medium_landscape/482/1205242.jpg', 'Punto y coma', 4,'Chloe considers opening up to Eric, while Nico is worried about his cousins behavior. Omar deals with the consequences of his past in Las Encinas.',30);
insert into EPISODIO_ENTITY values (5645, 47, 'https://static.tvmaze.com/uploads/images/medium_landscape/482/1205243.jpg', 'La familia', 5,'Sara gets Chloes help while scheming against Raúl. Omar catches Joel and Iván in an awkward situation. Carmen makes a bold move.',30);
insert into EPISODIO_ENTITY values (5646, 52, 'https://static.tvmaze.com/uploads/images/medium_landscape/482/1205244.jpg', 'Tocar fondo', 6,'Isadora makes tough decisions in the family business. Luis investigation is threatened. Deception leaves Chloe in a vulnerable place.',30);
insert into EPISODIO_ENTITY values (5647, 58, 'https://static.tvmaze.com/uploads/images/medium_landscape/482/1205245.jpg', 'Solo abrázame', 7,'Raúl manipulates Saras revenge to his advantage. Iváns presence puts Omar and Joels relationship in a very confusing place.',30);
insert into EPISODIO_ENTITY values (5648, 61, 'https://static.tvmaze.com/uploads/images/medium_landscape/482/1205246.jpg', 'Voy a acabar con esto para siempre', 8,'A new death shocks the students of Las Encinas. Iván makes a last-minute proposal to Joel, while Isadora must decide what to do with her parents.',30);
