insert into EPISODIO_ENTITY values (6728, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Seized with Fear', 1,'Trunks and Krillin join Bulma at the crash site of the mysterious time capsule and find an eerie clue: the shell of a large, locust-like creature! Whatever arrived in the time capsule isnt human, and its on the loose!',32);
insert into EPISODIO_ENTITY values (6729, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'The Reunion', 2,'An insect-like monster threatens to turn Gingertown into a ghastly graveyard! In response to this new menace, Kami fuses with Piccolo, and the resulting Super Namekian flies to Gingertown for a showdown of epic proportions!',32);
insert into EPISODIO_ENTITY values (6730, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Borrowed Powers', 3,'Gingertown becomes a battlefield as Piccolo confronts Cell. This monster from the future gains his strength by sucking the life out of his victims! But thats not the creatures only talent. He also knows the Kamehameha Wave!',32);
insert into EPISODIO_ENTITY values (6731, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'His Name Is Cell', 4,'Heavily-armored tanks fail to halt Cells rampage, and now its up to Piccolo to stop the monster! As the Namekian fights for survival, Cell reveals that hes actually an android, the ultimate achievement of Dr. Gero!',32);
insert into EPISODIO_ENTITY values (6732, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Piccolos Folly', 5,'Piccolo cleverly distracts Cell long enough to regenerate his arm. The Namekian is ready for another round, and Krillin and Trunks have arrived to provide backup! With the odds mounting against him, Cell makes a tactical decision.',32);
insert into EPISODIO_ENTITY values (6733, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Laboratory Basement', 6,'With hopes of saving the future, Trunks and Krillin race to destroy Dr. Geros lab. Meanwhile, Piccolo and Tien search for the elusive Cell. But how can they stop an enemy who knows their every move?',32);
insert into EPISODIO_ENTITY values (6734, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Our Hero Awakes', 7,'In South City, Cell plows through more civilians and accidentally runs into Krillin! Goku finally gets back on his feet, but with Cell and the other androids in full stride, can the Saiyan hero still make a difference?',32);
insert into EPISODIO_ENTITY values (6735, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Time Chamber', 8,'As Cell continues his deadly march, Goku hatches a plan to squeeze a years worth of training into just one day! Back at Master Roshis, the android trio arrives looking for Goku! Can Piccolo hold them off until the Saiyans return?',32);
insert into EPISODIO_ENTITY values (6736, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'The Monster is Coming', 9,'Behind the closed doors of the Hyperbolic Time Chamber, Vegeta and Trunks struggle to push past the level of Super Saiyan! Down on Earth, Piccolo challenges Android 17 to a battle!',32);
insert into EPISODIO_ENTITY values (6737, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Hes Here', 10,'Stronger than ever after fusing with Kami, Piccolo leads the attack against the androids! It looks like the Super Namekian has things under control until Cell arrives on the battlefield! Can anyone stop this hideous monster?!',32);
insert into EPISODIO_ENTITY values (6738, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Up to Piccolo', 11,'Just as Cell is about to absorb Android 17, Piccolo bravely steps in and foils the monsters plan! Does the Super Namekian really have a chance at stopping Cell on his own?! Or is he simply putting off the inevitable?',32);
insert into EPISODIO_ENTITY values (6739, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Silent Warrior', 12,'When Android 16 claims to be as strong as Cell, it seems like a wild boast! But after he launches an offensive that throws Cell against the ropes, it becomes clear that the big android has the power to back up his words!',32);
insert into EPISODIO_ENTITY values (6740, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Say Goodbye, 17', 13,'Its android against android as 16 clashes with Cell. Android 16 is the stronger fighter, but Cell is far too driven to be stopped now! With an underheanded attack, Cell moves one step closer to his gruesome transformation!',32);
insert into EPISODIO_ENTITY values (6741, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Sacrifice', 14,'With an onslaught of psychic blasts, Tien gives Androids 16 and 18 a chance to escape, but the powerful attack rapidly drains his strength. Tien may have saved the androids, but can he save himself?',32);
insert into EPISODIO_ENTITY values (6742, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Saiyans Emerge', 15,'Trunks and Vegeta emerge from the time chamber after a year of intense training. Goku and Gohan are next into the room, but with Cell nearing his ultimate form, can the fighters afford to wait another day?',32);
insert into EPISODIO_ENTITY values (6743, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Super Vegeta', 16,'Cell obliterates a chain of islands in search of Android 18! Vegeta, fresh from the time chamber, is ready to test his new strength against the monster, but is he really stronger than a Super Saiyan?',32);
insert into EPISODIO_ENTITY values (6744, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Bow to the Prince', 17,'Vegeta shows cell his new power while Goku and Gohun train.',32);
insert into EPISODIO_ENTITY values (6745, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Hour of Temptation', 18,'No hay resumen disponible',32);
insert into EPISODIO_ENTITY values (6746, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Krillins Decision', 19,'No hay resumen disponible',32);
insert into EPISODIO_ENTITY values (6747, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'The Last Defense', 20,'With the remote control smashed, Krillin and Trunks must save Android 18 from Cells power-hungry grasp. But Vegeta has other plans in mind. Will trunks attack his own father to save humanity?',32);
insert into EPISODIO_ENTITY values (6748, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Cell is Complete', 21,'The earths greatest fear has come true: Cell is complete! Can anyone stop the android nightmare in his final, perfect form? As the heroes nervously line up, a glimmer of hope shines from above. Gohan is a Super Saiyan!',32);
insert into EPISODIO_ENTITY values (6749, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Vegeta Must Pay', 22,'After allowing Cell to reach his final form, Vegeta is ready for the challenge he was promised. But as Cell easily deflects the Saiyans every blow, its clear that Vegeta has more his hands than he bargained for!',32);
insert into EPISODIO_ENTITY values (6750, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Trunks Ascends', 23,'Tapping into the deepest wells of his energy, Vegeta summons one last attack: the Final Flash! Meanwhile, Trunks struggles to decide whether or not to help his father. Vegetas pride is at stake, but so is his life!',32);
insert into EPISODIO_ENTITY values (6751, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Saving Throw', 24,'Vegeta lies unconscious after his battle with Cell, and Trunks unleashes his hidden powers to save his fathers life. With Goku and Gohan still training, Trunks is the only person standing in the evil androids way.',32);
insert into EPISODIO_ENTITY values (6752, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Ghosts from Tomorrow', 25,'Trunks vows to stop the future from repeating itself; Cell cant wait for the future to unfold. Its all up for grabs as the two warriors prepare for battle. Only one future will survive. Whose will it be?',32);
insert into EPISODIO_ENTITY values (6753, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'The Cell Games', 26,'Realizing that his powers are no match for his opponent, Trunks accepts defeat, only to be given a second chance when Cell proposes a tournament! Is Cell really interested in competition, or does he have a sinister motive?',32);
insert into EPISODIO_ENTITY values (6754, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'What is the Tournament?', 1,'No hay resumen disponible',32);
