insert into EPISODIO_ENTITY values (6761, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Dendes Dragon', 8,'With help from King Kai, Goku travels to Namek to recruit a new guardian for the Earth! Most of the Namekians refuse the offer, but theres one little guy who cant wait to go! Dende is back, and hes going to create a new Dragon!',32);
insert into EPISODIO_ENTITY values (6762, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'The Puzzle of General Tao', 9,'Goku comes face to face with an old adversary: General Tao! The search for the Dragon Balls led Goku to the aging general, but unless the Super Saiyan can solve the crafty villains puzzle, the search may end in vain!',32);
insert into EPISODIO_ENTITY values (6763, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'The Games Begin', 10,'The wait is over, and the Cell Games are ready to begin! The Z-Fighters arrive ringside, only to discover another challenger already on the scene. Its none other than World Martial Arts Champion, Mr. Satan!',32);
insert into EPISODIO_ENTITY values (6764, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Losers Fight First', 11,'Caroni and Pirozhki, Mr. Satans top students, make a spectacular entrance to the ring, but are they really ready to rumble with Cell? Dont miss a minute of the fun, because this fight could be over fast!',32);
insert into EPISODIO_ENTITY values (6765, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Goku vs. Cell', 12,'Goku and Cell start fighting with each other in the ring. If Cell wins then hell destroy the earth. If Goku wins then the Cell will give up.',32);
insert into EPISODIO_ENTITY values (6766, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Cells Bag of Tricks', 13,'Cell attacks Goku with a dazzling array of moves including the Destructo Disk, the Special Beam Cannon, and even the Kamehameha Wave! Goku matches the monster blow for blow, but how long can he last against such a lethal arsenal?',32);
insert into EPISODIO_ENTITY values (6767, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'No More Rules', 14,'As the battle intensifies, Cell quickly grows tired of the rules he created for the tournament. With a flick of his finger, the Android destroys the ring, instantly turning the Cell Games into a deadly fight to the finish!',32);
insert into EPISODIO_ENTITY values (6768, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'The Fight is Over', 15,'Goku blasts Cell with a Kamehameha Wave that reduces the android to a pile of cinders, but his triumph is short-lived. The monster shows his amazing resilience by fully regenerating himself!',32);
insert into EPISODIO_ENTITY values (6769, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Faith in a Boy', 16,'After surrendering to Cell, Goku names the next challenger to enter the Cell Games: Gohan! Goku has supreme faith in his sons abilities, but the young Saiyan will need a lot more than his fathers confidence if hes going to survive!',32);
insert into EPISODIO_ENTITY values (6770, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Gohans Plea', 17,'The fight between Gohan and Cell intensifies, but the villains attacks seem to have no effect on the boy! Could the young hero really have the power to defeat the evil android once and for all?',32);
insert into EPISODIO_ENTITY values (6771, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Android Explosion', 18,'Cell is determined to unleash Gohans full potential, but the boy refuses to fight, prompting the android to torture Gohans friends instead! Next, Cell does the unthinkable by spawning miniature Cells to attack the Z-Fighters!',32);
insert into EPISODIO_ENTITY values (6772, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Cell Juniors Attack!', 19,'Gohan boils with rage as the Cell Juniors wreak havoc on the Z-Fighters. The boy struggles to resist the urge to fight, but hes a powder keg waiting to explode, and Android 16 appears ready to light the fuse!',32);
insert into EPISODIO_ENTITY values (6773, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Awakening', 20,'"The Unleashing" - After Android 16 tells Gohan to unleash his powers. Gohan becomes super sayan and starts destroying cells children.',32);
insert into EPISODIO_ENTITY values (6774, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'The Unstoppable Gohan', 21,'Cells desire for battle turns into a nightmare as Gohan unleashes the full fury of his strength. The evil android powers up to his maximum level, but will it be enough to spare him from the wrath of Super Saiyan?',32);
insert into EPISODIO_ENTITY values (6775, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Cells Break Down', 22,'Gokus training is complete, so the gang summons the Eternal Dragon to wish him back to life. Theres only one day left before the Saiyans arrive. Unfortunately, it will take Goku two days to return!',32);
insert into EPISODIO_ENTITY values (6776, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'A Heros Farewell', 23,'Clearly overmatched by Gohan, Cell initiates his last line of defense: a self-destruct program that will blow up the entire planet! With only seconds to spare, Goku risks everything to transport Cell away from the Earth.',32);
insert into EPISODIO_ENTITY values (6777, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Cell Returns!', 24,'The nightmare continues! Cell explodes, but a particle of his nucleus survives the blast, providing all the android needs to regenerate himself! Restored to his ultimate form, Cell returns to the Earth more powerful than ever!',32);
insert into EPISODIO_ENTITY values (6778, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'The Horror Wont End', 25,'Vegeta lashed out against Cell but was incapacitated in a single blow. Gohan jumps in front to save Vegeta and is wounded in the process. Cell and Gohan unleash their devastating Kamehameha waves as they collide in a fierce beam struggle.',32);
insert into EPISODIO_ENTITY values (6779, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Save the World', 26,'The final showdown begins! While Goku telepathically coaches Gohan from the Other World, the Z-Fighters jump in for a five-sided attack! Gohan has the potential inside him, but can Goku show him how to unlock it?',32);
insert into EPISODIO_ENTITY values (6780, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Gokus Decision', 27,'Cell is finally defeated, but the Z-Fighters still have much to resolve! Can they make it to the Lookout in time to heal the badly-injured Gohan? Is Android 18 still a threat? And can our heroes find a way to bring back Goku?',32);
insert into EPISODIO_ENTITY values (6781, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'One More Wish', 28,'With one more wish left, what shall the Z-Fighters wish for?',32);
insert into EPISODIO_ENTITY values (6782, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Free the Future', 29,'Peace and order have been restored on Earth in the present, but Trunks future world is still a place of darkness and despair! Once he arrives home, the future will be forever changed!',32);
insert into EPISODIO_ENTITY values (6783, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Warriors of the Dead', 1,'When Goku hears about a martial arts master known as the Grand Kai, he rushes to meet him for a lesson! Meanwhile, Cell, Frieza, King Cold and the Ginyu Force have teamed up to take control of Other World!',32);
insert into EPISODIO_ENTITY values (6784, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Tournament Begins', 2,'Goku must train for 10,000 years before he can study under the Grand Kai! But when the West, South, and East Kaiâ&amp;#x20AC;ôs decide to hold an Other World Tournament, Goku gets his chance! All he has to do is defeat the greatest fighters of all time!',32);
insert into EPISODIO_ENTITY values (6785, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Water Fight', 3,'The Other World Tournament advances to the Quarter-Finals, and the battles are out of this world! Gokus opponent, Arqua, appears to be a wimp, but things change quickly when he transforms the entire ring into water!',32);
insert into EPISODIO_ENTITY values (6786, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Final Round', 4,'Goku advances to the final round of the tournament where he will face the warrior Pikkon! Sparks of energy fly as the brawlers battle for the title! When Pikkon reveals a Piccolo-like secret, Goku must up the ante! Its Super Saiyan time!',32);
insert into EPISODIO_ENTITY values (6787, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Goku vs.Pikkon', 5,'Goku may be a Super Saiyan, but can he withstand Pikkons unbelievable Thunder Flash Attack?! And thats not all! While Gokus been fighting in Other World, seven years have passed on Earth, Gohan is now a teenager!',32);
insert into EPISODIO_ENTITY values (6788, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Gohan Goes to High School', 6,'On his first day of high school, Gohan stops a truckload of bank robbers by turning Super Saiyan. Now, the city cant stop talking about this mysterious "Gold Fighter!" Can Gohan get through class without revealing his secret identity?',32);
insert into EPISODIO_ENTITY values (6789, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'I am Saiyaman!', 7,'Afraid he will be recognized by his classmates, Gohan gets Bulma to design a retractable super-hero costume that he can activate in an instant. Say goodbye to Gohan - and hello to Saiyaman.',32);
insert into EPISODIO_ENTITY values (6790, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Gohans First Date', 8,'Gohan thinks being a super-hero is a snap until a pretty girl named Angela discovers his secret. When Angela threatens to tell all unless he goes on a date with her, Gohans life suddenly becomes more complicated than ever!',32);
insert into EPISODIO_ENTITY values (6791, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Rescue Videl', 9,'When the Red Shark Gang kidnaps the mayor and demands a showdown with Mr. Satan, its Videl who answers the challenge. Gohan knows Videl is in over her head, but he cant leave his classroom to help her without blowing his cover!',32);
insert into EPISODIO_ENTITY values (6792, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Blackmail', 10,'When a greedy circus promoter kidnaps a baby dinosaur, all he sees are dollar signs! Little does he know, that the dinosaur is a close, personal friend of the Great Saiyaman!',32);
insert into EPISODIO_ENTITY values (6793, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Ill Fight Too', 11,'The Great Saiyaman is about to become a movie star but the heros brush with stardom better not take long, because he has to hurry up and tell all of his old friends the big news: Goku is coming back.',32);
insert into EPISODIO_ENTITY values (6794, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'The Newest Super Saiyan', 12,'While training for the upcoming tournament, Gohan discovers that Goten has already reached the level of Super Saiyan! Sparks fly when the brothers spar, but the main event happens when Videl meets Chichi for the first time!',32);
insert into EPISODIO_ENTITY values (6795, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Take Flight, Videl', 13,'With the Tournament fast approaching, Videl and Goten must learn to fly! Miles away, Vegeta holds a training session of his own, and his young son, Trunks, has a big surprise in store for him',32);
insert into EPISODIO_ENTITY values (6796, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Gather for the Tournament', 14,'Videl learns to fly, and Gohan and Goten do some last minute honing of their Super Saiyan skills. On the island where the tournament will be held, a special guest arrives! What do you say to a hero whos been dead for seven years?!',32);
insert into EPISODIO_ENTITY values (6797, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Camera Shy', 15,'Everyone qualifies for the World Tournament.',32);
insert into EPISODIO_ENTITY values (6798, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'The World Tournament', 16,'The action begins as the World Martial Arts Tournament opens with the Junior Division! Thirty-five young fighters vie for the prize, but the matches prove to be more comedy than competition - until Trunks steps into the ring!',32);
insert into EPISODIO_ENTITY values (6799, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Trunks vs. Goten', 17,'Goten and Trunks breeze through the Junior Division of the tournament until they find themselves going head-to-head in the finals! Who will win this exciting match? This is one championship fight you wont want to miss!',32);
insert into EPISODIO_ENTITY values (6800, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Best of the Boys', 18,'The match for the Junior Division World Championship continues as Goten and Trunks battle for the title! The winner of this final joust becomes the new World Champion! Can Goten outwit the cunning Trunks?',32);
insert into EPISODIO_ENTITY values (6801, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Big Trouble, Little Trunks', 19,'After winning the championship, Trunks fights an exhibition match against Mr. Satan! Can the Champ hold on to his reputation as the worlds strongest fighter? Meanwhile, two mysterious figures reveal themselves to Goku!',32);
insert into EPISODIO_ENTITY values (6802, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Who Will Fight Who?', 20,'Trunks and Gohan infiltrate the adult competition at the tournament by donning the disguise of Mighty Mask. The pairings for the day matches are selected. The first to fight: Krillin vs. Pintar, a man easily ten times Krillins size!',32);
insert into EPISODIO_ENTITY values (6803, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Forfeit of Piccolo', 21,'Piccolo stuns the crowd by surrendering to his mysterious opponent before the first punch is thrown! Next into the ring is Videl, who must face the enormous Spopovitch. Will she be able to handle such a large job?',32);
insert into EPISODIO_ENTITY values (6804, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'A Dark and Secret Power', 22,'Videl takes to the ring for what is expected to be an easy victory over Spopovitch. She hits the towering brute with everything shes got, but her attacks have no effect. It seems Spopovitch is possessed by a supernatural power!',32);
insert into EPISODIO_ENTITY values (6805, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Videl is Crushed', 23,'To everyones horror, Spopovitch delays his inevitable victory for the purposes of torturing Videl! It appears the muscle-bound thug isnt going to stop until he kills her! Will Videl make it out of the ring alive?',32);
insert into EPISODIO_ENTITY values (6806, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Identities Revealed', 24,'Gohans identity is finally discovered as he takes his place on the tournament floor, but he has bigger things to worry about. His opponent, Kibito, is determined to see him transform into a Super Saiyan!',32);
insert into EPISODIO_ENTITY values (6807, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Energy Drain', 25,'When Gohan transforms into a Super Saiyan, Spopovitch and Yamu spring into action! Armed with a mysterious energy-draining device, the pair launch an attack on the golden-haired teen.',32);
insert into EPISODIO_ENTITY values (6808, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'The Wizards Curse', 1,'The Z-Fighters race to stop Babidis cronies from delivering the pure energy that will be used resurrect the dreaded Majin Buu. Will they find Babidis hidden spaceship in time?',32);
insert into EPISODIO_ENTITY values (6809, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'King of the Demons', 2,'Piccolo and Krillin are turned to stone by Dabura! Determined to save their friends, Goku, Gohan, and Vegeta board Babidis ship only to find themselves trapped! Can they save their friends and find their way out?',32);
insert into EPISODIO_ENTITY values (6810, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Vegeta Attacks', 3,'At each stage of Babidis ship, Goku, Gohan, and Vegeta must face a fearsome warrior, each more powerful than the last. Theres no room for error. Even the tiniest mistake will enable Babidi to steal their energy for Majin Buu.',32);
insert into EPISODIO_ENTITY values (6811, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Next Up, Goku', 4,'Babidi unleashes his monster Yakon to steal the Z-Fighters energy for Majin Buu. The battle at Stage Two is sure to be intense, as Yakon is one of the most fearsome creatures in the universe!',32);
insert into EPISODIO_ENTITY values (6812, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Battle Supreme', 5,'At the World Martial Arts Tournament, the five remaining competitors enter the ring for an all-out Battle Royale! The fists fly as Number 18, Mighty Mask, and Mr. Satan duke it out to decide who will be the next Champion of the World!',32);
insert into EPISODIO_ENTITY values (6813, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Eighteen Unmasks', 6,'The battle heats up as Number 18 and Mighty Mask take their fight to the skies. Number 18 gives it everything shes got, but her attacks prove useless against her masked opponent. Could she find the edge she needs to win?',32);
insert into EPISODIO_ENTITY values (6814, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Pay to Win', 7,'As the final bout of the tournament continues, Number 18 throws the defending champ for a loop by offering to throw the fight! Meanwhile, Babidi has selected his warrior for Stage 3: Dabura, King of the Demon World!',32);
insert into EPISODIO_ENTITY values (6815, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Heart of a Villain', 8,'The intense battle between Gohan and Dabura rages on, but just as the Stage 3 clash reaches a heated peak, Dabura stops the fight! Why has the evil giant conceded, and what is the great discovery he claims to have made?',32);
insert into EPISODIO_ENTITY values (6816, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'The Dark Prince Returns', 9,'In an all-out assault against Vegeta, Babidi uses his power to undo the unsuspecting Prince from within! Vegeta is stripped of his good qualities by the wicked wizard, and becomes the heartless warrior that he once was!',32);
insert into EPISODIO_ENTITY values (6817, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Vegetas Pride', 10,'Goku has no choice but to accept Vegetas challenge.',32);
insert into EPISODIO_ENTITY values (6818, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'The Long Awaited Fight', 11,'The battle between Goku and Vegeta has begun! With Babidis magic enhancing his already incredible strength, Vegeta matches Goku move for move, but every blow the Saiyan Prince lands is a boost for Majin Buu!',32);
insert into EPISODIO_ENTITY values (6819, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Magic Ball of Buu', 12,'Gohan and the Supreme Kai confront Babidi in the depths of his space ship. With the fight between Goku and Vegeta supplying vast quantities of energy for Majin Buu, with not a moment to lose.',32);
insert into EPISODIO_ENTITY values (6820, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Buu is Hatched', 13,'The seal encasing Buu is finally broken! Supreme Kai insists on retreat, but Gohan refuses, launching an incredible series of energy attacks. When the shell opens, nothing is inside! Gohan, however, there is no time to celebrate..',32);
insert into EPISODIO_ENTITY values (6821, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'The Losses Begin', 14,'With his big pink belly and infantile behavior, Buu doesnt fit the bill of a galaxy destroyer - until he hurls Dabura into a cliff with a single blow! Gohan senses a limitless power, and the Supreme Kai insists this is the end!',32);
insert into EPISODIO_ENTITY values (6822, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'The Terror of Majin Buu', 15,'Supreme Kai must use his unique fighting powers to keep Buu at bay - or lose his life! One mile away, Goten and Trunks stumble upon Piccolo, still frozen in stone, and accidentally shatter him to pieces! And theres more! The King of Demons returns!',32);
insert into EPISODIO_ENTITY values (6823, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Meal Time', 16,'Free from the grip of Babidi, Vegeta decides to seek his revenge by destroying the monster Majin Buu. Assuming Gohan to be a victim of the voracious villain, the Super Saiyan goes ballistic. Can Vegeta bring down Buu?',32);
insert into EPISODIO_ENTITY values (6824, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'The Warriors Decision', 17,'Vegeta has decided to do the ultimate sacrifice for his family, friends, and last but not the least, KAKAROT!',32);
insert into EPISODIO_ENTITY values (6825, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Final Atonement', 18,'After fighting with Majin Buu, Vegeta realizes he isnt fighting for just himself, but for the entire planet, and commits the ultimate sacrifice.',32);
insert into EPISODIO_ENTITY values (6826, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Evil Lives On', 19,'Majin Buus flesh is scattered on the battlefield, but his mystical power is rebuilding the monster into one deadly piece. Babidi is recovering, too, having narrowly survived Piccolos attack.',32);
insert into EPISODIO_ENTITY values (6827, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Find the Dragonballs', 20,'Videl, Yamcha, Master Roshi, Chi Chi and Bulma find the last Dragon Ball... then it gets eaten by a dinosaur.',32);
insert into EPISODIO_ENTITY values (6828, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Revival', 21,'Goku hatches a plan for defeating Majin Buu: Fusion! By joining two fighters of equal size and strength, an entirely new fighter can be created. But only one such pair remains-Goten and Trunks! Can the young half-Saiyans save the world?',32);
insert into EPISODIO_ENTITY values (6829, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Global Announcement', 22,'Babidi seeks vengeance against Piccolo, Goten, and Trunks! Plastering images on everyones mind, Babidi threatens to terrorize humanity until the trio is brought forward! Meanwhile, Gohan is taken to Supreme Kais world!',32);
insert into EPISODIO_ENTITY values (6830, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Learn to Fuse!', 23,'Goku begins training Goten and Trunks in the art of Fusion. Meanwhile, Gohan, having been healed in Supreme Kais world, tries to remove the legendary Z-Sword to use in the fight against Majin Buu!',32);
insert into EPISODIO_ENTITY values (6831, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'The Z Sword', 24,'Majin Buu launches into a feeding frenzy, transforming an entire towns population into chocolate! Gohan draws the ancient Z-Sword, Goku struggles to teach Goten and Trunks the art of Fusion, and an unlikely hero is asked to join the fight!',32);
insert into EPISODIO_ENTITY values (6832, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Race to Capsule Corp.', 25,'As Goten and Trunks train to stop the vicious Majin Buu, Idasas jaded mother tells Babidi exactly where Trunks lives! The Z-Fighters must now find a way to stop the evil wizard before he reaches Capsule Corp!',32);
insert into EPISODIO_ENTITY values (6833, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Super Saiyan 3', 26,'Trunks searches frantically for the lost dragon radar, and Goku powers-up to an unimaginable level: Super Saiyan 3! Will this newfound strength be enough to stop Majin Buu from destroying West City?',32);
insert into EPISODIO_ENTITY values (6834, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Buus Mutiny', 27,'Goku uses his new Super Saiyan 3 abilities to combat the evil Majin Buu, buying Trunks the time he needs to locate the missing Dragon Radar. But now that Goku has started the fight, he may not be able to escape!',32);
insert into EPISODIO_ENTITY values (6835, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'The Fusion Dance', 28,'Liberated from his master, Majin Buu becomes even more destructive than before, wiping out entire cities in mere seconds! Earths only hope now rests on the shoulders of two young warriors: Goten and Trunks!',32);
insert into EPISODIO_ENTITY values (6836, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Gokus Time Is Up', 29,'Tensions rise for Goten and Trunks as their duel with Majin Buu approaches. Meanwhile, Buu prepares for the upcoming battle by building himself a home! Elsewhere, Goku bids a poignant farewell as he finally returns to Other World.',32);
insert into EPISODIO_ENTITY values (6837, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Return to Other World', 30,'While Trunks and Goten continue their quest to perfect the Fusion Technique, Gohan seeks to master the Z-Sword. Back on Earth, an encounter with a blind boy reveals that there is another side to the belligerent Buu!',32);
insert into EPISODIO_ENTITY values (6838, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Out from the Broken Sword', 31,'Gohan breaks the Z Sword in training, but from within it comes a new Kai, with a new technique!',32);
insert into EPISODIO_ENTITY values (6839, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Gotenks is Born', 32,'After many comical misfires, Trunks and Goten finally perfect the Fusion technique, and Gotenks is born! Defying Piccolos command, the super-kid immediately leaves to go fight Majin Buu! Is Gotenks ready for the fight of his young life?',32);
insert into EPISODIO_ENTITY values (6840, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Unlikely Friendship', 33,'As Majin Buu continues to terrorize humanity, a lone savior appears: Mr. Satan! But his Megaton punch wont be enough to stop the monster, but this unlikely hero may have a few surprises in store for Buu!',32);
insert into EPISODIO_ENTITY values (6841, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'I Kill No More', 34,'While the Z-Fighters continue training in preparation for their battle with Majin Buu, Mr. Satan devises some sneakier plans to take the villain down. But will he even need to carry them out? Is Majin Buu having a change of heart?',32);
insert into EPISODIO_ENTITY values (6842, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'The Evil of Men', 1,'When Mr. Satan inspires Majin Buu to give up his evil ways, it seems the professional pretender has really saved the world. But when a deranged madman suddenly spoils Buus good mood, the pink terror goes on another rampage.',32);
insert into EPISODIO_ENTITY values (6843, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Buu Against Buu', 2,'Good Buu and Evil Buu begin fighting and it seems Evil Buu is much stronger. After a counterattack from Evil Buu the Good Buu turns into chocalate and the Evil Buu eats him and transforms into Super Buu.',32);
insert into EPISODIO_ENTITY values (6844, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Empty Planet', 3,'When the new and improved Majin Buu makes a surprise visit to the Lookout to challenge Gotenks, every second becomes a test of survival! And where are Trunks and Goten during the chaos that erupts?... Sound asleep, of course!',32);
insert into EPISODIO_ENTITY values (6845, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Time Struggle', 4,'Before he can unleash his fury on the remaining Z-Fighters, Majin Buu is coaxed into the Hyperbolic Time Chamber. Inside, Trunks and Goten are training diligently, but will they have enough time to perfect their new moves before Majin Buu arrives?',32);
insert into EPISODIO_ENTITY values (6846, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Super Moves of Gotenks', 5,'The long awaited rematch between Majin Buu and Gotenks begins! But when Gotenks fighting techniques come up short, he is forced to improvise - resulting in some of the craziest attack moves ever!',32);
insert into EPISODIO_ENTITY values (6847, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Trapped In Forever', 6,'The battle between Gotenks and Majin Buu rages on inside the Hyperbolic Time Chamber. On the outside, family and friends wait anxiously for Gotenks and Piccolo to reappear. Can they successfully defeat Majin Buu and make it out alive?',32);
insert into EPISODIO_ENTITY values (6848, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Feeding Frenzy', 7,'Powered by his insatiable hunger, Majin Buu escapes the Hyperbolic Time Chamber, leaving Piccolo and Gotenks trapped inside. Krillin and the gang are forced to fight the monster on their own. Will Buu finally make a meal out of the good guys?',32);
insert into EPISODIO_ENTITY values (6849, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Gotenks Is Awesome', 8,'Super Saiyan 3 Gotenks continues his fight with Majin Buu, and the Lookout is caught in the crossfire! As Gotenks turns up the power, so does Majin Buu - and by the time its over, one of them will be in way over his head!',32);
insert into EPISODIO_ENTITY values (6850, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Unlucky Break', 9,'Gohan continues his training on the World of the Kais. Meanwhile, Gotenks briefly takes the upper hand in the battle with Majin Buu before his techniques begin to fall apart. Will Gohan be ready in time to step in and finish the fight?',32);
insert into EPISODIO_ENTITY values (6851, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'A Whole New Gohan', 10,'When Gotenks fusion unravels, it appears the end has finally come for Goten and Trunks. But just as things seem their worst, Gohan descends on the scene with his newly awakened powers! Finally, the tables are turning on Majin Buu!',32);
insert into EPISODIO_ENTITY values (6852, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Search for Survivors', 11,'After being dominated on the battlefield, Majin Buu blows himself up in a desperate attempt to destroy Gohan! But is this just a ploy? Gohan seems to think so! Is Majin Buu plotting an ambush or simply trying to buy a little time?',32);
insert into EPISODIO_ENTITY values (6853, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Majin Buu Transforms', 12,'Majin Buu reappears, ready for battle, but rather than continue his fight against Gohan, Buu stages a clever deception to absorb Gotenks and Piccolo. With the wisdom of Piccolo and the power of Super Saiyan Gotenks, Buu transforms into "Super Buu!"',32);
insert into EPISODIO_ENTITY values (6854, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'The Old Kais Weapon', 13,'After absorbing Piccolo and Gotenks, Majin Buus powers have increased exponentially! Armed with some new tricks, Majin Buu is poised for global destruction. Now that Gohan is alone and weakening, is there anyone who can stop the monster?',32);
insert into EPISODIO_ENTITY values (6855, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Ready to Fuse', 14,'Goku watches helplessly from Other World as Majin Buu sets his sights on Gohan. Luckily the Old Kai reveals a secret source of power that could save the day. Is Goku ready to bond with his son and put an end to Majin Buus reign of terror?',32);
insert into EPISODIO_ENTITY values (6856, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Union of Rivals', 15,'After Majin Buu absorbs Gohan, Gokus plan to join forces with his son is ruined. But an unlikely ally arrives on the scene-Vegeta. Will the Saiyan Prince put aside his differences and agree to merge with Goku?',32);
insert into EPISODIO_ENTITY values (6857, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Meet Vegito', 16,'The bodies of Goku and Vegeta join to form a new Saiyan warrior. The monster Majin Buu is impressed by the strength of his new opponent, but refuses to take him seriously. Will Majin Buus arrogance be his undoing?',32);
insert into EPISODIO_ENTITY values (6858, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Rip in the Universe', 17,'The newly-formed Saiyan warrior Super Vegito matches Majin Buu punch for punch. But the monsters new opponent stirs up an uncontrollable anger within the very heart of the beast. Will Majin Buus frenzy mean the end of planet Earth?',32);
insert into EPISODIO_ENTITY values (6859, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Vegito Downsized', 18,'The battle rages on between Vegito and Majin Buu! The Super Saiyan Combo seems to have the fight well in hand. But is Vegito tempting fate by toying with Buu? What terrible tricks does the wily, pink monster still have up his sleeve?',32);
insert into EPISODIO_ENTITY values (6860, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'The Incredible Fighting Candy', 19,'Having been reduced to a coffee-flavored candy, it seems nothing can stop Vegito from being consumed by the evil Majin Buu. But when the gumdrop fights back, Buu realizes that the battle is far from over!',32);
insert into EPISODIO_ENTITY values (6861, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'The Innards of Buu', 20,'When Majin Buu absorbs Vegito, the fused Saiyan separates into Goku and Vegeta once again. Deep within the villain, they reveal their plan to rescue Gohan and the others. Can the duo survive the digestive process and carry out their mission?',32);
insert into EPISODIO_ENTITY values (6862, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Mind Trap', 21,'Dangers abound as Goku and Vegeta continue their search for Gohan and inside of Majin Buus body! After meeting some disgusting bedfellows, they finally find what theyre looking for as they enter Majin Buus head!',32);
insert into EPISODIO_ENTITY values (6863, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Deadly Vision', 22,'Goku and Vegeta reunite the others only to be attacked by Majin Buu! The showdown proves that fighting Buu inside his own head is a mind-bending experience. Can Goku and Vegeta survive in this twisted house of horrors where all is Buu?',32);
insert into EPISODIO_ENTITY values (6864, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Evil Kid Buu', 23,'When Super Buu begins to mutate once more, Goku and Vegeta make an escape. But what is it that awaits should they manage to escape? The sinister Kid Buu is revealed and proves to be more deadly and psychotic than all previous incarnations.',32);
insert into EPISODIO_ENTITY values (6865, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'End of Earth', 24,'After the chords of attachment to the roly-poly Buu are cut by Vegeta, Majin Buu should mutate into a much weaker form. But instead he gets even stronger! This baffles everyone but Kibito Kai, who discloses Majin Buus bizarre history!',32);
insert into EPISODIO_ENTITY values (6866, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'True Saiyans Fight Alone', 25,'With Earth erased from existence, Majin Buu begins his search for Goku and Vegeta, leaving entire worlds destroyed in his wake. But when Buus hunt leads him to the World of the Kais, Goku and Vegeta draw the line!',32);
insert into EPISODIO_ENTITY values (6867, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Battle for the Universe Begins', 26,'With Majin Buu ready for a fight, Kibito Kai is stunned to see Goku and Vegeta playing a game of Rock, Paper, Scissors! Rather than use the Fusion Technique to join their powers, the duo has decided to fight Buu one at a time!',32);
insert into EPISODIO_ENTITY values (6868, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Vegetas Respect', 27,'When Super Saiyan 3 Goku collapses from exhaustion, Vegeta enters the fight, but he doesnt last long! Just as Majin Buu is about to deliver the deathblow, Goku makes a comeback!',32);
insert into EPISODIO_ENTITY values (6869, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Minute of Desperation', 28,'Gokus powers are fading, and he must end the battle before its too late! Enter Vegeta, who begins a furious battle with Buu to buy Goku the time needed to gather energy. Outclassed by his opponent, can the Saiyan Prince survive!?',32);
insert into EPISODIO_ENTITY values (6870, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Old Buu Emerges', 29,'When Vegeta falls, Mr. Satan steps in to take up the challenge! It appears the wannabe hero has signed his death warrant, but when Buu attempts to attack, the monster is crippled by agony!',32);
insert into EPISODIO_ENTITY values (6871, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Earth Reborn', 30,'As good Majin Buu wages an all-out war against his evil counterpart, Vegeta asks Dende to summon the Dragon on the new Planet Namek. With the good Buus power dwindling, will Vegeta have enough time to carry out the final phase of his plan?',32);
insert into EPISODIO_ENTITY values (6872, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Call to Action', 31,'Goku awaits the arrival of the Earthlings collective energy to vitalize the Spirit Bomb, but the energy isnt coming! Have the people of the Earth turned a deaf ear to Vegetas plea for help at this most critical hour?',32);
insert into EPISODIO_ENTITY values (6873, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'People of Earth Unite', 32,'People of earth are united in order to help Goku to prepare his final attack to defeat Buu and honored Vegetas sacrifice.',32);
insert into EPISODIO_ENTITY values (6874, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Spirit Bomb Triumphant', 33,'After the good Buu and Mr. Satan free Vegeta, Goku launches the Spirit Bomb! Unfortunately, the weary Saiyan doesnt have enough power to deliver the blast, and Buu sends it right back at him! Will Goku be destroyed by his own attack?',32);
insert into EPISODIO_ENTITY values (6875, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Celebrations with Majin Buu', 34,'When Goku and his companions return to Earth after defeating Majin Buu, they are welcomed with open arms. But nobody is happy to see the good Buu! Can Mr. Satans pink pal manage to fit into society? Or is he destined to become an outcast?',32);
insert into EPISODIO_ENTITY values (6876, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Hes Always Late', 35,'Goku is late for his own party... hes busy looking after some pterodactyl eggs.',32);
insert into EPISODIO_ENTITY values (6877, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Granddaughter Pan', 36,'Goku intends to participate in the World Martial Arts Tournament. It seems a mysterious fighter has caught his eye. Of course, Vegeta, Trunks, Goten, and Pan will fight as well.',32);
insert into EPISODIO_ENTITY values (6878, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Buus Reincarnation', 37,'The World Martial Arts Tournament gets underway. Goku is paired up with the mystery fighter who Goku claims is the reincarnation of Majin Buu.',32);
insert into EPISODIO_ENTITY values (6879, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/11/29190.jpg', 'Gokus Next Journey', 38,'Goku takes Uub on as his student, and bids goodbye to his family and friends as he embarks on a new adventure.',32);
insert into PARTICIPANTE_ENTITY values (350, 'Sean Schemmel is an American voice actor, ADR director, and screenwriter known chiefly for his work in cartoons, anime, and video games. His most notable role is the teen and adult voice of Son Goku in the Funimation dub of the Dragon Ball franchise.', 'https://m.media-amazon.com/images/M/MV5BMTg0MjM3ODM3NV5BMl5BanBnXkFtZTgwODIxNjYxNjE@._V1_.jpg', 'Sean Schemmel');
