insert into SERIE_ENTITY  values (33, 1986,'https://static.tvmaze.com/uploads/images/medium_portrait/20/52044.jpg', 'Saint Seiya', 'Ages ago, the goddess Athena was served by fighters called Saints who channeled the power of the Cosmos within them. Now a youth named Seiya has trained to become a Saint himself by earning the mystical Cloth of Pegasus. He is joined by other Saints with Cloths of their own to fight for Athena.','https://cdn.hobbyconsolas.com/sites/navi.axelspringer.es/public/media/image/2017/02/caballeros-zodiaco-como-acabo-anime-original-saint-seiya.jpg?tf=1200x');
