insert into SERIE_ENTITY  values (34, 2019,'https://static.tvmaze.com/uploads/images/medium_portrait/486/1216600.jpg', 'Dr. Stone', 'One fateful day, all of humanity was petrified by a blinding flash of light. After several millennia, high schooler Taiju awakens and finds himself lost in a world of statues. However, hes not alone! His science-loving friend Senkus been up and running for a few months and hes got a grand plan in mind—to kickstart civilization with the power of science!','https://wallpaperforu.com/wp-content/uploads/2022/12/Dr-Stone-Wallpapers-For-Free.jpg');
