insert into EPISODIO_ENTITY values (7051, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/204/511334.jpg', 'Stone World', 1,'Thousands of years after a mysterious phenomenon turned all of humanity to stone, the super-intelligent, science-driven boy Senku Ishigami awakens. Facing a world of stone and the total collapse of civilization, Senku decides to use science to rebuild the world. Together with his childhood friend Taiju Oki, they begin to rebuild civilization from scratch.',34);
insert into EPISODIO_ENTITY values (7052, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/217/543137.jpg', 'King of The Stone World', 2,'Senku and Taiju prepare to make Yuzuriha as the first person they revive with their completed water, only to suddenly be chased by lions. In order to fight them off, the duo decide to instead revive the strongest fighter in their school, Tsukasa Shishio, who proves to be a valuable hunter. As the group begin harvesting seashells to grind into calcium carbonate for further advances in civilization, Tsukasa, who is against reviving the corrupt adults of human society, clashes with Senku, who remains determined to save everyone.',34);
insert into EPISODIO_ENTITY values (7053, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/436/1092205.jpg', 'Weapons of Science', 3,'Senku does not trust the motivation of Shishio, so he will try to hide his plans from a new and unforeseen enemy for his plan to revive civilization.',34);
insert into EPISODIO_ENTITY values (7054, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/217/543139.jpg', 'Fire the Smoke Signal', 4,'The group embarks on a hunt for gunpowder making supplies; an accidental explosion leads to a fight.',34);
insert into EPISODIO_ENTITY values (7055, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/217/543140.jpg', 'Stone World the Beginning', 5,'Taiju and Yuzuriha flee from Tsukasa while taking Senku with them. It is discovered how Senku survived his first days after being freed from petrifaction.',34);
insert into EPISODIO_ENTITY values (7056, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/436/1092206.jpg', 'Two Nations of the Stone World', 6,'Senku awakens after being nearly killed by Tsukasa and suggests splitting up with Yuzuriha and Taiju so they can spy on Tsukasa. A girl fights Tsukasa but is defeated and trapped under a tree. Senku finds the same girl and helps her.',34);
insert into EPISODIO_ENTITY values (7057, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/217/543142.jpg', 'Where Two Million Years Have Gone', 7,'Senku helps Kohaku bring hot water back to her village for her ill sister. Kohaku tells Senku about her village and that it has forty people. Senku is told he cannot enter the village. Senku explains to Chrome about the history of mankind.',34);
insert into EPISODIO_ENTITY values (7058, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/217/543143.jpg', 'Stone Road', 8,'Senku wants to make antibiotics and he explains how to Chrome and Kohaku. Senku decides to use magnets to collect iron. A child named Suika offers to help Senku. Senku decides to make ramen to appease the villagers and use their manpower.',34);
insert into EPISODIO_ENTITY values (7059, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/217/543144.jpg', 'Let There Be the Light of Science', 9,'Senku feeds the villagers ramen so they can help him make iron. Senku meets Asagiri Gen a man whos been unpetrified and is working for Tsukasa. Asagiri decides to help Senku. Senku wants to make a generator with the help of lightning.',34);
insert into EPISODIO_ENTITY values (7060, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/217/543145.jpg', 'A Flimsy Alliance', 10,'After Gen is brutally beaten in a surprise attack, Kohaku devises a plan to bring down the attacker once and for all.',34);
insert into EPISODIO_ENTITY values (7061, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/217/543146.jpg', 'Clear World', 11,'Suika never wants to show her face for some reason that only a few know. Fortunately, Senku knows the solution to his annoying problem.',34);
insert into EPISODIO_ENTITY values (7062, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/217/543147.jpg', 'Buddies Back to Back', 12,'To recover the most problematic ingredient in order to create sulfonamides, Ginro, Chrome, Kohaku and Senku will head to a zone of maximum danger. What kind of enemy will stand before them?',34);
insert into EPISODIO_ENTITY values (7063, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/217/543148.jpg', 'Masked Warrior', 13,'All thats needed to make antibiotics is alcohol. The best way to get some is to win the Grand Bout, which the Senku and his kingdom will also need to do in order to keep Magma away from Ruri and give her the drug.',34);
insert into EPISODIO_ENTITY values (7064, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/217/543149.jpg', 'Master of Flame', 14,'After Magmas series of tricks to reach the final match, Chrome reveals a trick of his own. With a little extra help from Gen, Chrome just may be able to pull this one off.',34);
insert into EPISODIO_ENTITY values (7065, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/217/543150.jpg', 'The Culmination of Two Million Years', 15,'After Senkus unlikely victory, quick marriage, and even hastier divorce, the kingdom of science is back to work to finally finish Ruris medicine.',34);
insert into EPISODIO_ENTITY values (7066, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/436/1092207.jpg', 'A Tale for the Ages', 16,'Ruri reveals the origin of the villages name and Senku learns of his fathers fate.',34);
insert into EPISODIO_ENTITY values (7067, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/229/572563.jpg', 'A Hundred Nights and a Thousand Skies', 17,'Byakuya and the astronauts story continues, and Senkus connection to Ishigami Village and the Hundred Tales is finally revealed.',34);
insert into EPISODIO_ENTITY values (7068, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/436/1092208.jpg', 'Stone Wars', 18,'Tsukasas army is coming. Kinro struggles to hold the bridge against the deadly spearman Hyoga and his shock troops, but Senku and the villagers are ready with deadly new weapons of science.',34);
insert into EPISODIO_ENTITY values (7069, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/229/572565.jpg', 'To Modernity', 19,'Hyoga is disarmed, but the kingdom of science is still in danger - Ishigami village is in flames. And Tsukasa will soon know that Senku is still alive - How will the villagers fight off the coming invasion?',34);
insert into EPISODIO_ENTITY values (7070, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/229/572566.jpg', 'The Age of Energy', 20,'Work begins on creating the components for Senkus cell phone, but spinning gold wire is proving to be quite the task! Luckily, Chrome and Kaseki "invent" the water wheel and drastically improve the process!',34);
insert into EPISODIO_ENTITY values (7071, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/229/572567.jpg', 'Spartan Crafts Club', 21,'With Chrome and Kasekis water wheel finished, Ishigami Village moves into the age of electricity! But with the primitive materials available to him, will Senku be able to create a filament that can withstand the intense heat of operating a vacuum tube?',34);
insert into EPISODIO_ENTITY values (7072, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/229/572569.jpg', 'The Treasure', 22,'Senku, Chrome, and Magma venture into a cave in search of Tungsten, but theres a suspicious accident that leaves Senku and Chrome trapped at the bottom of a pit! What is Magma up to?!',34);
insert into EPISODIO_ENTITY values (7073, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/436/1092209.jpg', 'Wave of Science', 23,'Senku and the rest of the village get to work on making the components for the cell phone. Its hard work but everyone is pumped!',34);
insert into EPISODIO_ENTITY values (7074, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/233/583434.jpg', 'Voices Over Infinite Distance', 24,'In a flashback, Byakuya decides to leave a glass record for Senku containing a message from him. In the present, Senku and his group create a record player.Senku unveils the record player to the village and plays it. To their amazement, Byakuyas voice is heard as he introduces himself. He then stops with the formalities as he addresses Senku, knowing full well that he is free by now and is hearing the message. Byakuya wants to voice confidence in him before stopping, since he knows his son wouldnt go for sappy father-son moments. Senku laughs that Byakuya truly gets him, as Kohaku notes that Senku is cold to his father while Kokuyo sadly notes she is no better.Byakuya then has Lillian perform a song preformed with the crew helping. The villagers are in awe at the sound.',34);
insert into EPISODIO_ENTITY values (7075, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/293/733636.jpg', 'Stone Wars Beginning', 1,'Senku continues in trying to advance the stone world, this time he makes "space food", it is in actuality cup noodles. After Senku finishes his project, Gen has an epiphany and devises a plan to take down Tsukasas army without violence.',34);
insert into EPISODIO_ENTITY values (7076, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/294/735732.jpg', 'Hot Line', 2,'While Senkus diversion buys Gen and others some time, soon Homura realizes something is not right.',34);
insert into EPISODIO_ENTITY values (7077, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/295/739949.jpg', 'Call From The Dead', 3,'Taiju and Yuzuriha are on the verge of tears after they hear Senkus voice, and Senku informs them of his plan to win the war without any bloodshed.',34);
insert into EPISODIO_ENTITY values (7078, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/296/742075.jpg', 'Full Assault', 4,'Chrome and Magnum struggles with Urkyo, while Senku, however, gets his hands busy with building up an invention; a new hope.',34);
insert into EPISODIO_ENTITY values (7079, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/297/744071.jpg', 'Steam Gorilla', 5,'The final touches to the automobile are made and it is used to transport the science supplies to a fortified cliffside thats close to the Tsukasa empire. From there the automobile is upgraded into a tank, but unbeknownst to the rescue group preparations by the empire have been made to counter any vehicular attack.',34);
insert into EPISODIO_ENTITY values (7080, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/298/746042.jpg', 'Prison Break', 6,'Desperate to escape his prisone confine, Chrome tries to stratergize a plan that will allow him to escape. However, surrounding his prison are traps and his new head jailer Yo is a former loose cannon police officer.',34);
insert into EPISODIO_ENTITY values (7081, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/298/746045.jpg', 'Secret Mission', 7,'With Chrome safe and sound, Senku and Gen start work on the plan to convert people to their side with the Lilian Weinberg recording. They just have to avoid Ukyo and his incredible hearing.',34);
insert into EPISODIO_ENTITY values (7082, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/300/750335.jpg', 'Final Battle', 8,'The Final Battle for the miracle cave starts as Senku and the Kingdom of Science conduct a frontal assault on the cave.',34);
insert into EPISODIO_ENTITY values (7083, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/300/750336.jpg', 'To Destroy and to Save', 9,'Tsukasa and Hyoga are coming to capture the miracle cave. The Kingdom of Science must buy Senku and Chrome some time to turn the tide, or it is all over.',34);
insert into EPISODIO_ENTITY values (7084, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/305/762658.jpg', 'Humanitys Strongest Tag Team', 10,'A truce is called between the Kingdom of Science and Tsukasa Empire. All appears to be well, but some of the Kingdoms dynamite is missing.',34);
insert into EPISODIO_ENTITY values (7085, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/305/762659.jpg', 'Prologue of Dr. Stone', 11,'The Kingdom of Science is victorious, however it is not over for Senku. Senku must use all of his knowledge to cure Tsukasa who is severly injured.',34);
