insert into EPISODIO_ENTITY values (7277, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/242650.jpg', 'To You, in 2000 Years - The Fall of Shiganshina (1)', 1,'For over a century, humans have been living in settlements surrounded by gigantic walls, which prevent the Titans, giant humanoid creatures who eat humans, from entering. Young Eren Yeager wishes to see the outside world by joining the Recon Corps, as he likens living in the cities to livestock. Despite this, his foster sister Mikasa Ackerman and their mother Carla are against him in joining the Corps. Even after seeing the Recon Corps returning home with large casualties, Eren expresses his interest to join.',36);
insert into EPISODIO_ENTITY values (7278, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/242651.jpg', 'That Day - The Fall of Shiganshina (2)', 2,'Some of the Shiganshina townsfolk escape to the inner Wall Maria while the soldiers try to hold off the Titans. The soldiers try to close the gate, but one of the Titans rams the gate, breaching Wall Maria, and causing those inside to retreat even further to Wall Rose. During the next year, as a food shortage becomes apparent, the government orders the refugees to work at the farms or fight to reclaim Wall Maria.',36);
insert into EPISODIO_ENTITY values (7279, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/242652.jpg', 'A Dim Light Amid Despair - Humanitys Comeback (1)', 3,'Eren begins his training with the Cadet Corps, but questions about his painful past overwhelm him. When he struggles with a maneuvering exercise, Berholt and Reiner offer kindly advice.',36);
insert into EPISODIO_ENTITY values (7280, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/242653.jpg', 'The Night of the Closing Ceremony - Humanitys Comeback (2)', 4,'Annie proves her skill in a sparring session, Jan dreams of serving alongside the King, and graduation day brings shocking revelations - along with a sudden outbreak of violence.',36);
insert into EPISODIO_ENTITY values (7281, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/242656.jpg', 'First Battle - The Struggle for Trost (1)', 5,'Eren faces off against the Colossal Titan after it appears out of nowhere and knocks a strategic hole in the Rose Wall gate. As Titans swarm the city, the newly graduated Cadets are called in to fight in brutal battle that wont be without casualties.',36);
insert into EPISODIO_ENTITY values (7282, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/242630.jpg', 'The World the Girl Saw - The Struggle for Trost (2)', 6,'Armin tries to cope with the loss of his friends and allies after Titans massacre his squad. Elsewhere in the city, Mikasa manages to take out several of the monsters, which brings back tragic memories of her past and the first time she met Eren.',36);
insert into EPISODIO_ENTITY values (7283, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/242629.jpg', 'Small Blade - The Struggle for Trost (3)', 7,'After the retreat bell sounds, many cadets find themselves without enough fuel to scale the wall back to safety. Mikasa begins to lose hope once she hears of the deaths in Armins squad, but the appearance of a new type of Titan stokes her will to fight.',36);
insert into EPISODIO_ENTITY values (7284, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/242631.jpg', 'I Can Hear His Heartbeat - The Struggle for Trost (4)', 8,'Armin comes up with a risky plan that pits Titan against Titan as the abandoned Cadets attempt to take back their headquarters. Getting into the building might be possible, but getting out alive and refueled will mean facing more of the giants.',36);
insert into EPISODIO_ENTITY values (7285, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/242632.jpg', 'Whereabouts of His Left Arm - The Struggle for Trost (5)', 9,'A miraculous return is met with anger and fear. Cannons are fixed on Eren as he struggles to remember what happened to him inside the belly of a monster and how he ended up humankinds enemy. One question is all that matters: is Eren human or Titan?',36);
insert into EPISODIO_ENTITY values (7286, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/242633.jpg', 'Response - The Struggle for Trost (6)', 10,'Cadets respond to Erens terrifying transformation with doubt and fear as he struggles to understand it himself. If Armin cant talk the commander into using Erens newfound powers for the good of humankind, all hope of stopping the Titans might be lost.',36);
insert into EPISODIO_ENTITY values (7287, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/242634.jpg', 'Idol - The Struggle for Trost (7)', 11,'Plans are created to use Erens Titan powers to seal the hole in the wall in an attempt reclaim Trost. But with the governments bloodstained history and vocal dissenters in the military ranks, the biggest threat to humankind may not be the Titans.',36);
insert into EPISODIO_ENTITY values (7288, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/242635.jpg', 'Wound - The Struggle for Trost (8)', 12,'The plan to reclaim Trost falls apart when Erens newfound powers turn him into a mindless giant. As Titans continue to swarm the city, its up to Armin and Mikasa to make sure the cadets massacred during the mission havent died in vain.',36);
insert into EPISODIO_ENTITY values (7289, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/242637.jpg', 'Primal Desire - The Struggle for Trost (9)', 13,'After the skirmishes between the cadets and the Titans come to a close, the soldiers of Trost see Eren carrying the boulder to the breach and defend him with their lives.',36);
insert into EPISODIO_ENTITY values (7290, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/242636.jpg', 'Cant Look Into His Eyes - Eve of the Counterattack (1)', 14,'A special military tribunal will decide Erens fate. The Military Police calls for his execution while the Scout Regiment argues that he is a powerful resource for humankind, and Mikasa is put on the spot when asked about the events of the Trost mission.',36);
insert into EPISODIO_ENTITY values (7291, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/242639.jpg', 'Special Operations Squad - Eve of the Counterattack (2)', 15,'The Scout Regiment moves Eren to an old abandoned castle where he will continue his training. Hanzi visits and reveals that shes been putting two captured Titans through a series of tests and trials - experiments that she wants Erens help with.',36);
insert into EPISODIO_ENTITY values (7292, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/242638.jpg', 'What Needs to Be Done Now - Eve of the Counterattack (3)', 16,'Everyone is a suspect in the investigation to find out who killed the two test-subject Titans. Meanwhile, the Cadets pick which corps theyll be joining, but after the harrowing events in the Trost attack, many are uncertain which branch to choose.',36);
insert into EPISODIO_ENTITY values (7293, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/242641.jpg', 'Female Titan - The 57th Exterior Scouting Mission (1)', 17,'As the Scout Regiment begins its push toward Shiganshina, they encounter an intelligent Female Titan unlike any theyve seen before. When Armin hypothesizes that its really a human thats been turned into a Titan, he, Jean, and Reiner attempt to stop it.',36);
insert into EPISODIO_ENTITY values (7294, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/242640.jpg', 'Forest of Giant Trees - The 57th Exterior Scouting Mission (2)', 18,'Armin, Reiner, and Jean are left stranded after their encounter with the Female Titan. Meanwhile, news reaches the centre group about their right flank being annihilated by the Female Titan as the latter continues to wreak havoc within the formation.',36);
insert into EPISODIO_ENTITY values (7295, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/242642.jpg', 'Bite - The 57th Exterior Scouting Mission (3)', 19,'Levi fires a noise round and tells the squad to keep moving forward. With more of the rearguard getting killed by the Female Titan, Eren begs his squad to let him fight but they tell him to trust Levis decision. Eren starts remembering when Hange, Levi, and his squad had him try to transform into a Titan for experimental purposes.',36);
insert into EPISODIO_ENTITY values (7296, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/242643.jpg', 'Erwin Smith - The 57th Exterior Scouting Mission (4)', 20,'The Female Titan has been captured, and its Erwins goal to find out who the human is lurking inside it. Meanwhile, the Scouts realize that the reason Levi told no one about their true mission outside the wall is because there is a spy among their ranks.',36);
insert into EPISODIO_ENTITY values (7297, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/242644.jpg', 'Crushing Blow - The 57th Exterior Scouting Mission (5)', 21,'The mole transforms into the Female Titan. Eren wants to transform into his Titan form, but the squad tells him to trust in their skills and keep moving forward.',36);
insert into EPISODIO_ENTITY values (7298, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/242646.jpg', 'The Defeated - The 57th Exterior Scouting Mission (6)', 22,'Levi orders Mikasa to distract the Female Titan in order to get Eren back. As the Corps mourn, count their dead, and retrieve the bodies before returning home, Erwin orders that the fallen whose bodies were not retrieved be reported MIA.',36);
insert into EPISODIO_ENTITY values (7299, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/242645.jpg', 'Smile - Assault on Stohess (1)', 23,'In the Stohess District of Wall Sina, the Military Police are ordered to escort the Recon Corps convoy once they enter the capital. After the convoy has entered Stohess, Annie is secretly called by Armin in the alleyways.',36);
insert into EPISODIO_ENTITY values (7300, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/242647.jpg', 'Mercy - Assault on Stohess (2)', 24,'Days before Eren is escorted to the capital, Erwin and Armin reveal to him they have a plan to capture the person they believe is the Female Titan. Back in the present, Eren, Armin and Mikasa manage to escape a tunnel collapse while being hunted by the Female Titan.',36);
insert into EPISODIO_ENTITY values (7301, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/242648.jpg', 'Wall: Raid on Stohess District (3)', 25,'The battle between Eren and the Female Titan brings devastation to Stohess, leading up to a final struggle between the Titans near a damaged Wall Sina.',36);
insert into EPISODIO_ENTITY values (7302, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/104/262363.jpg', 'Beast Titan', 1,'Coupled with the militarys coverup of a previous incident, the shocking discovery inside the wall causes a stir. Elsewhere, while the new scout recruits are held for observation, a surprising threat appears.',36);
insert into EPISODIO_ENTITY values (7303, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/109/273876.jpg', 'Im Home', 2,'The source of the Titans strength is revealed.',36);
insert into EPISODIO_ENTITY values (7304, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/107/268323.jpg', 'Southwestward', 3,'The Scouts search for a hole in the wall while Eren and the others learn that someone close may be hiding all the answers.',36);
insert into EPISODIO_ENTITY values (7305, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/108/270511.jpg', 'Soldier', 4,'The Scouts depend on a secret as the castle is assaulted.',36);
insert into EPISODIO_ENTITY values (7306, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/109/273707.jpg', 'Historia', 5,'Krista and Ymir become lost in the mountains as they attempt to save a fellow cadet who becomes lost in a blizzard during winter training.',36);
insert into EPISODIO_ENTITY values (7307, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/110/276584.jpg', 'Warrior', 6,'Ymir is taken to receive medical help by the Scouts after the end of the battle.',36);
insert into EPISODIO_ENTITY values (7308, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/111/279026.jpg', 'Close Combat', 7,'When a new enemy appears on the scene, Eren and the Scouts fight back.',36);
insert into EPISODIO_ENTITY values (7309, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/112/281717.jpg', 'The Hunters', 8,'When the Titans body hits the earth, heat and steam is released allowing the Armored Titans to free itself.',36);
insert into EPISODIO_ENTITY values (7310, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/114/285044.jpg', 'Opening', 9,'Erwin leads the expedition away from Wall Rose and Hange demands a horse ride to visit a captured TItan.',36);
insert into EPISODIO_ENTITY values (7311, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/115/287691.jpg', 'Children', 10,'The group finally flees and Ymir debates lying or staying true to herself.',36);
insert into EPISODIO_ENTITY values (7312, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/116/290476.jpg', 'Charge', 11,'Commander Erwin charges forth to conquer the Armored Titan.',36);
insert into EPISODIO_ENTITY values (7313, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/117/292535.jpg', 'Scream', 12,'Eren confronts a Titan, which results in doubts about his abilities.',36);
insert into EPISODIO_ENTITY values (7314, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/162/405369.jpg', 'Smoke Signal', 1,'After barely surviving Erens recovery, a rising threat from the shadows puts everyones lives in danger again.',36);
insert into EPISODIO_ENTITY values (7315, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/163/407750.jpg', 'Pain', 2,'The Scouts take a stand against a new enemy, but its not just Titans theyll be fighting anymore.',36);
insert into EPISODIO_ENTITY values (7316, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/163/408893.jpg', 'Old Story', 3,'Historia and Erwin look back on their past, revealing a shady government with a hidden agenda and inspiration for an uprising.',36);
insert into EPISODIO_ENTITY values (7317, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/164/410733.jpg', 'Trust', 4,'On the run and running out of time, the Scouts must entrust their lives to others if they plan on surviving.',36);
insert into EPISODIO_ENTITY values (7318, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/164/412261.jpg', 'Reply', 5,'Erwin pleads his case for the Scouts to be spared, but an unforeseen announcement puts the fate of humanity at risk.',36);
insert into EPISODIO_ENTITY values (7319, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/165/414604.jpg', 'Sin', 6,'While sins of the past reveal new truths, both sides prepare for the upcoming showdown before they run out of time.',36);
insert into EPISODIO_ENTITY values (7320, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/166/415797.jpg', 'Wish', 7,'As battle breaks out to prevent the ritual, Historia makes a shocking decision which leads to catastrophe.',36);
insert into EPISODIO_ENTITY values (7321, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/166/417463.jpg', 'Outside the Walls of Orvud District', 8,'When everything falls apart, Eren must believe in himself to save his friends. But Eren alone may not be enough to stop the impending doom.',36);
insert into EPISODIO_ENTITY values (7322, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/168/420106.jpg', 'Ruler of the Walls', 9,'The survey corps and the wall garrison must protect the Orvud District from the impending attack of Rod Reisss titan.',36);
insert into EPISODIO_ENTITY values (7323, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/168/422153.jpg', 'Friends', 10,'Kenny recalls the life which has brought him to deaths door, but he gets to decide whether to live on or not.',36);
insert into EPISODIO_ENTITY values (7324, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/170/426289.jpg', 'Bystander', 11,'Having seen a glimpse of his fathers memories, Eren attempts to track down a man hoping they might shed some light on his fathers secrets.',36);
insert into EPISODIO_ENTITY values (7325, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1008674.jpg', 'Night of the Battle to Retake the Wall', 12,'The Scouts gather for a feisty feast before leaving to retake Wall Maria to uncover whats hidden in the basement once and for all.',36);
insert into EPISODIO_ENTITY values (7326, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/194/485080.jpg', 'The Town Where Everything Began', 13,'The Scouts arrive in Shiganshina as part of the operation to retake Wall Maria, but while investigating the area, they stumble upon something suspicious.',36);
insert into EPISODIO_ENTITY values (7327, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/195/487967.jpg', 'Thunder Spears', 14,'Against a rush of enemies, the Scouts scramble to defend their horses. But despite falling into a trap, they have their own surprise for the Armored Titan.',36);
insert into EPISODIO_ENTITY values (7328, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1008842.jpg', 'Descent', 15,'Despite their efforts, the Scouts face impending disaster in Shiganshina.',36);
insert into EPISODIO_ENTITY values (7329, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/198/495209.jpg', 'Perfect Game', 16,'While one front in the battle is rained on by flames, the other is battered by boulders. With no way out, the Scouts are forced to fight or die trying.',36);
insert into EPISODIO_ENTITY values (7330, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/199/498959.jpg', 'Hero', 17,'As Erwins heroic charge buys Levi time to confront the Beast Titan, Armin comes up with a plan of his own that lays it all on the line.',36);
insert into EPISODIO_ENTITY values (7331, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/200/501741.jpg', 'Midnight Sun', 18,'While picking up the pieces from the costly battle, tensions rise when deciding which of the wounded Scouts to use the single syringe on.',36);
insert into EPISODIO_ENTITY values (7332, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1008856.jpg', 'The Basement', 19,'The Scouts reflect on all they have gained and lost in their mission. With their enemies gone, Eren and the Scouts finally enter the basement to uncover the truth that will change everything.',36);
insert into EPISODIO_ENTITY values (7333, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/202/505550.jpg', 'That Day', 20,'A look into Grishas memories shows Eren the many secrets his father was hiding, including one which led to his mothers demise.',36);
insert into EPISODIO_ENTITY values (7334, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/202/507445.jpg', 'Attack Titan', 21,'Eren learns the truth about his Titan powers, his Father and himself. The Survey Corps have a meeting that discusses the future of Eldia with all their new information.',36);
insert into EPISODIO_ENTITY values (7335, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/203/509777.jpg', 'The Other Side of the Wall', 22,'Scouts will be go outside the walls again and they will reach the same place where Grisha and The Owl were talking and Armin,Eren and Mikasa and other scouts will see the Sea for the first time.',36);
insert into EPISODIO_ENTITY values (7336, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/288/722012.jpg', 'Other Side of the Sea', 1,'As Marley battles the Mid-East Alliance to end a four-year war, a group of Warrior candidates on the front lines compete to be the successor of the Armored Titan.',36);
insert into EPISODIO_ENTITY values (7337, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/289/722719.jpg', 'Midnight Train', 2,'Though glad the war is over, both the Eldian Warriors and Marley brass realize that neither have a future unless they finish the job of retaking the Founding Titan.',36);
insert into EPISODIO_ENTITY values (7338, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/290/725698.jpg', 'The Door of Hope', 3,'Reiner reflects on his past, remembering what pushed him to become a Warrior and keep moving forward when all hope was lost.',36);
insert into EPISODIO_ENTITY values (7339, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1008979.jpg', 'From One Hand to Another', 4,'A sudden visit from the Tybur family shakes up the Marleyan military. Meanwhile, Falco smuggles letters for a friend and helps two old comrades reunite.',36);
insert into EPISODIO_ENTITY values (7340, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/403/1009156.jpg', 'Declaration of War', 5,'While Willy Tybur reveals the truth in a shocking speech to the world, tensions rise behind the stage as Eren and Reiner meet face to face.',36);
insert into EPISODIO_ENTITY values (7341, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/293/733387.jpg', 'The War Hammer Titan', 6,'Erens rampage is thwarted by the War Hammer Titan whose tenacity leaves him stumped. With Marleys military joining the fight, hell be hard-pressed to survive on his own.',36);
insert into EPISODIO_ENTITY values (7342, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/294/735595.jpg', 'Assault', 7,'The forces of Paradis begin their assault, but the Warriors stand their ground. As Marley troops close in around them, Eren struggles to break the War Hammers defenses',36);
insert into EPISODIO_ENTITY values (7343, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/295/737993.jpg', 'Assassins Bullet', 8,'With no Titans left to threaten their escape, the Scouts retreat on the airship. Determined to make them pay for trampling on her home, Gabi chases after with gun in hand',36);
insert into EPISODIO_ENTITY values (7344, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/295/739942.jpg', 'Brave Volunteers', 9,'As Paradis deals with the aftermath of the raid on Liberio, Armin looks back in the past to meeting the volunteer soldiers who reshaped their world.',36);
insert into EPISODIO_ENTITY values (7345, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/296/742218.jpg', 'A Sound Argument', 10,'Two years ago, Paradis welcomed their first visitor who was surprised to see one of their own. Obtaining their help will be critical in a three-part plan to protect Paradis.',36);
insert into EPISODIO_ENTITY values (7346, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/298/745543.jpg', 'Deceiver', 11,'Trapped on the worlds most dangerous island, Falco and Gabi will do anything to survive. Elsewhere, the public demands answers when they learn the savior of Paradis has been detained.',36);
insert into EPISODIO_ENTITY values (7347, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/298/746022.jpg', 'Guides', 12,'While Hange and Pyxis piece together Zekes true intentions, tension builds outside HQ where Armin and Mikasa plead for permission to speak with Eren.',36);
insert into EPISODIO_ENTITY values (7348, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/299/748152.jpg', 'Children of the Forest', 13,'Gabi and Falco seek out a fellow Marleyan whos surprised to see Warrior candidates. The truth of what happened at Ragako may shed some light on Zekes secret plans.',36);
insert into EPISODIO_ENTITY values (7349, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/300/751604.jpg', 'Savagery', 14,'Armin and Mikasa speak with Eren, but are astounded by what he says. In the forest, Levi considers feeding the Beast Titan to someone new, but Zeke has other plans in mind.',36);
insert into EPISODIO_ENTITY values (7350, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/300/751605.jpg', 'Sole Salvation', 15,'A look into Zekes past shows his struggle to become a Warrior. His plans to end the suffering of all Eldians stems from a chance friendship made in his youth.',36);
insert into EPISODIO_ENTITY values (7351, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/388/972026.jpg', 'Above and Below', 16,'With the Jaegerists now in charge, Zekes master plan is revealed. But before it is put in motion, Eren recruits help to flush out any invaders in their midst.',36);
insert into EPISODIO_ENTITY values (7352, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/388/972027.jpg', 'Judgement', 17,'Caught off guard by Marleys surprise attack, Eren fends off their Titans alone. As the battle rages on above, the Scouts consider Erens motives from the underground dungeons.',36);
insert into EPISODIO_ENTITY values (7353, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/390/975881.jpg', 'Sneak Attack', 18,'The Beast Titan joins the fray, but General Magath is determined to take him down. Meanwhile, with the city in flames, Colt and Gabi rush to rescue Falco whos held captive by the Jaegerists.',36);
insert into EPISODIO_ENTITY values (7354, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/392/980305.jpg', 'Two Brothers', 19,'Colt pleads with Zeke to not use his scream and turn Falco into a Titan. All the while, soldiers and Titans clash in battle as Eren struggles to make contact with his brother.',36);
insert into EPISODIO_ENTITY values (7355, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/393/984800.jpg', 'Memories of the Future', 20,'After Zeke makes contact with Eren, he shows him memories of Erens and Grishas past.',36);
insert into EPISODIO_ENTITY values (7356, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/394/987203.jpg', 'From You, 2,000 Years Ago', 21,'Ymir, the founder, unveils her tragic past and deepest secrets within the walls.',36);
insert into EPISODIO_ENTITY values (7357, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/396/990136.jpg', 'Thaw', 22,'As Eren and the Wall Titans march to trample the rest of the world, the Survey Corps defend the Shiganshina District against the Pure Titans.',36);
insert into EPISODIO_ENTITY values (7358, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/396/992275.jpg', 'Sunset', 23,'Hitch Dreyse unexpectedly reunites with Annie and helps her escape the ruins of Trost District. Meanwhile, Armin and Gabi try catching up with Conny before he can sacrifice Falco to make his mother human again.',36);
insert into EPISODIO_ENTITY values (7359, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/397/994572.jpg', 'Pride', 24,'Armin tries to save Falco from Connys attempt to feed him to his mothers Titan in order to restore her humanity. Back in Shiganshina District, Floch Forster begins the execution proceedings for Yelena and Onyankopon.',36);
insert into EPISODIO_ENTITY values (7360, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/398/996875.jpg', 'Night of the End', 25,'Deep in the forest, an unlikely rabble of Marley stragglers and island fugitives attempt to set their hatred aside and talk around a campfire without killing each other.',36);
insert into EPISODIO_ENTITY values (7361, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/998907.jpg', 'Traitor', 26,'The flying boat is guarded by a port full of Jaegerists, but the Scouts are reluctant to kill their former friends. If they wish to avoid bloodshed, they cant afford their plan to go wrong',36);
insert into EPISODIO_ENTITY values (7362, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001912.jpg', 'Retrospective', 27,'For the flying boat to take off, the mechanics need half a day to service it. Knowing theyll never last that long with Jaegerist reinforcements on the way, the crew is forced to change their plans.',36);
insert into EPISODIO_ENTITY values (7363, 25, 'https://static.tvmaze.com/uploads/images/medium_landscape/402/1007369.jpg', 'The Dawn of Humanity', 28,'Regardless of where it all began, Eren commits to his path of destruction during the Scouts first visit to the Marleyan mainland, leaving Mikasa to wonder if things couldve been different.',36);
insert into EPISODIO_ENTITY values (7364, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/450/1125777.jpg', 'The Final Chapters (Part One)', 29,'Chapter 1 - The Rumbling: The Rumbling continues, with the Colossal Titans killing countless people, including Ramzi and his brother and Grishas parents, and destroying civilizations all over the world. Meanwhile, the ship carrying the scouts and warriors arrive at Odiha. Thinking her father is already dead, Annie decides to stay behind on the ship with Gabi, Falco, Yelena, and the Azumabito, while the remaining warriors, scouts, and Onyankopon take the flying boat to stop Eren. The next day, just as the group are about to take off, Floch, having survived the battle at the port, damages the hull of the flying boat before being killed by Mikasa. However, before the flying boat can be properly repaired, the Rumbling arrives. Hange appoints Armin the next commander of the Survey Corps before sacrificing herself by going up against the Colossal Titans, buying them just enough time to get the aircraft off the ground.Chapter 2 - Sinners: En route to Eren, the scouts',36);
insert into EPISODIO_ENTITY values (7365, 90, 'https://static.tvmaze.com/uploads/images/medium_landscape/485/1213317.jpg', 'The Final Chapters (Part Two)', 30,'Eren, as the Founding Titan, advances on Fort Salta with countless other Titans. Appearing before the refugees, who stand on the brink of despair, are Mikasa, Armin, Jean, Conny, Reiner, Pieck, and Levi, who narrowly escaped from the rumbling. The battle between former comrades and childhood friends with Eren concludes here.',36);
