insert into SERIE_ENTITY  values (37, 2013,'https://static.tvmaze.com/uploads/images/medium_portrait/48/122213.jpg', 'Peaky Blinders', 'An epic gangster drama set in the lawless streets of 1920s Birmingham.','https://images.alphacoders.com/125/1254595.jpg');
