insert into EPISODIO_ENTITY values (7366, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/999232.jpg', 'Episode 1', 1,'Birmingham, 1919. Thomas Shelby controls the Peaky Blinders, one of the citys most feared criminal organisations, but his ambitions go beyond running the streets.When a crate of guns goes missing, Thomas recognises an opportunity to move up in the world.',37);
insert into EPISODIO_ENTITY values (7367, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/999233.jpg', 'Episode 2', 2,'Birmingham, 1919. Thomas Shelby controls the Peaky Blinders, one of the citys most feared criminal organisations, but his ambitions go beyond running the streets.Thomas fixes a horserace, provoking the ire of local kingpin Billy Kimber. He also starts a war with gypsy family the Lees. Meanwhile, Inspector Campbell carries out a vicious raid of Small Heath in search of the stolen guns.',37);
insert into EPISODIO_ENTITY values (7368, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/999234.jpg', 'Episode 3', 3,'Thomas Shelby plans to go to Cheltenham races in order to get closer to Billy Kimber. Knowing the gangsters appetite for beautiful women, Thomas invites Grace to accompany him.Meanwhile some IRA sympathisers approach Thomas with an offer to buy the stolen guns.',37);
insert into EPISODIO_ENTITY values (7369, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/999235.jpg', 'Episode 4', 4,'Thomas Shelbys war with the Lee family of gypsies escalates and Campbell puts further pressure on him to deliver the stolen guns. Meanwhile, Thomass brother John plans to marry a former prostitute, but Thomas suspects that shes still on the game.',37);
insert into EPISODIO_ENTITY values (7370, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/999236.jpg', 'Episode 5', 5,'Thomas Shelby has to deal with an IRA chief who has come to Small Heath to avenge his cousins death. Meanwhile, Campbell gets closer to the stolen guns, and Grace has to decide whether her loyalties lie with him or with Thomas.',37);
insert into EPISODIO_ENTITY values (7371, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/999237.jpg', 'Episode 6', 6,'As Thomas Shelby prepares to oust Billy Kimber, hidden secrets are revealed and the family have to face up to the problems that have divided them. Meanwhile, Campbell, obsessed with taking down the Peaky Blinders, unleashes one last plan to destroy them.',37);
insert into EPISODIO_ENTITY values (7372, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/999238.jpg', 'Episode 1', 1,'As the 1920s begin to roar, business is booming for the Peaky Blinders gang. Tommy Shelby starts to expand his legal and illegal operations, with an eye on the racetracks of the south. Meanwhile, an enemy from Tommys past returns to Birmingham.',37);
insert into EPISODIO_ENTITY values (7373, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/999239.jpg', 'Episode 2', 2,'Tommy offers to help Polly by searching for her children, who long ago were taken from her. In London, Tommy risks his life by meeting enigmatic leader Alfie Solomons. Meanwhile Arthur continues to feel the devastating effects of the Great War.',37);
insert into EPISODIO_ENTITY values (7374, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/999240.jpg', 'Episode 3', 3,'Tommy hatches a plan to take control of the southern racecourses. He also meets the aristocratic May Carleton and sees an opportunity to move up in the world. Meanwhile both Major Campbell and London gangster Darby Sabini plan Tommys downfall.',37);
insert into EPISODIO_ENTITY values (7375, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/999241.jpg', 'Episode 4', 4,'Tommy finds out exactly what mission Major Campbell is forcing him to undertake. Arthur spearheads a ferocious takeover of Londons Eden Club. Meanwhile, Pollys son Michael is welcomed into the business and quickly experiences the dark side of the Peaky Blinders.',37);
insert into EPISODIO_ENTITY values (7376, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/999242.jpg', 'Episode 5', 5,'Tommy is caught by surprise when his powerbase in London is obliterated. As Tommy struggles to save his family and regain the upper hand, May expresses her feelings for him, and he is paid a visit by an old friend.',37);
insert into EPISODIO_ENTITY values (7377, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/999243.jpg', 'Episode 6', 6,'As derby day arrives, Tommy is faced with impossible decisions as he plans to strike back at his enemies and take the family business to another level. Meanwhile, Major Campbell has one final card to play - one that he is certain will bring about Tommys demise.',37);
insert into EPISODIO_ENTITY values (7378, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/999244.jpg', 'Episode 1', 1,'It is Thomas Shelbys long-awaited wedding day. In the middle of the celebrations, a mysterious visitor imperils the entire Shelby family, and Tommy finds himself pulled into a web of intrigue more lethal than anything he has yet encountered.',37);
insert into EPISODIO_ENTITY values (7379, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/999246.jpg', 'Episode 2', 2,'Tommy discovers the extent of the mission given to him and the extreme lengths his new paymasters are willing to go to in their quest for power.Meanwhile his own familys activities lead to escalating danger in Birmingham.',37);
insert into EPISODIO_ENTITY values (7380, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/999247.jpg', 'Episode 3', 3,'Responding to the Italians actions, Tommy is set on a path of deadly vengeance. Meanwhile, as he makes plans for his mission on behalf of the Russians, he realises there is a traitor in his midst.',37);
insert into EPISODIO_ENTITY values (7381, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/999248.jpg', 'Episode 4', 4,'Tommy and Tatiana play a personal and dangerous game to acquire information from one another, and Tommy finally comprehends the magnitude of Tatianas warped ideals.Meanwhile, Polly reveals a dark secret, with terrible consequences for Tommy.',37);
insert into EPISODIO_ENTITY values (7382, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/999249.jpg', 'Episode 5', 5,'As the Russians test the Peaky Blinders, Tommy realises that he is being seriously outmanoeuvred. But he has an ace up his sleeve in the form of an enemy turned ally - if only he can control him.',37);
insert into EPISODIO_ENTITY values (7383, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/999250.jpg', 'Episode 6', 6,'As Tommy prepares to commit the most audacious crime of his career, a blow is struck against him that could change everything. As he faces his worst fears, he needs his family more than ever - but who can he trust?',37);
insert into EPISODIO_ENTITY values (7384, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/999257.jpg', 'The Noose', 1,'December 1925. Tommy Shelby OBE has acquired unprecedented legitimacy. The former gangster is also a man alone, estranged from his family and focused only on business. But when he receives a mysterious letter on Christmas Eve, Tommy realises that the Shelbys are in danger of annihilation. As the enemy closes in, Tommy flees his country house and returns to the only safe place he knows: Small Heath, Birmingham, the slum where he grew up. Facing a more determined and sophisticated threat than ever before, the Shelby family must find a way to put differences aside, work together, take up arms and fight for survival...',37);
insert into EPISODIO_ENTITY values (7385, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/999256.jpg', 'Heathens', 2,'As the Shelbys come to terms with the shocking events of Christmas Day, Tommy endeavours to unite his family. Until the current threat is dealt with, their only safe place is together in Small Heath. Johnny Dogs and Charlie set about arming the locals - everyone is now a Peaky bodyguard. Tommy enlists the help of tough Romany Gypsy Aberama Gold, who wants something unusual in return.Jessie Eden confronts Tommy about the workers pay. She warns him that revolution is in the air, and when Tommy doesnt relent she calls his bluff. As the situation plays out, Tommys factory manager tells him he has one more meeting - with a mysterious businessman from Paris. But what transpires is no ordinary meeting with no ordinary businessman...',37);
insert into EPISODIO_ENTITY values (7386, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/999255.jpg', 'Blackbird', 3,'The Italians launch another attack on the Peaky Blinders. Tommy realises that the Shelbys need to evolve if they are to survive, but some of the family are reluctant to part with tradition.As the strike takes hold at the Lanchester factory, Tommy pays a personal visit to Jessie Eden, but he is outmanoeuvred when she reveals something she knows about his past.Changretta plots to continue the vendetta in the most devastating way possible. As well as identifying an enemy of the Shelby family who could help him, Luca makes direct contact with someone at the heart of the Peaky Blinders organisation.',37);
insert into EPISODIO_ENTITY values (7387, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/999254.jpg', 'Dangerous', 4,'The Peaky Blinders are lured by the Italians into a cat-and-mouse chase on the streets of Birmingham, where it becomes clear that Tommy has met his match. Trapped in Small Heath, Tommy tries to console himself with a visit from an old flame but it soon becomes clear that he cant always get what he wants.As his factory lies idle, Tommy confronts the possibility that the Communists might win and he will be deemed a traitor to his class. Meanwhile, Changretta prepares to spring another trap.',37);
insert into EPISODIO_ENTITY values (7388, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/999252.jpg', 'The Duel', 5,'Tommy prepares himself as the bloody battle lines are drawn between the Peaky Blinders and Changretta. A deal is struck - with potentially devastating consequences.',37);
insert into EPISODIO_ENTITY values (7389, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/999251.jpg', 'The Company', 6,'It is the night of the big fight - Bonnie Gold versus Goliath. But as the bell rings and the crowd goes wild, dangers lurk in the shadows for Tommy Shelby and his family. When Changretta plays his final ace, he sets in motion a series of events that will change the Peaky Blinders forever.',37);
insert into EPISODIO_ENTITY values (7390, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/209/523111.jpg', 'Black Tuesday', 1,'1929 – The Shelby family have dispersed: Michael is living at Shelby Company headquarters in Detroit, while Aunt Polly is holed up with a pilot in Monte Carlo. But the family are quickly brought back together when news of the Wall Street Crash hits and its implications for the family business become clear.Meanwhile, Tommys political career is going from strength to strength; he gives a rousing speech in the House of Commons. Its not long, however, before ghosts from Tommys past threaten to undermine his position.',37);
insert into EPISODIO_ENTITY values (7391, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/999265.jpg', 'Black Cats', 2,'Tommy is at Arrow House when he receives a call from a mysterious new ally with potentially devastating information. At Westminster, in a dimly lit bar, he, Ada and Mosley meet to discuss business.Meanwhile, a rival gang, keen to send a message to Tommy, use brutal means to do so. At the Garrison pub, Arthur and Finn reveal their plans to expand the Peaky business empire. Later, a birthday celebration is interrupted by the unexpected arrival of someone close to Tommy with a message about a dangerous new enemy.',37);
insert into EPISODIO_ENTITY values (7392, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/999264.jpg', 'Strategy', 3,'Tommy gathers everyone together to discuss recent tragic events and to give his orders, before the Shelby men travel to London to meet Mosley and its soon revealed who has the upper hand. Linda heads to Arrow House to ask Lizzies advice, Polly visits Aberama to pass on instructions from Tommy, who learns that one of the Peaky Blinders is in danger and sends Arthur and Johnny Dogs on an urgent mission to intervene.',37);
insert into EPISODIO_ENTITY values (7393, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/999262.jpg', 'The Loop', 4,'Tommy waits by the water at Charlies Yard to meet a dangerous adversary. Despite their past grievances, the pair agree to a truce. Later, in a private room at the Garrison pub, as Tommy meets with his constituents to hear their grievances, a mysterious stranger with a message arrives. At his Westminster office, Tommy makes Aberama an offer he cant refuse before inviting Mosley to a party he is throwing for Lizzies birthday. On the night of the party, things soon take a turn for the worse when a surprise guest arrives.',37);
insert into EPISODIO_ENTITY values (7394, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/999261.jpg', 'The Shock', 5,'Mosley takes advantage of shocking events to give a speech to the gathered crowd at Arrow House. Afterwards, Mosley gives Tommy his instructions. Arthur and his men arrive at Limehouse for the arranged rendezvous, but the situation has changed drastically. Meanwhile, Tommy visits an old war comrade who has a very specific skill that Tommy intends to use.',37);
insert into EPISODIO_ENTITY values (7395, 65, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/999259.jpg', 'Mr Jones', 6,'News of Tommys activities have reached Winston Churchill. At a family meeting, Tommy lays out his plans for Mosley, which will take place at a rally Sir Oswald is leading. Tommy is surprised by another strategy, coming from an unexpected corner. Meanwhile, Tommy has his own secrets to reveal.',37);
insert into EPISODIO_ENTITY values (7396, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/397/994692.jpg', 'Black Day', 1,'Tommy sets off to North America, where the end of Prohibition brings new opportunities. But he faces new danger from an old adversary who is finally making his move.',37);
insert into EPISODIO_ENTITY values (7397, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/398/996942.jpg', 'Black Shirt', 2,'Tommy gets involved in a power game with fascists, freedom fighters and Boston gangsters. As the players plan to double cross him, Tommy visits an old ally in Camden.',37);
insert into EPISODIO_ENTITY values (7398, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/399/998740.jpg', 'Gold', 3,'As Ruby is rushed into hospital for urgent treatment for consumption, Tommy is more convinced than ever that his family has been cursed. He sets out on a journey to a gypsy camp to discover who is responsible and how his family might be saved. Ada takes charge of the situation, instructing Arthur to round up some new recruits and head to Liverpool to deliver a warning.',37);
insert into EPISODIO_ENTITY values (7399, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/400/1001616.jpg', 'Sapphire', 4,'Tommy establishes a connection between crime and political power that could alter the course of history. He also receives life-changing news from an unexpected source.',37);
insert into EPISODIO_ENTITY values (7400, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/401/1004124.jpg', 'The Road to Hell', 5,'In the light of extraordinary personal revelations, Tommy takes a course of action that will change everything. Meanwhile, his enemies plans start to fall into place.',37);
insert into EPISODIO_ENTITY values (7401, 80, 'https://static.tvmaze.com/uploads/images/medium_landscape/401/1004177.jpg', 'Lock and Key', 6,'A war veteran who fought in the trenches, Tommy Shelby has been a gangster, an entrepreneur, a captain of industry, a spy and ultimately a Member of Parliament. In the course of this odyssey, he has taken on numerous criminal organisations, business adversaries, foreign insurgents, and the British Establishment itself.Now, in the 1930s, as the clouds of the coming storm gather, he faces the consequences of his experiences and his actions.',37);
