insert into EPISODIO_ENTITY values (7402, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012681.jpg', 'Pilot', 1,'A high-school chemistry teacher (Bryan Cranston) is diagnosed with a deadly cancer, so he puts his expertise to use and teams with an ex-student (Aaron Paul) to manufacture top-grade crystal meth in hopes of providing for his family after hes gone.',38);
insert into EPISODIO_ENTITY values (7403, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012682.jpg', 'Cats in the Bag...', 2,'After the accident in the desert, Walter and Jesse need to dispose of the unfortunate mess in their rolling lab of an RV, and Skyler begins to suspect that Walter and Jesse are involved in some mysterious goings-on.',38);
insert into EPISODIO_ENTITY values (7404, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012683.jpg', '...and the Bags in the River', 3,'Walter and Jesse fight about the latters drug use, so he leaves, forcing Walter to deal with their captive, Krazy-8 (Max Arciniega); Hank uses scared-straight tactics with Walter Jr. when his aunt suspects hes smoking pot; Skyler is furious when Walter stays away from home.',38);
insert into EPISODIO_ENTITY values (7405, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012684.jpg', 'Cancer Man', 4,'Walter announces to the family that he has cancer; the DEA believes there is a new big-time player in the Albuquerque drug business; a depressed Walter takes his anger out on a worthy recipient; Jesse pays a surprise visit to his parents house.',38);
insert into EPISODIO_ENTITY values (7406, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012685.jpg', 'Gray Matter', 5,'At a birthday party for a successful former science colleague, Walter is offered a job; Jesse tries gaining legitimate employment but winds up back cooking meth, and an inferior kind at that; Skyler assembles the family for an intervention to get Walter to agree to chemotherapy, but hes concerned about quality-of-life issues and their financial difficulties.',38);
insert into EPISODIO_ENTITY values (7407, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012686.jpg', 'Crazy Handful of Nothin', 6,'Walter, in the throes of his chemotherapy treatment and needing money more than ever, agrees to cook more crystal meth with Jesse; Skinny Pete hooks Jesse up with an important new contact, while the DEA intensifies its investigation of Albuquerques new drug kingpin.',38);
insert into EPISODIO_ENTITY values (7408, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012687.jpg', 'A No-Rough-Stuff-Type Deal', 7,'Walter and Jesse do business with a new partner-in-crime, but immediately run into "production problems," which necessitates a nearly impossible mission to knock off a chemical-supply house. Meanwhile, Marie throws a baby shower for Skyler and presents her with an unusual gift that shows a different side of the aunt-to-be.',38);
insert into EPISODIO_ENTITY values (7409, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012709.jpg', 'Seven Thirty-Seven', 1,'Season 2 kicks off with Walt and Jesse once again bearing witness to Tucos incendiary disposition, which leads them to the conclusion that its time to put an end to their business dealings with him. But the question is how. Meanwhile, Hank serves as a go-between for estranged sisters Skyler and Marie.',38);
insert into EPISODIO_ENTITY values (7410, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012710.jpg', 'Grilled', 2,'Trying to dissociate themselves from the volatile Tuco takes a bad turn when Walt and Jesse get trapped with the dealer, and Skyler, worried about her missing husband, receives comfort from her sister and brother-in-law. Hank, meanwhile, pays a business call on Jesses mother.',38);
insert into EPISODIO_ENTITY values (7411, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012711.jpg', 'Bit by a Dead Bee', 3,'Walt and Jesse attempt to cover their tracks and distance themselves from Tuco, but they soon find that business is taking a hit along with their financial situation. Meanwhile, Hank and his DEA investigation into the meth ring get a major break that just might put Walt and Jesse in their crosshairs.',38);
insert into EPISODIO_ENTITY values (7412, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012712.jpg', 'Down', 4,'Despite Walts attempt to reconnect with the family, a suspicious Skyler keeps him at arms length and worries about what hes been up to while hes been away from the house; Jesse finds himself on the streets once again and struggles to improve his lot in life.',38);
insert into EPISODIO_ENTITY values (7413, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012713.jpg', 'Breakage', 5,'Hank deals with some lingering aftereffects from his confrontation with Tuco; bills are piling up at the White house and tensions are beginning to run high; Jesse organizes a crew of dealers to take their product to the streets.',38);
insert into EPISODIO_ENTITY values (7414, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012714.jpg', 'Peekaboo', 6,'Walt returns to teaching at the high school; when Skinny Pete gets taken advantage of and ripped off, Jesse steps in, but bites off more than he can chew; Skyler takes the opportunity to show her appreciation for Gretchens kindness in picking up the tab for Walts treatments.',38);
insert into EPISODIO_ENTITY values (7415, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012715.jpg', 'Negro Y Azul', 7,'Walt and Jesse contemplate an expansion of their business; Hank experiences a hassle in El Paso as he tries to adapt to his new coworkers; Skylers new job opportunity leads to her reconnecting with an ex-colleague; and Jesse interacts with his new landlady.',38);
insert into EPISODIO_ENTITY values (7416, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012716.jpg', 'Better Call Saul', 8,'Badgers brush with the law leads Walt and Jesse to call in a shady lawyer; the DEA believes it has a line on the mysterious and elusive "Heisenberg"; Hanks stint in El Paso is up and he returns to Albuquerque, but his mental makeup causes concern for Marie.',38);
insert into EPISODIO_ENTITY values (7417, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012717.jpg', '4 Days Out', 9,'After undergoing a PET-CAT scan and fearing the worst, Walt takes lawyer Sauls advice and hunkers down for a marathon session of cooking product; Jesses romance with his landlady is heating up, but must cool off quickly when he and Walt head for the desert to take care of business.',38);
insert into EPISODIO_ENTITY values (7418, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012718.jpg', 'Over', 10,'The Whites throw a party to thank family and friends for their support through Walts trying time, but it turns ugly when he and Hank get into a bitter argument; later, a pent-up and fed-up Walt tries to occupy his time with home-improvement projects. Worried about Walts physical and emotional states, Skyler confides in her boss; Jane keeps her relationship with Jesse a secret from her father.',38);
insert into EPISODIO_ENTITY values (7419, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012719.jpg', 'Mandala', 11,'Saul suggests a new business partner for Walt and Jesse after they begin to lose their dealers to some unforeseen circumstances. At work, Skyler confronts Ted after she uncovers some unnerving information; and Jesse opens up to Jane about what he does for a living, with disastrous results.',38);
insert into EPISODIO_ENTITY values (7420, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012720.jpg', 'Phoenix', 12,'A new addition joins the White family as Walter Jr. attempts to help out his struggling family by launching a new Web site. Elsewhere, Jesses addiction worsens and his relationship with Jane begins to negatively impact Walt and her father.',38);
insert into EPISODIO_ENTITY values (7421, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012721.jpg', 'ABQ', 13,'In the Season 2 finale, Skylers frustration with Walts secrecy boils over; Jesse is dealt a devastating blow that leads him down a path of self-destruction, and only Walt is willing to help him; and a grief-stricken Donald experiences more tragedy.',38);
insert into EPISODIO_ENTITY values (7422, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012733.jpg', 'No Más', 1,'In the third-season premiere, Walt faces a new threat on a new front and deals with an increasingly angry Skyler, who must consider what to do next with her life and the kids. Meanwhile, Jesse comes face-to-face with some startling self-revelations.',38);
insert into EPISODIO_ENTITY values (7423, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012734.jpg', 'Caballo sin Nombre', 2,'Despite ever-increasing tension between Walt and Skyler, he pulls out all the stops in an effort to reconcile with the family. Elsewhere, Saul is instrumental in getting Jesse involved in a most-unusual investment opportunity.',38);
insert into EPISODIO_ENTITY values (7424, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012735.jpg', 'I.F.T.', 3,'Walt disregards Skylers demands and the rift between them widens dramatically, pushing her to take even more drastic steps. Meanwhile, continuing anxiety and panic attacks plague Hank, which leads to a serious situation at the Drug Enforcement Agency.',38);
insert into EPISODIO_ENTITY values (7425, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012736.jpg', 'Green Light', 4,'Skylers latest bit of bad news proves to be a blow to Walt, and his loss of control endangers his job and his business relationships with Saul and Jesse. Hank goes full-speed ahead into the agencys investigation of the blue-meth case, while Jesse cooks up a new plan.',38);
insert into EPISODIO_ENTITY values (7426, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012737.jpg', 'Más', 5,'When Gus intensifies efforts to persuade Walt to get back in the meth business, Jesse takes exception and a rift appears in his and Walts personal relationship. Meanwhile, Skylers new relationship isnt turning out as shed like; and Marie tells Skyler about her concerns for the increasingly troubled Hank and his well-being.',38);
insert into EPISODIO_ENTITY values (7427, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012738.jpg', 'Sunset', 6,'Walt moves into new digs and a distraught Walter Jr. demands to know just where his parents relationship stands. Meanwhile, Hanks investigation is beginning to hit too close to home for Walt, causing serious concerns for him and Jesse.',38);
insert into EPISODIO_ENTITY values (7428, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012739.jpg', 'One Minute', 7,'Hanks behavior becomes increasingly more unpredictable and volatile, which leads to a confrontation with Jesse and problems at the DEA; Skyler wants Walt to make a deal; and Gus decisions result in some serious consequences.',38);
insert into EPISODIO_ENTITY values (7429, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012740.jpg', 'I See You', 8,'The White and Schrader families anxiously await word on Hanks condition. Meanwhile, Jesse takes care of business at the lab while Walt tries to make peace with Gus, but after witnessing a terrifying flash of anger, Walt starts to fear for his and his familys lives.',38);
insert into EPISODIO_ENTITY values (7430, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012741.jpg', 'Kafkaesque', 9,'Hanks stay in the hospital is accompanied by some daunting bills, but Skyler thinks she has a way of dealing with them. Meanwhile, some of the problems between Walt and Gus are ameliorated; and Jesse seeks more independence and grabs a profitable opportunity that presents itself.',38);
insert into EPISODIO_ENTITY values (7431, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012742.jpg', 'Fly', 10,'When Walt becomes driven to distraction by a contaminant in the lab, he refuses to cook meth until they are able to get rid of it.',38);
insert into EPISODIO_ENTITY values (7432, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012743.jpg', 'Abiquiu', 11,'Skylers increased involvement in Walts business causes him concern; Hanks recovery is plagued by setbacks; and Jesse makes a surprising discovery as he gets more involved in his new enterprise.',38);
insert into EPISODIO_ENTITY values (7433, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012744.jpg', 'Half Measures', 12,'Jesse ignores Walts advice and finds himself in a dangerous situation. Fearing for Jesses safety, Walt takes drastic measures to try to put things right. And tragedy strikes following an unexpected confrontation.',38);
insert into EPISODIO_ENTITY values (7434, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012745.jpg', 'Full Measure', 13,'Jesse goes on the lam in the third-season finale. But Mike is right on his heels, so Walt works a deal with Gus and comes up with an unsettling plan that might help guarantee both his and Jesses safety.',38);
insert into EPISODIO_ENTITY values (7435, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012751.jpg', 'Box Cutter', 1,'In the Season 4 opener, Walt and Jesse are confronted by the life-threatening consequences of their actions. Meanwhile, Skyler contends with a puzzling disappearance, and Marie finds it difficult to help a recovering Hank.',38);
insert into EPISODIO_ENTITY values (7436, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012752.jpg', 'Thirty-Eight Snub', 2,'Walt tries to establish a new alliance as he plots his next move. Meanwhile, Skyler urges Walt to consider a business opportunity that could keep the family safe.',38);
insert into EPISODIO_ENTITY values (7437, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012753.jpg', 'Open House', 3,'Goings-on at Jesses place start to get out of control; Skyler reluctantly turns to Saul for help; Marie settles back into an old habit; and Hank hears from an old friend who needs assistance.',38);
insert into EPISODIO_ENTITY values (7438, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012754.jpg', 'Bullet Points', 4,'The Cartel makes a power move; Skyler and Walt reveal something embarrassing to the family; and Jesses misdeeds bring some unwanted attention.',38);
insert into EPISODIO_ENTITY values (7439, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012755.jpg', 'Shotgun', 5,'Jesses disappearance leaves Walt fearing the worst; Skyler has a surprising reunion; and Hank gives Det. Roberts bad news.',38);
insert into EPISODIO_ENTITY values (7440, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012756.jpg', 'Cornered', 6,'A shocking discovery unsettles Skyler; Walter Jr. leans on his father to make a special purchase; Mike gets surprise help from Jesse.',38);
insert into EPISODIO_ENTITY values (7441, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012757.jpg', 'Problem Dog', 7,'A frustrated Walt takes on a risky gamble; Skyler encounters problems with her latest business venture; Hank requires Walter Jr.s services for an unusual reason.',38);
insert into EPISODIO_ENTITY values (7442, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012758.jpg', 'Hermanos', 8,'Skyler devises a plan to cure her money woes; Hank recruits Walt to help him work out a theory, while Walt grows impatient with Jesse.',38);
insert into EPISODIO_ENTITY values (7443, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012759.jpg', 'Bug', 9,'Mistakes from Skylers past prove to be impactful to the present; Gus is spurred to action against rivals; Jesse seeks help from Walt but the results are mixed.',38);
insert into EPISODIO_ENTITY values (7444, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012760.jpg', 'Salud', 10,'The family becomes gravely concerned when Walt doesnt show up for his sons 16th birthday celebration. And Jesses lab skills are tested in Walts absence.',38);
insert into EPISODIO_ENTITY values (7445, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012761.jpg', 'Crawl Space', 11,'Walt moves to protect his secret and Gus; Skyler is stymied in her attempt to help Ted with his financial problem.',38);
insert into EPISODIO_ENTITY values (7446, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012762.jpg', 'End Times', 12,'Hank leans on Gomez to explore one final lead, as Walt scrambles to protect his family. Meanwhile, Jesse learns some unsettling news and races to share it with Walt.',38);
insert into EPISODIO_ENTITY values (7447, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012763.jpg', 'Face Off', 13,'The fourth season ends with Walt and Jesse squaring off against Gus. Elsewhere, Walt acquires a surprise confederate with help from Saul.',38);
insert into EPISODIO_ENTITY values (7448, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012774.jpg', 'Live Free or Die', 1,'In the series 5 premiere, Walt deals with the aftermath of the explosion, while Hank wraps up his investigation of Gus and his criminal empire.',38);
insert into EPISODIO_ENTITY values (7449, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012775.jpg', 'Madrigal', 2,'Walt and Jesse seek out an unlikely partner for a new business venture. The DEA follows up new leads in its investigation.',38);
insert into EPISODIO_ENTITY values (7450, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012776.jpg', 'Hazard Pay', 3,'Walt and Jesse put a business plan into action. Walt confesses a secret to Marie.',38);
insert into EPISODIO_ENTITY values (7451, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012777.jpg', 'Fifty-One', 4,'Walt celebrates another birthday. Skyler considers her options. An associate complicates Walt and Jesses plan.',38);
insert into EPISODIO_ENTITY values (7452, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012778.jpg', 'Dead Freight', 5,'Walts team must get creative to obtain the materials they need to continue their operation.',38);
insert into EPISODIO_ENTITY values (7453, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012779.jpg', 'Buyout', 6,'Walt, Jesse, and Mike struggle over the future of their business, as occupational hazards weigh on Jesse.',38);
insert into EPISODIO_ENTITY values (7454, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012780.jpg', 'Say My Name', 7,'Walt takes control of business matters as Mike grapples with the consequences of his actions.',38);
insert into EPISODIO_ENTITY values (7455, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012781.jpg', 'Gliding Over All', 8,'Walt ties up loose ends. Seeing the evidence of his success, he makes a startling and dangerous decision.',38);
insert into EPISODIO_ENTITY values (7456, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012782.jpg', 'Blood Money', 9,'As Walt and Jesse adjust to life out of the business, Hank grapples with a troubling lead.',38);
insert into EPISODIO_ENTITY values (7457, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012783.jpg', 'Buried', 10,'While Skylers past catches up with her, Walt covers his tracks. Jesse continues to struggle with his guilt.',38);
insert into EPISODIO_ENTITY values (7458, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012784.jpg', 'Confessions', 11,'Jesse decides to make a change, while Walt and Skyler try to deal with an unexpected demand.',38);
insert into EPISODIO_ENTITY values (7459, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012785.jpg', 'Rabid Dog', 12,'An unusual strategy starts to bear fruit, while plans are set in motion that could change everything.',38);
insert into EPISODIO_ENTITY values (7460, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012786.jpg', 'Tohajiilee', 13,'Things heat up for Walt in unexpected ways.',38);
insert into EPISODIO_ENTITY values (7461, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012787.jpg', 'Ozymandias', 14,'Everyone copes with radically changed circumstances.',38);
insert into EPISODIO_ENTITY values (7462, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012788.jpg', 'Granite State', 15,'Events set in motion long ago move toward a conclusion.',38);
insert into EPISODIO_ENTITY values (7463, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/405/1012789.jpg', 'Felina', 16,'The acclaimed crime drama comes to a close in the series finale.',38);
