insert into EPISODIO_ENTITY values (7464, 50, 'https://static.tvmaze.com/uploads/images/medium_landscape/327/817543.jpg', 'Glorious Purpose', 1,'Loki, the God of Mischief, finds himself out of time and in an unusual place and forced — against his godly disposition — to cooperate with others. Welcome to the TVA, yall!',39);
insert into EPISODIO_ENTITY values (7465, 53, 'https://static.tvmaze.com/uploads/images/medium_landscape/329/823863.jpg', 'The Variant', 2,'Mobius puts Loki to work investigating The Variant, but not everyone at the TVA is thrilled to be working alongside The God of Mischief.',39);
insert into EPISODIO_ENTITY values (7466, 41, 'https://static.tvmaze.com/uploads/images/medium_landscape/332/831232.jpg', 'Lamentis', 3,'Loki finds himself trapped in an apocalypse with a dead TemPad and the last person he wants by his side: the Loki Variant, Sylvie. Now the two must find their way off of the doomed moon before complete annihilation.',39);
insert into EPISODIO_ENTITY values (7467, 48, 'https://static.tvmaze.com/uploads/images/medium_landscape/334/836858.jpg', 'The Nexus Event', 4,'Loki and Sylvie find their way off the Lamentis-1 mere moments before complete annihilation. Now, the question on everyones mind, especially those in charge of the TVA — how did these two variants create a Nexus Event in the face of an apocalypse?',39);
insert into EPISODIO_ENTITY values (7468, 48, 'https://static.tvmaze.com/uploads/images/medium_landscape/337/843491.jpg', 'Journey Into Mystery', 5,'Upon discovering the Time Keepers arent real, Judge Renslayer prunes Loki with the Time Stick. Now in an unknown land surrounded by variant Lokis, they urge him to follow them. Meanwhile, turning on the judge, Sylvie demands to be told everything about the TVA.',39);
insert into EPISODIO_ENTITY values (7469, 45, 'https://static.tvmaze.com/uploads/images/medium_landscape/339/849919.jpg', 'For All Time. Always.', 6,'Loki and Sylvie arrive the Citadel at the End of Time. Will they finally discover who is behind the Time Variance Authority?',39);
insert into EPISODIO_ENTITY values (7470, 48, 'https://static.tvmaze.com/uploads/images/medium_landscape/480/1202210.jpg', 'Ouroboros', 1,'Loki finds himself lost to time and torn, quite literally, between past, present and future.',39);
insert into EPISODIO_ENTITY values (7471, 52, 'https://static.tvmaze.com/uploads/images/medium_landscape/480/1202264.jpg', 'Breaking Brad', 2,'With the TVA on the verge of a temporal meltdown, Loki &amp; Mobius will stop at nothing to find Sylvie.',39);
insert into EPISODIO_ENTITY values (7472, 56, 'https://static.tvmaze.com/uploads/images/medium_landscape/482/1205174.jpg', '1893', 3,'Mobius go on the hunt to find everyones favorite cartoon clock as they try to save the TVA.',39);
insert into EPISODIO_ENTITY values (7473, 51, 'https://static.tvmaze.com/uploads/images/medium_landscape/483/1208748.jpg', 'Heart of the TVA', 4,'The TVAs Loom nears catastrophic failure but Loki, Mobius and Sylvie have a He Who Remains variant.',39);
insert into EPISODIO_ENTITY values (7474, 45, 'https://static.tvmaze.com/uploads/images/medium_landscape/484/1212376.jpg', 'Science/Fiction', 5,'Loki traverses dying timelines in attempt to find his friends, but Reality is not what it seems.',39);
insert into EPISODIO_ENTITY values (7475, 59, 'https://static.tvmaze.com/uploads/images/medium_landscape/485/1214953.jpg', 'Glorious Purpose', 6,'The clock is ticking in the season finale which finds Loki and Sylvie on a date with destiny.',39);
