insert into SERIE_ENTITY  values (40, 2019,'https://static.tvmaze.com/uploads/images/medium_portrait/445/1113531.jpg', 'The Boys', 'In a world where superheroes embrace the darker side of their massive celebrity and fame, The Boys centres on a group of vigilantes known informally as "The Boys," who set out to take down corrupt superheroes with no more than blue collar grit and a willingness to fight dirty.','https://wallpapercosmos.com/w/full/1/9/a/16154-3840x2160-desktop-4k-the-boys-background.jpg');
