insert into EPISODIO_ENTITY values (7476, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/206/515724.jpg', 'The Name of the Game', 1,'In a world where super-powered "Supes" exist and can do whatever they want with the help of the corporation that supports them, normal men are powerless. But one man, Hughie Campbell, vows to fight back after a Supe accidentally kills his girlfriend. A shadowy figure, Billy Butcher, contacts Hughie and recruits the younger man to help him.',40);
insert into EPISODIO_ENTITY values (7477, 59, 'https://static.tvmaze.com/uploads/images/medium_landscape/206/515781.jpg', 'Cherry', 2,'Billy goes to a "top man" to figure out how to deal with Translucents impenetrable skin. Madelyn seeks leverage on a Senate committee chairman, and Homelander begins acting on his own.',40);
insert into EPISODIO_ENTITY values (7478, 55, 'https://static.tvmaze.com/uploads/images/medium_landscape/206/515785.jpg', 'Get Some', 3,'Billy recruits another former member of the team, and looks Homelander in the eye. A-Train races Shockwave, and the team get a lead on where A-Train keeps his Compound V.',40);
insert into EPISODIO_ENTITY values (7479, 57, 'https://static.tvmaze.com/uploads/images/medium_landscape/206/515787.jpg', 'The Female of the Species', 4,'While Billy, Mothers Milk, and Frenchie track down A-Trains V connection and meet the Woman, Hughie goes on a date with Annie. The Deep self-actualizes and makes a friend, and Homelander and Maeve go after hijackers.',40);
insert into EPISODIO_ENTITY values (7480, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/206/515901.jpg', 'Good for the Soul', 5,'At the Believe Expo, Homelander and Starlight both go off script and Madelyn isnt happy. Hughie recruits an unwitting Starlight to get close to Ezekiel so he can blackmail the Supe into telling him about V, and Billy and Milk get an eyeful when they learn how Supes are created.',40);
insert into EPISODIO_ENTITY values (7481, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/206/515951.jpg', 'The Innocents', 6,'Mothers Milk finds a Supe who can read the Womans mind and find out her backstory. Vought forces the Deep to go public about his sexual harassment of Starlight, and Annie and Hughie make plans for a trip to the Bahamas.',40);
insert into EPISODIO_ENTITY values (7482, 56, 'https://static.tvmaze.com/uploads/images/medium_landscape/206/515954.jpg', 'The Self-Preservation Society', 7,'Billy has a meeting of minds with Mesmer after learning that he burned the Boys. The Deep adjusts to life in Sandusky, and Starlight learns the truth about Hughie.',40);
insert into EPISODIO_ENTITY values (7483, 67, 'https://static.tvmaze.com/uploads/images/medium_landscape/206/515956.jpg', 'You Found Me', 8,'The Deep has a close shave in Sandusky, Hughie and Annie have an argument, Frenchie, Mothers Milk, and Kimiko are captured, and Billy strikes back against Homelander the only way he can.',40);
insert into EPISODIO_ENTITY values (7484, 63, 'https://static.tvmaze.com/uploads/images/medium_landscape/271/678566.jpg', 'The Big Ride', 1,'Season 2! New and improved! Now with 50% more explosive decapitations, terrorists, S&amp;M hookers, cults, and a new pine fresh scent! But wait, theres more! 2X MORE blood, guts and gore than the other leading brands! This exclusive offer is available only on Amazon Prime Video! Dont delay! Order now!With Butcher still missing, Hughie, Mothers Milk, Frenchie, and Kimiko are now fugitives, and Homelander and Vought are more powerful than ever. But just as the Boys are about to leave the country, they are pulled back into the fray.',40);
insert into EPISODIO_ENTITY values (7485, 59, 'https://static.tvmaze.com/uploads/images/medium_landscape/271/678565.jpg', 'Proper Preparation and Planning', 2,'The Boys get themselves a Super Terrorist, Starlight gets evidence against Vought, The Deep gets in touch with his feelings, and Homelander gets himself a family (sort of).  All that, and a hard-hitting exposé on why Super Suits dont have pockets.',40);
insert into EPISODIO_ENTITY values (7486, 59, 'https://static.tvmaze.com/uploads/images/medium_landscape/271/678568.jpg', 'Over the Hill with the Swords of a Thousand Men', 3,'Attention: If you or a loved one were exposed to Compound V, you may be entitled to financial compensation. Vought has given the drug to multiple victims, without their knowledge or consent. If you believe that you or a loved one were administered Compound V, call the law firm of Bremmer &amp; Bremmer at 1-888-177-2774 for a free legal consultation. Know your rights!',40);
insert into EPISODIO_ENTITY values (7487, 68, 'https://static.tvmaze.com/uploads/images/medium_landscape/272/681739.jpg', 'Nothing Like It In the World', 4,'Road trip!  The Boys head to North Carolina to follow a lead on a mysterious Supe named Liberty.  And did you know a persons choice of candy bars might tell you if theyre a serial killer?  Watch and learn the warning signs!  This episode could save your life!',40);
insert into EPISODIO_ENTITY values (7488, 61, 'https://static.tvmaze.com/uploads/images/medium_landscape/273/684726.jpg', 'We Gotta Go Now', 5,'VoughtStudios is pleased to announce that filming has begun on #DawnOfTheSeven. 12 years of VCU movies have led to this. If you like movies about One Hero, youll love a movie about Seven Heroes. Introducing newest member @RealStormfront! See how the legend began! In theaters Summer 2021!',40);
insert into EPISODIO_ENTITY values (7489, 66, 'https://static.tvmaze.com/uploads/images/medium_landscape/275/687576.jpg', 'The Bloody Doors Off', 6,'When The Boys and Starlight follow a lead to Voughts mysterious Sage Grove Center, they find one of Voughts darkest secrets - and someone even darker from their past. Meanwhile Homelander and Stormfronts relationship deepens.',40);
insert into EPISODIO_ENTITY values (7490, 55, 'https://static.tvmaze.com/uploads/images/medium_landscape/276/690352.jpg', 'Butcher, Baker, Candlestick Maker', 7,'To help Victoria Neuman make a case against Vought, Mallory and The Boys look to an unlikely source for answers. Hughie gets terrifying news about Starlight. Meanwhile, Homelander and Stormfront further their master plan for Compound V.',40);
insert into EPISODIO_ENTITY values (7491, 68, 'https://static.tvmaze.com/uploads/images/medium_landscape/277/693203.jpg', 'What I Know', 8,'Becca shows up on Butchers doorstep and begs for his help. The Boys agree to back Butcher, and together with Starlight, they finally face off against Homelander and Stormfront. But things go very bad, very fast.',40);
insert into EPISODIO_ENTITY values (7492, 62, 'https://static.tvmaze.com/uploads/images/medium_landscape/411/1027562.jpg', 'Payback', 1,'You and a guest are invited to the premiere of DAWN OF THE SEVEN this Tuesday at 7PM in Vought Towers Lamplighter Memorial Theater! Screening will be followed by a Q&amp;A with director Adam Bourke and an after-party with Supe DJ Malchemical on the turntables! Join us for the greatest true origin story ever told about Americas number one Superhero team and see how the legend began!',40);
insert into EPISODIO_ENTITY values (7493, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/411/1027563.jpg', 'The Only Man in the Sky', 2,'Homelander. Americas greatest Superhero. Defending our shores from sea to shining sea. Today, America honors him on his birthday. And the Vought Shopping Network is celebrating by offering the exclusive Homelander Limited Birthday Edition Gold Coin for only $99.95 (plus tax and shipping) while supplies last. Vought Gold Commemorative Coins: An investment that lasts a lifetime.',40);
insert into EPISODIO_ENTITY values (7494, 61, 'https://static.tvmaze.com/uploads/images/medium_landscape/411/1027564.jpg', 'Barbary Coast', 3,'Tonight at 9/8C on Vought Plus, its the season finale of #AmericanHero! Three contestants remain, but only TWO will join #TheSeven! Will Starlight choose her old flame Supersonic? Or will someone else be moving into the Seven Tower? Tune in tonight for the SHOCKING final episode, brought to you by Lean Lady Frozen Dinners by Vought: Where slim tastes super!',40);
insert into EPISODIO_ENTITY values (7495, 61, 'https://static.tvmaze.com/uploads/images/medium_landscape/412/1031452.jpg', 'Glorious Five Year Plan', 4,'Tonight, streaming live exclusively for Supeporn.com Super-Subscribers, its the #ClashOfTheDildos! Which of The Seven-inspired dildos will crush the competition in this tip-to-tip challenge? Will it be the reigning champion Homelander Star-Spangled Banger or Starlights electrified Star-Brator? Join us as we put these pleasure-pounding penetrators through their paces! Only on Supeporn.com!',40);
insert into EPISODIO_ENTITY values (7496, 61, 'https://static.tvmaze.com/uploads/images/medium_landscape/413/1032932.jpg', 'The Last Time to Look on This World of Lies', 5,'Did you know chimpanzees are an endangered species largely because of human activity? But you can help by supporting construction costs for Crimson Countesss Chimp Country! This beautiful refuge for chimpanzees will feature a banana plantation, four daily stunt shows, and a petting zoo! And when you donate, youll be entered to win a private video chat with Crimson Countess! Donate today!',40);
insert into EPISODIO_ENTITY values (7497, 61, 'https://static.tvmaze.com/uploads/images/medium_landscape/413/1034375.jpg', 'Herogasm', 6,'Youre invited to the 70th Annual Herogasm! You must present this invitation in order to be admitted! Same rules as always: no cameras, no non-Supe guests unless they sign an NDA and theyre DTF, and no telling any news media! Its BYOD, but food, alcohol and lube will be provided! And please remember to RSVP so we can get an accurate headcount for the caterer!',40);
insert into EPISODIO_ENTITY values (7498, 65, 'https://static.tvmaze.com/uploads/images/medium_landscape/414/1036337.jpg', 'Here Comes a Candle to Light You to Bed', 7,'Did someone say birthday? Come celebrate at Buster Beavers with our new Deluxe VIP Birthday Package, with seating for up to 30 guests, ten large two-topping pizzas, and ten pitchers of your choice of soda! And of course, a special birthday play starring Buster Beaver and his cast of furry forest friends! All for only $199.99 + tax! Buster Beavers Pizza! Where Kids Make the Rules®!',40);
insert into EPISODIO_ENTITY values (7499, 62, 'https://static.tvmaze.com/uploads/images/medium_landscape/415/1037854.jpg', 'The Instant White-Hot Wild', 8,'Calling all patriots! Lets show Homelander weve got his back and were not going to let Starlight and her Starlight House of Horrors get away with trafficking children and drinking their adrenaline! Its time for real Americans to fight back! Join the Hometeamers and Stormchasers tomorrow at Vought Square! Stand back and stand by!',40);
