insert into PARTICIPANTE_ENTITY values (493, 'He is a Japanese anime animator and director. Since 2011 he is the director of the Trigger studio. His style is based on speed and successions of many and varied movements to give a greater touch of action to his creations and to make them more real and impressive, inspired by the style of Yoshinori Kanada.', 'https://images.mubicdn.net/images/cast_member/78392/cache-83747-1376474971/image-w856.jpg?size=800x', 'Hiroyuki Imaishi');
insert into SERIE_ENTITY_DIRECTORES values (41, 493);
insert into SERIE_ENTITY  values (42, 2014,'https://static.tvmaze.com/uploads/images/medium_portrait/189/474715.jpg', 'Gotham', 'The good. The evil. The beginning.Everyone knows the name Commissioner Gordon. He is one of the crime worlds greatest foes, a man whose reputation is synonymous with law and order. But what is known of Gordons story and his rise from rookie detective to Police Commissioner? What did it take to navigate the multiple layers of corruption that secretly ruled Gotham City, the spawning ground of the worlds most iconic villains? And what circumstances created them – the larger-than-life personas who would become Catwoman, The Penguin, The Riddler, Two-Face and The Joker?Gotham is an origin story of the great DC Comics Super-Villains and vigilantes, revealing an entirely new chapter that has never been told. It follows one cops rise through a dangerously corrupt city teetering between good and evil, and chronicles the birth of one of the most popular super heroes of our time.','https://wallpapers.com/images/featured/gotham-r0azg7309yv4nj3l.jpg');
insert into SERIE_ENTITY_PLATAFORMAS  values (42, 4);
insert into SERIE_ENTITY_CATEGORIAS values (42, 4);
insert into SERIE_ENTITY_CATEGORIAS values (42, 2);
insert into SERIE_ENTITY_CATEGORIAS values (42, 12);
insert into EPISODIO_ENTITY values (7524, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/0/1148.jpg', 'Pilot', 1,'Lt. Jim Gordon tries to deal with the corruption in his new home of Gotham, but his partner Harvey Bullock isnt interested. Their first case is investigating the shooting deaths of one of Gothams wealthiest couples, the Waynes.',42);
insert into EPISODIO_ENTITY values (7525, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/0/1149.jpg', 'Selina Kyle', 2,'Jim and Harvey investigate a child-trafficking ring, while Oswald returns to Gotham vowing revenge.',42);
insert into EPISODIO_ENTITY values (7526, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/0/1150.jpg', 'The Balloonman', 3,'A vigilante targets the corrupt by sending them into the stratosphere. Oswald tries to use Carmines rival to get revenge on Carmine, and someone tries to turn Barbara against Jim.',42);
insert into EPISODIO_ENTITY values (7527, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/0/1151.jpg', 'Arkham', 4,'Someone hires a hitman to target city council members deciding the fate of Arkham. Oswald continues using Maroni to get at Carmine.',42);
insert into EPISODIO_ENTITY values (7528, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/1/4839.jpg', 'Viper', 5,'Jim and Harvey try to track down a new street drug, while Oswald and Fish both continue their plots against Carmine. Bruce continues searching for his parents killer.',42);
insert into EPISODIO_ENTITY values (7529, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/2/6106.jpg', 'Spirit of the Goat', 6,'A seemingly dead serial killer, the Goat, rises to kill more firstborn sons of wealth and privilege. Oswald pays his mother Gertrud a visit, and Edward makes a friend.',42);
insert into EPISODIO_ENTITY values (7530, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/3/7677.jpg', 'Penguins Umbrella', 7,'Jim tries to bring Mayor James and Falcone to justice for the Waynes murder. Maroni defies Carmine, and hitman Victor Zsasz pays Jim a visit.',42);
insert into EPISODIO_ENTITY values (7531, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/10277.jpg', 'The Mask', 8,'A financial CEO runs a fight club among his employees, and Jim and Harvey find out about it. Alfred helps Bruce when he returns to school and finds his classmates less than sympathetic toward his plight.',42);
insert into EPISODIO_ENTITY values (7532, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/11191.jpg', 'Harvey Dent', 9,'DA Harvey Dent tries to close the Waynes murder case with Jims help. Meanwhile, Oswald finds out who Fish has on the inside of the Falcone operation.',42);
insert into EPISODIO_ENTITY values (7533, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/5/12559.jpg', 'LoveCraft', 10,'Bruce trains with Selina, and an assassin comes after the girl. Jim learns about it, while Alfred and Harvey go after the teenagers when they flee the city to avoid the killer.',42);
insert into EPISODIO_ENTITY values (7534, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/7/18709.jpg', 'Rogues Gallery', 11,'After Jim is reassigned to Arkham, he looks into a guards murder. Selina takes Ivy to Jims apartment and finds an unexpected ally.',42);
insert into EPISODIO_ENTITY values (7535, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/7/19555.jpg', 'What the Little Bird Told Him', 12,'Jim hunts a self-styled "Electrocutioner", and Fish tries to take down Carmine.',42);
insert into EPISODIO_ENTITY values (7536, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/7/19847.jpg', 'Welcome Back, Jim Gordon', 13,'Jim is reinstated but forced to turn to Oswald for help when he goes after a mole in the police. Bruce looks for Selina, and Oswald tries to impress Gertrud.',42);
insert into EPISODIO_ENTITY values (7537, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/8/20247.jpg', 'The Fearsome Dr. Crane', 14,'Jim and Harvey investigate a new killer who uses his victims worst fears against them. Edward gets a job notice, and Fish gets revenge on the person who betrayed her by telling Maroni who it was.',42);
insert into EPISODIO_ENTITY values (7538, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/8/21389.jpg', 'The Scarecrow', 15,'Jim and Harvey continue their search for the fear-based serial killer, Carmine makes a request of Maroni, and Bruce goes for his annual hike alone for the first time.',42);
insert into EPISODIO_ENTITY values (7539, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/8/21773.jpg', 'The Blind Fortune Teller', 16,'Jim and Leslie go to the circus, Oswald gets a new employee, and Barbara gets new roommates.',42);
insert into EPISODIO_ENTITY values (7540, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/8/22213.jpg', 'Red Hood', 17,'Bank robbers wear red hoods to stay anonymous, baffling Jim and Harveys efforts to bring them in. Barbara tries to become Selinas friend, and Fish tries to negotiate her release.',42);
insert into EPISODIO_ENTITY values (7541, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/9/22811.jpg', 'Everyone Has a Cobblepot', 18,'Bruce and Alfred deal with the attack on Alfred. Selina offers her help to Bruce, and Jim tries to help Harvey who is in over his head.',42);
insert into EPISODIO_ENTITY values (7542, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/10/25551.jpg', 'Beasts of Prey', 19,'While Bruce and Selina track down Reggie, Jim and Harvey investigate the Ogre, and Fish tries to escape the Dollmaker.',42);
insert into EPISODIO_ENTITY values (7543, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/10/26059.jpg', 'Under the Knife', 20,'Jim and Harvey continue pursuing the Ogre, Maroni visits Gertrud, and Edward defends Kristen.',42);
insert into EPISODIO_ENTITY values (7544, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/10/26515.jpg', 'The Anvil or the Hammer', 21,'Jim discovers that someone close to him is involved with the Ogre. Oswald tries to gain control of the Gotham underworld, and Bruce closes in on the person responsible for his parents deaths.',42);
insert into EPISODIO_ENTITY values (7545, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/10/26891.jpg', 'All Happy Families Are Alike', 22,'The mob war that Oswald has engineered between Falcone and Maroni comes to a startling conclusion when Fish returns from the dead. Meanwhile, Bruce finds his fathers secret, and Barbara and Leslie have a heart-to-heart chat.',42);
insert into EPISODIO_ENTITY values (7546, 45, 'https://static.tvmaze.com/uploads/images/medium_landscape/19/49823.jpg', 'Rise of the Villains: Damned If You Do', 1,'While Bruce continues to try and penetrate his fathers vault, Loeb fires Jim from the force... and Jim takes extreme measures to get reinstated. Meanwhile, Barbara settles in to life at Arkham Asylum and makes several new friends.',42);
insert into EPISODIO_ENTITY values (7547, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/21/53818.jpg', 'Rise of the Villains: Knock Knock', 2,'Theo sends his team of Maniax out on a new assignment, but its only the prelude to something much larger and bloodier. Meanwhile, Alfred tries to protect Bruce, and turns to Lucius Fox for help.',42);
insert into EPISODIO_ENTITY values (7548, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/22/57203.jpg', 'Rise of the Villains: The Last Laugh', 3,'Jim is reluctant to turn to Oswald for help, so Harvey pays the new crime boss a visit. Meanwhile, Jerome poses as a magician to infiltrate a childrens hospital benefit, but discovers that Theo has other plans in store for him.',42);
insert into EPISODIO_ENTITY values (7549, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/23/59296.jpg', 'Rise of the Villains: Strike Force', 4,'The GCPD gets a new captain and he immediately cleans house and brings on Jim as his second-in-command... unaware of Jims background with the Penguin. Meanwhile, Theo asks the Penguin for a favor, and Bruce and Theo have lunch.',42);
insert into EPISODIO_ENTITY values (7550, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/63177.jpg', 'Rise of the Villains: Scarification', 5,'Theo forces Oswald to hire the Pike Brothers to torch select buildings in Gotham, and the Pikes use their sister Bridgit. Meanwhile, Theo asks Jim for his endorsement, Oswald orders Butch to lend a hand, and Leslie invites Edward and Kristen over for fondue.',42);
insert into EPISODIO_ENTITY values (7551, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/26/65830.jpg', 'Rise of the Villains: By Fire', 6,'Jim promises Selina to keep the new Firefly safe, but discovers that the girl doesnt want to turn herself in. Meanwhile, Theo and Silver invite Bruce to dinner, Edward tells Kirsten the truth, and Butch finds out where Gertrude is imprisoned.',42);
insert into EPISODIO_ENTITY values (7552, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/27/68906.jpg', 'Rise of the Villains: Mommys Little Monster', 7,'Jim begins to realize that Theo has orchestrated everything to become mayor. Meanwhile, Oswald swears revenge on the man who killed his mother, and Edward tries to cover up Kristens death but faces an opponent that knows his every move.',42);
insert into EPISODIO_ENTITY values (7553, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/29/72862.jpg', 'Rise of the Villains: Tonights the Night', 8,'While Theo tries to convince Bruce to sign over Wayne Enterprises to him, he sends Barbara as a distraction to keep Jim occupied. Meanwhile, Edward has one last picnic lunch with Kirsten before disposing of her body, and ends up meeting a familiar figure.',42);
insert into EPISODIO_ENTITY values (7554, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/30/76198.jpg', 'Rise of the Villains: A Bitter Pill to Swallow', 9,'While Jim and Barnes takes on hit men sent to kill Jim, Edward convinces Oswald that he has something to live for in Gotham. Meanwhile, Alfred forbids Bruce from seeing Silver again, even though she may hold the key to finding out whose his parents killer was.',42);
insert into EPISODIO_ENTITY values (7555, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/31/79369.jpg', 'Rise of the Villains: The Son of Gotham', 10,'While Jim and Harvey try to track down the elusive monks performing blood sacrifices, Bruce proposes a new deal with Silver to find out the name of his parents killers. Meanwhile, Edward gets used to having a roommate.',42);
insert into EPISODIO_ENTITY values (7556, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/32/81950.jpg', 'Rise of the Villains: Worse Than a Crime', 11,'Jim discovers that the Order of Dumas is prepared to sacrifice Bruce at midnight, and turns to Oswald for help. Meanwhile, Leslie gives Jim startling news, Tabitha comes to a decision about her brother, and a new vigilante stalks the streets of Gotham.',42);
insert into EPISODIO_ENTITY values (7557, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/33/84419.jpg', 'Wrath of the Villains: Mr. Freeze', 12,'A new killer stalks the streets of Gotham, freezing victims with liquid helium for his experiments in cyrogenic reanimation. Meanwhile, Jim goes before the board for his actions in taking down Theo, and a captured Oswald is sentenced to Arkham.',42);
insert into EPISODIO_ENTITY values (7558, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/44/111441.jpg', 'Wrath of the Villains: A Dead Man Feels No Cold', 13,'The GCPD take Nora to Arkham when her condition worsens, and Victor breaks into the asylum in his new guise as Mr. Freeze. Meanwhile, Oswald undergoes extreme treatment at Hugos hands, and Alfred finds the mysterious M. Malone that killed Bruces parents.',42);
insert into EPISODIO_ENTITY values (7559, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/47/118491.jpg', 'Wrath of the Villains: This Ball of Mud and Meanness', 14,'While Hugo continues Oswalds treatment at Arkham, Bruce goes on a hunt for his parents killer.',42);
insert into EPISODIO_ENTITY values (7560, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/48/120237.jpg', 'Wrath of the Villains: Mad Grey Dawn', 15,'Jim and Harvey try to track down a bomber who leaves riddles to his crimes. Meanwhile, Oswald pays old friends a visit and is reunited with the father and family that he never knew.',42);
insert into EPISODIO_ENTITY values (7561, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/48/121634.jpg', 'Wrath of the Villains: Prisoners', 16,'While Jim adjusts to life in prison, Harvey makes plans to break his friend out. Meanwhile, Oswald adjusts to family life but discovers that his new relatives have other plans.',42);
insert into EPISODIO_ENTITY values (7562, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/51/127709.jpg', 'Wrath of the Villains: Into the Woods', 17,'Jim discovers who framed him, but it may cost him his life. Meanwhile, Alfred gives Bruce an ultimatum, and Hugo releases Barbara from Arkham.',42);
insert into EPISODIO_ENTITY values (7563, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/52/131696.jpg', 'Wrath of the Villains: Pinewood', 18,'Bruce decrypts some of his fathers computer files and learns of the mysterious Pinewood Project. While he and Alfred investigate, Barbara offers to help Jim find the mysterious Philosopher.',42);
insert into EPISODIO_ENTITY values (7564, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/55/139289.jpg', 'Wrath of the Villains: Azrael', 19,'Hugo figures out the key to controlling the resurrected Theo and sends him forth as... Azrael. Meanwhile, Jim tries to convince Barnes that Hugo is responsible for creating monsters, and Bruce begins to learn that the law is insufficient to deal with the threats to Gotham.',42);
insert into EPISODIO_ENTITY values (7565, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142483.jpg', 'Wrath of the Villains: Unleashed', 20,'Bruce convinces Selina to break into Arkham and rescue her friend Bridgit, and along the way Selina encounters an escaping Edward. Meanwhile, the manhunt for Azrael continues and Tabitha agrees to help Jim and Harvey track her brother down.',42);
insert into EPISODIO_ENTITY values (7566, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142480.jpg', 'Wrath of the Villains: A Legion of Horribles', 21,'Bruce, Jim, and Lucius sneak into Arkham to try and find Selena, but Hugo realizes what theyre up to and captures them. Meanwhile, Selena offers herself as a servant to Firefly, and Alfred turns to Harvey for help.',42);
insert into EPISODIO_ENTITY values (7567, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/59/148353.jpg', 'Wrath of the Villains: Transference', 22,'Hugo is ordered to destroy Arkham to cover the councils tracks, but Fishs efforts to escape complicate things. Meanwhile, Basil distracts Harvey from investigating Arkham, and Bruce and Lucius fail Edwards quiz.',42);
insert into EPISODIO_ENTITY values (7568, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/75/189324.jpg', 'Mad City: Better to Reign in Hell...', 1,'Six months after the Indian Hill escape, Jim is working as a bounty hunter in Gotham. He teams up with reporter Valerie Vale to track down Fish and her new gang of escapees... all of whom have superpowers. Meanwhile, Bruce and Alfred return from Switzerland to confront the Wayne Enterprises board, and Selina falls in with the wrong crowd.',42);
insert into EPISODIO_ENTITY values (7569, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/76/192058.jpg', 'Mad City: Burn the Witch', 2,'Fish takes control of Harvey and tracks down Hugo, demanding a cure to her condition. Meanwhile, Oswald rallies the citizens against the "monsters" in their midst, and Jim and Barnes are forced to ally to save Harvey.',42);
insert into EPISODIO_ENTITY values (7570, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/78/195625.jpg', 'Mad City: Look Into My Eyes', 3,'Hypnotist Jervis Tetch comes to Gotham looking for his sister Alice, and hires Jim to find her. However, Jervis has some secrets of his own that he doesnt want anyone to find out. Meanwhile, Oswald announces his candidacy for mayor while Jim meets Lees fiance.',42);
insert into EPISODIO_ENTITY values (7571, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/79/198519.jpg', 'Mad City: New Day Rising', 4,'Bruce and Alfred look for the missing Five, and the trail leads to Selina. Meanwhile, Jervis goes to extreme lengths to recover his sister Alice, and Edward takes extreme steps to convince Oswald how popular he is.',42);
insert into EPISODIO_ENTITY values (7572, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/80/201834.jpg', 'Mad City: Anything for You', 5,'Bruce asks Jim to help find Ivy, while Oswald finds his mayorship threatened when the Red Hood Gang launch a new series of attacks.',42);
insert into EPISODIO_ENTITY values (7573, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/81/204693.jpg', 'Mad City: Follow the White Rabbit', 6,'Jervis forces Jim to choose between the two women that he loves, leading Jim through a maze of tests to determine if he can pick who will live and who will die.',42);
insert into EPISODIO_ENTITY values (7574, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/82/207459.jpg', 'Mad City: Red Queen', 7,'Jervis doses Jim with a powerful hallucinogenic that will burn out his brain, and forces Jim to face some hard truths. Meanwhile, Oswald tries to break up Edward and Isabella, and Bruce has Selina over for dinner.',42);
insert into EPISODIO_ENTITY values (7575, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/83/209851.jpg', 'Mad City: Blood Rush', 8,'The virus begins to consume Barnes, bringing out his inner rage at the guilty. Meanwhile, Jims first case after he rejoins the GCPD involves him trying to find a killer... unaware that his captain is responsible. And Isabella puts Edwards sanity to the test, unaware that Oswald has his own plans.',42);
insert into EPISODIO_ENTITY values (7576, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/84/212199.jpg', 'Mad City: The Executioner', 9,'Barnes attempts to recruit Jim to his new crusade. Meanwhile, Edward realizes that someone murdered Isabella and confronts Oswald with what hes learned. On the streets, Ivy turns to Selina and Bruce for help after she steals a necklace.',42);
insert into EPISODIO_ENTITY values (7577, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/85/214457.jpg', 'Mad City: Time Bomb', 10,'Someone tries to kill Carmine, but Jim suspects that theres more going on. Meanwhile, Edward goes after the man he believes killed Isabella, and Bruce makes a deal with a faction opposed to the Court of Owls.',42);
insert into EPISODIO_ENTITY values (7578, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/87/217818.jpg', 'Mad City: Beware the Green-Eyed Monster', 11,'Barbara forges a fragile alliance to gain control of the Gotham underworld.. Meanwhile, Jim suspects that Mario is infected with the Tetch virus and tries to stop his marriage to Lee before its too late.And Bruce, Selina, and Alfred break into the Court of Owls building to acquire the weapon they need to destroy the organization.',42);
insert into EPISODIO_ENTITY values (7579, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/93/234345.jpg', 'Mad City: Ghosts', 12,'Carmine orders a hit on Jim after Jim is forced to kill Mario. Meanwhile, a follower plans the resurrection of one of Gothams greatest criminals, and Oswalds facade starts to slip after he sees his fathers ghost.',42);
insert into EPISODIO_ENTITY values (7580, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/94/236453.jpg', 'Mad City: Smile Like You Mean It', 13,'When hes unable to resurrect Jerome, Dwight cuts off his face and tries to lead the cult. Meanwhile, Lee reveals a darker side, while Barbara and Tabitha continue to undermine Oswald while following Edwards plan.',42);
insert into EPISODIO_ENTITY values (7581, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/94/237347.jpg', 'Mad City: The Gentle Art of Making Enemies', 14,'Jerome and his acolytes run wild across a darkened Gotham, and Jerome abducts Bruce. Meanwhile, Oswald confronts Edward and the Court begins its move to take control of the city.',42);
insert into EPISODIO_ENTITY values (7582, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/108/271662.jpg', 'Heroes Rise: How the Riddler Got His Name', 15,'Edward goes on a killing spree to discover who he is without Oswald. Meanwhile, Frank tells Jim about the Court of Owls, and Bruce tries to reconnect with Selina.',42);
insert into EPISODIO_ENTITY values (7583, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/110/275022.jpg', 'Heroes Rise: These Delicate and Dark Obsessions', 16,'Jim discovers who ordered his father killed. Meanwhile, Oswald learns the loyalty of his minions, and a Shaman tries to help Bruce overcome the pain of his parents deaths.',42);
insert into EPISODIO_ENTITY values (7584, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/110/277386.jpg', 'Heroes Rise: The Primal Riddle', 17,'Oswald gathers the first two members of his army of freaks. meanwhile, Edward sets out to solve the riddle of the Court, and Bruce-2 warns Selina about the citys coming demise.',42);
insert into EPISODIO_ENTITY values (7585, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/112/280108.jpg', 'Heroes Rise: Light the Wick', 18,'The Court puts Hugo to work weaponizing the Tetch virus. Meanwhile, Jim tries to learn what the Court plans for Gotham, and the Shaman offers Bruce a release from his emotional pain.',42);
insert into EPISODIO_ENTITY values (7586, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/112/281148.jpg', 'Heroes Rise: All Will Be Judged', 19,'Jim and Harvey discover that Kathryn isnt the Courts leader. Meanwhile, Alfred learns that Bruce isnt who he believed him to be, and Lee realizes who is truly responsible for Marios death.',42);
insert into EPISODIO_ENTITY values (7587, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/112/281146.jpg', 'Heroes Rise: Pretty Hate Machine', 20,'Edward puts pressure on Selina to find out where Oswald is hiding. Meanwhile, Jim confronts the infected Lee, who sets him up so that he must make a terrible choice if he wants to save the citizens of Gotham from the Tetch virus.',42);
insert into EPISODIO_ENTITY values (7588, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/115/288684.jpg', 'Heroes Rise: Destiny Calling', 21,'Gotham descends into chaos after the spread of the virus. Jim fights for control as he and Harvey try to locate Lee. Meanwhile, Barbara convinces Edward to help her take control of Gotham by obtaining the antidote, only to find Fish and Oswald opposing her.',42);
insert into EPISODIO_ENTITY values (7589, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/115/288695.jpg', 'Heroes Rise: Heavydirtysoul', 22,'Bruce kills Alfred and Ras promises that they will meet again. Meanwhile, Jim and Harvey make a desperate trade with Edward to get what they need for the antidote, and Butch and Tabitha turn against Barbara.',42);
insert into EPISODIO_ENTITY values (7590, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/128/321423.jpg', 'A Dark Knight: Pax Penguina', 1,'Oswald controls Gotham by handing out licenses to criminals and lowering the crime rate. Meanwhile, Bruce continues his field training by preying on criminals, and Harvey tells Jim in no uncertain terms to let the licensed criminals go free. And a new gang tries to undermine Oswald by breaking Jonathan Crane out of Arkham and using his fathers fear gas formula.',42);
insert into EPISODIO_ENTITY values (7591, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/129/323320.jpg', 'A Dark Knight: The Fear Reaper', 2,'Bruces efforts in fighting crime prove less than successful until Lucius steps in. Meanwhile, Jonathan Crane goes on a rampage through Arkham as the Scarecrow, and Jim goes in alone to stop him. Elsewhere, Tabitha and Selina receive an invitation to join a new criminal enterprise.',42);
insert into EPISODIO_ENTITY values (7592, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/130/325442.jpg', 'A Dark Knight: They Who Hide Behind Masks', 3,'Jim acquires an unexpected ally when he travels to Miami to get Carmine to help him against Oswald. Meanwhile, Oswald ships an antique knife into the city and several interested parties seek to obtain it.',42);
insert into EPISODIO_ENTITY values (7593, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/131/327651.jpg', 'A Dark Knight: The Demons Head', 4,'Bruce goes to a museum curator for information on the knife, but the man is soon killed and his grandson goes on the run. Meanwhile, Edward tries to come up with a riddle worthy of his nemesis, but things dont go as planned.',42);
insert into EPISODIO_ENTITY values (7594, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/131/329781.jpg', 'A Dark Knight: The Blades Path', 5,'After six months in a coma, Butch is exposed to Indian Hills chemicals and transformed into a man-monster. Meanwhile, Bruce seeks out Ras, and Sofia tries to make amends with Oswald.',42);
insert into EPISODIO_ENTITY values (7595, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/132/331916.jpg', 'A Dark Knight: Hog Day Afternoon', 6,'A serial killer goes after crooked cops, putting pig masks on their corpses. Jim and Harvey hunt him down once they realize who his targets are. Meanwhile, Oswald suspects that Sofia is preparing to betray him, and Edward asks Lee for help.',42);
insert into EPISODIO_ENTITY values (7596, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/133/334317.jpg', 'A Dark Knight: A Day in the Narrows', 7,'The hunt continues for Pyg, who abducts three cops. Meanwhile, Bruce receives an invitation from a former classmate, and Selina sets out to prove she and Tabitha can still serve a role in Barbaras organization.',42);
insert into EPISODIO_ENTITY values (7597, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/134/336175.jpg', 'A Dark Knight: Stop Hitting Yourself', 8,'When Oswald learns that Edward is mocking him on stage at Cherrys, he tells the Sirens to bring Edward to him. However, Grundy protects Edward until Tabitha reminds him of who he was. Meanwhile, Jim receives an offer from the mayor and has to consider whether to go against Harvey or not... and what it will cost him.',42);
insert into EPISODIO_ENTITY values (7598, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/135/338529.jpg', 'A Dark Knight: Let Them Eat Pie', 9,'Professor Pyg continues to torment Gotham city, involving Jim Gordon whenever possible. Sofia and Penguin get ready for a fundraiser for the orphanage, and things dont go as planned when Professor Pyg shows up as the chef. Meanwhile, Bruces partying gets in the way of his relationship with Alfred.',42);
insert into EPISODIO_ENTITY values (7599, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/137/342561.jpg', 'A Dark Knight: Things That Go Boom', 10,'After learning that Jim and Sofia are involved, Oswald prepares to torture Sofia for information about her plans. Meanwhile, Lee and Edward pay a visit to a gangster trying to move in on the Narrows.',42);
insert into EPISODIO_ENTITY values (7600, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/137/344499.jpg', 'A Dark Knight: Queen Takes Knight', 11,'Jim tries to stop the war between Oswald and Sofia, and discovers that the only way to do so is to take Sofias side. Meanwhile, Tabitha attempts to beat Grundys memories of Butch back into Grundys head, and Alfred and Bruce come to blows.',42);
insert into EPISODIO_ENTITY values (7601, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/147/368694.jpg', 'A Dark Knight: Pieces of a Broken Mirror', 12,'A new killer, the Toy Maker, strikes at Lees Narrows meeting. While Jim tries to determine the killers next target and who hired him, Selina meets two old friends. Meanwhile, Alfred makes a new friend while wandering the Narrows.',42);
insert into EPISODIO_ENTITY values (7602, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/148/370725.jpg', 'A Dark Knight: A Beautiful Darkness', 13,'Ivy learns of a secret project at WayneTech that will let her avenge the murdered plants of Gotham, and gives Bruce a dose of her hallucinogenic poison. While Bruce sees his real self, jim tries to track down Ivy. At Arkham, Jerome tries to convince Oswald to cheer up.',42);
insert into EPISODIO_ENTITY values (7603, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/149/372857.jpg', 'A Dark Knight: Reunion', 14,'Ivy prepares to take revenge for the plants and for herself, and her first target is Harvey. While Selina prepares to confront her former friend, Bruce asks Alfred to help him while Edward comes up with a way to destroy Riddler once and for all.',42);
insert into EPISODIO_ENTITY values (7604, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/150/375251.jpg', 'A Dark Knight: The Sinking Ship the Grand Applause', 15,'Jim and Harvey try to track down Oswald, who has information on the man who can provide them with evidence to tie Sofia to Pyg. Meanwhile, Riddler and Oswald turn to Lee and Grundy for help, and Selina asks Bruce for help returning some stolen jewelry.',42);
insert into EPISODIO_ENTITY values (7605, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/151/377845.jpg', 'A Dark Knight: One of My Three Soups', 16,'Jerome escapes from Arkham with Mad Hatter and Scarecrow, and goes after his uncle while Jarvis commands thousands to kill themselves at midnight. Meanwhile, Bruce searches for Jerome and the League of Shadows confront Barbara.',42);
insert into EPISODIO_ENTITY values (7606, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/151/379431.jpg', 'A Dark Knight: Mandatory Brunch Meeting', 17,'While Jim and Harvey chase after Jerome and try to find his target, Lee challenges Riddler to a duel of riddles. Meanwhile, Oswald tracks down Butch and offers him a cure to his monstrous condition.',42);
insert into EPISODIO_ENTITY values (7607, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/152/381373.jpg', 'A Dark Knight: Thats Entertainment', 18,'Jerome plans his revenge against Gotham, and lies further plans in case of his death. Meanwhile, Barbara and Tabitha come to a parting of the ways, and Alfred helps Bruce celebrate his birthday.',42);
insert into EPISODIO_ENTITY values (7608, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/153/383381.jpg', 'A Dark Knight: To Our Deaths and Beyond', 19,'The League uses Bruces blood to bring Ras back to life. Meanwhile, Oswald advises Riddler to turn against Lee, who is giving the money from the bank robberies to the people of the Narrows.',42);
insert into EPISODIO_ENTITY values (7609, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/154/386922.jpg', 'A Dark Knight: That Old Corpse', 20,'Jerome sends his followers a message from beyond the grave, and they hold a wake in the GCPD. Meanwhile, Jeremiah shows Bruce his new "clean" generator, and Butch grows impatient with Oswalds failure to find him a cure for his condition.',42);
insert into EPISODIO_ENTITY values (7610, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/155/388389.jpg', 'A Dark Knight: One Bad Day', 21,'Jeremiah carries out his plan to destroy Gotham, while Lee and Riddler find Jim and tend to his injuries. Meanwhile, Oswald senses an opportunity and convinces Barbara and Tabitha to help him.',42);
insert into EPISODIO_ENTITY values (7611, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/155/389918.jpg', 'A Dark Knight: No Mans Land', 22,'Ras and Jeremiah join forces to destroy Gotham and recreate Bruce. Meanwhile, Jim faces off with the military when the mayor orders Gothams evacuation, and Strange finds a cure for Butch.',42);
insert into EPISODIO_ENTITY values (7612, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/179/447845.jpg', 'Year Zero', 1,'Two months after Gotham is cut off from the outside world, Jim and his men are trying to hold the precinct house; Oswald has secured City Hall; Barbara and Tabitha have opened up the Sirens Club to women; Riddler is dealing with a split personality; and Selina undergoes an operation to save her life but will be paralyzed for life.',42);
insert into EPISODIO_ENTITY values (7613, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/179/449113.jpg', 'Trespassers', 2,'Riddler deals with a prisoner that he doesnt remember capturing, and Barbara offers Jim unexpected help. While Jim and Harvey rescue kids being held by the Soothsayers, Bruce tries to find a cure for Selina.',42);
insert into EPISODIO_ENTITY values (7614, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/180/450961.jpg', 'Penguin, Our Hero', 3,'While Selina and Bruce set out to find Jeremiah, Oswald gathers the gangs in an attack on Haven to get his people back.',42);
insert into EPISODIO_ENTITY values (7615, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/181/453402.jpg', 'Ruin', 4,'Oswald offers Jim his help to bring in the person responsible for bombing Haven. Meanwhile, Lucius teams up with an unlikely partner to find out how the crime was committed, and Selina finds Jeremiah.',42);
insert into EPISODIO_ENTITY values (7616, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/182/455354.jpg', 'Pena Dura', 5,'Secretary Walker sends Eduardo Durrance and his men in to help Jim clean up Gotham. Edward looks for the person who controlled him into bombing Haven, and turns to Oswald to find the person responsible.',42);
insert into EPISODIO_ENTITY values (7617, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/183/459964.jpg', '13 Stitches', 6,'Eduardo continues his search for Jim, who finds new allies and tries to get word out about Eduardos and Walkers bombing of Haven. Oswald gets a new partner, and Lee makes a surprising reappearance.',42);
insert into EPISODIO_ENTITY values (7618, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/184/462409.jpg', 'Ace Chemicals', 7,'Jeremiah lures Bruce to Wayne Manor to bond the two of them together in life... and death. Jim and Lee go looking for a criminal gang connected to a recent series of chemical deaths.',42);
insert into EPISODIO_ENTITY values (7619, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/186/465208.jpg', 'Nothings Shocking', 8,'Two former detectives are murdered in Sirens, and the clues lead to Harveys old partner Dix... and Harvey himself. Edward and Oswald meet a new rival, and Barbara seeks assurances from Jim that she wont go to prison when the government arrives.',42);
insert into EPISODIO_ENTITY values (7620, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/186/467424.jpg', 'The Trial of Jim Gordon', 9,'Jim is shoot while trying to negotiate a cease-fire with Gothams gangs, and Harvey soon learns who is responsible. Bruce goes on a date with Selina, and Alfred gives Lee some advice on parenthood.',42);
insert into EPISODIO_ENTITY values (7621, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/189/472677.jpg', 'I Am Bane', 10,'The mutated Eduardo--Bane--kidnaps Bruce, Jim, and the general in charge of assessing Gothams suitability for reunification, and his employer Walker reveals who she really is. Barbara turns to Lee for help when she goes into labor, and Edward and Oswald come looking for their "partner".',42);
insert into EPISODIO_ENTITY values (7622, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/189/473729.jpg', 'They Did What?', 11,'Jim and the others make their final stand against the invading army under the command of Bane. Nyssa holds Barbara and her baby captive, and Edward and Oswald consider whether to defend Gotham or leave it to its fate.',42);
insert into EPISODIO_ENTITY values (7623, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/193/483423.jpg', 'The Beginning...', 12,'Ten years in the future, Gotham is preparing for the reopening of Wayne Tower and the return of Bruce Wayne to the city. However, four cases of C-4 go missing, Edward escapes from Arkham, Oswald is released from Blackgate, and Jim considers retiring as police commissioner. Will someone step up to be the savior that Gotham needs?',42);
