insert into SERIE_ENTITY  values (43, 2011,'https://static.tvmaze.com/uploads/images/medium_portrait/30/75365.jpg', 'Teen Wolf', 'Always an outsider and often unnoticed, Scott McCall yearns to be recognized in some small way that takes him out of his typical state of high school anonymity. When his best friend, Stiles, convinces him to go into the woods one night to join a police search for a dead body, Scott encounters a creature in the darkness. Narrowly escaping an attack with a vicious bite in his side, the next day brings strange surprises for Scott at school and his life will never be the same.MTVs reboot of the classic 1980s cult movie Teen Wolf.','https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/304b7861-c706-48d9-bcba-4016d13aa7c0/d5i5mfg-f37a0f36-a56d-4613-98cd-a8ed9cfcf9b5.png/v1/fill/w_1024,h_576,q_80,strp/wallpaper_teen_wolf_by_mpepina_d5i5mfg-fullview.jpg?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..5ZVwV4weiDPJm4Fq1NYndqPbYh0VwLvfPRMZHKyl_Bo');
