insert into EPISODIO_ENTITY values (7624, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142012.jpg', 'Wolf Moon', 1,'Everything in Scott McCalls life is starting to fall into place. He gets a spot on the First Line of his Lacrosse team and a date with the woman of his dreams. When he gets bitten by a werewolf, the people around him could be in danger.',43);
insert into EPISODIO_ENTITY values (7625, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142013.jpg', 'Second Chance at First Line', 2,'Scott and Stiles discover that the werewolf curse can also be triggered by anger, besides the full moon. With the lacrosse game coming up, Jackson and his girlfriend, Lydia, hope to humiliate Scott. Will Scott be able to control his rage?',43);
insert into EPISODIO_ENTITY values (7626, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142014.jpg', 'Pack Mentality', 3,'Scott is shaken when his vivid dream of a mauling aboard a school bus turns out to have actually happened. Scott turns to Derek for help, but Derek warns him that his help will not be free. Meanwhile, Scotts long awaited date with Allison turns into a group date. Scott gets bowling help from Allison.',43);
insert into EPISODIO_ENTITY values (7627, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142015.jpg', 'Magic Bullet', 4,'Allisons aunt comes to town and shoots a shadowy werewolf figure with a special bullet that she estimates will kill it within 48 hours. Derek is the one hit and insists that Scott and Stiles help him.',43);
insert into EPISODIO_ENTITY values (7628, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142016.jpg', 'The Tell', 5,'Lydia and Jackson witness a werewolf attack at the video store. Stiles is worried for his father, the sheriff. Allisons aunt gives Allison a family heirloom and encourages her to use it to learn more about the family history. Scott and Allison play hooky on her birthday. Derek confronts Jackson about what he saw the night before. Derek gets a surprise visit. At the parent teacher conference, Scotts mom and Allisons father find out they both skipped school that day. After the parent teacher conference, someone pulls a gun and uses it.',43);
insert into EPISODIO_ENTITY values (7629, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142017.jpg', 'Heart Monitor', 6,'Scott and Stiles are on the outs after Stiles dad gets hurt, but when Derek insists that Scott avoid Allison, Scott turns to Stiles to help him master his anger with the help of a heart monitor. Meanwhile, Jackson is feeling the effects of having been scratched and approaches Allison claiming to want to get to know her and Scott better.',43);
insert into EPISODIO_ENTITY values (7630, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142018.jpg', 'Night School', 7,'Responding to Scotts howl, the alpha savages Derek and traps Scott and Stiles in their high school. Events escalate even further when Allison, Jackson and Lydia are lured to the school as well with a phony text message.',43);
insert into EPISODIO_ENTITY values (7631, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142019.jpg', 'Lunatic', 8,'As Scotts second full moon approaches, he gives in to his animal urges and hurts Stiles, but Stiles gets a measure of revenge in locking him up. Meanwhile, Jackson continues to try and get closer to Allison. The Argents learn that Scott somehow knew Derek.',43);
insert into EPISODIO_ENTITY values (7632, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142020.jpg', 'Wolfs Bane', 9,'Jackson discovers that he has aconite poisoning and thinks he has figured out what is up with Scott. Meanwhile, Derek hides from the manhunt in Stiles room while Stiles and Scott try to get Allisons necklace and any clues that may lead to the identity of the alpha. Teammate Danny lends Stiles his internet expertise to help in the search.',43);
insert into EPISODIO_ENTITY values (7633, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142021.jpg', 'Co-Captain', 10,'The Alpha finally reveals himself to Scott and gives him an idea of why he has killed certain people. Argent stages an encounter thinking that Jackson may be a werewolf. Meanwhile, Allison discovers a bit more about her familys secrets and confronts Lydia about her kissing Scott.',43);
insert into EPISODIO_ENTITY values (7634, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142022.jpg', 'Formality', 11,'Kate Argent has Derek chained up in a basement following her attack on his house and shows him off to Allison before torturing him. The coach has banned Scott from the Spring Formal in exchange for not dropping him from the team for academic reasons. Scott intimidates Jackson into escorting Allison to the dance, and she asks Lydia to escort Stiles.',43);
insert into EPISODIO_ENTITY values (7635, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142023.jpg', 'Code Breaker', 12,'Caught in a war between hunters and werewolves, Scott seeks help from friends and enemies.',43);
insert into EPISODIO_ENTITY values (7636, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142024.jpg', 'Omega', 1,'When Lydia goes missing from the hospital, werewolves and hunters alike begin a search to discover not only where she is, but what shes become.',43);
insert into EPISODIO_ENTITY values (7637, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142025.jpg', 'Shape Shifted', 2,'The night before the new full moon, Isaacs father is murdered. When hes taken into custody, Scott, Stiles and Derek resolve to break him out before the Argents get to him first and before the newly bitten teen turns into a werewolf.',43);
insert into EPISODIO_ENTITY values (7638, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142026.jpg', 'Ice Pick', 3,'Scott tries to keep Derek from creating new werewolves; Argent officially begins Allisons training; the new creature in town takes another victim.',43);
insert into EPISODIO_ENTITY values (7639, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142027.jpg', 'Abomination', 4,'The new shape-shifter strikes again, and Scott recruits a reluctant Allison to acquire a rare book in Gerards collection.',43);
insert into EPISODIO_ENTITY values (7640, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142028.jpg', 'Venomous', 5,'Derek believes that Lydia is the shapeshifter they are after; Scott gathers forces for protection.',43);
insert into EPISODIO_ENTITY values (7641, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142029.jpg', 'Frenemy', 6,'Derek believes that Lydia is the shapeshifter they are after; Scott gathers forces for protection.',43);
insert into EPISODIO_ENTITY values (7642, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142030.jpg', 'Restraint', 7,'As Lydia begins to make connections about the bite from Peter, Jackson causes new problems for Scott and Stiles while Derek has a crisis of faith in his leadership as a new Alpha.',43);
insert into EPISODIO_ENTITY values (7643, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142031.jpg', 'Raving', 8,'Chris, Scott and Stiles struggle with how to stop the Kanima; Scott and Stiles plan to trap the Kanima at a warehouse party, where Erica will also be present, while Allisons mother plans to take Scott down. Chris and his team of hunters face Derek in a confrontation.',43);
insert into EPISODIO_ENTITY values (7644, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142032.jpg', 'Party Guessed', 9,'Even as his relationship with Allison becomes further strained, Scott and Stiles must attend Lydias birthday party while Derek locks his new wolves up to watch after them on their first full moon together.',43);
insert into EPISODIO_ENTITY values (7645, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142033.jpg', 'Fury', 10,'Allison tracks Derek to the sheriffs station, where Scott, Stiles, Melissa and Sheriff Stilinski are being held hostage.',43);
insert into EPISODIO_ENTITY values (7646, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142034.jpg', 'Battlefield', 11,'Scott plays in the championship lacrosse game and must also figure out a way to stop Gerard. Meanwhile, Allison continues her hunt for Derek and his wolves.',43);
insert into EPISODIO_ENTITY values (7647, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142035.jpg', 'Master Plan', 12,'Scott races to uncover Gerards master plan following a shocking death on the lacrosse field. Meanwhile, Derek plots to take Gerard down using his own methods.',43);
insert into EPISODIO_ENTITY values (7648, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142038.jpg', 'Tattoo', 1,'Derek and Isaac search for Erica and Boyd, and a new wolf pack arrives in town with its own menacing Alpha.',43);
insert into EPISODIO_ENTITY values (7649, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142039.jpg', 'Chaos Rising', 2,'Allison and Lydia stumble upon a possible clue to finding Boyd and Erica while a childhood friend of Stiles goes missing.',43);
insert into EPISODIO_ENTITY values (7650, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142040.jpg', 'Fireflies', 3,'With Boyd and Cora on the loose and under the influence of the full moon, Scott and Derek must turn to an unlikely ally for help.',43);
insert into EPISODIO_ENTITY values (7651, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142041.jpg', 'Unleashed', 4,'While Scott tries to keep Isaac from engaging in a deadly confrontation with the Twins in school, Stiles attempts to prove his theory that the killings have nothing to do with werewolves.',43);
insert into EPISODIO_ENTITY values (7652, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142043.jpg', 'Frayed', 5,'During a bus ride to a cross country meet, Scott and his friends flash back to the events of a preemptive strike against the Alphas that has left several injured and possibly one or more dead.',43);
insert into EPISODIO_ENTITY values (7653, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142044.jpg', 'Motel California', 6,'Stranded at a motel for the night because of the postponed cross country meet, Scott and the others suffer strange experiences that cause them to believe members of their own group may the mysterious killers newest targets.',43);
insert into EPISODIO_ENTITY values (7654, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142045.jpg', 'Currents', 7,'As the danger begins to reach closer to Scott, threatening his trusted mentor and boss, Deaton, Kali and the Twins go after Derek.',43);
insert into EPISODIO_ENTITY values (7655, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142046.jpg', 'Visionary', 8,'Seeking answers, Scott, Allison and Stiles hear stories told by two unlikely narrators and discover a secret about the color of a werewolfs eyes.',43);
insert into EPISODIO_ENTITY values (7656, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142047.jpg', 'The Girl Who Knew Too Much', 9,'As Allison begins to suspect someone dangerously close to her may be involved in the murders, Scott and Stiles conclude that Lydias rising talents may be their best bet to solving the murders.',43);
insert into EPISODIO_ENTITY values (7657, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142048.jpg', 'The Overlooked', 10,'Trapped inside an evacuated Beacon Hills hospital by a powerful storm, Scott and Derek must defend themselves against the Alphas while trying to figure out how to save Coras life.',43);
insert into EPISODIO_ENTITY values (7658, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142049.jpg', 'Alpha Pact', 11,'With the threat growing far more personal and time running out on innocent lives, Scott is forced to make a difficult choice in order to save both friends and family. Derek and Peter try to figure out how to save Coras life.',43);
insert into EPISODIO_ENTITY values (7659, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142050.jpg', 'Lunar Ellipse', 12,'Under Deatons advice, Scott and his friends use an ancient but extremely dangerous ritual to help them both save the lives of the people they love and stop Deucalion from achieving his sinister goal.',43);
insert into EPISODIO_ENTITY values (7660, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142051.jpg', 'Anchors', 13,'Three weeks after saving the lives of their parents, Scott, Stiles and Allison begin to suffer strange side effects from their ritual sacrifice. At the same time, the newly enlightened Sheriff Stilinski scours through old cases.',43);
insert into EPISODIO_ENTITY values (7661, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142052.jpg', 'More Bad Than Good', 14,'Scott and his friends race to figure out how to catch the Werecoyote before its hunted down while Derek and Peter are broken out of captivity by an unlikely ally.',43);
insert into EPISODIO_ENTITY values (7662, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142053.jpg', 'Galvanize', 15,'On the night before Halloween, Mischief Night, a convicted murderer brought to Beacon Hills Hospital for surgery escapes, forcing Scott and his friends to step in to help when his unexpected target becomes clear.',43);
insert into EPISODIO_ENTITY values (7663, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/142054.jpg', 'Illuminated', 16,'With Beacon Hills under curfew due to the power outage, the teens decide to throw a black light Halloween party while Scott tries to get Kira to trust him in the midst of an attack by a strange new threat.',43);
