insert into SERIE_ENTITY  values (44, 2022,'https://static.tvmaze.com/uploads/images/medium_portrait/433/1084564.jpg', 'The Glory', 'Moon Dong Eun had to drop out of school because of school violence. Since then, she has lived with thoughts of revenge. Years later, her main abuser got married and gave birth to a child. The former victim becomes this childs homeroom teacher when he goes to elementary school. So begins her long and difficult path of revenge. It targets not only the main offender, but also all those who watched the violence, but did nothing. Joo Ye Jung is a carefree and smiling guy. Instead of being the fairy prince Dong Eun, he decides to become the means of her revenge.','https://wallpapercave.com/wp/wp11954351.jpg');
