insert into EPISODIO_ENTITY values (7724, 47, 'https://static.tvmaze.com/uploads/images/medium_landscape/438/1095444.jpg', 'Episode 1', 1,'Tormented by her high school classmates and with nowhere to turn for help, Moon Dong Eun sinks into despair before deciding on a new mission in life.',44);
insert into EPISODIO_ENTITY values (7725, 52, 'https://static.tvmaze.com/uploads/images/medium_landscape/438/1095445.jpg', 'Episode 2', 2,'With Park Yun Jins wedding on the way, Dong Euns revenge rolls out according to plan. Meanwhile, a fateful encounter at a hospital takes place.',44);
insert into EPISODIO_ENTITY values (7726, 50, 'https://static.tvmaze.com/uploads/images/medium_landscape/438/1095446.jpg', 'Episode 3', 3,'After securing the services of an amateur sleuth, Dong Eun uncovers scandalous secrets that she leverages for the next phase of her scheme.',44);
insert into EPISODIO_ENTITY values (7727, 47, 'https://static.tvmaze.com/uploads/images/medium_landscape/438/1095447.jpg', 'Episode 4', 4,'Already on edge over the past resurfacing, Yun Jin grows more anxious when she learns about her daughters new homeroom teacher — and of a sudden death.',44);
insert into EPISODIO_ENTITY values (7728, 49, 'https://static.tvmaze.com/uploads/images/medium_landscape/438/1095448.jpg', 'Episode 5', 5,'While Ha Do Young comes across an intriguing game opponent, Yun Jin realizes her deepest secrets are at stake when she tries to intimidate Dong Eun.',44);
insert into EPISODIO_ENTITY values (7729, 52, 'https://static.tvmaze.com/uploads/images/medium_landscape/438/1095449.jpg', 'Episode 6', 6,'Son Myung Ohs sudden absence causes tension in the friend group. Dong Eun finds her trust in Kang Hyun Nam tested.',44);
insert into EPISODIO_ENTITY values (7730, 50, 'https://static.tvmaze.com/uploads/images/medium_landscape/438/1095450.jpg', 'Episode 7', 7,'Dong Eun shares her traumatic past with Joo Yeo Jung, who has unfinished business of his own. A new plan is put in place for Hyun Nams daughter.',44);
insert into EPISODIO_ENTITY values (7731, 55, 'https://static.tvmaze.com/uploads/images/medium_landscape/438/1095451.jpg', 'Episode 8', 8,'Do Young meets with Choi Hye Jung to find out more about his wife — and her past. Yun Jun digs into Dong Euns private life.',44);
insert into EPISODIO_ENTITY values (7732, 53, 'https://static.tvmaze.com/uploads/images/medium_landscape/451/1128585.jpg', 'Episode 9', 9,'Questions arise over Myung Oh, Dong Eun gives Yun Jin a chance to come clean about her past, and the circumstances of Yoon So Hees death are revealed.',44);
insert into EPISODIO_ENTITY values (7733, 51, 'https://static.tvmaze.com/uploads/images/medium_landscape/451/1128586.jpg', 'Episode 10', 10,'Yun Jin threatens Hyun Nam after discovering her involvement with Dong Eun. Yeo Jung devises a way to get the truth out of Yun Jin.',44);
insert into EPISODIO_ENTITY values (7734, 53, 'https://static.tvmaze.com/uploads/images/medium_landscape/451/1128587.jpg', 'Episode 11', 11,'Hye Jung finds an incriminating recording on Myung Ohs tablet, and Hyun Nam receives an unwelcome visitor as she prepares to send her daughter abroad.',44);
insert into EPISODIO_ENTITY values (7735, 53, 'https://static.tvmaze.com/uploads/images/medium_landscape/451/1128588.jpg', 'Episode 12', 12,'Dong Euns end game comes into focus as she sends Jae Joon a troubling package and orchestrates a plan to take down Yun Jin and Lee Sa Ra.',44);
insert into EPISODIO_ENTITY values (7736, 54, 'https://static.tvmaze.com/uploads/images/medium_landscape/451/1128589.jpg', 'Episode 13', 13,'As Sa Ra and Yun Jin deal with the aftermath of their crumbling reputations, Dong Eun learns the details behind Ye Jungs private struggles.',44);
insert into EPISODIO_ENTITY values (7737, 54, 'https://static.tvmaze.com/uploads/images/medium_landscape/451/1128590.jpg', 'Episode 14', 14,'Yun Jin and Shin Young Joon panic over Myung Oh. Dong Eun takes care of a lingering problem. Yun Jins mother schemes to remove a threat.',44);
insert into EPISODIO_ENTITY values (7738, 60, 'https://static.tvmaze.com/uploads/images/medium_landscape/451/1128591.jpg', 'Episode 15', 15,'Do Young issues an ultimatum. Dong Eun demands a piece of evidence be handed over. Yun Jin attempts to do damage control after old videos appear online.',44);
insert into EPISODIO_ENTITY values (7739, 71, 'https://static.tvmaze.com/uploads/images/medium_landscape/451/1128592.jpg', 'Episode 16', 16,'As the final pieces of Dong Euns revenge plot slot into place, she considers what comes next — and what it will mean for Yeo Jung.',44);
