insert into EPISODIO_ENTITY values (7740, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493034.jpg', 'Pilot', 1,'Malcolm finds his life as the middle brother in an eccentric family made even more difficult by his being placed in a class for "gifted" students at school.',45);
insert into EPISODIO_ENTITY values (7741, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493036.jpg', 'Red Dress', 2,'Lois must take drastic steps to discover which of her sons ruined the special dress she bought for an anniversary dinner with Hal.',45);
insert into EPISODIO_ENTITY values (7742, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493038.jpg', 'Home Alone 4', 3,'Lois and Hal leave the boys alone for the weekend with Francis, promising that if all goes well, Francis may not have to go back to military school.',45);
insert into EPISODIO_ENTITY values (7743, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493039.jpg', 'Shame', 4,'Malcolm feels guilty after beating up a seven year old; Hal takes heat after cutting down a tree; Francis tries to sabotage Spanglers sex education lecture.',45);
insert into EPISODIO_ENTITY values (7744, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493041.jpg', 'Malcolm Babysits', 5,'While his family is reduced to living in a trailer in their driveway while their house is fumigated, Malcolm luxuriates while babysitting for what seems like the ideal family.',45);
insert into EPISODIO_ENTITY values (7745, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493042.jpg', 'Sleepover', 6,'During a sleepover, Malcolm sneaks Stevie out of the Kenarin house and loses his wheelchair; Francis deals with hazing at military school; and Reese tries to prove hes man enough to watch a scary movie',45);
insert into EPISODIO_ENTITY values (7746, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493044.jpg', 'Francis Escapes', 7,'Malcolms brother, Francis, runs away from military school and comes home to see his girlfriend.',45);
insert into EPISODIO_ENTITY values (7747, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493045.jpg', 'Krelboyne Picnic', 8,'The whole family attend a Krelboyne family picnic, and Malcom dreads his performance in the events "Academic Circus" will make him look like a freak.',45);
insert into EPISODIO_ENTITY values (7748, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493046.jpg', 'Lois vs. Evil', 9,'The family suffers in poverty after Lois gets fired from the grocery store; Francis loves his new assignment as part of an honor guard at a beauty pageant.',45);
insert into EPISODIO_ENTITY values (7749, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493047.jpg', 'Stock Car Races', 10,'While Hal secretly takes the boys to the stock car races, Lois desperately searches for her missing paycheck.',45);
insert into EPISODIO_ENTITY values (7750, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493048.jpg', 'Funeral', 11,'Malcolm talks the family out of going to a relatives funeral, so he can go on his first date instead.',45);
insert into EPISODIO_ENTITY values (7751, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493049.jpg', 'Cheerleader', 12,'Malcolm helps Reese become a male cheerleader to attract a girl; Francis has a heart-to-heart conversation with headmaster Spangler; Dewey is enticed by a new toy.',45);
insert into EPISODIO_ENTITY values (7752, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493050.jpg', 'Rollerskates', 13,'Malcolm suffers under his fathers roller skating tutelage, while Lois is sidelined with a nasty back injury.',45);
insert into EPISODIO_ENTITY values (7753, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493051.jpg', 'The Bots and the Bees', 14,'While Lois is out of town visiting Francis after his appendectomy, Malcolm and his friends build a robot, but Hal reverts to his pre-marriage wild-man persona and takes over the project.',45);
insert into EPISODIO_ENTITY values (7754, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493052.jpg', 'Smunday', 15,'When Lois gets sick, Malcolm and his brothers convince her its Sunday so they can stay home from school...while Hal heeds the Siren song of a Porsche dealership.',45);
insert into EPISODIO_ENTITY values (7755, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493053.jpg', 'Water Park (1)', 16,'Malcolm and Reese spend the day fighting at a water park; Francis gets into a different kind of pool match with Spangler; and Dewey stays home with an odd babysitter.',45);
insert into EPISODIO_ENTITY values (7756, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493054.jpg', 'Traffic Jam (2)', 1,'Stranded in a traffic jam, Malcolm meets his match in an intriguing young girl; Reese attempts to break into an ice cream truck; and Lois tries to control the uncontrollable chaos.',45);
insert into EPISODIO_ENTITY values (7757, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493055.jpg', 'Halloween Approximately', 2,'Malcolm and his brothers build the ultimate stealth weapon, while Hal and Lois battle a speeding car that terrorizes their neighborhood.',45);
insert into EPISODIO_ENTITY values (7758, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493056.jpg', 'Loiss Birthday', 3,'When the boys demolish Lois meager hopes for a happy birthday, she runs away from home.',45);
insert into EPISODIO_ENTITY values (7759, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493057.jpg', 'Dinner Out', 4,'Malcolms family goes out to dinner with the straight-laced Kenarbans, while Francis makes the mistake of inviting local girls to a party at Marlin Academy.',45);
insert into EPISODIO_ENTITY values (7760, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493059.jpg', 'Casino', 5,'When the family takes a vacation to a casino, Hal gets banned from gambling and takes Malcolm and Reese on an ill-fated trek into the desert; Lois and Dewey win a free day of spa pampering.',45);
insert into EPISODIO_ENTITY values (7761, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493060.jpg', 'Convention', 6,'Malcolm and Reese compete with Dewey for a cute babysitters attention, while Hal and Lois attend a convention where Hal cant resist fighting with an old rival.',45);
insert into EPISODIO_ENTITY values (7762, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493061.jpg', 'Robbery', 7,'While Hal and the boys are besieged by bats after Hal brings home an antique armoire; Lois gets robbed at work.',45);
insert into EPISODIO_ENTITY values (7763, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493062.jpg', 'Therapy', 8,'Malcolm gets into therapy to get out of class; Francis cleans up on laundry duty; Dewey turns out to be a skittles prodigy; and Hal and Lois attempt to clean out an over-stuffed closet.',45);
insert into EPISODIO_ENTITY values (7764, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493063.jpg', 'High School Play', 9,'Malcolms friendships suffer when he becomes the suddenly popular star of a high school play; Hal and Dewey build their very own Utopia from plastic blocks.',45);
insert into EPISODIO_ENTITY values (7765, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493064.jpg', 'The Bully', 10,'When Reese gives up his position as school bully, Malcolm suffers at the hands of his successors; Francis dreads his upcoming birthday at Marlin Academy.',45);
insert into EPISODIO_ENTITY values (7766, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493065.jpg', 'Old Mrs. Old', 11,'Malcolm gets in trouble with an elderly neighbor; Francis slacker friend enrolls at Marlin Academy; Dewey trades his backpack for a purse.',45);
insert into EPISODIO_ENTITY values (7767, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493066.jpg', 'Krelboyne Girl', 12,'Malcolm experiences his first crush as a confusing mix of love and hate; Francis tries to avoid discipline for his latest prank; Dewey overreacts to Lois lecture about the hazards of dirty teddy bears.',45);
insert into EPISODIO_ENTITY values (7768, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493067.jpg', 'New Neighbors', 13,'New neighbors, who turn out to be even more awful than Malcolms family, move in next door; the Marlin Academy cadets prepare for a visit from Oliver North.',45);
insert into EPISODIO_ENTITY values (7769, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493068.jpg', 'Hal Quits', 14,'Hal quits his job to become an artist; Francis suffers though a week of inventory work at Lucky Aide; and Malcolm begins to wonder about his own career future.',45);
insert into EPISODIO_ENTITY values (7770, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493069.jpg', 'The Grandparents', 15,'Lois disapproving parents visit; Francis goes to Mardi Gras but gets stopped by food poisoning.',45);
insert into EPISODIO_ENTITY values (7771, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493070.jpg', 'Traffic Ticket', 16,'Lois disputes a cops claim she was driving recklessly, and orders Francis to pay off $750 in parking tickets he racked up under her name.',45);
insert into EPISODIO_ENTITY values (7772, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493071.jpg', 'Surgery', 17,'Malcolm is hospitalized for an appendectomy; Francis stages a hunger strike at Marlin Academy.',45);
insert into EPISODIO_ENTITY values (7773, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493072.jpg', 'Reese Cooks', 18,'Reese discovers a talent for cooking; Malcolm tries to convince a Krelboyne classmate not to have a party; Francis is forced to write a term paper.',45);
insert into EPISODIO_ENTITY values (7774, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493073.jpg', 'Tutoring Reese', 19,'Malcolm tries to help Reese bring his grades up; Francis is exiled to a friends house after defying Lois order to patch the roof.',45);
insert into EPISODIO_ENTITY values (7775, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493075.jpg', 'Bowling', 20,'Malcolm and Reeses trip to a bowling alley is seen in two versions; one with Hal chaperoning and one with Lois doing the honors.',45);
insert into EPISODIO_ENTITY values (7776, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493076.jpg', 'Malcolm vs. Reese', 21,'Francis forces Malcolm and Reese compete to "earn a coveted ticket to a wrestling match; Dewey loses Craigs cat while Craig is away at a comic book convention.',45);
insert into EPISODIO_ENTITY values (7777, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493077.jpg', 'Mini-Bike', 22,'The younger boys try to convince Lois to let them have a mini-bike; Hal attends a father-son weekend at Marlin Academy.',45);
insert into EPISODIO_ENTITY values (7778, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493078.jpg', 'Carnival', 23,'Malcolm, Reese, Dewey, and Stevie sneak out to a county fair, then get locked inside after hours with a drunk, belligerent guard.',45);
insert into EPISODIO_ENTITY values (7779, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493079.jpg', 'Evacuation', 24,'Hal is inadvertently responsible for a toxic chemical spill that forces a neighborhood evacuation; Malcolm deals with being grounded even in the emergency shelter; Francis suffers though a date with a geeky 12-year-old.',45);
insert into EPISODIO_ENTITY values (7780, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493080.jpg', 'Flashback', 25,'When Lois thinks she might be pregnant again, she and Hal argue...and remember how their lives changed with the births of each of their sons.',45);
insert into EPISODIO_ENTITY values (7781, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493352.jpg', 'Houseboat (1)', 1,'Malcolm and Stevies families vacation together on a houseboat; Francis decides to quit school and move to Alaska.',45);
insert into EPISODIO_ENTITY values (7782, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493354.jpg', 'Emancipation (2)', 2,'Malcolm and the Krelboynes do battle with a tough new teacher; Francis tries to get Lois to talk to him after his self-emancipation.',45);
insert into EPISODIO_ENTITY values (7783, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493356.jpg', 'Book Club', 3,'Lois joins a book club; Hal worries about getting the boys to behave while Lois is out; Francis hitchhikes through Canada with a trucker who vows to test Francis limits.',45);
insert into EPISODIO_ENTITY values (7784, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493357.jpg', 'Malcolms Girlfriend', 4,'Malcolm gets his first official girlfriend; Dewey makes a non-imaginary friend; Francis takes refuge with a mad bomber in a remote Canadian cabin.',45);
insert into EPISODIO_ENTITY values (7785, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493358.jpg', 'Charity', 5,'Malcolm and his brothers mine personal profit from some church charity work; Francis gets a taste of life in a logging camp.',45);
insert into EPISODIO_ENTITY values (7786, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493359.jpg', 'Health Scare', 6,'Hal sweats out a biopsy on a lump found during a medical checkup; Dewey babysits the class hamster; Lavernia challenges Francis to a fight at the logging camp.',45);
insert into EPISODIO_ENTITY values (7787, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493360.jpg', 'Christmas', 7,'Lois tries to get the boys to behave until Christmas by holding their presents hostage; Francis spends Christmas with his mean-spirited grandmother.',45);
insert into EPISODIO_ENTITY values (7788, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493361.jpg', 'Poker', 8,'Hal accuses Abe of cheating him at poker; Francis weathers a storm at the logging camp; Reese and Lois attend a dance class.',45);
insert into EPISODIO_ENTITY values (7789, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493363.jpg', 'Reeses Job', 9,'Reese is accused of stealing at his new job; Dewey tries to convince his parents he can keep a goldfish alive; Malcolm chafes when a super-genius joins his class.',45);
insert into EPISODIO_ENTITY values (7790, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493364.jpg', 'Lois Makeover', 10,'Lois gets dolled up after a scathing customer review; the boys take on Hal at basketball; Francis becomes a rat catcher.',45);
insert into EPISODIO_ENTITY values (7791, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493366.jpg', 'Company Picnic (1)', 11,'As the picnic continues, Hal cant bring himself to admit his real identity to his boss, Malcolm further humiliates himself, and Reese bonds with his scavenger hunt partner.',45);
insert into EPISODIO_ENTITY values (7792, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493367.jpg', 'Company Picnic (2)', 12,'As the picnic continues, Hal cant bring himself to admit his real identity to his boss, Malcolm further humiliates himself, and Reese bonds with his scavenger hunt partner.',45);
insert into EPISODIO_ENTITY values (7793, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493368.jpg', 'Reese Drives', 13,'Reese gets into trouble during his very first driving lesson; Malcolm helps Craig install a new stereo system; Francis barters a chain of favors to pay off a debt.',45);
insert into EPISODIO_ENTITY values (7794, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493369.jpg', 'Cynthias Back', 14,'Malcolm reveals Cynthias big secret to Reese; Dewey helps Hal overcome his fear of kites; a neighbor makes amends to Lois; Francis becomes enchanted with a totem pole.',45);
insert into EPISODIO_ENTITY values (7795, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493370.jpg', 'Hals Birthday', 15,'After Francis shows up with his new wife, Malcolm, Reese, and Dewey get so fed up with Lois constant yelling, they run away from home.',45);
insert into EPISODIO_ENTITY values (7796, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493371.jpg', 'Hal Coaches', 16,'Hal begins coaching Deweys soccer team...much to Deweys horror; Malcolm gets unexpected results when he programs his new computer to act out the lives of his family; Reese blackmails neighbor Ed.',45);
insert into EPISODIO_ENTITY values (7797, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493372.jpg', 'Deweys Dog', 17,'Dewey hides a dog from his parents; Hal and Lois try to keep a romantic date, even though both of them are sick; Commandant Spangler finds Francis at the logging camp.',45);
insert into EPISODIO_ENTITY values (7798, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493373.jpg', 'Poker #2', 18,'While Hal gets into a variety of one-up contests with his poker buddies, Reese sets Stevie up with the daughter of one player, while Malcolm discovers the daughter of another player has a gun in her purse.',45);
insert into EPISODIO_ENTITY values (7799, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493375.jpg', 'Clip Show', 19,'After the family car gets damaged and the boys wont own up to causing the incident, Hal takes them to see a psychiatrist.',45);
insert into EPISODIO_ENTITY values (7800, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493376.jpg', 'Jury Duty', 20,'While Lois is on jury duty, she pushes the other jurors to take their jobs seriously; Hal tries to solve a murder case he thinks Lois is assigned to; Malcolm, Reese, and Dewey get lost in a sewer.',45);
