insert into EPISODIO_ENTITY values (7887, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493873.jpg', 'Stevie in the Hospital', 19,'Malcolms afraid to visit his best friend Stevie in the hospital; Reese becomes a master telemarketer; and someone secretly tries to drive Lois crazy.',45);
insert into EPISODIO_ENTITY values (7888, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493874.jpg', 'Cattle Court', 20,'Reese pretends to be a vegetarian; Hal decides to teach Dewey a lesson about the game of "Life;" and Malcolm talks Craig into standing up to Lois...and then regrets it.',45);
insert into EPISODIO_ENTITY values (7889, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493875.jpg', 'Morp', 21,'Malcolm organizes the outcast kids at school for an anti-prom; Reese is transformed into the perfect prom date...for a price; and Dewey holds Hals wallet hostage for the attention he was denied.',45);
