insert into SERIE_ENTITY  values (46, 2007,'https://static.tvmaze.com/uploads/images/medium_portrait/173/433868.jpg', 'The Big Bang Theory', 'The Big Bang Theory is a comedy about brilliant physicists, Leonard and Sheldon, who are the kind of "beautiful minds" that understand how the universe works. But none of that genius helps them interact with people, especially women. All this begins to change when a free-spirited beauty named Penny moves in next door. Sheldon, Leonards roommate, is quite content spending his nights playing Klingon Boggle with their socially dysfunctional friends, fellow Cal Tech scientists Wolowitz and Koothrappali. However, Leonard sees in Penny a whole new universe of possibilities... including love.','https://images8.alphacoders.com/431/thumb-1920-431311.jpg');
insert into SERIE_ENTITY_PLATAFORMAS  values (46, 4);
