insert into EPISODIO_ENTITY values (7891, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12368.jpg', 'Pilot', 1,'Is a comedy about brilliant physicists, Leonard and Sheldon, who are the kind of "beautiful minds" that understand how the universe works. But none of that genius helps them interact with people, especially women. All this begins to change when a free-spirited beauty named Penny moves in next door. Sheldon, Leonards roommate, is quite content spending his nights playing Klingon Boggle with their socially dysfunctional friends, fellow Cal Tech scientists Wolowitz and Koothrappali. However, Leonard sees in Penny a whole new universe of possibilities... including love.',46);
insert into EPISODIO_ENTITY values (7892, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12369.jpg', 'The Big Bran Hypothesis', 2,'Leonard volunteers to sign for a package, hoping to make a good impression on Penny. When he enlists the help of his obsessive-compulsive roommate, Sheldon, his attempt at chivalry goes horribly awry.',46);
insert into EPISODIO_ENTITY values (7893, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12370.jpg', 'The Fuzzy Boots Corollary', 3,'Leonard is bummed to learn that his crush, Penny, is seeing someone, so encouraged by his friends and fellow scientists, Leonard actually summons the nerve to ask a woman out on a date.',46);
insert into EPISODIO_ENTITY values (7894, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12371.jpg', 'The Luminous Fish Effect', 4,'When Sheldon gets fired, he explores life beyond physics, but his initial thrill of shopping with Penny devolves over time to him weaving ponchos as a shut-in, forcing Leonard to call on Sheldons mother.',46);
insert into EPISODIO_ENTITY values (7895, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12372.jpg', 'The Hamburger Postulate', 5,'After sensing his pursuit of Penny isnt going anywhere, Leonard agrees to an unexpected sexual encounter with fellow scientist Leslie Winkle.',46);
insert into EPISODIO_ENTITY values (7896, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12373.jpg', 'The Middle-Earth Paradigm', 6,'Leonard, Sheldon, Wolowitz and Koothrappali undertake a challenging and risky experiment-attending the Halloween party being thrown by their hot neighbor, Penny.',46);
insert into EPISODIO_ENTITY values (7897, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12374.jpg', 'The Dumpling Paradox', 7,'When Wolowitz seduces Pennys friend and takes over her apartment, Penny sleeps on Leonard and Sheldons couch. With Wolowitz preoccupied, the guys discover they are without a fourth member of their group and in desperation, they ask Penny to join their Halo team.',46);
insert into EPISODIO_ENTITY values (7898, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12375.jpg', 'The Grasshopper Experiment', 8,'Koothrappali is overwhelmed after his parents arrange a blind date, but he discovers he actually can talk to the opposite sex after a few drinks; however, complications set in when his beautiful date is more interested in Sheldon.',46);
insert into EPISODIO_ENTITY values (7899, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12457.jpg', 'The Cooper-Hofstadter Polarization', 9,'When Sheldon and Leonard are invited to present their joint findings at a physics conference, Sheldon refuses, and Penny steps in to mediate, only deepening the rift between the two best friends.',46);
insert into EPISODIO_ENTITY values (7900, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12458.jpg', 'The Loobenfeld Decay', 10,'After hearing Penny sing, Leonard lies to avoid seeing her perform, but Sheldon takes it one step further with a more elaborate lie that leads to the appearance of his non-existent cousin.',46);
insert into EPISODIO_ENTITY values (7901, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12459.jpg', 'The Pancake Batter Anomaly', 11,'When Sheldon gets sick, Leonard and the boys know whats in store and avoid him like the plague, leaving an unsuspecting Penny to nurse the worlds worst patient back to health.',46);
insert into EPISODIO_ENTITY values (7902, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12460.jpg', 'The Jerusalem Duality', 12,'When Leonard and Sheldon meet a 15-year-old physics prodigy, Sheldon is distraught that this boy genius is younger and smarter, so in an attempt to restore his sense of purpose, the boys come up with a solution to derail Dennis research.',46);
insert into EPISODIO_ENTITY values (7903, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12461.jpg', 'The Bat Jar Conjecture', 13,'Since Sheldons only focus is to prove his mental superiority while preparing for the Physics Bowl, the guys kick him off the team and enlist his nemesis Leslie Winkle.',46);
insert into EPISODIO_ENTITY values (7904, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12462.jpg', 'The Nerdvana Annihilation', 14,'When Leonard and the guys buy a time machine prop from a classic 1960 movie, its arrival creates problems for Penny and she tells the boys that their obsession with comics and toys is "pathetic".',46);
insert into EPISODIO_ENTITY values (7905, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12463.jpg', 'The Pork Chop Indeterminacy', 15,'When Leonard, Wolowitz, and Koothrappali all become smitten with Sheldons twin sister, Leonard devises a plan to eliminate his rivals, however, it backfires when Sheldon declares he will decide whom his sister dates.',46);
insert into EPISODIO_ENTITY values (7906, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12464.jpg', 'The Peanut Reaction', 16,'When Penny learns that Leonard doesnt celebrate birthdays, she attempts to throw him a surprise party, but is sidetracked by Sheldon who unexpectedly gets to live out one of his greatest fantasies at an electronics store.',46);
insert into EPISODIO_ENTITY values (7907, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12465.jpg', 'The Tangerine Factor', 17,'When Leonard asks Penny out on a date and she says yes, they each seek the "wisdom" of reluctant advisor.',46);
insert into EPISODIO_ENTITY values (7908, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12345.jpg', 'The Bad Fish Paradigm', 1,'After her first date with Leonard goes awry, Penny finds an unwilling confidant in Leonards anti-social roommate, Sheldon.',46);
insert into EPISODIO_ENTITY values (7909, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12346.jpg', 'The Codpiece Topology', 2,'When Leonard sees Penny with a handsome new guy, he enters into a rebound relationship with Sheldons nemesis, Leslie Winkle.',46);
insert into EPISODIO_ENTITY values (7910, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12347.jpg', 'The Barbarian Sublimation', 3,'Sheldon creates a monster when he introduces Penny to the world of online gaming.',46);
insert into EPISODIO_ENTITY values (7911, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12348.jpg', 'The Griffin Equivalency', 4,'Raj, newly famous because of an article in a magazine, gets a big head and makes a disastrous play for Leonards crush, Penny.',46);
insert into EPISODIO_ENTITY values (7912, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12349.jpg', 'The Euclid Alternative', 5,'Leonard and his friends stage an intervention to make Sheldon confront his longstanding fear of driving.',46);
insert into EPISODIO_ENTITY values (7913, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12350.jpg', 'The Cooper-Nowitzki Theorem', 6,'Young grad students attraction to Sheldon confuses everyone, including Sheldon himself.',46);
insert into EPISODIO_ENTITY values (7914, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12351.jpg', 'The Panty Piñata Polarization', 7,'Penny vows to get revenge on Sheldon when he bans her from the apartment for a series of petty infractions.',46);
insert into EPISODIO_ENTITY values (7915, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12352.jpg', 'The Lizard-Spock Expansion', 8,'Wolowitz thinks hes found the love of his life, until she meets Leonard.',46);
insert into EPISODIO_ENTITY values (7916, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12353.jpg', 'The White Asparagus Triangulation', 9,'Sheldon can barely contain his joy when Leonard starts dating a woman who meets Sheldons exacting standards.',46);
insert into EPISODIO_ENTITY values (7917, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12354.jpg', 'The Vartabedian Conundrum', 10,'When Leonards relationship with a new woman starts moving too fast, he goes to Penny for advice.',46);
insert into EPISODIO_ENTITY values (7918, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12355.jpg', 'The Bath Item Gift Hypothesis', 11,'Christmas is a source of stress for Leonard - whose handsome colleague starts dating Penny - and his friends, who are being tormented by Sheldons obsession with gift-giving etiquette.',46);
insert into EPISODIO_ENTITY values (7919, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12356.jpg', 'The Killer Robot Instability', 12,'When Pennys comment about Wolowitzs love life sends him into a depressed stupor, his friends lose their most important team-mate in an upcoming fighting robot competition.',46);
insert into EPISODIO_ENTITY values (7920, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12357.jpg', 'The Friendship Algorithm', 13,'Socially awkward Sheldon develops a scientific procedure for making friends.',46);
insert into EPISODIO_ENTITY values (7921, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12358.jpg', 'The Financial Permeability', 14,'Sheldons "simple" solution to Pennys financial problem leads to a confrontation between Leonard and Pennys hulking ex-boyfriend, Kurt.',46);
insert into EPISODIO_ENTITY values (7922, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12359.jpg', 'The Maternal Capacitance', 15,'Disastrous visit from Mrs. Hofstadter brings Leonard and Penny closer together.',46);
insert into EPISODIO_ENTITY values (7923, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12360.jpg', 'The Cushion Saturation', 16,'Paintball game leads to a fight between Penny and Sheldon, and romance for Wolowitz and Leslie.',46);
insert into EPISODIO_ENTITY values (7924, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12361.jpg', 'The Terminator Decoupling', 17,'Train trip to San Francisco takes a major detour when Leonard, Sheldon, Wolowitz and Raj discover that beautiful sci-fi actress Summer Glau is onboard.',46);
insert into EPISODIO_ENTITY values (7925, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12362.jpg', 'The Work Song Nanocluster', 18,'Pennys home hair products business becomes a complete nightmare when a caffeine-addled Sheldon takes over.',46);
insert into EPISODIO_ENTITY values (7926, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12363.jpg', 'The Dead Hooker Juxtaposition', 19,'Penny develops a rivalry with a sexy female neighbor who threatens to become "The New Penny" in the building.',46);
insert into EPISODIO_ENTITY values (7927, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12364.jpg', 'The Hofstadter Isotope', 20,'While a fellow comic book-loving pal of the guys romances Penny, Leonard and Wolowitz venture out into the world of "Ladies Night" at a local bar.',46);
insert into EPISODIO_ENTITY values (7928, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12365.jpg', 'The Vegas Renormalization', 21,'Leonard and Koothrappali take a heartbroken Wolowitz to Las Vegas, leaving Sheldon locked out of his apartment and forced to bunk with Penny.',46);
insert into EPISODIO_ENTITY values (7929, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12366.jpg', 'The Classified Materials Turbulence', 22,'Things begin to look up for Leonard when Penny makes a surprising revelation on her second date with Stuart. Meanwhile, Wolowitz enlists his friends help when he discovers a critical design flaw in his project for NASA.',46);
insert into EPISODIO_ENTITY values (7930, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12367.jpg', 'The Monopolar Expedition', 23,'Penny is conflicted when Leonard and his friends decide to spend the summer working - at the North Pole.',46);
insert into EPISODIO_ENTITY values (7931, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12466.jpg', 'The Electric Can Opener Fluctuation', 1,'Sheldon flees back to Texas in disgrace when he learns the guys tampered with his arctic expedition data, forcing the guys to follow him and threatening Leonards hopes for a romantic encounter with Penny.',46);
insert into EPISODIO_ENTITY values (7932, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12467.jpg', 'The Jiminy Conjecture', 2,'Leonard and Penny struggle to recover from an awkward first hookup while Sheldon and Howard stake their best comic books on a bet to determine the species of a cricket.',46);
insert into EPISODIO_ENTITY values (7933, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12468.jpg', 'The Gothowitz Deviation', 3,'Howard and Raj visit a Goth nightclub to pick up women while Sheldon attempts to build a better Penny using chocolate-based behavior modification.',46);
insert into EPISODIO_ENTITY values (7934, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12469.jpg', 'The Pirate Solution', 4,'Raj must find a new job or be sent back to India, but Sheldon has a solution, which leaves Leonard and Penny dealing with Howard as third wheel.',46);
insert into EPISODIO_ENTITY values (7935, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12470.jpg', 'The Creepy Candy Coating Corollary', 5,'While Sheldon settles a score with his nemesis, Wil Wheaton, Wolowitz begs Leonard to get Penny to set him up with one of her friends.',46);
insert into EPISODIO_ENTITY values (7936, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12471.jpg', 'The Cornhusker Vortex', 6,'Sheldon teaches Leonard how to understand football while a kite-fighting incident threatens Howard and Rajs friendship.',46);
insert into EPISODIO_ENTITY values (7937, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12472.jpg', 'The Guitarist Amplification', 7,'An argument between Leonard and Penny proves "inconvenient" to Sheldon.',46);
insert into EPISODIO_ENTITY values (7938, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12473.jpg', 'The Adhesive Duck Deficiency', 8,'With Leonard, Howard and Raj away camping in the desert, an injured Penny has only Sheldon to rely on.',46);
insert into EPISODIO_ENTITY values (7939, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12474.jpg', 'The Vengeance Formulation', 9,'After hes humiliated on National Public Radio, Sheldon vows to destroy Kripke, while Wolowitz tries not to destroy his new relationship with Bernadette.',46);
insert into EPISODIO_ENTITY values (7940, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12475.jpg', 'The Gorilla Experiment', 10,'Sheldon attempts to help Penny understand Leonards work, and Wolowitz becomes jealous when Leonard starts hanging out with his new girlfriend.',46);
insert into EPISODIO_ENTITY values (7941, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/274/687086.jpg', 'The Maternal Congruence', 11,'Visit from Leonards mother delights Sheldon and horrifies Leonard.',46);
insert into EPISODIO_ENTITY values (7942, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12481.jpg', 'The Psychic Vortex', 12,'While Sheldon and Koothrappali attend a university mixer, Leonard is upset to discover that Penny believes in psychics.',46);
insert into EPISODIO_ENTITY values (7943, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12480.jpg', 'The Bozeman Reaction', 13,'When their apartment is robbed, Leonard and Sheldon turn to their friends to create a state-of-the-art security system.',46);
insert into EPISODIO_ENTITY values (7944, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12477.jpg', 'The Einstein Approximation', 14,'Sheldons search for the answer to a physics problem leads him to work at the Cheesecake Factory with Penny.',46);
insert into EPISODIO_ENTITY values (7945, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12479.jpg', 'The Large Hadron Collision', 15,'Leonard can only bring one guest on a trip to see CERNs Large Hadron Collider in Switzerland on Valentines Day.',46);
insert into EPISODIO_ENTITY values (7946, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12482.jpg', 'The Excelsior Acquisition', 16,'Sheldon winds up in traffic court when he gets a ticket because of Penny.',46);
insert into EPISODIO_ENTITY values (7947, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12478.jpg', 'The Precious Fragmentation', 17,'When the guys find a ring from "The Lord of the Rings" at a garage sale, it threatens to tear them apart.',46);
insert into EPISODIO_ENTITY values (7948, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12483.jpg', 'The Pants Alternative', 18,'Sheldons friends come to his aid when his fear of public speaking stands between him and a coveted award.',46);
insert into EPISODIO_ENTITY values (7949, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12484.jpg', 'The Wheaton Recurrence', 19,'Fight between Leonard and Penny threatens their relationship, while Sheldon battles Wil Wheaton in bowling.',46);
insert into EPISODIO_ENTITY values (7950, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12485.jpg', 'The Spaghetti Catalyst', 20,'When Leonard and Penny arent speaking, Sheldon goes to extremes to keep them both happy.',46);
insert into EPISODIO_ENTITY values (7951, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12486.jpg', 'The Plimpton Stimulation', 21,'Leonard and Sheldon compete for the attention of a famous female physicist.',46);
insert into EPISODIO_ENTITY values (7952, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12487.jpg', 'The Staircase Implementation', 22,'Leonard tells Penny about how he met Sheldon for the first time...and what happened to the elevator.',46);
insert into EPISODIO_ENTITY values (7953, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12488.jpg', 'The Lunar Excitation', 23,'While Penny worries that dating Leonard has ruined her for normal guys, Wolowitz and Koothrappali search for Sheldons perfect match online.',46);
insert into EPISODIO_ENTITY values (7954, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12321.jpg', 'The Robotic Manipulation', 1,'Penny finds herself along for the ride on Sheldons first date ever; while Wolowitz finds a new use for a robotic arm.',46);
insert into EPISODIO_ENTITY values (7955, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12322.jpg', 'The Cruciferous Vegetable Amplification', 2,'Sheldon realizes he wont live long enough to download his consciousness into a robot body, and attempts to extend his lifespan.',46);
insert into EPISODIO_ENTITY values (7956, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12323.jpg', 'The Zazzy Substitution', 3,'The guys are concerned as Sheldon searches for an alternative to human companionship.',46);
insert into EPISODIO_ENTITY values (7957, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12324.jpg', 'The Hot Troll Deviation', 4,'An embarrassing secret of Wolowitzs comes to light, while Sheldon and Raj have a small war at work.',46);
insert into EPISODIO_ENTITY values (7958, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12325.jpg', 'The Desperation Emanation', 5,'Leonard realizes hes the only one without a girlfriend, while Sheldon wants to get rid of his.',46);
insert into EPISODIO_ENTITY values (7959, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12326.jpg', 'The Irish Pub Formulation', 6,'Leonard keeps an affair secret from Sheldon, Howard and Raj.',46);
insert into EPISODIO_ENTITY values (7960, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12327.jpg', 'The Apology Insufficiency', 7,'Sheldons answers during an FBI interview put Wolowitzs security clearance in jeopardy.',46);
insert into EPISODIO_ENTITY values (7961, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12328.jpg', 'The 21-Second Excitation', 8,'While the guys camp in line for a screening, Penny and Bernadette invite Amy to her first slumber party.',46);
insert into EPISODIO_ENTITY values (7962, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12329.jpg', 'The Boyfriend Complexity', 9,'Penny asks Leonard to lie to her father, while Howard, Raj and Bernadette pull an all-nighter at a telescope.',46);
insert into EPISODIO_ENTITY values (7963, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12330.jpg', 'The Alien Parasite Hypothesis', 10,'Amy finds she has sexual feelings for Pennys ex, while Koothrappali and Wolowitz try to prove who would be the better superhero.',46);
insert into EPISODIO_ENTITY values (7964, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12331.jpg', 'The Justice League Recombination', 11,'The guys find a "super" use for Pennys new boyfriend, Zack, when they enter a costume contest as the Justice League.',46);
insert into EPISODIO_ENTITY values (7965, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12332.jpg', 'The Bus Pants Utilization', 12,'Leonards idea for a smartphone app derails his friendship with Sheldon.',46);
insert into EPISODIO_ENTITY values (7966, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/12333.jpg', 'The Love Car Displacement', 13,'Tension runs high when everyone is staying at the same hotel for a science event and Bernadette runs into her ex-boyfriend.',46);
