insert into EPISODIO_ENTITY values (8057, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/3/8064.jpg', 'The Prom Equivalency', 8,'When the gang recreates a high school prom on the roof the of the guys apartment building, Sheldon feels pressure to participate in all the typical romantic traditions.',46);
insert into EPISODIO_ENTITY values (8058, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/4/10587.jpg', 'The Septum Deviation', 9,'When Leonard gets minor surgery on his nose, Sheldon is the one in need of sympathy. Meanwhile, Rajs parents impending divorce causes Howard and Bernadette to work on their own marriage.',46);
insert into EPISODIO_ENTITY values (8059, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/8/21689.jpg', 'The Champagne Reflection', 10,'Sheldon says a tearful goodbye to "Fun with Flags." Also, Leonard, Howard and Raj look for something significant in a dead professors research, and Bernadette is shocked to learn her co-workers true feelings from Penny.',46);
insert into EPISODIO_ENTITY values (8060, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/5/14957.jpg', 'The Clean Room Infiltration', 11,'On Christmas Eve, Amy plans a traditional Victorian dinner, while Raj, Leonard and Howard scramble to remove a pigeon that flew into the clean room at the university. To prove a point to Amy, a Scrooge-like Sheldon buys her the worst possible gift.',46);
insert into EPISODIO_ENTITY values (8061, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/7/18901.jpg', 'The Space Probe Disintegration', 12,'Wolowitz tries to distract Raj, who is anxiously awaiting data from a space probe he helped launch. Meanwhile, Sheldon and Leonard go dress shopping with Penny and Amy.',46);
insert into EPISODIO_ENTITY values (8062, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/8/20054.jpg', 'The Anxiety Optimization', 13,'The gang tries to help Sheldon when he becomes stuck in a rut at work by increasing his anxiety level. Howard teases Raj with a new game called "Cinnamon or Emily?"',46);
insert into EPISODIO_ENTITY values (8063, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/8/20814.jpg', 'The Troll Manifestation', 14,'After Leonard and Sheldon co-publish a physics paper, they must defend themselves against criticism from an online bully. Also, girls night finds Penny, Amy and Bernadette confronting embarrassing moments from their past.',46);
insert into EPISODIO_ENTITY values (8064, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/8/22003.jpg', 'The Comic Book Store Regeneration', 15,'Wolowitz receives some shocking news as everyone prepares for the reopening of Stuarts comic book store. Penny teaches Sheldon how to "let it go," but cant follow her own advice after she learns something infuriating about Amy. Also, Leonard and Raj think they spot Nathan Fillion at a restaurant.',46);
insert into EPISODIO_ENTITY values (8065, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/8/22442.jpg', 'The Intimacy Acceleration', 16,'As a joke, Sheldon and Penny try an experiment designed to make participants fall in love. Also, Leonard, Amy, Raj and Emily spend the evening trying to escape a room with a "zombie." And, after returning from Mrs. Wolowitz funeral, Bernadette and Howard run into trouble at the airport.',46);
insert into EPISODIO_ENTITY values (8066, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/9/23019.jpg', 'The Colonization Application', 17,'Trouble arises when Amy learns Sheldon has applied for a one-way mission to colonize Mars. Also, a trip to the pet store ends in a fight for Sheldon and Amy, Leonard surprises Penny with a very "adult" purchase, and, Raj is caught snooping in Emilys apartment.',46);
insert into EPISODIO_ENTITY values (8067, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/9/23725.jpg', 'The Leftover Thermalization', 18,'Friction ensues when a magazine fails to mention Leonard in an article about the paper he co-wrote with Sheldon. Also, a blackout at Mrs. Wolowitzs home leads to a final family dinner in her honor.',46);
insert into EPISODIO_ENTITY values (8068, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/9/24939.jpg', 'The Skywalker Incursion', 19,'When Leonard and Sheldon are invited to speak at UC Berkeley, they take a detour to try to meet an idol. Also, when Bernadette and Howard battle over the fate of his Dr. Who TARDIS, Raj and Amy offer to settle the dispute with a game of ping pong.',46);
insert into EPISODIO_ENTITY values (8069, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/10/25283.jpg', 'The Fortification Implementation', 20,'When Sheldon and Amy build a blanket fort, they come to major crossroads in their relationship. Also, Wolowitz meets the half-brother he never knew he had, and when Penny is invited to appear on Wil Wheatons podcast, she and Leonard have a huge, on-air argument.',46);
insert into EPISODIO_ENTITY values (8070, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/10/25898.jpg', 'The Communication Deterioration', 21,'When Raj is asked to create a message in case a NASA mission discovers alien life, the guys fight over what he should do. Also, Penny is torn between auditioning for a movie or keeping her successful pharmaceutical sales job.',46);
insert into EPISODIO_ENTITY values (8071, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/10/26335.jpg', 'The Graduation Transmission', 22,'Wolowitz questions his engineering abilities when he and Sheldon cant get a toy drone to fly. Meanwhile, a cancelled flight nearly prevents Leonard from giving the commencement address at his former high school, and Raj pits his parents against each other when his father cuts him off financially.',46);
insert into EPISODIO_ENTITY values (8072, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/10/26639.jpg', 'The Maternal Combustion', 23,'Personalities collide when Sheldon and Leonards mothers finally meet. Meanwhile, Howard finally decides to "man up" and do his fair share of the housework - but not without a little help from his friends.',46);
insert into EPISODIO_ENTITY values (8073, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/10/26990.jpg', 'The Commitment Determination', 24,'In the Season 8 finale, Leonard and Penny are pressured to set a wedding date by Sheldon, whose relationship with Amy has taken an interesting turn.',46);
insert into EPISODIO_ENTITY values (8074, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/19/49900.jpg', 'The Matrimonial Momentum', 1,'After driving to Vegas to get married, Penny struggles with Leonards confession that he kissed another girl. Also, Sheldon doesnt know how to act after Amy pushes pause on their relationship.',46);
insert into EPISODIO_ENTITY values (8075, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/21/54054.jpg', 'The Separation Oscillation', 2,'Leonard confronts the woman he kissed on the North Sea in an attempt to set Pennys mind at ease. Also, Sheldon films a special episode of "Fun with Flags" after his breakup with Amy, and Bernadette feels guilty about withholding a secret from Penny.',46);
insert into EPISODIO_ENTITY values (8076, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/22/57320.jpg', 'The Bachelor Party Corrosion', 3,'The guys surprise Leonard with a belated bachelor-party weekend in Mexico, but their plans hit a bump in the road when they get a flat tire on the way. Meanwhile, the girls lean on Penny to tell her unsuspecting family that she and Leonard eloped.',46);
insert into EPISODIO_ENTITY values (8077, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/24/60466.jpg', 'The 2003 Approximation', 4,'Sheldon learns of an impending change in his living arrangements and decides to revert back to 2003, a simpler time before he met Leonard and Penny. Also, Howard and Raj form a band to play at the Comic Book Store.',46);
insert into EPISODIO_ENTITY values (8078, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/25/63818.jpg', 'The Perspiration Implementation', 5,'The guys take a fencing lesson from Barry Kripke and Sheldon finds himself in an awkward position when Kripke expresses interest in Amy. Also, when Stuart struggles to get female customers at the Comic Book Store, Penny, Amy and Bernadette come by to help him out.',46);
insert into EPISODIO_ENTITY values (8079, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/26/66085.jpg', 'The Helium Insufficiency', 6,'In the midst of a nation-wide helium shortage, Sheldon and Leonard take desperate measures to get the supplies they need. Also, Penny and Bernadette download a dating app on Amys phone to try and find her a new man.',46);
insert into EPISODIO_ENTITY values (8080, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/28/70784.jpg', 'The Spock Resonance', 7,'While being interviewed for a documentary about Spock from "Star Trek", Sheldon struggles to suppress his emotions about his recent break-up with Amy. Also, Wolowitz and Bernadette butt heads over remodeling his childhood home.',46);
insert into EPISODIO_ENTITY values (8081, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/29/74753.jpg', 'The Mystery Date Observation', 8,'When Leonard, Penny and Bernadette learn that Amy is going out on a dinner date, the trio set out to spy on her and the guy. Meanwhile, Sheldon recruits Raj and Howard to find a woman for him, since they were responsible for getting Amy and him together.',46);
insert into EPISODIO_ENTITY values (8082, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/31/77852.jpg', 'The Platonic Permutation', 9,'Sheldon and Amy try hanging out as friends when they spend Thanksgiving together at the aquarium. Also, Wolowitz reluctantly agrees to volunteer at the soup kitchen with Bernadette, Raj and Emily, and Penny discovers that Leonard knows more about her than she thought.',46);
insert into EPISODIO_ENTITY values (8083, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/35/88078.jpg', 'The Earworm Reverberation', 10,'Sheldon has a revelation when he realizes why a song was stuck in his head. Also, Amy invites Dave over for dinner despite their previously awkward date, and Wolowitz and Koothrappali become obsessed with a fan of their band, "Footprints on the Moon".',46);
insert into EPISODIO_ENTITY values (8084, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/35/88073.jpg', 'The Opening Night Excitation', 11,'As the guys prepare to go to the premiere of the new Star Wars movie, Sheldon plans a special event for Amys birthday. Also, Leonard, Wolowitz, and Koothrappali must decide who will take their extra Star Wars movie ticket.',46);
insert into EPISODIO_ENTITY values (8085, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/38/95653.jpg', 'The Sales Call Sublimation', 12,'Penny gets more than she bargained for when Leonard agrees to meet with a psychiatrist on her behalf. Also, Sheldon and Koothrappali collaborate on an astronomical discovery, and Wolowitz and Bernadette cant believe what they are feeling after Stuart moves out.',46);
insert into EPISODIO_ENTITY values (8086, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/39/99008.jpg', 'The Empathy Optimization', 13,'After having to deal with a sick Sheldon, Leonard, Penny and the gang try to treat themselves to a Sheldon-free weekend.',46);
insert into EPISODIO_ENTITY values (8087, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/42/105461.jpg', 'The Meemaw Materialization', 14,'Sheldons thrilled when his Meemaw comes to visit, but his excitement quickly fades when she butts heads with Amy. Also, Raj meets a new girl at the comic book store who makes him question his relationship with Emily.',46);
insert into EPISODIO_ENTITY values (8088, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/43/109341.jpg', 'The Valentino Submergence', 15,'Sheldon and Amy host a live Valentines Day episode of Fun with Flags, Leonard and Penny grapple with getting older, Howard and Bernadette find a surprise in their hot tub and Raj is torn between Emily and the cute girl he met at the Comic Bookstore.',46);
insert into EPISODIO_ENTITY values (8089, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/45/112735.jpg', 'The Positive Negative Reaction', 16,'When the gang finds out about Bernadettes pregnancy, they celebrate by singing karaoke. Also, Bernadette is concerned when Wolowitz freaks out over her pregnancy announcement, and Wolowitz is convinced he must make more money to provide for the baby.',46);
insert into EPISODIO_ENTITY values (8090, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/45/114362.jpg', 'The Celebration Experimentation', 17,'After more than nine years together, the gang finally celebrates Sheldons birthday, surprising him with a special guest.',46);
insert into EPISODIO_ENTITY values (8091, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/47/118490.jpg', 'The Application Deterioration', 18,'Leonard, Sheldon, and Wolowitz run into problems when they file for a patent for their infinite persistence gyroscope. Also, Penny, Amy and Bernadette give Koothrappali dating advice when Emily reaches out to him after their breakup.',46);
insert into EPISODIO_ENTITY values (8092, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/50/126936.jpg', 'The Solder Excursion Diversion', 19,'Amy is shocked at a revelation from Sheldon after she buys him a new laptop. Also, Koothrappali sells out Leonard and Wolowitz after they lie to their wives in order to attend an early screening of a movie.',46);
insert into EPISODIO_ENTITY values (8093, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/52/130380.jpg', 'The Big Bear Precipitation', 20,'Sheldon spills a secret of Leonards when the two take a weekend cabin trip with Penny and Amy. Also, when Koothrappali goes overboard with pregnancy gifts, Wolowitz and Bernadette must draw the line.',46);
insert into EPISODIO_ENTITY values (8094, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/55/137822.jpg', 'The Viewing Party Combustion', 21,'Everyone must choose sides when a small argument between Leonard and Sheldon erupts into a heated fight during a group get-together.',46);
insert into EPISODIO_ENTITY values (8095, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/55/137821.jpg', 'The Fermentation Bifurcation', 22,'The gang goes to a wine bar and runs into Pennys old boyfriend, Zack. Also, Bernadette gets stuck spending the evening with Sheldon when she cant go wine tasting with the group, and things dont go as planned when Koothrappali introduces his new girlfriend, Claire.',46);
insert into EPISODIO_ENTITY values (8096, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/56/140332.jpg', 'The Line Substitution Solution', 23,'Sheldon hires Stuart to spend the day with Amy when hed rather go to a movie screening. Also, Leonards mother, Beverly, comes to town and Penny struggles to make a connection with her.',46);
insert into EPISODIO_ENTITY values (8097, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/55/139271.jpg', 'The Convergence Convergence', 24,'Chaos ensues when Leonards recently divorced parents, Alfred and Beverly, and Sheldons devoutly religious mother, Mary, come to town. Also, Wolowitz and Koothrappali think the government is out to get them when they are contacted about their guidance system.',46);
insert into EPISODIO_ENTITY values (8098, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/75/189808.jpg', 'The Conjugal Conjecture', 1,'After Sheldons mother and Leonards father share an evening together, everyone deals with an awkward morning the following day. Also, Pennys family arrives for the ceremony, including her anxiety-ridden mother, Susan, and her drug dealing brother, Randall.',46);
insert into EPISODIO_ENTITY values (8099, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/75/189160.jpg', 'The Military Miniaturization', 2,'Colonel Williams, an Air Force representative from the Department of Material Command sits down to talk with Wolowitz.',46);
insert into EPISODIO_ENTITY values (8100, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/78/196809.jpg', 'The Dependence Transcendence', 3,'Tensions rise when the boys struggle to complete their government project on time and Sheldon tries an energy drink to stay awake. Also, Penny and Amy go to a "party" at Bert the geologists house, and Kooothrappali learns Bernadettes true feelings about her pregnancy when they clean out the future baby room.',46);
insert into EPISODIO_ENTITY values (8101, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/79/198605.jpg', 'The Cohabitation Experimentation', 4,'When Amys apartment floods, she proposes a "cohabitation experiment" with Sheldon. Also, Howard and Bernadette are upset when Koothrappali learns the gender of the baby before they do.',46);
insert into EPISODIO_ENTITY values (8102, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/80/201958.jpg', 'The Hot Tub Contamination', 5,'Leonard and Penny must separate a quarreling Sheldon and Amy when their cohabitation does not go as planned, and Sheldon threatens to break off their relationship when Amy refuses to adhere to the bathroom schedule. Also, Howard and Bernadette find unexpected guests at their house when they decide to stay home from a planned vacation.',46);
insert into EPISODIO_ENTITY values (8103, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/82/207208.jpg', 'The Fetal Kick Catalyst', 6,'Penny is surprised to learn she has fans of her performance in "Serial Ape-ist" when she attends Van Nuys Comic Con with Leonard. Also, Amy hosts a Sheldon-style brunch at Pennys apartment, and Wolowitz makes an impulsive purchase when he starts stressing out about the baby on the way.',46);
insert into EPISODIO_ENTITY values (8104, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/84/210793.jpg', 'The Veracity Elasticity', 7,'In order to continue living with Sheldon, Amy lies to him about repairs being made to her apartment and they host an "on location" episode of "Fun With Flags" in Pennys apartment. Also, Leonard lets Penny decorate Sheldons old room after he learns that she has been secretly moving Leonards collectibles into storage.',46);
insert into EPISODIO_ENTITY values (8105, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/84/210794.jpg', 'The Brain Bowl Incubation', 8,'After a successful experiment combining their genes, Sheldon will stop at nothing to convince Amy they should procreate. Also, Koothrappali is embarrassed to tell the gang what the new woman hes dating does for a living.',46);
insert into EPISODIO_ENTITY values (8106, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/85/213120.jpg', 'The Geology Elevation', 9,'When Bert, a Caltech geologist, wins the MacArthur Genius fellowship, Sheldon is overcome with jealousy. Also, Wolowitz finds an old remote control Stephen Hawking action figure he invented.',46);
insert into EPISODIO_ENTITY values (8107, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/89/223174.jpg', 'The Property Division Collision', 10,'Sheldon and Leonard must divide up their possessions and remove Pennys things from 4B.',46);
insert into EPISODIO_ENTITY values (8108, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/89/223173.jpg', 'The Birthday Synchronicity', 11,'Sheldon and Amy attempt to have an intimate moment together to celebrate Amys birthday; Bernadette and Wolowitz welcome their newborn baby to the world.',46);
insert into EPISODIO_ENTITY values (8109, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/92/230610.jpg', 'The Holiday Summation', 12,'Sheldon and Amy visit Leonard and Penny for the first time since the holidays and share details about their terrible trip to Texas.',46);
insert into EPISODIO_ENTITY values (8110, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/94/235969.jpg', 'The Romance Recalibration', 13,'Leonard and Penny ask for Sheldons and Amys help on putting the romance back in their marriage. Howard and Raj go to extreme lengths to stop the floor in Halleys bedroom from making noise.',46);
insert into EPISODIO_ENTITY values (8111, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/96/241037.jpg', 'The Emotion Detection Automation', 14,'Sheldon beta tests an MIT invention after hearing it can help him read peoples emotions. Also, Leonard cant hide his feelings when Penny announces her brother is coming to town and Raj invites his ex-girlfriends over to give him dating advice.',46);
insert into EPISODIO_ENTITY values (8112, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/97/243824.jpg', 'The Locomotion Reverberation', 15,'Leonard and Wolowitz try to distract Sheldon when he slows the progress of their guidance system. Also, Penny and Amy take Bernadette out for the night, leaving Raj and Stuart to care for baby Halley.',46);
insert into EPISODIO_ENTITY values (8113, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/98/247215.jpg', 'The Allowance Evaporation', 16,'Sheldon and Amy have their first fight since moving in together, and Koothrappali is shocked at the realities of financial independence when he stops receiving support from his father.',46);
insert into EPISODIO_ENTITY values (8114, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/99/249435.jpg', 'The Comic-Con Conundrum', 17,'With Koothrappali cut off from his fathers fortune, he appoints Sheldon to help him get out of debt. Also, Penny considers joining Leonard at Comic-Con.',46);
insert into EPISODIO_ENTITY values (8115, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/101/253767.jpg', 'The Escape Hatch Identification', 18,'When Raj moves out of his apartment, Leonard and Penny offer him Sheldons old room.',46);
insert into EPISODIO_ENTITY values (8116, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/104/262432.jpg', 'The Collaboration Fluctuation', 19,'Leonard, Penny and Raj adjust to their new living arrangement, and Sheldon takes an interest in Amys work.',46);
insert into EPISODIO_ENTITY values (8117, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/105/264736.jpg', 'The Recollection Dissipation', 20,'Sheldon pushes himself to the limit when he collaborates on projects with Leonard and Wolowitz as well as Amy on the same day. Also, Bernadette is nearing the end of her maternity leave and must return to work.',46);
insert into EPISODIO_ENTITY values (8118, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/108/270249.jpg', 'The Separation Agitation', 21,'Howard and Bernadette have a hard time leaving Halley in day care when Bernadette returns to work. Also, Bert introduces the gang to his new girlfriend, Rebecca.',46);
insert into EPISODIO_ENTITY values (8119, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/109/273806.jpg', 'The Cognition Regeneration', 22,'Leonard isnt thrilled when Penny considers taking a new job offered by her ex-boyfriend, Zack.',46);
insert into EPISODIO_ENTITY values (8120, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/110/276419.jpg', 'The Gyroscopic Collapse', 23,'After Leonard, Sheldon and Wolowitz celebrate the completion of the top secret air force project, they are met with an unpleasant surprise. Also, Amy is offered a summer position as a visiting researcher.',46);
insert into EPISODIO_ENTITY values (8121, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/111/278822.jpg', 'The Long Distance Dissonance', 24,'The gang is concerned when Sheldons former admirer, Dr. Ramona Nowitzki, resurfaces while Amy is away at Princeton.',46);
insert into EPISODIO_ENTITY values (8122, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/142/355239.jpg', 'The Proposal Proposal', 1,'Amy gives Sheldon an answer to his proposal while Howard and Bernadette struggle with some unexpected news.',46);
insert into EPISODIO_ENTITY values (8123, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/142/355242.jpg', 'The Retraction Reaction', 2,'Leonard angers the university – and the entire physics community – after he gives an embarrassing interview. Also, Amy and Bernadette bond over having to hide their success from Sheldon and Howard.',46);
insert into EPISODIO_ENTITY values (8124, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/142/355243.jpg', 'The Relaxation Integration', 3,'As Sheldon stresses about picking a wedding date, Amy tries to convince him he has a more laid-back side. Also, Koothrappali and Stuart compete to win the heart of Bernadettes new coworker, Ruchi.',46);
insert into EPISODIO_ENTITY values (8125, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/131/329424.jpg', 'The Explosion Implosion', 4,'Howard and Sheldon bond when they drive to the desert to shoot off a model rocket. Also, when Leonards mom, Beverly, finds a new best friend in Penny, it rubs Leonard the wrong way.',46);
insert into EPISODIO_ENTITY values (8126, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/132/331050.jpg', 'The Collaboration Contamination', 5,'Sheldon and Koothrappali confide in Bernadette when they cant handle Amy and Wolowitz working together. Also, Penny and Leonard learn new tactics for how to deal Sheldon from an unlikely source.',46);
insert into EPISODIO_ENTITY values (8127, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/132/332326.jpg', 'The Proton Regeneration', 6,'Sheldon goes head-to-head with Wil Wheaton for the role of the new Professor Proton. Also, Penny steps in to take care of Halley when Bernadette and Wolowitz both wind up on bed rest.',46);
insert into EPISODIO_ENTITY values (8128, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/134/335924.jpg', 'The Geology Methodology', 7,'Sheldon and Bert collaborate on a research project, despite Sheldons embarrassment. Also, Penny and Bernadette coach Koothrappali on how to navigate his relationship with Ruchi.',46);
insert into EPISODIO_ENTITY values (8129, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/135/339330.jpg', 'The Tesla Recoil', 8,'Leonard and Wolowitz are furious after they learn Sheldon went to work with the military behind their backs. Also, while Bernadette is on bed rest, she asks Raj to do some digging when she suspects Ruchi is trying to steal her job.',46);
insert into EPISODIO_ENTITY values (8130, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/136/342276.jpg', 'The Bitcoin Entanglement', 9,'Sheldon tries to teach the guys a lesson after they cut him out of a potentially valuable Bitcoin investment. Also, a seven-year-old video reveals a secret about Leonard and Pennys relationship.',46);
insert into EPISODIO_ENTITY values (8131, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/137/344140.jpg', 'The Confidence Erosion', 10,'Sheldon and Amy try to eliminate stress from wedding planning by applying math to the process. Also, Koothrappali "breaks up" with Wolowitz after realizing his best friend is actually hurting his confidence.',46);
insert into EPISODIO_ENTITY values (8132, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/138/346472.jpg', 'The Celebration Reverberation', 11,'Sheldon and Wolowitz plan birthday celebrations for Amy and Halley, respectively. Also, Leonard receives a Christmas letter from his brother that causes him to spiral out about his own lack of accomplishments.',46);
insert into EPISODIO_ENTITY values (8133, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/141/352926.jpg', 'The Matrimonial Metric', 12,'To discover who would be most qualified to be best man and maid of honor at their wedding, Sheldon and Amy subject their friends to a series of secret experiments. Also, Penny reveals her true feelings about Amy.',46);
insert into EPISODIO_ENTITY values (8134, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/142/355438.jpg', 'The Solo Oscillation', 13,'When Sheldon kicks Amy out to work solo, she and Leonard bond during a series of science experiments. Also, Bert the geologist replaces Wolowitz in the band Footprints on the Moon, and Sheldon finds Penny a surprising source of scientific inspiration.',46);
insert into EPISODIO_ENTITY values (8135, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/142/356979.jpg', 'The Separation Triangulation', 14,'Koothrappali finds himself in the middle of domestic drama when he learns the woman hes dating, Nell, has a very upset husband, Oliver. Also, when Sheldon rents his old room back for a quiet place to work, he drives Leonard crazy by being a model tenant.',46);
insert into EPISODIO_ENTITY values (8136, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/144/361596.jpg', 'The Novelization Correlation', 15,'When Sheldon petitions Wil Wheaton to appear on the new Professor Proton show, Wil offers a role to Amy instead. Also, Penny gets angry when she thinks the female protagonist in Leonards novel is based on her.',46);
insert into EPISODIO_ENTITY values (8137, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/147/368495.jpg', 'The Neonatal Nomenclature', 16,'When Bernadette wont go into labor, all her friends try different tactics to get things started. Also, Wolowitz confronts Bernadette after Amy accidentally reveals shes already chosen their sons name.',46);
insert into EPISODIO_ENTITY values (8138, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/148/371530.jpg', 'The Athenaeum Allocation', 17,'Leonard jumps through hoops to help secure the perfect wedding venue for Sheldon and Amy. Also, Bernadette and Wolowitz have a hard time deciding who should stay at home with the kids and who should go back to work.',46);
insert into EPISODIO_ENTITY values (8139, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/151/379315.jpg', 'The Gates Excitation', 18,'Penny gets the opportunity to host Bill Gates at work when his company wants to partner with her pharmaceutical company. Also, Leonard, Koothrappali and Wolowitz do everything in their power to meet him, while Sheldon thinks he is the victim of an April Fools prank.',46);
insert into EPISODIO_ENTITY values (8140, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/151/379314.jpg', 'The Tenant Disassociation', 19,'When Leonard learns Sheldon is the president of the tenants association, he decides to run against him. Also, Bernadette encourages Wolowitz and Koothrappali to find the owner of a drone after they find it in the backyard.',46);
insert into EPISODIO_ENTITY values (8141, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/152/381194.jpg', 'The Reclusive Potential', 20,'A brilliant but reclusive scientist, Doctor Wolcott, invites Sheldon to his cabin in the middle of nowhere, and Leonard, Raj and Howard go along for the trip. Also, Penny and Bernadette improvise after Amy doesnt like the tame bachelorette party they planned for her.',46);
insert into EPISODIO_ENTITY values (8142, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/153/382793.jpg', 'The Comet Polarization', 21,'Sheldons comic book store experiences changes when writer Neil Gaiman puts Stuarts store on the map. Also, Koothrappali takes credit for Pennys astronomical discovery, and friendships are threatened.',46);
insert into EPISODIO_ENTITY values (8143, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/154/386157.jpg', 'The Monetary Insufficiency', 22,'Sheldon goes to Vegas to win money for science. Also, Penny and Bernadette take Amy wedding dress shopping, but her terrible choice entangles them in a web of lies.',46);
insert into EPISODIO_ENTITY values (8144, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/154/386385.jpg', 'The Sibling Realignment', 23,'When Sheldon learns that his mother wont attend his wedding unless he invites his brother, Georgie, he and Leonard travel to Texas to end a family feud. Also, the Wolowitz kids inadvertently infest Amy, Bernadette, Wolowitz and Koothrappali with pinkeye.',46);
insert into EPISODIO_ENTITY values (8145, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/155/388166.jpg', 'The Bow Tie Asymmetry', 24,'Amy and Sheldons wedding provides Sheldon with the information he needs to make a breakthrough in his symmetrical string theory. Meanwhile, their friends pick up Sheldon and Amys families from the airport, and Mark Hamill agrees to officiate at the ceremony.',46);
insert into EPISODIO_ENTITY values (8146, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/170/425575.jpg', 'The Conjugal Configuration', 1,'Sheldon and Amys honeymoon runs aground in New York, while Penny and Leonard discover they are uncomfortably similar to Amys parents, Mr. and Mrs. Fowler. Also, Koothrappali insults physicist Neil deGrasse Tyson and starts a Twitter war.',46);
insert into EPISODIO_ENTITY values (8147, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/170/425574.jpg', 'The Wedding Gift Wormhole', 2,'Sheldon and Amy drive themselves crazy trying to figure out what "perfect gift" Leonard and Penny gave them for their wedding. Also, Koothrappali decides he wants to settle down and asks his father to arrange a marriage for him.',46);
insert into EPISODIO_ENTITY values (8148, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/170/425573.jpg', 'The Procreation Calculation', 3,'The Wolowitzes life gets complicated when Stuart starts bringing his new girlfriend home. Also, Penny and Leonard talk about starting a family while Koothrappali explores an arranged marriage.',46);
insert into EPISODIO_ENTITY values (8149, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/171/428314.jpg', 'The Tam Turbulence', 4,'When Sheldon wont tell anyone why hes never mentioned Tam, his childhood best friend, Leonard takes matters into his own hands. Also, Bernadette and Penny take out Rajs fiancée, Anu, for dinner to get the skinny on her.',46);
insert into EPISODIO_ENTITY values (8150, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/171/429994.jpg', 'The Planetarium Collision', 5,'When Amy doesnt have time to work on super-asymmetry, Sheldon goes to great lengths to ensure shes available to work with him even it if means accidentally sabotaging her career in the process. Also, Koothrappali doesnt want Wolowitz to join him in hosting a show at the planetarium.',46);
insert into EPISODIO_ENTITY values (8151, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/172/431129.jpg', 'The Imitation Perturbation', 6,'When Wolowitz dresses up as Sheldon for Halloween, Sheldon seeks retaliation at Leonard and Pennys Halloween party. Also, Leonard is shocked that Penny doesnt remember their first kiss.',46);
insert into EPISODIO_ENTITY values (8152, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/173/433874.jpg', 'The Grant Allocation Derivation', 7,'Leonard is caught between a rock and a hard place when hes responsible for distributing extra grant money. Also, Bernadette turns the backyard playhouse into a hideaway from her husband and kids.',46);
insert into EPISODIO_ENTITY values (8153, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/174/435544.jpg', 'The Consummation Deviation', 8,'Sheldon tries to bond with Amys father, but when Wolowitz lures Mr. Fowler away with magic tricks, Sheldon has no choice but to bond with Mrs. Fowler. Also, Koothrappali and Anu try to get physical for the first time.',46);
insert into EPISODIO_ENTITY values (8154, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/174/435847.jpg', 'The Citation Negation', 9,'Sheldon and Amy are devastated after learning from a Russian paper that Super Asymmetry has already been discovered and disproven. Also, ultra-competitive Bernadette asks Stuarts girlfriend, Denise, to teach her how to beat Howard in a popular videogame.',46);
insert into EPISODIO_ENTITY values (8155, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/176/441718.jpg', 'The VCR Illumination', 10,'Sheldon and Amy are still down about their theory being disproven, but a VHS tape from Sheldons past inspires him not to give up. Also, Bernadette turns into a pageant mom when she tries to help Wolowitz ace his Magic Castle audition.',46);
insert into EPISODIO_ENTITY values (8156, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/179/447871.jpg', 'The Paintball Scattering', 11,'Penny and Leonard organize a paintball game that results in mayhem when Sheldon is jealous of Amy. Also, Koothrappali catches Anu with her ex-boyfriend, and Stuart doesnt want to move in with Denise.',46);
insert into EPISODIO_ENTITY values (8157, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/179/449443.jpg', 'The Propagation Proposition', 12,'Pennys ex-boyfriend, Zack, and his wife want a baby, but when Zack is infertile, they ask Leonard for help. Also, Koothrappali attempts to mend things with his ex-fiancée, Anu.',46);
insert into EPISODIO_ENTITY values (8158, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/180/450967.jpg', 'The Confirmation Polarization', 13,'When Sheldon and Amys super asymmetry theory is proven by two physicists, Dr. Pemberton and Dr. Campbell from Chicago, theyre thrilled, until they try to kick Amy off the Nobel nomination. Also, Bernadette has a big success at work and Pennys going to be a part of it – whether she wants to or not.',46);
insert into EPISODIO_ENTITY values (8159, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/182/455458.jpg', 'The Meteorite Manifestation', 14,'Sheldon is thrilled to help Bernadette and Wolowitz navigate bureaucratic paperwork, until he discovers they are breaking the law. Also, Leonard is disappointed when his friends exclude him from a scientific project.',46);
insert into EPISODIO_ENTITY values (8160, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/182/457473.jpg', 'The Donation Oscillation', 15,'Penny tries to seduce an abstaining Leonard to ruin his "donation" for her ex-boyfriend, Zack, and his wife, Marissa. Also, Wolowitz, Bernadette, Anu and Koothrappali turn Koothrappalis canceled bachelor party into a couples trip aboard the "vomit comet".',46);
insert into EPISODIO_ENTITY values (8161, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/184/462416.jpg', 'The D & D Vortex', 16,'When the gang finds out Wil Wheaton hosts a celebrity Dungeons and Dragons game involving William Shatner, Joe Manganiello, Kareem Abdul-Jabbar and Kevin Smith, deception and betrayal are the path to make it to the one open seat.',46);
insert into EPISODIO_ENTITY values (8162, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/186/467456.jpg', 'The Conference Valuation', 17,'When Penny and Bernadette go to San Diego for a pharmaceutical sales convention, Wolowitz is in charge of the kids. Also, Sheldon finds a book on experimenting on kids, and the guys plus Amy make a day of it.',46);
insert into EPISODIO_ENTITY values (8163, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/190/476575.jpg', 'The Laureate Accumulation', 18,'When competitors Pemberton and Campbell charm America on a publicity tour, Sheldon and Amy try to bring Nobel laureates Kip Thorne, George Smoot and Frances Arnold to their side. Also, Halleys fear of the dark leads to opportunity and conflict for Howard, Bernadette and Stuart.',46);
insert into EPISODIO_ENTITY values (8164, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/192/480675.jpg', 'The Inspiration Deprivation', 19,'The concept of what it would mean for women everywhere if Amy were to win a Nobel Prize causes Amy to have a meltdown. Also, Koothrappali and Wolowitz try to relive the good old days after Wolowitz buys a scooter that looks like the one he had years ago.',46);
insert into EPISODIO_ENTITY values (8165, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/193/483551.jpg', 'The Decision Reverberation', 20,'Koothrappali is worried people wont take him seriously in his own field after publishing a paper that suggests he may have discovered alien life. Also, Leonard wants to be the principal investigator on a plasma physics study.',46);
insert into EPISODIO_ENTITY values (8166, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/194/485926.jpg', 'The Plagiarism Schism', 21,'Kripke has proof that Dr. Pemberton plagiarized his thesis in college, and Sheldon and Amy arent sure if they should turn him in or not. Also, Wolowitz is happily surprised to learn that Bernadette wasnt the only waitress at the Cheesecake Factory who had a crush on him back in the day.',46);
insert into EPISODIO_ENTITY values (8167, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/195/489825.jpg', 'The Maternal Conclusion', 22,'Leonard is pleasantly surprised when Beverly comes to visit and shes genuinely kind to him, until he finds out the real reason shes there. Also, Denise and Stuart overstay their welcome at the Wolowitz house.',46);
insert into EPISODIO_ENTITY values (8168, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493238.jpg', 'The Change Constant', 23,'Sheldon and Amy await big news.',46);
insert into EPISODIO_ENTITY values (8169, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/493243.jpg', 'The Stockholm Syndrome', 24,'Bernadette and Wolowitz leave their kids for the first time; Penny and Leonard try to keep a secret; Sheldon and Amy stick together; and Koothrappali makes a new friend, as the gang travels together into an uncharted future.',46);
