insert into EPISODIO_ENTITY values (8170, 65, 'https://static.tvmaze.com/uploads/images/medium_landscape/194/485593.jpg', '1:23:45', 1,'April 26, 1986, Ukrainian SSR. Plant workers and firefighters put their lives on the line to control a catastrophic 1986 explosion at a Soviet nuclear power plant.',47);
insert into EPISODIO_ENTITY values (8171, 70, 'https://static.tvmaze.com/uploads/images/medium_landscape/195/487666.jpg', 'Please Remain Calm', 2,'With untold millions at risk after the Chernobyl explosion, nuclear physicist Ulana Khomyuk makes a desperate attempt to reach Valery Legasov, a leading Soviet nuclear physicist, and warn him about the threat of second explosion that could devastate the continent.',47);
insert into EPISODIO_ENTITY values (8172, 66, 'https://static.tvmaze.com/uploads/images/medium_landscape/196/491554.jpg', 'Open Wide, O Earth', 3,'Lyudmilla Ignatenko, a Pripyat resident, ignores warning about her firefighter husbands contamination; Valery Legasov lays out a decontamination plan, complete with human risks.',47);
insert into EPISODIO_ENTITY values (8173, 71, 'https://static.tvmaze.com/uploads/images/medium_landscape/197/492747.jpg', 'The Happiness of All Mankind', 4,'Valery Legasov and Soviet Deputy Prime Minister Boris Shcherbina consider using lunar rovers to remove radioactive debris, while Ulana Khomyuk faces government hurdles in determining the truth about the cause of the explosion.',47);
insert into EPISODIO_ENTITY values (8174, 78, 'https://static.tvmaze.com/uploads/images/medium_landscape/198/496912.jpg', 'Vichnaya Pamyat', 5,'Valery Legasov, Boris Shcherbina and Ulana Khomyuk risk their lives and reputations to expose the truth about Chernobyl.',47);
