insert into EPISODIO_ENTITY values (8175, 90, 'https://static.tvmaze.com/uploads/images/medium_landscape/432/1082204.jpg', 'A Study in Pink', 1,'A war hero, invalided home from Afghanistan, meets a strange but charismatic genius who is looking for a flatmate - it is London in 2010, and Dr Watson and Sherlock Holmes are meeting for the first time. A string of impossible suicides has Scotland Yard baffled - and only one man can help.',48);
insert into EPISODIO_ENTITY values (8176, 90, 'https://static.tvmaze.com/uploads/images/medium_landscape/432/1082205.jpg', 'The Blind Banker', 2,'A mysterious cipher is being scrawled on the walls around London. The first person to see the cipher is dead within hours of reading it. Sherlock plunges into a world of codes and symbols, consulting with Londons best graffiti artists. He soon learns that the city is in the grip a gang of international smugglers, a secret society called the Black Lotus.',48);
insert into EPISODIO_ENTITY values (8177, 90, 'https://static.tvmaze.com/uploads/images/medium_landscape/432/1082206.jpg', 'The Great Game', 3,'A strange clue in an empty room, a blood-soaked car, a priceless Old Master, a deranged bomber. With the clock ticking, the curtain rises on a battle of wits between Sherlock, John and the shadowy stranger who seems to know all the answers...',48);
insert into EPISODIO_ENTITY values (8178, 90, 'https://static.tvmaze.com/uploads/images/medium_landscape/234/587222.jpg', 'A Scandal in Belgravia', 1,'Rejoin the 21st-century team of Sherlock Holmes and Dr. Watson as they battle the worst that modern criminality has to offer.',48);
insert into EPISODIO_ENTITY values (8179, 90, 'https://static.tvmaze.com/uploads/images/medium_landscape/234/587221.jpg', 'The Hounds of Baskerville', 2,'Watch Sherlock and Watson pursue information about research on genetically engineered animals for military use.',48);
insert into EPISODIO_ENTITY values (8180, 90, 'https://static.tvmaze.com/uploads/images/medium_landscape/234/587220.jpg', 'The Reichenbach Fall', 3,'Watch as Moriarty poses the "final problem" and a tabloid reporter reveals the "shocking truth" about Sherlock.',48);
insert into EPISODIO_ENTITY values (8181, 90, 'https://static.tvmaze.com/uploads/images/medium_landscape/234/587219.jpg', 'The Empty Hearse', 1,'Just one more miracle, Sherlock. Stop being dead. Two years after the devastating events of The Reichenbach Fall, Dr John Watson has got on with his life. New horizons, romance and a comforting domestic future beckon.But with London under threat of a huge terrorist attack, Sherlock Holmes is about to rise from the grave with all the theatricality that comes so naturally to him. Its what his best friend wanted more than anything, but for John Watson it might well be a case of be careful what you wish for!If Sherlock thinks everything will be just as he left it, though, he is in for a very big surprise...',48);
insert into EPISODIO_ENTITY values (8182, 90, 'https://static.tvmaze.com/uploads/images/medium_landscape/234/587218.jpg', 'The Sign of Three', 2,'Sherlock faces his biggest challenge of all - delivering a best mans speech on Johns wedding day.',48);
insert into EPISODIO_ENTITY values (8183, 90, 'https://static.tvmaze.com/uploads/images/medium_landscape/234/587217.jpg', 'His Last Vow', 3,'Sherlock goes after publishing magnate and blackmailer Charles Magnussen, one of the most despicable criminals that he has ever encountered.',48);
insert into EPISODIO_ENTITY values (8184, 90, 'https://static.tvmaze.com/uploads/images/medium_landscape/234/587215.jpg', 'The Six Thatchers', 1,'While waiting for Moriarty to make good on his beyond-the-grave threat, Sherlock is intrigued by cases of vandalism where the criminal is breaking open busts of Margaret Thatcher. He soon discovers that the vandalism is tied to Marys past.',48);
insert into EPISODIO_ENTITY values (8185, 90, 'https://static.tvmaze.com/uploads/images/medium_landscape/234/587214.jpg', 'The Lying Detective', 2,'To save John, Sherlock takes on the most dangerous case of his career: bring serial killer and milliionaire-philanthropist Culverton Smith to justice. Meanwhile, the mystery of Sherringford Holmes deepens.',48);
insert into EPISODIO_ENTITY values (8186, 90, 'https://static.tvmaze.com/uploads/images/medium_landscape/234/587213.jpg', 'The Final Problem', 3,'Sherlock and John confirm that Eurus is still alive, and go to Sherringford to meet with her. However, they soon discover that it is all part of Eurus master plan.',48);
