insert into SERIE_ENTITY  values (49, 2023,'https://static.tvmaze.com/uploads/images/medium_portrait/479/1198409.jpg', 'Frieren: Beyond Journeys End', 'The mage Frieren defeated the Demon King alongside the hero Himmels party after a 10-year quest. Peace was restored to the kingdom. Because she is an elf, she is able to live over a thousand years. She promises Himmel and the others that she will be back to see them and then sets out on a journey by herself. Fifty years later, Frieren goes to visit Himmel and the others. She remained unchanged, but Himmel and the others have aged and only a little of their lives remain. Later, she witnesses Himmels death. Frieren is pained by her desire to have spent more time getting to know people. With that regret in her heart, she then goes on a journey to do just that. On her journey, she meets many people and many events await her.','https://i.ytimg.com/vi/uZXHRHn-foY/maxresdefault.jpg');
insert into SERIE_ENTITY_PLATAFORMAS  values (49, 5);
insert into SERIE_ENTITY_PLATAFORMAS  values (49, 3);
insert into CATEGORIA_ENTITY  values (15, 'https://www.mundodeportivo.com/alfabeta/hero/2023/04/mejores-anime-largos.jpg?width=768&aspect_ratio=16:9&format=nowebp','Anime');
insert into SERIE_ENTITY_CATEGORIAS values (49, 15);
insert into EPISODIO_ENTITY values (8187, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/505/1264161.jpg', 'The Journeys End', 1,'The world celebrates the Demon Kings defeat at the hands of the Hero and his companions. Now that their great adventure is over, what will Frieren the mage do next?',49);
insert into EPISODIO_ENTITY values (8188, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/505/1264162.jpg', 'It Didnt Have to Be Magic...', 2,'Frieren instructs Fern in the use of magic while deciphering a grimoire for Heiter.',49);
insert into EPISODIO_ENTITY values (8189, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/505/1264165.jpg', 'Killing Magic', 3,'While retracing the path she took on her adventure with her former traveling companions, Frieren confronts an old enemy.',49);
insert into EPISODIO_ENTITY values (8190, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/505/1264166.jpg', 'The Land Where Souls Rest', 4,'Frieren and Fern pay a visit to Eisen, who requests their help in finding the notes of Flamme the Legendary Mage.',49);
insert into EPISODIO_ENTITY values (8191, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/505/1264167.jpg', 'Phantoms of the Dead', 5,'Frieren and Fern investigate ghost sightings at a village where people have started going missing.',49);
insert into EPISODIO_ENTITY values (8192, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/505/1264168.jpg', 'The Hero of the Village', 6,'Frieren and Fern enlist Starks help to fight the solar dragon - but is he up to the task?',49);
insert into EPISODIO_ENTITY values (8193, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/505/1264169.jpg', 'Like a Fairy Tale', 7,'After reflecting on the transient nature of the past as it exists in peoples collective memories, Frieren unexpectedly runs into a sworn enemy.',49);
insert into EPISODIO_ENTITY values (8194, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/505/1264170.jpg', 'Frieren the Slayer', 8,'As tensions in Graf Granats domain reach a breaking point, Fern and Stark find their own resolve - and Frieren resumes an old duty.',49);
insert into EPISODIO_ENTITY values (8195, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/505/1264174.jpg', 'Aura the Guillotine', 9,'While Fern and Stark make a temporary retreat with Graf Granat, Frierens true foe awaits her outside the city.',49);
insert into EPISODIO_ENTITY values (8196, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/505/1264175.jpg', 'A Powerful Mage', 10,'Frierens many years of training under her teacher Flamme are tested in her confrontation with Aura the Guillotine. Will Auras scales find her wanting?',49);
insert into EPISODIO_ENTITY values (8197, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/505/1264176.jpg', 'Winter in the Northern Lands', 11,'Frieren and her companions continue their journey through the northern lands, but obstacles both natural and manmade still stand in their way.',49);
insert into EPISODIO_ENTITY values (8198, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/505/1264251.jpg', 'A Real Hero', 12,'Deep in the mountains of the northern lands, Frieren and her party arrive at the Village of the Sword, where they have another job to do.',49);
insert into EPISODIO_ENTITY values (8199, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/505/1264252.jpg', 'Aversion to Ones Own Kind', 13,'While passing by a village in the woods of the northern lands, Frieren and party meet Sein, a gifted priest who is nonetheless corrupt enough to give even Heiter a run for his money. But what happened in his past?',49);
insert into EPISODIO_ENTITY values (8200, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/505/1264253.jpg', 'Privilege of the Young', 14,'The party arrives in a large and lively town with a bustling shopping district that Frieren once visited with Himmel, but something seems to have come up between Fern and Stark.',49);
insert into EPISODIO_ENTITY values (8201, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/505/1264254.jpg', 'Smells Like Trouble', 15,'When the party happens upon a town whose inhabitants are all mysteriously asleep, its time for their newest traveling companion to prove his mettle.',49);
insert into EPISODIO_ENTITY values (8202, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/505/1264255.jpg', 'Long-Lived Friends', 16,'Frieren pays a visit to Old Man Voll, a long-lived friend of hers, with traveling companions in tow.',49);
insert into EPISODIO_ENTITY values (8203, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/505/1264172.jpg', 'Take Care', 17,'Now that Sein finally has a lead on the whereabouts of his long-lost friend, is it time for him and Frierens party to part ways?',49);
insert into EPISODIO_ENTITY values (8204, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/505/1264256.jpg', 'First-Class Mage Exam', 18,'Frieren and party finally arrive in Äußerst, ready to undergo the first-class mage exam, and meet a number of colorful characters who are there to do the same.',49);
insert into EPISODIO_ENTITY values (8205, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/505/1264257.jpg', 'Well-Laid Plans', 19,'Frieren and her new teammates hatch a plan to capture a Stille - but are the other teams just going to stand by and let it happen?',49);
insert into EPISODIO_ENTITY values (8206, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/505/1264258.jpg', 'Necessary Killing', 20,'The first-class mage exam intensifies as fighting breaks out between the participants - and whats at stake might even be worth killing for.',49);
insert into EPISODIO_ENTITY values (8207, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/505/1264259.jpg', 'The World of Magic', 21,'Frieren, Kanne, and Lawine struggle with the 13th party over possession of the Stille, but therell be more surprises in store before their battle, and the first test, reach their conclusion.',49);
insert into EPISODIO_ENTITY values (8208, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/505/1264260.jpg', 'Future Enemies', 22,'After the conclusion of the first test, the exam participants have some time to kill in town. What do mages get up to on their days off?',49);
insert into EPISODIO_ENTITY values (8209, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/505/1264173.jpg', 'Conquering the Labyrinth', 23,'The aspiring first-class mages now face their second test: conquering the Ruins of the Kings Tomb. A simple task, or so the proctor claims, but theres a reason this particular dungeon remains unexplored.',49);
insert into EPISODIO_ENTITY values (8210, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/505/1264261.jpg', 'Perfect Replicas', 24,'Due to the Spiegel, a legendary monster that can create perfect replicas of others, the test-takers who would conquer the Ruins of the Kings Tomb must first face the ultimate enemy: themselves.',49);
insert into EPISODIO_ENTITY values (8211, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/506/1266902.jpg', 'A Fatal Vulnerability', 25,'A perfect imitation of Frieren stands between the test-takers and victory, but Fern believes she knows how to win. Is it time for the student to surpass the master?',49);
insert into EPISODIO_ENTITY values (8212, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/507/1269164.jpg', 'The Height of Magic', 26,'No hay resumen disponible',49);
insert into EPISODIO_ENTITY values (8213, 30, 'https://static.tvmaze.com/uploads/images/medium_landscape/508/1271992.jpg', 'An Era of Humans', 27,'With the second test behind them, only one remains - but first, Frieren and Fern need to settle an important matter in town. What awaits them in the third test?',49);
insert into EPISODIO_ENTITY values (8214, 30, 'https://static.tvmaze.com/uploads/images/medium_portrait/479/1198409.jpg', 'It Would Be Embarrassing When We Met Again', 28,'No hay resumen disponible',49);
insert into PARTICIPANTE_ENTITY values (591, 'In 2015, Saitō graduated from the Animation Department of the Manga Faculty of Seika University in Kyoto. He won Best Director for Bocchi the Rock! at the 2023 Newtype Anime Awards.', 'https://s4.anilist.co/file/anilistcdn/staff/large/n134254-bqcsuWzJr87n.png', 'Keiichirō Saitō');
