insert into PARTICIPANTE_ENTITY values (593, 'Kana Ichinose (December 20, 1996) is a seiyū from Hokkaido. She is affiliated with Sigma Seven e.1 She played her first leading role in 2018 as Ichigo in the anime Darling in the Franxx.', 'https://media.themoviedb.org/t/p/w500/3MmHWf5pa1i4s64T2mI6npc26TY.jpg', 'Kana Ichinose');
insert into SERIE_ENTITY_ACTORES values (49, 593);
insert into PARTICIPANTE_ENTITY values (594, 'Chiaki Kobayashi (Kanagawa Prefecture, Japan, June 4, 1994) is a Japanese voice actor, affiliated with Office Osawa. Some of his most notable roles include Hiroto Kuga in Gundam Build Divers Re:Rise, Tony Freyd in Kenja no Mago, Makoto Edamura in Great Pretender, Louis James Moriarty in Yūkoku no Moriarty, Langa Hasegawa in SK the Infinity, Yūichi Katagiri in Tomodachi Game, Gabimaru in Jigokuraku and Mash Burnedead in MASHLE.', 'https://media.themoviedb.org/t/p/w500/o0XZFXc50z28ICUpvfZ1QcTL2Yt.jpg', 'Chiaki Kobayashi');
